(21, 'Atressi·m pren com fai al jogador', 'BdT 10.12', 'Aimeric de Peguillan', 'Occitan', 'G', '38r-38v', 1, 1, '[\"C3 G a cha G a h c d cha c \'\\nC3 c h c dedh G a h cha ha a \'\\nC2 G a h h d hG aG FEF FED E\\nF \'F4 G a haG a ha h c dch ha\\nc \'C3 d e e d c h c d chc ha \'\\nC2 h c d ch aG F G a G FED E \'\\nC2F4 F G a a h c h a G \'C3 h\\nh c dc h a GF E \'C3F5 FG aG GFE\",\"C3 G a cha G a h c d cha c \'\\nC3 c h c dedh G a h cha ha a \'\\nC2 G a h h d hG aG FEF FED E \'F\\nF4 G a haG a ha h c dch ha \'c\\nC3 d e e d c h c d chc ha \'\\nC2 h c d ch aG F G a G FED E \'\\nC2F4 F G a a h c h a G\\nC3 h \'h c dc h a GF E\\nC3F5 FG aG GFE\"]', '[\"A-tres-si·m pren com fai al ju-ga-dor\\nc\'al co-me-zar jo-ga ma-e-stra-men\\na pe-tit joc, pois s\'es-chau-fa per-den\\nqe·l fai mon-tar tan q\'es en la fo-lor;\\nais-si mis eu pauc a pauc en la vi-a\\nq\'eu cu-ja-va a-mar ab ma-e-stri-a,\\nsi qe·m po-gues par-tir qan me vol-gues;\\ner sui en-traz tan qu\'es-sir non pos ges.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649d4\", \"custos\": \"[5,8,6,2,6,7,4,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(22, 'Cel que s\'irais ni guerrej\' ab amor', 'BdT 10.15', 'Aimeric de Peguillan', 'Occitan', 'G', '36v', 1, 1, '[\"C2 a c d e c de dch c dch a\\naGah \'C1F3 a GFE D E G G a ch a\\nG d \'C2 ch aG F G a h aGa F \'\\n[C2F4 F G aG FED E C FG F FED D] \'\\nF G \'C2F4 FE D F G F h a GFG a\\na c \'C3 d fed c haGF FG h a GFG F\\nF G FE D \'C2F4 E F GF ED DEDC F\\nF G FE \'C2F4 D ED C FG FE D FED\",\"C2 a c d e c de dch c dch a \'aGah\\nC1F3 a GFE D E G G a ch a \'G d\\nC2 ch aG F G a h aGa F \'\\n[C2F4 F G aG FED E C FG F FED D] \'\\nF G\\nC2F4 FE D F G F h a GFG a \'a c\\nC3 d fed c haGF FG h a GFG F \'F G FE D\\nC2F4 E F GF ED DEDC F \'F G FE\\nC2F4 D ED C FG FE D FED\"]', '[\"Cel qi s\'i-rais ni gue-re\' ab a-mor\\nges qe sa-vis non fai al meu sem-blan,\\ncar hom a tart pron de guerr\' e tost dan\\ne guer-ra fai tor-nar mal en pe-jor.\\nEn guer-ra trob, per q\'eu no la vol-ri-a,\\nvil-tat de mal e de ben ca-re-sti-a,\\ne fin\' a-mor, si-tot mi fai lan-guir,\\na tant de joi qe·m pot tost es-jau-zir.\"]', '[\"Notes: The text scribe makes a <i>saut du même au même</i> from line 3 to line 5. The music scribe corrects the error by adding line 4 at the bottom of the column.\\n<br>\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649d1\", \"custos\": \"[5,1,null,7,2,2,10,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(23, 'En amor trob alqes en qe·m refraing', 'BdT 10.25', 'Aimeric de Peguillan', 'Occitan', 'G', '37r-37v', 1, 1, '[\"C2 d c d a h G c a c \'C2 d\\nc a ahc(h) aGa F G \'C3 a h aGaha aG\\nd c d a h G \'C2F4 c a c d\\nc a ahc(h) aGa \'C2F4 F Ga FE D FE ED\\nFG \'C2F4 a GFE D FE DC FG FE D \'C2F4 FEDC D\\nF G ah(a) G c d a c \'C2F4 haG FGahaG a\\nc d fe ed c h c d \'C3F5 a haGaha aGF\\nF E F GaGFED FE DC FG \'C1 a F FGaGE FED\",\"C2 d c d a h G c a c\\nC2 d \'c a ahc(h) aGa F G\\nC3 a h aGaha aG \'d c d a h G\\nC2F4 c a c d \'c a ahc(h) aGa\\nC2F4 F Ga FE D FE ED \'FG\\nC2F4 a GFE D FE DC FG FE D\\nC2F4 FEDC D \'F G ah(a) G c d a c\\nC2F4 haG FGahaG a \'c d fe ed c h c d\\nC3F5 a haGaha aGF \'F E F GaGFED FE DC FG\\nC1 a F FGaGE FED\"]', '[\"En a-mor trob al-qes en qe·m re-fraing\\nq\'al meinz d\'a-mor mal al be no·m so-fraing,\\nni eu per mal no·m loing d\'a-mor ni·m fraing:\\non pus m\'au-ci, plus vas a-mor m\'a-fraing;\\nmas no co-nosc q\'a-mors vas mi s\'a-fra-inga\\nni eu d\'a-mor no ai po-der qe·m fra-inga\\nre no·m so-fraing sol c\'a-mor no·m so-fra-inga\\ncar ses a-mor no sai en qe·m re-fra-inga.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649d2\", \"custos\": \"[2,5,5,7,5,7,4,5,7,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
