 d cb a \'b G a ba G\"]', '[\"Qui la ve en ditz:\\npos Dyeus tant i mes\\nbes\\nen na Bi-a-tritz,\\nnon i es mer-ces\\nges;\\ncar tan gen noy-ritz\\nsos gays cors cor-tes\\nes\\nque sa-ra fal-litz\\ngautz que non l\'a-ges\\nres.\\nLi sieu dous e-sgartz\\nclars,\\nco-rals, dels gen-sors\\nflors\\nren-dri\' al par-lars\\ncars\\ngautz, tant es dou-sors.\\nPuesc l\'on-ratz on-rars\\npars,\\nqu\'es autz plus c\'o-nors\\nsors,\\nplaz, e·l cum-di-ars,\\ndars\\nno·m val tant d\'al-lors.\\nTant di-ri-a,\\nsi·n cre-si-a\\nde leys mon cor ian\\ntan,\\nqu\'e-ne-mi-a\\nm\'en se-ri-a\\nli bel-la can man\\nblan.\\nQue·m val-ri-a,\\nsia·n per-di-a\\nleys qu\'ieu am sens en-gan\\ntan?\\nqu\'ieu pen-ri-a\\ne m\'a-mi-a\\nde-stric e·l syeu dan\\ngran.\\nAnc de nul-la gen\\nnon fon a-tro-batz\\nnatz\\nque tan fi-na-men\\na-mes de-sa-matz.\\nFatz\\nsuy car non l\'a-ten\\nioy,\\nni no·m n\'es datz\\ngratz.\\nSe-gun fal-li-men\\nsay que suy sen-natz.\\nPatz\\ne vol-gra e s\'a-cort\\nfort,\\nsuy en engoy-sos\\nblos\\nsuy seus tot con-fort.\\nTort\\nn\'an gran sas fay-sons;\\nqu\'en luac de con-fort\\nport\\nal cor a-be-dos\\nsos\\nuelz. Ve·us le co-nort!\\nMort\\nm\'a le gentz re-spos,\\nque d\'a-man-sa\\nfes sem-blan-sa\\ncant son bel cor\\nvi,\\ner sens lan-sa,\\nque no·m lan-sa\\nsos uelhz que non ri\\nni\\nvol m\'on-ran-sa,\\nni m\'e-nan-sa,\\nan luan-na de si\\nmi.\\nSens dup-tan-sa\\nn\'a mer-man-sa\\ncar ay-si m\'au-si.\"]', '[\"\\n\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/canvas/f385\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 732, \"facsimileY\": 388, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"2