(39, 'Las grans beutatz e·ls fis ensenhamens', 'BdT 30.16', 'Arnaut de Maroill', 'Occitan', 'R', '52r', 1, 1, '[\"F3 a a h a G FE D EFG F(E) D\\nC D \'F3 E G a G FE D DC D\\na a h a G FE D EFG \'C1 F(E) D\\nC D E G a G FE D C DE\\nFED D E G \'F3 G ah ch a G aGFG FE\\nG a h a G F E D EFG FED \'F3 DC\\nC D E E E E FE D C DE\\nG a \'F3 F G E C DE FG FE FED //\",\"F3 a a h a G FE D EFG F(E) D \'C D\\nF3 E G a G FE D DC D \'a a h a G FE D EFG\\nC1 F(E) D \'C D E G a G FE D C DE \'FED D E G\\nF3 G ah ch a G aGFG FE \'G a h a G F E D EFG FED\\nF3 DC \'C D E E E E FE D C DE \'G a\\nF3 F G E C DE FG FE FED //\"]', '[\"Las grans beu-tatz e·ls fis en-se-nha-mens\\ne·ls ve-rais pretz e las bo-nas lau-zors\\ne·ls au-tres ditz e la fres-ca co-lors\\nque vos a-vetz, bo-na do-na va-len,\\nme do-nan genh de chan-tar e sci-en-sa,\\nmas gran pa-or m’o tol e gran te-men-sa\\nqu’ieu non aus dir, do-na, qu’ieu chant de vos,\\ne re no sai si m’er o dans o pros.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f117\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 678.5, \"facsimileY\": 1165, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 210, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(40, 'L\'enseignamens e.l pretz e la valors', 'BdT 30.17', 'Arnaut de Maroill', 'Occitan', 'R', '81r (LXXXIIIr)', 1, 1, '[\"F3 G G a a a h ch ah aG aGah\\nG a h aG G \'F3 E G E ED EFED DC\\nC D E G a a h c h aG a\\na \'F3 h a G E G F ED EF ED\\nD EF ED C \'F3 G G a G GF E\\nE F ED C D E F ED \'F3 ED D\\na h c d ch aG a haG a\",\"F3 G G a a a h ch ah aG aGah \'G a h aG G\\nF3 E G E ED EFED DC \'C D E G a a h c h aG a \'a\\nF3 h a G E G F ED EF ED \'D EF ED C\\nF3 G G a G GF E \'E F ED C D E F ED\\nF3 ED D \'a h c d ch aG a haG a\"]', '[\"L’en-se-nha-mens e∙l pretz e la va-lor\\nde vos, do-na, que so-plei nueg e di-a\\nan si mon cors dug de be-la pa-ri-a\\ncom pus me duelh ieu chant e m’es-bau-dey\\ne pus A-mors mos-tra tant sos po-ders\\nvas mi tot sol, car mi tro-ba li-al,\\nno∙m es-fors con-tra luy mon sa-bers.\\n\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f175\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 76, \"facsimileY\": 175, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(41, 'Mout eron dous mei consir', 'BdT 30.19', 'Arnaut de Maroill', 'Occitan', 'G', '33r', 1, 1, '[\"F4 D C D E FG FED DC\\nC D FE \'F4 DE C D\\nF G a GF E FG FED \'F3 DC\\nC D F G a ah aGF GF \'\\nF4 F G a D FG F FED DC\\nC D \'F3 FG FED C D\\na cd chaG ahc haG GF \'\\nF3 F Ga GF DC D F\\nF G a \'C1F3 ah aG a D-FEDC\\nF GF GaG FE DE C D-D \",\"F4 D C D E FG FED DC \'C D FE\\nF4 DE C D \'F G a GF E FG FED\\nF3 DC \'C D F G a ah aGF GF \'\\nF4 F G a D FG F FED DC \'C D\\nF3 FG FED C D \'a cd chaG ahc haG GF \'\\nF3 F Ga GF DC D F \'F G a\\nC1F3 ah aG a D-FEDC \'F GF GaG FE DE C D-D \"]', '[\"Molt e-ra·m dolz mei con-ssir\\ne ses tot mar-ri-men\\nqan la bel-la ab lo cor gen,\\nhu-mils, franq\' e de bon ai-re\\nme diz de s\'a-mor es-trai-re\\ndon eu no·m posc par-tir;\\ne pos ill no·m re-te\\nni·ll aus cla-mar mer-ce,\\ntoz so-laz mi son es-traing\\npos de leis jois mi so-fraign.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649c0\", \"custos\": \"[9,9,5,7,5,3]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(42, 'Si·m destreignetz, domna, vos et amors', 'BdT 30.23', 'Arnaut de Maroill', 'Occitan', 'R', '79r (LXXXIr)', 1, 1, '[\"C3 e e e ed defed h c h ha aG\\nd e h \'C2 c h a G a C2 h aG GF\\nF E F G C1 E C \'F3 D E D C\\nC3 f g f ed e f e d dc hah\\nG \'C4 a ah G h d d d cha h\\nd a ah d e e e f \'C3 edc dcde\\nf g fed dh d d h G cha aG \",\"C3 e e e ed defed h c h ha aG \'d e h\\nC2 c h a G a C2 h aG GF \'F E F G C1 E C\\nF3 D E D C \'C3 f g f ed e f e d dc hah \'G\\nC4 a ah G h d d d cha h \'d a ah d e e e f\\nC3 edc dcde \'f g fed dh d d h G cha aG \"]', '[\"Si·m des-tre-nhetz, Do-na, vos ez A-mors\\nc’a-mar no·us aus ni no m’en puesc es-trai-re:\\nl’us m’en-cau-sa, l’au-tre·m fay re-ma-ner;\\npre-gar no·us aus per en-ten-dre jau-zir,\\nmais si co selh qu’es n’a-fratz per mu-rir\\nsap que mortz es em-pe-ro si·s com-bat,\\nvos clam mer-ce ab cor des-es-pe-rat.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f171\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 230, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(43, 'A chantar m\'es al cor que non deurie', 'BdT 46.2', 'Beatriz de Dia', 'Occitan', 'W', '204r-v', 1, 1, '[\"C1 a a(G) F FG a G F(G) FE \'C1 D FED E\\nC D E FG a(G) \'C1 FED C DE F EDC-D\\na a(G) F FG a \'C1 G F(G) FE D FED E\\nC D E FG a(G) FED \'C1 C DE F EDC D\\na a a(h) a G a G FED \'C1 E F\\nF F a c h a G FE D FED E \'\\nF2 C D E FG a(G) FED C DE F EDC D \",\"C1 a a(G) F FG a G F(G) FE\\nC1 D FED E \'C D E FG a(G)\\nC1 FED C DE F EDC-D \'a a(G) F FG a\\nC1 G F(G) FE D FED E \'C D E FG a(G) FED\\nC1 C DE F EDC D \'a a a(h) a G a G FED\\nC1 E F \'F F a c h a G FE D FED E \'\\nF2 C D E FG a(G) FED C DE F EDC D \"]', '[\"A chan-tar m\'es al cor que non deu-ri-e\\ntant mi ran-cur ce-le_a qui sui a-migs\\net si l\'am mais que nu-le ren qui si-e\\nnon mi val ren bel-tat ni cur-te-si-e\\nne ma bon-taz ne mon pres ne mon sen:\\nal-tre-si sui en-ga-na-de_et tra-gi-de\\nqu\'e-us-se fait vers lui de-sa-vi-nen-ce.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/canvas/f423\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 474, \"facsimileY\": 1107, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(44, 'Ab la fresca clardat', 'BdT 47.1', 'Berenguier de Palazol', 'Occitan', 'R', '37r', 1, 1, '[\"C3 e f g f ed h\\nc h C2F4 a GFG a h\\nc d d d \'C2F4 h ch\\na G a haGF G a\\na h(a) GF G Ga h\\nc d d e \'C3 fg fdh\\nc ha C2 aG G aG ahchaG\\na h c c a ch aG\\nC3 d d d e \'C3 f gfed h\\nc ha F2 E D E GF \",\"C3 e f g f ed h \'c h C2F4 a GFG a h \'c d d d\\nC2F4 h ch \'a G a haGF G a \'a h(a) GF G Ga h \'c d d e\\nC3 fg fdh \'c ha C2 aG G aG ahchaG \'a h c c a ch aG \'C3 d d d e\\nC3 f gfed h \'c ha F2 E D E GF \"]', '[\"Am la fres-ca clar-tat\\nque·m mou del tems se-re,\\ndo-na, e ab l’es-tars\\nque re-no-ve-l’e ve\\nay tot mon cor pau-zat\\nen la vos-tra mer-ce,\\ne car tant ay es-tat\\nque ve-zer no·us vo-li-a,\\nsi la col-pa es mi-a,\\net yeu m’o ay com-prat. \\n\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f87\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 787, \"facsimileY\": 242, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 250, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(45, 'Aital domna com eu sai', 'BdT 47.3', 'Berenguier de Palazol', 'Occitan', 'R', '37v', 1, 1, '[\"C1 a a GF F G aGF FE\\nF Ga FEDC D EFG FED D\\na a \'F3 GF F G aGF FE\\nF Ga FEDC D EFG F2 FED D\\nF C1 G aG GF a cdc \'C1 a aFEDC DE F\\na c d ca-aFED F GFG a D FED DC\\nC D \'F3 E FEDC E G aGFE DC DE FG a\\nDEF ED D C E Ga GFE DC \'F3 DE GF ED\",\"C1 a a GF F G aGF FE \'F Ga FEDC D EFG FED D \'a a\\nF3 GF F G aGF FE \'F Ga FEDC D EFG F2 FED D \'F C1 G aG GF a cdc\\nC1 a aFEDC DE F \'a c d ca-aFED F GFG a D FED DC \'C D\\nF3 E FEDC E G aGFE DC DE FG a \'DEF ED D C E Ga GFE DC\\nF3 DE GF ED\"]', '[\"Ai-tal dom-na co yeu say,\\nri-ca de be-las fay-ssos,\\nab cors co-vi-nen e jay,\\nab ditz pla-zen-tiers e bos,\\nsi vol-gues precx ni de-man-da so-frir,\\nde-gram on-rar, car te-ner e ser-vir,\\nque no·y falh res qu’en bo-na do-na si-a,\\nmas car A-mors y pert sa se-nho-ri-a.\\n\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f88\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 16, \"facsimileY\": 816, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(46, 'Bona domna, cui rics pretz fai valer', 'BdT 47.4', 'Berenguier de Palazol', 'Occitan', 'R', '36v-37r', 1, 1, '[\"F3 b} a aG FF(G) c b a b(a) G F G\\nd d c d F4 d e f \'C2F4 ed e dc d\\nd d c d d e f e d hh(a) h\\nG a \'F4 F G a c a h G G\\nE G F3 F D G G h G \'F3 a c\\nF4 c d e f e d e d h c\\nc d e \'F4 f e d e d ch c\\na c h d c ha h aG \'F4 a F G aha G\",\"F3 b} a aG FF(G) c b a b(a) G F G \'d d c d F4 d e f\\nC2F4 ed e dc d \'d d c d d e f e d hh(a) h \'G a\\nF4 F G a c a h G G \'E G F3 F D G G h G\\nF3 a c \'F4 c d e f e d e d h c \'c d e\\nF4 f e d e d ch c \'a c h d c ha h aG\\nF4 a F G aha G\"]', '[\"Bo-na do-na, cui ric pretz fa va-ler\\nso-bre las pus va-lens, al meu ve-jay-re,\\na-vetz ra-zon per que·m de-nhatz es-tray-re\\nlo bel sem-blan e·l a-mo-ros pla-zer,\\nsi no car anc vos au-zey far sa-ber\\nque·us a-ma-va mil ai-tans mays que me?\\nEn a-quest tort m’a-tro-ba-retz jas-se,\\ncar non es tortz que ja·us po-gues de tant des-fay-re.\\n\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f86\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 881, \"facsimileY\": 1504, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(47, 'De la gensor qu\'om vej\' al meu semblan', 'BdT 47.5', 'Berenguier de Palazol', 'Occitan', 'R', '37r', 1, 1, '[\"F3 d d h cc(d) h ha GF G a h\\nh \'F3 c a h G a h c ha aG\\nd d h cc(d) h ha GF \'F3 G a h\\nh c a h G a h c ha aG\\nC2 d \'F4 h c d d e fd e c c\\nc e f g C3 f e \'C3 d e c dedh\\nc ha C2 G F G a h c ha aG\",\"F3 d d h cc(d) h ha GF G a h \'h\\nF3 c a h G a h c ha aG \'d d h cc(d) h ha GF\\nF3 G a h \'h c a h G a h c ha aG \'C2 d\\nF4 h c d d e fd e c c \'c e f g C3 f e\\nC3 d e c dedh \'c ha C2 G F G a h c ha aG\"]', '[\"De la jen-sor c’om vei’, al meu sem-blan,\\ndon nueg e jorn velh e pes e cos-sir,\\nm’er a lu-nhar si·l cor mi vol se-guir,\\nab tal a-cort qu’ieu mays no·l torn de-nan,\\ncar lon-ja-men m’a ten-gut de-zi-ran\\nab bel sem-blan, mays tan dur mi res-pon\\nc’anc jorn no·m volc precx ni de-mans su-frir.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f87.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 154, \"facsimileY\": 655, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(48, 'Domna, la gensor qu\'om veja', 'BdT 47.6', 'Berenguier de Palazol', 'Occitan', 'R', '37v', 1, 1, '[\"C2 c d e f e d e c\\nd h c a h c haG\\nc d \'C2 e f d ec de\\nC3 e g f e de f ed dc\\nd h c a h \'C3 cha aG\\nc d e e f de cde\\ne g f e de fed c \'\\nC3 d h G a hdc chah c\",\"C2 c d e f e d e c \'d h c a h c haG \'c d\\nC2 e f d ec de \'C3 e g f e de f ed dc \'d h c a h\\nC3 cha aG \'c d e e f de cde \'e g f e de fed c \'\\nC3 d h G a hdc chah c\"]', '[\"Do-na, la jen-ser c’om ve-ya,\\nsay, del bel a-cu-lhi-men,\\na-gra-di-v’a to-ta gen,\\nmas trop te-non gran en-ve-ya\\nsilh que de-zi-ron jau-zir,\\ncar us no pot con-se-guir\\nditz que so qu’en cuy-d’a-ver\\nco-ras que la torn ve-zer.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f88.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 217, \"facsimileY\": 447, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(49, 'Tan m\'abelis joys et amors e chans', 'BdT 47.11', 'Berenguier de Palazol', 'Occitan', 'R', '37v', 1, 1, '[\"C2 G h c d d e f e d eed\\nh d e d-c \'C2 h a h G h dc d\\nd d C3 e g f e d e f ed dc \'\\nC1 G a h c h a h a F G\\nc h a \'C1 G h c d c h d\\nC2 d e f g C3 f \'C3 e d e c dedh\\nG a h c h a h a G a\",\"C2 G h c d d e f e d eed \'h d e d-c\\nC2 h a h G h dc d \'d d C3 e g f e d e f ed dc \'\\nC1 G a h c h a h a F G \'c h a\\nC1 G h c d c h d \'C2 d e f g C3 f\\nC3 e d e c dedh \'G a h c h a h a G a\"]', '[\"Tant m’a-be-lis joys e a-mors e chans,\\ne a-le-grier, de-port e cor-te-zi-a,\\nque·l mon non a ar-gen ni ma-nen-ti-a\\ndon mielhs d’ai-so·m ten-gues per be-ne-nans;\\ndoncx, soi yeu be que mi-dons ten las claus\\nde totz los bes qu’ieu a-ten ni es-per,\\nque res d’ay-so ses lieys non puesc a-ver.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f88.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 878, \"facsimileY\": 174, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(50, 'Ab ioi mou lo vers e·l començ', 'BdT 70.1', 'Bernart de Ventadorn', 'Occitan', 'G', '9v', 1, 1, '[\"F4 F F F F EDC D E F\\nE \'F4 F G E F(E) DCD DEFEC C\\nE F G E F \'F3 EDC E F\\nE F G a GFE F GF \'C2F4 F\\na h a G a h a GF\\nG \'C1F3 a G E F G GFED EFEC\\nE F a G a \'C2F4 h c aGF a GahaG\\nC D E FG a \'C2F4 F G EC DE GaGF \",\"F4 F F F F EDC D E F \'E\\nF4 F G E F(E) DCD DEFEC C \'E F G E F\\nF3 EDC E F \'E F G a GFE F GF\\nC2F4 F \'a h a G a h a GF \'G\\nC1F3 a G E F G GFED EFEC \'E F a G a\\nC2F4 h c aGF a GahaG \'C D E FG a\\nC2F4 F G EC DE GaGF \"]', '[\"Ab ioi mou lo vers e·l co-menç,\\net ab ioi re-man e fe-nis;\\ne sol qe bo-na fos la fis,\\nbons sai q’er lo co-men-ça-menz.\\nPer la bo-na co-men-çan-ça\\nme ven iois et a-le-gran-ça;\\nper zo deu om la bo-na fin gra-çir,\\nqe toç bons faiç vei lau-çar al fe-nir.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064951\", \"custos\": \"[7,8,5,5,null,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
