(51, 'Ab joi muou lo vers e·l comens', 'BdT 70.1', 'Bernart de Ventadorn', 'Occitan', 'R', '57r', 1, 1, '[\"C1F3 E F G E FF(E) DD(C) CDE F\\nE F G \'F3 a G E FG F\\nE F G E FE DC C CDE F\\nE F G a G \'F3 FE FG F\\na a a G a h aG GF\\nF a G E F G GGFED EC \'\\nF3 F F a G a h cc(h) aGF a ahchG\\nC D E G a F \'F3 GF ED E GF \",\"C1F3 E F G E FF(E) DD(C) CDE F \'E F G\\nF3 a G E FG F \'E F G E FE DC C CDE F \'E F G a G\\nF3 FE FG F \'a a a G a h aG GF \'F a G E F G GGFED EC \'\\nF3 F F a G a h cc(h) aGF a ahchG \'C D E G a F\\nF3 GF ED E GF \"]', '[\"Ab joi muou lo vers e·l co-mens\\net ab joi re-man e fe-nis;\\net ab que bo-na si-a la fis,\\nbos crey qu’er lo co-men-sa-mens.\\nPer la bo-na co-men-san-sa\\nmi don joi et a-le-gran-sa;\\nper so deu hom la bo-na fin gra-zir,\\ncar totz bos faitz aug lau-zar al fe-nir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f127.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 861, \"facsimileY\": 1126, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(52, '[A]mors, e que·us es veiaire?', 'BdT 70.4', 'Bernart de Ventadorn', 'Occitan', 'R', '56v', 1, 1, '[\"F2 C C C D F FE DEFED DC\\nC D F FE D DC \'F2 D\\nD D C D F FE D EFED DC\\nC D F FE D DC E \'\\nF2 G F E F G FED EFED DC\\nC D F FE D C DCH\\nH C D C \'F2 ED C\\nHC D E FG F FE FEDC \",\"F2 C C C D F FE DEFED DC \'C D F FE D DC\\nF2 D \'D D C D F FE D EFED DC \'C D F FE D DC E \'\\nF2 G F E F G FED EFED DC \'C D F FE D C DCH \'H C D C\\nF2 ED C \'HC D E FG F FE FEDC \"]', '[\"[A]-mors, e que·us es ve-iai-re?\\nTro-batz pus fol mas can mi?\\nQue cu-iatz vos qu’ieu si’ a-mai-re\\ne que ja noi truep mer-ce?\\nQue que·m co-man-detz a fai-re,\\nfa-rai o, c’ai-si·s co-ve;\\ne vos no·m  faitz ges be\\nque·m faitz tot jorn mal-trai-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f126.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 227, \"facsimileY\": 1620, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(53, 'Ara·m conseillatz seignor', 'BdT 70.6', 'Bernart de Ventadorn', 'Occitan', 'G', '13v', 1, 1, '[\"C3 F G G G G a G\\na \'C2 b a G F G EDE\\nC E F G \'C2 G a G\\na _h a G F G(F) ED \'\\nC2 E F G G E F D\\nE F G \'C1 E F EDC C\\nC E G F \'C1 G a hc\\nh a G a \'C2 GE F GahaG\",\"C3 F G G G G a G \'a\\nC2 b a G F G EDE \'C E F G\\nC2 G a G \'a _h a G F G(F) ED \'\\nC2 E F G G E F D \'E F G\\nC1 E F EDC C \'C E G F\\nC1 G a hc \'h a G a\\nC2 GE F GahaG\"]', '[\"A-ra·m con-se-illaz seig-nor\\nvos q\'a-veç sa-ber e sen\\nc\'u-na don-na·m det s\'a-mor\\nc\'ai a-ma-da lon-ga-men,\\nmas e-ra sai de ver-tat\\nqu\'il a al-tr\'a-mic pri-vat\\net anc de null con-pa-gnon\\ncom-pa-gna tan greus no·m fo.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064964\", \"custos\": \"[6,6,8,8,4,4]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(54, 'Ar m’acosselhatz, senhors', 'BdT 70.6', 'Bernart de Ventadorn', 'Occitan', 'R', '57v', 1, 1, '[\"F3 E F G F G a G\\na h a G F G FED \'\\nF3 E F G F G(F) a G\\na h a G F G FED\\nE F G FED \'F3 DEF EDC C\\nE F G FED DEF EDC C\\nE F G F G G GabaGF \'\\nF3 a G F G FED E GF \",\"F3 E F G F G a G \'a h a G F G FED \'\\nF3 E F G F G(F) a G \'a h a G F G FED \'E F G FED\\nF3 DEF EDC C \'E F G FED DEF EDC C \'E F G F G G GabaGF \'\\nF3 a G F G FED E GF \"]', '[\"Ar m’a-cos-se-lhatz, se-nhors,\\nvos c’a-vetz va-lor e sen.\\nU-na do-na·m det s’a-mor,\\nc’ay a-ma-da lon-ja-men.\\nMais e-ras say per ver-tat\\nque fay au-tr’a-mic pri-vat,\\ne anc de nulh com-pa-nho\\ncom-pa-nha tan greu no·m fo.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f128.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 259, \"facsimileY\": 102, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(55, 'Era non vei luzir solleill', 'BdT 70.7', 'Bernart de Ventadorn', 'Occitan', 'G', '17r', 1, 1, '[\"F4 D D C E G FE DC E\\nE G \'F4 G a F a GF E\\nF a G a F a \'F4 GF ED\\nC D E E E E FED \'F3 EFG\\nG a h c haG a ha GF\\na c \'F4 h c a F GF ED\\nFED C E \'F3 G F E G aGF\\nE F G F \'F3 ED F EDDC D\",\"F4 D D C E G FE DC E \'E G\\nF4 G a F a GF E \'F a G a F a\\nF4 GF ED \'C D E E E E FED\\nF3 EFG \'G a h c haG a ha GF \'a c\\nF4 h c a F GF ED \'FED C E\\nF3 G F E G aGF \'E F G F\\nF3 ED F EDDC D\"]', '[\"E-ra non vei lu-zir so-lleill,\\ntan m’en son es-cur-çit li rai;\\ne ges per ai-cho no m\'es-mai,\\nc’u-na clar-taz me sol-leil-la\\nd’a-mor, q’inz el cor mi ra-ia;\\ne qant al-tra genz s’es-ma-ia,\\neu meil-lor a-banz qe sor-dei,\\nper que mos chanz no sor-de-ia.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064975\", \"custos\": \"[6,6,8,2,6,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(56, 'Eras no vei luzir solelh', 'BdT 70.7', 'Bernart de Ventadorn', 'Occitan', 'R', '57r', 1, 1, '[\"F3 a G F a a G F a\\na c c d d c \'C2 dch a\\nd c h a d c h a\\nah G h ch a G ahaG \'C2 ah\\nh c d d c h dd(c) c\\ne d c h a hcd ch a \'\\nC2 a h G ah a h dcha\\nc h a aa(G) G a \'C2 ahch hG \",\"F3 a G F a a G F a \'a c c d d c\\nC2 dch a \'d c h a d c h a \'ah G h ch a G ahaG\\nC2 ah \'h c d d c h dd(c) c \'e d c h a hcd ch a \'\\nC2 a h G ah a h dcha \'c h a aa(G) G a\\nC2 ahch hG \"]', '[\"E-ras no vei lu-zir so-lelh,\\ntan me son es-clar-zit li ray;\\ne ges per ais-so no·m es-may,\\nc’u-na clar-dat me so-le-lha\\nd’a-mors, que al cor mi ra-ya;\\ne, cant au-tra gen s’es-ma-ia,\\nyeu me-lhur qui que sor-dei,\\nper que mos chans no·s sor-de-ya.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f127.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 143, \"facsimileY\": 319, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(57, 'Ere non ve luisir soleill', 'BdT 70.7', 'Bernart de Ventadorn', 'Occitan', 'W', '190r', 1, 1, '[\"C2 F G G ah c(b) aGF FG a\\na \'C2b} c c d cb c dcb ba\\nc \'C2b} e dcb cd b cd c(b) aGa\\nF G a a \'C2 a b} a baG ahc\\nc d e f edc d ed dch\\nd \'C3 f e def d c c(h) aGa\\nbaG F Ga c \'C2b} b a c ddcb\\na h c a G \'C2b} a baGF G\",\"C2 F G G ah c(b) aGF FG a \'a\\nC2b} c c d cb c dcb ba \'c\\nC2b} e dcb cd b cd c(b) aGa \'F G a a\\nC2 a b} a baG ahc \'c d e f edc d ed dch \'d\\nC3 f e def d c c(h) aGa \'baG F Ga c\\nC2b} b a c ddcb \'a h c a G\\nC2b} a baGF G\"]', '[\"E-re non ve lui-sir so-leill,\\ntant mi sunt os-cu-rei lou rai;\\net gins per ai-co non m’es-mai,\\nc’u-ne clar-tas mi so-leil-le\\nd’a-mor, qui al cor mi ra-ie;\\net, quan l’al-tre gens s’es-ma-ie,\\net meil-lor a-baus que sor-dei,\\nper que mon chant non sor-de-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f395.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 591, \"facsimileY\": 475, \"Annotations\": true, \"FontSizeOld\": 15, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 200, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(58, 'A! tantas bonas chansos', 'BdT 70.8', 'Bernart de Ventadorn', 'Occitan', 'R', '58r', 1, 1, '[\"C1 c h a G a hG G\\na F G FED E \'F3 FD D\\nD E F G ahaG FG a\\nc dc haG F G a aG \'\\nF3 c h a c d G ahaG GF\\nF G a h a G aGFG FE \'\\nF3 F E D D E F GahaGF Ga\\nc dc haG F G a haGa G \",\"C1 c h a G a hG G \'a F G FED E\\nF3 FD D \'D E F G ahaG FG a \'c dc haG F G a aG \'\\nF3 c h a c d G ahaG GF \'F G a h a G aGFG FE \'\\nF3 F E D D E F GahaGF Ga \'c dc haG F G a haGa G \"]', '[\"A! tan-tas bo-nas chan-sos\\ne tan bos vers au-rai fagz,\\ndon ja no·mz me-zer’ en plag,\\ndo-na, si·m pes-ses de vos\\nque fos-ses vas mi tan du-ra.\\nA-ras sai qu’e·us ai per-du-da!\\nMas si-vals no m’es tol-gu-da\\na la mi-a for-fay-tu-ra.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f129.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 136, \"facsimileY\": 1517, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(59, 'Be m\'an perdut lai enves Ventadorn', 'BdT 70.12', 'Bernart de Ventadorn', 'Occitan', 'G', '14r', 1, 1, '[\"C2 G G D F F G D FE D \'C2 C\\nD DC H C D FE D FE \'C1F3 D DCH C\\nG G D F F G D \'C1F3 FE D C\\nD DC H C D FE \'F2 D FE DE DCH C\\nDE DCD CH C \'F2 D FE DC F Ga GF\\nG a ha aG \'F2 G FE D FE DE DCH C\\nDE DC H C \'F3 D FE D FE DE DCH C\",\"C2 G G D F F G D FE D\\nC2 C \'D DC H C D FE D FE\\nC1F3 D DCH C \'G G D F F G D\\nC1F3 FE D C \'D DC H C D FE\\nF2 D FE DE DCH C \'DE DCD CH C\\nF2 D FE DC F Ga GF \'G a ha aG\\nF2 G FE D FE DE DCH C \'DE DC H C\\nF3 D FE D FE DE DCH C\"]', '[\"Ben m’an per-out lai en-ves Ve-ta-dorn\\ntuit mei a-mis, pos ma dom-na no m’a-ma;\\net es ben dreiz qe ja-mais lai no torn,\\nc’a-des es-ta vas mi sal-vaz’ e gra-ma.\\nVez per qe·m fai sen-blan i-raz e morn:\\ncar en s’a-mor mi de-leiz e·n so-jorn! \\nNi de ren als no·s ran-cu-ra ni·s cla-ma.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064965\", \"custos\": \"[10,9,5,5,5,2,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(60, 'Be m’an perdut en lay ves Ventadorn', 'BdT 70.12', 'Bernart de Ventadorn', 'Occitan', 'R', '57r', 1, 1, '[\"C2F4 d dcc(h) a c d fed ch ch ha haG\\na \'F4 haG FG a h ch aG ahch a hhaGF G\\nd dcc(h) a c d fed \'C2F4 ch ch ha haG\\na haG FG a h ch aG ahch a hhaGF Gah\\nh \'C2F4 ch ha aG a ahch a haF G a\\na h c d e fed ch \'F4 h ch cha aG\\na haG FG a h ch aG ahch a haGF G \",\"C2F4 d dcc(h) a c d fed ch ch ha haG \'a\\nF4 haG FG a h ch aG ahch a hhaGF G \'d dcc(h) a c d fed\\nC2F4 ch ch ha haG \'a haG FG a h ch aG ahch a hhaGF Gah \'h\\nC2F4 ch ha aG a ahch a haF G a \'a h c d e fed ch\\nF4 h ch cha aG \'a haG FG a h ch aG ahch a haGF G \"]', '[\"Be m’an per-dut en lay ves Ven-ta-dorn\\ntug miei a-mic, pus ma do-na no m’a-ma;\\nnon ay ra-zon que ieu ja-mays lai torn\\ntant es vas mi bra-va e no·s re-la-ma.\\nTot jorn me fai sem-blar i-rat e morn\\ncar en s’a-mor mi de-li-eg e·m so-jorn,\\ne de res als no·s ran-cu-ra ni·s cla-ma.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f127.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 138, \"facsimileY\": 1287, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(61, 'Conort, era sai [...] be', 'BdT 70.16', 'Bernart de Ventadorn', 'Occitan', 'G', '20r', 1, 1, '[\"C1F3 C D E F F FED\\nE F G \'F3 F E D CDEFED\\nH C D D D EDC \'C1F3 D\\nD E F E D C FEDC \'\\nF3 C D F F F F FED\\nE F G F E \'F3 D CDEFED\\nH C D D EDC D\\nD E \'F3 F EDC D E FED C \",\"C1F3 C D E F F FED \'E F G\\nF3 F E D CDEFED \'H C D D D EDC\\nC1F3 D \'D E F E D C FEDC \'\\nF3 C D F F F F FED \'E F G F E\\nF3 D CDEFED \'H C D D EDC D \'D E\\nF3 F EDC D E FED C \"]', '[\"Co-nort, e-ra sai ben\\nqe ges de mi no pen-saz,\\npos sa-luz ni\' [a]-mis-taz\\nni mes-sa-ges no m\'en ven.\\nTrop au-rai fait lonc a-ten,\\net es ben sem-blanz oi-mai\\nq\'eu chaz zo q\'al-tre pren,\\npos non m\'a-ven a-ven-tu-ra. \"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064991\", \"custos\": \"[5,7,8,7,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(62, 'Conortz, era sai eu be', 'BdT 70.16', 'Bernart de Ventadorn', 'Occitan', 'R', '57v', 1, 1, '[\"F3 G a c c c c cha\\nh c d c h \'F3 a Gaha\\nF G a a a a a\\nG a h ch a GF \'ahG\\nG a c c c c ch\\nh c d c h a \'F3 Gaha\\nF G a a a a a\\nG a h \'F3 ch a GF a ahchG\",\"F3 G a c c c c cha \'h c d c h\\nF3 a Gaha \'F G a a a a a \'G a h ch a GF\\nahG \'G a c c c c ch \'h c d c h a\\nF3 Gaha \'F G a a a a a \'G a h\\nF3 ch a GF a ahchG\"]', '[\"Co-nortz, a-ras say yeu be\\nque vos de me non pen-satz,\\nque sa-lutz ni a-mis-tatz\\nni mes-sa-tges no m’en ve.\\nBe sai trop fas lonc a-ten,\\ne er be sem-blans huey may\\nque so qu’ieu cas au-tre pren,\\npus no m’en ven a-ven-tu-ra.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f128.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 1008, \"facsimileY\": 270, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(63, 'In consirer et en esmai', 'BdT 70.17', 'Bernart de Ventadorn', 'Occitan', 'G', '19r', 1, 1, '[\"C1F3 G G C E D C H DE\\nFED C \'C1F3 E D E DCH DE C\\nG G C E \'C1F3 D C H DE\\nFED C E D EDC DE C \'C2F4 C\\nE F E DE C E F G\\nG a \'F4 h a GF a GF G\\nG h c haG F G \'F4 FED E\\naGFE GFE D FG a GFG a GFE\",\"C1F3 G G C E D C H DE \'FED C\\nC1F3 E D E DCH DE C \'G G C E\\nC1F3 D C H DE \'FED C E D EDC DE C\\nC2F4 C \'E F E DE C E F G \'G a\\nF4 h a GF a GF G \'G h c haG F G\\nF4 FED E \'aGFE GFE D FG a GFG a GFE\"]', '[\"In con-si-rer et en es-mai\\nsui d\'un\' a-mor qi·m laça e·m te\\nqe tan no vai ni ça ni lai\\nq\'a-des non te-gna en so fre,\\nq\'e-ra m\'a dat cor e ta-len\\nq\'eu en-qe-ses, si po-di-a,\\ntal qe, si·l reis l\'en-qe-ri-a,\\nau-ri-a faiz gran ar-di-men. \"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064979\", \"custos\": \"[6,7,null,4,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(64, 'Estat ai com hom esperdutz', 'BdT 70.19', 'Bernart de Ventadorn', 'Occitan', 'W', '195r', 1, 1, '[\"C3 h c dee(d) dc h c dedc c\\nc \'C3 d e ee(d) dc de fefed e\\ne f g(f) ede \'C3 f e ee(d) dc\\nd e c d cha h cdee(d) \'C3 dc\\ne ee(d) dc d cha ahc hh(a) aG\\nG a \'C3 h c d e ee(d) dc\\ne f e d e fgf \'C3 dc cha\\nh c a hchG a h dcdee(d) dc\",\"C3 h c dee(d) dc h c dedc c \'c\\nC3 d e ee(d) dc de fefed e \'e f g(f) ede\\nC3 f e ee(d) dc \'d e c d cha h cdee(d)\\nC3 dc \'e ee(d) dc d cha ahc hh(a) aG \'G a\\nC3 h c d e ee(d) dc \'e f e d e fgf\\nC3 dc cha \'h c a hchG a h dcdee(d) dc\"]', '[\"Ma dos-ne fu al co-men-car\\nfran-che_et de bo-ne con-pai-gne;\\nper que ieu m’en dei mais la-var,\\nque se·l fust fel ne es-trai-gne;\\nben es dreis que dos-na frai-gne\\nvers ce-lui qui l’a cor d’a-mar.\\nQue se·l fait son a-mi pre-gar,\\ndreis es qu’a-mis li sou-frai-gne.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f405.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 57, \"facsimileY\": 1147, \"Annotations\": true, \"FontSizeOld\": 16, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 200, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(65, 'La dossa votz ai auzida', 'BdT 70.23', 'Bernart de Ventadorn', 'Occitan', 'R', '57v', 1, 1, '[\"F3 F G a a h a GFG a\\nF G a F G FED F G \'\\nF3 F G a a h a GFG a\\nF G a h a G FG-a\\nc c \'F3 a h c a Gaha GF\\nF a F ahc ha GF GaGE F\\nF G a h G \'F3 ah ch\\na G a F G D EFGF FE\",\"F3 F G a a h a GFG a \'F G a F G FED F G \'\\nF3 F G a a h a GFG a \'F G a h a G FG-a \'c c\\nF3 a h c a Gaha GF \'F a F ahc ha GF GaGE F \'F G a h G\\nF3 ah ch \'a G a F G D EFGF FE\"]', '[\"La dos-sa votz ai au-zi-da\\ndel ros-si-nho-lhet sal-vat-ge,\\nque m’es dins lo cor sa-lhi-da,\\nsi que tot lo cos-si-rier\\ne·l mal tratz c’a-mors me do-na,\\nme le-vi-a e m’as-sa-zo-na;\\ne au-ri-a·m be mes-tier\\nau-tre joi a mon dam-pna-tge.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f128.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 308, \"facsimileY\": 906.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(66, 'La dolce voiz ai oide', 'BdT 70.23', 'Bernart de Ventadorn', 'Occitan', 'X', '89r', 1, 1, '[\"F3 F G a a a aF G Ga\\nF G a GF G F EDDE F\\nF G a h cd \'F3 G aha aG\\nF G a a a haG ah\\ncd c a h c a cha aG\\na h \'F3 G ah c aF G GF\\nF G a ah G ah cha\\nF G a F G \'F2 ED DEFE ED\",\"F3 F G a a a aF G Ga \'F G a GF G F EDDE F \'F G a h cd\\nF3 G aha aG \'F G a a a haG ah \'cd c a h c a cha aG \'a h\\nF3 G ah c aF G GF \'F G a ah G ah cha \'F G a F G\\nF2 ED DEFE ED\"]', '[\"La dol-ce vois ai o-i-de\\ndel ro-si-gno-let sal-va-ge,\\nqui s\'es en mon cor sail-li-de\\nsi que tuit mei de-si-er\\net mal trait q’a-mors me do-ne,\\nm’a-dou-cist et m’a-sai-zo-ne.\\nEt m\'a-u-rie bon mis-ter\\nl\'au-trui joi en mon dan-na-ge.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f185\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 35, \"facsimileY\": 67, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 120, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(67, 'Lanque fueille et bosc jaurrist', 'BdT 70.24', 'Bernart de Ventadorn', 'Occitan', 'W', '202v', 1, 1, '[\"C1 C D F ED DC F FG \'C1 a\\na a a a(G) G Gaha \'C1 a aG\\nF G a GG(F) EDC DC\\nE F G \'F3 G G G a aGF\\nF Ga c ba aGF \'C1 FG aG\\nc b} a b a(G) a Ga(b) a(G) GF\\nFF(G) \'C1b} b aG a F G(F) EDC GFGa\\nF G aGF G \'F3 C DEF EDDC D\",\"C1 C D F ED DC F FG\\nC1 a \'a a a a(G) G Gaha\\nC1 a aG \'F G a GG(F) EDC DC \'E F G\\nF3 G G G a aGF \'F Ga c ba aGF\\nC1 FG aG \'c b} a b a(G) a Ga(b) a(G) GF \'FF(G)\\nC1b} b aG a F G(F) EDC GFGa \'F G aGF G\\nF3 C DEF EDDC D\"]', '[\"Lan-que fueil-le et bosc jaur-rist,\\nque flor s’es-pan et ver-du-re\\nper ver-giers et per praz,\\net l’au-zel qui s’es-tai te-nic,\\nsunt gai per me lou fueil-las,\\nal-tre-si chant et m’es-bau-de\\net vif de joi et ra-ver-de\\net fueill se-gont ma na-tu-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f420.item[/\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 578, \"Annotations\": true, \"FontSizeOld\": 21, \"TextFontOld\": 1, \"MsLineBreaks\": true, \"ZoomFacsimile\": 180, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(68, 'Lai can vey la fuelha', 'BdT 70.25', 'Bernart de Ventadorn', 'Occitan', 'R', '58r', 1, 1, '[\"F3 G G a h c c\\nh ch a haGF G a\\nF D E \'F3 F GaG F\\na hch a aG F G\\nG G a h c c\\nh \'F3 ch a haGF G a\\nF D E F GaG F\\na hch a aG \'F3 F G\\nh d c h hahc ha\\na h a GF G a\\nF \'F3 D E F GaG GF\\na ahch a haG F aG \",\"F3 G G a h c c \'h ch a haGF G a \'F D E\\nF3 F GaG F \'a hch a aG F G \'G G a h c c \'h\\nF3 ch a haGF G a \'F D E F GaG F \'a hch a aG\\nF3 F G \'h d c h hahc ha \'a h a GF G a \'F\\nF3 D E F GaG GF \'a ahch a haG F aG \"]', '[\"Lai can vey la fue-lha\\njus-t’a l’al-bre cha-zer,\\nqui que pes o·s due-lha,\\na mi deu bon sa-ber.\\nNon cre-zatz qu’ieu vue-lha\\nflor ni fue-lha ve-zer,\\ncar vas mi s’er-gue-lha\\ns’ilh qu’ieu pus suelh a-ver.\\nCor ay que m’en tue-lha,\\nmas ges no·n ai po-der,\\nc’a-des cug m’a-cue-lha,\\non pus m’en de-ses-per.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f129.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 783, \"facsimileY\": 456, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(69, 'Non es meraveilla s’eu chan', 'BdT 70.31', 'Bernart de Ventadorn', 'Occitan', 'G', '9r', 1, 1, '[\"C1 D G G G a h a GaGF\\nF a \'C2 h c a c haGa G\\nc h a \'C1 G F E(D) C Ga\\nC D C E \'C1 G F G ECD\\nE G G G a h aGF F \'\\nC1 a c a h a G aGGF\\nahc h a G \'C1 F EDE F EDE\\nC D C E G F \'C1 G ECD \",\"C1 D G G G a h a GaGF \'F a\\nC2 h c a c haGa G \'c h a\\nC1 G F E(D) C Ga \'C D C E\\nC1 G F G ECD \'E G G G a h aGF F \'\\nC1 a c a h a G aGGF \'ahc h a G\\nC1 F EDE F EDE \'C D C E G F\\nC1 G ECD \"]', '[\"Non es me-ra-veil-la s’eu chan\\nmeilz de nul au-tre chan-ta-dor\\nqe plu·m ti-ra·l cors vers a-mor\\ne meillç sui faiç al seu co-man;\\ncor e cors e sa-ber e sen\\ne forç e po-der i_a mes\\nsi·m ti-ra vas a-mors lo fres\\nq\'en-ver al-tra part no m\'a-ten.\"]', '[\"Notes: The melody is exceptionally copied on both the first and second stanza (here only the first one is transcribed). \\nAs demonstrated by Federico Di Santo,  \'“Verba modulationi armonizata”: l’attendibilità della teoria dantesca della canzone fra schemi di rime e fraseologia musicale\', in Federico Di Santo (Hg.), <i>La rima tra filologia, metrica e musica dal Medioevo al Rinascimento</i>, Freie Universität Berlin 2023, p. 40-65, at p. 53, the omission of the notes <i>F G</i> at 4.6-7 of the second stanza has caused a shift of melody upon the text for the entire second half of the song. This has obscured the structural musical repetition within the stanza, as well as the identity with the first stanza. The copyst has conceiled his error by adding three note groups at the end of the stanza, partially repeating the last notes of the piece.\\n<br/>\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064950\", \"custos\": \"[2,6,4,3,5,4]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(70, 'Non es meravilla s\'eu chan', 'BdT 70.31', 'Bernart de Ventadorn', 'Occitan', 'W', '191r', 1, 1, '[\"C2 G d d d e f edde(d) dch(d) \'\\nC2 a h aG c d ff(e) dcc(d) e \'\\nC3 f fg+a g f fe d defe edc\\nd ee(d) \'C3 dc f ed c d ed\\nG d d e f \'C3 edde dc\\nf g+a g fe ed ff(e) dc\\nefg f \'[C3] ? d c hha hcdd(c) haa(h)\\nG a G ah \'[C2] d ec d(c) ahaG\",\"C2 G d d d e f edde(d) dch(d) \'\\nC2 a h aG c d ff(e) dcc(d) e \'\\nC3 f fg+a g f fe d defe edc \'d ee(d)\\nC3 dc f ed c d ed \'G d d e f\\nC3 edde dc \'f g+a g fe ed ff(e) dc \'efg f\\n[C3] ? d c hha hcdd(c) haa(h) \'G a G ah\\n[C2] d ec d(c) ahaG\"]', '[\"Non es me-ra-vil-le s’eu chant\\nmais de nul al-tre chan-ta-dor,\\nquan plus trai lou cor vers a-mor\\net mau sui fais a son con-mant.\\nCor et cors, sa-ber et sen\\net for-ce_et po-der i_ai mes;\\ns’en ti …e vers a-mor lou fren\\nqu\'a nu-le_al-tre ren non en-ten.\"]', '[\"Notes: 7.3-8.8: The clef on the sisth and seventh staff of the manuscript have been asperted. The height of the notes in this last segment is thus conjectural.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f397.item\", \"Plica\": false, \"custos\": \"[null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 60, \"facsimileY\": 683, \"Annotations\": true, \"FontSizeOld\": 16, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 210, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(71, 'Pos mi pregatz mi, seignor', 'BdT 70.36', 'Bernart de Ventadorn', 'Occitan', 'G', '20v', 1, 1, '[\"C2 c c c ha h c\\nh d \'C2 h c ha G\\nh c d ha \'C2 h c\\na c a h aG F\\na h \'C2 c ha GF a\\na c a \'C2 c haG F\\na h c ha GF \'C2 a\\na c a c haG F \'\\nC2 G a h c haG ha \",\"C2 c c c ha h c \'h d\\nC2 h c ha G \'h c d ha\\nC2 h c \'a c a h aG F \'a h\\nC2 c ha GF a \'a c a\\nC2 c haG F \'a h c ha GF\\nC2 a \'a c a c haG F \'\\nC2 G a h c haG ha \"]', '[\"Pos pre-gaz mi, sei-gnor,\\nq’eu chant eu chan-te-rai;\\nqant cuit chan-tar, eu plor\\na l’o-ra c’o eu sai.\\nGreu vei-reç chan-ta-dor,\\nben chant, qan mal li vai.\\nVai mi donc mal d’a-mor?\\nAnz meilz qe non feç mai!\\nE donc per qe m’es-mai?\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064992\", \"custos\": \"[4,4,3,3,5,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(72, 'Pus mi preiatz, senhor', 'BdT 70.36', 'Bernart de Ventadorn', 'Occitan', 'R', '57v-58r', 1, 1, '[\"F3 a c c c haG a\\nh c a \'F3 h G a\\na c c c haG a\\nh c a h \'F3 G a\\nF F G a F GahaG\\na h aG aG F FE\\nF \'F3 F G a F GahaG\\na h aG aG F FE\\nD F \'F2 G a F GahaGF \",\"F3 a c c c haG a \'h c a\\nF3 h G a \'a c c c haG a \'h c a h\\nF3 G a \'F F G a F GahaG \'a h aG aG F FE \'F\\nF3 F G a F GahaG \'a h aG aG F FE \'D F\\nF2 G a F GahaGF \"]', '[\"Pus mi pre-iatz, se-nhor,\\nqu’ieu chant, yeu chan-ta-rai;\\ne cant cug chan-tar, plor\\nman-tas ves, qu’ieu o sai.\\nGreu vei-retz chan-ta-dor,\\nben chan, can mal l’e-stai.\\nA mi del mal d’a-mor\\nva mielhs que no fes may!\\nE doncx, per que·m n’e-smai? \\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f128.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 949, \"facsimileY\": 1892, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(73, 'Cant l’erba fresqu’e·l fuelha par', 'BdT 70.39', 'Bernart de Ventadorn', 'Occitan', 'R', '57v', 1, 1, '[\"F3 F G a aGF E D EFE D\\nF G a G \'F3 a h chah a\\na h c haG a F G E\\nF G a aGE \'F3 F D EFE D\\nG F E F G F E D E C\\nG \'F3 F E F G F E D E C\\nFED E F G G G FG \'F3 a aG FE\\nD D E F G F FED D E FED \",\"F3 F G a aGF E D EFE D \'F G a G\\nF3 a h chah a \'a h c haG a F G E \'F G a aGE\\nF3 F D EFE D \'G F E F G F E D E C \'G\\nF3 F E F G F E D E C \'FED E F G G G FG\\nF3 a aG FE \'D D E F G F FED D E FED \"]', '[\"Cant l’er-ba fres-qu’e·l fue-lha par\\ne·l fuelh s’es-pan-dis pel ver-ian,\\ne·l ros-si-nhol au-tet e clar\\naus-sa sa votz e·n dreg son chan,\\nioi ay de luy e ioi ai de la flor,\\nioi ai de mi e de mi-dons ma-ior;\\nde to-tas partz soi de ioi claus e senh,\\nmas ilh es iois que totz los au-tres vens.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f128.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(82, 'Rassa, tan creis e mont\' e poja', 'BdT 80.37', 'Bertran de Born', 'Occitan', 'R', '6v', 1, 1, '[\"C2 c c c c c h a h a\\na h c d c h \'F3 a h a\\nG F G a a a a a a\\na G a h c ha \'F3 G(F) G G\\nF G a a a a a a a\\na G a h \'C2 c ha G a a\\nc(h) a h c d c h a\\nG F G \'C2 a a a a E\\nE F G a a a ha aG\\nF G a a a \'C1 a a a D\\nD E F G a h G haG\",\"C2 c c c c c h a h a \'a h c d c h\\nF3 a h a \'G F G a a a a a a \'a G a h c ha\\nF3 G(F) G G \'F G a a a a a a a \'a G a h\\nC2 c ha G a a \'c(h) a h c d c h a \'G F G\\nC2 a a a a E \'E F G a a a ha aG \'F G a a a\\nC1 a a a D \'D E F G a h G haG\"]', '[\"Ras-sa, tan derts e mont\' e pue-ia\\nde leys, qu\'es de totz en laus vue-ia,\\nson pretz c\'a las me-lhors en-ve-ia;\\nc\'u-na non a po-der que·l nue-ia\\nque·l ve-zer de sa beu-tat lue-ia\\na sos obs les pros, cuy que cue-ya\\ne·l plus co-noy-sent e·l me-lhor\\nman-te-nent a-des sa lau-zor\\ne la tri-o per be-la-zor.\\nMas ilh sap far tan en-tiei-ra_o-nor\\nque no vol mas un pre-ja-dor.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f26.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 984, \"facsimileY\": 161, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(83, 'Ben volgra que·m venques merces', 'BdT 96.2', 'Blacasset', 'Occitan', 'W', '78v', 1, 1, '[\"C2b} F G a b a G(a) \'C2b} GFE(F) G\\nG a G F(E) D C DE \'C2b} F\\na b c d c b(c) baG a \'\\nC2b} a b(a) GF(G) E F Ga G(a) F\\nb(c) baG \'C2b} a b c F Ga ba G\\nG a(G) \'C2b} F GF DC DE(F) G F\\na c d e(d) c \'C2b} c b(c) a\\nc b aG FE G a(G) F \'C2b} c baG a\\nF G a b a G F G(F) \'F2 FE F //\",\"C2b} F G a b a G(a)\\nC2b} GFE(F) G \'G a G F(E) D C DE\\nC2b} F \'a b c d c b(c) baG a \'\\nC2b} a b(a) GF(G) E F Ga G(a) F \'b(c) baG\\nC2b} a b c F Ga ba G \'G a(G)\\nC2b} F GF DC DE(F) G F \'a c d e(d) c\\nC2b} c b(c) a \'c b aG FE G a(G) F\\nC2b} c baG a \'F G a b a G F G(F)\\nF2 FE F //\"]', '[\"Ben vol-gra que·m ven-ques mer-ces\\ndon-na ien-sers de las ien-sors\\nvos, si con vos-tra gran va-lors\\nto-tas sel-las que va-lor an\\nvens, qui en fo-ra rics amb ay-tan\\nque puys non fe-ra fal-len-sa\\nsi qu’ieu de-sir am te-men-sa,\\ns’ay-si po-ges l’er-gual dous a-dou-sir,\\nco·us fay va-lors per la mel-lor te-nir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f174.item\", \"Plica\": false, \"custos\": \"[null,null,null,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 860, \"facsimileY\": 546, \"Annotations\": true, \"FontSizeOld\": 14, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(84, 'S\'anc fuy bela ni prezada', 'BdT 106.14', 'Cadenet', 'Occitan', 'R', '52r', 1, 1, '[\"F3 D ahcha G c haG Gah aGFG ahcha\\nD ahcha G c \'F3 haG Gah aGFG ahcha\\naGah aG Ga D F aG FEF GaGFD\\nC D E F F aG \'F3 EDEF ED\\nd d ahcdcha ahaG\\na F ahc d c h aGa GF\\nD D E F aG EDEFE \'F3 ED\\nE GF E Gahcha aGFEFD\\nD E DC DE FaGEDEF ED\",\"F3 D ahcha G c haG Gah aGFG ahcha \'D ahcha G c\\nF3 haG Gah aGFG ahcha \'aGah aG Ga D F aG FEF GaGFD \'C D E F F aG\\nF3 EDEF ED \'d d ahcdcha ahaG \'a F ahc d c h aGa GF \'D D E F aG EDEFE\\nF3 ED \'E GF E Gahcha aGFEFD \'D E DC DE FaGEDEF ED\"]', '[\"S\'anc fuy be-la ni pre-za-da,\\nar soi d’aut en bas tor-na-da,\\nc’ad un vi-lan soi do-na-da\\ntot per sa gran ma-nen-ti-a;\\ne mur-ri-a\\ns’ieu fin a-mic non a-vi-a\\non co-bris mos mar-ri-mens,\\ne gai-ta pla-zens\\nque mi fes son d’al-ba.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f117.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 283, \"facsimileY\": 2210, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 290, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(85, 'Bele m\'es la veis altana', 'BdT 124.5', 'Daude de Pradas', 'Occitan', 'W', '196r', 1, 1, '[\"C1 a h c c c h ca hG\\nh \'C1 d h c haG ah c\\nb \'C2 d f d d(e) d c dcb\\nh d c cd \'C3 b c c cd\\nf d _e dcba h c d(c) haG\\nF \'C2b} b b c dcb c d ef\\nd _e dc d b \'C2b} c abaG a \",\"C1 a h c c c h ca hG \'h\\nC1 d h c haG ah c \'b\\nC2 d f d d(e) d c dcb \'h d c cd\\nC3 b c c cd \'f d _e dcba h c d(c) haG \'F\\nC2b} b b c dcb c d ef \'d _e dc d b\\nC2b} c abaG a \"]', '[\"Be-le m\'es la veis al-ta-na\\ndes lou-sei-gnol en pa-scor,\\nque fo-ille_es vers et blan-che flor\\net l\'er-be nais en l\'ar-fa-ne\\na-donc ten-tis-sent li ver-gier;\\net iois m\'au-ri-e tal me-stier \\nque·l cor mi ra-vif et sa-ne.\"]', '[\"Notes: An additional line is provided by the notator for the <i>F</i> on 6.1.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f407.item[\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 926, \"Annotations\": true, \"FontSizeOld\": 14, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(86, 'Amors, merce! no moira tan soven', 'BdT 155.1', 'Folquet de Marseilla', 'Occitan', 'G', '1v', 1, 1, '[\"C1b} a a a F G b ab G G FED \'\\nC1b} D E F G a b G a G EC DC \'\\nC1b} a b c ba G F EDC DE FE ED \'\\nC1b} a a a ab G E C E G EC DC \'\\nC1b} G G Gab c c c b G Gab cbaGF ED \'\\nC1 C D EC C G Ga_h c-aG F ED C \'\\nC1F3 C D E ED C H F G EC EDC\",\"C1b} a a a F G b ab G G FED \'\\nC1b} D E F G a b G a G EC DC \'\\nC1b} a b c ba G F EDC DE FE ED \'\\nC1b} a a a ab G E C E G EC DC \'\\nC1b} G G Gab c c c b G Gab cbaGF ED \'\\nC1 C D EC C G Ga_h c-aG F ED C \'\\nC1F3 C D E ED C H F G EC EDC\"]', '[\"A-mors mer-ce, non muo-ra tan so-ven\\nqe ja·m po-dez vi-az del tot au-ci-re\\nqe viu-re·m faiz e mo-rir mes-cla-men\\net e-nais-si dob-laz mi mon mar-ti-re,\\npe-ro mielz morz vos sui homs e ser-vi-re\\ne·l ser-vi-zis es mi mil tanz plus bos\\nqe de nul au-tra_a-ver rics gui-za-dos.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da828006492b\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(87, 'Amors, merce! No mueyra tan soven', 'BdT 155.1', 'Folquet de Marseilla', 'Occitan', 'R', '42v', 1, 1, '[\"F3 c ch ha aG a c h a aG FE\\nD E F G \'F3 a h c a h aF G\\nC2 d e fe edc c ch ha Ga ha G \'\\nC2 e fe ed dc h G a h d hG haG\\nC3 e f gfe g +a g \'C3 g e def edc haG\\nG ? ? ? a ha cde fed dc hah\\nh c d d d c ha aG \'dhG haG\",\"F3 c ch ha aG a c h a aG FE \'D E F G\\nF3 a h c a h aF G \'C2 d e fe edc c ch ha Ga ha G \'\\nC2 e fe ed dc h G a h d hG haG \'C3 e f gfe g +a g\\nC3 g e def edc haG \'G ? ? ? a ha cde fed dc hah \'h c d d d c ha aG\\ndhG haG\"]', '[\"A-mors, mer-ce! No muey-ra tan so-ven,\\nque ja·m po-detz vi-atz del tot au-ssi-re;\\nque vieu-re·m faitz e mo-rir ey-ssa-men\\net e-nai-ssi do-blatz me mo mar-ti-re;\\npe-ro, mietz mortz, vos son om e ser-vei-res\\net        es me mil tans pus bos\\nque de nulh au-tr’a-ver ric ga-zar-dos. \\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f98.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 217, \"facsimileY\": 546, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(88, 'A! quan gen vens et ab quan pauc d\'afan', 'BdT 155.3', 'Folquet de Marseilla', 'Occitan', 'R', '43r', 1, 1, '[\"F3 D F G a a F G a h aG\\nF G a(G) \'F3 D E F G E FE ED\\nD E F GabaG F ED EE(F) E ED DC\\nC D E \'F3 F E Gaha GFE ED EDC D\\nD F G aGF a c dc a F GaGF \'\\nF3 a c d cha hc hG aGh hch haG aGF\\nFG Ga ahchG haG \'F3 a D D EFG FED DC\\nC D E FEDC E Gah FED DC EDC \'F2 CD \",\"F3 D F G a a F G a h aG \'F G a(G)\\nF3 D E F G E FE ED \'D E F GabaG F ED EE(F) E ED DC \'C D E\\nF3 F E Gaha GFE ED EDC D \'D F G aGF a c dc a F GaGF \'\\nF3 a c d cha hc hG aGh hch haG aGF \'FG Ga ahchG haG\\nF3 a D D EFG FED DC \'C D E FEDC E Gah FED DC EDC\\nF2 CD \"]', '[\"Ay! tan gen vens et ab tan pauc d’a-fan\\nay-sel que·s lay-sa ven-ser a mer-ce!\\ncar e-nay-si vens hom au-trui e se,\\net a ven-cut do-as vetz se-nes dan;\\nmas vos, A-mors, no faitz jes e-nay-si,\\nc’ap vos mer-ce no·m poc un jorn va-ler,\\nans m’a-vetz tant mos-trat vos-tre po-der\\nqu’e-ras no∙us ay ni vos non a-vetz me.\\n\"]', '[\"Notes:\\nAn old version of the melody, only partially scraped, appears in the background. When possible, the notator tried to use the old notes, which explains the many misplaced stems and unusual ligatures.\\n6.9: the <i>G</i> is positioned under <i>ha</i>, suggesting it was part of the older version. However, it has not been erased, which means the notator used it as a part of the new version.\\n7.3-7-4: betwenn the two syllables, the notes <i>ch</i>, both with a bottom right stem, appear to be part of the old version of the melody.\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f99\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 914, \"facsimileY\": 1631.5, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004