(89, 'Ben an mort mi e lor', 'BdT 155.5', 'Folquet de Marseilla', 'Occitan', 'G', '4v-5r', 1, 1, '[\"C2 c c d c ah ch\\nG FE DC F Ga \'C2 F\\na a a G FED C\\nD E \'C1 F GF FE D\\nF FE DC D E G \'\\nC2 a h c c h chah\\nG a h \'C2 d cdca F Ga GFG\\nah a G a GFE FG FED C \'\\nC1 C D E G a h c ha G FG \'\\nC2 ah aG aG FE G E FG a hG aGGF\",\"C2 c c d c ah ch \'G FE DC F Ga\\nC2 F \'a a a G FED C \'D E\\nC1 F GF FE D \'F FE DC D E G \'\\nC2 a h c c h chah \'G a h\\nC2 d cdca F Ga GFG \'ah a G a GFE FG FED C \'\\nC1 C D E G a h c ha G FG \'\\nC2 ah aG aG FE G E FG a hG aGGF\"]', '[\"Ben an mort mi e lor\\nmei oil ga-li-a-dor\\nper qe·m plaz q\'a bels plor\\npois il ço an me-rit\\nq\'en tal do-pn\'_an çau-sit\\ndond an fait fa-lli-men\\ne qi trop puo-ia bas dei-sen,\\npe-ro en sa mer-ci mi ren\\nqe no cre ges qe mer-ces aus fal-lir\\nlai on Deus volc toz au-tres bens as-sir\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064931\", \"custos\": \"[7,7,3,2,10,3]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(90, 'En chantan m\'aven a membrar', 'BdT 155.8', 'Folquet de Marseilla', 'Occitan', 'G', '5r-v', 1, 1, '[\"C2 E G G ah G F DE GFED \'\\nC2 C DC F EF DC FG FED D \'\\nC2 DE G a h c d G ah c haG \'\\nC2 G a chaG a\\nd d e c d \'C2 cha h a \'\\nC3 a haG a h c d d chah c haG \'\\nC1 E FE GFED D\\nE G G aF G a \'C2 h d\\nf ed dc haG aG FE FG \'C2 aG GF GFE\\nG a h c dc haG ah \'C3 dh chaG a \",\"C2 E G G ah G F DE GFED \'\\nC2 C DC F EF DC FG FED D \'\\nC2 DE G a h c d G ah c haG \'\\nC2 G a chaG a \'d d e c d\\nC2 cha h a \'\\nC3 a haG a h c d d chah c haG \'\\nC1 E FE GFED D \'E G G aF G a\\nC2 h d \'f ed dc haG aG FE FG\\nC2 aG GF GFE \'G a h c dc haG ah\\nC3 dh chaG a \"]', '[\"In can-tan m\'a-ven a mem-brar\\ncho q\'eu cuich chan-tan ob-li-dar\\nmas per ço chant q\'eu ob-lides la do-lor\\ne·l mal d\'a-mor\\nmais on plus chan plus mi so-ve\\nc\'a la bo-cha nul-la res no·m a-ve\\nmais sols mer-ce\\nper q\'es ver-taz e sem-blan be\\nq\'inz el cor port, dom-na, vos-tra fai-çon\\nqe·m chas-ti-a q\'eu no vir ma ra-son.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064948\", \"custos\": \"[10,9,6,3,3,10,2,5,2]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(91, 'Greu feira nuls hom faillensa', 'BdT 155.10', 'Folquet de Marseilla', 'Occitan', 'G', '8v', 1, 1, '[\"C2 a a a b} baG a b abG G \'\\nC2 a c d chah G aG G\\na c \'C2 d cha a haF Ga\\na h c ha G \'C2 FE EDE ED\\nED C DE G \'C2 a GF Gahch hah\\nd c ah c c c c \'\\nC2 c c ch aGa F GF F \'\\nC2 F G ahc haG F FE EDEFGF EDC \'\\nC2 F Ga ahc haG F FE EDEC D \",\"C2 a a a b} baG a b abG G \'\\nC2 a c d chah G aG G \'a c\\nC2 d cha a haF Ga \'a h c ha G\\nC2 FE EDE ED \'ED C DE G\\nC2 a GF Gahch hah \'d c ah c c c c \'\\nC2 c c ch aGa F GF F \'\\nC2 F G ahc haG F FE EDEFGF EDC \'\\nC2 F Ga ahc haG F FE EDEC D \"]', '[\"Greu fei-ra nuls hom fal-len-ça\\nse tan tem-ses son bon sen\\ncon lo blas-me de la gen\\nqe ju-z\'_a des-con-is-cen-za\\nq\'eu fal-lir lais_car_lais per te-men-za\\ndel blas-me des-co-noi-sen\\ncar con-tra_a-mor no m\'ep-ren\\nq\'eis-sa-men nois trop sof-fren-ça\\ncom leos cors ses re-te-nen-ça.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da828006494f\", \"custos\": \"[5,2,7,5,3,7,7,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
