(92, 'Greu feira nuls hom faillensa', 'BdT 155.10', 'Folquet de Marseilla', 'Occitan', 'R', '42r', 1, 1, '[\"F3b} aa(h) aG a aF G b} a baG a\\na c dcc(h) aG \'F3 G aF G\\na c d ca Gah aGF F\\nb} G b aG \'F3 F E D DEF EDC\\nFF(E) DC E Ga G h dcha aG\\nh cha \'F3 G c d c c\\nc c hah G G aF G\\nFa ahch aG \'F3 G F E DEFEE(D) DC\\nF G ah ch G FE ED DCD\",\"F3b} aa(h) aG a aF G b} a baG a \'a c dcc(h) aG\\nF3 G aF G \'a c d ca Gah aGF F \'b} G b aG\\nF3 F E D DEF EDC \'FF(E) DC E Ga G h dcha aG \'h cha\\nF3 G c d c c \'c c hah G G aF G \'Fa ahch aG\\nF3 G F E DEFEE(D) DC \'F G ah ch G FE ED DCD\"]', '[\"Greu fe-ra nulhs hom fa-lhen-sa,\\nsi tant teu-ses son bo sen\\ncom lo blas-me de las jens,\\nqui ju-ron des-co-no-sien-sa;\\nqu’ieu falh car lais, per te-men-sa\\nd’un blas-me des-co-noi-sen,\\nqu’en-con-tr’A-mors non em-pren:\\nqu’eis-sa-men notz trop su-fren-sa\\ncom leu cors ses re-te-nen-sa.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f97.item.zoom\", \"Plica\": true, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 183, \"facsimileY\": 1578, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(93, 'Greu feira nuls hom faillensa', 'BdT 155.10', 'Folquet de Marseilla', 'Occitan', 'W', '200v', 1, 1, '[\"C3 c c d c d e defec c\\nc \'C3 e g gff(e) ed edc c \'\\nC3 d e f ed ee(d) dch cd\\nd e fgfd c \'C3 b cdca Gaha aG\\nC2b} aba G F a c ha c defe ed \'\\nC3 g g#fgg(#f) e f g fe f\\nd \'C3 e f edee(d) dc edc c\\ne f g fgfd b \'C2 cdca Gabc(b) aGF\\nb d ff(e) dcdd(c) cb cdca GabaF G\",\"C3 c c d c d e defec c \'c\\nC3 e g gff(e) ed edc c \'\\nC3 d e f ed ee(d) dch cd \'d e fgfd c\\nC3 b cdca Gaha aG \'C2b} aba G F a c ha c defe ed \'\\nC3 g g#fgg(#f) e f g fe f \'d\\nC3 e f edee(d) dc edc c \'e f g fgfd b\\nC2 cdca Gabc(b) aGF \'b d ff(e) dcdd(c) cb cdca GabaF G\"]', '[\"En la vos-tre main-te-nen-ce\\nm\'ai mis, A-mors, fran-che-ment,\\nqu\'eu fus-se mors ve-ra-ment\\nse non fust ma con-nois-sen-ce;\\ndont non eu en me per-ve-en-ce,\\ndon muir quan pluz sui plaig-nens,\\ndont mi-re me tan su-vent\\nque ma can-con en per-ven-ce\\nn\'au-ri-e maiz de va-len-ce.\"]', '[\"Notes: The songs starts from the second stanza.\\n\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f416.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 707, \"facsimileY\": 656, \"Annotations\": true, \"FontSizeOld\": 16, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 210, \"FontSizeModern\": 20, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(94, 'Ja no·s cuich hom q\'eu cange mas cancos', 'BdT 155.11', 'Folquet de Marseilla', 'Occitan', 'G', '6v', 1, 1, '[\"C2b} a a abc b a G Gab a GF \'C2 GF\\nF G b a G FED DE GF ED D \'\\nC2b} DE F EDC C a d cb a G FEDE C \'\\nC2 C D DEDC F F GF EDC D ED DC \'\\nC1 F G a a h c ? h cha h c \'\\nC1 hahc aG GF E D C DC DE FE ED DC \'\\nC1 C D E E E E FE D C CEDH \'\\nC1 C E G h d c haG F EDC CED\",\"C2b} a a abc b a G Gab a GF\\nC2 GF \'F G b a G FED DE GF ED D \'\\nC2b} DE F EDC C a d cb a G FEDE C \'\\nC2 C D DEDC F F GF EDC D ED DC \'\\nC1 F G a a h c ? h cha h c \'\\nC1 hahc aG GF E D C DC DE FE ED DC \'\\nC1 C D E E E E FE D C CEDH \'\\nC1 C E G h d c haG F EDC CED\"]', '[\"Ja no·s cuich hom q\'eu can-ge mas can-cos\\npois no·s can-ja mos cors ni mas ra-ços\\ncar si·m jau-cis d\'a-mors eu m\'en lau-çe-ra\\nmas qe men-tis non se-ri-a nuls pros,\\nc\'al-tre-si·m ten com se sol in ba-lan-ça\\nde-se-spe-rat ab al-qet d\'es-pe-ran-ça\\npe-ro no·m vol del tot lai-sar mo-rir\\nper ço qe·m pos-ca plus so-vent au-cir.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da828006494b\", \"custos\": \"[6,9,10,7,2,8,8]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(95, 'Molt i feç granç pecat amors', 'BdT 155.14', 'Folquet de Marseilla', 'Occitan', 'G', '3v', 1, 1, '[\"C1b} a a abaG ab c c ba abcbaG \'\\nC2 Ga c ca c_hGF EF Ga GE FED \'\\nC2 a a ahaG a h c haaG ah \'\\nC2 cd ch aG FEDC D E FEFD E \'\\nC1 F a GF EDC DE FE EDC C \'\\nC1 C D E D F G aGF Ga \'\\nC2 c c ch aGF Gah a GaGF G \'\\nC2 G a h chcd c a haG ah\\nd c dG aGFE \'C1 F G EC DEDC\\nC D E FED FGah a GE FEED\",\"C1b} a a abaG ab c c ba abcbaG \'\\nC2 Ga c ca c_hGF EF Ga GE FED \'\\nC2 a a ahaG a h c haaG ah \'\\nC2 cd ch aG FEDC D E FEFD E \'\\nC1 F a GF EDC DE FE EDC C \'\\nC1 C D E D F G aGF Ga \'\\nC2 c c ch aGF Gah a GaGF G \'\\nC2 G a h chcd c a haG ah \'d c dG aGFE\\nC1 F G EC DEDC \'C D E FED FGah a GE FEED\"]', '[\"Molt i feç granç pe-cat a-mors\\npos li plac qe·s me-ses in me\\nqar mer-ce non ab-duis ab se\\nab qe m\'a-dol-ces mas do-lors,\\nq\'a-mors perd son nom e des-men\\net es de-sa-mors pla-na-men\\nqan mer-ces no·i pot far se-cors\\ne fo-ra li preç et o-nors\\npois il vol ven-cer to-tas res\\nc\'u-na vez la ven-ces mer-ces.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da828006492f\", \"custos\": \"[4,5,3,7,8,1,6,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
