u-ra,\\ncant la prec de mi\\nri!\\nC\'ans vol-ri-a\\nsol que mi-a\\nfos un di-a\\ne ma vi-a,\\nnon da-ri-a\\nma fol-li-a\\nper ca-tor-ze sentz.\\nVentz\\ne cuh si-a\\nque m\'em-bri-a,\\ndoncs fa-di-a;\\nm\'en peu-ri-a\\nsi·m po-di-a,\\nma so·m li-a\\nc\'oms ven-cutz, suf-rentz,\\nventz.\\nBes tans ven-sa\\nben-vo-len-sa\\nle-yals que non chay\\nlay\\non se-men-sa\\nde va-len-sa\\nflo-riys am ve-ray\\niay.\\nMan-te-nen-sa\\nam suf-ren-sa,\\ncar don-na, s’ye·us play,\\nsay\\nque sil gen-sa\\nco-noy-sen-sa\\nque los sieus d\'es-may\\ntray.\\nDel mal tray-re\\nmer-ce-ay-re\\nsuy\\ne fins, le-als a-may-re\\ne·l ben fay-re\\nsens es-tray-re\\ncuch sap-cha gra-sir.\\nDir\\nnon l\'aus gay-re\\nmon ve-iay-re,\\nqui·lz grantz beu-tatz don es may-re\\nmi fay tray-re:\\nmon cors, lay-re.\\nen a-quest con-sir\\nvir.\\nPueys vol-vi_e·m vi-re\\nen a-quest con-si-re\\ndon mays am mar-ti-re\\nque d’au-tre ga-sahn\\nmahn.\\nGent ga-sa-hna\\nqui que·s pla-hna,\\nma don-na vol-vent re-ma-hna\\nva-lors ma-hna\\nen que·s ba-hna\\nsos gays cors cor-tes.\\nEs\\npla-sentz, gen-ta,\\nm’a-ta-len-ta\\nplus c\'al me-ge fals\\nmals.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f388.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 838, \"facsimileY\": 137, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(145, 'Aiga poja contra mon', 'BdT 223.1', 'Guillem Magret', 'Occitan', 'W', '201v', 1, 1, '[\"C3 c d c h f e(f) ed \'\\nC3 d h G a h cdd(c) \'C3 ch\\nd d(c) h f e edc c\\ne g \'C3 f e d edc de\\ne g f \'C3 g+ag e c dch\\nd d(c) h f e edc c\\na \'C3 hchG G a h c dd(c) ch\\nee(d) dch c \'C3 d e g+agf ee(d) dc\\ne f g +a g +h gec de \'\\nC3 g gf e(f) ed f g ec dch\\nh c \'C3 dd(c) ch f e d feedc \",\"C3 c d c h f e(f) ed \'\\nC3 d h G a h cdd(c)\\nC3 ch \'d d(c) h f e edc c \'e g\\nC3 f e d edc de \'e g f\\nC3 g+ag e c dch \'d d(c) h f e edc c \'a\\nC3 hchG G a h c dd(c) ch \'ee(d) dch c\\nC3 d e g+agf ee(d) dc \'e f g +a g +h gec de \'\\nC3 g gf e(f) ed f g ec dch \'h c\\nC3 dd(c) ch f e d feedc \"]', '[\"L\'ai-gue pu-ge con-tre mont\\nal fum, al niu-le_et al vent\\net quant est aut et de-scent;\\net sa-chent tuit cil del mont\\nqu\'en-se-ment pu-ge va-lors\\na ben fas et ab en-nor,\\net quant est aut des-cen-dri-e,\\nson ben non la sous-te-ni-e.\\nEt de-grem es-ser e-nu-ios\\ndel mar-keis et des al-tres prous\\net des on-ras ric fas kiu fen.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f418.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 227, \"facsimileY\": 1397, \"Annotations\": true, \"FontSizeOld\": 16, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
