(148, 'Sus tan mi fors\'amors que mi fay entremetre', 'BdT 234.16', 'Guillem de Saint Leidier', 'Occitan', 'R', '41v', 1, 1, '[\"C2 d d d d d c h a h c d cha aG\\nh \'C2 c d ch a c C1 a F D F G GFE G\\nG G G a G \'C1 F a h c ha G h aG\\nE G G a G F \'C1 G a G F E D C\\n\\nc a F a G ahchG F E FE D C \'C1 FE EDC \",\"C2 d d d d d c h a h c d cha aG \'h\\nC2 c d ch a c C1 a F D F G GFE G \'G G G a G\\nC1 F a h c ha G h aG \'E G G a G F\\nC1 G a G F E D C \' \'c a F a G ahchG F E FE D C\\nC1 FE EDC \"]', '[\"Sus tan mi for-s\'a-mors que mi fay en-tre-me-tre\\nqu\'en la gen-sor del mon aus ma chan-so tra-me-tre,\\nni vas a-lhors non puesc mon fin cor es-de-me-tre,\\nben deu-ria en-ple-yar mo so-til sen e me-tre\\n_\\nsi·l de cuy ieu hom so ses dar e ses pro-me-tre.\"]', '[\"Notes: line 5 is omitted, most probably due to a <i>saut du même au même</i>.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f96.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 175, \"facsimileY\": 750, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(149, 'Leu chansonet\'e vil', 'BdT 242.45', 'Giraut de Borneill', 'Occitan', 'R', '9v', 1, 1, '[\"F3 E G G G G GF\\nE D E F E ED \'\\nF3 C D E E E E\\nF E D F E D\\nE G G G G GF\\nE \'F3 D E F E ED\\nD a a h a G\\nG h a c h \'F3 aGF\\nG FED E F\\nD E F GF FE ED\",\"F3 E G G G G GF \'E D E F E ED \'\\nF3 C D E E E E \'F E D F E D \'E G G G G GF \'E\\nF3 D E F E ED \'D a a h a G \'G h a c h\\nF3 aGF \'G FED E F \'D E F GF FE ED\"]', '[\"Leu chan-so-ne-t’e vil\\nm’au-ri’ a obs a-far\\nque po-gues en-vi-ar\\nen Al-ver-nh’al Dal-fi.\\nPe-ro, s’il dreg ca-mi\\npo-gues n’E-bles tro-bar,\\nbe∙l poi-ri-a man-dar\\nqu’ieu dic qu’en l’es-cur-zir\\nnon es l’a-fans,\\nmas en l’o-br’es-clar-zir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f32.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 238, \"facsimileY\": 589, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(150, 'Non puesc sofrir c\'a la dolor', 'BdT 242.51', 'Giraut de Borneill', 'Occitan', 'R', '82r (LXXXIVr)', 1, 1, '[\"F3 a h c ha G E F E\\nE D E G G a \'F3 h a\\na c c h c d h(a) G\\na h c ha G \'F3 E F E\\nE D E G F FEDE D\\nE G G G G \'F3 a a\\na c c h c d h G\\na h ch a G aGFG E\\nD \'F3 E F a G FE D DC\\nC D E F G(E) E EFGD D \",\"F3 a h c ha G E F E \'E D E G G a\\nF3 h a \'a c c h c d h(a) G \'a h c ha G\\nF3 E F E \'E D E G F FEDE D \'E G G G G\\nF3 a a \'a c c h c d h G \'a h ch a G aGFG E \'D\\nF3 E F a G FE D DC \'C D E F G(E) E EFGD D \"]', '[\"Non puesc so-frir c\'a la do-lor\\nde ma den la len-gua no vir\\ne·l chant a la no-ve-la flor,\\nlay cant vey los ra-mels flo-rir\\ne·ls chans fors pel bos-ca-tie\\ndels au-zeletz e-na-mo-ratz;\\ne si tot m\'es-tau a-pes-satz\\nni pres de mal u-za-tie,\\ncant vey cams ni ver-giers ni pratz,\\nie·m re-no-vel e m\'a-so-latz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f177.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 238, \"facsimileY\": 589, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(151, 'Rei glorios, veray lums e clartatz', 'BdT 242.64', 'Giraut de Borneill', 'Occitan', 'R', '8v', 1, 1, '[\"C1F3 D D a a ah c hah G ahc ha\\nD D a a \'F3 ah c hah G ahc ha\\naGah a G(F) E E G a D E FED \'F3 DC\\nF2 C D E FED F3 aGah a G(F) E F GFED E\\nC \'F3 D E F GaG FEDEF ED \",\"C1F3 D D a a ah c hah G ahc ha \'D D a a\\nF3 ah c hah G ahc ha \'aGah a G(F) E E G a D E FED\\nF3 DC \'F2 C D E FED F3 aGah a G(F) E F GFED E \'C\\nF3 D E F GaG FEDEF ED \"]', '[\"Rei glo-ri-os, ve-ray lums e clar-tatz,\\ntotz po-de-ros, se-nher, si a vos platz,\\nal mieu com-paynh si-as fi-zels a-iu-da;\\nqu\'ieu non lo vi pus la nuech fo ven-gu-da,\\net a-des se-ra l\'al-ba!\\n\\nBel com-pa-nho, si dor-metz o vel-hatz:\\nnon dor-matz plus, se-nher, si a vos platz\\nqu\'en au-ri-en vey l\'es-te-la cre-gu-da\\nc\'a-dus lo jorn qu\'ieu l\'ay be co-no-gu-da,\\net ad-es [se-ra l\'al-ba!]\\n\\nBel com-pa-nho, en chan-tan vos a-pel,\\nnon dur-mas pus qu\'ieu au chan-tar l\'au-zel,\\nque vay quer-ren lo jorn per lo bos-ca-tje\\net ai pa-or qu\'el gi-los vos as-sa-tje,\\net ad-es [se-ra l\'al-ba!]\\n\\nBel com-pa-nho, pos mi par-ti de vos\\nyeu non dur-mi ni.m muoc de gi-nol-hos,\\nans preg\'-ieu Dieu lo filh San-ta Ma-ri-a\\nque.us mi ren-des per li-al com-pa-nhi-a.\\n[Et ad-es se-ra l\'al-ba!]\\n\\nBel com-pa-nho, is-setz al fe-nes-trel\\net es-gar-datz las en-se-nhas del sel:\\nco-noy-si-retz s\'ie.n soy fi-zel mes-sa-tje;\\nsi non o faytz vos-tres er lo dam-pna-tje.\\nEt ad-es [se-ra l\'al-ba!]\\n\\nBel com-pa-nho, la fo-ras al pei-ro\\nme pre-ia-vatz qu\'ieu no fos dor-mil-hos,\\ne-nans ve-lhes to-ta nueg tro ad di-a,\\na-ras no.us platz mos chans ni ma pa-ri-a.\\net ad-es [se-ra l\'al-ba!]\\n\\nBel dos com-panh, tan soy en ric so-jorn\\nqu\'ieu no vol-gra mays fos al-ba ni jorn,\\ncar la gen-ser que anc nas-ques de may-re\\ntenc et a-bras, per qu\'ieu non pre-zi gai-re\\nlo fol gi-los ni l\'al-ba!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f30.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 875, \"facsimileY\": 1020, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(152, 'Sie·us quier cosselh, bel\'ami\' Alamanda', 'BdT 242.69', 'Giraut de Borneill', 'Occitan', 'R', '8r', 1, 1, '[\"F1 F F F E F G FED EDC H D E\\nG GF D H \'A A AH C DCH C D\\nF F F E F G FED EDC \'F1 H D E\\nG GF D H A *G AH C DCH C D\\nH C D *G H \'F1 D DCH C D D E\\nF EDC D CHA\\nE E F D F2 F a G G \'F2 E C DE\\nG GFE F Gah aGF FG\",\"F1 F F F E F G FED EDC H D E \'G GF D H\\nA A AH C DCH C D \'F F F E F G FED EDC\\nF1 H D E \'G GF D H A *G AH C DCH C D \'H C D *G H\\nF1 D DCH C D D E \'F EDC D CHA \'E E F D F2 F a G G\\nF2 E C DE \'G GFE F Gah aGF FG\"]', '[\"Sie·us quier cos-selh, be-l\'a-mi\' A-la-man-da\\nno·l me ve-detz, c\'om co-chat lo·us de-man-da;\\nqu\'e-ras m\'a dig vos-tra do-na tru-an-da\\nc\'a lhons suy fors i-ssitz de sa co-man-da,\\npus so que det er m\'es-tra e·m des-man-da.\\nQue cos-se-lhatz?\\nc\'a pauc lo cor dins d\'i-ra no m\'a-bran-da,\\ntan fort en soy i-ratz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f29.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 560, \"facsimileY\": 676, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 190, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(153, 'Be volgra, s\'esser pogues', 'BdT 244.1a', 'Guiraut d\'Espaigna', 'Occitan', 'W', '186r-v', 1, 1, '[\"C1 a(h) c(h) a F G F E\\nF ED E \'C2 F G a G\\nc h(a) G F E F G\\nG a \'C2 G F E(F) G F\\na h G a h(c) \'C1 d c\\nc h a G a(h) a G\\na(h) G F \'C1 EF G(F) F a\\na h(a) G a h d c \'\\nC1 c h a G a(h) a G\\na(h) G F EF G(F) \'C1 E F\\na(h) c(h) a F G F E\\nF ED E \'C1 F G a G\\nc h(a) G F E F G\\nG \'C1 a G F E(F) G F \",\"C1 a(h) c(h) a F G F E \'F ED E\\nC2 F G a G \'c h(a) G F E F G \'G a\\nC2 G F E(F) G F \'a h G a h(c)\\nC1 d c \'c h a G a(h) a G \'a(h) G F\\nC1 EF G(F) F a \'a h(a) G a h d c \'\\nC1 c h a G a(h) a G \'a(h) G F EF G(F)\\nC1 E F \'a(h) c(h) a F G F E \'F ED E\\nC1 F G a G \'c h(a) G F E F G \'G\\nC1 a G F E(F) G F \"]', '[\"Ben vol-gra, s\'es-ser po-ges,\\nc\'A-mors si gar-des d\'ay-tan:\\nque non fe-ses fin ay-man\\nchau-sir en luec que·l pla-ges.\\nE per que? Car per pla-ser\\nqu\'ieu cre-sia de vos a-ver,\\ndon-na, vos mi fes chau-sir\\nA-mor. Do-n\',_a-via es-per\\nque mi de-ges-ses va-ler\\ndel ioy don ieu tant sos-pir,\\nar m\'a-ves a tal punch mes\\nque tot iorn vauc de-si-ran\\nla mort, don ay do-lor gran.\\nCar non faitz so c\'A-mors fes?\"]', '[\"Notes: This song uses mensural notation.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f387.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 657, \"facsimileY\": 1040, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(154, 'Ab lo temps agradiu, gai', 'BdT 248.1', 'Guiraut Riquier', 'Occitan', 'R', '104v (CVIv)', 1, 1, '[\"F3 G aGah aG b} F a baGF G\\naGah aG GaGF EDE F \'F3 ED EDC\\nG a h ch a G chaG\\nGah aG GaGF EDE G aGFE \'F3 GF\\nF G a aGah aGFEF GFE F\\na h chcd D EDEF EDC C\\nE G \'F3 aGah aGF a haGF G \",\"F3 G aGah aG b} F a baGF G \'aGah aG GaGF EDE F\\nF3 ED EDC \'G a h ch a G chaG \'Gah aG GaGF EDE G aGFE\\nF3 GF \'F G a aGah aGFEF GFE F \'a h chcd D EDEF EDC C \'E G\\nF3 aGah aGF a haGF G \"]', '[\"Ab lo temps a-gra-dieu gay\\nle cors mieu blons de bon grat\\nqu’ieu am, a mon cor, co-mes\\nde far vers a-dre-chu-rat\\ne far l’ay de ma-scles motz,\\nab tot lo nom-bre de seth,\\net ab bel chant pla-zen-tier.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f220.item.zoom\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 306, \"facsimileY\": 696, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 270, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
