(155, 'Ab pauc er decazutz', 'BdT 248.2', 'Guiraut Riquier', 'Occitan', 'R', '105r (CVIr)', 1, 1, '[\"C2 d c d h G a\\nh c h a Ga GF\\nG a h \'C2 c ha h\\nd c d h G a\\nh c h a Ga GF\\nG \'C2 a h ch ha aG\\nh c d e fedc d\\ne g f \'C2 d efed dc\\nh c d e dch haG\\nahaG F GFGa c edc d\\ncdch \'C2 a G aGah aGF G\",\"C2 d c d h G a \'h c h a Ga GF \'G a h\\nC2 c ha h \'d c d h G a \'h c h a Ga GF \'G\\nC2 a h ch ha aG \'h c d e fedc d \'e g f\\nC2 d efed dc \'h c d e dch haG \'ahaG F GFGa c edc d \'cdch\\nC2 a G aGah aGF G\"]', '[\"Ab pauc er de-scau-zitz,\\nA-mor, e re-ma-zutz\\ntotz mos a-for-ti-mens\\npus de Mi-dons a-iutz\\ngen se-latz ni sau-butz\\nno∙m ven; car le tur-mens\\nm’au-si que∙m datz e∙m vens\\ne no m’en puesc ai-dar\\nab ren mai ab chan-tar,\\ne chans es al de-ios\\nper qu’ieu soy de joy blos.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f221.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 158, \"facsimileY\": 482, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(156, 'Aisi com selh que franchamens estay', 'BdT 248.5', 'Guiraut Riquier', 'Occitan', 'R', '104r (CVr)', 1, 1, '[\"C1 F G a a a h a G a GF\\nF G FED \'F3 F E F G a haG G\\nF G a a a h a G a \'C1 GF\\nF G FED F E F G a haG G\\nF G a a ah \'F3 aG ah c(h) aGF F\\nF G FED F E F G a haG G \'\\nF3 F E F G F G a G F EDC D\\nD E \'F3 F G G a G FE D DC\\nC D F F G ah \'F3 a G F EDC D\",\"C1 F G a a a h a G a GF \'F G FED\\nF3 F E F G a haG G \'F G a a a h a G a\\nC1 GF \'F G FED F E F G a haG G \'F G a a ah\\nF3 aG ah c(h) aGF F \'F G FED F E F G a haG G \'\\nF3 F E F G F G a G F EDC D \'D E\\nF3 F G G a G FE D DC \'C D F F G ah\\nF3 a G F EDC D\"]', '[\"Ai-si com selh que fran-cha-mens e-stay\\ne ses re-gartz, e·s met en ser-vi-tut\\nde tal se-nhor, que pus l’a re-ceu-but\\nper sieu li fai far son po-der e may,\\no fi yeu be qu’e-sta-va fran-cha-men\\ncant ad A-mor me diey, car man-te-nen\\nque li·m fuy datz me mes en tal me-scla-nha\\non cug mu-rir qu’ilh no·m val ni·m de-fen,\\nni n’aus is-sir ni say com i re-ma-nha.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f219.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 131, \"facsimileY\": 1488, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(157, 'Aissi pert poder amors', 'BdT 248.6', 'Guiraut Riquier', 'Occitan', 'R', '103v (CIVv)', 1, 1, '[\"F3 F G a a a aGahaG F\\na a a G a \'C2 h aG GF\\nF3 E F G aG F EDC F\\nF a G a h a aGFE \'F3 F\\na c cch a a aGah aGF\\nE F G aG F EDC FGa \'\\nF3 a c cdch aGF G E FED\\nD D F G aGF GaGE F \",\"F3 F G a a a aGahaG F \'a a a G a\\nC2 h aG GF \'F3 E F G aG F EDC F \'F a G a h a aGFE\\nF3 F \'a c cch a a aGah aGF \'E F G aG F EDC FGa \'\\nF3 a c cdch aGF G E FED \'D D F G aGF GaGE F \"]', '[\"Ai-si pert po-der A-mors\\ncom ricx homs cant pert sa ren-da\\ne∙l sieu e sos va-le-dors\\nper que hom non la re-pren-da:\\ncar Joys l’es e Pros fa-lhitz\\nque ca-scus e-ra sos guitz;\\na-quest de-strenh Co-bei-tatz\\ne si∙s fai Chant e So-latz.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f218.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 854, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(158, 'Aissi quon es sobronrada', 'BdT 248.7', 'Guiraut Riquier', 'Occitan', 'R', '104v (CVv)', 1, 1, '[\"F2 DC D FED DCD FEF G aGF GF\\nFED DCD F FEFGF FED EDC D \'\\nF2 DC D FED DCD FEF G aGF GF\\nFED DCD F FEFGF FED EDC D\\nFGaG FEDC D\\na \'F3 ahaGa FEDE\\nG ahaG a\\nD EF EDC D EFG FE\\nFEFG FED DC\\nF G ah aGF G \'F3 ahc chhaGF\\nF a cd chaG GFED EDC D\\nF G ah aG FED D DCDE \'F2 DC\\nC D EF EDC D E FED E\\nG a G aGF FED FEFG FEDC \'F2 CD \",\"F2 DC D FED DCD FEF G aGF GF \'FED DCD F FEFGF FED EDC D \'\\nF2 DC D FED DCD FEF G aGF GF \'FED DCD F FEFGF FED EDC D \'FGaG FEDC D \'a\\nF3 ahaGa FEDE \'G ahaG a \'D EF EDC D EFG FE \'FEFG FED DC \'F G ah aGF G\\nF3 ahc chhaGF \'F a cd chaG GFED EDC D \'F G ah aG FED D DCDE\\nF2 DC \'C D EF EDC D E FED E \'G a G aGF FED FEFG FEDC\\nF2 CD \"]', '[\"Ai-si com es so-bron-ra-da\\nla Mai-re del Sal-va-dor\\ndeu es-ser, hon-ran, lau-za-da\\ncar sin-gu-lars de va-lor\\nfo et es,\\nde totz bes\\ncom-pli-da,\\nclaus de ve-ra vi-da,\\ngra-zi-da;\\ne doncx so-bi-ras de-vers\\nm’es que s’es-fors mos sa-bers,\\ntant que∙l sï-a d’a-gra-dat-ge\\nsos laus, que tenc en co-rat-je,\\nc’ab so-bre-vo-ler co-men-sa.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f220.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 784, \"facsimileY\": 507.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 320, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(159, 'A mon dan sui esforcius', 'BdT 248.8', 'Guiraut Riquier', 'Occitan', 'R', '104r-v (CVr-v)', 1, 1, '[\"F3 D C DCD F FEF GaGF FED DC\\nF G a DCD EFED DC D\\nD \'F2 C DCD F F GaGF FED\\nF G a DCD EFED C D\\na \'F3 G ah aGF F GaGF F\\nFED DC F G a ahaG a\\na GFE D DC \'F3 D EDC D\\nF G a DC F GahaG aGF\\nFGa GFE DCD F \'F3 F a GFE ED\",\"F3 D C DCD F FEF GaGF FED DC \'F G a DCD EFED DC D \'D\\nF2 C DCD F F GaGF FED \'F G a DCD EFED C D \'a\\nF3 G ah aGF F GaGF F \'FED DC F G a ahaG a \'a GFE D DC\\nF3 D EDC D \'F G a DC F GahaG aGF \'FGa GFE DCD F\\nF3 F a GFE ED\"]', '[\"A mon dan soy e-sfor-sie-us\\na sem-blan-sa del lay-ro,\\nque·s met en luec re-gar-dieus\\nde sa mort tant li sap bo\\nfar lo fag don lä en-quier,\\na-tres-si·m fay a-be-lir\\nso, don sai que dey mu-rir,\\nA-mors e pus huey que ier,\\ncar silh q’eu pus am m’a-zi-ra.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f219.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 726, \"facsimileY\": 1502.5, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(160, 'Amors, pos a vos faill poders', 'BdT 248.10', 'Guiraut Riquier', 'Occitan', 'R', '104r (CVr)', 1, 1, '[\"F3 F G a aGah aGFE G aaG GF\\nG aG FE G ahaG \'F3 FE FG a\\na aG FE G a h a haG\\nE F \'F3 G aG FE G FE F\\na aG FE G a ha haG\\nE \'F3 F G aG F GFE G\\na a aGah aG aG FE G ah \'F3 aGF FE\\nF G aGF h a G FGF FED DE F\",\"F3 F G a aGah aGFE G aaG GF \'G aG FE G ahaG\\nF3 FE FG a \'a aG FE G a h a haG \'E F\\nF3 G aG FE G FE F \'a aG FE G a ha haG \'E\\nF3 F G aG F GFE G \'a a aGah aG aG FE G ah\\nF3 aGF FE \'F G aGF h a G FGF FED DE F\"]', '[\"A-mors, pus a vos falh po-ders\\nJois ab Pretz que∙us e-ran cap-tenh\\nque Co-bei-tatz vey que∙ls de-strenh,\\nde mort pot es-ser mos e-spers:\\nyeu o planc, car es mos dans,\\nmais lo vo-stre planc dos tans\\ncar el meu dan per-drai yeu so-la-mens\\net el vo-stre to-ta∙l ge-ne-ral gens.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f219.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 132, \"facsimileY\": 652, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(161, 'Anc mais per aital razo', 'BdT 248.12', 'Guiraut Riquier', 'Occitan', 'R', '108r (CIXr)', 1, 1, '[\"F3 F FEEDE b} FE G GabaG GFE G\\na aG GFE \'F3 G ah aGE F\\nF FEEDCD FE G GabaG GFE G\\na aG \'F3 GFE G ab aGE F\\nb} a b c h a haG ha\\naGF \'F3 E G ahaG F FEE DC\\nFE F G ahaG F GFE G\\na aG GFE \'F3 F EDCD DE F\\nC2b} b c d e fe ch ahaG ha\\naGF F G h \'C2 dc h ahaG aG\",\"F3 F FEEDE b} FE G GabaG GFE G \'a aG GFE\\nF3 G ah aGE F \'F FEEDCD FE G GabaG GFE G \'a aG\\nF3 GFE G ab aGE F \'b} a b c h a haG ha \'aGF\\nF3 E G ahaG F FEE DC \'FE F G ahaG F GFE G \'a aG GFE\\nF3 F EDCD DE F \'C2b} b c d e fe ch ahaG ha \'aGF F G h\\nC2 dc h ahaG aG\"]', '[\"Hanc may per ay-tal ra-zon\\nno fuy de chant em-bar-guatz\\nqu’er soy per joy tan so-bratz,\\nque mos sa-bers no∙m ten pro\\nper chan-tar del gran pla-zer\\nqu’ieu hai se-gon mon de-ver.\\ncar say mon se-nhor es-tort,\\nN’Ai-me-ric de pieytz de mort\\nad ho-nor, don cais per-du-da\\nes Nar-bo-na re-ven-gu-da.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f227.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 194, \"facsimileY\": 1219, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
