(163, 'Be·m meravilh co non es enveyos', 'BdT 248.18', 'Guiraut Riquier', 'Occitan', 'R', '104v (CVv)', 1, 1, '[\"F4 E FED DC D F G a a ahaG aGF\\nG ab aG aGF G \'F3 a GFE D EDC D\\nE FED DC D F G a a ahaG aGF \'\\nF3 G ah aG aGF G a GFE DCD a ccdchaG cdch\\na c dcd G a aGF \'F3 E FED F2 EDC CD\\nE FED DC D F3 F G a a ahaG aGF\\nG ab aG \'F3 aGF G a GFE DCD F EDC CD \",\"F4 E FED DC D F G a a ahaG aGF \'G ab aG aGF G\\nF3 a GFE D EDC D \'E FED DC D F G a a ahaG aGF \'\\nF3 G ah aG aGF G a GFE DCD a ccdchaG cdch \'a c dcd G a aGF\\nF3 E FED F2 EDC CD \'E FED DC D F3 F G a a ahaG aGF \'G ab aG\\nF3 aGF G a GFE DCD F EDC CD \"]', '[\"Be·m me-ra-vilh co non es en-ve-yos\\ntotz homs de pretz con-que-rer men-tre vieu:\\ncar pretz ve-ray per mort no pert son brieu,\\ndonc el es claus de bos faitz ses fa-lhen-sa,\\ne pretz non es res mas lau-zor de gens\\ne∙l lau-zors ven dels bos cap-te-ne-mens\\ne bos cap-tenhs de ve-ra co-nois-sen-sa.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f220.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 281, \"facsimileY\": 1424, \"Annotations\": true, \"FontSizeOld\": 18, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(164, 'Be·m volgra d\'Amor partir', 'BdT 248.19', 'Guiraut Riquier', 'Occitan', 'R', '104v (CVv)', 1, 1, '[\"F2 a aGFG a GFE D EDC D\\nEF EDC D E F ED E \'\\nF3 Ga ah aGF G a ahaG a\\na aGFG a GFE D EDC D\\nEF \'F3 EDC D E G a GFGa GFE\\nG a h ch a haG a\\nC2 a h c dcde G aGF E \'\\nF3 D E F Ga GFE D ED\\nD E FED aGFE G FED CD\",\"F2 a aGFG a GFE D EDC D \'EF EDC D E F ED E \'\\nF3 Ga ah aGF G a ahaG a \'a aGFG a GFE D EDC D \'EF\\nF3 EDC D E G a GFGa GFE \'G a h ch a haG a \'C2 a h c dcde G aGF E \'\\nF3 D E F Ga GFE D ED \'D E FED aGFE G FED CD\"]', '[\"Be·m vol-gra d’A-mor par-tir,\\nen-dreg Mi-dons de-zi-rar\\npus nulh se-cors no·m vol far,\\nmay non puesc; per que? M’al-bir,\\nque fols es qui s’a-ban-do-na\\na de-zi-rar nu-lha re\\nses e-spe-ran-sa de be\\na-ver e·l bes sï-a tals\\nque tos-temps sï-a vi-dals.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f220.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 796, \"facsimileY\": 1113, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
