(166, 'De far chanso soy marritz', 'BdT 248.23', 'Guiraut Riquier', 'Occitan', 'R', '105r (CVIr)', 1, 1, '[\"C1 c c dch aGa ahcha aG a\\naGF G a aGah aG a GFE \'F3 FED\\nFE DC F G a ahc chhaG GF\\nFEF G a ahc chhaG GahaG G\\nG \'C1 a h ch aGF GaGFE E\\nFE D FEF GaG FE DE DEDC\\nG aGF GahaG GFE D \'F2 EDC CD \",\"C1 c c dch aGa ahcha aG a \'aGF G a aGah aG a GFE\\nF3 FED \'FE DC F G a ahc chhaG GF \'FEF G a ahc chhaG GahaG G \'G\\nC1 a h ch aGF GaGFE E \'FE D FEF GaG FE DE DEDC \'G aGF GahaG GFE D\\nF2 EDC CD \"]', '[\"De far chan-so soy mar-ritz,\\nnon que sa-bers m’en so-fra-nha\\nni ra-zos ni res que y ta-nha,\\nni dom-ney ni gay so-latz\\npre-gai-re, ni faitz hon-ratz\\ne car silh no∙m vol va-ler\\nqu’ieu de-zir ses nulh vo-ler.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f221.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 819, \"facsimileY\": 467, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 22, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
