(170, 'Fis e verais e pus ferm que no suelh', 'BdT 248.29', 'Guiraut Riquier', 'Occitan', 'R', '106r (CVIIr)', 1, 1, '[\"C2 f fede f edcc a cdch ah aGFE FEFG a\\na aGa ha \'C2 aGF E FEFG a ha haG GF\\nf fede f edcc a cdch \'C2 ah aGFEF G a\\nb} a aGa ba aGF E FG b} a ba baG GF \'\\nC2 a b} c cb aG b d c cba ab c\\nf fed ef edc b} a cdcb \'C1b} ab aGFE FEFG a\\na aGa ba aGF E FEFG a ba baG GF \",\"C2 f fede f edcc a cdch ah aGFE FEFG a \'a aGa ha\\nC2 aGF E FEFG a ha haG GF \'f fede f edcc a cdch\\nC2 ah aGFEF G a \'b} a aGa ba aGF E FG b} a ba baG GF \'\\nC2 a b} c cb aG b d c cba ab c \'f fed ef edc b} a cdcb\\nC1b} ab aGFE FEFG a \'a aGa ba aGF E FEFG a ba baG GF \"]', '[\"Fis e ve-rais e pus ferm que no suelh\\nsoy vas A-mor en-dreg mon Bel De-port,\\nnon que m’a-ja fag sem-blan de co-nort,\\nmas que·m so-ve qui fuy ans que a-mes\\ne que·m cos-sir qui fo-ra ses A-mor,\\nez aug, per qui·m te-no·l co-noys-se-dor,\\nper qu’ieu am fis car d’a-mar ay l’e-nans.\"]', '[\"Notes: \\nF-clefs on the third line of the first and second manuscript staff are erased.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f223.item.zoom\", \"Plica\": false, \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 163, \"facsimileY\": 1578, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
