(179, 'Los bes qu\'eu trop en amor', 'BdT 248.53', 'Guiraut Riquier', 'Occitan', 'R', '106v (CVIIv)', 1, 1, '[\"C1 F EDC D F F GFE ED\\nE FED DC CD \'F3 F FGa GF\\nF G a G FE D DC\\nC D F E FED \'F3 DC D\\nD a a ah c haG ahaG\\nG a h c a(G) \'F3 F GaGF\\nF a c cd cd chaGa GFED\\nE F G Ga Ga \'F3 FED DC\\nC CD F FG a GFE FED\",\"C1 F EDC D F F GFE ED \'E FED DC CD\\nF3 F FGa GF \'F G a G FE D DC \'C D F E FED\\nF3 DC D \'D a a ah c haG ahaG \'G a h c a(G)\\nF3 F GaGF \'F a c cd cd chaGa GFED \'E F G Ga Ga\\nF3 FED DC \'C CD F FG a GFE FED\"]', '[\"Los bes qu’ieu truep en a-mor\\na sa-bor que·m fan chan-tar\\ntan so-ven e de-zi-rar\\nab grat creis-si-men d’o-nor\\ntot jorn de mon b[...] .. ..\\na cuy m’au-trey ferms e fis\\ncar gent m’a d[...] .. .. ..\\n[...] sos pla-zers m’es pla-zens\\nd[...] .. .. pla-zer ma-nens.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f224.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 901, \"facsimileY\": 1227, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(180, 'Mot me tenc ben per paguatz', 'BdT 248.56', 'Guiraut Riquier', 'Occitan', 'R', '105v (CVIv)', 1, 1, '[\"C1 a aGa GFE FG a aGa GFED\\nC CD F GFE D EDC \'F3 CD\\na aGa GFE FG a aGa GFED\\nC CD F GFE D EDC \'CD\\nFE FG a ah c ch ahaGa GF\\nF FG a aGa \'F3 FE FG a\\na c d dc a ch aGF\\nFG a D F \'F3 a GFEF GFED DC\\nC CD F GF E D FEDC CD\",\"C1 a aGa GFE FG a aGa GFED \'C CD F GFE D EDC\\nF3 CD \'a aGa GFE FG a aGa GFED \'C CD F GFE D EDC\\nCD \'FE FG a ah c ch ahaGa GF \'F FG a aGa\\nF3 FE FG a \'a c d dc a ch aGF \'FG a D F\\nF3 a GFEF GFED DC \'C CD F GF E D FEDC CD\"]', '[\"Mot me tenc ben per pa-guatz\\ndel sa-ber que m’es ven-gutz\\nper ben a-mar, non a-matz,\\nma do-na; car men-ta-gutz\\nne soy e n’ay be-vo-len-sa\\ndels pros, doncx be∙m val sa-bers\\ncent ai-tans d’au-tres va-lers;\\nqu’ieu ay d’a-mar lieis va-len-sa\\ntal on no s’en-ten fa-lhen-sa.\"]', '[\"Notes:\\n4.7-6.4: Although the clef is missing on the third stave, the pitch of the notes can be determined with certainty, as the notes on 4.7 must correspond to those in 2.7 (CD). The pitch is therefore consistent with the preceding and following staves, both of which are marked with an F-clef on the third line (counting from the top).\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f222\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"FontSizeModern\": \"21\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"A B A B C D E F B\'\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 1}', 2, 10),
(181, 'Non cugey mais d’esta razo chantar', 'BdT 248.57', 'Guiraut Riquier', 'Occitan', 'R', '110v (CXIv)', 1, 1, '[\"F3 a a aGa aGF FG a Ga GFED DCD F\\nF FEF aGF \'F2 FED C DE F aGF FE D\\na a aGa aGF FG a Ga GFED DCD F \'\\nF3 F FEF aGF FED DC DE F aGFE FE D\\nDCD FEF G a \'C1 ah c ch aGF Ga aGF\\na c d dc a aGF F Ga FED F\\nFG \'F3 a Ga aGF G a Ga GFE D DC\\nDCD FEF G aGF FG ahaGa\",\"F3 a a aGa aGF FG a Ga GFED DCD F \'F FEF aGF\\nF2 FED C DE F aGF FE D \'a a aGa aGF FG a Ga GFED DCD F \'\\nF3 F FEF aGF FED DC DE F aGFE FE D \'DCD FEF G a\\nC1 ah c ch aGF Ga aGF \'a c d dc a aGF F Ga FED F \'FG\\nF3 a Ga aGF G a Ga GFE D DC \'DCD FEF G aGF FG ahaGa\"]', '[\"Non cu-gey mais d’es-ta ra-zo chan-tar\\npus no·m des-treis le nes-sis de-zi-riers\\ndel Bel De-port, c’ab mo sa-ber es-tiers\\ncu-ja-va pro pes-sieus mon temps pas-sar\\ncar mas chan-sos per ric sen-hor va-len\\nno s’en-ten-det, si que m’en fetz par-ven,\\nmas e-ras chant que ben leu m’en-ten-dra,\\ntals qu’en-que-ras ben en\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f232.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 267, \"facsimileY\": 1630, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(182, 'No·m say d’Amor si m’es mala o bona', 'BdT 248.58', 'Guiraut Riquier', 'Occitan', 'R', '104r (CVr)', 1, 1, '[\"C1 C D E FED E F G FE D EFED DC\\nC D F \'F3 F G F EDC DE F EDC D\\nC D E FED E F G FE \'F3 D EFED DC\\nC D F F G F EDC DE F EDC D\\nE G a GF \'F3 E DC D E F GaGF FE\\nG a h chcd G a GF E G ahaG a \'\\nF3 c d G aGFE G a D EF G FED DC\\nC D E FED \'F3 a GFE DC DEF GaG FEDC D \",\"C1 C D E FED E F G FE D EFED DC \'C D F\\nF3 F G F EDC DE F EDC D \'C D E FED E F G FE\\nF3 D EFED DC \'C D F F G F EDC DE F EDC D \'E G a GF\\nF3 E DC D E F GaGF FE \'G a h chcd G a GF E G ahaG a \'\\nF3 c d G aGFE G a D EF G FED DC \'C D E FED\\nF3 a GFE DC DEF GaG FEDC D \"]', '[\"No·m say d’A-mor si m’es ma-la o bo-na,\\no·m val o·m notz, o·m man-ten o·m a-zi-ra,\\nni say de mal ni de ben cals se so-bra,\\nni no co-nosc si m’a-le-via o·m car-gua,\\nni en-ten-di si·m dic ver o mes-son-ja,\\nni si vauc dreg o tenc vi-a tra-ver-sa,\\nqu’est pes-sa-mens me de-strenh e·m ta-bor-na\\ndon trac trop pieitz que selh c’om vieus e-sco-rja.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f219.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 802, \"facsimileY\": 831, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(183, 'Ogan no cugei chantar', 'BdT 248.60', 'Guiraut Riquier', 'Occitan', 'R', '106r (CVIIr)', 1, 1, '[\"F3 C D F FEFGF FED EFED DC\\nC D F FEFGF FED DCD \'F3 F\\nF G a GFE D EFED DC\\nD E F GFE D DC D \'\\nF3 b} a baGa GF G FED EF G\\nF G a ah cch aGahaG G\\na c ha \'F3 c cd D aGFE\\nD FEDCD F FGaG FEDE FEDC D \",\"F3 C D F FEFGF FED EFED DC \'C D F FEFGF FED DCD\\nF3 F \'F G a GFE D EFED DC \'D E F GFE D DC D \'\\nF3 b} a baGa GF G FED EF G \'F G a ah cch aGahaG G \'a c ha\\nF3 c cd D aGFE \'D FEDCD F FGaG FEDE FEDC D \"]', '[\"O-guan no cu-giey chan-tar\\nd’a-mors, mas d’au-truj ra-zon\\nm’es obs a fai-re chan-so:\\ntals m’o a vol-gut man-dar\\nqu’ieu dey de grat o-be-zir\\ne pus chant per son vo-ler,\\nsi sol y puesc a-ve-nir,\\nchan-tar dey al sieu pla-zer.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f223.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 715, \"facsimileY\": 1091, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(184, 'Ops m\'agra que mos volers', 'BdT 248.61', 'Guiraut Riquier', 'Occitan', 'R', '108v (CIXv)', 1, 1, '[\"F3 a a GFE EDC F GabaG G\\nF GF FED DC DCDE G FEDC CD \'\\nF3 D E G GFE G b} a baG a\\nGF EDC E GFE DE FEDC D\\nD E \'F3 G GFG FEDE FED D\\nE G a G ahc haG aGah\\nc dc haG aG FED EFED \'F3 EDC\\nE G ahc haG FEDE GF-FEDC D\",\"F3 a a GFE EDC F GabaG G \'F GF FED DC DCDE G FEDC CD \'\\nF3 D E G GFE G b} a baG a \'GF EDC E GFE DE FEDC D \'D E\\nF3 G GFG FEDE FED D \'E G a G ahc haG aGah \'c dc haG aG FED EFED\\nF3 EDC \'E G ahc haG FEDE GF-FEDC D\"]', '[\"Obs m\'a-gra que mos vo-lers\\ns\'a-cor-des ab m\'en-ten-den-sa,\\nab sen et ab co-nois-sen-sa,\\nper que·s com-plis mos es-pers;\\nmas no·l puesc a-po-de-rar,\\nans me fa for-satz pas-sar\\nso-ven o-tra mon de-ver\\nab pe-zar o ab pla-zer.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f228.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 278, \"facsimileY\": 120, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(185, 'Per proar si pro privatz', 'BdT 248.62', 'Guiraut Riquier', 'Occitan', 'R', '107v (CVIIIv)', 1, 1, '[\"F3 aah a GFE EDC F GahaG G\\nE GFFED C DCDEF GFFED EDC D \'\\nF3 aah a GFE EDC F GahaG G\\nE GFFED C DCDEF GFFED EDC D\\nE F \'F3 G Gah aGF GahaG a\\na c d G ah aG aGF\\nFGah aG aG FED \'F3 DC DCDF GFED\",\"F3 aah a GFE EDC F GahaG G \'E GFFED C DCDEF GFFED EDC D \'\\nF3 aah a GFE EDC F GahaG G \'E GFFED C DCDEF GFFED EDC D \'E F\\nF3 G Gah aGF GahaG a \'a c d G ah aG aGF \'FGah aG aG FED\\nF3 DC DCDF GFED\"]', '[\"Per pro-ar si pro pri-vatz\\nm’es mos sa-bers men-ta-gutz,\\nvuelh va-len vers far vi-atz\\no-brat d’o-bra, don ja brutz\\nno cre que∙n cres-ca∙ls ca-bals,\\ndon dans m’a dat des-co-nort,\\ntan vei tro-bar trist a tort.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f226.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 258, \"facsimileY\": 1268, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(186, 'Ples de tristor, marritz e doloiros', 'BdT 248.63', 'Guiraut Riquier', 'Occitan', 'R', '105v (CVIv)', 1, 1, '[\"F3 a a ahaG G a h c h aGF F\\nF G \'F3 a a a GFE DC DEFE EDC C\\na a ahaG G a h c h aGF \'F3 F\\nF G a a a GFE DC DEFE EDC C\\nG G G aGF \'F3 G a cd c haG aGFG FE\\nE G G a G c ha hcha aG a \'\\nF3 c d ch aGF G b} a b a Ga FED DC\\nC D F F a cd chaGa \'F3 FED EDC CD\",\"F3 a a ahaG G a h c h aGF F \'F G\\nF3 a a a GFE DC DEFE EDC C \'a a ahaG G a h c h aGF\\nF3 F \'F G a a a GFE DC DEFE EDC C \'G G G aGF\\nF3 G a cd c haG aGFG FE \'E G G a G c ha hcha aG a \'\\nF3 c d ch aGF G b} a b a Ga FED DC \'C D F F a cd chaGa\\nF3 FED EDC CD\"]', '[\"Ples de tri-stor, mar-ritz e do-loi-ros\\nco-mens est planh per lo dan re-men-brar\\ne per lo dol que tart deu o-bli-dar,\\nque Nar-bo-nes so-sten tant an-gois-sos,\\nper la greu mort del se-nhor de Nar-bo-na,\\ndel Ve-scom-te n’A-mal-ric, mo se-nhor,\\ndon deu a-ver tre-balh to-ta gent bo-na\\ne la su-a pus lonc temps e ma-jor.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f222.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 233, \"facsimileY\": 601, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(187, 'Pos astres no m\'es donatz', 'BdT 248.65', 'Guiraut Riquier', 'Occitan', 'R', '110v (CXIv)', 1, 1, '[\"F3 D EDE C E G F GFE\\nD DE G GF D EDC D \'F3 E\\nD EDE C E G F GFE\\nD DE G GF D \'F2 EDC D E\\nE FG G a G aGF E\\nE GF E F1 ED C CD EF EDC\\nC \'F2 DE G a G aGF E\\nD DEF E FED C CD E E\\nE GF E ED \'F2 E EF EDC\\nE GF E ED EF EDC D \",\"F3 D EDE C E G F GFE \'D DE G GF D EDC D\\nF3 E \'D EDE C E G F GFE \'D DE G GF D\\nF2 EDC D E \'E FG G a G aGF E \'E GF E F1 ED C CD EF EDC \'C\\nF2 DE G a G aGF E \'D DEF E FED C CD E E \'E GF E ED\\nF2 E EF EDC \'E GF E ED EF EDC D \"]', '[\"Pus as-tres no m’es do-natz\\nque de Mi-dons be m’es-cha-ia,\\nni nulhs mos pla-zers no∙l platz,\\nni ai po-der que∙m n’es-tra-ia\\nobs m’es que sï-a fon-datz\\nen vi-a d’a-mor ve-ra-ia;\\ne puesc n’a-pen-re as-satz\\nen Ca-tha-lue-nha la gua-ia\\nen-tre∙ls Ca-ta-las va-lens\\ne las do-nas a-vi-nens.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f232.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 297, \"facsimileY\": 210, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(188, 'Pus sabers no·m val ni sens', 'BdT 248.66', 'Guiraut Riquier', 'Occitan', 'R', '107v (CVIIIv)', 1, 1, '[\"F3 F G a a aGahaG GFE F\\nD FEEDC E G aGF FED DE F \'\\nF3 F G a a aGahaG GFE F\\nD FEEDC E G aGF FED DE F\\nD E F \'F3 G aGFG FE F\\nF Ga GFE G b} a ba baG\\na h c h a _baG bahaGa GF\\nF \'F3 Ga GFE G a b} ba baG\\na h c h a haG hahaGa GF\\nG FG \'F3 FEDE C ED DE F \",\"F3 F G a a aGahaG GFE F \'D FEEDC E G aGF FED DE F \'\\nF3 F G a a aGahaG GFE F \'D FEEDC E G aGF FED DE F \'D E F\\nF3 G aGFG FE F \'F Ga GFE G b} a ba baG \'a h c h a _baG bahaGa GF \'F\\nF3 Ga GFE G a b} ba baG \'a h c h a haG hahaGa GF \'G FG\\nF3 FEDE C ED DE F \"]', '[\"Pus sa-bers no·m val ni sens\\nc’as A-mor aus res des-di-re\\nque·m fas-sa vo-ler, par-vens\\nm’es, c’a-man, me deu aus-si-re,\\ntant li soy o-be-di-ens;\\nqu’ieu a-vi-a ma-la-nans\\nes-tat d’ans vint fis a-mai-re\\ne pueys a·m ten-gut cinc ans\\ngue-rit ses joy del mal-trai-re:\\ne-ras ai de mal dos tans.\"]', '[\"Notes: This <i>canso redonda</i> is accompanied by a special rubric specifing that the first part of the melody (ll. 1-5) and the second part of the melody (ll. 6-10) are inverted in the second, fourth and sixth stanzas («Canso redonda et encadenada de motz e de so d\'en Gr. Riquier, facha l\'an m.cc.lxxxii. en abril. E·l so de la cobla segonda pren se el miech de la primieira e sec se tro la fi, pueys torna al comensamen e fenis el mieg aisi co es senhat; et aisi canta se la iiij.a e la vi.a, e la tersa e la v.a aisi co la premieira; e no·y cap retornada»). A cross between the end of the fifth and beginning of the sixth line indicates the division between the two parts of the melody\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f226.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 233, \"facsimileY\": 706, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10);
INSERT INTO `mm_staves_stored` (`id_staves`, `title`, `id`, `author`, `language`, `ms`, `f`, `modernStyle`, `oldStyle`, `staves`, `text`, `annotations`, `settings`, `visibility`, `id_user`) VALUES
(189, 'Car Dregz ni Fes', 'BdT 248.67', 'Guiraut Riquier', 'Occitan', 'R', '105r-v (CVIr-v)', 1, 1, '[\"F3 c d ch aGF\\nFEFG a cd chah aG a\\naGF G a a\\na \'F4 baGa F3 GFE D EF G\\nc d ch aGF\\nFEFG a cd chah aG a\\naGF \'F3 G a a\\nG a GFE D EDC D\\nFGa GFE D FEFG FE \'\\nF3 G aGah F2 D EDC C\\nE FG aGF G F3 ah cd cha\\nahch aG c \'C1 dch a haG Ga \",\"F3 c d ch aGF \'FEFG a cd chah aG a \'aGF G a a \'a\\nF4 baGa F3 GFE D EF G \'c d ch aGF \'FEFG a cd chah aG a \'aGF\\nF3 G a a \'G a GFE D EDC D \'FGa GFE D FEFG FE \'\\nF3 G aGah F2 D EDC C \'E FG aGF G F3 ah cd cha \'ahch aG c\\nC1 dch a haG Ga \"]', '[\"Car Dretz ni Fes,\\nni Sens ni Li-al-tatz,\\nni bo-n’A-mor\\nno son en-tre las gens,\\nni Ka-ri-tatz\\nno∙y re-nha ni Mer-ces,\\nqu’En-jans los vens\\nqu’es ab Co-bei-tat sors,\\nes mals tant mon-tatz\\ne bes tant bays-satz\\nqu’els bos faitz vey e-scar-nitz\\ne∙ls vils pre-zatz e gra-zitz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f221.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 767, \"facsimileY\": 1698, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(190, 'Qui·m disses non a dos ans', 'BdT 248.68', 'Guiraut Riquier', 'Occitan', 'R', '107r (CVIIIr)', 1, 1, '[\"C1 F G a a a aGaha aGaGF\\nG aGF G aG \'F3 FED DC D\\nF G a a a aGaha aGaGF\\nG aGF G aG FED \'F3 DC D\\nE F G G G aGaGF Ga\\na c ch a GF \'C1 GaG aGaGF\\na c d c dcde dch aGF\\nG a aGa D F GFE FEDC \'\\nF2 CD F G aGaGF C1 a cchhaG ahaG\",\"C1 F G a a a aGaha aGaGF \'G aGF G aG\\nF3 FED DC D \'F G a a a aGaha aGaGF \'G aGF G aG FED\\nF3 DC D \'E F G G G aGaGF Ga \'a c ch a GF\\nC1 GaG aGaGF \'a c d c dcde dch aGF \'G a aGa D F GFE FEDC \'\\nF2 CD F G aGaGF C1 a cchhaG ahaG\"]', '[\"Qui·m dis-ses non a dos ans\\nque·l laus me fos des-gra-zitz\\ndel rey n’Am-fos, de pretz guitz,\\nmot me fo-ra greus a-fans;\\nqu’er es tant vil ten-gutz sai\\ne blas-matz que sol par-lar\\nnon aus de luy ad ho-nor,\\ndon ai al cor tal do-lor\\nc’ap pauc chant non de-zam-par.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f225.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 178, \"facsimileY\": 947, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 290, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(191, 'Qui·s tolgues', 'BdT 248.69', 'Guiraut Riquier', 'Occitan', 'R', '107v (CVIIIv)', 1, 1, '[\"F3 a aGaha aGaGF FGaG FEDCD F\\nG aGa FE D FEF G\\nF G \'F3 a aGaha aGFG aGaGF\\nG aGa FED EFED DC D\\na aGaha aGaGF FGaG FEDCD F \'\\nF3 G aGa FE D FEF G\\nF G a aGaha aGFG aGaGF\\nG aGa FED EFED DC D \'\\nF3 a c dchcd dchcd cha aGaGF\\nFGah aGa FEDE GFE FEDC D\",\"F3 a aGaha aGaGF FGaG FEDCD F \'G aGa FE D FEF G \'F G\\nF3 a aGaha aGFG aGaGF \'G aGa FED EFED DC D \'a aGaha aGaGF FGaG FEDCD F \'\\nF3 G aGa FE D FEF G \'F G a aGaha aGFG aGaGF \'G aGa FED EFED DC D \'\\nF3 a c dchcd dchcd cha aGaGF \'FGah aGa FEDE GFE FEDC D\"]', '[\"Qui·s tol-gues e·s ten-gues\\ndels mals en que cos-sen,\\ne fe-zes totz los bes\\nque co-nois ez en-ten,\\nres non es que no-gues\\nd’a-nar a sal-va-men\\nals re-pres, on la fes\\nes de Dieu, que·ns a-ten,\\nc’a bon port nos trais-ses\\nsa mer-ce pro-me-ten.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/canvas/f226\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"21\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60004306/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(192, 'Razos m’aduy voler q’ieu chant soven', 'BdT 248.71', 'Guiraut Riquier', 'Occitan', 'R', '106v (CVIIv)', 1, 1, '[\"C2 a a b} a baG E FED F GahaGa GF G\\nF E EDEF \'F3 EDC E G F EDE FEDC D\\nb} a a a haG E FED F GahaG aGF G \'\\nC1 F E EDEF EDC E G F EDE F EDC D\\nF G a a ah \'F3 c ch aGF GaGF FE\\nE E F ED EF G aGF b} G ahaG a \'\\nF3 c d G ah c h aGF G aG FED DC\\nD F G aGF \'F3 G a GFE DCD GF EDC D\",\"C2 a a b} a baG E FED F GahaGa GF G \'F E EDEF\\nF3 EDC E G F EDE FEDC D \'b} a a a haG E FED F GahaG aGF G \'\\nC1 F E EDEF EDC E G F EDE F EDC D \'F G a a ah\\nF3 c ch aGF GaGF FE \'E E F ED EF G aGF b} G ahaG a \'\\nF3 c d G ah c h aGF G aG FED DC \'D F G aGF\\nF3 G a GFE DCD GF EDC D\"]', '[\"Ra-zos m’a-duy vo-ler q’ieu chant so-ven\\ne fin’ A-mors per Mi-dons la ra-zon,\\nc’a pe-nas ay en al-re pes-sa-men\\ntant m’a-be-lis; e qui bos chans gra-zi-a,\\no-ras e jorns e semp-ma-nas e mes\\npre-ja-ri-a lieys chan-tan que∙m ten-gues\\nper sieu, car tot cant que de-zir au-ri-a\\nen-dreg de lieys, sol mos chans li pla-zi-a.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f224.item.zoom\", \"Plica\": false, \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 867.5, \"facsimileY\": 212, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(193, 'Si chans me pogues valensa', 'BdT 248.78', 'Guiraut Riquier', 'Occitan', 'R', '110v (CXIv)', 1, 1, '[\"F3 E EDE G a G aGF ED E\\nG GF EFE D D CD E \'\\nF3 E EDE G a G aGF ED E\\nG GF EFE D D CD E\\nEDC D \'F3 E E D EF EDC\\nD DE G a G aGF ED E\\nG GF EFEE \'F3 D EF EDC D\\nD a G a G aGF E F\\nGaG E \'F2 C D E FED E E\",\"F3 E EDE G a G aGF ED E \'G GF EFE D D CD E \'\\nF3 E EDE G a G aGF ED E \'G GF EFE D D CD E \'EDC D\\nF3 E E D EF EDC \'D DE G a G aGF ED E \'G GF EFEE\\nF3 D EF EDC D \'D a G a G aGF E F \'GaG E\\nF2 C D E FED E E\"]', '[\"Si chans me po-gues va-len-sa\\nfai-re ab mon Bel De-port\\nque∙l pla-gues ma be-vo-len-sa,\\nbel fe-rä is-sir a port,\\nmay nulh sem-blan de co-nort\\nno m’en fa silh que m’a-gen-sa,\\nni m’en puesc par-tir ses mort,\\nni vuelh que res li so-ve-nha\\nen-drech mi que∙l des-co-ve-nha.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f232.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 277, \"facsimileY\": 924, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(194, 'S\'ieu ja trobat non agues', 'BdT 248.79', 'Guiraut Riquier', 'Occitan', 'R', '107r (CVIIIr)', 1, 1, '[\"C1 a G a h cha aG a\\nF Ga aGF GaG FED DC D\\na \'C1 G a h cha aG a\\nF Ga aGF GaG FED DC D\\nFE D \'F2 C DCDE G aGFE Ga\\nC1 G a h ch a G aGah\\na G FE F \'F3 Ga GFED E\\nE F G a GaG FED FEDC\\nCD F G aGF GahaGa \'F3 FEDC D\",\"C1 a G a h cha aG a \'F Ga aGF GaG FED DC D \'a\\nC1 G a h cha aG a \'F Ga aGF GaG FED DC D \'FE D\\nF2 C DCDE G aGFE Ga \'C1 G a h ch a G aGah \'a G FE F\\nF3 Ga GFED E \'E F G a GaG FED FEDC \'CD F G aGF GahaGa\\nF3 FEDC D\"]', '[\"S’ieu ja tro-bat non a-gues,\\ntan-tas de bo-nas ra-zos\\naug en cort del rey n’Am-fos\\nqu’er sau-bra tro-bar, so∙m pes;\\ndoncx pus sa-bers me n’es guitz,\\nsi tot chans non es gra-zitz\\nni so-cors non ai d’A-mor,\\nal bon rey tanh tan d’o-nor\\nque dey, si puesc, bon vers far.\\nu0000\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f225.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 815, \"facsimileY\": 1562, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(195, 'Si ja·m deu mos chans valer', 'BdT 248.80', 'Guiraut Riquier', 'Occitan', 'R', '105r (CVIr)', 1, 1, '[\"C1 a b} baGa GF GFGa b a_bc ba\\nbaGa F Ga h aG aGF \'F3 G\\nb} a baGa GF GFGa b a_bc ba\\nbaGa F G aG FED DC D\\nF G \'C1 a ah ch aGahaG GF\\nG a h c aGF GaGF FE\\nE F G a GFE D EDC\\nG G \'F3 aGF G a b} baG a\\ncb aG a GFE D EDC D\",\"C1 a b} baGa GF GFGa b a_bc ba \'baGa F Ga h aG aGF\\nF3 G \'b} a baGa GF GFGa b a_bc ba \'baGa F G aG FED DC D \'F G\\nC1 a ah ch aGahaG GF \'G a h c aGF GaGF FE \'E F G a GFE D EDC \'G G\\nF3 aGF G a b} baG a \'cb aG a GFE D EDC D\"]', '[\"Si ja·m deu mos chans va-ler\\nni far nulh be mos tro-bars\\nni mos sa-bers pro te-ner,\\ner s’en-dres-sa mos a-fars\\nc’al pay-re d’en-ten-de-men\\ne de sa-ber e d’o-nor\\ne de pretz e de lau-zor,\\non mos bos e-spers en-ten,\\nm’en vau, al bon rey n’An-fos.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f221.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 881, \"facsimileY\": 1238, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
