(197, 'Tant vey qu’es ab Joy Pretz mermatz', 'BdT 248.83', 'Guiraut Riquier', 'Occitan', 'R', '103v-104r (CIVv-CVr)', 1, 1, '[\"F3 F G a(G) FED DC F GahaG aGF\\nah aG aG \'F3 FEDC F G ah ?\\na c h a c G ahaG GF\\nF G a(G) \'F3 FED DC F GFE FED\\na aha G ah cch aG aGF\\nF Gah haG \'F3 a D FED DC\\nC D E FED a G aGFE G aGah D\\nDE DC \'F3 EDC D E GaG FE D GFED FED\",\"F3 F G a(G) FED DC F GahaG aGF \'ah aG aG\\nF3 FEDC F G ah ? \'a c h a c G ahaG GF \'F G a(G)\\nF3 FED DC F GFE FED \'a aha G ah cch aG aGF \'F Gah haG\\nF3 a D FED DC \'C D E FED a G aGFE G aGah D \'DE DC\\nF3 EDC D E GaG FE D GFED FED\"]', '[\"Tant vey qu’es ab Joy Pretz mer-matz\\ne Va-lors qu’es mal se-gu-ra\\nCor-te-zi-a e Me-zu-ra,\\nper qu’ieu chant cais de-se-spe-ratz\\nd’A-mor a qui falh ses brieus\\nper Joi c’ar e-sta chai-tieus,\\nque co-bei-tatz lï a tous son po-der\\ne∙l ten de-streg tant que m’en fa do-ler.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f218.item.zoom\", \"Plica\": false, \"custos\": \"[null,4]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 986, \"facsimileY\": 1712, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(198, 'Volontiers faria', 'BdT 248.85', 'Guiraut Riquier', 'Occitan', 'R', '106v (CVIIv)', 1, 1, '[\"C1 C E G ahaG GF ?\\na c h a G F\\nE D E GF \'F3 EFED DC\\nC E G ahaG GF ?\\na c h a G F\\nE D E GF EFED DC \'\\nF3 C D E F EFED E\\nE G a F GGFE FEDDC\\nC D E F EFED \'F3 E\\nE G a(G) F GGFE FEDDC\\nG a h cha aGF a\\nF(E) D E F GaGFE FG \",\"C1 C E G ahaG GF ? \'a c h a G F \'E D E GF\\nF3 EFED DC \'C E G ahaG GF ? \'a c h a G F \'E D E GF EFED DC \'\\nF3 C D E F EFED E \'E G a F GGFE FEDDC \'C D E F EFED\\nF3 E \'E G a(G) F GGFE FEDDC \'G a h cha aGF a \'F(E) D E F GaGFE FG \"]', '[\"Vo-lun-tiers fa-ri-a\\ntal chan-so no-ve-la\\nque fos a-gra-di-va\\nsi far la po-di-a:\\nmas ra-zos cap-de-la\\nmon chant e l’a-bri-va,\\nper qu’ieu tant can vi-va\\nvuelh ser-vir la be-la\\nque de grat sa-ge-la\\nsos faitz, gent ai-zi-va,\\nhu-mil et es-qui-va,\\npla-zens et ys-ne-la.\\n\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f224.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 209, \"facsimileY\": 1084, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(199, 'Cristias vey perilhar', 'BdT 248.87', 'Guiraut Riquier', 'Occitan', 'R', '107r (CVIIIr)', 1, 1, '[\"C1 a c ddcchaG aGah a GaGFED EFEDC\\nC D E F GaG FEDCD EFED\\na \'C2 c dcchaG aGah a GaGFE EFED\\nF3 C D E F GaG FEDCD EFED \'\\nF3 F G a a a ahaG G\\nG a h cd ch aG aGFE\\nC \'F3 D F b} a baG aGF G\",\"C1 a c ddcchaG aGah a GaGFED EFEDC \'C D E F GaG FEDCD EFED \'a\\nC2 c dcchaG aGah a GaGFE EFED \'F3 C D E F GaG FEDCD EFED \'\\nF3 F G a a a ahaG G \'G a h cd ch aG aGFE \'C\\nF3 D F b} a baG aGF G\"]', '[\"Cris-ti-as vey pe-ri-lhar\\nper col-pa dels re-gi-dors,\\ncar en-tr’els no cap A-mors,\\nni Patz, ni Dreitz c’ab tortz far\\nson d’au-tres dreitz en-ve-jos:\\ne creis lor i-ni-qui-tatz\\ncrei-sen lor pos-ses-si-os.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f225.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 119, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
