(201, 'Lai can li jorn son lonc e may', 'BdT 262.2', 'Jaufre Rudel de Blaja', 'Occitan', 'R', '63r', 1, 1, '[\"F3 CD F F F FE EDCD EDEF ED\\nD F GFGa G \'F3 F EDCD EDEF EDC\\nCD F F F FE EDCD EDEF ED\\nD F GFGa \'F3 G F EDCD EDEF EDC\\nGa c c c c haGa hahc haG\\nGahc h a G \'F3 FGa G F EDC\\nD F GFGa G F EDCD EDEF EDC\",\"F3 CD F F F FE EDCD EDEF ED \'D F GFGa G\\nF3 F EDCD EDEF EDC \'CD F F F FE EDCD EDEF ED \'D F GFGa\\nF3 G F EDCD EDEF EDC \'Ga c c c c haGa hahc haG \'Gahc h a G\\nF3 FGa G F EDC \'D F GFGa G F EDCD EDEF EDC\"]', '[\"Lai can li jorn son lonc e may\\nm’es bel dos chans d’au-zels de lonc,\\ne can mi soi par-titz de lay\\nre-men-bra·m u-n’a-mor de lonh:\\nvau de ta-lan en-brons e clis,\\nsi que chans ni flors dels bels pis\\nno·m val pus que l’y-vern ni glay.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f139.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 928, \"facsimileY\": 1442.5, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
