(205, 'Can lo rieu de la fontayna', 'BdT 262.5', 'Jaufre Rudel de Blaja', 'Occitan', 'R', '63v', 1, 1, '[\"F3 D F F F F ED EFE EDDC\\nC DE E GFE ED DC \'F3 DE\\nD F F F F ED EFE EDDC\\nC DE E GFE ED DC DE\\nD \'F3 G aG G G D DEFED DC\\nC DE E GF E D C DFE\\nF2 C A \'F2 C C C DE DCH C\",\"F3 D F F F F ED EFE EDDC \'C DE E GFE ED DC\\nF3 DE \'D F F F F ED EFE EDDC \'C DE E GFE ED DC DE \'D\\nF3 G aG G G D DEFED DC \'C DE E GF E D C DFE \'F2 C A\\nF2 C C C DE DCH C\"]', '[\"Can lo rieu de la fon-tay-na\\ns\'es-clar-zis, si co far sol,\\ne par la flor ai-guen-ti-na.\\ne.l ros-si-nho-let pel ram\\nvolv e re-franh et a-pla-na\\nson dos chan-tar e l\'a-fi-na\\nbes dretz qu\'ieu lo mieu re-fra-nha.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f140.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 339, \"facsimileY\": 912, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
