(208, 'Bel m\'es quan son li frug madur', 'BdT 293.13', 'Marcabru', 'Occitan', 'W', '203v', 1, 1, '[\"C1 F EDC FG a c aFG \'F3 FF(E) ED\\nc haG c dcde d \'C1 chG Ga aGF\\na a(h) a(h) G d c(h) aG aGF \'\\nC1 F G a(h) aGF FGa G F ED\\nE F G \'C1 E FGa G F EDC\\nC G G G G Ga aa(G) \'C1 GF\\na c aa(h) G d dd(c) aG aGF\\nFG aGa(h) \'C1 a(G) FED C aEG FF(E) ED \",\"C1 F EDC FG a c aFG\\nF3 FF(E) ED \'c haG c dcde d\\nC1 chG Ga aGF \'a a(h) a(h) G d c(h) aG aGF \'\\nC1 F G a(h) aGF FGa G F ED \'E F G\\nC1 E FGa G F EDC \'C G G G G Ga aa(G)\\nC1 GF \'a c aa(h) G d dd(c) aG aGF \'FG aGa(h)\\nC1 a(G) FED C aEG FF(E) ED \"]', '[\"Bel mes quan sunt li fruit ma-dur\\nque ra-ver-dis-sent li ga-im\\net lau-zel per lon tens ob-scur\\nbais-sent de lor veis lou re-fren\\ntan re-dou ten la te-ne-bror\\net mous co-ra-ges sen an ce\\net chant per ioi de fi-ne_a-mor\\nou nais ma bo-ne_es-pe-ran-ce\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f422.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 174, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
