(217, 'Mot m’enueya, so auzes dire', 'BdT 305.10', 'Monge de Montaudo', 'Occitan', 'R', '40r', 1, 1, '[\"F3 c c c c c h a h a\\na h c d c \'F3 h a h a\\nG F G a a a a a a\\na G a h c ha \'F3 F G G\\nc a h c d c h a\\nG F G a a a \'a C\\nC D E F E F GF E\\nE F G G G G G C \'\\nF3 C D E F G a F aGF\",\"F3 c c c c c h a h a \'a h c d c\\nF3 h a h a \'G F G a a a a a a \'a G a h c ha\\nF3 F G G \'c a h c d c h a \'G F G a a a\\na C \'C D E F E F GF E \'E F G G G G G C \'\\nF3 C D E F G a F aGF\"]', '[\"Mot m’e-nue-ya, so au-zes di-re,\\nhom par-liers qu’es d’a-vol ser-vi-re;\\net hom que trop vol au-tr’ au-si-re\\nm’e-nue-ya, e ca-vals que ti-re;\\net e-nue-ia∙m, si Dieus m’ai-ut,\\nJo-ves hom, que trop por-t’ es-cut\\nque ne-gun colp no∙y a a-vut,\\nCa-pe-lan e mon-ge bar-but\\ne lau-zen-gier bec es-mo-lut.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f93.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 756, \"facsimileY\": 924, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
