(221, 'Ar mi puesc yeu lauzar d\'amor', 'BdT 335.7', 'Peire Cardenal', 'Occitan', 'R', '72v', 1, 1, '[\"F3 a h c ha G E F ED\\nE C D \'F3 G G a h a\\na c c h c d h G\\na h c \'F3 a G E F E\\nF(E) D E G F EDE D\\nE G \'F3 G a a a h a\\na c c h c d h(a) G\\na h \'F3 c a G FG F\\nE G G a G E E D\\nE F G G \'F3 C E EFGD D\",\"F3 a h c ha G E F ED \'E C D\\nF3 G G a h a \'a c c h c d h G \'a h c\\nF3 a G E F E \'F(E) D E G F EDE D \'E G\\nF3 G a a a h a \'a c c h c d h(a) G \'a h\\nF3 c a G FG F \'E G G a G E E D \'E F G G\\nF3 C E EFGD D\"]', '[\"Ar mi puesc yeu lau-zar d’a-mor,\\nque non pert man-jar ni dor-mir;\\nni·n sent frey-du-ra ni ca-lor,\\nni non ba-dalh ni non sos-pir,\\nni·n vauc de nuetz ar-ra-tje,\\nni soy con-quis ni soi li-atz,\\nni·n soi do-lens ni·n soy i-ratz,\\nni non lo-gui mes-se-tjez,\\nni·n soi tra-itz ni en-ga-natz,\\nque par-titz m’en soi ab mos datz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f158.item.zoom\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 861, \"facsimileY\": 229, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(222, 'Ricx hom que greu ditz vertat e leu men', 'BdT 335.49', 'Peire Cardenal', 'Occitan', 'R', '72v', 1, 1, '[\"C1F3 a a h a G F a h aGa G\\nG a \'F3 G E F G E F E D\\nC D E C E G G F E G \'\\nF3 G a h a G F a h c hah a\\nh c d a h a \'C1 G E F G\\nG a G E F G a G F EDE\\nC D \'F3 E C E G a h G hcd\\ndc h ah G G aG FE ED \'F3 C FED C\",\"C1F3 a a h a G F a h aGa G \'G a\\nF3 G E F G E F E D \'C D E C E G G F E G \'\\nF3 G a h a G F a h c hah a \'h c d a h a\\nC1 G E F G \'G a G E F G a G F EDE \'C D\\nF3 E C E G a h G hcd \'dc h ah G G aG FE ED\\nF3 C FED C\"]', '[\"Ricx hom que greu ditz ver-tatz e leu men\\ne greu vol patz e leu mou oc-cai-zo\\ne do-na greu e leu vol c’om li do,\\ne greu fa be e leu des-tru-y la gen.\\ne greu es pros e leu es mals als bos,\\ne greu es francx e leu es er-gu-lhos,\\ne greu es larcx e leu tol e greu ren,\\ndeu ca-zer leu daut loc en bas es-ta-tge.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f157.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 830, \"facsimileY\": 400, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
