(224, 'Atressi com la candela', 'BdT 355.5', 'Peire Raimon de Toloza', 'Occitan', 'G', '52r-v', 1, 1, '[\"C3F5 d d h chaG h aGF G G\\nd e \'C3 f ed c dch cd\\nF G h chaG \'C3 h aGF G\\nf f g gfedc \'C3 d efgfe f ed\\ng fgfd h chaG \'C3 h hcdc ch\\nh a G ahc h aGF F \'\\nC3 h h c cd haG d\\nd e f \'C4 fed c d ch h\\nh a G ahc h \'C4 aGF F\\nh h c d haG F hc \'\\nC3 hcded dc haGF Ga h c(h) aG ahaaG \",\"C3F5 d d h chaG h aGF G G \'d e\\nC3 f ed c dch cd \'F G h chaG\\nC3 h aGF G \'f f g gfedc\\nC3 d efgfe f ed \'g fgfd h chaG\\nC3 h hcdc ch \'h a G ahc h aGF F \'\\nC3 h h c cd haG d \'d e f\\nC4 fed c d ch h \'h a G ahc h\\nC4 aGF F \'h h c d haG F hc \'\\nC3 hcded dc haGF Ga h c(h) aG ahaaG \"]', '[\"A-tres-si com la chan-del-la\\nqe si me-zes-sa des-trui\\nper far clar-tat ad al-trui,\\nchant, on plus trach greu mar-ti-re,\\nper plai-zer de l\'au-tra gen;\\ne qar a dreit es-ci-en\\nsai q\'eu faz fo-la-ge,\\nc\'ad al-trui don al-le-gra-ge\\net a mi pe-n\'e tor-men,\\nnul-la re, se mal m\'en pren,\\nnon deu plan-ger del dam-pna-ge.\"]', '[\"[link]http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP115_R71sup_c.52r.jp2/full/full/0/default.jpg[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[2,6,4,6,6,2,9,8]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(225, 'Anc no mori per amor ni per al', 'BdT 364.4', 'Peire Vidal', 'Occitan', 'G', '41v', 1, 1, '[\"C1F3 C C E G F ED C D CH \'C2F4 C\\nG G a G c h G a \'C2F4 GF G\\nc c h ch a G \'C2F4 FE D C Ga\\nF E D C D C \'C2F4 FE E ED C\\nFED E EDC D E \'C2F4 F G a hG G\\nc h \'C2F4 d d c c ha a aGF F\\nE G G \'C2F4 ahchG E E F ED C H\\nC D \'C2F4 EDC D E G aGF E EDC D \",\"C1F3 C C E G F ED C D CH\\nC2F4 C \'G G a G c h G a\\nC2F4 GF G \'c c h ch a G\\nC2F4 FE D C Ga \'F E D C D C\\nC2F4 FE E ED C \'FED E EDC D E\\nC2F4 F G a hG G \'c h\\nC2F4 d d c c ha a aGF F \'E G G\\nC2F4 ahchG E E F ED C H \'C D\\nC2F4 EDC D E G aGF E EDC D \"]', '[\"Anc no mo-ri per a-mor ni per al\\nmas ma vi-da pot be va-ler mo-rir\\nqand vei la ren qe plus am e de-sir\\ne ren non fai mas qand do-lor e mal;\\nfen me val mort mas an-car mes plus greu\\nq\'en breu se-rem ja veill et ill et eu,\\ne s\'ai-si perd lo seu e·l meu jo-ven,\\nmal m\'es del meu, mais del seu per un cen. \"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649e7\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(226, 'Anc no mori per amors ni per als', 'BdT 364.4', 'Peire Vidal', 'Occitan', 'R', '46v', 1, 1, '[\"F4 F F Ga c h a G a F G\\nc c d c f \'C3 e de d dc d\\nc d e f e d ch a h G\\nh \'C2 a G a G a h a G a\\nh h h haG G a \'C2 h c dch ac\\nc d e f e d cha a G\\nG a \'C2 h c h a G a aGF E\\nE F G a h c \'C2 dca FG aGFE F\",\"F4 F F Ga c h a G a F G \'c c d c f\\nC3 e de d dc d \'c d e f e d ch a h G \'h\\nC2 a G a G a h a G a \'h h h haG G a\\nC2 h c dch ac \'c d e f e d cha a G \'G a\\nC2 h c h a G a aGF E \'E F G a h c\\nC2 dca FG aGFE F\"]', '[\"Anc no mo-ri per a-mors ni per als,\\nmai ma vi-da pot be va-ler mu-rir\\ncant yeu es-gart la res qu’ieu pus de-zir\\ne res no∙m fai mas can do-lor e mal.\\nNo∙m val be mort, mas en-car m’es pus greu\\nqu’en breu se-rem vielh et ilh et ieu:\\ne s’ai-si∙s pert lo meu el seu jo-ven,\\nmal m’es del meu, e del sieu per un cen.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f106.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 201, \"facsimileY\": 1239, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(227, 'Ainz non morri pir amar ni per al', 'BdT 364.4', 'Peire Vidal', 'Occitan', 'X', '85v', 1, 1, '[\"C2b} F G a c b a GF F E F\\nb c d c f \'C2b} e dc c b c\\nf f fe dc c a ba G F c \'\\nC2b} a b aG F G F a G GF F\\na a aG GF F a c \'C2b} d ec c\\nC3b} f f f g f f(e) dc c cb aGa\\nC2b} b a G F \'C2b} F a cdc b aGF G\\na G GF F F a cdc b aGF aGGF\",\"C2b} F G a c b a GF F E F \'b c d c f\\nC2b} e dc c b c \'f f fe dc c a ba G F c \'\\nC2b} a b aG F G F a G GF F \'a a aG GF F a c\\nC2b} d ec c \'C3b} f f f g f f(e) dc c cb aGa \'C2b} b a G F\\nC2b} F a cdc b aGF G \'a G GF F F a cdc b aGF aGGF\"]', '[\"Ainz non mo-rri pir a-mar ni per al\\nmais ma vi-de pot ben va-ler mo-rir\\nqant vei la ren cui tant aim et de-sir\\net non mi fait fors que do-lor et mal;\\nmal en ai eu, mais en-cor m’es plus greu,\\nq’en breu se-rons ia viel et e-le_et eu,\\net s’en-si per lo men et son io-vant:\\nmal m’est del meu, et del son per un sant.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f178.item\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f178\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
