(231, 'Ren pac d\'ivern e d\'esti', 'BdT 364.11', 'Peire Vidal', 'Occitan', 'X', '87v', 1, 1, '[\"F2 EDEF EDCH C DC G FG FEDC\\nG G a G C1 c hahchG G\\nF FED F Ga \'F3 hG FE FEDC\\nG aGE C F2 DE FGFD CHC C\\nF1 *G A C D EG EDC GG(a) \'\\nC1F3 h G a c d hc haG\\nC2 F a c d ch d e c\\ne f ed c d \'C2 ch chG aGFE\\nF3 F EDC DE G a G ahchG\\nF2 EDEF EDCH D F aGaha FED DC \",\"F2 EDEF EDCH C DC G FG FEDC \'G G a G C1 c hahchG G \'F FED F Ga\\nF3 hG FE FEDC \'G aGE C F2 DE FGFD CHC C \'F1 *G A C D EG EDC GG(a) \'\\nC1F3 h G a c d hc haG \'C2 F a c d ch d e c \'e f ed c d\\nC2 ch chG aGFE \'F3 F EDC DE G a G ahchG \'F2 EDEF EDCH D F aGaha FED DC \"]', '[\"Ren pac d’i-ver et d’es-ti\\net de froit et de cha-lor\\net aim ab tant noif con flor\\net prou mor mais q’en-vol vif,\\ncar au-si teng en for-cis\\npris et io-vant et va-lor\\net car aim do-ne no-ve-le\\nsob-re_a-vi-nant et plus be-le\\npa-rans ro-se_es en-tre giel\\net clar tens en tro-blous ciel.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f182.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 69, \"facsimileY\": 435, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(232, 'Jes pel temps fer e brau', 'BdT 364.24', 'Peire Vidal', 'Occitan', 'R', '64v', 1, 1, '[\"C3 g g f e d g\\ne c d c h \'C3 a\\nc d cha h c e\\nc d e g f ed\\nh \'C3 G ahc h ha aG\\nG G ahc h ha aG\\na h c \'C3 h ha aG\\nh c haG a ah de\\nfe d c d g f \'C3 +a g f edef edh\\nch a h G h d(c) h ha G hcha aG\",\"C3 g g f e d g \'e c d c h\\nC3 a \'c d cha h c e \'c d e g f ed \'h\\nC3 G ahc h ha aG \'G G ahc h ha aG \'a h c\\nC3 h ha aG \'h c haG a ah de \'fe d c d g f\\nC3 +a g f edef edh \'ch a h G h d(c) h ha G hcha aG\"]', '[\"Jes per temps fer e brau,\\nc’a-dutz tem-piers e vens\\ne tor-ba∙ls e-le-mens\\ne fa∙l sel bru e blau,\\nno∙m cam-ja mos ta-lens,\\nans es mos pes-sa-mens\\nen joy e en chan-tar,\\ne∙m vuelh mais a-le-grar,\\ncan vey la neu sus en l’au-ta mon-ta-nha,\\nque can las flors s’es-pan-do per la pla-nha.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f142.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 297, \"facsimileY\": 839, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(233, 'Neus ni glatz ni plueyas ni fanh', 'BdT 364.30', 'Peire Vidal', 'Occitan', 'R', '64v', 1, 1, '[\"F3 F F GahaG GFG E DEF E C\\nF F E D E \'F4 E FG a\\nE FG GF c e d dc h\\nha G F \'F3 FE D E C D\\nF a G E G G GF a\\na h c \'F3 d ch cd c ha\\nc h c(h) a ahc d c aGF\\nG E D \'F3 F a ahchG ED E\",\"F3 F F GahaG GFG E DEF E C \'F F E D E\\nF4 E FG a \'E FG GF c e d dc h \'ha G F\\nF3 FE D E C D \'F a G E G G GF a \'a h c\\nF3 d ch cd c ha \'c h c(h) a ahc d c aGF \'G E D\\nF3 F a ahchG ED E\"]', '[\"Neus ni glatz ni plue-yas ni fanh\\nno∙m to-lon de-port ni so-latz,\\nque∙l temps es-cur me par clar-tatz\\npel no-vel joi en que∙m re-franh;\\ncar jo-ve do-na m’a con-ques,\\ne, s’ieu lieis con-quer-re po-gues,\\ncan la re-mir, tan be-la∙m par,\\nque de gaug cug e-ra vo-lar.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f142.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 270, \"facsimileY\": 1702.5, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
