(235, 'Si co·l paubre, can jatz el ric ostal', 'BdT 364.36', 'Peire Vidal', 'Occitan', 'R', '64r', 1, 1, '[\"C3 G a h G d c ch ha aG ahch\\nG a h \'C3 a d c h a haG a\\nd c d f e d d \'C3 dc d e\\nd c ha aG a h c(h) a hcdca a \'\\nC2 c c c G a h a GF a G\\na a a h \'C2 a h c ha G e\\nf f ed dc C3 d ed fe \'C3 d c ch\\nc h G c e g +agf fe d fedcha \",\"C3 G a h G d c ch ha aG ahch \'G a h\\nC3 a d c h a haG a \'d c d f e d d\\nC3 dc d e \'d c ha aG a h c(h) a hcdca a \'\\nC2 c c c G a h a GF a G \'a a a h\\nC2 a h c ha G e \'f f ed dc C3 d ed fe\\nC3 d c ch \'c h G c e g +agf fe d fedcha \"]', '[\"Si co·l pau-bre, can jatz el ric os-tal,\\ne no si planh si tot s’a gran do-lor,\\ntan tem que torn ad e-nueg al se-nhor,\\nno m’aus pla-nher de ma do-lor mor-tal.\\nBe·m dey do-ler, pus e-la·m mostr’ er-guelh,\\nla res del mon qu’ieu pus de-zir e vuelh,\\nque si-val re non l’aus cla-mar mer-ce\\ntal pa-or ay que se e-nueg de me.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f141.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 159, \"facsimileY\": 876, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
