(237, 'Cant hom es in autrui poder', 'BdT 364.39', 'Peire Vidal', 'Occitan', 'G', '42r-42v', 1, 1, '[\"C1 aG F h aG FE DCH CD E \'\\nC1 Ga c hG E ED CD DCH C \'\\nC2 E E EDC F F F ED\\nG F \'C2 Ga c d h haG G\\nd c \'C2 ha G Ga c ha aG\\nFE D E \'C1F3 G C D EC H\\nD F \'F3 F ED FG aG hG G\\nFE D \'C2F4 E FE C DC CH C \",\"C1 aG F h aG FE DCH CD E \'\\nC1 Ga c hG E ED CD DCH C \'\\nC2 E E EDC F F F ED \'G F\\nC2 Ga c d h haG G \'d c\\nC2 ha G Ga c ha aG \'FE D E\\nC1F3 G C D EC H \'D F\\nF3 F ED FG aG hG G \'FE D\\nC2F4 E FE C DC CH C \"]', '[\"Cant hom es in al-trui po-der\\nno pot tot sos ta-lanz com-plir,\\nanz lia-ven so-ven ge-qir\\nper al-trui grat lo seu vo-ler;\\ndonc pois el po-der me sui mes\\nd\'a-mor, se-grai los mals e·l bes\\ne·l torz e·l dreiz e·l danz e·l pros,\\nc\'ai-si m\'o co-man-da ra-zos.\"]', '[\"[link]http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP095_R71sup_c.42r.jp2/full/full/0/default.jpg[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[4,6,6,4,6,5,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(238, 'Cant hom es en autrui poder', 'BdT 364.39', 'Peire Vidal', 'Occitan', 'R', '63v', 1, 1, '[\"C1 d d dca a G ah c ha\\nd c h a \'F3 GE DC DEF C\\nG G G Ga FED E F G\\nG a h c \'F3 h aG F G\\nd d d e c d ha h\\nG(F) ED \'F3 F a h aG F Ga\\nD E C D E G F \'F3 b} abcd\\nc h a G(F) ED C DEFED DC\",\"C1 d d dca a G ah c ha \'d c h a\\nF3 GE DC DEF C \'G G G Ga FED E F G \'G a h c\\nF3 h aG F G \'d d d e c d ha h \'G(F) ED\\nF3 F a h aG F Ga \'D E C D E G F\\nF3 b} abcd \'c h a G(F) ED C DEFED DC\"]', '[\"Cant hom es en au-trui po-der,\\nnon pot totz sos ta-lans com-plir,\\nans l’a-ven so-ven a ge-quir\\nlo sieu grat per au-truy vo-ler.\\nDoncx mays en po-der me soi mes\\nd’A-mors, se-gray los mals e∙ls bes\\ne∙ls tortz e∙ls dretz e∙ls dans e∙ls pros,\\nc’ai-si m’o co-man-da ra-zos.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f140.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 164, \"facsimileY\": 1290, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
