(240, 'Quant hom honraz torna en gran paprera', 'BdT 364.40', 'Peire Vidal', 'Occitan', 'G', '41r', 1, 1, '[\"C2 c h c a h G a h \'C2 c dh c\\nGah c cG E FE D C \'C2 F FG aF G\\nG a h c ch G aG F \'C1F3 E FED C\\nE E ED C DC H FE D \'C1F3 C H C\\nC E F G aF Ga h c \'C1F3 ha F\\nGah c haGa G G h \'C2F4 aG GFE ED C\\nD E ED C \'F3 F GF D ED C CH C \",\"C2 c h c a h G a h\\nC2 c dh c \'Gah c cG E FE D C\\nC2 F FG aF G \'G a h c ch G aG F\\nC1F3 E FED C \'E E ED C DC H FE D\\nC1F3 C H C \'C E F G aF Ga h c\\nC1F3 ha F \'Gah c haGa G G h\\nC2F4 aG GFE ED C \'D E ED C\\nF3 F GF D ED C CH C \"]', '[\"Qant hom hon-raz tor-na en gran pa-pre-ra\\nq\'a es-tat rics e de gran be-ne-nan-za,\\nde ver-go-gna no sap ren com se qe-ra\\nanz a-ma mais cob-rir sa ma-le-nan-za;\\nper q\'es ma-ger mer-ces e plus franc dos\\nqan hom fai ben al pa-bres ver-go-gnos\\nq\'a mainç d\'al-tres qan en-qe-ro fi-an-za.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da82800649e6\", \"custos\": \"[3,7,8,8,2,3,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(241, 'S\'ieu fos en cort que hom tengues drechura', 'BdT 364.42', 'Peire Vidal', 'Occitan', 'R', '64v', 1, 1, '[\"F3 c c c h c(h) a h c d h G \'\\nF3 h c a h aG FE D GF E EDC D\\nE F G G G E C \'F3 G G FED F\\nG G F a c d ha h c cha G\\nC2 e d \'C2 c h a c d c h cha h\\nd e d cha \'C2 a c d c h aGah aG\",\"F3 c c c h c(h) a h c d h G \'\\nF3 h c a h aG FE D GF E EDC D \'E F G G G E C\\nF3 G G FED F \'G G F a c d ha h c cha G \'C2 e d\\nC2 c h a c d c h cha h \'d e d cha\\nC2 a c d c h aGah aG\"]', '[\"S’ieu fos en cort que hom ten-gues dre-chu-ra,\\nde ma do-na, si tot s’es bo-n’e be-la,\\nmi cla-me-ra, car tan grans tortz mi me-na\\nque no m’a-ten ple-vir ni co-vi-nen-sa.\\nE doncx per que∙m pro-met so que no∙m do-na,\\nnon tem pec-cat ni sap que s’es ver-go-nha.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f142.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 840, \"facsimileY\": 780, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 21, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(242, 'Tart mi vedront mi ami tholousan', 'BdT 364.49', 'Peire Vidal', 'Occitan', 'W', '197r', 1, 1, '[\"C1 c c c d c hh(a) aG a \'C2 hhG c\\na h c hh(a) G \'C1 F G a hh(a) aG\\nc d c bb(a) G F EDC \'C1 E GFE G\\na b aa(G) GF EE(D) DC CD F EDC \'C1 DEDC\\nF F E GG(F) E D EE(D) CH CD E\\nG \'C1 a hhaG G a h cc(h) a(G) aGF F\\nc d \'C1b} c bb(a) G F EDC E GFE G\\na b aa(G) GF \'C1 EE(D) DC CD F EDC DEDC\",\"C1 c c c d c hh(a) aG a\\nC2 hhG c \'a h c hh(a) G\\nC1 F G a hh(a) aG \'c d c bb(a) G F EDC\\nC1 E GFE G \'a b aa(G) GF EE(D) DC CD F EDC\\nC1 DEDC \'F F E GG(F) E D EE(D) CH CD E \'G\\nC1 a hhaG G a h cc(h) a(G) aGF F \'c d\\nC1b} c bb(a) G F EDC E GFE G \'a b aa(G) GF\\nC1 EE(D) DC CD F EDC DEDC\"]', '[\"Tart mi ven-dront mi a-mi tho-lou-san\\net tart ver-rai fau-giaus et mont re-al\\nquer re-ma-sus es del tot en ba-ras\\nmos bels re-gnes qui es dolz et cer-tans\\nhe be-la dos-na qu\'eu am et de-sir\\ndes ex vos plor et del cor vos sous-pir\\nquan mi mem-bre vos-tre cors a-vi-nenz\\nel dolz re-gars et la bou-che ri-ens.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f409.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 302, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(243, 'Atressi co·l signes fai', 'BdT 366.2', 'Peirol', 'Occitan', 'R', '88r (LXXXIXr)', 1, 1, '[\"F3 E F G G a F GFE\\nF D E F G\\nE C D \'F3 E F G FE\\nE D C DE C\\nC D C D E F E D \'\\nC1 D E F G F E EDC D\\nG G a c h G GF G \'\\nF3 C D C D E F EDC DC\",\"F3 E F G G a F GFE \'F D E F G \'E C D\\nF3 E F G FE \'E D C DE C \'C D C D E F E D \'\\nC1 D E F G F E EDC D \'G G a c h G GF G \'\\nF3 C D C D E F EDC DC\"]', '[\"A-tres-si co·l si-gnes fai,\\ncant dey mu-rir chan,\\ncar say que gen-ser mur-rai\\net ab mens d’a-fan;\\nbe m’a a-mors ten-gut el latz,\\nque mans a-fans n’ay so-fer-tatz,\\ne pel dan c’ad-ho-ras m’en ve\\nco-nosc c’anc mai non ai-mey be.\\n\\nE doncx cal cos-selh pen-rai \\ns’ai-si muer a-man,\\nque ioi non a-ten de lai \\non miei sos-pir van?\\nPer o no·s part ma vo-lon-tatz,\\nsi tot mi soi de-ses-pe-rat,\\npes-sieus e cos-si-ros me te\\nse-la de que pus mi so-ve.\\n\\nTan be-la do-na no sai,\\nlas, per que l’am tan?\\nPus que ia non l’au-za-rai \\ndi-re mo ta-lan;\\ngen m’a-cuelh et ab bel so-latz \\ne del pus soi me-cos-sel-hatz \\nque s’ieu li cla-ma-va mer-ce \\ntan que no mi lu-nhes de se.\\n\\nPre-yar   can no s’es-chai \\ntorn’ a e-nueg gran:\\nses par-lar la pre-ya-rai\\nab hu-mil sem-blan \\ne e-la en-tend’ o, s’il platz,\\nqu’e-nai-si dob-la ioi e grat,\\ncant us cors ab au-tre s’a-ve\\ne do-na ses quer-re fai be.\\n\\nPro-e-za e pretz ve-rai \\ntray a-mors e-nan,\\na-vols pa-ra-ties la de-chai,\\nque·l ric son tru-an\\net a n’i tant d’a-questz mal-vatz\\nper que·l se-gles es sor-de-yatz\\ne do-na que fin pretz man-te\\nno m’am per ri-cor, s’als no y ve.\\n\\nChan-so, a la be-la vai,\\nnon per re qe·l man,\\nbe·l potz di-re mon es-mai\\ne se-nes mon dan\\nvai li dir com soi a lieys dat\\nab bon cor del tot au-tre-yatz:\\nsieus soi e sieus se-rai ias-se,\\nmo-rir puesc per ma bo-na fe.\\n\\nLa res del mon que pus me platz\\nioi si’ ab vos on que si-atz,\\nqu’es-tiers no·us aus pre-yar de re,\\nmas si-vals pen-sar m’o puesc be.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f187.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 816, \"facsimileY\": 1250, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(244, 'Be dei chantar, pos amors m\'o enseigna', 'BdT 366.3', 'Peirol', 'Occitan', 'G', '48v', 1, 1, '[\"C2F4 a a Ga GFEDDE D G a c \'C2F4 h ahaG a\\na a Gaha aG F E F \'C1F4 G a FEDE D\\nCDE G FEDE D E \'C2F4 G a c h ahaG a\\na a Gaha aG \'C2F4 F E F G FED E\\na c a chaG \'C2F4 a h a aGF FG a\\na h a GFEDDE C \'C1F3 D E FEDC FEFGaG GFED EDDC\",\"C2F4 a a Ga GFEDDE D G a c\\nC2F4 h ahaG a \'a a Gaha aG F E F\\nC1F4 G a FEDE D \'CDE G FEDE D E\\nC2F4 G a c h ahaG a \'a a Gaha aG\\nC2F4 F E F G FED E \'a c a chaG\\nC2F4 a h a aGF FG a \'a h a GFEDDE C\\nC1F3 D E FEDC FEFGaG GFED EDDC\"]', '[\"Ben dei chan-tar pos A-mor m’o en-se-gna\\ne·m dom-na geing com pus-ca bos moz fai-re\\ncar s\'ill no fos eu no fo-ra chan-tai-re\\nni co-no-guz per tan-ta bo-na gen;\\nmas e-ra vei e sai cer-ta-na-men\\nqe toz los bes qe m\'a faz mi vol ven-dre.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP108_R71sup_c.48v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[4,6,6,7,5,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(245, 'Caniat m’a mon conssirer', 'BdT 366.6', 'Peirol', 'Occitan', 'G', '46v', 1, 1, '[\"C2F4 F E D a a h a\\nG \'C1F3 a G c h aG a\\nF E D a \'C2 a h a\\nG a G c h aG hc \'\\nC2F4 d c h a h c h\\nG E \'F3 F G a GaGF E\\nE E E D E D \'C2F4 C\\nE F aG F GF ah chaG\\nF E F \'C2 Ga GF EDC D\",\"C2F4 F E D a a h a \'G\\nC1F3 a G c h aG a \'F E D a\\nC2 a h a \'G a G c h aG hc \'\\nC2F4 d c h a h c h \'G E\\nF3 F G a GaGF E \'E E E D E D\\nC2F4 C \'E F aG F GF ah chaG \'F E F\\nC2 Ga GF EDC D\"]', '[\"Can-iat m’a mon con-ssi-rer\\ncan-ges q’a faich d’a-mi-a\\ndon ai fin ioi ver-ta-der\\ntrop meilz q’eu no so-li-a,\\nmas non es de prez so-brer,\\neu per qe·m men-ti-ri-a?\\nCar hom diz el re-pro-ver:\\nQi no tro-ba no tri-a\\ne qui pren no·s fa-di-a.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP104_R71sup_c.46v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,3,2,7,8,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(246, 'Coras qe·m fezes doler', 'BdT 366.9', 'Peirol', 'Occitan', 'G', '45v', 1, 1, '[\"C2F4 D C D E FE D C\\nD C \'C2F4 F G F E D\\nD C D \'C1F3 E FE D C\\nD C F G FEF \'C2F4 G D\\nF G a b a G \'C2F4 F\\nF E D EFG FED C\\nC D \'C2F4 F G a G FE FG\\nC D EFG F ED \'DC D\",\"C2F4 D C D E FE D C \'D C\\nC2F4 F G F E D \'D C D\\nC1F3 E FE D C \'D C F G FEF\\nC2F4 G D \'F G a b a G\\nC2F4 F \'F E D EFG FED C \'C D\\nC2F4 F G a G FE FG \'C D EFG F ED\\nDC D\"]', '[\"Co-ras qe·m fe-zes do-ler\\nA-mors ni·m do-nes es-mai\\na-ra·m ten iau-zen e gai\\nper q’eu chan a mon pla-zer,\\ncar plus ai ric ioi con-qis\\nq’a mi no ta-gni-a\\ne qan ri-cor s’u-mi-li-a\\nhu-mi-lil-taz s’en-ri-qis.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP102_R71sup_c.45v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[7,8,4,7,7,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(247, 'Coras que mi fes doler', 'BdT 366.9', 'Peirol', 'Occitan', 'R', '87v (LXXXVIIIv)', 1, 1, '[\"F3 D C D F FE D DC\\nC D F F G FED \'F3 F\\nF E D G FE D DC\\nC D F \'F2 G C D FED\\nF G a G FE D C\\nF E D EFG FED \'F2 DC\\nC D F F G ah aGF Ga\\nC D F GFE D EDC D\",\"F3 D C D F FE D DC \'C D F F G FED\\nF3 F \'F E D G FE D DC \'C D F\\nF2 G C D FED \'F G a G FE D C \'F E D EFG FED\\nF2 DC \'C D F F G ah aGF Ga \'C D F GFE D EDC D\"]', '[\"Co-ras que mi fes do-ler\\nA-mors, ni·m do-net es-may,\\na-ra·m ten a-le-gr’ e gai\\nper qui chant de mon pla-zer;\\ncar pus ric joi ai con-quis\\nc’a mi non ta-nhi-a,\\ne ric cors, cant s’u-me-li-a,\\nhu-mi-li-tatz l’en-re-quitz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f186.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 863, \"facsimileY\": 1240, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(248, 'D\'eissa la razon qu\'eu soill', 'BdT 366.11', 'Peirol', 'Occitan', 'G', '44r', 1, 1, '[\"C2 G a h h h a c\\nh \'C3 a h a G F Gah G\\nG a h h \'C2 h G c\\nh a h c haG \'C3 a h c\\nd c d e d h \'C3 Gah\\nc c c c hahc d\\nG \'C2 h a h d c h a\\nG F \'C2 a hG G\",\"C2 G a h h h a c \'h\\nC3 a h a G F Gah G \'G a h h\\nC2 h G c \'h a h c haG\\nC3 a h c \'d c d e d h\\nC3 Gah \'c c c c hahc d \'G\\nC2 h a h d c h a \'G F\\nC2 a hG G\"]', '[\"D’eis-sa la ra-zon q’eu soill\\nm’er a chan-tar per u-sa-ge,\\nqe mal mi son’ e m’a-cuoill\\nma-don’ el seu se-gno-ra-ge;\\nben tra-i-ron sei beill oill.\\ncom al fals mes-sa-ge\\ncan mi mei-ron en co-ra-ge\\ns’a-mor dont mi duoill.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP099_R71sup_c.44r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,6,5,8,6,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(249, 'Del seu tort farai esmenda', 'BdT 366.12', 'Peirol', 'Occitan', 'G', '49v', 1, 1, '[\"C1F3 D C D E F ED E C \'\\nF3 D E F G EC F D\\nD C \'F3 D E F ED E C\\nD E \'F3 F G FE F Ga\\nGF E D G \'F3 FE D C\\nD E D C H H \'F3 A*G A\\nC HA*G C D EFG F EDDC D\",\"C1F3 D C D E F ED E C \'\\nF3 D E F G EC F D \'D C\\nF3 D E F ED E C \'D E\\nF3 F G FE F Ga \'GF E D G\\nF3 FE D C \'D E D C H H\\nF3 A*G A \'C HA*G C D EFG F EDDC D\"]', '[\"Del seu tort fa-rai es-men-da\\nleis qi·m fe par-tir de se,\\nq\'en-car ai ta-lan qe·il ren-da,\\nsi·l plaz, ma chan-zon e me\\nsenz res-peich d\'al-tra mer-ce;\\nse·n sof-ra q\'en leis m\'en-ten-da\\ne qe·l bel ni-en m\'a-ten-da.\\n\\nGes per ne-gus mal qe·m pren-da\\nde s’a-mis-tat no·m re-cre,\\nanz sof-re, qe qe me ren-da,\\nla pe-na_e·l dan qe m’en ve:\\nfar me de-gra qal-qe be,\\nmais no·m taing qe la·n rep-ren-da\\nse-tot s’es vers q’il mes-pren-da.\\n\\nQ’eu sai q’es-ter non po-ri-a\\nde mi-donz mon cor os-tar\\nper i-ra ni per fel-ni-a\\nni per al-tra dom-na_a-mar;\\nno m’en cal plus es-sa-iar,\\nmas ais-si   co·ill plaz si-a,\\nq’eu l’a-ma-rai tu-ta vi-a.\\n\\nMolt en con-sir nuoit e di-a\\nni no m’en sai con-seil-lar;\\ne per-cho s’es-de-ve-ni-a!\\nli po-gues tol-re_o en-blar\\nde sa bo-cha_un doulz bai-sar\\ne s’ill pois s’en i-ras-si-a\\nvo-lun-tres lo li ren-dri-a.\\n\\nNon es ne-gus hom cui te-gna\\ntant a-po-de-rat A-mors,\\nq’e-ra vol qe·m de-so-ve-gna\\nlo ric ioi e·l bel so-cors \\nc’a-vi-a tro-bat ail-lors,\\nez a lei plaz qe·m des-tre-igna\\nper tal qe no·m vol nū de-igna.\\n\\nBo-na do-na, en cui re-gna\\njois e io-venz et ho-nors,\\nsof-ri-rez donc qe me te-ngna\\nlo de-si-rers e·l do-lors?\\nSa-vals dels pla-zers me-nors\\nme fais tan qe ioi m’en ve-gna,\\nsi c’ab vos no des-con-ve-gna.\\n\\nChan-zo-ne-ta, vai de cors\\na mi-donz dir qe·s re-te-igna,\\npois mi re-te-ner non de-igna.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP110_R71sup_c.49v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[7,7,5,5,10]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(250, 'D\'un bon vers dei pensar com lo fezes', 'BdT 366.13', 'Peirol', 'Occitan', 'G', '43r', 1, 1, '[\"C2 Ga G F b a F G a Gaha \'C2 aG\\nE Ga FE D D C DE \'C2 E EC C\\nE F E DE C G \'C1 G a Gaha aG\\nG a h c a h \'C2 aG a GF G a\\nc a h \'C2 G a b G c G FED C\\nG G \'C1 a baG F E DCH C D E \'\\nC1F4 F G GF G a c haGa h aGF GahaaG \",\"C2 Ga G F b a F G a Gaha\\nC2 aG \'E Ga FE D D C DE\\nC2 E EC C \'E F E DE C G\\nC1 G a Gaha aG \'G a h c a h\\nC2 aG a GF G a \'c a h\\nC2 G a b G c G FED C \'G G\\nC1 a baG F E DCH C D E \'\\nC1F4 F G GF G a c haGa h aGF GahaaG \"]', '[\"D’un bon vers dei pen-sar com lo fe-zes\\nc\'A-mors m’a-dui l’o-chai-son e·l ta-lan\\ne fai m’es-tar de tot a son co-man\\nsi qe mon cor a re-ten-guz en ga-ge;\\ntrop de-mos-tra ves mi son po-de-ra-ge\\nq’a-ra m’au-ci lo tre-bail on m’a mes\\nper tal dom-na q’en-dretz me no s’a-taing.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP097_R71sup_c.43r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,8,6,3,6,5,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(251, 'D\'un sonet vau pensan', 'BdT 366.14', 'Peirol', 'Occitan', 'G', '43r-44r', 1, 1, '[\"C2 D a a hahc haG G\\nh c h \'C3 a G ahch ha\\nD a hahc h haG G\\nh c \'C2F4 h ah G a h\\nd c d chah GF \'C3 a\\nh c a F GFED D\\nD \'C2 E F G FED EF\\nF G a \'C3 a h chahha \",\"C2 D a a hahc haG G \'h c h\\nC3 a G ahch ha \'D a hahc h haG G \'h c\\nC2F4 h ah G a h \'d c d chah GF\\nC3 a \'h c a F GFED D \'D\\nC2 E F G FED EF \'F G a\\nC3 a h chahha \"]', '[\"D’un so-net vau pen-san\\nper so-laz e pe ri-re\\ne no chan-tera o-gan\\nes-ters per mon cos-si-re\\ndon me co-nort chan-tan\\nc’A-mors m’au-ci d’es-mai\\ncar m’a tro-bat ve-rai\\nplus de null au-tre a-man.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP097_R71sup_c.43r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,6,5,10,5,11]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(252, 'Ab ioi qi·m demora', 'BdT 366.15', 'Peirol', 'Occitan', 'G', '48r', 1, 1, '[\"C1F3 C G G a Gah aGaE\\nG GahaG F \'F3 DC G G\\nD G F E DEF EDC\\nC CD \'F3 E DEFE D C\\nC G G a Gah aGaE \'\\nF3 G GahaG F DC G G\\nD G F E \'F3 DEF EDC\\nC CD E DEFE D C\\nC D E \'F3 E EDEF\\nE C DEF EDCD E\\nE G F E \'F3 DE-F EDC\\nH CD E DEFE DC \",\"C1F3 C G G a Gah aGaE \'G GahaG F\\nF3 DC G G \'D G F E DEF EDC \'C CD\\nF3 E DEFE D C \'C G G a Gah aGaE \'\\nF3 G GahaG F DC G G \'D G F E\\nF3 DEF EDC \'C CD E DEFE D C \'C D E\\nF3 E EDEF \'E C DEF EDCD E \'E G F E\\nF3 DE-F EDC \'H CD E DEFE DC \"]', '[\"Ab ioi qi·m de-mo-ra\\nvoil un so-net fai-re,\\nqe be·m vai a-do-ra\\nde tot mon a-fai-re;\\nfin a-mor m’o-no-ra\\nsi q’al meu ve-iai-re\\nges tan ric non fo-ra\\ns’eu fos em-pe-rai-re;\\nmon co-ra-ge n’ai\\niau-zi-on e gai,\\npe-ro non a gai-re\\nq’e-ra mortz d’es-mai.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP107_R71sup_c.48r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[7,6,4,7,6,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(253, 'Manta jens me malrazona', 'BdT 366.19', 'Peirol', 'Occitan', 'R', '47r', 1, 1, '[\"F3 h c d d c a h c\\nd c h a h \'F3 a G\\nh c d d c a h c\\nd c h a h a G \'\\nF3 a G F F E F G a\\na G F E F G \'F3 E C\\nF G a b} b c ha G\\na G F h a haGF G\",\"F3 h c d d c a h c \'d c h a h\\nF3 a G \'h c d d c a h c \'d c h a h a G \'\\nF3 a G F F E F G a \'a G F E F G\\nF3 E C \'F G a b} b c ha G \'a G F h a haGF G\"]', '[\"Man-ta jen me mal ra-zo-na\\ncar ieu non chant pus so-ven,\\nmais ai-sel que m’o-chay-zo-na\\nno sap co-si lon-ga-men\\nm’a ten-gut en greu pes-sa-men\\nsil que mon cors m’en-prey-zo-na:\\ntot n’ay per-dut jau-zi-men\\ntal des-co-nort me do-na.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f107.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 195, \"facsimileY\": 1023, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(254, 'M\'entension ai tot\'en un vers meza', 'BdT 366.20', 'Peirol', 'Occitan', 'R', '88v (LXXXIXv)', 1, 1, '[\"C2 h d c h a c h a G ahaG a\\na ah G ahch a G \'C1F3 F EDE G D\\nh d c h a c h a G ahaG a\\na ah G ahch \'C1 a G F EDE G D\\nE G G G a h c haG a\\nh G h d \'F3 c hah c haG a\\nd h G a G F E D E Gah\\nch a \'C1 G a G E F F1 GF ED FED\",\"C2 h d c h a c h a G ahaG a \'a ah G ahch a G\\nC1F3 F EDE G D \'h d c h a c h a G ahaG a \'a ah G ahch\\nC1 a G F EDE G D \'E G G G a h c haG a \'h G h d\\nF3 c hah c haG a \'d h G a G F E D E Gah \'ch a\\nC1 G a G E F F1 GF ED FED\"]', '[\"M’en-ten-si-o ai tot’ en un vers me-za,\\nco val-gues may de chant qu’ieu anc fe-zes,\\ne po-gr’ es-ser que fo-ra mielhs a-pre-za\\nchan-so-ne-ta, s’ieu fai-re la vol-gues;\\ncar chan-tar torn’ a leu-ja-ri-a,\\nmas bo vers, qui far lo sa-bi-a,\\nm’es a sem-blan que mays de-gues va-ler,\\nper qu’ieu y vuelh de-mos-trar mo sa-ber.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f188.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 213, \"facsimileY\": 216, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(255, 'Molt m\'entremis de chantar volunters', 'BdT 366.21', 'Peirol', 'Occitan', 'G', '45r', 1, 1, '[\"C1 G a h c c c h \'C3 h a G\\nh d h cha h c aF h aGF \'C3F5 Ga\\nahc haG GaGF EDE C G G G \'F3 GaGF ED\\nG G aG F a a h c haG ahaG \'\\nC2F4 G a h c c c h h a G \'\\nC2F4 h d h cha h c a h aGF \'C2F4 Ga\\nahc haG GaGF EDE C G G G GaGFE EDDC \",\"C1 G a h c c c h\\nC3 h a G \'h d h cha h c aF h aGF\\nC3F5 Ga \'ahc haG GaGF EDE C G G G\\nF3 GaGF ED \'G G aG F a a h c haG ahaG \'\\nC2F4 G a h c c c h h a G \'\\nC2F4 h d h cha h c a h aGF\\nC2F4 Ga \'ahc haG GaGF EDE C G G G GaGFE EDDC \"]', '[\"Molt m’en-tre-mis de chan-tar vo-lun-ters\\ne d’a-le-granz’ e de ioi man-te-ner\\nmen-tre q’eu fui d’a-mor en bon es-per\\nmas er no i vei mon pro ne l’i en-ten\\nne mais se-cors de mi-donz no a-ten\\ntals des-co-norz e tal es-mais m’en ve\\nqe per un pauc de tot ioi no∙m re-cre.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP101_R71sup_c.45r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[3,8,8,4,4,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(256, 'Nulz hom no s\'aucit tan gen', 'BdT 366.22', 'Peirol', 'Occitan', 'G', '49v-50r', 1, 1, '[\"C2 c c h a ? aGF G\\na \'C2 h a aGF F\\nG F h a G \'C2 F aGF G\\nc h a G F ED DC \'\\nC1F3 F E D C F FE G\\nG G h a \'C2F4 h c haaG GF\\nE GaG F E \'C2F4 G\\nGaha G F E DC DEFEC C\",\"C2 c c h a ? aGF G \'a\\nC2 h a aGF F \'G F h a G\\nC2 F aGF G \'c h a G F ED DC \'\\nC1F3 F E D C F FE G \'G G h a\\nC2F4 h c haaG GF \'E GaG F E\\nC2F4 G \'Gaha G F E DC DEFEC C\"]', '[\"Nulz hom no s’au-cit tan gen\\nni tan dol-za-men\\nni fai son dan ni fo-le-ia\\ncon cel q’en a-mor s’en-ten\\nper zo n’ai eu bon ta-len\\nsi tot A-mor mi guer-ri-a\\ne·m des-treing greu-men\\ncar per mon pla-zer mal pren.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP110_R71sup_c.49v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[4,7,7,2,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10);
