(257, 'Per dan qe d\'amor me vegna', 'BdT 366.26', 'Peirol', 'Occitan', 'G', '46r', 1, 1, '[\"C2F4 C G G F G Ga c h \'\\nC1F3 a G a G\\nE G G F G Ga \'C2F4 c h\\na G aha G\\nE G F \'C2F4 G D C D\\nE G F D E C \'\\nC1F3 E G F G E C D\\nE G \'C2F4 FE DE FE G\\nC G G \'C2F4 F G Ga c h\\na G a G\\nE G \'C2F4 G F G Ga c h\\na G aha \'C2F4 G\\nE G F G D C D\\nE G F D \'E C\\nE G F G E C D \'\\nE G FE DE FE G \",\"C2F4 C G G F G Ga c h \'\\nC1F3 a G a G \'E G G F G Ga\\nC2F4 c h \'a G aha G \'E G F\\nC2F4 G D C D \'E G F D E C \'\\nC1F3 E G F G E C D \'E G\\nC2F4 FE DE FE G \'C G G\\nC2F4 F G Ga c h \'a G a G \'E G\\nC2F4 G F G Ga c h \'a G aha\\nC2F4 G \'E G F G D C D \'E G F D\\nE C \'E G F G E C D \'\\nE G FE DE FE G \"]', '[\"Per dan qe d’a-mor m’a-ve-gna\\nno la-xe-rai\\nqe iois e chan no man-te-gna\\ntan com viu-rai;\\ne si·n sui en tal es-mai\\nno sai qe·m de-ve-gna\\ncar cil o mon cor es-tai\\nvei c’a-mar no·m de-igna.\\nNe-gu-na bo-n’ en-tre-se-gna\\nde lei non ai\\nqe ia con-seil ni pro·m te-gna\\ndel mal q’eu trai;\\npe-ro si la·n pre-ie-rai\\nqe de mi·l so-ve-gna:\\nqe s’A-mors no la m\'a-trai\\nMer-ces la·m des-tre-gna.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP103_R71sup_c.46r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,1,6,8,5,7,6,6,8,8]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(258, 'Qan Amors trobet partit', 'BdT 366.29', 'Peirol', 'Occitan', 'G', '48v-49r', 1, 1, '[\"[C2] a a G GF E G a\\nh \'C2F4 c a h G ah a\\nF G a h \'F3 G aF GE\\nE F G aG a ha a\\nh c \'C2F4 a h G ah a\\nG a c h c \'C2F4 haG d\\nc h a h G aG G\\na \'C2F4 c h a ha GF ED\\nD E G G \'C1 a aG a \",\"[C2] a a G GF E G a \'h\\nC2F4 c a h G ah a \'F G a h\\nF3 G aF GE \'E F G aG a ha a \'h c\\nC2F4 a h G ah a \'G a c h c\\nC2F4 haG d \'c h a h G aG G \'a\\nC2F4 c h a ha GF ED \'D E G G\\nC1 a aG a \"]', '[\"Qan A-mors tro-bet par-tit\\nmon cor del seu pes-sa-men\\nd’u-na rai-zon m’a-sail-lit\\ne po-dez au-zir co-men:\\n«A-mic Pei-rol, ma-la-men\\nvos an-naz de mi lo-gnan!\\nE, pos en mi ni en chan\\nno au-reç en-ten-zi-os,\\ndi-gaz puois qe val-r[e]z vos.»\\n\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP108_R71sup_c.48v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[1,6,3,4,3,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(259, 'Si be·m sui loing et entre gen estragna', 'BdT 366.31', 'Peirol', 'Occitan', 'G', '50r-50v', 1, 1, '[\"C3 F G G G a c c h cd cha h \'\\nC3 haGF G a h c a haGF G aG \'C3 G\\nh d h c h a h c \'C3F5 haG haGF\\nF G aG GF a c c c cha h \'\\nC3F5 h d h c h a h \'C2F4 c haG haGF\\nF G aG GF a c \'C2F4 c h cd cha h\\nhaGF G a h c \'C2F4 a haG G aG ahcha aG\",\"C3 F G G G a c c h cd cha h \'\\nC3 haGF G a h c a haGF G aG\\nC3 G \'h d h c h a h c\\nC3F5 haG haGF \'F G aG GF a c c c cha h \'\\nC3F5 h d h c h a h\\nC2F4 c haG haGF \'F G aG GF a c\\nC2F4 c h cd cha h \'haGF G a h c\\nC2F4 a haG G aG ahcha aG\"]', '[\"Si be·m sui loing et en-tre gen es-tra-gna\\neu mai con-ssir d’a-mor ab qe·m co-nort\\ne pes d’un vers co·l fa-za e qe l\'a-cort\\ntal qe si-a bos e va-lenz e fis,\\ncar on hom plus mos chan-tars mi gra-zis\\na-dons dei meilz po-gnar qe no i mes-pren-da\\nni di-ga re don sa-vis me re-pren-da.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP111_R71sup_c.50r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[6,8,6,6,5,3,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(260, 'Tut tems mi ten amors de tal faichon', 'BdT 370.13', 'Perdigon', 'Occitan', 'G', '65r-65v', 1, 1, '[\"C2F4 F Ga a ah G c ba G \'C3F5 GFE D\\nh a a h a G F \'C2F4 E EDC C\\nFE F G G a hc FG GFE \'C2F4 FG G\\na c ha c hcd aG F GF ha \'C2F4 Ga G\\nG E FED C G a F a ha GFGa F \'\\nC1F3 a c ha F FE DC DE FG FED D \'\\nC2F4 D EF F FE FG a aD EF GFED D\\nG ah \'C2F4 chG G h d a F ah aGFE\\nh \'C1F3 h ha ahc aG FED EF ah aGFED D \",\"C2F4 F Ga a ah G c ba G\\nC3F5 GFE D \'h a a h a G F\\nC2F4 E EDC C \'FE F G G a hc FG GFE\\nC2F4 FG G \'a c ha c hcd aG F GF ha\\nC2F4 Ga G \'G E FED C G a F a ha GFGa F \'\\nC1F3 a c ha F FE DC DE FG FED D \'\\nC2F4 D EF F FE FG a aD EF GFED D \'G ah\\nC2F4 chG G h d a F ah aGFE \'h\\nC1F3 h ha ahc aG FED EF ah aGFED D \"]', '[\"Tut tems mi ten a-mors de tal fai-chon\\ncom es-tai cel c\'a·l mal don s\'a-dor-mis\\ne mo-ri-a dor-men, tan es con-qis,\\nen pauc d\'o-ra, en-tro q\'om lo re-si-da,\\na-tres-si m\'es tal do-lor de-me-si-da\\nqe·m do-n\'a-mors qe sol non sai ni sen,\\ne mo-ri-a ab [a] qest mar-ri-men\\ntro qe m\'es-forz de far u-na chan-zon\\nqe·m re-si-da d\'e-qest tor-men on son.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP141_R71sup_c.65r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[6,10,7,6,5,7,3,4]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(261, 'Trop ai estat q\'en bon esper no vi', 'BdT 370.14', 'Perdigon', 'Occitan', 'G', '64v-65r', 1, 1, '[\"C2F4 a a a ahc h aGa GFE D ED DC \'\\nC2F4 F a G ahchGa F EDEFE C DE GF EDEFE ED \'\\nC2F4 G G GahaF F a c h G E CDE G \'\\nC2F4 a c cd chaGa F EDEFEC C F EDEFEC C\\nFEDC \'C2F4 D DE G Gah c aGahaF F\\na c \'C2F4 h dcde c aGF Gaha aG\\nG h c aG \'F4 DE G(F) EDEC D\\na a a ha \'C3F5 aG Gah a GaGFEEDC\",\"C2F4 a a a ahc h aGa GFE D ED DC \'\\nC2F4 F a G ahchGa F EDEFE C DE GF EDEFE ED \'\\nC2F4 G G GahaF F a c h G E CDE G \'\\nC2F4 a c cd chaGa F EDEFEC C F EDEFEC C \'FEDC\\nC2F4 D DE G Gah c aGahaF F \'a c\\nC2F4 h dcde c aGF Gaha aG \'G h c aG\\nF4 DE G(F) EDEC D \'a a a ha\\nC3F5 aG Gah a GaGFEEDC\"]', '[\"Trop ai es-tat q\'en bon es-per no vi\\nper q\'es be dreiz qe toz jois mi sof-ra-gna\\ncar eu mi loing de la so-a com-pa-gna\\nper mon fol sen, don anc jorn non jau-zi,\\nmas si-vals leis no cos-ta re\\nqe·l danz no torn tot sob-re me,\\net un eu plus mi vau lo-gnan\\nmeinz n\'ai de jois e plus d\'a-fan.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP140_R71sup_c.64v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[7,6,5,9,4,9,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(262, 'Molt ai estat q\'en bon esper non vi', 'BdT 370.14', 'Perdigon', 'Occitan', 'X', '89r-89v', 1, 1, '[\"F3 G a a ahc b aGah a GF EDC F\\nFG a a aGGa GF \'F3 EDEFE EC DE GF EDEFE ED\\nF G a aGF a ahc h G E CDE G \'\\nF3 G h cd cch aG F EDC F DEFECC\\nFFEDEDC DC DE G a \'? ?\\n? ? ? ? ? ? ?\\n? ? ? ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ?\",\"F3 G a a ahc b aGah a GF EDC F \'FG a a aGGa GF\\nF3 EDEFE EC DE GF EDEFE ED \'F G a aGF a ahc h G E CDE G \'\\nF3 G h cd cch aG F EDC F DEFECC \'FFEDEDC DC DE G a\\n? ? \'? ? ? ? ? ? ? \'? ? ? ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ?\"]', '[\"Molt ai es-tat q\'en bon es-per non vi\\net est ben dreiz que toz ioi mi sos-fra-igne\\ncant eu m\'es-loig de la so-ie com-pa-igne\\npir mon fol sen don tan ior non iou\\nnom-por-qant li non cos-te ren \\nque dans tor-ne sob-re men\\net cant eu mais m\'en vois lo-ignan\\nmeins ai de ioi et mais d\'al-fan.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f185.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 47, \"facsimileY\": 638, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(286, 'Er ab la forsa del freys', 'BdT 406.8', 'Raimon de Miraval', 'Occitan', 'R', '87v (LXXXVIIIv)', 1, 1, '[\"F3 F G a a ah aGFb} Gaba\\na a a GFE FG FEDC D \'\\nF3 F G a a ah aGF b} Gaba\\na a a GFE FG FEDC D\\nE F \'F3 G G G FD EFED\\nc dca h aG FE DEFE EDC\\nF G a a \'F3 aGF b} G Gaba aGF\\nF G a ahch G FED E GF\",\"F3 F G a a ah aGFb} Gaba \'a a a GFE FG FEDC D \'\\nF3 F G a a ah aGF b} Gaba \'a a a GFE FG FEDC D \'E F\\nF3 G G G FD EFED \'c dca h aG FE DEFE EDC \'F G a a\\nF3 aGF b} G Gaba aGF \'F G a ahch G FED E GF\"]', '[\"Er ab la for-sa del freys,\\ncant tot le mon trem-bl’e bruy,\\nval mai so-latz e dom-neys\\ne chans ab totz bels des-duy\\nque·l temps cant fue-lh’e flor nays;\\na se-luy qu’es pros e gais\\ncon-tra l’us del temps e del mon\\nben par que bon cor li a-on.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f186.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(287, 'Er agr\'ops que m\'aizis', 'BdT 406.9', 'Raimon de Miraval', 'Occitan', 'R', '84v-85v (LXXXVIv)', 1, 1, '[\"C3 e f ? gfed h c chaG\\nh d dch d e f fedc\\nh c \'C3 d edch ch haG ahch\\ne e e fe d edch cd\\nd fe \'C3 d f +a f ggfedef ed\\ne f g ggfed C1 h chaG G\\nh c d \'C2 edch ch aG hahchaG\\nF a c edef ed ch aGa haGFG\",\"C3 e f ? gfed h c chaG \'h d dch d e f fedc \'h c\\nC3 d edch ch haG ahch \'e e e fe d edch cd \'d fe\\nC3 d f +a f ggfedef ed \'e f g ggfed C1 h chaG G \'h c d\\nC2 edch ch aG hahchaG \'F a c edef ed ch aGa haGFG\"]', '[\"Er a--gr’obs que m’ai-zis\\nde tal chan-so que gra-zis\\nla be-la per cuy soi gais,\\ne non crey que nulhs homs mais\\na-ja tan fi-n’en-ten-den-sa\\ntant los truep totz e-nve-jos\\nc’a pe-nas ni co-nosc dos\\nab joi ses cal-que fa-lhen-sa.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f182.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 929, \"facsimileY\": 717, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
