(309, 'Vers vos souple dosne premierement', 'BdT 404.11', 'Raimon Jordan', 'Occitan', 'W', '194r', 1, 1, '[\"C1 a a a a(h) G GF a \'C2b} b aGa(G) aG\\na a a \'C1 GFE F G E F EDE D\\nC DE FGFD \'F2 D E G G F FE G\\nF a bb(a) aG \'C1 a GF a b aGa aG\\nh c d h \'C1 c hh(a) GF G Ga h\\nc a abaG F F \'C1 a hh(a) G G(F) EDE\\nC DE FGFD D E \'C1 G a hh(a) aG cd\\nc a G FE F GaG EC \'C1 D E GFFE D\",\"C1 a a a a(h) G GF a\\nC2b} b aGa(G) aG \'a a a\\nC1 GFE F G E F EDE D \'C DE FGFD\\nF2 D E G G F FE G \'F a bb(a) aG\\nC1 a GF a b aGa aG \'h c d h\\nC1 c hh(a) GF G Ga h \'c a abaG F F\\nC1 a hh(a) G G(F) EDE \'C DE FGFD D E\\nC1 G a hh(a) aG cd \'c a G FE F GaG EC\\nC1 D E GFFE D\"]', '[\"Vers vos sou-ple dos-ne pre-mie-re-ment\\nper que eu fas et com-mens ma chan-çon\\net sil vos plas en-ten-dez ma rai-son\\nc\'al-tre non aus des-cou-rir mon ta-lent\\nquen-sinc m\'a-ven quan vei vos-tre fa-çon\\nla lan-gue fal lou cor ai te-me-ronz\\nquer qui non tem non a-me co-ral-ment\\nper oc ten car lou vos-tre sei-gno-ra-ge.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f403.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 1182.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 200, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(310, 'Aissi com es genzer pascor', 'BdT 406.2', 'Raimon de Miraval', 'Occitan', 'G', '68r', 1, 1, '[\"F3 D F DC F G ah aGF GF\\nF G \'C2F4 ah aGa FG D FEDC CD\\nD F \'C2F4 DC F G ah aGF GF\\nF G ah aGa FG \'F3 D FEDC CD\\nDE FE DE G a c \'C2F4 haG GF\\na chcd a haG F GahaG GF \'\\nC2F4 F G aG FEFG D FED DC\\nC \'F4 D F G F a Ga GFG\\na chcd F \'F4 FGaGFE D FEDC ED\",\"F3 D F DC F G ah aGF GF \'F G\\nC2F4 ah aGa FG D FEDC CD \'D F\\nC2F4 DC F G ah aGF GF \'F G ah aGa FG\\nF3 D FEDC CD \'DE FE DE G a c\\nC2F4 haG GF \'a chcd a haG F GahaG GF \'\\nC2F4 F G aG FEFG D FED DC \'C\\nF4 D F G F a Ga GFG \'a chcd F\\nF4 FGaGFE D FEDC ED\"]', '[\"Ais-si com es gen-zer pas-cors\\nde nuill au-tre tems chaut ni frei,\\ndeu es-ser meil-ler per dom-nei\\nper a-le-grar fins a-ma-dors,\\nmas mal a-ion o-gan sas flors\\nqe tan m\'an de dan ten-gut\\nq\'en un sol jorn m\'an tol-gut\\ntot zo q\'a-vi-a an dos anz\\ncon-qes ab mainz durs af-fanz.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP147_R71sup_c.68r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[3,9,9,2,7,9,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(311, 'Aisi com es gensers pascors', 'BdT 406.2', 'Raimon de Miraval', 'Occitan', 'R', '83v (LXXXVv)', 1, 1, '[\"F2 D EC CG G b} a b aG FGF\\nF G a F D \'F2 FF(E) D DC\\nD F F G FG a aGF GF\\nF G a F FED \'F2 FE DC D\\nD F(E) DC F F3 a c ahchG F\\na ch d hG \'F3 ah ch ha\\na a a a a a GF FGF\\nF G a GF ED \'F3 FED DC\\nC1 dcc(h) a h aG F3 FED C FED\",\"F2 D EC CG G b} a b aG FGF \'F G a F D\\nF2 FF(E) D DC \'D F F G FG a aGF GF \'F G a F FED\\nF2 FE DC D \'D F(E) DC F F3 a c ahchG F \'a ch d hG\\nF3 ah ch ha \'a a a a a a GF FGF \'F G a GF ED\\nF3 FED DC \'C1 dcc(h) a h aG F3 FED C FED\"]', '[\"Ai-si com es gen-sers pas-cors\\nde nulh au-tre temps caut ni frei\\nde-gr’es-ser me-lhors vas dom-nei\\nper a-le-grar fis ai-ma-dors,\\nsi mal a-jon o-gan las flors\\nque tan de dan m’an ten-gut:\\nque sol en I jorn m’an tol-gut\\ntot cant a-vi’ en dos ans\\ncon-quist ab mans greus a-fans.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f180.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 974, \"facsimileY\": 194, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(312, 'A penas sai don m\'apreing', 'BdT 406.7', 'Raimon de Miraval', 'Occitan', 'G', '69r', 1, 1, '[\"C2F4 a h c d h cha aG\\na \'C2F4 h c d h ca a\\na h \'C2F4 c d h cha aG\\na h c d \'C2F4 h ca a\\na e e e d ed ? \'\\nC3 d f e d c dh G\\na h c d h \'C3 ca a\\na e e e d gf e\\nf \'C4 +a g f e fd h\\nc d e f(e) d \'C3 ec c\",\"C2F4 a h c d h cha aG \'a\\nC2F4 h c d h ca a \'a h\\nC2F4 c d h cha aG \'a h c d\\nC2F4 h ca a \'a e e e d ed ? \'\\nC3 d f e d c dh G \'a h c d h\\nC3 ca a \'a e e e d gf e \'f\\nC4 +a g f e fd h \'c d e f(e) d\\nC3 ec c\"]', '[\"A pe-nas sai don m\'ap-reing\\ncho q\'en chan-tar m\'au-zes dir,\\ncom peing trac e plus m\'a-zir\\nmeils en mon chant es-de-veing:\\ngar-daz, qan er qi n\'e-seng\\ns\'i sa-brai es-de-ve-nir\\nqe ma bo-na dom-pna·m deing,\\nqe ges de sa-ber non feing\\nne nuls hom non pot fal-lir\\nqe de leis a-ia so-veg.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP149_R71sup_c.69r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[4,3,4,3,5,0,7,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
