(314, 'Ben aja·l messatgiers', 'BdT 406.15', 'Raimon de Miraval', 'Occitan', 'R', '83v (LXXXIIIv)', 1, 1, '[\"F3 D E G aG F EDE\\nD G G a GF G\\na c h \'C1 aG F EDE\\nF2 C D E F ED DC\\nC D E F E D EDC D \'\\nF3 G G a c h h a aG\\na h c haG F E DE F ED DC \'\\nF3 C D E FEDE G Ga D EFGF FE EDC\",\"F3 D E G aG F EDE \'D G G a GF G \'a c h\\nC1 aG F EDE \'F2 C D E F ED DC \'C D E F E D EDC D \'\\nF3 G G a c h h a aG \'a h c haG F E DE F ED DC \'\\nF3 C D E FEDE G Ga D EFGF FE EDC\"]', '[\"Ben a-ja·l mes-sa-tgiers\\ne silh que·l m’a tra-mes\\na cui rent las mer-ces\\nsi ja·m torn’ a-le-griers;\\npe-ro de mos mals cos-si-riers\\nc’ai a-vutz soi tant so-bre-pres\\nc’a-pe-nas crei que do-na per a-mor\\nm’a-ja bon cor ni·m vue-lha far ho-nor.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f180.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 279, \"facsimileY\": 1270, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(315, 'Sel cuy joy tanh ni chantar sap', 'BdT 406.18', 'Raimon de Miraval', 'Occitan', 'R', '84v-85r (LXXXVIr)', 1, 1, '[\"C2 cha h c d e d h haG\\nG h h c(h) \'C2 a haF G a\\nG ch a c e dc ha aG\\nh c d dca a \'C2 G aG F\\nF3 F G a a GFE G aGFE G\\na h a G a h \'F3 aG GF\\nFE D E F G G ED E\\nE C E FG aGF ahc haG GahaG \",\"C2 cha h c d e d h haG \'G h h c(h)\\nC2 a haF G a \'G ch a c e dc ha aG \'h c d dca a\\nC2 G aG F \'F3 F G a a GFE G aGFE G \'a h a G a h\\nF3 aG GF \'FE D E F G G ED E \'E C E FG aGF ahc haG GahaG \"]', '[\"Sel cuy joy tanh ni chan-tar sap\\nni sos bels ditz vol des-pren-dre\\na tal do-na·ls fas-s’en-ten-dre\\nc’on-ratz li·n si-a·l dans e·l pros,\\nc’as-satz deu va-ler cor-tes nos\\nde-sa-vi-nen dru-da-ri-a;\\ne s’ieu dom-ney ab fa-di-a\\nsi-vals en-quer in loc gen-til.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f181.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 718, \"facsimileY\": 491, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(316, 'Sill qi no vol auzir chanzos', 'BdT 406.20', 'Raimon de Miraval', 'Occitan', 'G', '68v', 1, 1, '[\"C2 a a a a G a ba aGF \'\\nF3 G a a a GFE FG FED D\\na a \'C2F4 a a G a ba aGF\\nG a a a GFE \'C2F4 FG FED D\\nD E D D C F G a \'\\nC2 a c a c d c haG F\\nh \'C2F4 a Ga GFE ? FG FED C\\nC D E \'C2F4 F G E C DEFED\",\"C2 a a a a G a ba aGF \'\\nF3 G a a a GFE FG FED D \'a a\\nC2F4 a a G a ba aGF \'G a a a GFE\\nC2F4 FG FED D \'D E D D C F G a \'\\nC2 a c a c d c haG F \'h\\nC2F4 a Ga GFE ? FG FED C \'C D E\\nC2F4 F G E C DEFED\"]', '[\"Sill qi no vol au-zir chan-zos\\nde nos-tras com-pa-gni-a·s gar\\nq\'eu chanz per mon cor al-le-grar\\ne per so-laz dels com-pa-gnos\\ne plus, per cho q\'es-de-ven-gues\\nen chan-zon q\'a mi-donz pla-gues,\\nc\'al-tra vo-lon-taz non des-treing\\nde so-laz ni de bes cap-teing.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP148_R71sup_c.68v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[6,3,7,5,5,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(317, 'Selh que no vol auzir chansos', 'BdT 406.20', 'Raimon de Miraval', 'Occitan', 'R', '84v-85r (LXXXVIr)', 1, 1, '[\"F3 a a a G a _h aa(G) GF\\nF G a a F \'F3 G FED D\\na a a G a _h aG F\\nF G a a(G) \'F3 F G GFE D\\nE F G E C D EFD C\\na a a G \'F3 a _h a aGF\\na h c a G FE D C\\nC \'F3 D F E G a(G) FE FED\",\"F3 a a a G a _h aa(G) GF \'F G a a F\\nF3 G FED D \'a a a G a _h aG F \'F G a a(G)\\nF3 F G GFE D \'E F G E C D EFD C \'a a a G\\nF3 a _h a aGF \'a h c a G FE D C \'C\\nF3 D F E G a(G) FE FED\"]', '[\"Selh que no vol au-zir chan-sos\\nde nos-tra com-pa-nhi-a·s gar\\nqu’ieu chan per mon cors a-le-grar\\ne per so-latz dels com-pa-nhos\\ne mais per tal qu’en de-ven-gues\\nen chan-so c’a mi-dons pla-gues:\\nc’au-tra vo-lon-tatz no·m des-trenh\\nde so-latz ni de bel cap-tenh.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f181.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 652.2222290039062, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 180, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(318, 'Chansoneta farai, Vencut', 'BdT 406.21', 'Raimon de Miraval', 'Occitan', 'R', '87r-v (LXXXVIIIr-v)', 1, 1, '[\"F3 FE D E F E G G F\\nF G b} a b aG \'F3 FE FG F\\nFE D E F E G G F\\nG a h a G \'F3 FE FG F\\nb} a c b a G F E D E FED C\\nC D E \'F3 F b} G a b a G aGFE F\\nb} a c b a G F E D E FED \'F2 C\\nC D E FE F3 b} G a b a G aGFE F\",\"F3 FE D E F E G G F \'F G b} a b aG\\nF3 FE FG F \'FE D E F E G G F \'G a h a G\\nF3 FE FG F \'b} a c b a G F E D E FED C \'C D E\\nF3 F b} G a b a G aGFE F \'b} a c b a G F E D E FED\\nF2 C \'C D E FE F3 b} G a b a G aGFE F\"]', '[\"Chan-so-ne-ta fa-rai, Ven-cut,\\npus vos m’an ren-dut Ros-si-lhos,\\ne sap-chatz que nos em cre-gut,\\npus no vim vos-tres com-pa-nhos,\\nd’un drut no-vel don to-ta gen res-so-na\\nque mi-dons es a sem-blan de le-o-na:\\nar sai que∙s to-can las pei-ras d’Al-zo-na,\\npus pre-mier pot in-trar sel que mais do-na.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f185.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 687, \"facsimileY\": 1552, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 230, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
