(324, 'Si·m fos de mos chantars parven', 'BdT 406.39', 'Raimon de Miraval', 'Occitan', 'R', '87v (LXXXVIIIv)', 1, 1, '[\"C1 h c d d d cha G(F) aha\\nG aGF G ah c \'C2 haG aha G\\nG ah c hah G hc d(c) h\\nG aGF a hc de dch aGF \'C1F3 GE\\nF G a GFG E hc dch\\nC2 a h c d e dch cd cha \'\\nC2 c d c ha h ch aG aGF\\nF3 E FG a GFG E FG cha haG\",\"C1 h c d d d cha G(F) aha \'G aGF G ah c\\nC2 haG aha G \'G ah c hah G hc d(c) h \'G aGF a hc de dch aGF\\nC1F3 GE \'F G a GFG E hc dch \'C2 a h c d e dch cd cha \'\\nC2 c d c ha h ch aG aGF \'F3 E FG a GFG E FG cha haG\"]', '[\"Si·m fos de mos chan-tars par-ven\\nc’a ma do-na·n pre-zes cu-ra\\nja no·i gar-de-ra me-zu-ra\\nmas al pus que po-gra so-ven;\\nmas car no·m denh’ es-co-tar\\nm’a fag de tot so-latz gi-quir,\\nper qu’ieu sai qu’es vers so c’aug dir\\nqu’e-nue-ja s’om de bel chan-tar.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f186.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 988, \"facsimileY\": 602, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
