(341, 'A l\'entrade del tens clar', 'BdT 461.12', 'Author of BdT 461.12', 'Occitan', 'X', '82v', 1, 1, '[\"C2 h c d d d h a h c d\\nh c d d d h a h G a \'\\nC2 h c d d d h a h c d\\nh c d d d h a\\nh a G \'C2 a a C1 FED E\\nG G GE F F FED E ED F2 CH\\nC C(D) E C C(D) E G aGGF \'\\nF2 F FE DC D DH C //\",\"C2 h c d d d h a h c d \'h c d d d h a h G a \'\\nC2 h c d d d h a h c d \'h c d d d h a \'h a G\\nC2 a a C1 FED E \'G G GE F F FED E ED F2 CH \'C C(D) E C C(D) E G aGGF \'\\nF2 F FE DC D DH C //\"]', '[\"A l\'en-tra-de del tens clar, e-y-a!\\nPir jo-ie re-co-men-çar, e-y-a!\\nEt pir ja-lous ir-ri-tar, e-y-a!\\nVol la re-gi-ne mos-trar\\nk\'e-le_est si a-mo-rou-se!\\nA la vi\', a la vi-e ja-lous!\\nLas-saz nos, las-saz nos bal-lar\\nen-tre nos en-tre nos!\\n\\nE-le_a fait pir tot man-dar, e-y-a!\\nnon si-e jus-q\'a la mar, e-y-a!\\npu-ce-le ni ba-che-lar, e-y-a!\\nque tuit non ven-guent dan-çar\\nen la dan-ce jo-iou-se.\\nA la vi\', a la vi-e, ja-lous!\\nLas-saz nos, las-saz nos bal-lar\\nen-tre nos, en-tre nos.\\n\\nLo reis i vent d\'au-tre part, e-y-a!\\npir la dan-ce des-tor-bar, e-y-a!\\nque il est en cre-me-tar, e-y-a!\\nque on ne li vuel-le_em-blar\\nla re-gi-ne_a-vril-lou-se.\\nA la vi\', a la [vi-e, ja-lous!\\nLas-saz nos, las-saz nos bal-lar\\nen-tre nos, en-tre nos.]\\n\\nMas pir ne-ient lo vol far, e-y-a!\\nk\'e-le n\'a soi[n]g de viel-lart, e-y-a!\\nmais d\'un le-geir ba-che-lar, e-y-a!\\nki ben sa-che so-la-çar\\nla don-ne sa-vo-rou-se.\\nA la vi\', a la vi-e, ja-lous!\\n[Las-saz nos, las-saz nos bal-lar\\nen-tre nos, en-tre nos.]\\n\\nQui donc la ve-ist dan-çar, e-y-a!\\ne son gent cors de-por-tar, e-y-a!\\nben puist di-re de ver-tat, e-y-a!\\nk\'el mont non a-ie sa par\\nla re-gi-ne jo-iou-se.\\nA la vi\', a la vi-e, ja-lous!\\n[Las-saz nos, las-saz nos bal-lar\\nen-tre nos, en-tre nos.]\",\"A len-tra-de del tens clar e-y-a.\\npir io-ie re-co-men-car e-y-a.\\nat pir ia-lous ir-ri-tar e-y-a.\\nuol la re-gi-ne mos-trar.\\nke-le_est si a-mo-rou-se.\\na la ui. a la ui-e ia-lous.\\nlas-saz nos las-saz nos bal-lar\\nen-tre nos en-tre nos\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f172.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 94, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
