(343, 'Amors m\'art con fuoc ab flama', 'BdT 461.20a', 'Author of BdT 461.20a', 'Occitan', 'W', '187v', 1, 1, '[\"C1 D a(G) a G F E(F) G G \'\\nC1 F ED C D E FED E\\nE F \'C1 G G b} a ba G\\nG GFE D G(a) G \'C1 GFE F F\\na a(h) c G c cbaG \'C1 a a\\nG GFED E E D FED C\\na \'C1 a(h) c G c cbaG a\\nG GFED E E \'C1 D FEDC D D\\nD a(G) a G F E(F) G \'C1b} G\\nF ED C D E FED E\\nE F G \'C1b} G a ba G\\nG GFE D G(a) G GFE F F\",\"C1 D a(G) a G F E(F) G G \'\\nC1 F ED C D E FED E \'E F\\nC1 G G b} a ba G \'G GFE D G(a) G\\nC1 GFE F F \'a a(h) c G c cbaG\\nC1 a a \'G GFED E E D FED C \'a\\nC1 a(h) c G c cbaG a \'G GFED E E\\nC1 D FEDC D D \'D a(G) a G F E(F) G\\nC1b} G \'F ED C D E FED E \'E F G\\nC1b} G a ba G \'G GFE D G(a) G GFE F F\"]', '[\"A-mors m\'art con fuoc am fla-mat\\ne nueg e iorn plus m’a-pren\\nper qu’ieu sai ben, ve-ra-men,\\nque de llueng co-nois qui a-ma.\\n...e lueng vos sui, dous-s’a-mi-a,\\nso cre-son nos-tre guer-rier,\\nmas non sa-bon ies con fi-er\\nle ca-i-rells c’A-mors m’en-via,\\nc’a totz iorns plus m’en-lli-a-ma\\ncon si·us ve-si’ a pre-sen,\\ne ia no·m tro-bi dor-men\\nc’am vos non sie ios la ra-ma.\"]', '[\"Notes: this song is notated in mensural notation. \", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f390.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 36, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(344, 'Amore, merce no sia', 'BdT 461.20b', 'Author of BdT 461.20b', 'Occitan', 'SJA', '1v', 1, 1, '[\"C2 c c c c h ahch a\\na ha F Gah c haGF G\\nc c c c h ahch a\\na haG F Gah [c] \'C2 haGF G\\nd d e c h ahch a\\nF a h(a) GF G ahca h\\nd d e c h ahch a\\na haG F [Gah] \'C2 c haGF G\",\"C2 c c c c h ahch a \'a ha F Gah c haGF G \'c c c c h ahch a \'a haG F Gah [c]\\nC2 haGF G \'d d e c h ahch a \'F a h(a) GF G ahca h \'d d e c h ahch a \'a haG F [Gah]\\nC2 c haGF G\"]', '[\"A-mors, mer-ce no si-a,\\nno ti a-ban-do-nas-ses,\\nqe lo meu cor de-si-a\\nnem-bran-do me ... tas-ses.\\nE no ne cre-de-ri-a\\nqe t\'a-mor me fal-sas-ses\\nne a la vi-ta mi-a\\nper al-cre me cam-jas-ses.\"]', '[\"\"]', NULL, 2, 10),
(345, 'Ara lausetz', 'BdT 461.27b', 'Author of BdT 461.27b', 'Occitan', 'SJA', '1v', 1, 0, '[\"C2 G a h c h c d h\\nd e c d ha h G\\nd e c h c d h\\nd e c h c \'C2 d h\\nd e c c chc d ch a\\nc h c h chc d h\\nd e f e d e ch a \'\\nC2 c h c d ch a h\\nc ha h G\",\"C2 G a h c h c d h \'d e c d ha h G \'d e c h c d h \'d e c h c\\nC2 d h \'d e c c chc d ch a \'c h c h chc d h \'d e f e d e ch a \'\\nC2 c h c d ch a h \'c ha h G\"]', '[\"A-ra lau-setz, lau-set, lau-set\\nli co-man-da-men I\'ab-bet.\\nBe-la, si vos e-ra-vatz\\nmoi-na de nos-tra mai-so,\\na pro-fit de totz los moi-nes\\nvos pen-dri-atz liu-ra-so;\\nmas vos non es-ta-retz, be-la,\\nsi totz jorns en-ver-sa no;\\nzo dix l\'ab-bet.\"]', '[\"Notes: 3.4 and 6.2: <i>c</i> corrected to <i>h</i> by the notator.\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
