 d d cd e \'e g(f) edc d \'d\\nC2b} b c b a \'G \'e e dc b \'d\\nC2b} e dc b \'b c d d cba \'G\"]', '[\"Sill qu\'es caps e guitz,\\non ve-ra mer-ces\\nes,\\ndon qu\'ieu sia au-sitz\\nd\'un ioy que pro-mes\\nm\'es;\\nc\'uns gentz cors gra-sitz\\nm\'a am pla-sen bres\\npres:\\ndonc s\'yeu suy tra-itz,\\npe-chatz e non fes\\nes.\\nC\'au-tres pla-sers cars\\nars\\nnon pot far so-cors;\\nsors\\nm\'a-gra_un dous bay-sars,\\npars\\nfo-ra dels mel-lors,\\npors\\nfe-ra chan-tars\\nclars\\ndi-sent las lau-sors:\\nplors\\nm\'es a-ra·l pre-sars\\ncars.\\nNon say si l\'a-mors\\nam que·m li-a,\\nmi val-ri-a\\ns\'a-ten-di-a\\na-man\\ntan,\\ne se-ri-a\\ncor-te-si-a\\nsi·m leu-ges l\'a-fan\\ngran:\\ncar s\'un di-a\\nm\'a-cor-ri-a\\nd\'un ioy qu\'ie·l de-man\\ntan,\\nnon cal-ri-a\\ns\'ieu mo-ri-a\\npueys d\'a-qui e-nan\\nlan.\\nDonc dic a la gen\\nque man-don cro-sar\\nar\\nqu\'ieu non ay ta-len\\nni cor de pas-sar\\nmar,\\nneys si·l mo-ni-men\\nsa-bi-a co-brar;\\ncar\\ns\'el-la m\'o de-fen\\nde prez non a par\\ncar.\\nGara con-sin l\'au-ray.\\nN\'ay\\npon-na co·l de-sir\\nvir\\nam leys: non fa-ray,\\nmay\\nam per Dyeu mo-rir!\\nC\'am si·n ten am fort ca-de-na,\\nc\'am pueys qu\'ieu la vic\\ntric\\nd\'a-mor ben am dou-sa pe-na:\\nc\'anc mal non sen-tic,\\ndic,\\ns\'ay-si me-na\\nno m\'es-tre-na\\ncon le-yal a-mic,\\ngic;\\nmas qui spe-ra\\ntro-bar me-na\\nd\'aur per i-star ric,\\npic.\\nBlan-c\'E-le-na,\\ndas m\'es-tre-na,\\nque·ls vos-tres prez ric\\ncric.\"]', '[\"Notes: The song, one of fr. 844 additions by a later scribe, is preserved with mensural notation.\\n<br>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f386.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 864, \"facsimileY\": 491, \"Annotations\": true, \"FontSizeOld\": 20, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicSt