(347, 'Donna, pos vos ay chausida', 'BdT 461.92', 'Author of BdT 461.92', 'Occitan', 'W', '1v', 1, 0, '[\"F3 E F G F E D EDCD C\\nC D E DCD E\\nE F G F E D EDCD C\\nD E \'F2 F EDC D\\nC2 a aGah c h a haG a\\na h aGa F FEDE F GFGaG F\\na aGah c h \'C2 a haG a\\na h aGa F FEDE F EDEFE D\\nE F G F E D EDCD C\\nC D E \'F3 DCD E\\nE F G F E D EDCD C\\nD E F EDC D \",\"F3 E F G F E D EDCD C \'C D E DCD E \'E F G F E D EDCD C \'D E\\nF2 F EDC D \'C2 a aGah c h a haG a \'a h aGa F FEDE F GFGaG F \'a aGah c h\\nC2 a haG a \'a h aGa F FEDE F EDEFE D \'E F G F E D EDCD C \'C D E\\nF3 DCD E \'E F G F E D EDCD C \'D E F EDC D \"]', '[\"Don-na pos vos ay chau-si-da\\nfaz me bel sem-blan\\nqu\'ieu suy a to-ta ma vi-da\\na vos-tre co-man\\nA vos-tre co-man se-ray\\na totz los iors de ma vi-a\\ne ja de vos non par-tray\\nper de-gu-n\'au-tra que si-a\\nQue_E-rex non a-met He-ri-da\\ntan, ni_Y-seutz Tris-tan\\ncon yeu vos, don-na gra-si-da,\\nqu\'ieu am sens en-gan.\"]', '[\"Notes: the song is notated in mensural notation.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f22.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 98, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 1, \"MsLineBreaks\": true, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(348, 'Ensement com la panthere', 'BdT 461.102', 'Author of BdT 461.102', 'Occitan', 'W', '199v', 1, 1, '[\"C1 C CD F Ga C CD EDDC D\\nD \'F2 A C DE F EDE C\\nE F G \'F2 Ga C DE F\\nF G a a aG a(h) aa(G) GF\\na h \'C1 c a GF Ga GFF(E) ED\\nE FG E F EDC DEF EDC D \'\\nC1 a h c a b aG a\\nd c a c \'C1 hc aF GaGE\\nF G a h a Ga GFF(E) ED\\nE F \'C1 G Ga C CD FEDE C\\nD F EDC F F G a \'C1b} ba aa(G) GF\\nc ahc(h) Ga(G) FEDE C D E F GaGFED EFED\",\"C1 C CD F Ga C CD EDDC D \'D\\nF2 A C DE F EDE C \'E F G\\nF2 Ga C DE F \'F G a a aG a(h) aa(G) GF \'a h\\nC1 c a GF Ga GFF(E) ED \'E FG E F EDC DEF EDC D \'\\nC1 a h c a b aG a \'d c a c\\nC1 hc aF GaGE \'F G a h a Ga GFF(E) ED \'E F\\nC1 G Ga C CD FEDE C \'D F EDC F F G a\\nC1b} ba aa(G) GF \'c ahc(h) Ga(G) FEDE C D E F GaGFED EFED\"]', '[\"En-se-ment com la pan-the-re\\nqui por-te tan bo-ne_o-dor\\net a si be-le co-lor\\nque non es bes-te sal-va-ge\\nqui par for-ce_et par ou-tra-ge\\nsi-e tan ma-le ni fe-re\\nque, si loing com puet choi-sir,\\nnon au-ges pres lou mu-rir,\\net en al-tre-tal sem-blan-ce\\nmi ten a-mor en ba-lan-ce,\\nque·m fas se-gre che que non pos a-ber,\\net sec mon damp per far lou sen pla-ser.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f414.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 689, \"facsimileY\": 170, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10);
