c haG a \'f e d\\nC3 c d ch aG \'a G G C2 F G G \'f\\nC2 f ed e dch a G \'a G F\\nC2 G G G/ \'\\nC2 f f f \'f f f \'c h c/ \'\\nC3 h c a \'c de e \'e de f \'d\\nC3 e fgf \'d h G \'G h h G \'C2 F a G\\nC2 a \'h cdcha ha hchaGFG\"]', '[\"I._Gent m\'en ais\\nquan de chais\\nen is lais\\nMar-ki-ol.\\nNon cuit mais\\niois m\'en-crais\\nne m\'a-pais\\nsi com sol,\\nper qu\'eu ai dol,\\net a·l cor mol.\\nC\'uns es-glais\\ncans de plais\\nqui m\'a-bais\\net m\'a-fol.\\nA cel, mais\\nfore en-glais\\nper un bais\\nsol a sol;\\nmi dosn mi col\\ncar eu non vol!\\nII._Griu pan-tais\\nqui me plais,\\net griu fais\\nn\'\'ai en col\\nqui mon trais!\\nEt mon fais\\n–_sont ve-rais\\ndis de foi_–,\\nDex le·n des-tol\\nqu\'eu ca-ui-rol.\\nIII._Cil sui qui ment\\net m\'en re-pent,\\nquant de mi dosn non port ne-ent:\\ne-nans a-tent\\nson cau-si-ment,\\net si fe-rai mon e-sci-ent,\\nve-ra-ie-ment,\\na son vi-vent.\\nSon cors io-uent\\net non ri-ent!\\nI-rai a li, dou-ce a ta-lent,\\nper fa-illi-ment\\nqui m\'es-po-ent,\\ndonc pris ie pou mon ar-di-ment,\\ndont sui do-lent\\net pe-ne-dent.\\nqui cai ni lai\\ntal ioi non sai\\ncom de mi dosn k\'ai vi quai quis.\\nIV._D’a-mor pre-sent\\net non va-lent\\nse bo-ne mi so-ne […] do-ne [s\'a-m]or\\npreis et va-l[…]\\n-gre me-illor.\\nDos-na va-lent\\nmai qu’al-tres cent\\npre-nas et do-nas mi pre-se[..]\\nnon guis ar-gent\\nni gar-ni-ment\\nmaiz un bai-sar ce-la-da-ment\\ncom au-rai cent\\nvi-ras ma-nent.\\nV._Qu’a-mors ven et vai\\net le-ve et cai\\nmal-vai-se_est la tra-ce\\ndel ia-lous sal-vai\\nci se-iorn\' et jai\\na ce-le qui·n plai\\nmais eu seu la tra-ce\\ndel breu Ber-to-lai\\net se ia l\'au-rai\\net ia la ten-drai\\nel brueill souz la fueill-e\\na fin ioi ve-rai.\\nPer hoc non es-chai\\nc\'ainc non vi tant gen-te\\na Jhe-su lou rei\\nprei qu\'a liei m\'au-tre,\\nqu\'e-le_es la plus va-len-te\\nfol eu qui fo-ll[..]\\net fors que per-drei\\ns\'en a-pe-la-ve tren-te.\\nVI._Bien dei di-re\\nmon con-si-re\\ndonc sui pen-sai-re\\ncar ser-vi-re\\net jau-si-re\\nsui [...] a-mai-re\\nli m\'a-pai-re\\ner mai-re\\nqu\'en-si lou pot fai-re\\nli re-gart et li re-mi-re\\npluz que fist sa mai-re\\nli me poig et li m\'a-pi-re\\nsi ne co-ste gai-re\\nVeirs Dex, qui non fis men-ti-re\\ntun si-es gui-ai-re\\nc\'ainc non trais pe-ior mar-ty-re\\nne-guns fins a-mai-re.\\nVII._Be-le don-se cu-bi-nens\\nmer-ces vos prai-gne\\nd\'ai-quest vos-tre ben vo-lens\\nc\'un iois li vai-gne\\nque d\'al-tres n\'au-ri-e cent\\nque me non dai-gne.\\nVIII._Mors lou con-strai-gne\\ncel qui non dai-gne\\nque lau-zen-ger\\nfol par-ler\\nmi con-ven\\net quan mi com-men-ce\\ntout lou cor mi tren-che\\nde ma com-pai-gne\\nnon si-e_es-trai-gne\\nqu\'eu ni ple-ners\\ndre-tu-rers\\nver-ta-ders.\\na-mis sans faill-an-ce\\nen-fas la pro-van-ce\\nDos-ne non des-trai-gne\\nquin vos bar-gai-gne\\nde fol par-lar\\nmen-con-ger\\ncar es-ter\\nnon tro-be ga-ren-ce\\nni al-tra ve-len-ce.\\nIX._Dos-ne bien sa-vez\\nse di-re_ou vo-lez\\nque de preis va-lez\\nme-illors cent\\nen un reng.\\nVos-tre a-mor m\'a-taig\\ntant es con-vi-nen-te.\\nEt vos en va-lez\\nben les meill-ors des,\\nde loig et de-pres.\\nJois m\'a-taig\\net non faig:\\nvos-tre a-mor me çaig\\ntant es com-bi-nen-te.\\nDit en ai mir ves\\nque per vos siu les\\nsi vai mes.\\nVos-tre_a-mor m\'a çaig,\\net non faig\\nper l\'al-trui en-saig:\\nde bo-ne vo-len-te.\\nX._Ja non e-re\\nvos-tre_a-me-re\\nne non a-gre cu-re,\\nnon pri-se-re\\nnus pris ge-re\\nque sa-bes tan du-re,\\nleu·s a-me-re\\nfres-che, cle-re,\\n–_mais d\'i-tal fi-gu-re\\nbru-ne_–, me-re,\\nfres-che cle-re\\ntot per ma-uen-tu-re.\\nXI._Dos-ne Ieh-sus me con-fon-de!\\nSe vo-lez en-ten-dre\\nqu\'al me-illor ma-ri del mon-de\\ntal mi poez pren-dre\\nu ven-dre\\nsi po-ghes com au-rion-de\\npu-jar et de-scen-dre,\\ntost mi vi-ras en l\'es-pon-de,\\net po-ghes mi pren-dre\\nni ve-dre.\\nDos-ne fres-che, gen-te_et blon-de,\\nnon pos mais a-ten-dre,\\ncar vo-lun-tas de-si-ron-de\\nfac qu\'el foc de-scen-de\\ncel qui vol a vos con-ten-dre\\nlai.\\nXII._Mes a-le-giers\\nde-si-iers\\nest pluz fers\\nque tem-pers:\\ntan sui d\'a-mors lou-ca-ders\\nque non pos ga-rir a-cers.\\nXIII._Dos-ne, s\'eu au-sais-se dir\\nque fus-siez m\'a-mi-e,\\nai-qui, hoc, vol-gre mo-rir,\\nmais en i-cel di-e.\\nMais vous a-vez tant d\'a-bir\\net de cur-tei-si-e,\\nben sau-rez lou meill cau-sir.\\nMa da-me cau-si-e,\\nDex vos laist tal meill cau-sir,\\nque mon cor en ri-e.\\nXIV._A-mor ant,\\nqui a-mant\\nnon pre-sant\\nmaiz ser-vol.\\nCent i-tant\\nest pluz grant\\nque del chant\\nMar-ki-ol.\\nJhe-su l\'a-fol\\nqui joi non vol,\\nqu\'eu veu et vol.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f439.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 65, \"facsimileY\": 361, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 200, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
