re-pent,\\nquant de mj dosn non port no-ient;\\nen aus a-tent\\nson cau-smj-ent,\\net si fe-rai mon en-ti-ent,\\nve-rai-e-ment,\\na son vi-vent.\\nSon cors io-vent\\net non ri-ent!\\nI-raj a li, doce a ta-lent,\\nper fa-li-ment,\\nki mes-pau-ent,\\ndont pris io poj mon ar-de-ment,\\ndont suj do-lent\\net pe-ne-dent,\\nke caj nj lai\\ntal ioi non sai\\ncom de mj dosn   k\'ai vi, k\'ai quis\\nd\'a-mor pre-sent\\net non va-lent,\\nse boi-ne mj so-ne non do-ne s\'a-mor,\\npreis et va-lor\\nvol-ghe mi-lor.\\nDos-ne va-lent\\nplus k\'au-tres cent,\\npre-gnas et do-nas mj pre-sent,\\nnon gins ar-gent\\nnj gar-nj-ment,\\nmais un bai-sar ce-la-da-ment:\\ncom au-raj cent\\nvi-ras ma-nent!\\nK\'a-mors vieg et vaj\\net lie-ve_et kaj!\\nMau-vai-se_est la trai-ce\\nde breu Ber-tho-laj,\\net se ia l\'a-raj\\net ie la ten-draj\\nel bruel sos la foil-le\\na-fin ioj ver-raj.\\nPer oc non es-chaj\\nk\'ainc non vi tant gen-te.\\nA Ihe-su lor roj\\nprej k\'a li m\'au-tre,\\nk\'e-le_est la plus va-len-te.\\nFols est qui fo-le-j\\net fols kj par dej\\ns\'en a-pie-la-ve tren-te.\\nBien doj di-re\\nmon con-si-re\\ndonc suj pen-sai-re,\\ncar ser-vi-re\\net jau-si-re\\nsuj et a-mai-re.\\nMi fait frj-re\\ndont de-si-re\\ndont sui mer-chi-ai-re.\\nLi m\'a-pai-re et m\'ai-re\\nqu\'en-si lor pot fai-re:\\nli re-gart et li re-mi-re\\nplus ke fist sa mai-re,\\nli me poing\' et li m\'a-pi-re,\\nsi ne co-ste gai-re!\\nVoirs Diex ki nos fiss men-ti-re,\\nti·m sies gu-iai-re,\\nc\'ainc mon trais pe-ior mar-ti-re\\nne-guns fins a-mai-re.\\nBel-le dos-ne cu-bi-nens,\\nmar-ches vos pre-gne\\nd\'ai-kest vos-tre boin voil-lent;\\nc\'uns iors li vai-gne,\\nke d\'au-tres n\'au-ri-e cent\\nque men non dai-gne.\\nMors li con-strai-gne,\\nce ki nos dai-gne\\nke lau-ze-ger,\\nfol par-ler\\nmj co-ven;\\net ke mj co-men-ce,\\ntot le cor mj tren-che.\\nDe ma com-pai-gne\\nnon si-e_es-trai-gne,\\nk\'eu, nj ple-niers,\\ndroi-tu-rers,\\nver-ta-ders,\\na-mjs sans fail-lan-ce,\\nen-fas la per-van-ce.\\nDos-ne, non es-trai-gne\\nki·n nos bar-gai-gne\\nde fol par-ler,\\nmen-con-gier,\\ncar es-ter\\nnon trou-be ga-ren-te,\\nne au-tre va-len-te.\\nDos-ne ben sa-ves\\nse di-re vo-les,\\nke de-pris va-les\\nmil-lors cent\\nen un regn.\\nvos-tre_a-mors m\'a caing\\ntan est cu-bi-nen-ce.\\nEt vos en va-les\\nben les meil-lors des,\\nde loins et de pres.\\nIois m\'a caing\\net non faing:\\nvos-tre_a-mors m\'a-taing\\ntant est cu-bi-nen-te.\\nDit en aj mir ves\\nki per vos suj les\\nsi vai mes.\\nVos-tre_a-mors m\'a-taing\\net non faing\\nper l\'au-trui en-saing:\\nde boi-ne vo-len-te.\\nJa non e-re\\nvos-tre_a-me-re,\\nne non ai-gre cu-re,\\nnon pri-se-re\\nnus pri ge-re\\nke sa-bes tant du-re,\\nleu s\'a-me-re,\\nfres-che, cle-re,\\nmes d\'i-tal fi-gu-re\\nbru-ne, me-re,\\ndo-ce, cle-re,\\ntot per m\'a-ven-tu-re.\\nDos-ne, Ihe-sus me con-fon-de!\\nSe va-las en-ten-dre\\nk\'a mil-lor ma-rj del mon-de\\nvos paj po-ghes pren-dres\\nou ven-dre.\\nSi po-ghes co-me_au-ri-on-de\\npu-iar et des-cen-dre,\\ntot mi vi-ras ens l\'es-pon-de,\\net po-ghes mi pren-dre\\nni ven-dre.\\nDos-ne fres-ce, gen-te et blon-de\\nnon pos mais a-ten-dre,\\ncar vo-lun-tas de-si-ron-de\\nfaic k\'el foc des-cen-de\\ncel ki vol a vos con-ten-dre\\nlei.\\nMes a-le-giers de-sijers\\nplus est fers ke tem-pers;\\ntant suji d\'a-mors lou-ca-ders\\nke non pos ga-rir a-cers.\\nDos-ne, si aus-sai-se dire\\nque fuis-sies m\'a-mi-e,\\nai-qui, hoc, vol-ghe mo-rir\\nmais en i-cel di-e.\\nMais vos a-var tant d\'a-bir\\net de cur-te-si-e,\\nben sau-res lor miaus coi-sir.\\nMa-da-me kau-si-e,\\nDiex vos laist tel miex chau-sir,\\nki mon cor en ri-e.\\nA-mor ant,\\nki a-mant\\nnon pre-sant\\nmais ser-vol.\\nCent i-tant\\nest plus grant\\nke del tant\\nMar-ki-ol.\\nJe-sus l\'a-fol\\nqui joi non voil,\\nk\'eu veu   et vol.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60007945/f155.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null