 chant.\\nJ\'en voi las-chant\\nde-se-re en a-vant,\\npar ben sam-blant.\\nAb siens,\\nsa-pi-ens\'\\net boin sens\\nist d\'a-mar,\\nhoc, et de\\nfin tro-bar,\\nper qu\'en doi ju-gar.\\nCar i-tol car-pti-nen-ce\\ntot li cor-tois dru fant,\\ndos-ne va-lent\\na Dieu vos co-mant,\\nk\'eu vai loi-gnant.\\nA-vi-nens\\nPre va-lens\\net Io-vens\\net Do-nar\\ndert re-gnar\\nod les pros,\\nper k\'en dert pre-sar\\nSa-ber et Ab-sti-nen-ce\\nmi vai en-doc-tri-nant,\\nJoi mi rent blanc\\ntal com e-u de-mant,\\ntot sans en-gant.\\nE! dos-ne fi-ne,\\ngent cors de re-gi-ne,\\nla fuisse od vos\\nou mis cors de-si-re,\\nke d\'al non con-si-re.\\nM\'en de-la-i-tos\\nal saint vas glo-ri-ous\\nou Diex jut por nos.\\nAi! chai-re gri-ne\\nma-ris, te-ste_en-cli-ne,\\ncar res-tai ia-lo-us,\\nson cor en griu ti-re\\nki d\'al non em-pi-re:\\ncar eu sui jau-ous,\\nmolt est pen-sa-tos\\net l\'en-fais lan-gous.\\nAi! be-che d\'es-pi-ne,\\nnai-rens fu ma vi-ne,\\nfaus con-tra-lio-us,\\ntant mal vos con-si-re,\\nlou cor vos ar-bri-e,\\nke di-sas des-prous,\\ncar est tant en-vio-us\\net tant a-nu-ious!\\nMas Dieu laou\\nke no-us au.\\nA la mil-lor\\ntant m\'es-jau\\nki\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60007945/f159.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 99, \"facsimileY\": 849.5, \"Annotations\": true, \"FontSizeOld\": 28, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 140, \"FontSizeModern\": 17, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
