(357, 'Lo premer jor que vi', 'BdT 461.152', 'Author of BdT 461.152', 'Occitan', 'W', '201r', 1, 1, '[\"C2 F a c d(c) baG FF(G)\\nFE Ga F \'\\nC2 a b} c aa(G) F baa(G) GF \'\\nC2 a c a baG\\nG E E F Ga haa(G) GF\\na \'C2 c dd(c) c%h cde cdd(c) a\\nc(h) aGF F\\nG E FGa \'C2b} ba aGF F\\nbaG F G E FGa haa(G) F\\nG E \'C2 FGa ha aGF F\\nF Ga cde fedc aa(G) GF \'\\nC2 aa(G) F E F b} Ga baa(G) GF \",\"C2 F a c d(c) baG FF(G) \'FE Ga F \'\\nC2 a b} c aa(G) F baa(G) GF \'\\nC2 a c a baG \'G E E F Ga haa(G) GF \'a\\nC2 c dd(c) c%h cde cdd(c) a \'c(h) aGF F \'G E FGa\\nC2b} ba aGF F \'baG F G E FGa haa(G) F \'G E\\nC2 FGa ha aGF F \'F Ga cde fedc aa(G) GF \'\\nC2 aa(G) F E F b} Ga baa(G) GF \"]', '[\"Lou pre-mer ior que vi,\\nm\'a-be-li\\nli vos-tres biaus cors gens,\\ndouz, et plai-sens,\\ncor-teis et de-bo-nai-re;\\net s\'eu sap dir ni fai-re\\nnu-le ren\\nque vos ten-gues a ben,\\nma dou-ce che-re_a-mi-ge\\nal cors plai-sen et gai,\\nsa-chaz que mol mi plai\\ns\'eu fai ren qui vos si-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f417.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 466, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(359, 'Pos qu\'ieu vey la fuella', 'BdT 461.196', 'Author of BdT 461.196', 'Occitan', 'W', '1v', 1, 1, '[\"F4 F F E F Ga G\\na h c h a GF E\\nF G a F G(F) E D\\na G a \'C2 h c h a\\nb} a b a\\na b aG F G a baG a\\na G a h c h a\\na \'C2b} b a\\na h aG F E G a-GFE F\\nF F E F Ga G\\na h c h a(G) \'C2b} GF E\\nF G a F G(F) E D\",\"F4 F F E F Ga G \'a h c h a GF E \'F G a F G(F) E D \'a G a\\nC2 h c h a \'b} a b a \'a b aG F G a baG a \'a G a h c h a \'a\\nC2b} b a \'a h aG F E G a-GFE F \'F F E F Ga G \'a h c h a(G)\\nC2b} GF E \'F G a F G(F) E D\"]', '[\"Pos qu’ieu vey la fual-la\\nver-de-ar en-tre la flor,\\nchan-tar vual per fi-n’a-mor.\\nQuar fi-n’a-mors mi ten gay\\ne mi fay\\nviu-re tot iorn sens con-si-re\\nper qu’ieu d’a-mar no·n par-tray\\nleys, que·m play\\ntant, qu’ieu mays ren non de-si-re\\nmas sol qu’el-la vual-la\\nque de sa va-lent va-lor\\npuas-cha chan-tar a ss’o-nor.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f22.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 122, \"facsimileY\": 535, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(360, 'Pos ve gent que l’ivers irais', 'BdT 461.197', 'Author of BdT 461.197', 'Occitan', 'W', '190r', 1, 1, '[\"C2 a c c c c chc d hG \'\\nC2 h c d d d ch cd chc\\na \'C2 c c c c chc d hG\\nh c d d d \'C2 ch cd chc\\na c cde d c hc(d) c \'C2 haG\\ndcd G a c c c d edc\\ne c efgfd ? \'C2 c aG ah ccha \",\"C2 a c c c c chc d hG \'\\nC2 h c d d d ch cd chc \'a\\nC2 c c c c chc d hG \'h c d d d\\nC2 ch cd chc \'a c cde d c hc(d) c\\nC2 haG \'dcd G a c c c d edc \'e c efgfd ?\\nC2 c aG ah ccha \"]', '[\"Pos ve gent que l’i-vers i-rais\\net part se del tanz a-mo-ros,\\nque non au ges no-tes ni lais\\ndes au-selz per ver-gers foil-loz,\\nper lou freit del brun tem-po-rau\\nnon leis-se-rai un vers a far,\\net di-rai al-ques mon ta-lant.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f395.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 315, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(363, 'S\'anc vos amei', 'BdT 461.215c', 'Author of BdT 461.215c', 'Occitan', 'SJA', '1v', 1, 1, '[\"F2 FE D E FE F G FE D E C\\nFE D E FE F G FE D E F \'\\nF3 a a a a a G FE F G F\\na a a a G F E F G F\\nFE \'? ? ? ? ? ? ? ? ?\\n? ? ? ? ? ? ? ? ? ?\",\"F2 FE D E FE F G FE D E C \'FE D E FE F G FE D E F \'\\nF3 a a a a a G FE F G F \'a a a a G F E F G F \'FE\\n? ? ? ? ? ? ? ? ? \'? ? ? ? ? ? ? ? ? ?\"]', '[\"S\'anc vos a-me, e-ra·us vau de-sa-man,\\ne ai ra-zo, que no·i trob mas en-jan.\\nEn-jan i trob per mi-tad ve-ra-men,\\nper q\'eu no·us deg te-ner ne-gun co-ven:\\nvos a-vetz fait lo ma-jor fa-li-men\\nq\'anc a-mi-ga fe-des vas son a-man.\"]', '[\"Notes: Last two tetragrams without musical notation in the MS.\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(365, 'Tant es gay\'es avinentz', 'BdT 461.230', 'Author of BdT 461.230', 'Occitan', 'W', '78v', 1, 1, '[\"F4 D EF a G(F) E FEFG E \'\\nC2 E F E D C D E(D) E \'\\nC2 D EF a G(F) E FEFG E\\nE \'C2 F E D C D EEF D \'\\nC2 a hc d c ha Ga hch a \'\\nC2 a hch a G a GFE DE(F) G \'\\nC2 a hc d c ha Ga hch aGF\\na \'C2 hch a G a GFE DDEFG F\\nD \'C2 EF a G(F) E FEFG E\\nE F \'C2 E D C D E(D) E\\nD EF a \'C1 G(F) E FEFG E\\nE F E \'C2 D C D EEF D\",\"F4 D EF a G(F) E FEFG E \'\\nC2 E F E D C D E(D) E \'\\nC2 D EF a G(F) E FEFG E \'E\\nC2 F E D C D EEF D \'\\nC2 a hc d c ha Ga hch a \'\\nC2 a hch a G a GFE DE(F) G \'\\nC2 a hc d c ha Ga hch aGF \'a\\nC2 hch a G a GFE DDEFG F \'D\\nC2 EF a G(F) E FEFG E \'E F\\nC2 E D C D E(D) E \'D EF a\\nC1 G(F) E FEFG E \'E F E\\nC2 D C D EEF D\"]', '[\"Tant es ga-y’es a-vi-nentz\\nmi-donz que fin pres am-pa-ra,\\nes a beu-tats si pla-sens\\nper qu’ieu l’am e la tenc ca-ra.\\nTant la say de ioy com-pli-da\\nque non a par, ses men-ti-re.\\nGa-ya, proz es e-xer-ni-da,\\nper qu’ieu l’am ses com-tra-di-re.\\nQue par es-lu-me-na-mentz\\ntant a fres-ca co-lor ca-ra,\\na e tots bons com-pli-ments\\ne va-lor qu’en re no·s va-ra.\\n\\nTesto Aztiriakos 2020, con ritocchi.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f174.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 108, \"facsimileY\": 145, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
