(370, 'Can par la flor justa·l vert fuelh', 'BdT 70.41', 'Bernart de Ventadorn', 'Occitan', 'R', '56v', 1, 1, '[\"F3 E F G G G G aG GF\\nb} F G a b \'F3b} a G aGFE FG\\nE F G G G G aG GF\\nb} F G a \'F3 _h a G aGFE FG\\nd c h a c h ch aaG\\nG h \'F3 a c h a a EFGFED\\nE F E D E F D E F \'F3 G\\nah ch aG aG F E F G a EFGFED \",\"F3 E F G G G G aG GF \'b} F G a b\\nF3b} a G aGFE FG \'E F G G G G aG GF \'b} F G a\\nF3 _h a G aGFE FG \'d c h a c h ch aaG \'G h\\nF3 a c h a a EFGFED \'E F E D E F D E F\\nF3 G \'ah ch aG aG F E F G a EFGFED \"]', '[\"Can par la flor ju-sta·l vert fuelh\\ne vei lo tems clar e se-re\\net aug lo chans d’au-zels pel bruelh\\nque m’a-dos-sa·l cor e·m re-ve,\\nmais l’au-zel chan-ton a lau-zor,\\nieu plus ai de ioi en mon cor,\\ndei ben chan-tar, car tug li miei ior-nal\\nson ioi e chan, que no pens de ren als.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f126.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 944, \"facsimileY\": 667, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
