(373, 'Quant par la flor soubre el vert fueill', 'BdT 70.41', 'Bernart de Ventadorn', 'Occitan', 'W', '188r-v', 1, 1, '[\"C3 c d e d c d e \'C3 ee(d) dc\\nc d e f \'C3 ed e(d) ch d\\nc d e d c d \'C3 e dc\\nc d e f ed e(d) ch d \'\\nC3 g f e d f e ed dc\\nd e c \'C3 f e d e(d) haG\\na b} b a G b \'C2 _aG_a F GFGa Ga c\\nd f f(e) ede f \'C2 c a [ ]\",\"C3 c d e d c d e\\nC3 ee(d) dc \'c d e f\\nC3 ed e(d) ch d \'c d e d c d\\nC3 e dc \'c d e f ed e(d) ch d \'\\nC3 g f e d f e ed dc \'d e c\\nC3 f e d e(d) haG \'a b} b a G b\\nC2 _aG_a F GFGa Ga c \'d f f(e) ede f\\nC2 c a [ ]\"]', '[\"Quant par la flor sou-bre el vert fueill\\net vei lou tems clar et se-ren,\\nlou douz chans des oi-selz per brueill\\nm’a-le-gre lou cor et re-ven,\\npuis c’au-zel chan-ten a lor for,\\neu c’ai tan de ioi en mon cor,\\ndei ben chan-tar, que tuit li mien ior-nal\\nsunt en a-mour et ne pens de .. ..\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f391.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 432, \"facsimileY\": 651, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 160, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(374, 'Domna, si totz temps vivia', 'BdT 47.7', 'Berenguier de Palazol', 'Occitan', 'R', '37r-v', 1, 1, '[\"C1F3 G a h h G c hah\\nh h G c ha haGF G \'\\nC2 h c d h ch haG G\\na G F3 E F G E F E \'\\nC1F3 G a G c ha haGF G\\nh c d h ha aG GF\\na G \'F3 E F G E F D\\nG a G c ha haGF G\\nh c \'C1 d c h ha aG\\na a D F G F GaGF F\",\"C1F3 G a h h G c hah \'h h G c ha haGF G \'\\nC2 h c d h ch haG G \'a G F3 E F G E F E \'\\nC1F3 G a G c ha haGF G \'h c d h ha aG GF \'a G\\nF3 E F G E F D \'G a G c ha haGF G \'h c\\nC1 d c h ha aG \'a a D F G F GaGF F\"]', '[\"Do-na, s’ieu  vi-via tos-tems,\\ntos-tems vos se-ray a-clis:\\nqu’es-tra-nha-men m’a-be-lis\\nque·us am, cals que mals m’en si-a,\\ndes-ti-natz ni a-ve-nir;\\nsi tot no m’en puesc jau-zir\\ntan be co mos cors vol-ri-a,\\nsi·n val mays mos pen-sa-mens\\ne m’en sap me-lhor jo-vens\\ne de-port e ga-lhar-di-a.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f87.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 794, \"facsimileY\": 1653, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(375, 'Totz temoros e duptans', 'BdT 47.12', 'Berenguier de Palazol', 'Occitan', 'R', '37r', 1, 1, '[\"C3 h c d e c fed e\\ne g fd h cha G G \'\\nC3 G h c c d(c) h ch aG\\na ha F4 G F c c d e \'\\nF4 e d e e d ef ed c\\nd d d d h ch a G\\naha ha c c \'C3 d ef g\\ne gfe fe d dc d e \",\"C3 h c d e c fed e \'e g fd h cha G G \'\\nC3 G h c c d(c) h ch aG \'a ha F4 G F c c d e \'\\nF4 e d e e d ef ed c \'d d d d h ch a G \'aha ha c c\\nC3 d ef g \'e gfe fe d dc d e \"]', '[\"Totz te-mo-ros e dup-tans,\\ncais qui·s lai-s’a non cha-ler.\\nSol pues-ca en-tre·ls bos ca-ber,\\nvuelh que·m si-a au-zit mos chans;\\npe-ro no m’en-tre-me-tri-a\\nsi mon vo-ler en se-gui-a:\\nmas fran-ca-mens m’en so-mo\\ntals que non aus dir de no.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f87.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 868, \"facsimileY\": 1029, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 260, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(376, 'En ioi mof lou vers et comens', 'BdT 70.1', 'Bernart de Ventadorn', 'Occitan', 'W', '202r', 1, 1, '[\"C3 a c c c hh(a) aG c c \'\\nC3 h c d h cc(h) aGa hchG G\\nh \'C2 d h c(d) chh(a) aG c c\\nc d e \'C3 e dch c dd(c) c\\ne f e d e f ee(d) dc \'\\nC3 d e d ch c d(e) dcha G\\nc d ee(d) dc d \'C3 f gg(f) ed c efgfd\\nG a h d e c \'C3 cc(h) haG ah c-dedc \",\"C3 a c c c hh(a) aG c c \'\\nC3 h c d h cc(h) aGa hchG G \'h\\nC2 d h c(d) chh(a) aG c c \'c d e\\nC3 e dch c dd(c) c \'e f e d e f ee(d) dc \'\\nC3 d e d ch c d(e) dcha G \'c d ee(d) dc d\\nC3 f gg(f) ed c efgfd \'G a h d e c\\nC3 cc(h) haG ah c-dedc \"]', '[\"En ioi mof lou vers et co-mens,\\net en ioi re-man et fe-nis;\\net sab que bo-ne en est la fins,\\ncar bons est li con-men-ce-mens.\\nPer la bo-ne con-mec-can-ce\\nmi ven iois et a-le-gran-ce;\\net per oc dei la bo-ne fin gra-sir,\\nque toz bens faz vei lau-sar al fe-nir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f419.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 176, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(377, 'Qant vei parer l’erbe vert et la fuelle', 'BdT 70.42', 'Bernart de Ventadorn', 'Occitan', 'X', '88r', 1, 1, '[\"C3 e f g e g f d e d cha aG\\nc c c cha a \'C3 h c d e ffede ed\\nd e f g +a f ggf edc d eed dc\\nf f f \'C2 ffe c a c e dch d G\\nf f f fed d e C3 f g feded \'C3 d\\ng f e d c ha c d edc cd\\nf f f ffe c ha c \'C2 ch aG aha aG\",\"C3 e f g e g f d e d cha aG \'c c c cha a\\nC3 h c d e ffede ed \'d e f g +a f ggf edc d eed dc \'f f f\\nC2 ffe c a c e dch d G \'f f f fed d e C3 f g feded\\nC3 d \'g f e d c ha c d edc cd \'f f f ffe c ha c\\nC2 ch aG aha aG\"]', '[\"Qant vei pa-rer l’er-be vert et la fuel-le\\net iau lo chant des au-zels par bos-ca-ge,\\net l’au-tre ioi que i_ai en mon co-ra-ge,\\ndou-ble mes chans et crest et nest et bruel-le;\\na-don m’est vis con ren pus-se va-ler,\\ns’o-re non poc a-mor ni io-ie_a-ver,\\ncar tot can k’est s’a-le-gre_et s’es-bau-de-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f183.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 48, \"facsimileY\": 345, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(379, 'Can vei la lauzeta mover', 'BdT 70.43', 'Bernart de Ventadorn', 'Occitan', 'R', '56v', 1, 1, '[\"C1 D F G a a a aGah aG\\nG a h c h \'aGF G a\\nC2 c d c(h) aG ah a aG aGF\\nF G a ahch C1 G E \'C1 F EDE\\nG a F G a h chcd G\\na c a h a \'C1 GF GaGF E\\nF G a ahch G E F EDE\\nE G a(G) F G(F) EC DE FED\",\"C1 D F G a a a aGah aG \'G a h c h\\naGF G a \'C2 c d c(h) aG ah a aG aGF \'F G a ahch C1 G E\\nC1 F EDE \'G a F G a h chcd G \'a c a h a\\nC1 GF GaGF E \'F G a ahch G E F EDE \'E G a(G) F G(F) EC DE FED\"]', '[\"Can vei la lau-ze-ta mo-ver\\nde ioi sas a-las con-tral rai,\\nque s’o-bli-da, lais-sa·s cha-zer\\nper la dos-sor c’al cor li vay,\\nai, las! Tal en-ve-ya m’en ve\\nde qui qu’ieu ve-ya iau-zi-on,\\nme-ra-vi-lhas ai, car des-se\\nlo cor de de-zi-rier no·mz fon.\\n\\nAi, las! tan cu-ia-va sa-ber\\nd’a-mors, e tan pe-tit en sai!\\ncar ieu d’a-mar no.mz puesc te-ner\\nde leys don pro-fieg non av-rai.\\nQue tout m’a.l cor en bo-na fe,\\ne si me-teis e tot lo mon!\\ne can si·m touc, no·m lais-set re\\nmas de-zi-ri-er e cor vo-lon.\\n\\nDe las do-nas mi de-ses-per!\\nJa-mais en lor no·mz fi-a-rai!\\nC’ai-si co las suelh man-te-ner,\\na-tres-si las des-man-ten-rai.\\nPus vei que nul-ha pro no.m te\\nDe leis quy aus-si e·m co-fon,\\nai-si las dopt’ e las mes-cre,\\ncar say que a-tres-tal se son.\\n\\nAnc non a-gui de mi po-der\\nni no fuy mieus de l’or’ en sai\\npus e-lam mos-tret son vo-ler\\nen un mi-ralh que mot mi plai.\\nMi-ralh, en quy mi-re em te,\\nm’an mort li sos-pir de pri-on,\\nais-si·m per-diei com per-det se\\nlo bel Mar-si-li en la fon.\\n\\nD’ais-so·s fai be fem-na pa-rer\\nma do-na, per q’eu lo re-trai,\\ncar vol so c’om non deu vo-ler,\\ne so c’om li ve-de-la, fai.\\nCa-zutz soi en ma-la mer-ce,\\net ai ben pres del fol un pon\\ne no sai per que s’en-de-ve,\\nmais car tan pue-ga con-tra mon.\\n\\nPus ab mi-dons no·m vol va-ler\\nPrecy ni mer-ce ni·l dreg qu’ieu ai,\\nni a leys no ven a pla-zer\\nqu’ieu l’am ia-mai non lol di-rai.\\nAi-si·m part de lieis  e·m re-cre!\\nMort m’a, e per mort li res-pon,\\ne vau m’en, pus ilh no·m re-te,\\nfai-zitz et is-silh no say on.\\n\\nMer-ces es per-du-da, per ver,\\net ieu non o sau-pi huey mai,\\ncar silh que la de-gr]a_ [a-ver,\\nnon la ay, las on la quer-rai\\nben grans pec-cats es, qui o ve,\\nque a-quest cai-tieu de-li-ro\\nque ja ses lieis non au-ra be,\\nlas-sa mu-rir, qui non l’a-on.    \"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f126.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 880, \"facsimileY\": 1230.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 240, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10);
