(380, 'Quan vei l\'alauzeta mover', 'BdT 70.43', 'Bernart de Ventadorn', 'Occitan', 'W', '190v', 1, 1, '[\"C1 D F G b} a a baG aG G\\nb \'C1 a b c aa(G) GF Ga a\\nc \'C1 d cc(_h) aG Ga(_h) aF GaGF F\\nG a _h c a \'F3 G E GFFED\\nb} abaG a b c b c d G \'\\nC1 a c a b} b aGF G aGF F\\nG a b c a \'C1 G E FEDE\\nE G a GF GaG EC DE GFFED \",\"C1 D F G b} a a baG aG G \'b\\nC1 a b c aa(G) GF Ga a \'c\\nC1 d cc(_h) aG Ga(_h) aF GaGF F \'G a _h c a\\nF3 G E GFFED \'b} abaG a b c b c d G \'\\nC1 a c a b} b aGF G aGF F \'G a b c a\\nC1 G E FEDE \'E G a GF GaG EC DE GFFED \"]', '[\"Quan vei l’a-lo-e-te mo-der\\nde ioi ses a-les con-tre_al rai\\nque s’ou-bli-de_et lais-se ca-der\\nper la dou-cor qu\'el cor li vai,\\nhe! Tan granz en-vi-de m’en pren\\nde co qu\'est si en jau-si-on,\\nmi-ra-vill me qu’eu m’es del sen\\net cor de de-sir-rier non fon.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f396.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 487, \"facsimileY\": 725, \"Annotations\": true, \"FontSizeOld\": 15, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
