(382, 'A! quan gen vens et ab quan pauc d\'afan', 'BdT 155.3', 'Folquet de Marseilla', 'Occitan', 'G', '4r-v', 1, 1, '[\"C2b} F Ga a a a ab aG F FG GabaF \'\\nC1 ah G E GFE C DE F GF EDE D \'\\nC2 D E F Gah a aGa FE EDC DEFE EDEC \'\\nC1 C D ED ED E Ga GF EDC DC D \'\\nC2 F Ga a aGF a c ch haGF FEDC F \'\\nC2 a c hcd c h G ahc h aGF GaF \'\\nC1F3 F a ahc haG a D EFGa GF \'C1F3 EDEF EDC\\nC D ED ED E Ga GF EDC DC D\",\"C2b} F Ga a a a ab aG F FG GabaF \'\\nC1 ah G E GFE C DE F GF EDE D \'\\nC2 D E F Gah a aGa FE EDC DEFE EDEC \'\\nC1 C D ED ED E Ga GF EDC DC D \'\\nC2 F Ga a aGF a c ch haGF FEDC F \'\\nC2 a c hcd c h G ahc h aGF GaF \'\\nC1F3 F a ahc haG a D EFGa GF\\nC1F3 EDEF EDC \'C D ED ED E Ga GF EDC DC D\"]', '[\"Ha qant gen venz et a qant pauc d\'a-fan\\na-cil qi·s lai-sa ven-cer ab mer-ce\\ncar e-nai-si venç om al-trui e se\\net a ven-cut do-as veç se-nes dan,\\nmas vos, a-mors, non o fai ges ai-si\\nc\'anc jorn mer-ces ab vos no·m poc va-ler\\nanz m\'a-veç tant mos-trad vos-tre po-der\\nq\'e-ra no·us ai ni vos no a-vez mi.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064930\", \"custos\": \"[5,7,10,5,5,7,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(410, 'Si tot m\'ai tarzat mon chan', 'BdT 167.53', 'Gaucelm Faidit', 'Occitan', 'R', '44v-45r', 1, 1, '[\"F3 c c dch a h c dG\\nG a \'F3 GF G a Ga GFE DE\\nc c dch a h c dG\\nG \'F3 a GF G a Ga GFE DE\\nF G a D F G FED DC\\nE \'F3 E F E D C E\\nFE D ah c d cha aGF\\nF \'F3 a c haG FG aG FED D\\nC D F G a GFE FED\",\"F3 c c dch a h c dG \'G a\\nF3 GF G a Ga GFE DE \'c c dch a h c dG \'G\\nF3 a GF G a Ga GFE DE \'F G a D F G FED DC \'E\\nF3 E F E D C E \'FE D ah c d cha aGF \'F\\nF3 a c haG FG aG FED D \'C D F G a GFE FED\"]', '[\"Si tot ai tar-dat mon chant\\nni n\'ay fayt trop lon-gu\'_es-tat-ge,\\ne-ra·l n\'ay cor e ta-lan\\nqu\'en torn la per-d\'e·l dam-pnat-ge,\\nqu\'e-la m\'en dres\' el vi-at-ge\\ne·m ditz qu\'ieu mo-str\'en chan-tan\\nlo ioi e la va-lor gran\\nque do-net e l\'a-le-grat-ge\\nlo iorn que·m re-tenc bai-zan.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f102.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 902, \"facsimileY\": 1715, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(411, 'Quan vei l\'alauzeta mover', 'BdT 70.43', 'Bernart de Ventadorn', 'Occitan', 'G', '10r', 1, 1, '[\"C2F4 D F G a a a haGa G\\nG a \'C3 h c a haGF G a\\nc d dc aG Gah \'C3 a G GF\\nF G a c a F GF ED\\na \'C2 haG a h c h c d-G\\na c a \'C3 h aGa F aGE F\\nG a h c a GE \'C1F3 F EDE\\nE G a F G(F) EC DE EFGFD \",\"C2F4 D F G a a a haGa G \'G a\\nC3 h c a haGF G a \'c d dc aG Gah\\nC3 a G GF \'F G a c a F GF ED \'a\\nC2 haG a h c h c d-G \'a c a\\nC3 h aGa F aGE F \'G a h c a GE\\nC1F3 F EDE \'E G a F G(F) EC DE EFGFD \"]', '[\"Qan vei la lau-de-ta mo-ver\\nde ioi sas a-las con-tra·l rai\\nper la dol-çor q’al cor li vai\\ns’ob-li-da e·s lai-sa ca-der,\\nha las! Com grand en-ve-ia·m ve\\nde cui que ve-ia iau-ci-on,\\nme-ri-veil-las ai, car de-se\\nlo cor de de-si-rer no·m fon.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP031_R71sup_c.10r.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[4,7,6,4,9,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(412, 'Jamais rien tal non porroit far amor', 'BdT 167.30', 'Gaucelm Faidit', 'Occitan', 'W', '200r', 1, 1, '[\"C2 d d G a h c d(c) ha G aa(G)\\nF \'C1 a c h a F D a G G\\nC2 d d \'C1 G a h c d(c) ha G aa(G)\\nF a \'C1 c h a F D a GF Ga\\nh G a F \'C1 G a G(a) h G FEF G\\nC2 d e d cha h \'C1 c d(c) ha G FED\\nahh(a) G a F G a \'C1 G FE D DC D\\nD E F G(F) E D \'C1 F G a cd\\nD D F EDC G F \'C1 ED D C D\",\"C2 d d G a h c d(c) ha G aa(G) \'F\\nC1 a c h a F D a G G \'C2 d d\\nC1 G a h c d(c) ha G aa(G) \'F a\\nC1 c h a F D a GF Ga \'h G a F\\nC1 G a G(a) h G FEF G \'C2 d e d cha h\\nC1 c d(c) ha G FED \'ahh(a) G a F G a\\nC1 G FE D DC D \'D E F G(F) E D\\nC1 F G a cd \'D D F EDC G F\\nC1 ED D C D\"]', '[\"Ja-mais rien tal non por-roit far a-mor\\nkiu si-e_en-nui ne mal trais ne a-fans\\ncar el m’a fait tant a-vi-nent sou-cors\\nque res-tau-raz m’a les per-tes e·l dans,\\nqu’a-vi-e fes a dreit per mon fo-la-ge\\net si ainc ior de ren m\'a fet ma-ri\\neu lou par-don lou de-tric e·l da-ma-ge\\ncar tal dos-na fai mon preis a-cueil-lir\\nqui ma-men-de tuit que m\'a fait suf-rir.\\n\"]', '[\"Notes:\\nClef on the second staff is missing. A comparison of the musical phrase on line 4, as well as with the other witnesses suggest to supply the second staff with a C-clef on the first line.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f415.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 56, \"facsimileY\": 721, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 220, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(413, 'Lo gens cors honratz', 'BdT 167.32', 'Gaucelm Faidit', 'Occitan', 'G', '23r-23v', 1, 1, '[\"C2 c ch aG c d\\nc d e \'C3 c dch a\\nG d ch a G \'C2 h a\\na GF G a chah\\na c \'C2 haG c c d\\nc d e dch \'C3 cdch a\\nG d c a G Gah a\\nG F \'C1 G aG FED\\nC F FG h aG \'C1 a\\nahc G F G ha G\\na \'C2 h c F c h h\\nh a ha aG F \'\\nC1 E h a F DE DCH\\nA D DE \'C1 FG E h d\\nh G a GFEF FED \'\\nC1 E D FG aG FEF GFE \",\"C2 c ch aG c d \'c d e\\nC3 c dch a \'G d ch a G\\nC2 h a \'a GF G a chah \'a c\\nC2 haG c c d \'c d e dch\\nC3 cdch a \'G d c a G Gah a \'G F\\nC1 G aG FED \'C F FG h aG\\nC1 a \'ahc G F G ha G \'a\\nC2 h c F c h h \'h a ha aG F \'\\nC1 E h a F DE DCH \'A D DE\\nC1 FG E h d \'h G a GFEF FED \'\\nC1 E D FG aG FEF GFE \"]', '[\"Lo gen cors hon-raz\\ncon-plit de granz bel-taz\\nde leis qi plus m\'a-gen-za\\ne qi mais me plaz\\non es plai-senz so-laz\\ne fran-cha_hu-mi-li-taz\\ne dol-za cap-te-nen-za\\ne gais prez pre-jaz\\nmi fai chan-tar so-ven,\\nses cho q\'ill non cos-sen\\nq\'eu ja·n si-a jau-zi-re\\nd\'a-ver joi pla-çen,\\nni de leis non a-ten\\nmais l\'en-ve-ja_e·l de-si-re\\nc\'ai de seu cors gen,\\nses au-tre jau-çi-men. \"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da8280064997\", \"custos\": \"[3,6,4,3,8,3,2,8,5,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(414, 'Tot mon engieng e mon saber', 'BdT 366.33', 'Peirol', 'Occitan', 'G', '47v', 1, 1, '[\"C2F4 D F G a GF E G E \'\\nF3 FE D C E D F E D\\nF \'C2F4 a GF E F G FEFG E\\nFE D DE \'C1F3 G G a h a\\nG a h \'C2F4 c h aG ahch a\\naGF E F G \'C2F4 a GF ED C\\nD E D C \'C1F3 DE Gah cha\\nGF E F Ga F EDDC D\",\"C2F4 D F G a GF E G E \'\\nF3 FE D C E D F E D \'F\\nC2F4 a GF E F G FEFG E \'FE D DE\\nC1F3 G G a h a \'G a h\\nC2F4 c h aG ahch a \'aGF E F G\\nC2F4 a GF ED C \'D E D C\\nC1F3 DE Gah cha \'GF E F Ga F EDDC D\"]', '[\"Tot mon en-gieng e mon sa-ber\\nai mes en un ioi qi·m sos-te;\\nqan mi re-men-bra ni·m so-ve\\ntan bo-na dom-na·m fai chan-tar,\\nLas duncs me deu-ri-e es-for-zar\\ncom po-gues far mon chan va-ler,\\nsi-tot trac greu mar-ti-re\\nd’A-mor, cui sui ser-vi-re.\"]', '[\"\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP106_R71sup_c.47v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[7,3,6,1,5,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(415, 'Los mals d\'amor ai eu ben toz apres', 'BdT 370.9', 'Perdigon', 'Occitan', 'G', '64r-64v', 1, 1, '[\"F4 D F G a a a h a GF GF \'\\nC3F5 a G FE D ED C CDE F ED C \'\\nC3F5 F G h a G F GF Ga ha F\\nd c \'C2F4 chaGa F G h aG FE DCDE C\\nC D DE \'C2F4 F G h a G FED D\\nG G \'C2F4 Ga GFE C D DE FG FEDE C\\nE G FE \'C2F4 G a c haG a c c\\nc d defed \'C2F4 c hc dch aG FE FG a\\na c \'C2F4 cde dchc a aGFG E FG a GFaF GF \",\"F4 D F G a a a h a GF GF \'\\nC3F5 a G FE D ED C CDE F ED C \'\\nC3F5 F G h a G F GF Ga ha F \'d c\\nC2F4 chaGa F G h aG FE DCDE C \'C D DE\\nC2F4 F G h a G FED D \'G G\\nC2F4 Ga GFE C D DE FG FEDE C \'E G FE\\nC2F4 G a c haG a c c \'c d defed\\nC2F4 c hc dch aG FE FG a \'a c\\nC2F4 cde dchc a aGFG E FG a GFaF GF \"]', '[\"Los mals d\'a-mors ai eu ben toz ap-res\\nmas anc lo bes non pois un jorn sa-ber\\ne se no fos c\'ar eu ai bon es-per\\neu cui-de-ra qe no·n i a-gues ges,\\net a-gra·n dreiz q\'eu fos de-ses-pe-raz\\ntan ai a-mat et anc no fui a-maz,\\npe-ro se·l ben es tan dolz e plai-senz\\ncom es lo mals an-gui-sos e co-senz,\\nanz voil mo-rir q\'eu an-car no l\'a-ten-da.\"]', '[\"[link]http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP139_R71sup_c.64r.jp2/full/full/0/default.jpg[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[5,9,5,7,6,6,3,3]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(416, 'Quar eusse ie .c. mile mars d\'argent', 'BdT 372.3', 'Pistoleta', 'French', 'O', '125r', 1, 1, '[\"C2 d e c d h G h \'C2 c a a\\nF a c ha h \'C1 E D #F D D\\nC2 d e c d h \'C2 G h c a a\\nF a c ha \'C1 G E D #F D D\\nG G G F \'C1 F E D E F GF(G) FE\\nE F \'C1 G a h c d d(c) c hah \'C1 ha\\nd c h a GF E F \'C1 G #FF(E) ED\\nD F G a G \'C1 a h a G a\",\"C2 d e c d h G h\\nC2 c a a \'F a c ha h\\nC1 E D #F D D \'C2 d e c d h\\nC2 G h c a a \'F a c ha\\nC1 G E D #F D D \'G G G F\\nC1 F E D E F GF(G) FE \'E F\\nC1 G a h c d d(c) c hah\\nC1 ha \'d c h a GF E F\\nC1 G #FF(E) ED \'D F G a G\\nC1 a h a G a\"]', '[\"Quar eus-se ie .c. mi-le mars d\'ar-gent\\net a-tre-tant de fin or et fust rox\\net s\'e-us-se prou a-voin-ne_et fro-ment\\nbues et va-ches et bre-biz et mou-tons\\net chas-cun ior mil liv-res a des-pren-dre\\net fort chas-tel que nuns ne pe-ust pren-dre\\ntel que nuns hons ne le pe-ust for-çar\\net s\'eust port d\'ai-gue dou-ce et de mar.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b6000950p/f279.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 463, \"facsimileY\": 125, \"Annotations\": true, \"FontSizeOld\": 14, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(417, 'A penas sai don m\'apreing', 'BdT 406.7', 'Raimon de Miraval', 'Occitan', 'R', '87r (LXXXVIIIr)', 1, 1, '[\"F3 G a h c ha haG GF\\nG a h c a \'F4 hG G\\nG a h c ha haG GF\\nG a h \'F4 c(h) a hG G\\nG d d d c dedc ch\\nc \'F4 e c c hc haG F\\nG a h c a hG G\\nG d \'F4 d d c dedc ch\\nc e d c hc haG F \'\\nF4 G a h c(h) a hG G\",\"F3 G a h c ha haG GF \'G a h c a\\nF4 hG G \'G a h c ha haG GF \'G a h\\nF4 c(h) a hG G \'G d d d c dedc ch \'c\\nF4 e c c hc haG F \'G a h c a hG G \'G d\\nF4 d d c dedc ch \'c e d c hc haG F \'\\nF4 G a h c(h) a hG G\"]', '[\"A pe-nas sai don m\'ap-renh\\nso q\'en chan-tan m\'au-zes dir,\\ncon peitz trac e pus m\'a-zir\\nmeilhs en mon chant en-de-venh:\\ngar-datz, cant er qui ·m n\'es-senh\\ns\'i sa-brai es-de-ve-nir\\nque ma bo-na do-na·m denh,\\nque jes de sa-ber no·m fenh\\nmas nulh hom non pot fa-lhir\\nque de lieys a-ja man-tenh.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f185.item.zoom\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 124, \"facsimileY\": 1202, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(418, 'Anc enemics qu\'eu agues', 'BdT 457.3', 'Uc de Saint Circ', 'Occitan', 'G', '84r-84v', 1, 1, '[\"C3 d e h hc d cha h \'\\nC2F4 h aGFE D DE G aGFE E \'\\nC2F4 d e h hc d cha h\\nh aGFE \'C2F4 D DE G aGFE E\\nG GFE D EF a \'C2F4 a b\\na b c b a Ga \'C2F4 F\\nF G a h a GFGE D \'\\nF3 E F H DE F GFE D\\nG a \'C1F3 h c d cha G\\nF Gah a FED \'F3 EF EDC D\",\"C3 d e h hc d cha h \'\\nC2F4 h aGFE D DE G aGFE E \'\\nC2F4 d e h hc d cha h \'h aGFE\\nC2F4 D DE G aGFE E \'G GFE D EF a\\nC2F4 a b \'a b c b a Ga\\nC2F4 F \'F G a h a GFGE D \'\\nF3 E F H DE F GFE D \'G a\\nC1F3 h c d cha G \'F Gah a FED\\nF3 EF EDC D\"]', '[\"Anc e-ne-mics q\'eu a-gues\\nnulz tems non tenc tan de dan\\ncum mei oill e mos cor fan,\\ne s\'eu ai per lor mal pres\\nill no·il an faich nul ga-daing;\\nqe·l cor en sos-pir e plaing\\ne·ill oil en plo-ron so-ven\\net on cha-saiz pe en pren\\nplus vol chas-cus o-be-dir\\nlai don sen-to·il mal ve-nir.\"]', '[\"[link]http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP179_R71sup_c.84r.jp2/full/full/0/default.jpg[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[6,2,9,5,7,8,2,6]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(423, 'Ja nuns hons pris ne dira sa raison', 'Linker 241.2', 'Roi Richart', 'French', 'O', '62v-63r', 1, 1, '[\"C2 c c c c e d ch a hG \'C2 G\\nh d c cha h d h c \'C2 h a\\nc c c c \'C2 e d ch a h(a) G\\nh \'C2 d c cha h d h c h \'C3 a\\nc d e e f e d \'C2 ch a chG\\nc d ch a haG Ga\",\"C2 c c c c e d ch a hG\\nC2 G \'h d c cha h d h c\\nC2 h a \'c c c c\\nC2 e d ch a h(a) G \'h\\nC2 d c cha h d h c h\\nC3 a \'c d e e f e d\\nC2 ch a chG \'c d ch a haG Ga\"]', '[\"Ja nuns hons pris ne di-ra sa rai-son\\na-droi-te-ment, se do-lan-te-ment non;\\nmais par es-fort puet il fai-re chan-çon.\\nMout ai a-mis, mais pov-re sont li don,\\nhon-te_y au-ront se, por ma re-an-çon,\\nsui ça deus y-vers pris.\\n\\nCe se-vent bien mi ho-me_et mi ba-ron,\\nyn-glois, nor-manz, poi-te-vin et gas-con,\\nque je n\'ai nul si pov-re com-pai-gnon\\nque je les-sais-se, por a-voir, en pri-son.\\nJe nou di mie por nu-le re-tra-çon\\ncar en-cor sui   pris.\\n\\nOr sai je bien de voir cer-tein-ne-ment\\nque je ne pris ne a-mi ne pa-rent\\nquant on me faut por or ne por ar-gent.\\nMout m\'est de moi, mes plus m\'est de ma gent,\\nqu\'ap-res lor mort au-rai rep-ro-che-ment,\\nse lon-gue-ment sui pris.\\n\\nN\'est pas mer-voille se j\'ai le cuer do-lant,\\nquant mes si-res mest ma ter-re_en tor-ment;\\ns\'il li mem-brast de nos-tre soi-re-ment,\\nque nos feis-mes an-dui com-mu-ne-ment,\\nje sai de voir que ja trop lon-gue-ment\\nne se-ro-ie ça pris.\\n\\nCe se-vent bien an-ge-vin et to-rain,\\ncil ba-che-ler qui or sont ri-che_et sain,\\nqu\'en-com-brez sui loing d\'aus en au-tre main\\nFor-ment m\'ai-des-sent! Mais il nen o-ient grain.\\nDe be-les armes sont o-re vuit et plain,\\npor ce que je sui pris.\\n\\nMes com-pai-gnons que j\'a-mo-ie_et que j\'ain\\nces de Cha-eu et ces de Per-che-rain,\\ndi lor chan-çon, q\'il ne sont pas cer-tain,\\nc\'on-ques vers aus ne oi faus cuer ne vain;\\ns\'il me guer-roient il fe-ront que vi-lain,\\ntant com je se-rai pris.\\n\\nCon-tes-se suer, vos-tre pris so-ve-rain\\nvos saut et gart cil a cui je m\'en clain\\net por ce sui je pris.\\n\\nJe ne di mie a ce-le de Char-tain,\\nla me-re Lo-e-ys.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b6000950p/f154.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 83, \"facsimileY\": 927, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
