(440, 'Seigneurs, sachiez: qui or ne s\'en ira', 'Linker 240.49', 'Thibaut de Champagne', 'French', 'K', '1b', 1, 1, '[\"C2 d d G d e \'C2 d ch a G F\\nF G a c c d \'C2 c fe d c d\\nd d G \'C2 d e d ch a G F \'\\nC2 F G a c d c fe d c d \'\\nC3 f g fed c a c h h h haG \'C2 Ga\\nF G Ga GF a c \'C2 h a c d chah\\nF G Ga F a \'C2 c ha Ga GF FG // \",\"C2 d d G d e\\nC2 d ch a G F \'F G a c c d\\nC2 c fe d c d \'d d G\\nC2 d e d ch a G F \'\\nC2 F G a c d c fe d c d \'\\nC3 f g fed c a c h h h haG\\nC2 Ga \'F G Ga GF a c\\nC2 h a c d chah \'F G Ga F a\\nC2 c ha Ga GF FG // \"]', '[\"Sei-gneurs, sa-chiez: qui or ne s\'en i-ra\\nen ce-le ter-re ou Dex fu morz et vis\\net qui la croiz d\'Ou-tre-mer ne pren-dra,\\na pai-nes mès i-ra en Pa-ra-dis.\\nQui en soi a pi-tié ne re-men-bran-ce,\\nau haut Sei-gneur doit quer-re sa ven-jan-ce\\net de-liv-rer sa terre et son pa-ïs.\"]', '[\"\"]', NULL, 2, 11),
(441, 'Amors me fet conmencier', 'Linker 240.2', 'Thibaut de Champagne', 'French', 'K', '1a', 1, 1, '[\"C1 D C D FE DC \'C1 D F\\nE F G \'C1 EC D EFE D\\nD C D FE DC D \'C1 F\\nE F G EC D EFE D\\nC D \'C1 F F G F\\na c d ch \'C1 G F\\nG EC D F G F \'\\nC1 G EC D F Ga GFF(E) D\\nC D \'C1 F F G F\\na c d ch G \'C1 F\\nG EC D F Ga GFFE D //\",\"C1 D C D FE DC\\nC1 D F \'E F G\\nC1 EC D EFE D \'D C D FE DC D\\nC1 F \'E F G EC D EFE D \'C D\\nC1 F F G F \'a c d ch\\nC1 G F \'G EC D F G F \'\\nC1 G EC D F Ga GFF(E) D \'C D\\nC1 F F G F \'a c d ch G\\nC1 F \'G EC D F Ga GFFE D //\"]', '[\"A-mors me fet con-men-cier\\nu-ne chan-çon nou-ve-le,\\nqu\'e-le me fet en-sei-gnier\\na a-mer la plus be-le\\nqui soit el mont vi-vant:\\nc\'est la bele au cors gent,\\nc\'est ce-le dont je chant.\\nDex m\'en doint tel nou-ve-le\\nqui soit a mon ta-lent!\\nCar me-nu et sou-vent\\nmes cuers por li sau-te-le.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f27.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 449, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(442, 'J\'aloie l\'autrier errant', 'Linker 240.27', 'Thibaut de Champagne', 'French', 'K', '2b', 1, 1, '[\"C2 c de c de f f e \'\\nC2 e dcd e d\\nc ch \'C2 a ah c d c\\nC3 e g +a gfe \'C3 fed dc\\nc de c de g f \'C3 e\\ne dcd e d\\nc ch \'C3 a ah c d c\\ne g \'C3 +a gfe fed dc\\nf ed ed cha \'C3 h cd c\\ne efg +a gfe d \'C3 cha hc\\nd dch c cha h \'C3 ch dch\\nc de fe dcd dch c //\",\"C2 c de c de f f e \'\\nC2 e dcd e d \'c ch\\nC2 a ah c d c \'C3 e g +a gfe\\nC3 fed dc \'c de c de g f\\nC3 e \'e dcd e d \'c ch\\nC3 a ah c d c \'e g\\nC3 +a gfe fed dc \'f ed ed cha\\nC3 h cd c \'e efg +a gfe d\\nC3 cha hc \'d dch c cha h\\nC3 ch dch \'c de fe dcd dch c //\"]', '[\"J\'a-lo-ie l\'au-trier er-rant\\nsanz con-pai-gnon\\nseur mon pa-le-froi, pen-sant\\na fere u-ne chan-çon,\\nquant j\'o-ï, ne sai con-ment,\\nlez un bui-sson\\nla voiz du plus bel en-fant\\nc\'on-ques ve-ïst nus hon;\\net n\'es-toit pas en-fes si\\nn\'e-üst quin-ze_anz et de-mi,\\nn\'on-ques nu-le riens ne vi\\nde si gen-te fa-çon.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f28.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 865, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(443, 'En chantant vueil ma dolor descouvrir', 'Linker 240.25', 'Thibaut de Champagne', 'French', 'K', '3b', 1, 1, '[\"C2 h c d a h cd \'C2 cch aGF FG a\\nc c dch c \'C1 d e c G F EDDE D\\nc c cd a \'C1 h cd cch aGF FG a\\na a haG \'C1 a h c a G F EDE D\\nE F \'C1 G FED E G E F EDC C\\nF \'C1 E F G a h aG GF GE F\\nD \'C1 E F EDC F D EFG F ED EDC D //\",\"C2 h c d a h cd\\nC2 cch aGF FG a \'c c dch c\\nC1 d e c G F EDDE D \'c c cd a\\nC1 h cd cch aGF FG a \'a a haG\\nC1 a h c a G F EDE D \'E F\\nC1 G FED E G E F EDC C \'F\\nC1 E F G a h aG GF GE F \'D\\nC1 E F EDC F D EFG F ED EDC D //\"]', '[\"En chan-tant vueil ma do-lor des-cou-vrir,\\nquant per-du ai ce que plus de-sir-ro-ie.\\nLas! si ne sai que pui-sse de-ve-nir,\\nque m\'a-mors est ce dont g\'es-poi-re jo-ie;\\nsi m\'es-touv-ra a tel do-lor mo-rir,\\nquant je ne puis ne vo-er ne o-ïr\\nla be-le riens a qui je m\'a-ten-do-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f29.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 483, \"facsimileY\": 792, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(445, 'L\'autre nuit en mon dormant', 'Linker 240.32', 'Thibaut de Champagne', 'French', 'K', '4b', 1, 1, '[\"C1 G ah G G(F) ED C \'C1 DDE\\nEFG E ED C DEFE D \'\\nC1 G ah G G(F) ED C DDE \'\\nC1 EFG F ED C DEFE D\\nG \'C1 ah ch hG GE F G\\nG \'C1 ah ch hG GE F G\\nD \'C1 EF G a FED ED DC\\nF EDC DE \'C1 FG FEED C // \",\"C1 G ah G G(F) ED C\\nC1 DDE \'EFG E ED C DEFE D \'\\nC1 G ah G G(F) ED C DDE \'\\nC1 EFG F ED C DEFE D \'G\\nC1 ah ch hG GE F G \'G\\nC1 ah ch hG GE F G \'D\\nC1 EF G a FED ED DC \'F EDC DE\\nC1 FG FEED C // \"]', '[\"L\'au-tre nuit en mon dor-mant\\nfui en grant do-tan-ce\\nd\'un gieu par-ti en chan-tant\\net en grant ba-lan-ce,\\nquant A-mors me vint de-vant,\\nqui me dist: Que vas que-rant?\\ntrop as co-ra-ge mou-vant;\\nce te muet d\'en-fan-ce. -\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f30.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 731, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(446, 'Dame, cist vostre fins amis', 'Linker 240.12', 'Thibaut de Champagne', 'French', 'K', '5b', 1, 1, '[\"C1 D D E F G aGF GFE D \'\\nC1 E FG E D E FG FED \'C1 C\\nC D E F G aGF GFE D \'\\nC1 E G E G a cha haG a \'\\nC1 h d G a h cha haG \'C1 a\\na a G FE F Ga FED \'C1 DC\\nC D E F G ECD DEFE ED //\",\"C1 D D E F G aGF GFE D \'\\nC1 E FG E D E FG FED\\nC1 C \'C D E F G aGF GFE D \'\\nC1 E G E G a cha haG a \'\\nC1 h d G a h cha haG\\nC1 a \'a a G FE F Ga FED\\nC1 DC \'C D E F G ECD DEFE ED //\"]', '[\"Da-me, cist vos-tre fins a-mis,\\nqui tout son cuer a en vous mis\\nde vos a-mer est si sor-pris\\nque de nuit et de jor est pris,\\nvos man-de que sa-chiez de voir\\nq\'il vous ai-me sanz de-ce-voir;\\nen vos a-mer n\'a pas mes-pris.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f31.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 482, \"facsimileY\": 124, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(447, 'Contre le tans qui debrise (devise)', 'Linker 240.9', 'Thibaut de Champagne', 'French', 'K', '6v', 1, 1, '[\"F2 D D C D C G FE \'F2 D\\nC E DCH D E F F\\nD D \'F2 C D C G FE D\\nA C HA*G \'F2 A C D D\\nF ED C D \'F2 F E D\\nF G a G FE \'F2 F G\\nF E F G a GF \'F2 EDC DE\\nC H A C CD \'F2 EDDC D //\",\"F2 D D C D C G FE\\nF2 D \'C E DCH D E F F \'D D\\nF2 C D C G FE D \'A C HA*G\\nF2 A C D D \'F ED C D\\nF2 F E D \'F G a G FE\\nF2 F G \'F E F G a GF\\nF2 EDC DE \'C H A C CD\\nF2 EDDC D //\"]', '[\"Con-tre le tens qui de-vi-se\\ny-ver et plui-e d’es-té,\\net la mau-vis se de-bri-se,\\nqui de lonc tens n’a chan-té,\\nfe-rai chan-çon car a gré\\nme vient que j’ai en-pen-sé.\\nA-mors qui en moi s’est mi-se,\\nbien m’a droit son dart ge-té.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
