b aG E C \'F G\\nC1 a a a \'a a a a a \'a a F G(a) \'h\\nC1b} aG aG G \'F G a a a \'a a a a a \'\\nC1 a a F Ga \'b aG E C \'F G a a a \'a\\nC1 a a a a a \'a a F G a \'b aG a\\nC1 G \'F G a a a \'a a a a a \'a a\\nC1 F G a \'b aG E C \'E G F E D \'E F E D\\nF2 C \'D E(D) C H D D \'E G F E D \'E F E\\nF2 D C \'D E C H C C \'E G F E D \'\\nF2 E F E D C \'D E(D) C B C C \'\\nC1 c a F \'c ba G E \'ba G FE \'F2 D E E\\nC1 C \'c a F \'c ba G E \'ba G FE \'D\\nC1 E E C \'c a F \'c ba G E \'ba G FE \'D\\nF3 E E C \'F G a a a \'a a a\\nC1 a a G \'b} a b a Ga GFE F \'a c ba G\\nC1b} b a G \'a G F E D \'E F G F\\nC1 E \'D E D E D C \'F2 D E C H\\nF2 D H \'EFG FED EE(D) DCB C \'\\nC2 c c c \'c c c \'d c h \'ahc hahh(a)\\nC1 aG \'c a c \'d c h \'a h G\\nC1 a G \'h d d d c h a \'h cha h\\nC1 ch h(a) aG \'G G G a \'G F E G\\nF2 G \'FE EDC G G\"]', '[\"Fi-na-ment\\net ja-uent,\\nvos que mens\\nlai non par.\\nQui chan-tar\\nnon sap far\\nben deit es-cou-tar,\\ncar a  fin ioi co-men-ce.\\njo-ies son, cur-teis chant.\\nJ\'en vai las-chant\\nde-so-re e-nant,\\nper bon sam-blant.\\nAb-si-ens,\\nsa-pi-ens\'\\net bon sens\\nist d\'a-mar,\\nhoc, et de\\nfin tro-bar,\\nper qu\'en dei ju-gar.\\nCar i-tal cap-ti-nen-ce\\ntot li cor-teis dru fant,\\ndos-ne va-lent\\na Dieu vos co-mant,\\nqu\'eu vai loi-gnant.\\nA-vi-nens\\nPres va-lens\\net Jo-vens\\nest, d\'on-rar\\ndeit re-gnar\\nod les prous,\\nper qu\'en deit pre-sar.\\nSa-ber et Ab-sti-nen-ce\\nmi vai en-doc-tri-nant,\\nJoi mi rent blanc\\ntal com eu de-mant,\\ntout sans en-gant.\\nHe! dos-ne fi-ne,\\ngens cors de re-gi-ne,\\nla fus-se_od vos\\nou mous cors de-sir-re,\\nque d\'al non con-sir-re.\\nM\'en val de-lai-tous\\nau saint vas glo-ri-ous\\nou Dex jut por nos.\\nAhi! chie-re gri-ne,\\nma-ris, tes-te_en-cli-ne,\\ncai res-tai, ja-lous!\\nSon cor en griu ti-re\\nqui d\'al non em-pi-re:\\ncar eu sui jau-ous,\\nmolt en est pe-san-cous\\net l\'en fais lan-gous.\\nAhi! be-che d\'es-pi-ne,\\nnai-rens fu ma vi-ne,\\nfaus con-tra-lio-us,\\ntant mal vous con-si-re,\\nlou cor vos ar-bi-re,\\nque di-sas des prous,\\ncar est tant en-vi-ous\\net tant a-nu-ious!\\nMais Deu lau\\nque non au.\\nA_la meil-lor\\ntant m\'es-jau\\nque me tau\\nsa lau-xor.\\nPer li vau\\nver la nau\\nsanz pa-or.\\nBel-taz et pro-he-ce\\net la grant ri-che-ce\\nde mi dosn en fai.\\nTant est ben a-pre-se,\\nsei-gna-de_et cor-te-se,\\nque tot la-ment jai.\\nLa ter-re_ur-ga-le-se,\\nla gent ber-sen-de-se,\\nsal Dex per li, lai.\\nCar il n\'ai\\njoi ve-rai;\\nsanz jau-zir\\nai grant de-sir.\\nTot m\'a-pai\\nqui·n re-trai\\nses bels dis,\\nque vol au-sir.\\nPos Dieu plai,\\nben s\'es-chai\\nqu\'al suf-frir\\nai des-ser-vir.\\nSaint Mar-tin bon pe-le-grin\\npre-gon Dieu qu\'il doint bon fin,\\net si me font la gent rin,\\nlou-sen ioi fo-re toz mis.\\nOr sui ci sanz nul fin grin,\\net gran con-me faus ro-min.\\nOr di fo-li-e_et\\nvi-le-ni-e,\\ncom hom vi-lans:\\n«de cor en ren,\\ncar cil vi-a-ges\\net ro-ma-sa-ges\\nmi par sal-va-ges,\\ndel flum Jor-dan.\\nmaiz tot au-ri-e,\\nse Dieu plai-si-e,\\nnon vi-nes chai,\\nnon vol-gre gren.\\nSanc-ta Ma-ri-e,\\ntu rens m\'a-mi-e,\\net tor-ne lai\\nou e-le_es-tai.\\nPos del ri-va-ge\\nou non vei mes-sa-ge\\nni a-le-gra-ge,\\nnon ioi, non sen:\\nal prin pas-sa-ge\\ncel douz vo-ia-ge\\nver-rai co-ra-ge\\nfin et cer-tan».\\nTost cai non vai jen\\na Dé nous do-nen,\\nqui vous be-ne-di-ghe!\\nO J-her-u-lem,\\ncom fort me tor-men,\\nqu\'en to-las m\'a-mi-ghe.\\nRex de Bel-le-em\\nqu\'a-o-rent cre-den,\\nn\'en tor-nas sans tri-che.\\nTri-ni-tas\\net u-ni-tas,\\nRe-dem-ptor\\net Sal-va-tor,\\nmos pec-cas\\nmi per-do-nas;\\npos ren-des\\nm\'a la gen-cor,\\net li plas,\\nsi me tor-nas\\na la tor\\nde Blan-cha-flor.\\nRex et sal-vai-re,\\ncest vos-tre pec-cai-re\\ndo-nas, s\'il vous seit bel,\\na-sin doi, lai bo-ne lai\\nper bai-sar, selo-ne,\\ndins son ric cha-stel,\\nod lou fin dei cha-del,\\nsol e mon a-vi-nent,\\ncur-teis chant no-vel.\\nFi-na-ment\\net jau-zent,\\nvos de-fin\\nlai non par.\\nMeil-ler non\\npot tro-bar\\nhom qui sap chan-tar,\\nqu\'el est de tal va-len-ce\\nper que l\'en vait pre-sant.\\nDos-na va-lent,\\nvos en faz pre-sent\\nper bon ta-lent.\"]', '[\"Notes: 119.3-120.2: The words <i>corage fi(n) (et)</i> and the respective notes are supplied by the notator in the left margin (12<sup>th</sup> system at f° 214vA).\\n<br>\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/canvas/f442\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 762, \"facsimileY\": 103, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b84192440/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 220, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
