(452, 'A l\'entrant del tans salvage', 'Linker 113.1', 'Hue de Saint Quentin', 'French', 'T', '43r', 1, 1, '[\"C3 G G G a a ah c h\\na GF a G\\nE F G a G ah c h\\na GF a G \'\\nF3 E G F G E C DE\\nE G F FD D C\\nE G F G E C D\\nE G F FD FG G\",\"C3 G G G a a ah c h \'a GF a G \'E F G a G ah c h \'a GF a G \'\\nF3 E G F G E C DE \'E G F FD D C \'E G F G E C D \'E G F FD FG G\"]', '[\"A l\'en-trant del tans sal-va-ge\\nki veis sen-clot\\nque cist oi-sel-lon sal-va-ge\\net ioc    \\no-i dou-se ki chan-tot\\nda-les u-ne trel-le\\nmout ert be-le si gar-doit\\nca-briaus ki brous-tel-le.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60007945/canvas/f97\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 96, \"facsimileY\": 9, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60007945/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(453, 'Je ne puis pas bien metre en nonchaloir', 'Linker 240.29', 'Thibaut de Champagne', 'French', 'K', '7b', 1, 1, '[\"C2 c c de f f f f \'C2 ed e ec\\nh aG a c \'C2 d e f edc d ec\\nc \'C3 c de f f f f ed e \'C3 ec\\ne g fe f g e g \'C4 +h +a gfg fe\\nf g +a+agf g +a +h +a \'C4 gfe fed c\\nc e dc ch d f \'C4 e dc de dcch c\\ne f g fe \'C3 c g +a gf edcd e\\nf \'C3 ed ed dc d e f g e c defedc //\",\"C2 c c de f f f f\\nC2 ed e ec \'h aG a c\\nC2 d e f edc d ec \'c\\nC3 c de f f f f ed e\\nC3 ec \'e g fe f g e g\\nC4 +h +a gfg fe \'f g +a+agf g +a +h +a\\nC4 gfe fed c \'c e dc ch d f\\nC4 e dc de dcch c \'e f g fe\\nC3 c g +a gf edcd e \'f\\nC3 ed ed dc d e f g e c defedc //\"]', '[\"Je ne puis pas bien metre en non-cha-loir\\nque je ne chant, quant A-mors m\'en se-mont,\\nque de ç\'ai je le grei-gneur duel du mont\\nque je n\'os pas des-couv-rir ma pen-se-e,\\nce dont je voi les au-tres de-ce-voir.\\nTels fet sen-blant d\'a-mor qui point n\'i be-e;\\npor ce chant je que g\'en re-fraig mon plor,\\net s\'en a-tent jo-ie ap-res ma do-lor.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f33.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 444, \"facsimileY\": 966, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(454, 'Por ce se d\'amer me dueil', 'Linker 240.42', 'Thibaut de Champagne', 'French', 'K', '8b', 1, 1, '[\"F2 D CA C CD F EDC F\\nG \'F2 F EDC DE F GFE D\\nD CA C CD \'F2 F EDC F\\nG F EDC DE F GFE \'C1 D\\nc c d ch aG ah GFFE a \'\\nC1 G F G a GFE FG FE DC\\nD \'C1 F EDC C D E F ED DC D\\nE \'F2 F ED CCH A A C DDC DE F \'\\nF2 G a GFE ED E F G \'F2 EDC EED C\\nD E F EDE H \'F2 C H C D FEFEDC //\",\"F2 D CA C CD F EDC F \'G\\nF2 F EDC DE F GFE D \'D CA C CD\\nF2 F EDC F \'G F EDC DE F GFE\\nC1 D \'c c d ch aG ah GFFE a \'\\nC1 G F G a GFE FG FE DC \'D\\nC1 F EDC C D E F ED DC D \'E\\nF2 F ED CCH A A C DDC DE F \'\\nF2 G a GFE ED E F G\\nF2 EDC EED C \'D E F EDE H\\nF2 C H C D FEFEDC //\"]', '[\"Por ce se d\'a-mer me dueil,\\nsi i ai je grant con-fort,\\ncar a-des en li re-cort,\\nDex! Ce que vi-rent mi oeil:\\nc\'est a grant biau-te ve-ra-ie\\nqui en plu-seurs sens m\'es-sa-ie,\\nque ce que j\'ai, si se com-bat a moi:\\nc\'est cuer et cors et li oeil dont la voi;\\nmès de cuer ai, qu\'est de greig-neur po-uoir.\\nOr me dont Dex les au-tres vueil a-voir!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f34.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 854, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(455, 'Pour conforter ma pesance', 'Linker 240.43', 'Thibaut de Champagne', 'French', 'K', '9b', 1, 1, '[\"C2 d h G a h c a G \'\\nC2 F G E\\nd h G a h \'C2 c a G\\nF G E\\nC1 h G C D \'C1 E F G\\na F G E F \'C1 G FE D\\nF D F G //\",\"C2 d h G a h c a G \'\\nC2 F G E \'d h G a h\\nC2 c a G \'F G E \'C1 h G C D\\nC1 E F G \'a F G E F\\nC1 G FE D \'F D F G //\"]', '[\"Por con-for-ter ma pe-san-ce\\nfaz un son.\\nBons ert, se il m\'en a-van-ce,\\ncar Ja-son,\\ncil qui con-quist le tais-son,\\nn\'ot pas si grief pe-ni-tan-ce.\\nE! é! é!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f35.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 408, \"facsimileY\": 953, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11);
