(459, 'L\'autrier m\'iere levaz', 'BdT 461.148 (Linker 266.4)', 'Author of BdT 461.148 (Linker 266.4)', 'Occitan', 'X', '91v', 1, 1, '[\"F3 F G a a a a\\nF G a a a a\\na G b \'F3 a G F\\nG a G G F GGa G\\nF G a ? a a a\\nF G a \'F3 a a a(h)\\na G b a G F\\nG a G Ga F GGa F\\nF G GF G Ga \'C2 cch a\\nh c d ch ch aGGa F\\nF G a a a a\\na G h a \'F3 G F\\nG a G Ga F GGa G\",\"F3 F G a a a a \'F G a a a a \'a G b\\nF3 a G F \'G a G G F GGa G \'F G a ? a a a \'F G a\\nF3 a a a(h) \'a G b a G F \'G a G Ga F GGa F \'F G GF G Ga\\nC2 cch a \'h c d ch ch aGGa F \'F G a a a a \'a G h a\\nF3 G F \'G a G Ga F GGa G\"]', '[\"L\'au-trier m\'ie-re le-vaz,\\nsor mon che-val mon-taz,\\nsui por de-dui-re_a-laz\\nlaz u-ne pra-ie-ri-e.\\nNe fui gai-res es-loi-gnaz\\ncan me sui ar-res-taz\\net des-sen-di en praz\\nsoz u-ne_an-te flo-ri-e;\\ns\'ai Er-mo-niion choi-si-e:\\nc\'on-ques ro-se_es-pen-ni-e\\nne fu tals ne cris-tals.\\nVers li vois liez et baus\\nque sea bel-taz m\'a-gri-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f190.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 79, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(463, 'E serventois arriere t\'en revas', 'Linker 4.1', 'Alart de Chans', 'French', 'M', '19r-v', 1, 1, '[\"[C1] ? ? ? ? F ? ? ? ? ED \'\\nC1 a G GG(F) ED E F EDC D E \'F2 E\\nE F G FED E F EDC D H C \'\\nF3 G G Ga c h G a F \'C1 F GaGEC DE\\nG a(G) FED D a a a(%h) \'C1 G ahc b aGF\\nE D DE G a C \'F2 EE(D) C D D\\nF EDC a aGFED E F \'F2 EE(D) C D H\\nF F F EDC D \'C1 G ah a(G) [FED] ?\\na h G ahchG\",\"[C1] ? ? ? ? F ? ? ? ? ED \'\\nC1 a G GG(F) ED E F EDC D E\\nF2 E \'E F G FED E F EDC D H C \'\\nF3 G G Ga c h G a F\\nC1 F GaGEC DE \'G a(G) FED D a a a(%h)\\nC1 G ahc b aGF \'E D DE G a C\\nF2 EE(D) C D D \'F EDC a aGFED E F\\nF2 EE(D) C D H \'F F F EDC D\\nC1 G ah a(G) [FED] ? \'a h G ahchG\"]', '[\"E ser-ven-tois ar-rie-re t\'en re-vas,\\ndroit en ar-tois ne te vais a-tar-gant\\net ma da-me si me sa-lü-e-ras\\nqui tant est be-le_et dou-ce_et de-bo-nai-re\\ndi li quant vi au par-tir son vi-ai-re\\net ses biaux ex et son cors a-ve-nant\\nje m\'en par-ti tris-tes a cuer do-lant\\nsanz li ne sai donc ... ... ... ... \\n... ... ... ... ...\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f55.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 115, \"facsimileY\": 183.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 180, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(495, 'Nuls hom no sap d\'amic tro l\'a perdut', 'BdT 457.26', 'Uc de Saint Circ', 'Occitan', 'G', '83v-84r', 1, 1, '[\"C2 d d cd hG F G \'C2 a a GF ED\\nD F F G F G \'C2 aG F G a\\nd d cd hG F G a \'C2 a GF ED\\nD F F G F G Ga FE \'C2F4 C D\\nD F F G F G a \'C2F4 F G ahaG a\\na c c d e d c(h) aG \'C2F4 ahch aGF\\nFG a GFE D E F Ga \'C2F4 F DE DC\\nc d dcd haGF G ah \'C2F4 a F D FDC D\",\"C2 d d cd hG F G\\nC2 a a GF ED \'D F F G F G\\nC2 aG F G a \'d d cd hG F G a\\nC2 a GF ED \'D F F G F G Ga FE\\nC2F4 C D \'D F F G F G a\\nC2F4 F G ahaG a \'a c c d e d c(h) aG\\nC2F4 ahch aGF \'FG a GFE D E F Ga\\nC2F4 F DE DC \'c d dcd haGF G ah\\nC2F4 a F D FDC D\"]', '[\"Nuls hom no sap d’a-mic, tro l’a per-dut,\\nso que l’a-mics li va-li-a de-nan;\\nmas quan lo pert o pois es a son dan\\ne nois l\'ai-tan com l’a-vi-a val-gut,\\na-doncs co-nois que l’a-mic li va-li-a,\\nper qe·m vol-gra ma dom-na co-no-guest\\ncho q’eu li vail, ans que per-dut m’a-gues,\\ne za puoi-sas al sieu tort no·m perdi-ri-a.\"]', '[\"[link]http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP178_R71sup_c.83v.jp2/full/full/0/default.jpg[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[5,5,5,10,7,5,7,5]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(496, 'Tres enemics e dos mals seignors ai', 'BdT 457.40', 'Uc de Saint Circ', 'Occitan', 'G', '82v-83r', 1, 1, '[\"C1F3b} a a a baGa GF E G a GFE \'C1 FED\\nFEDE C DEF G G ah c F \'C2 F GF ED\\na a a baGa GF E G a \'C3 GFE FED\\nFEDE C DEF G G ah c F \'C2 F GF ED\\nFEDE C DEF G G ah c a \'C2 G ahch a\\nc d [a haGF aGah ED E F \'C2 GFEF ED\\nD E FG a a hc d ch ha h \'C2\\nd e a haGF aGah ED E F GFEF ED \'C1\\nD E FG a a hc dc hah E GFG GFE] \",\"C1F3b} a a a baGa GF E G a GFE\\nC1 FED \'FEDE C DEF G G ah c F\\nC2 F GF ED \'a a a baGa GF E G a\\nC3 GFE FED \'FEDE C DEF G G ah c F\\nC2 F GF ED \'FEDE C DEF G G ah c a\\nC2 G ahch a \'c d [a haGF aGah ED E F\\nC2 GFEF ED \'D E FG a a hc d ch ha h\\nC2 \'d e a haGF aGah ED E F GFEF ED\\nC1 \'D E FG a a hc dc hah E GFG GFE] \"]', '[\"Tres e-ne-mics e dos mals se-gnors ai\\nc\'us-qecs po-gna noit e jorn con m\'au-ci-a:\\nl\'e-ne-mic son mei oill e·l cor, qi·m fai\\nvo-ler ce-lei c\'a mi no ta-gne-ri-a,\\ne l\'us se-gnor es a-mor, qi·m bai-li-a\\nten mon fin cor e mon fin pes-sa-men,\\ne l\'au-tre vos, dom-na en cui m\'en-ten,\\na cui non aus mon cor mos-trar ni dir\\ncom m\'au-ci-ez d\'en-ve-ja_e de de-sir.\"]', '[\"Notes\\n6.3-9.11: The notes from the third syllables of the sixth line until the end are scraped out. The reason for this is not apparent, and even if it has to be assumed that the melody in this segment does not constitute a reliable representation of the song, since the height of the notes is still clearly traceable, it is here trascribed in full.\", \"\"]', '{\"Link\": \"http://213.21.172.25/iiif/2/public&SEP0b02da8280051bf4&SEP176_R71sup_c.82v.jp2/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[5,5,6,9,6,6,2,9]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(519, 'A envis sent mal qui ne la apris', 'Linker 240.1', 'Thibaut de Champagne', 'French', 'K', '10a', 1, 1, '[\"C3 d e f e d ch a \'C2 G aGF G\\nc c c d ch \'C2 a G h a cha c\\nC3 f g \'C3 +a g +a +h +ag +a \'C4 gf ee dc\\nd e f ed e \'C4 dc h d ch c\\nfe c d c \'C4 e g g g+a gf ede \'\\nC4 e d e c +a +a +h g +agf ede \'C4 e\\ne f edc c e h \'C4 +a +h +agf dc\\nf g +a+a(g) g \'C4 e f gg(f) d dc c //\",\"C3 d e f e d ch a\\nC2 G aGF G \'c c c d ch\\nC2 a G h a cha c \'C3 f g\\nC3 +a g +a +h +ag +a\\nC4 gf ee dc \'d e f ed e\\nC4 dc h d ch c \'fe c d c\\nC4 e g g g+a gf ede \'\\nC4 e d e c +a +a +h g +agf ede\\nC4 e \'e f edc c e h\\nC4 +a +h +agf dc \'f g +a+a(g) g\\nC4 e f gg(f) d dc c //\"]', '[\"A en-viz sent mal qui ne l\'a ap-ris:\\ngue-rir l\'es-tuet ou mo-rir ou re-main-dre,\\net li miens max, las! dont je ne m\'os plain-dre,\\ni-cil par est seur touz po-os-te-ïs.\\nmo-rir en vueil, mès quant me vient de-vant\\nl\'es-pe-ran-ce de la grant jo-ie_a-tain-dre,\\nlors me con-fort. Voi-re, qui po-ïst tant\\nsous-frir en pais, mès ne puis, ce m\'est vis!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f36.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 90, \"facsimileY\": 890.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(520, 'De ma dame souvenir', 'Linker 240.18', 'Thibaut de Champagne', 'French', 'K', '11a', 1, 1, '[\"C1 C C E F G Ga G\\nF \'C1 E G ahc haG F Gaha aG\\nC \'C1 C E F G Ga G\\nF F G \'C1 ahc aG F Gaha aG\\nE F G G \'C1 G E FED\\nF F G G G EC \'F2 DCH\\nD F F G E FEC \'F2 C\\nE F G G F Gaha aG \'\\nF2 D C H D F EDC C //\",\"C1 C C E F G Ga G \'F\\nC1 E G ahc haG F Gaha aG \'C\\nC1 C E F G Ga G \'F F G\\nC1 ahc aG F Gaha aG \'E F G G\\nC1 G E FED \'F F G G G EC\\nF2 DCH \'D F F G E FEC\\nF2 C \'E F G G F Gaha aG \'\\nF2 D C H D F EDC C //\"]', '[\"De ma da-me sou-ve-nir\\nfet A-mors lié mon co-ra-ge,\\nque me fet jo-iant mo-rir,\\nsi la truis vers moi sau-va-ge.\\nLa be-le que tant de-sir\\nfe-ra de moi son ple-sir,\\nque touz sui siens sanz faus-ser\\nnus ne puet trop a-che-ter\\nles biens qu\'A-mors puet do-ner.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f37.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(521, 'Chançon ferai, que talent m\'en est pris', 'Linker 240.6', 'Thibaut de Champagne', 'French', 'K', '12a', 1, 1, '[\"C1 D C D F G a GFE \'C1 D DC D\\nE F G FED C \'C1 G FED C DC D\\nD C D \'C1 F G a GFE D DC D\\nE F \'C1 G FED C GGa FED C DC D\\na \'C1 a a c a G FED C CD EED DC\\nF \'C1 E F G F a c d c haG GF\\nG \'C1 a h aG G E G E C DEFED DC \'\\nC1 F E F G a C D F GFE D \'\\nF2 C D F D E C D CHC\\nA \'F2 D D FED DC D //\",\"C1 D C D F G a GFE\\nC1 D DC D \'E F G FED C\\nC1 G FED C DC D \'D C D\\nC1 F G a GFE D DC D \'E F\\nC1 G FED C GGa FED C DC D \'a\\nC1 a a c a G FED C CD EED DC \'F\\nC1 E F G F a c d c haG GF \'G\\nC1 a h aG G E G E C DEFED DC \'\\nC1 F E F G a C D F GFE D \'\\nF2 C D F D E C D CHC \'A\\nF2 D D FED DC D //\"]', '[\"Chan-çon fe-rai, car ta-lent m\'en est pris,\\nde la meil-leur qui soit en tout le mont.\\nDe la meil-leur? Je cuit que j\'ai mes-pris.\\nS\'e-le fust tex, se Dex jo-ie me dont,\\nde moi li fust au-cu-ne pi-tié pri-se,\\nqui sui touz siens et sui a sa de-vi-se.\\npi-tiez de cuer, Dex! Que ne s\'est as-si-se\\nen sa biau-té? Da-me, qui mer-ci proi,\\nje sent les max d\'a-mer por vos,\\nsen-tez les vos por moi?\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f38.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(522, 'Tout autresi corn fraint nois et ivers', 'Linker 240.52', 'Thibaut de Champagne', 'French', 'K', '13a', 1, 1, '[\"C2 chaG d edc hhaG G G G \'C2 Ga haG aah\\nde c dc ha hcd c \'C2 haGF G ah chG G\\ncha d edc hhaG \'C2 G G G a haG aah\\nde c dc ha \'C2 hcd c haGF G ah cha h\\nC3 de g +a g \'C3 ggf e d c ddc e\\need ch a \'C3 h c e f d f gfed e\\ng \'C3 e g e g f e d g gfe dccd \'\\nC3 ef edc h c cd h f gfe \'C3 fed dc //\",\"C2 chaG d edc hhaG G G G\\nC2 Ga haG aah \'de c dc ha hcd c\\nC2 haGF G ah chG G \'cha d edc hhaG\\nC2 G G G a haG aah \'de c dc ha\\nC2 hcd c haGF G ah cha h \'C3 de g +a g\\nC3 ggf e d c ddc e \'eed ch a\\nC3 h c e f d f gfed e \'g\\nC3 e g e g f e d g gfe dccd \'\\nC3 ef edc h c cd h f gfe\\nC3 fed dc //\"]', '[\"Tout au-tre-si con fraint nois et y-vers,\\nque vient es-tez, que li douz tens re-pai-re,\\nde-üst fain-dre li faus prï-er-res sers\\net fins a-mis a-men-der son a-fai-re;\\net je dot mult q\'il ne me soit di-vers,\\nse il touz est aus au-tres de-bo-nai-re;\\nmes tant me fi la ou biau-tez re-pai-re,\\nq\'a-ï-manz sui, se tout n\'est vers moi fers.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f39.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 9, \"facsimileY\": 883.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(523, 'Nus hon ne puet ami reconforter', 'Linker 240.39', 'Thibaut de Champagne', 'French', 'K', '14b', 1, 1, '[\"C2 h c d c ch aG Ga h \'C2 cha c\\nh c d c cch aG Ga c \'C2 cha aG\\nh c d c ch aG \'C2 Ga c cha c\\nh c d \'C2 c cch aG Ga c cha aG \'\\nC2 h c d d e d hha G ah \'C2 cch a\\nh c d d e f ed \'C2 e dc hha G\\nG a haG G\\nF a \'C2 ch a G G d e dc hha GF\\nG \'C2 ah cha aG //\",\"C2 h c d c ch aG Ga h\\nC2 cha c \'h c d c cch aG Ga c\\nC2 cha aG \'h c d c ch aG\\nC2 Ga c cha c \'h c d\\nC2 c cch aG Ga c cha aG \'\\nC2 h c d d e d hha G ah\\nC2 cch a \'h c d d e f ed\\nC2 e dc hha G \'G a haG G \'F a\\nC2 ch a G G d e dc hha GF \'G\\nC2 ah cha aG //\"]', '[\"Nus hons ne puet a-mi re-con-for-ter\\nse ce-le non ou il a son cuer mis.\\npor ce m\'es-tuet sou-vent plaindre et plo-rer,\\nque nus con-forz ne me vient, ce m\'est vis,\\nde la ou j\'ai tou-te ma re-men-bran-ce.\\nPor bien a-mer ai so-vent es-mai-an-ce\\na di-re voir.\\nDa-me, mer-ci! do-nez moi es-pe-ran-ce\\nde jo-ie_a-voir!\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f40.item[/link]\"]', NULL, 2, 11),
(525, 'Douce dame, tout autre pensement', 'Linker 240.22', 'Thibaut de Champagne', 'French', 'K', '15a', 1, 1, '[\"C1 c h aG F G a h aG \'C1 GF a\\nE F G G \'C1 E C D E F FED E\\nc h \'C1 aG F G a ha aG GF G \'\\nC1 E F G G E C D E \'C1 F FED F\\nF D F G a \'C1 h aG G F G\\na h \'C1 c d c h c h aG \'C1 F\\nG a h aGF G\\na h \'C1 aG GF G aG F\\nG a G \'C1 F E GFEDC D //\",\"C1 c h aG F G a h aG\\nC1 GF a \'E F G G\\nC1 E C D E F FED E \'c h\\nC1 aG F G a ha aG GF G \'\\nC1 E F G G E C D E\\nC1 F FED F \'F D F G a\\nC1 h aG G F G \'a h\\nC1 c d c h c h aG\\nC1 F \'G a h aGF G \'a h\\nC1 aG GF G aG F \'G a G\\nC1 F E GFEDC D //\"]', '[\"Dou-ce da-me, tout au-tre pen-se-ment,\\nquant pens a vous, ou-bli en mon co-ra-ge.\\nDes que vous vi des euz pre-mie-re-ment,\\nainz puis A-mors ne fu de moi sau-va-ge;\\nan-çois m\'a plus tra-veil-lié que de-vant.\\npour ce voi bien que guer-re-don n\'a-tent,\\nqui m\'as-so-a-ge,\\nfors seul de vos re-mi-rer\\ndes euz du cuer en pen-sant.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f41.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 480, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(526, 'Une chanson encor vueil', 'Linker 240.55', 'Thibaut de Champagne', 'French', 'K', '16b', 1, 1, '[\"C1 a h c ha G GF GahaG\\nF \'C1 FE D DE F GaG GF\\na h c \'C1 ha G GF GahaG\\nF FE D \'C1 DE F GaG GF\\nh a a G F \'C1 E FED F\\nF a h c c \'C1 haG FFE\\nD FE D DC F GaGE F //\",\"C1 a h c ha G GF GahaG \'F\\nC1 FE D DE F GaG GF \'a h c\\nC1 ha G GF GahaG \'F FE D\\nC1 DE F GaG GF \'h a a G F\\nC1 E FED F \'F a h c c\\nC1 haG FFE \'D FE D DC F GaGE F //\"]', '[\"U-ne chan-son on-cor vueil\\nfe-re por moi con-for-ter.\\nPour ce-le dont je me dueil\\nvueil mon chant re-nou-ve-ler;\\npour ce ai ta-lent de chan-ter\\ncar, quant je ne chant, mi oeil\\ntor-nent sou-vent a plo-rer.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f42.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 298, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(527, 'De grant joie me sui tout esmeus', 'Linker 240.16', 'Thibaut de Champagne', 'French', 'K', '17a', 1, 1, '[\"C1 h c haG F G a h \'C1 a G G\\nF E D F G \'C1 a h a G aGF G\\na h \'C1 c haGF G a h a a G G \'\\nC1 F E D F G a h a G \'C1 aGF G\\nh c d cha h c h a \'C1 a G\\nF G FE DF G F GF \'C1 a h c\\nh c d ch a G F \'C1 G a hhaa(G) a\\nhh(a) G F G a h \'C1 c h a G hha G //\",\"C1 h c haG F G a h\\nC1 a G G \'F E D F G\\nC1 a h a G aGF G \'a h\\nC1 c haGF G a h a a G G \'\\nC1 F E D F G a h a G\\nC1 aGF G \'h c d cha h c h a\\nC1 a G \'F G FE DF G F GF\\nC1 a h c \'h c d ch a G F\\nC1 G a hhaa(G) a \'hh(a) G F G a h\\nC1 c h a G hha G //\"]', '[\"De grant jo-ie me sui toz es-me-üz\\net mon vo-loir, qui mon fin cuer es-clai-re:\\ndes que ma da-me m\'a de-man-de sa-luz,\\nje ne me puis ne doi de chan-ter tai-re.\\nDe ce pre-sent doi je es-tre si liez\\ncom de ce-li qui a, bien le sa-chiez,\\nfi-ne biau-té, cor-toi-sie et vail-lan-ce;\\npour ce i ai mis tres-tou-te m\'es-pe-ran-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f43.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(528, 'Je ne vois mais nului qui gieut ne chant', 'Linker 240.30', 'Thibaut de Champagne', 'French', 'K', '18a', 1, 1, '[\"C2 G G a h c h aGF G \'C2 a aG\\nd e d c c c \'C2 GF G ah chha aG\\nG G a h c h \'C1 aGF G a aG\\nC2 d e d c \'C2 a a GF G ah chha aG\\naG h d ch \'C1 a G ahc h ha aG\\nh d e d \'C2 e f ed h dc ha\\nG a h \'C2 h a G h c d chaG hha\\nh \'C2 h c d h haGF G G a aG //\",\"C2 G G a h c h aGF G\\nC2 a aG \'d e d c c c\\nC2 GF G ah chha aG \'G G a h c h\\nC1 aGF G a aG \'C2 d e d c\\nC2 a a GF G ah chha aG \'aG h d ch\\nC1 a G ahc h ha aG \'h d e d\\nC2 e f ed h dc ha \'G a h\\nC2 h a G h c d chaG hha \'h\\nC2 h c d h haGF G G a aG //\"]', '[\"Je ne voi mes nu-lui qui gieut ne chant\\nne vo-len-tiers fa-ce fes-te ne jo-ie,\\net pour ce ai de-mo-ré lon-gue-ment\\nque n\'ai chan-té en-si com je so-lo-ie,\\nne je n\'av-rai e-ü con-man-de-ment;\\net pour i-ce, s\'ai je dit fo-le-ment\\nen ma chan-çon de ce que je vou-dro-ie,\\nne m\'en doit on re-pren-dre fo-le-ment.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f44.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(529, 'Pour mal tans ne pour gelee', 'Linker 240.45', 'Thibaut de Champagne', 'French', 'K', '19a', 1, 1, '[\"C1 a h c ha G \'C1 ch ha G\\na h c ha G ch ha G \'\\nC1 a h c ha G ch ha G \'\\nC1 a h a a G G FE D\\nD C \'C1 C CD\\nDE F Ga G FE E\\nD \'C1 FE ED C //\",\"C1 a h c ha G\\nC1 ch ha G \'a h c ha G ch ha G \'\\nC1 a h c ha G ch ha G \'\\nC1 a h a a G G FE D \'D C\\nC1 C CD \'DE F Ga G FE E \'D\\nC1 FE ED C //\"]', '[\"Por mau tens ne por ge-le-e\\nne por froi-de ma-ti-ne-e\\nne por nule au-tre riens ne-e\\nne par-ti-rai ma pen-se-e\\nd\'a-mors que j\'ai,\\nque trop l\'ai a-me-e\\nde cuer ve-rai.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f45.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 882, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(530, 'Dame, ensi est qu\'il m\'en convient aler', 'Linker 240.11', 'Thibaut de Champagne', 'French', 'K', '19b', 1, 1, '[\"C2 G G h d e d \'C1 c h a F\\nG a F D \'C2 G F G ah a aGF FG\\nG G h \'C2 d e d c h a F\\nG \'C1 a F D G F G ah a \'C1 aGF FG\\na h aG F G a ch \'C1 h a aG\\nG C2 d e f d \'C2 c c h a G\\nFG a F \'C1 D F E G a h cch aG\\nE F ED \'C1 C F E Ga ha aG GF //\",\"C2 G G h d e d\\nC1 c h a F \'G a F D\\nC2 G F G ah a aGF FG \'G G h\\nC2 d e d c h a F \'G\\nC1 a F D G F G ah a\\nC1 aGF FG \'a h aG F G a ch\\nC1 h a aG \'G C2 d e f d\\nC2 c c h a G \'FG a F\\nC1 D F E G a h cch aG \'E F ED\\nC1 C F E Ga ha aG GF //\"]', '[\"Da-me,_en-si est q\'il m\'en cou-vient a-ler\\net de-par-tir de ma dou-ce con-tre-e\\nou tant ai maus sous-fers et en-du-rez;\\nquant je vous lais, droiz est que je me he-e.\\nDex! Pour quoi fu la ter-re d\'Ou-tre-mer,\\nqui tanz a-manz a-vra fet de-se-vrer\\ndont puis ne fu l\'a-mors re-con-for-te-e,\\nne ne po-rent leur jo-ie re-men-brer!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f45.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 324, \"facsimileY\": 804, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(531, 'De novel m\'estuet chanter', 'Linker 240.19', 'Thibaut de Champagne', 'French', 'K', '20b', 1, 1, '[\"C1 c d ch a GF FED \'C1 F\\nG a GFE D CD EEC C \'\\nC1 c d ch a GF FD F \'\\nC1 G a GFE D E EED C\\nD E F \'C1 FE DC DE F\\nF G a h c h \'C1 aGF G\\na h c a ah ch GFED E \'\\nC1 G a GFE D DCD FED DC //\",\"C1 c d ch a GF FED\\nC1 F \'G a GFE D CD EEC C \'\\nC1 c d ch a GF FD F \'\\nC1 G a GFE D E EED C \'D E F\\nC1 FE DC DE F \'F G a h c h\\nC1 aGF G \'a h c a ah ch GFED E \'\\nC1 G a GFE D DCD FED DC //\"]', '[\"De nou-viau m\'es-tuet chan-ter\\nel tens que plus sui mar-riz.\\nQuant ne puis mer-ci trou-ver,\\nbien doi chan-ter a en-viz;\\nne je n\'os a li par-ler.\\nDe ma chan-çon faz me-sa-ge,\\nque tant est cor-toi-se_et sa-ge\\nque ne puis ail-lors pen-ser.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f46.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 858.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(532, 'Li dous penser et li dous souvenir', 'Linker 240.35', 'Thibaut de Champagne', 'French', 'K', '21b', 1, 1, '[\"C1 G G FE FG a F Ga \'C1 h ha aG\\na h c ch \'C1 a h c h ha ha\\nG G FE FG \'C1 a F Ga h ha G\\nC2 h d \'C2 ef e d c ch aG Ga h \'\\nC1 c h haG GF a h c h a \'C1 aGF G\\nh c d dc C3 e f \'C3 gg(f) ed e ffd d\\ne f g gf \'C3 e f g f d h\\nc d dch ha \'C2 a h ch aG ahaF G //\",\"C1 G G FE FG a F Ga\\nC1 h ha aG \'a h c ch\\nC1 a h c h ha ha \'G G FE FG\\nC1 a F Ga h ha G \'C2 h d\\nC2 ef e d c ch aG Ga h \'\\nC1 c h haG GF a h c h a\\nC1 aGF G \'h c d dc C3 e f\\nC3 gg(f) ed e ffd d \'e f g gf\\nC3 e f g f d h \'c d dch ha\\nC2 a h ch aG ahaF G //\"]', '[\"Li douz pen-sers et li douz sou-ve-nirs\\nm\'i fet mon cuer es-pen-re de chan-ter,\\net fine A-mor, qui ne m\'i let du-rer,\\nqui fet les siens en jo-ie main-te-nir\\net met es cuers la dou-ce re-men-bran-ce.\\nPour c\'est A-mors de trop hau-te pois-san-ce,\\nqui en es-mai fet hon-me res-jo-ïr\\nne pour do-loir nel let de li par-tir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f47.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 369, \"facsimileY\": 518, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(533, 'De tous maus n\'est nus plaisans', 'Linker 240.20', 'Thibaut de Champagne', 'French', 'K', '22b', 1, 1, '[\"C1 c h a G GF Gah \'C1 aG\\nF E DC D F ED E \'\\nC1 c h a G GF Gah aG\\nF \'C1 EC D F F ED F\\nF G a \'C1 h c h aaG\\na h c \'C1 h c d C2 f\\ne d ch a \'C2 GF G aGF //\",\"C1 c h a G GF Gah\\nC1 aG \'F E DC D F ED E \'\\nC1 c h a G GF Gah aG \'F\\nC1 EC D F F ED F \'F G a\\nC1 h c h aaG \'a h c\\nC1 h c d C2 f \'e d ch a\\nC2 GF G aGF //\"]', '[\"De touz max n\'est nus ple-sanz\\nfors seu-le-ment cil d\'a-mer,\\nmès cil est douz et poig-nanz\\net de-li-teus a pen-ser\\net tant set biau con-for-ter,\\net des granz biens i a tant\\nque nus ne s\'en doit os-ter.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f48.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 716, \"facsimileY\": 693, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 200, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(534, 'Chanter m\'estuet que ne m\'en puis tenir', 'Linker 240.7', 'Thibaut de Champagne', 'French', 'K', '23a', 1, 1, '[\"C2 G a h c h a \'C2 G a hha aG\\nG a h c \'C2 d c h a G aha aG\\nG \'C2 a h c h a G a hha aG \'\\nC2 G a h c d c h \'C2 a G aha aG\\nG a h c \'C2 h a G a h a\\nc \'C2 d e f e d c a c haG \'\\nC2 G a h c a G h c \'C2 d cch a\\nh c h a G \'C2 F G Ga cha G //\",\"C2 G a h c h a\\nC2 G a hha aG \'G a h c\\nC2 d c h a G aha aG \'G\\nC2 a h c h a G a hha aG \'\\nC2 G a h c d c h\\nC2 a G aha aG \'G a h c\\nC2 h a G a h a \'c\\nC2 d e f e d c a c haG \'\\nC2 G a h c a G h c\\nC2 d cch a \'h c h a G\\nC2 F G Ga cha G //\"]', '[\"Chan-ter m\'es-tuet, car ne m\'en puis te-nir,\\net si n\'ai je fors en-nui et pe-san-ce;\\nmès tout a-dès se fet bon res-jo-ïr,\\nqu\'en fe-re duel nus del mont ne s\'a-van-ce.\\nJe ne chant pas com hons qui soit a-mez,\\nmès com des-troiz, pen-sis et es-ga-rez;\\nque je n\'ai mès de bien nu-le_es-pe-ran-ce,\\nainz sui toz jorz par pa-ro-le me-nez.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f49.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 905, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(535, 'Li rossignous chante tan', 'Linker 240.36', 'Thibaut de Champagne', 'French', 'K', '24a', 1, 1, '[\"C3 c d e f g fed ch \'\\nC3 c h a hd e dh h \'\\nC3 d e f f ed c G\\na \'C2 GF G Ga h hG G\\nh c d d \'C3 e f g fe d c\\nh \'C2 c d d h a hc ha G dde dde \'\\nC2 e e(f) e dc a h dc ha G aGF G\",\"C3 c d e f g fed ch \'\\nC3 c h a hd e dh h \'\\nC3 d e f f ed c G \'a\\nC2 GF G Ga h hG G \'h c d d\\nC3 e f g fe d c \'h\\nC2 c d d h a hc ha G dde dde \'\\nC2 e e(f) e dc a h dc ha G aGF G\"]', '[\"Li ro-si-gnox chan-te tant\\nq\'il chiet mors de l\'ar-bre jus;\\nsi be-le mort ne vit nus,\\ntant dou-ce ne si ple-sant.\\nAu-tre-si muir en chan-tant a hauz criz,\\nquant je ne puis de ma da-me estre o-ïz,\\nn\'e-le de moi a-voir pi-tié ne dai-gne.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f50.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 154, \"facsimileY\": 861.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(536, 'Empereres ne rois n\'ont nul pooir', 'Linker 240.24', 'Thibaut de Champagne', 'French', 'K', '25a', 1, 1, '[\"C2 h d e d d d ch a \'C2 G GF\\na h c ch a G hh(a) \'C2 G F G\\nh d e d d d \'C2 ch a G GF\\na h c ch a \'C2 G hh(a) G F G\\na h c haG \'C2 h c d e dc hah\\ne f e \'C2 d e dc hc ha\\nh d c h a \'C2 G a ha aG //\",\"C2 h d e d d d ch a\\nC2 G GF \'a h c ch a G hh(a)\\nC2 G F G \'h d e d d d\\nC2 ch a G GF \'a h c ch a\\nC2 G hh(a) G F G \'a h c haG\\nC2 h c d e dc hah \'e f e\\nC2 d e dc hc ha \'h d c h a\\nC2 G a ha aG //\"]', '[\"Em-pe-re-res ne rois n\'ont nul pou-oir\\nen-vers A-mors, i-ce vous vueil prou-ver:\\nil pu-ent bien do-ner de leur a-voir,\\nter-res et fiez, et mes-fez par-do-ner,\\net A-mors puet hon-me de mort gar-der\\net do-ner jo-ie qui du-re,\\nplai-ne de bo-ne a-ven-tu-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f51.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 449, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
