(538, 'Tout autressi con I\'ente fait venir', 'Linker 240.53', 'Thibaut de Champagne', 'French', 'K', '26b', 1, 1, '[\"C2 h c d d e f e d \'C3 dc d\\nd e f g e f ed c \'C3 defe dc\\nh c d d e \'C3 f e d dc d\\nd e \'C3 f g e f ed c \'C2 defe fed\\nC3 e f ggf ed e \'C3 f e d c dcde\\nc d e d \'C3 e f gg(f) e d d\\ne \'C3 f g fed e f edc\\nd e \'C3 f e d dc d\\ne f g +a \'C3 g fe ed\\nd edc d de \'C3 f edc d // \",\"C2 h c d d e f e d\\nC3 dc d \'d e f g e f ed c\\nC3 defe dc \'h c d d e\\nC3 f e d dc d \'d e\\nC3 f g e f ed c\\nC2 defe fed \'C3 e f ggf ed e\\nC3 f e d c dcde \'c d e d\\nC3 e f gg(f) e d d \'e\\nC3 f g fed e f edc \'d e\\nC3 f e d dc d \'e f g +a\\nC3 g fe ed \'d edc d de\\nC3 f edc d // \"]', '[\"Tout au-tre-si con l\'en-te fet ve-nir\\nli ar-rou-sers de l\'e-ve qui chiet jus,\\nfet bo-ne_a-mor nes-tre_et crois-tre_et flo-rir\\nli ra-men-brers par cous-tu-me_et par us.\\nd\'a-mors lo-ial n\'iert ja nus au de-sus,\\nainz li cou-vient au de-souz main-te-nir.\\nPor c\'est ma dou-ce do-lor\\nplai-ne de si grant po-or,\\nda-me, si faz grant vi-gor\\nde chan-ter, quant de cuer plor.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f52.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 728, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(539, 'Mauvais arbres ne puet florir', 'Linker 240.37', 'Thibaut de Champagne', 'French', 'K', '27b', 1, 1, '[\"C3 g g+a g ffe d dc \'C3 h c\\nc ha h d e dc h \'C3 c\\ng g+a g ffe d dc h \'C3 c\\nc ha h d e dc h \'C3 c\\ne f g +a g fe \'C4 fe ed\\ne f g +a +h +c+h \'C4 +h+a +ag\\n+a +h +c +h+ag +a f g \'C4 fed\\ne f g +a g fe ed dc \'\\nC4 e g +a g +a +a +h+a +agf-f\\ne d \'C4 e gf d cd ec c //\",\"C3 g g+a g ffe d dc\\nC3 h c \'c ha h d e dc h\\nC3 c \'g g+a g ffe d dc h\\nC3 c \'c ha h d e dc h\\nC3 c \'e f g +a g fe\\nC4 fe ed \'e f g +a +h +c+h\\nC4 +h+a +ag \'+a +h +c +h+ag +a f g\\nC4 fed \'e f g +a g fe ed dc \'\\nC4 e g +a g +a +a +h+a +agf-f \'e d\\nC4 e gf d cd ec c //\"]', '[\"Mau-ves ar-bres ne puet flo-rir,\\nainz se-che tout et va crol-lant;\\net hons qui n\'ai-me, sanz men-tir,\\nne por-te fruit, ainz va mo-rant.\\nFlor et fruit de coin-te sen-blant\\npor-te cil en qui nest a-mors.\\nEn ce fruit a tant de va-lor\\nque nus ne por-roit el-li-gier,\\nfruit de Na-tu-re l\'a-pe-le_on\\nor vos ai de-vi-se son non.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f53.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 392, \"facsimileY\": 1001, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
