(542, 'Au tres dous nom a la vierge Marie', 'Linker 240.23', 'Thibaut de Champagne', 'French', 'K', '31b', 1, 1, '[\"C2b} a b c c c c c \'C1b} c a b aGF\\nE F G G a b \'C1b} a G F F\\na b c c \'C1b} c c b c a b aGF\\nE F G G a \'C1b} b a G F F\\nF G a \'C1b} G a b a G F aa(G)\\na b \'C1b} c baG a b a G F G\\nc d \'C1b} b c aG F G b c a\\na b \'C1b} a a G a b c c a bba G //\",\"C2b} a b c c c c c\\nC1b} c a b aGF \'E F G G a b\\nC1b} a G F F \'a b c c\\nC1b} c c b c a b aGF \'E F G G a\\nC1b} b a G F F \'F G a\\nC1b} G a b a G F aa(G) \'a b\\nC1b} c baG a b a G F G \'c d\\nC1b} b c aG F G b c a \'a b\\nC1b} a a G a b c c a bba G //\"]', '[\"Au tres douz non a la Vir-ge Ma-ri-e\\nvous es-pon-drai cinq le-tres plai-ne-ment.\\nla pre-mie-re est M, qui se-ne-fi-e\\nque les a-mes en sont fors de tor-ment;\\ncar par li vint ça jus en-tre sa gent\\net nos ge-ta de la noi-re pri-son\\nDex, qui pour nos en sous-fri pas-si-on.\\nI-ces-te M est et sa me-re_et s\'a-mi-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f57.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 121, \"facsimileY\": 581.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(543, 'Les douces doulours', 'Linker 240.34', 'Thibaut de Champagne', 'French', 'K', '32b', 1, 1, '[\"C1 F G a ha aG\\nG FED FG \'C1 Ga hhaG\\nF G a hha aG \'\\nC1 F EDC G Ga hhaG\\ncd c h \'C1 a G F FE\\nE F G G a GGF \'C1 EDC\\nF G a ha a GF Ga \'\\nC1 cd c h a G GFE FFG //\",\"C1 F G a ha aG \'G FED FG\\nC1 Ga hhaG \'F G a hha aG \'\\nC1 F EDC G Ga hhaG \'cd c h\\nC1 a G F FE \'E F G G a GGF\\nC1 EDC \'F G a ha a GF Ga \'\\nC1 cd c h a G GFE FFG //\"]', '[\"Les dou-ces do-lors\\net li mal ple-sant\\nqui vien-nent d\'a-mors\\nsont douz et cui-sant,\\net qui fet fol har-de-ment\\na pai-nes av-ra se-cors.\\nG\'en fis un dont la po-ors\\nm\'en tient el cors que g\'en sent.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f58.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 869, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(544, 'Dame, merci, une rien vous demant', 'Linker 240.58', 'Thibaut de Champagne', 'French', 'K', '33b', 1, 1, '[\"C1 E F EDD C E F GG(F) F \'C1 ED F\\nc d c h a G \'C1 E F D EED E\\nE F \'C1 EED C E F GGF E ED F \'\\nC1 c d c h a G E FD E \'C1 EC F\\nF E G F a h c \'C2 d c aG a\\nf e d c h a \'C2 a a h G aa(G)\\nF G aa(G) \'C2 F a c h a G aF G //\",\"C1 E F EDD C E F GG(F) F\\nC1 ED F \'c d c h a G\\nC1 E F D EED E \'E F\\nC1 EED C E F GGF E ED F \'\\nC1 c d c h a G E FD E\\nC1 EC F \'F E G F a h c\\nC2 d c aG a \'f e d c h a\\nC2 a a h G aa(G) \'F G aa(G)\\nC2 F a c h a G aF G //\"]', '[\"–Da-me, mer-ci! U-ne riens vos de-mant,\\ndi-tes moi voir, se Dex vous be-ne-ï-e:\\nquant vous mor-rez et je mes c\'iers a-vant,\\ncar ap-res vous ne viv-ro-ie je mi-e–,\\nque de-ven-dra A-mors, cele es-ba-hi-e,\\nque tant a-vez sens, et va-lor, et j\'aim tant\\nque je croi bien qu\'ap-res nous ert fail-li-e?\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f59.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 409, \"facsimileY\": 264, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(545, 'Dieus est ensi comme est li pelicans', 'Linker 240.21', 'Thibaut de Champagne', 'French', 'K', '34b', 1, 1, '[\"C1 F G a a h h a h a G \'\\nC1 F E D F G a h a \'C1 G F\\nF E D D E F G \'C1 a G GF\\na h c c(h) a G \'C1 a h a G\\nF G a h \'C1 a G F E D EEC\\nF E \'C1 D F G a c c h a\\nG \'C1 F G a F G h c h a \'\\nC1 E F E D E G F E D \'C1 C\\nE G a a c h a \'C1 G c hha\\nF G a h a G \'C1 F G hh(a) GF //\",\"C1 F G a a h h a h a G \'\\nC1 F E D F G a h a\\nC1 G F \'F E D D E F G\\nC1 a G GF \'a h c c(h) a G\\nC1 a h a G \'F G a h\\nC1 a G F E D EEC \'F E\\nC1 D F G a c c h a \'G\\nC1 F G a F G h c h a \'\\nC1 E F E D E G F E D\\nC1 C \'E G a a c h a\\nC1 G c hha \'F G a h a G\\nC1 F G hh(a) GF //\"]', '[\"Dex est en-si con-me li pel-li-cans\\nqui fet son nif el plus haut ar-bre sus,\\net li mauves oi-si-ax, qui vient de jus,\\nses oi-sel-lons o-cit: tant est pu-anz;\\nli pe-res vient des-troiz et an-gois-seus,\\ndu bec s\'o-cit, de son sanc do-le-reus\\nvi-vre re-fet tan-tost ses oi-sel-lons.\\nDex fist au-tel, quant fu sa pas-si-ons:\\nde son douz sanc ra-che-ta ses en-fanz\\ndu de-a-ble, qui mult es-toit pu-anz.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f60.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 179, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(546, 'Une doulours enossee', 'Linker 240.56', 'Thibaut de Champagne', 'French', 'K', '35b', 1, 1, '[\"C1 G a h c c a h h(a)\\nG FE \'C1 D EF G\\nF Ga c ha \'C1 G FG G\\nh h G F G \'C1 a a a\\nc ch a aGF F\\nF \'C1 Ga h aG F Ga F\\nF FD \'C1 E G F E F //\",\"C1 G a h c c a h h(a) \'G FE\\nC1 D EF G \'F Ga c ha\\nC1 G FG G \'h h G F G\\nC1 a a a \'c ch a aGF F \'F\\nC1 Ga h aG F Ga F \'F FD\\nC1 E G F E F //\"]', '[\"U-ne do-lor e-nos-se-e\\ns\'est de-denz mon cuer\\nque je ne puis os-ter puer\\npor nu-le riens qui soit ne-e;\\nc\'est do-lor d\'a-mors,\\ndont n\'ai con-fort ne se-cors,\\nainz cuit que je me he-e.\"]', '[\"Notes: 1.7-1.8. The notes <i>h h(a)</i> form a single group in the manuscript, which we have here divided to fit the syllables count. The text beneath the notes is writen upon an erasure, suggesting that a different text might have justified the grouping of the neumes.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f61.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 403, \"facsimileY\": 812, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(547, 'De chanter ne me puis tenir', 'Linker 240.15', 'Thibaut de Champagne', 'French', 'K', '36a', 1, 1, '[\"C1b} a b c b ba GF FG \'C1b} b\\na b c c ba GF FG F \'\\nC1b} a b c c ba aG FG \'C1b} b\\na b c c cb aG FFG \'C1b} F\\nE F G G G aGF FG\\nG \'C1b} a ba GF Ga GF FE\\nE F G \'C1b} G G aGF G\\nE F GF ED \'C1 EFE EDC D //\",\"C1b} a b c b ba GF FG\\nC1b} b \'a b c c ba GF FG F \'\\nC1b} a b c c ba aG FG\\nC1b} b \'a b c c cb aG FFG\\nC1b} F \'E F G G G aGF FG \'G\\nC1b} a ba GF Ga GF FE \'E F G\\nC1b} G G aGF G \'E F GF ED\\nC1 EFE EDC D //\"]', '[\"De chan-ter ne me puis te-nir\\nde la tres bele es-pe-ri-taus,\\nque riens du mont ne puet ser-vir\\nqui ja vien-gne hon-te ne max;\\nque li Rois ce-les-tï-ax,\\nqui en li dai-gna ve-nir,\\nne por-roit mi-e sous-frir\\nqui la sert q\'il ne fust saus.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f62.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 230, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(558, 'Phelipe, je vous demant / Dui ami de cuer verai', 'Linker 240.61', 'Thibaut de Champagne', 'French', 'K', '37a', 1, 1, '[\"C1 a a GF Ga GF E EDC \'\\nC1 E F G G FED DC CD\\na a \'C1 GF Ga GF E EDC\\nE F G \'C1 G FED DC CD\\nD F G a a \'C1 aG ah\\nc h a G ah aG FG\\na \'C1 h aG a GF E DE\\nG F ED \'C1 C GF E DCDE D //\",\"C1 a a GF Ga GF E EDC \'\\nC1 E F G G FED DC CD \'a a\\nC1 GF Ga GF E EDC \'E F G\\nC1 G FED DC CD \'D F G a a\\nC1 aG ah \'c h a G ah aG FG \'a\\nC1 h aG a GF E DE \'G F ED\\nC1 C GF E DCDE D //\"]', '[\"Phe-li-pe, je vous de-mant:\\ndui a-mi de cuer ve-rai\\nsont qui ai-ment lo-iau-ment,\\nba-che-ler le-gier et gai.\\nLi uns a tout son ta-lent,\\nli au-tres est a l\'es-sai.\\nQui doit melz ve-nir a-vant,\\nli a-mez ou cil qui pri-e?\"]', '[\"\"]', NULL, 2, 11),
(559, 'Phelipe, je vous demant / Ce qu\'est devenue amours', 'Linker 240.60', 'Thibaut de Champagne', 'French', 'K', '37b', 1, 1, '[\"C2 d d d d d c d\\nd \'C2 G a haGF Ga c\\nd c d d ed \'C2 c d\\nd G a haG F Ga \'C2 hhaG\\nG G G haG F Ga \'C2 c\\nh d e d dh a ah \'\\nC2 d ch aGa\\nG a h aG aGF \'\\nC2 a h a Ga F FG G //\",\"C2 d d d d d c d \'d\\nC2 G a haGF Ga c \'d c d d ed\\nC2 c d \'d G a haG F Ga\\nC2 hhaG \'G G G haG F Ga\\nC2 c \'h d e d dh a ah \'\\nC2 d ch aGa \'G a h aG aGF \'\\nC2 a h a Ga F FG G //\"]', '[\"Phe-li-pe, je vous de-mant\\nqu\'est de-ve-nue a-mors:\\nen cest pa-ïs ne ail-lors\\nne fet nus d\'a-mer sen-blant.\\nTrop me mer-veil du-re-ment\\nquant ele de-mo-re en-si,\\ns\'ai o-ï des da-mes grant plaint,\\net che-va-lier en font maint.\"]', '[\"\"]', NULL, 2, 11);
INSERT INTO `mm_staves_stored` (`id_staves`, `title`, `id`, `author`, `language`, `ms`, `f`, `modernStyle`, `oldStyle`, `staves`, `text`, `annotations`, `settings`, `visibility`, `id_user`) VALUES
(560, 'Par Dieu, sire de Champaigne et de Brie', 'Linker 197.3', 'Philippe de Nantueill - Thibaut de Champagne', 'French', 'K', '38b', 1, 1, '[\"C1 a c c G a c d c \'C1 cd c c c\\na c c h a a \'C1 E EF G F\\na c c \'C1 G a c c d c c c \'\\nC1 a c c h h a G Ga h a \'\\nC1 G G G F a c d C2 e \'C2 d c\\nd e d c a h a G \'C2 b aG F\\nG G G F a \'C2 c d ed d c\\nd e d c \'C2 a h a G h aF \'\\nC2 G G G F a c a h \'C2 a aGF G //\",\"C1 a c c G a c d c\\nC1 cd c c c \'a c c h a a\\nC1 E EF G F \'a c c\\nC1 G a c c d c c c \'\\nC1 a c c h h a G Ga h a \'\\nC1 G G G F a c d C2 e\\nC2 d c \'d e d c a h a G\\nC2 b aG F \'G G G F a\\nC2 c d ed d c \'d e d c\\nC2 a h a G h aF \'\\nC2 G G G F a c a h\\nC2 a aGF G //\"]', '[\"Par Dieu, si-re de Cham-pai-gne et de Bri-e,\\nje me sui mult d\'u-ne riens mer-veil-liez,\\nque je voi bien que vous ne chan-tez mi-e,\\nainz es-tes pou jo-lis et en-voi-siez;\\ncar me di-tes pour quoi vous le lessi-ez.\\nEs-tez re-vient et la se-sons flo-ri-e,\\nque touz li monz doit es-tre bauz et liez;\\net bien sa-chiez que mains en vau-drï-ez,\\ns\'A-mors s\'es-toit si tost de vos par-ti-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f64.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 481, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(561, 'Cuens, je vos part un jeu par ahaitie', 'Linker 94.1', 'Thibaut de Champagne - Gui', 'French', 'K', '39b', 1, 1, '[\"C1 c c c a h \'C2 cd cc(h) aG F Ga GF\\ncc(h) aG F Ga \'C1 F Gah a FED DC D\\nc \'C1 c c a h cd cc(h) aG \'C1 F Ga GF\\ncc(h) aG F Ga F Gah \'C1 aG FED C D\\nG G a GFG \'C1 GE D E FG FED C\\nG G \'C1 a G a b a FED C DE C\\nG \'C1b} G G c b cd a b aG a \'\\nC1b} F G F\\nF G GF ED\\nE G \'C1 FG a FED C\\nG a a GF a \'C1 h cchG G E FED\\nE G F \'C1 E D EFG FED C\\nC E G a GF Ga \'C1 c\\nd c h a G GahaG aG //\",\"C1 c c c a h\\nC2 cd cc(h) aG F Ga GF \'cc(h) aG F Ga\\nC1 F Gah a FED DC D \'c\\nC1 c c a h cd cc(h) aG\\nC1 F Ga GF \'cc(h) aG F Ga F Gah\\nC1 aG FED C D \'G G a GFG\\nC1 GE D E FG FED C \'G G\\nC1 a G a b a FED C DE C \'G\\nC1b} G G c b cd a b aG a \'\\nC1b} F G F \'F G GF ED \'E G\\nC1 FG a FED C \'G a a GF a\\nC1 h cchG G E FED \'E G F\\nC1 E D EFG FED C \'C E G a GF Ga\\nC1 c \'d c h a G GahaG aG //\"]', '[\"Cuens, je vous part un gieu par a-a-ti-e\\net si m\'en met seur vos-tre ju-ge-ment:\\ndui che-va-lier ai-ment chas-cuns s\'a-mi-e;\\nli uns des deus ai-me mult lo-iau-ment,\\net li au-tres gui-le mult du-re-ment.\\nLi quels tret pis, se Dex vous be-ne-ï-e,\\nou li lo-iax ou cil qui triche et ment\\nEt de-çoit?\\nDi-tes m\'en droit,\\nSi-re, tout o-ren-droit\\net si pre-nez l\'un des deus main-te-nant,\\net j\'av-rai l\'au-tre par-ti-e\\net res-pon-drai a-ve-nant,\\nse-lonc voz diz, en chan-tant.\"]', '[\"\"]', NULL, 2, 11),
(562, 'Sire ne me celez mie', 'Linker 97.1', 'Thibaut de Champagne - Guillaume', 'French', 'K', '41a', 1, 1, '[\"C1b} F G G b aG a FE F\\nGa G \'C1b} FE D FED C D\\nF G a \'C1b} b aG a FE F\\nGa G FE \'C1b} D FED C D\\nF G a b aGF \'C1b} G a\\nc b a aG GF Ga \'C1b} GFE D\\nF a G a GFE F Ga G \'\\nC1b} G FED E C\\nC D F D \'C1b} F Ga GFE D\\nE F ED E DC D D //\",\"C1b} F G G b aG a FE F \'Ga G\\nC1b} FE D FED C D \'F G a\\nC1b} b aG a FE F \'Ga G FE\\nC1b} D FED C D \'F G a b aGF\\nC1b} G a \'c b a aG GF Ga\\nC1b} GFE D \'F a G a GFE F Ga G \'\\nC1b} G FED E C \'C D F D\\nC1b} F Ga GFE D \'E F ED E DC D D //\"]', '[\"Si-re, nel me ce-lez mi-e\\nli quex vous ert melz a gré:\\ns\'il a-vient que vos-tre_a-mi-e\\nvous ait par-le-ment man-dé\\nnu a nu lez son cos-té\\npar nuit que n\'en ver-roiz mi-e,\\nou de jorz vous best et ri-e\\nen un biau pré\\net en-braz, mes ne di mi-e\\nq\'il i ait de plus par-lé.\"]', '[\"\"]', NULL, 2, 11),
(563, 'Robert, veez de Pieron', 'Linker 240.47', 'Thibaut de Champagne', 'French', 'K', '41b', 1, 1, '[\"C1 a G a ch a G a\\na \'C1 G a ch a G a\\nC2 a a h \'C2 c c h c ha\\nc d ch a \'C2 a G a\\na c d e d e(d) ch\\na \'C2 c d ch a G a //\",\"C1 a G a ch a G a \'a\\nC1 G a ch a G a \'C2 a a h\\nC2 c c h c ha \'c d ch a\\nC2 a G a \'a c d e d e(d) ch \'a\\nC2 c d ch a G a //\"]', '[\"Ro-bert, ve-ez de Per-ron\\ncon-me_il a le cuer fe-lon,\\nqui a un si loig-taing ba-ron\\nveut sa fil-le ma-rï-er,\\nqui a si cle-re fa-çon\\nque l\'en s\'i por-roit mi-rer!\"]', '[\"\"]', NULL, 2, 11),
(564, 'Bons rois Thiebaut, consoilliez moi', 'Linker 265.281', 'Thibaut de Champagne', 'French', 'K', '42a', 1, 1, '[\"C2 ef e d c h c \'C2 e d h c\\nC3 e f g \'C3 e d e f f f fed e \'\\nC3 ef e d c h c d d ch \'C3 c\\ne f g g e d ch \'C3 c d dch c\\nc h a h c c \'C3 h c e fe ed\\ne f g gg(f) f \'C3 d e f g g\\n+a +a +a(g) fe \'C3 e d f f(e) d e\\ne f \'C3 f(e) fe d c e f f fed\\nh c \'C3 d def e d e d c d //\",\"C2 ef e d c h c\\nC2 e d h c \'C3 e f g\\nC3 e d e f f f fed e \'\\nC3 ef e d c h c d d ch\\nC3 c \'e f g g e d ch\\nC3 c d dch c \'c h a h c c\\nC3 h c e fe ed \'e f g gg(f) f\\nC3 d e f g g \'+a +a +a(g) fe\\nC3 e d f f(e) d e \'e f\\nC3 f(e) fe d c e f f fed \'h c\\nC3 d def e d e d c d //\"]', '[\"Bons rois Thie-baut, si-re, con-seil-liez moi!\\nu-ne dame ai, mult ai lonc tens, a-me-e\\nde cuer lo-ial, sa-chiez, en bo-ne foi,\\nmes ne li os des-couv-rir ma pen-se-e,\\ntel po-or ai que ne me soit ve-e-e\\nde li l\'a-mors qui me des-traint sou-vent.\\nDi-tes, si-re, qu\'en font li fin a-mant?\\nSues-frent il tuit au-si si grant do-lor,\\nou il di-ent le mal q\'il ont d\'a-mor?\"]', '[\"\"]', NULL, 2, 11),
(565, 'Sire, loez moi a choisir', 'Linker 215.7', 'Thibaut de Champagne', 'French', 'K', '43b', 1, 1, '[\"C1 c cd ch ha G GF D F \'\\nC1 F ED E G a GF \'C1 E F\\nc cd d ha G GF \'C1 F\\nED F ED E G a GF E F \'\\nC1 a h c d c ha a GF \'\\nC1 a a h c c dc ch ha \'\\nC1 h c d cha h G a GFE \'\\nC1 a h c d c ha aG GF \'\\nC1 G a h aGF E F FG a\\na \'C2 c d c d ed dch h\\na G \'C1 a c a FG aF F //\",\"C1 c cd ch ha G GF D F \'\\nC1 F ED E G a GF\\nC1 E F \'c cd d ha G GF\\nC1 F \'ED F ED E G a GF E F \'\\nC1 a h c d c ha a GF \'\\nC1 a a h c c dc ch ha \'\\nC1 h c d cha h G a GFE \'\\nC1 a h c d c ha aG GF \'\\nC1 G a h aGF E F FG a \'a\\nC2 c d c d ed dch h \'a G\\nC1 a c a FG aF F //\"]', '[\"Si-re, lo-ëz moi a choi-sir\\nd\'un gieu, le quel doit melz va-loir:\\nou sou-vent s\'a-mi-e sen-tir,\\nbe-sier, a-co-ler, sanz vo-ir,\\nsanz par-ler et sanz plus a-voir\\na touz jorz mes de ses a-mors,\\nou par-ler et vo-er touz jorz,\\nsanz sen-tir et sanz a-tou-chier?\\nSe l\'un en cou-vient a lessi-er,\\ndi-tes li quels est mains jo-ianz\\net du quel la jo-ie_est plus granz. \"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(566, 'Rois Thiebaut, sire, en chantant respondez', 'Linker 19.1', 'Baudouin - Thibaut de Champagne', 'French', 'K', '44b', 1, 1, '[\"C1 F G a h a G \'C1 ahc h ha aG\\na a ha G E \'C1 FG FED E F G\\nG G a h \'C1 a G ahc h ha aG\\na c ha \'C1 G F G FED E F G\\na h aGF \'C1 G d d c h a Ga\\nc h a \'C1 hcd c h a G GGF EDE\\nC D F G \'C1 a G d h cca a\\nha G a(G) FE \'C1 F D EF G aGFE F //\",\"C1 F G a h a G\\nC1 ahc h ha aG \'a a ha G E\\nC1 FG FED E F G \'G G a h\\nC1 a G ahc h ha aG \'a c ha\\nC1 G F G FED E F G \'a h aGF\\nC1 G d d c h a Ga \'c h a\\nC1 hcd c h a G GGF EDE \'C D F G\\nC1 a G d h cca a \'ha G a(G) FE\\nC1 F D EF G aGFE F //\"]', '[\"Rois Thie-baut, sire, en chan-tant res-pon-nez:\\njo-ene da-me tres bele et a-ve-nant\\nseur tou-te riens de fin cuer a-me-rez,\\nmes n\'en por-roiz a-voir vos-tre ta-lent,\\ns\'a vos-tre col ge-sir ne la por-tez\\nchiez un au-tre qui de li est a-mez,\\nou se ce-lui ne li fe-tes ve-nir\\nen vos-tre_os-tel pour a-vec li ge-sir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f70.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 576, \"facsimileY\": 358, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 180, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(568, 'Quant fine Amours me proie que je chant', 'Linker 65.62', 'Gace Brulé', 'French', 'K', '45a', 1, 1, '[\"C2 c c d d d haG a a \'C2 ahc a\\nc d c aF G \'C1 D DC E FE ED\\nc c cd d \'C2 d c haG a ahc a\\nc \'C2 d c aG F3 F FE D F F(E) ED \'\\nC1 F G a a a h aGF F FGa a \'\\nC1 c d c a G F GF G a \'C1 GFE\\nC D E F G F Ga \'C1 D EDDC D //\",\"C2 c c d d d haG a a\\nC2 ahc a \'c d c aF G\\nC1 D DC E FE ED \'c c cd d\\nC2 d c haG a ahc a \'c\\nC2 d c aG F3 F FE D F F(E) ED \'\\nC1 F G a a a h aGF F FGa a \'\\nC1 c d c a G F GF G a\\nC1 GFE \'C D E F G F Ga\\nC1 D EDDC D //\"]', '[\"Quant fine A-mours me pri-e que je chant,\\nchan-ter m\'es-tuet, car je nel puis les-sier,\\ncar si sui tout en son con-man-de-ment\\nqu\'en moi n\'a mes des-fen-se ne dan-gier.\\nSe la be-le, qui je n\'os mes pri-er,\\nn\'en a mer-ci et pi-tiez ne l\'en prent,\\nmo-rir m\'es-tuet a-mou-reus en chan-tant.\"]', '[\"Notes: Work attributed to Thibaut de Champagne in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f71.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 894.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(569, 'Tant ai amours servies longuement', 'Linker 240.51', 'Thibaut de Champagne', 'French', 'K', '47a', 1, 1, '[\"C3 G a hG G d e f gg(f) \'C2 edh cha\\nG a h c h \'C2 a G c h aGF G\\nG a \'C3 hG G d e f gg(f) edh cha \'\\nC2 G a h c h a G \'C2 c h aGF G\\nh c d d e \'C3 f g g gg(f) edh cha\\nh c h \'C2 G h c d ch cd chG \'\\nC2 h c d d e f e d \'C2 c edc\\nh c h a h \'C2 c d e d chha aG //\",\"C3 G a hG G d e f gg(f)\\nC2 edh cha \'G a h c h\\nC2 a G c h aGF G \'G a\\nC3 hG G d e f gg(f) edh cha \'\\nC2 G a h c h a G\\nC2 c h aGF G \'h c d d e\\nC3 f g g gg(f) edh cha \'h c h\\nC2 G h c d ch cd chG \'\\nC2 h c d d e f e d\\nC2 c edc \'h c h a h\\nC2 c d e d chha aG //\"]', '[\"Tant ai a-mors ser-vi-es lon-gue-ment\\nque des or mes ne m\'en doit nus re-pren-dre\\nse je m\'en part. Ore a Dieu les con-mant,\\nqu\'en ne doit pas touz jorz fo-lie en-pren-dre;\\net cil est fox qui ne s\'en set des-fen-dre\\nne n\'i co-noist son mal ne son tor-ment.\\nL\'en me ten-droit des or mes por en-fant,\\ncar chas-cun tens doit sa se-son a-ten-dre.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f73.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 351, \"facsimileY\": 103, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 2, 11),
(570, 'Coustume est bien quant on tient un prison', 'Linker 240.10', 'Thibaut de Champagne', 'French', 'K', '48a', 1, 1, '[\"C2 d d d d e \'C2 d c h a G\\nG \'C2 a h c h a G a h a\\nd \'C2 d d d e d c h \'C2 a G\\nG a h c h \'C2 a G a h a\\nh c h \'C2 a h G a h c ha\\nc \'C3 d e f e d c d c(h) ha\\nh \'C2 c h a h G a h c haG \'\\nC3 c d e f e d c e d cha //\",\"C2 d d d d e\\nC2 d c h a G \'G\\nC2 a h c h a G a h a \'d\\nC2 d d d e d c h\\nC2 a G \'G a h c h\\nC2 a G a h a \'h c h\\nC2 a h G a h c ha \'c\\nC3 d e f e d c d c(h) ha \'h\\nC2 c h a h G a h c haG \'\\nC3 c d e f e d c e d cha //\"]', '[\"Cous-tume est bien, quant on tient un pri-sion,\\nqu\'on ne le veut o-ïr ne es-cou-ter,\\ncar nu-le riens ne fet tant cuer fe-lon\\ncon grant po-voir, qui mal en veut u-ser.\\nPour ce, da-me, de moi m\'es-tuet dou-ter,\\ncar je n\'i os par-ler de ra-en-çon\\nn\'es-tre_os-ta-giez s\'en be-le gui-se non.\\nA-vec tout ce ne puis je es-cha-per.\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f74.item[/link]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(571, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'K', '49a', 1, 1, '[\"C1b} a b a G a G FE F \'C1b} G G\\nC D DE G a G FF(E) \'C1 D C D\\na b a G a G \'C1b} FE F G G\\nC D DE G a G \'C1 FF(E) D C D\\nE F E DC \'C1 E G Ga _h aGa G\\nc a G G \'C1b} a b c b a GF\\nG E \'C1 FED D E F G a GF \'C1 Ga\\ncc(h) a G a F D E F \'C1 FFE ED // \",\"C1b} a b a G a G FE F\\nC1b} G G \'C D DE G a G FF(E)\\nC1 D C D \'a b a G a G\\nC1b} FE F G G \'C D DE G a G\\nC1 FF(E) D C D \'E F E DC\\nC1 E G Ga _h aGa G \'c a G G\\nC1b} a b c b a GF \'G E\\nC1 FED D E F G a GF\\nC1 Ga \'cc(h) a G a F D E F\\nC1 FFE ED // \"]', '[\"De bone a-mor vient se-an-ce_et biau-té,\\net a-mors vient de ces deus au-tre-si.\\nLi troi sunt un, que bien l\'ai es-prou-vé;\\nJa a nul jor n\'en se-ront de-par-ti.\\nPar un con-seil ont en-senble es-ta-bli\\nli co-re-or, qui sont a-vant a-lé:\\nde mon cuer ont fet leur che-min fer-ré;\\ntant l\'ont u-sé, ja n\'en se-ront par-ti.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f75.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 579, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(572, 'De mi cuidoie partir', 'Linker 240.28', 'Thibaut de Champagne', 'French', 'K', '50a', 1, 1, '[\"C1 d d G F G ah cha\\nc \'C1 c G F G ah aG \'\\nC1 d d G F G ah cha\\nc \'C1 c G F G ah aG\\nh \'C2 c d d ch ha aGF\\nGFG a \'C2 h d dc h c\\ne f \'C2 ed e dc h cha\\nh c d d \'C2 ch ha aGF\\nG ah a GD F \'C2 Ga aG //\",\"C1 d d G F G ah cha \'c\\nC1 c G F G ah aG \'\\nC1 d d G F G ah cha \'c\\nC1 c G F G ah aG \'h\\nC2 c d d ch ha aGF \'GFG a\\nC2 h d dc h c \'e f\\nC2 ed e dc h cha \'h c d d\\nC2 ch ha aGF \'G ah a GD F\\nC2 Ga aG //\"]', '[\"De mi cui-do-ie par-tir\\nd\'A-mors, mes riens ne m\'i vaut.\\nLi douz max d\'a-mer m\'o-cit,\\nqui nuit ne jor ne m\'i faut,\\nle jor m\'i fet maint as-saut,\\net la nuit n\'i puis dor-mir,\\nainz plain et pleur et sous-pir.\\nLi douz dex tant la de-sir,\\nmes bien croi q\'il ne l\'en chaut.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f76\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(573, 'Qui plus (bien) aime, plus endure', 'Linker 240.46', 'Thibaut de Champagne', 'French', 'K', '51a', 1, 1, '[\"C1b} c a b aa(G) F FG aa(G) \'C1b} a\\nF EDC F FG a aa(G) G \'\\nC1b} c a b aa(G) F FG aa(G) a\\nF \'C1b} EDC F FG a aa(G) G\\nF EDC \'C1b} F FG a Ga cc(b)\\na GFE D CD F \'C1b} FG aF G\\na GFE D CD FF(G) \'C1b} FF(E) ED\\nF FG a Ga c(b) aG \'C1b} aGF\\na GFE D CD F Ga GFFE ED //\",\"C1b} c a b aa(G) F FG aa(G)\\nC1b} a \'F EDC F FG a aa(G) G \'\\nC1b} c a b aa(G) F FG aa(G) a \'F\\nC1b} EDC F FG a aa(G) G \'F EDC\\nC1b} F FG a Ga cc(b) \'a GFE D CD F\\nC1b} FG aF G \'a GFE D CD FF(G)\\nC1b} FF(E) ED \'F FG a Ga c(b) aG\\nC1b} aGF \'a GFE D CD F Ga GFFE ED //\"]', '[\"Qui plus ai-me plus en-du-re,\\nplus a mes-tier de con-fort,\\nA-mors est de tel na-tu-re\\nque son a-mi mai-ne_a mort;\\npuis en a jo-ie_et de-port,\\ns\'il est de bone a-ven-tu-re\\nmes je n\'en puis point a-voir, \\nainz m\'a mis en non-cha-loir \\nce-le qui n\'a de moi cu-re.\"]', '[\"\"]', NULL, 2, 11),
(574, 'Tuit mi desir et tuit mi grief tourment', 'Linker 240.54', 'Thibaut de Champagne', 'French', 'K', '51b', 1, 1, '[\"C2b} F a bc c d e(f) edc \'C2b} ba bb(c) ba\\naGF G a \'C2b} b c d cba G aGF G\\nF \'C2b} a bc c d e(f) edc ba bb(c) ba \'\\nC2b} aGF G a b c d cba G \'C2b} aGF G\\nb b a(b) a G \'C2b} F E F G a\\nc d e ff(e) \'C2b} d c b c bb(c) ba\\naGF G \'C2b} a a a G ff(e) dc cc(b) \'C2b} aGF //\",\"C2b} F a bc c d e(f) edc\\nC2b} ba bb(c) ba \'aGF G a\\nC2b} b c d cba G aGF G \'F\\nC2b} a bc c d e(f) edc ba bb(c) ba \'\\nC2b} aGF G a b c d cba G\\nC2b} aGF G \'b b a(b) a G\\nC2b} F E F G a \'c d e ff(e)\\nC2b} d c b c bb(c) ba \'aGF G\\nC2b} a a a G ff(e) dc cc(b)\\nC2b} aGF //\"]', '[\"Tuit mi de-sir et tuit mi grief tor-ment\\nvien-nent de la ou sont tuit mi pen-sé.\\nGrant po-or ai, pour ce que tou-te gent\\nqui ont ve-ü son gent cors a cors cesmé\\nm\'ont si sor-pris de bo-ne vo-len-té.\\nNes Dex l\'ai-me, gel sai a es-cï-ent;\\ngrant mer-veil-le_est, quant il en sues-fre tant.\"]', '[\"\"]', NULL, 2, 11),
(575, 'Feuille ne flour ne vaut riens en chantant', 'Linker 240.26', 'Thibaut de Champagne', 'French', 'K', '52b', 1, 1, '[\"C2 a h c d d d \'C2 c h a G\\nG a \'C2 h c h a G h h \'C2 a\\na h c d d d c h a \'C2 G\\nG a h c h \'C2 a G h h a\\nc h a \'C2 G h G a h c haG\\nd e \'C3 f g f e d d c \'C3 h\\nh h a G h G a \'C2 h c haG\\nG a h d \'C3 e f ggf e d cha //\",\"C2 a h c d d d\\nC2 c h a G \'G a\\nC2 h c h a G h h\\nC2 a \'a h c d d d c h a\\nC2 G \'G a h c h\\nC2 a G h h a \'c h a\\nC2 G h G a h c haG \'d e\\nC3 f g f e d d c\\nC3 h \'h h a G h G a\\nC2 h c haG \'G a h d\\nC3 e f ggf e d cha //\"]', '[\"Fueil-le ne flor ne vaut riens en chan-tant\\nfors por de-faut, sanz plus, de ri-mo-ier\\net pour fe-re so-laz vi-lai-ne gent\\nqui mau-ves moz font sou-vent a-bo-ier.\\nJe ne chant pas por aus es-ba-no-ier,\\nmés por mon cuer fe-re_un pou plus jo-iant,\\nq\'uns ma-la-des en gue-rist bien sou-vent\\npar un con-fort, quant il ne puet men-gier.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(576, 'Dame, l\'on dit que l\'on muert bien de joie', 'Linker 240.13', 'Thibaut de Champagne', 'French', 'K', '53b', 1, 1, '[\"C3 e f g fed c h C2 aGF \'C2 G ah cha h\\nh c d d e f \'C2 ed c de d\\nC3 e f g fed c \'C2 h aGF G ah cha h\\nh c d d \'C2 e f ed c de d\\nC3 efg fe d \'C3 c e f g +a f g(f)\\ne \'C3 f g(f) edc a b c d e \'C3b} dd(c) cb\\nb c d d b G \'C3 d de f e(d) dc // \",\"C3 e f g fed c h C2 aGF\\nC2 G ah cha h \'h c d d e f\\nC2 ed c de d \'C3 e f g fed c\\nC2 h aGF G ah cha h \'h c d d\\nC2 e f ed c de d \'C3 efg fe d\\nC3 c e f g +a f g(f) \'e\\nC3 f g(f) edc a b c d e\\nC3b} dd(c) cb \'b c d d b G\\nC3 d de f e(d) dc // \"]', '[\"Da-me, le [...]t que l\'en muert bien de jo-ie,\\nje l\'ai dou-té, més ce fu pour no-ient,\\nque je cui-dai, s\'en-tre voz braz es-to-ie,\\nque je fe-nis-se_i-luec jo-ieu-se-ment.\\nSi dou-ce morz fust bien a mon ta-lent,\\nque la do-lor d\'a-mors qui me guer-ro-ie\\npar est si grant que du mo-rir m\'es-fro-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f79.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(577, 'Au renouveau de la douçour d\'este', 'Linker 65.6', 'Gace Brulé', 'French', 'K', '54b', 1, 1, '[\"C1b} a a a(G) ab aG \'C1b} aGF FG a(G) FEDC F \'\\nC1b} F E F Ga G(F) ED C DE F \'C1b} EDC D\\na a a(G) ab aG aGF \'C1 FG a(G) FEDC F\\nF E F Ga G(F) \'C1 ED C DE F EDC D\\nC D \'C1 F F G FE D DEF EDC C\\nGah \'C1b} a a(G) aGF G(F) ED C DE F \'C1 EDE F\\nG a h c a G FED \'C1 DEF EDC C\\nGah a(G) aG aGF G(F) \'C1 ED C DE FEC D //\",\"C1b} a a a(G) ab aG\\nC1b} aGF FG a(G) FEDC F \'\\nC1b} F E F Ga G(F) ED C DE F\\nC1b} EDC D \'a a a(G) ab aG aGF\\nC1 FG a(G) FEDC F \'F E F Ga G(F)\\nC1 ED C DE F EDC D \'C D\\nC1 F F G FE D DEF EDC C \'Gah\\nC1b} a a(G) aGF G(F) ED C DE F\\nC1 EDE F \'G a h c a G FED\\nC1 DEF EDC C \'Gah a(G) aG aGF G(F)\\nC1 ED C DE FEC D //\"]', '[\"Au re-nou-viau de la dou-çor d\'es-té,\\nque res-clar-cist la doiz en la fon-tai-ne\\net que sont vert bois et ver-gier et pré\\net li ro-sier en mai flo-rist et grai-ne,\\nlors chan-te-rai, car trop m\'av-ra gre-vé\\nire et es-mai qui m\'est au cuer pro-chai-ne;\\net fins a-mis, a tort a-chai-so-ne,\\nest mult sou-vent de le-gier es-fre-e.\"]', '[\"\"]', NULL, 2, 11),
(578, 'Cil qui d\'amour me conseille', 'Linker 65.17', 'Gace Brulé', 'French', 'K', '55b', 1, 1, '[\"C1 D a a a h a G \'C1 aGF\\nE F G FED FE DC FE\\nD a \'C1 a a h a G aGF\\nE F \'C1 G FED F EDC D\\nE F G \'C1 G G F GFD EF\\na h c c \'C1 c h chah\\nG d d c a hcd chaG F \'\\nC1 a h c aF G a(G) FED C\\nC D E \'C1 F G(F) EDC F\\nF G a D EFG \'C1 FEC EFED //\",\"C1 D a a a h a G\\nC1 aGF \'E F G FED FE DC FE \'D a\\nC1 a a h a G aGF \'E F\\nC1 G FED F EDC D \'E F G\\nC1 G G F GFD EF \'a h c c\\nC1 c h chah \'G d d c a hcd chaG F \'\\nC1 a h c aF G a(G) FED C \'C D E\\nC1 F G(F) EDC F \'F G a D EFG\\nC1 FEC EFED //\"]', '[\"Cil qui d\'a-mors me con-seil-le,\\nque de li do-ie par-tir,\\nne set pas qui me res-veil-le,\\nne quel sont mi grief sous-pir.\\nPe-tit a sens et veis-di-e.\\nCil qui me veut chas-ti-er,\\nn\'on-ques n\'a-ma en sa vi-e.\\nCi fet trop ni-ce fo-li-e,\\nqui s\'en-tre-met du mes-tier\\ndont il ne se set ai-dier.\"]', '[\"\"]', NULL, 2, 11),
(579, 'Contre tens que voi frimer', 'Linker 65.22', 'Gace Brulé', 'French', 'K', '56b', 1, 1, '[\"C1 D a a a G F EDE \'\\nC1 D C D DC E FE ED\\nD \'C1 a a a G F EDE\\nD C D DC \'C1 E FE ED\\nD a a G c \'C1 ch ha\\nh cd c haG F aGF FE \'\\nC1 E Ga G FED EFG FED DC\\nC D F EDC \'C1 G FE ED\\nF Gah a(G) FED C CD FFE ED //\",\"C1 D a a a G F EDE \'\\nC1 D C D DC E FE ED \'D\\nC1 a a a G F EDE \'D C D DC\\nC1 E FE ED \'D a a G c\\nC1 ch ha \'h cd c haG F aGF FE \'\\nC1 E Ga G FED EFG FED DC \'C D F EDC\\nC1 G FE ED \'F Gah a(G) FED C CD FFE ED //\"]', '[\"Con-tre tens que voi fri-mer\\nces ar-bres et blan-cho-ier,\\nm\'est pris ta-lent de chan-ter,\\nsi n\'en e-us-se mes-tier;\\nqu\'a-mors mi font com-pe-rer\\nce qu\'on-ques ne soi tri-chier,\\nn\'on-ques ne poi en-du-rer\\na a-voir fax cuer la-mer,\\npor cai fail-li a a-mi-e.\"]', '[\"\"]', NULL, 2, 11),
(580, 'Chanter m\'estuet ireement', 'Linker 65.15', 'Gace Brulé', 'French', 'K', '57a', 1, 1, '[\"F2 D F F FED CH CD EC EF \'\\nF2 D F E FED CD E F(E) ED \'\\nF2 D F F FED CH CD EC EF \'\\nF2 D F E FED CD E F(E) ED \'\\nF2 H C D ED CH CD EC \'F2 F\\nG a h aG a ha aG \'F2 GFE\\nF a G aGF EF G ED \'F2 DC //\",\"F2 D F F FED CH CD EC EF \'\\nF2 D F E FED CD E F(E) ED \'\\nF2 D F F FED CH CD EC EF \'\\nF2 D F E FED CD E F(E) ED \'\\nF2 H C D ED CH CD EC\\nF2 F \'G a h aG a ha aG\\nF2 GFE \'F a G aGF EF G ED\\nF2 DC //\"]', '[\"Chan-ter m\'es-tuet i-re-e-ment.\\nHe las, con-ment por-rai chan-ter,\\nquant je ne puis vo-ër sou-vent\\nma douce a-mie au biau vis cler?\\nPlus sui pour li en grant tor-ment\\nque d\'es-tre sanz ba-tel en mer\\net sanz nul au-tre gar-ne-ment.\"]', '[\"\"]', NULL, 2, 11),
(581, 'D\'Amors, qui m\'a tolu a moi', 'Linker 39.2', 'Chrestien de Troies', 'French', 'K', '58a', 1, 1, '[\"C1 d d d ch c dd(c) haG Ga \'\\nF2 F a c a FE FG FE D\\nC1 d \'C1 d d ch c dd(c) haG Ga\\nF a \'C1 c a FE FG FE D\\nF EDC D F \'C1 G FED E D\\na b} b ab G \'C1b} b b cd(c) cb a\\nc aGF G \'C1b} a b a FED D\\nF Ga FED C \'C1 D FG FED F\\nb G a FED C G GaGE F\",\"C1 d d d ch c dd(c) haG Ga \'\\nF2 F a c a FE FG FE D \'C1 d\\nC1 d d ch c dd(c) haG Ga \'F a\\nC1 c a FE FG FE D \'F EDC D F\\nC1 G FED E D \'a b} b ab G\\nC1b} b b cd(c) cb a \'c aGF G\\nC1b} a b a FED D \'F Ga FED C\\nC1 D FG FED F \'b G a FED C G GaGE F\"]', '[\"D\'A-mors, qui m\'a to-lu a moi\\nn\'a soi ne me veut re-te-nir,\\nme plaing en-si, qu\'a-dés o-troi\\nque de moi fa-ce son ple-sir.\\nEt si ne me re-puis te-nir\\nque ne m\'en plaig-ne, et di por quoi:\\ncar ceus qui la tra-ïs-sent voi\\nsou-vent a lor jo-ie ve-nir\\net g\'i fail par ma bo-ne foi.\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f84.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 201, \"facsimileY\": 493, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(583, 'De bien amer grant joie atent', 'Linker 65.24', 'Gace Brulé', 'French', 'K', '59a', 1, 1, '[\"C1b} a a a(b) a(G) F Ga GG(F) \'C1b} ED\\nC DE G a Ga cbaG a \'\\nC1b} a a a(b) a(G) F Ga GG(F) ED \'\\nC1b} C DE G a G Ga cbaG a\\nc \'C2b} d e d c cd edc a\\na \'C2b} cd ccb a aG a abc baG F\\na cc(b) a \'C1b} bc cc(b) a GaG F\\nC C H \'C1b} F Ga GF FE ED //\",\"C1b} a a a(b) a(G) F Ga GG(F)\\nC1b} ED \'C DE G a Ga cbaG a \'\\nC1b} a a a(b) a(G) F Ga GG(F) ED \'\\nC1b} C DE G a G Ga cbaG a \'c\\nC2b} d e d c cd edc a \'a\\nC2b} cd ccb a aG a abc baG F \'a cc(b) a\\nC1b} bc cc(b) a GaG F \'C C H\\nC1b} F Ga GF FE ED //\"]', '[\"De bien a-mer grant jo-ie_a-tent,\\nc\'est ma greig-neur en-vi-e;\\net sa-chiez bien cer-tai-ne-ment\\nqu\'a-mors ont tel seg-no-ri-e\\nqu\'au dou-ble guer-re-do-ne_et rent\\na ce-lui qui en li se fi-e;\\net cil qui d\'a-mer se re-pent\\ns\'est bien tra-veil-liez por no-ient.\"]', '[\"\"]', NULL, 2, 11),
(585, 'Avril ne mai, froidure ne let tans', 'Linker 20.1', 'Baudouin des Autes', 'French', 'K', '59b', 1, 1, '[\"C2 G h cd d d d c \'C2 de f ed\\nh d ed c \'C2 h a G ah a aG\\nG h \'C2 cd d d d c de f \'C2 ed\\nh d ed c \'C2 h a G ah a aG\\nc c c cde \'C2 d dc h c dc ha\\nh c d \'C2 dc h aG ahc h aG aG\\ne \'C3 e e e e e d e \'C3 f ed\\nde g f ch a d \'C2 c de f ed\\nch a G G c \'C2 c de d dc d //\",\"C2 G h cd d d d c\\nC2 de f ed \'h d ed c\\nC2 h a G ah a aG \'G h\\nC2 cd d d d c de f\\nC2 ed \'h d ed c\\nC2 h a G ah a aG \'c c c cde\\nC2 d dc h c dc ha \'h c d\\nC2 dc h aG ahc h aG aG \'e\\nC3 e e e e e d e\\nC3 f ed \'de g f ch a d\\nC2 c de f ed \'ch a G G c\\nC2 c de d dc d //\"]', '[\"A-vril ne mai froi-du-re ne let tens\\nne puet mon chant a-tar-gier ne has-ter,\\nmes douz re-gars, clers vis et biau sen-blanz\\npuet bien mon cuer es-for-cier de chan-ter.\\nSi chan-te-rai, ne puet plus de-mo-rer,\\nsi que par tout se-ra o-ïz mes chanz;\\ncar en tel lieu ma fet mes cuers pen-ser\\ndont ja nul jor ne cuit es-tre jo-ianz,\\ns\'A-mors nu fet qui touz biens puet do-ner.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(586, 'J\'ai oublie paine et travaus', 'Linker 8.1', 'Andrieu de Paris', 'French', 'K', '60b', 1, 1, '[\"C2 a c c d f ed dc d \'\\nC2 c a h c c(h) aGF Gahc a\\na c \'C2 c d f ed dc d\\nc a \'C2 h c c(h) aGF Gahc a\\nC1 D F G \'C1 a D FF(E) FG a(h)\\na GFE D C \'C1 Ga GFED EDC D\\na C2 c d e \'C1 c d cc(h) aGF\\nGab a(G) a E \'C1b} Ga GFED EDC D //\",\"C2 a c c d f ed dc d \'\\nC2 c a h c c(h) aGF Gahc a \'a c\\nC2 c d f ed dc d \'c a\\nC2 h c c(h) aGF Gahc a \'C1 D F G\\nC1 a D FF(E) FG a(h) \'a GFE D C\\nC1 Ga GFED EDC D \'a C2 c d e\\nC1 c d cc(h) aGF \'Gab a(G) a E\\nC1b} Ga GFED EDC D //\"]', '[\"J\'ai ou-bli-e paine et tra-vax,\\ns\'ai de fi-ne jo-ie chan-té.\\nDes or ne sui je mes de caus\\nqui por no-ient a-ient a-mé:\\nBo-ne-ment m\'a as-se-ü-ré\\ncele ou mes ser-vi-ses est saus,\\nqu\'ainc tri-che-or ne\'n fui ne faus,\\nsi en sai mon cuer mult bon gré.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(587, 'Se j\'ai este lone tans hors du pais', 'Linker 73.23', 'Gautier de Dargies', 'French', 'K', '61b', 1, 1, '[\"C3 d e fd g +a efg ed \'C3 dc ch\\nahc h haG a a h d \'C2 e dch aGah cd\\nC3 d e fd g \'C3 +a efg ed dc ch ahc\\nh haG a \'C3 a h d e dch a aGah cd\\ne f \'C3 g fed e f ed c h aGahcha aG \'\\nC2 c c c ch a G a h hG G \'\\nC2 c c c ch a G ah d cha \'C3 h\\nd e ffd g +a gf ed e \'C3 c dcha h\\nchaG a ah c \'C3 de f gfed h Gah dcha aG //\",\"C3 d e fd g +a efg ed\\nC3 dc ch \'ahc h haG a a h d\\nC2 e dch aGah cd \'C3 d e fd g\\nC3 +a efg ed dc ch ahc \'h haG a\\nC3 a h d e dch a aGah cd \'e f\\nC3 g fed e f ed c h aGahcha aG \'\\nC2 c c c ch a G a h hG G \'\\nC2 c c c ch a G ah d cha\\nC3 h \'d e ffd g +a gf ed e\\nC3 c dcha h \'chaG a ah c\\nC3 de f gfed h Gah dcha aG //\"]', '[\" J\'ai es-té lonc tens hors du pa-ïs\\nou je les-sai la riens que plus a-mo-ie,\\nde maint en-nui ai puis es-té ser-vis\\net es-cha-pez de pe-ril-leu-se vo-ie.\\nSi vueil di-re cho-se dont l\'en me cro-ie:\\nMult ai es-té do-lenz et es-ba-his\\net tout a-des et sanz gieu et sanz ris.\\nEt Dex, mer-ciz! Et dont me ve-nist jo-ie,\\nquant ma tres dou-ce a-mie n\'i ve-o-ie?\"]', '[\"Notes: Work attributed to Gace Brulé in K.\",\"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f87.item\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 398, \"facsimileY\": 630, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(588, 'Ire d\'amour qui en mon cuer repaire', 'Linker 65.39', 'Gace Brulé', 'French', 'K', '62b', 1, 1, '[\"C1 a a a GF G FED DC F \'C1 FG aaG F\\nG a GGF FE F ED \'C1 C DD(C) DE GFF(E) D\\na a \'C1 aa(G) GF G FED C F G \'C1 a(G) F\\nG a GGF FE F EED DC \'C1 DDC DE GFFE ED\\nE F G E \'C1 F G a G GF G\\na a \'C1b} a G a b a a GF F\\na b \'C1b} c a G FED C D E FFE G \'\\nC1 FG a GG(F) FE F ED C DC DE GFFE D // \",\"C1 a a a GF G FED DC F\\nC1 FG aaG F \'G a GGF FE F ED\\nC1 C DD(C) DE GFF(E) D \'a a\\nC1 aa(G) GF G FED C F G\\nC1 a(G) F \'G a GGF FE F EED DC\\nC1 DDC DE GFFE ED \'E F G E\\nC1 F G a G GF G \'a a\\nC1b} a G a b a a GF F \'a b\\nC1b} c a G FED C D E FFE G \'\\nC1 FG a GG(F) FE F ED C DC DE GFFE D // \"]', '[\"I-re d\'a-mors qui en mon cuer re-pe-re\\nne mi let tant que de chan-ter me tien-gne.\\nGrant mer-veille est se g\'en puis chan-çon trai-re,\\ncar je ni voi l\'a-chai-son dont el vien-gne;\\ncar li de-sirs et la grant vo-len-tez,\\ndont je sui si pen-sis et es-ga-rez,\\nma si me-né, ce vous puis je bien di-re,\\nqu\'a pai-nes sai co-nois-tre jo-ie d\'i-re.\"]', '[\"\"]', NULL, 2, 11),
(589, 'N\'est pas a soi qui aime coraument', 'Linker 65.53', 'Gace Brulé', 'French', 'K', '63b', 1, 1, '[\"C2b} a a abc baG b baG F Ga \'C2b} baG G\\na a abc baG b \'C2b} baG F Ga b aGF G\\na \'C2b} a abc baG b baG F Ga baG \'C2b} G\\na a abc baG b baG \'C1b} F Ga b baG G\\nd d cbcd cba \'C2b} b(a) baG F Ga c d(c) cb\\nf f \'C2b} edef edc d(c) baG F Gab c \'C2b} d(c) cb\\nf e(d) ed e(d) ed \'C2b} cba G c cd ed dc\\ne f def edc \'C2b} d baG F b cd(c) baGF abaG //\",\"C2b} a a abc baG b baG F Ga\\nC2b} baG G \'a a abc baG b\\nC2b} baG F Ga b aGF G \'a\\nC2b} a abc baG b baG F Ga baG\\nC2b} G \'a a abc baG b baG\\nC1b} F Ga b baG G \'d d cbcd cba\\nC2b} b(a) baG F Ga c d(c) cb \'f f\\nC2b} edef edc d(c) baG F Gab c\\nC2b} d(c) cb \'f e(d) ed e(d) ed\\nC2b} cba G c cd ed dc \'e f def edc\\nC2b} d baG F b cd(c) baGF abaG //\"]', '[\"N\'est pas a soi qui ai-me co-riau-ment,\\nne cil a-mis qu\'a-mours ne puet des-train-dre,\\net sa-chiez bien, qui d\'a-mors se de-fent,\\nq\'il ne doit pas a haute a-mor a-tain-dre.\\nLi vi-gue-reus ne se\'n pu-ënt def-fen-dre,\\ncar que plus vaut plus tost se les-se pren-dre,\\ncar d\'a-mors sont tuit li bien a de-vi-se,\\nne ja sanz li n\'ert grant jo-ie con-qui-se.\"]', '[\"\"]', NULL, 2, 11),
(591, 'Moins ai joie que je ne seuil', 'Linker 99.1', 'Guillaume de Corbie', 'French', 'K', '65b', 1, 1, '[\"C2 h d cha h ha cha G \'\\nC2 a GF G aG a h cha h \'\\nC2 h d cha h h ha haG \'\\nC2 GF G G aa(G) a h cha \'C2 G\\nh c d d dc dcha h \'\\nC2 h c edc d d d cha G \'\\nC3 d e f gfed h c cha h \'\\nC3 def e d c h ha chaG F\\nahcd \'C2 cha cha aG //\",\"C2 h d cha h ha cha G \'\\nC2 a GF G aG a h cha h \'\\nC2 h d cha h h ha haG \'\\nC2 GF G G aa(G) a h cha\\nC2 G \'h c d d dc dcha h \'\\nC2 h c edc d d d cha G \'\\nC3 d e f gfed h c cha h \'\\nC3 def e d c h ha chaG F \'ahcd\\nC2 cha cha aG //\"]', '[\"Mains ai jo-ie que ne sueil,\\nquant il me cou-vient es-loi-gnier\\nla dou-ce riens pour qui sueil\\nmon chant de nou-vel con-men-cier;\\nqu\'ele a tout en sa bail-lie,\\nmon cuer, mon cors et ma vi-e;\\nAu-si mi puist s\'a-mor ai-dier\\ncom je l\'aim sanz tri-che-ri-e,\\nde cuer en-tier!\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f91.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(592, 'Ne me sont pas achoison de chanter', 'Linker 65.51', 'Gace Brulé', 'French', 'K', '66a', 1, 1, '[\"C2b} c c c d d d d c \'C2b} c(b) aGF\\nGab a a G F3 E F EDC \'C1b} F FG a\\nc c c d d \'C1b} d d c c(b) aGF\\nGab a a \'C1b} G E F EDC F FG a\\na a \'C1b} aa(G) G d c aF G a GFFE F \'\\nC1b} a c d cba a a GF FE F Ga GFFE D \'\\nC1b} C F G G G a b cd \'C1b} cc(b) ba\\nabc b a G E F EDC \'C1 DE GFFE D //\",\"C2b} c c c d d d d c\\nC2b} c(b) aGF \'Gab a a G F3 E F EDC\\nC1b} F FG a \'c c c d d\\nC1b} d d c c(b) aGF \'Gab a a\\nC1b} G E F EDC F FG a \'a a\\nC1b} aa(G) G d c aF G a GFFE F \'\\nC1b} a c d cba a a GF FE F Ga GFFE D \'\\nC1b} C F G G G a b cd\\nC1b} cc(b) ba \'abc b a G E F EDC\\nC1 DE GFFE D //\"]', '[\"Ne mi sont pas a-che-son de chan-ter\\npre ne ver-gier, ple-se-iz ne buis-son;\\nquant ma da-me le plest a con-man-der,\\nn\'i puis tro-ver plus a-ve-nant re-son.\\nSi m\'est mult bel que sa va-lor re-tra-ie,\\nsa cor-toi-sie et sa bi-au-te ve-ra-ie,\\ndont Dex li vout si grant plen-te do-ner\\nq\'il en co-vient les au-tres ou-bli-er.\"]', '[\"\"]', NULL, 2, 11),
(593, 'Ne puis faillir a bone chançon faire', 'Linker 65.52', 'Gace Brulé', 'French', 'K', '67a', 1, 1, '[\"C1 G a h G a F D E \'C1 F GG(F) a\\nc h ha G a \'C1 F D E F D\\nG a h G \'C1 a F D E F GG(F) a \'\\nC1 c h ha G a F D E F \'C1 D\\nd d c(h) ha G a \'C1 hc(h) h haG a\\nC2 d e d ch \'C2 c a h h c a\\ne e \'C2 d d d G aG F FE \'C2 G //\",\"C1 G a h G a F D E\\nC1 F GG(F) a \'c h ha G a\\nC1 F D E F D \'G a h G\\nC1 a F D E F GG(F) a \'\\nC1 c h ha G a F D E F\\nC1 D \'d d c(h) ha G a\\nC1 hc(h) h haG a \'C2 d e d ch\\nC2 c a h h c a \'e e\\nC2 d d d G aG F FE\\nC2 G //\"]', '[\"Ne puis fail-lir a bo-ne chan-son fai-re\\nquant ma da-me me pri-e que je chant.\\nS\'e-le me fust tant fran-che_et de-bo-nai-re\\ncon je sui li, bien por-ro-ie mon chant\\nfe-re meil-leur, s\'en se-roit melz a-mez.\\nMes por i-tant m\'en sui re-con-for-tez,\\nque nus biens n\'est d\'A-mors trop de-si-rez.\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f93.item[/link]\"]', NULL, 2, 11),
(594, 'Iries et destrois et pensis', 'Linker 65.40', 'Gace Brulé', 'French', 'K', '68a', 1, 1, '[\"C1 E G G G G G F EDC\\nC \'C1 D C FEDE FG FED DC D\\nE G G \'C1 G G G F EDC\\nC D C \'C1 FEDE FG FED DC D\\na c b a \'C1b} G F GG(F) FE\\nGab a G(F) \'C1b} ED EFG F E(D) DC\\nC D C DE \'C1b} F DCD FG\\nFGab a Ga GFED C D \'C1 C DE F EDDC D //\",\"C1 E G G G G G F EDC \'C\\nC1 D C FEDE FG FED DC D \'E G G\\nC1 G G G F EDC \'C D C\\nC1 FEDE FG FED DC D \'a c b a\\nC1b} G F GG(F) FE \'Gab a G(F)\\nC1b} ED EFG F E(D) DC \'C D C DE\\nC1b} F DCD FG \'FGab a Ga GFED C D\\nC1 C DE F EDDC D //\"]', '[\"I-riez et des-troiz et pen-sis\\nchan-te-rai a-mo-reu-se-ment,\\ncar con-tre mon cuer l\'ai en-pris;\\na pou que je ne m\'en re-pent!\\nCar qui sav-roit le grief tor-ment\\ndont la nuit veil et le jor pens,\\npor fi-ne_a-mour ve-ra-ie,\\nde voir sav-roit qu\'a son grant tort m\'es-ma-ie.\"]', '[\"\"]', NULL, 2, 11),
(595, 'Li plus desconfortes du mont', 'Linker 262.5', 'Vidame de Chartres', 'French', 'K', '68b', 1, 1, '[\"C1 c d c a F Ga GG(F) F \'\\nC1 F EDC CD F G ah a(G) FED \'\\nC1b} c a Gab aa(G) F Ga GF F\\nFG FED \'C1b} ED C D F G a\\nh cd \'C1b} c(b) aG Gah cd c(b) aGF\\nG a \'C1b} FED F Ga G FED DC\\nC D F \'C1 FE G ah a GFED\\nC FG FE D \'\\nF2 D H D DCDCH D FG aa(h)\\nC1 cd \'C1 c a GF Ga G(F) FED // \",\"C1 c d c a F Ga GG(F) F \'\\nC1 F EDC CD F G ah a(G) FED \'\\nC1b} c a Gab aa(G) F Ga GF F \'FG FED\\nC1b} ED C D F G a \'h cd\\nC1b} c(b) aG Gah cd c(b) aGF \'G a\\nC1b} FED F Ga G FED DC \'C D F\\nC1 FE G ah a GFED \'C FG FE D \'\\nF2 D H D DCDCH D FG aa(h) \'C1 cd\\nC1 c a GF Ga G(F) FED // \"]', '[\"Li plus des-con-for-tez du mont\\nsui! Et si chant con-me_en-voi-siez\\nne ja Dex jo-ie ne me dont\\nde la dont je vueil es-tre liez,\\ns\'uns au-tres n\'en fust en-ra-giez.\\nMes ma lo-iau-te me con-font:\\nOr voi bien que li a-mant sont\\nmort et tra-ï.\\nQu\'a guer-re-don ai fail-li,\\npour ce que trop ai ser-vi.\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f94.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 960, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(596, 'Les oiseles (oisillons) de mon pais', 'Linker 65.45', 'Gace Brulé', 'French', 'K', '69b', 1, 1, '[\"C1b} a a a aaG abc ha aaG GF\\nFG \'C1b} a GFED C D FFG F\\na a a \'C1b} aaG abc ba aaG GF\\nFG a GFED \'C1b} C D FFG F\\nD a aG GF\\nF \'C1b} ab cb a a\\na a a a aGF \'C1b} FGa G FED\\nC D E GFFE G \'C1 a c ccd\\nc h a G ahc \'C1 haaG aGF\\nF Gah a GFED C \'C1 GaGE FE ED //\",\"C1b} a a a aaG abc ha aaG GF \'FG\\nC1b} a GFED C D FFG F \'a a a\\nC1b} aaG abc ba aaG GF \'FG a GFED\\nC1b} C D FFG F \'D a aG GF \'F\\nC1b} ab cb a a \'a a a a aGF\\nC1b} FGa G FED \'C D E GFFE G\\nC1 a c ccd \'c h a G ahc\\nC1 haaG aGF \'F Gah a GFED C\\nC1 GaGE FE ED //\"]', '[\"Les oi-sil-lons de mon pa-ïs\\nai o-ïz en Bre-taig-ne;\\na leur chant m\'est il bien a vis\\nqu\'en la dou-ce con-paig-ne\\nles oï ja-dis,\\nse g\'i ai mes-pris.\\nIl m\'ont en si douz pen-ser mis\\nqu\'a chan-çon fe-re me sui pris\\ntant que je par-a-taig-ne\\nce qu\'A-mours mont lonc tens pra-mis.\"]', '[\"\"]', NULL, 2, 11),
(599, 'Quant fleurs et glais et verdure s\'esloigne', 'Linker 65.63', 'Gace Brulé', 'French', 'K', '70a', 1, 1, '[\"C1 F G aa(G) GF a \'C1 c h a c haG aG\\nF aG \'C1 F G F Ga b aG F G \'\\nC1 F G aa(G) GF a c h \'C1 a c haG aG\\nF aG F \'C1 G F Ga b aG F G \'\\nC2 c d c cde d def ed c \'C2 d(c) haG\\nF G a cha G(F) FE \'C1 DE G Gah cc(h) d C2\\ne(d) ch dc \'C1 haGa F Ga h aG F G //\",\"C1 F G aa(G) GF a\\nC1 c h a c haG aG \'F aG\\nC1 F G F Ga b aG F G \'\\nC1 F G aa(G) GF a c h\\nC1 a c haG aG \'F aG F\\nC1 G F Ga b aG F G \'\\nC2 c d c cde d def ed c\\nC2 d(c) haG \'F G a cha G(F) FE\\nC1 DE G Gah cc(h) d C2 \'e(d) ch dc\\nC1 haGa F Ga h aG F G //\"]', '[\"Quant fleurs et glais et ver-du-re s\'es-loing-ne:\\nque cil oi-sel n\'o-sent un mot son-ner,\\npour la froi-dor chas-cuns do-te_et re-soing-ne,\\njus qu\'au biau tens que il seu-lent chan-ter,\\nor chan-te-rai car ne puis ou-bli-er\\nla dou-ce riens, dont Dex jo-ie me doig-ne,\\ncar de li sont mi bon et mi pen-ser.\"]', '[\"\"]', NULL, 2, 11),
(600, 'Quant bone dame et fine amour me prie', 'Linker 65.60', 'Gace Brulé', 'French', 'K', '71a', 1, 1, '[\"C1 C D F EDC D F \'C1 G GF G baaG a\\nGab a Ga FED EFG \'C1b} FE FE DC DE GFFE D\\na a a \'C1b} a c b ba aG FG baaG Ga \'\\nC1b} G d d cbc c(b) aG\\nGa cd cb \'C1b} aG Gab aGF\\nG a b a G(F)\\nD DC \'C1b} F G GFFE F\\nb caF Ga FED EFG \'C1 FE ED D DE GFE D //\",\"C1 C D F EDC D F\\nC1 G GF G baaG a \'Gab a Ga FED EFG\\nC1b} FE FE DC DE GFFE D \'a a a\\nC1b} a c b ba aG FG baaG Ga \'\\nC1b} G d d cbc c(b) aG \'Ga cd cb\\nC1b} aG Gab aGF \'G a b a G(F) \'D DC\\nC1b} F G GFFE F \'b caF Ga FED EFG\\nC1 FE ED D DE GFE D //\"]', '[\"Quant bo-ne dame et fine a-mor me pri-e,\\non-cor fe-rai chan çon cointe et jo-li-e,\\nne ja ne qier qu\'e-nui-eus mot en di-e,\\ncar on-ques nes a-mai\\nne ja nes a-me-rai,\\nqui les ai-me si fet cru-el fo-li-e,\\nqu\'en-vi-eus sont de le-de fe-lon-ni-e.\"]', '[\"\"]', NULL, 2, 11),
(601, 'Quant voi paroir le feuille en la ramee', 'Linker 249.1', 'Sauvage de Betune', 'French', 'K', '71b', 1, 1, '[\"C1 G a aGF G a h \'C2 ch a G aGGF G\\nh c d d \'C2 c def edc h haG G\\nG a \'C2 aGF G a c ch a G aGGF G\\nh \'C2 c d d c def edc h \'C2 haG G C3\\nd e f g f g+a \'C3 gfed e edc d\\nde f g fed \'C2 c def edc h ca G\\ncha h \'C3 cd d c def ed c h dcha aG \'\\nC3 de f gf ed e c d h G \'C2 chha aG //\",\"C1 G a aGF G a h\\nC2 ch a G aGGF G \'h c d d\\nC2 c def edc h haG G \'G a\\nC2 aGF G a c ch a G aGGF G \'h\\nC2 c d d c def edc h\\nC2 haG G C3 \'d e f g f g+a\\nC3 gfed e edc d \'de f g fed\\nC2 c def edc h ca G \'cha h\\nC3 cd d c def ed c h dcha aG \'\\nC3 de f gf ed e c d h G\\nC2 chha aG //\"]', '[\"Quant voi pa-roir la fueil-le_en la ra-me-e,\\nque li douz tens nou-viax est res-clar-cis,\\nque cil oi-sel et soir et ma-ti-ne-e\\nchan-tent si cler par ces ver-giers flo-ris,\\ntrop vo-len-tiers pen-sas-se_a leur douz criz,\\nmes je sui si d\'au-tre cho-se_es-ba-hiz,\\ncar une a-mor du-re-ment me tra-vail-le,\\nsi n\'ai re-pos nuit et jor ne m\'as-sail-le.\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f97.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 288, \"facsimileY\": 635, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 2, 11),
(602, 'Tant de soulas comme j\'ai pour (de) chanter', 'Linker 65.76', 'Gace Brulé', 'French', 'K', '73a', 1, 1, '[\"C1b} FG a GFG F FG a ab c \'C1b} c(b) aGF\\nFGab a(G) FED D D CD \'C1b} F GFE C D\\nFG a GFG F \'C1b} FG a ab c c(b) aGF\\nFG \'C1b} aba(G) FED D D C DE F GFE \'C1b} D\\nF G E FEC C C DC \'C1b} DE F EDDC C\\nC D E G \'C1b} Gab a(G) FEDC DE GF EDC D\\na a abcbG a \'C1b} d c aF G a GFG a\\nabcbG F EDE C \'C1b} C D D FG GF EDDC D //\",\"C1b} FG a GFG F FG a ab c\\nC1b} c(b) aGF \'FGab a(G) FED D D CD\\nC1b} F GFE C D \'FG a GFG F\\nC1b} FG a ab c c(b) aGF \'FG\\nC1b} aba(G) FED D D C DE F GFE\\nC1b} D \'F G E FEC C C DC\\nC1b} DE F EDDC C \'C D E G\\nC1b} Gab a(G) FEDC DE GF EDC D \'a a abcbG a\\nC1b} d c aF G a GFG a \'abcbG F EDE C\\nC1b} C D D FG GF EDDC D //\"]', '[\"Tant de so-laz con-me j\'ai por chan-ter,\\nda-me, m\'es-tuet de guer-pir et les-sier;\\nquant je ne puis en vous mer-ci trou-ver,\\ntrop con-ven-dra ma chan-çon en-pi-rier;\\npour ce le lais, que jo-ie m\'est fail-li-e\\nquant en vos n\'ai a-ten-te ne fï-an-ce,\\nne ja d\'ail-lors ne qier a-voir a-ï-e:\\ntot ai per-du, con-fort et es-pe-ran-ce.\"]', '[\"\"]', NULL, 2, 11),
(603, 'Fine amour et bonne esperance', 'Linker 65.35', 'Gace Brulé', 'French', 'K', '74a', 1, 1, '[\"C2b} F G a b c d(c) bc b(a) \'C2b} aG\\na c ba G F b aGF G \'\\nC2b} F G a b c d(c) bc b(a) aG \'\\nC2b} a c ba G F b aGF \'C2b} G\\nb a b c ba G \'C2b} Gab aGF\\nF G a b G a b \'C2b} cbcd c\\nd e f a b c bb(a) aGa \'\\nC2b} F G a bb(a) aG a b cba baG //\",\"C2b} F G a b c d(c) bc b(a)\\nC2b} aG \'a c ba G F b aGF G \'\\nC2b} F G a b c d(c) bc b(a) aG \'\\nC2b} a c ba G F b aGF\\nC2b} G \'b a b c ba G\\nC2b} Gab aGF \'F G a b G a b\\nC2b} cbcd c \'d e f a b c bb(a) aGa \'\\nC2b} F G a bb(a) aG a b cba baG //\"]', '[\"Fine a-mor et bo-ne_es-pe-ran-ce\\nme ra-mai-ne joie et chant-er,\\nse cele m\'os-te ire et pe-san-ce\\nqui tanz max ma fet en-du-rer,\\nainz ne m\'i vout guer-re-do-ner;\\nsi en ai es-mai et dou-tan-ce,\\nse lo-iau-te de bien a-mer\\nou sa grant pi-tie ne m\'a-van-ce.\"]', '[\"\"]', NULL, 2, 11),
(604, 'A l\'entrant du dous termine', 'Linker 181.1', 'Maurice de Craon', 'French', 'K', '74b', 1, 1, '[\"C2 G a c c d e(d) cha \'C2 G\\na hcha aG a\\nG a \'C2 c c d e(d) cha G\\nGa hcha aG \'C2 a\\ne ed c cd e ed \'C2 edc ee(d)\\ncd ed hcd ha\\nh c d edc \'C2 d e(d) cha F\\nGa hcha aG a \'\\nC2 h cd ch cha e\\ncha G efe \'C2 ccd df ed edcd(c) ha // \",\"C2 G a c c d e(d) cha\\nC2 G \'a hcha aG a \'G a\\nC2 c c d e(d) cha G \'Ga hcha aG\\nC2 a \'e ed c cd e ed\\nC2 edc ee(d) \'cd ed hcd ha \'h c d edc\\nC2 d e(d) cha F \'Ga hcha aG a \'\\nC2 h cd ch cha e \'cha G efe\\nC2 ccd df ed edcd(c) ha // \"]', '[\"A l\'en-trant del douz ter-mi-ne\\ndu mois nou-vel,\\nque la flor nest en l\'es-pi-ne\\net cil oi-sel\\nchan-tent par-mi la gau-di-ne\\nse-ri et bel,\\nlors me ra-saut a-mors fi-ne\\nd\'un tres douz mal;\\nque je ne pens al,\\nfors la ou mes cuers s\'a-cli-ne.\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f100.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 980.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11);
