(605, 'Qui sert de fausse proiere', 'Linker 65.73', 'Gace Brulé', 'French', 'K', '75b', 1, 1, '[\"C2 f e fed c cd e ed c \'\\nC2 c h cha GF Ga ha aG \'\\nC2 f e fed c cd e ed c\\nc \'C2 h cha GF Ga ha aG \'\\nC3 h c de dc d\\ne f \'C3 g f ede d\\ne f e d \'C2 ed h ch a\\nah G ah c \'C2 d\\ne f ed c ed \'C2 a chha aG //\",\"C2 f e fed c cd e ed c \'\\nC2 c h cha GF Ga ha aG \'\\nC2 f e fed c cd e ed c \'c\\nC2 h cha GF Ga ha aG \'\\nC3 h c de dc d \'e f\\nC3 g f ede d \'e f e d\\nC2 ed h ch a \'ah G ah c\\nC2 d \'e f ed c ed\\nC2 a chha aG //\"]', '[\"Qui sert de faus-se pro-ie-re\\nbien est re-sons qu\'a mal aut,\\nque de pen-se-e dou-blie-re\\nne puet nus mon-ter en haut.\\nPour ce ne me chaut\\nd\'a-mors nou-ve-lie-re:\\nu-ne_en ai fine et en-tie-re\\nqui touz jorz m\'a-saut,\\nsi ne m\'en puis trere ar-rie-re.\"]', '[\"\"]', NULL, 2, 11),
(606, 'Encor ai si grant poissance', 'Linker 185.9', 'Moniot d\'Arras', 'French', 'K', '76a', 1, 1, '[\"C1 a a a(G) F aG FE FG \'C1 a\\nFG FED E FG a GFG FE \'\\nC1 a a a(G) F aG FE FG \'C1 a\\nFED E FG a GFG FE ED \'\\nC1 F E F G a G a G\\nFED \'C1 FG a aG GF\\nG a b aG a \'C1b} GFG FE ED\\nG aG F G \'C1 FED F EDC\\nG aGF G a \'C1 G aG FE FG a\\nGF E D C DE \'\\nC1 C D E GaG E FE ED //\",\"C1 a a a(G) F aG FE FG\\nC1 a \'FG FED E FG a GFG FE \'\\nC1 a a a(G) F aG FE FG\\nC1 a \'FED E FG a GFG FE ED \'\\nC1 F E F G a G a G \'FED\\nC1 FG a aG GF \'G a b aG a\\nC1b} GFG FE ED \'G aG F G\\nC1 FED F EDC \'G aGF G a\\nC1 G aG FE FG a \'GF E D C DE \'\\nC1 C D E GaG E FE ED //\"]', '[\"On-co-re_a si grant pois-san-ce\\na-mors co-me_el seur a-voir,\\nmes n\'en veut fe-re mous-tran-ce,\\nque mis la en non-cha-loir\\nce fol sie-cle qui_a cui-dan-ce\\nqu\'il do-ie va-loir\\nsanz sa-ie et sanz son cui-dier.\\nmes qiu ad-roit veut vi-gier,\\nnus ne puet a hau-te vail-lan-ce\\nsanz li ad-re-cier:\\nite-le est ma cre-an-ce.\"]', '[\"Notes: Work attributed to Gace Brulé in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f102.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 250, \"facsimileY\": 1130, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(607, 'Bien ait l\'amour dont l\'en cuide avoir joie', 'Linker 65.9', 'Gace Brulé', 'French', 'K', '77a', 1, 1, '[\"C1b} b b ba aG a G FFE \'C1 DC CD FEED DC\\nC D EF FE F \'C1 G aaG F GGE F\\nh h ha aG \'C1 a G FFE DC CD FEED DC\\nC D \'C1 EF FE F G aaG F GGE F\\na \'C1b} b c baG a c b a baG GF \'\\nC1b} a b aGF G G a G E FFE DC \'\\nC1b} GGa C DE G aa(G) F Gab a baG FEFG aGF //\",\"C1b} b b ba aG a G FFE\\nC1 DC CD FEED DC \'C D EF FE F\\nC1 G aaG F GGE F \'h h ha aG\\nC1 a G FFE DC CD FEED DC \'C D\\nC1 EF FE F G aaG F GGE F \'a\\nC1b} b c baG a c b a baG GF \'\\nC1b} a b aGF G G a G E FFE DC \'\\nC1b} GGa C DE G aa(G) F Gab a baG FEFG aGF //\"]', '[\"Bien ait l\'a-mor dont l\'en cui-de_a-voir jo-ie\\nde bien a-mer et ser-vir lo-iau-ment\\nmes je n\'a-tent fors la mort de la mo-ie,\\nque j\'ai em-pris d\'a-mer si hau-te-ment,\\net si n\'i voi fors mon de-fi-ne-ment,\\nse ma da-me de moi pi-tie ne prent,\\nou lo-iau-tez et a-mors ne l\'en pro-ie. \"]', '[\"\"]', NULL, 2, 11),
(608, 'Quant je voi l\'erbe reprendre', 'Linker 65.65', 'Gace Brulé', 'French', 'K', '78a', 1, 1, '[\"C2 a G c def ed ed cha \'C2 aG\\nd ed cha h cha aG Ga \'\\nC2 a G c def ed ed cha aG \'\\nC2 d ed cha h cha aG Ga \'\\nC3 e f g g g f ed \'C3 dc\\ne f ed e dc dedh c \'\\nC3 e g +a +a g f ed dc \'\\nC3 e f ed e dcd cha aG\\nG \'C2 a c def ed cha aG\\nd \'C2 ed dc def edchac haG a //\",\"C2 a G c def ed ed cha\\nC2 aG \'d ed cha h cha aG Ga \'\\nC2 a G c def ed ed cha aG \'\\nC2 d ed cha h cha aG Ga \'\\nC3 e f g g g f ed\\nC3 dc \'e f ed e dc dedh c \'\\nC3 e g +a +a g f ed dc \'\\nC3 e f ed e dcd cha aG \'G\\nC2 a c def ed cha aG \'d\\nC2 ed dc def edchac haG a //\"]', '[\"Quant je voi l\'er-bre rep-ren-dre\\npar ces prez et ra-ver-dir,\\nlors vueil a chan-ter en-ten-dre,\\nque ne m\'en puis plus te-nir;\\nqu\'a-mors mi font ce en-pren-dre\\nqui grief m\'est a de-ser-vir.\\nA-mer sanz guer-re-don ren-dre\\nne puet mi-e cors sous-frir\\na lon-gue-ment main-te-nir\\nsanz con-fort ou sanz me-rir.\"]', '[\"\"]', NULL, 2, 11),
