(614, 'Quant voi la flor botoner', 'Linker 65.69', 'Gace Brulé', 'French', 'K', '83a', 1, 1, '[\"C1 F G a a a h aaG \'\\nC1 F FG ah a a(G) FED C C\\nF \'C1 G a a G ah aG\\nF FG ah \'C1 a G FED C D\\nF G a a a \'C1 h aa(G)\\nE FG a GGF EDC \'C1 C D\\nC D F F G a aG \'\\nC1 F FG ah a(G) a(G) FED C D\\na \'C1 h aG a\\na h c chc a(G) a \'\\nC1 c d a F F FED C\\nD \'C1 FG FFE ED //\",\"C1 F G a a a h aaG \'\\nC1 F FG ah a a(G) FED C C \'F\\nC1 G a a G ah aG \'F FG ah\\nC1 a G FED C D \'F G a a a\\nC1 h aa(G) \'E FG a GGF EDC\\nC1 C D \'C D F F G a aG \'\\nC1 F FG ah a(G) a(G) FED C D \'a\\nC1 h aG a \'a h c chc a(G) a \'\\nC1 c d a F F FED C \'D\\nC1 FG FFE ED //\"]', '[\"Quant voi la flor bou-ton-ner,\\nque res-clar-cis-sent ri-va-ge,\\net j\'oi l\'a-lo-e chan-ter\\ndu tens qui se ras-so-a-ge,\\nlas! ne me puis con-for-ter,\\nqu\'A-mors vuet mon da-ma-ge;\\nqua ce-le me fet pen-ser\\nque l\'en me tient a ou-tra-ge.\\ncon fins a-mis\\nmor-rai, ce m\'est a-vis.\\nJa voir n\'en par-ti-rai vis:\\ntrop m\'a sor-pris.\"]', '[\"\"]', NULL, 2, 11),
