(622, 'A la douçour de la bele saison', 'Linker 65.2', 'Gace Brulé', 'French', 'K', '89', 1, 1, '[\"C1 c c d(c) aGF F G Ga c h aG \'\\nC1 F FGa G FE CCD D F \'C1 GF ED D\\nc c d(c) chaGa \'C1 F FG Ga c h aG\\nF Ga \'C1 G FED C D E FG DC D \'\\nC2 F Ga GF F F G Ga \'C2 c h aG\\nd fedc c aG F \'C1 G Ga ha GF F\\nG a \'C1 GG(F) ED C D DE FG CD D //\",\"C1 c c d(c) aGF F G Ga c h aG \'\\nC1 F FGa G FE CCD D F\\nC1 GF ED D \'c c d(c) chaGa\\nC1 F FG Ga c h aG \'F Ga\\nC1 G FED C D E FG DC D \'\\nC2 F Ga GF F F G Ga\\nC2 c h aG \'d fedc c aG F\\nC1 G Ga ha GF F \'G a\\nC1 GG(F) ED C D DE FG CD D //\"]', '[\"A la dou-çor de la be-le se-son,\\nque tou-te riens se res-plent en ver-dor,\\nque sont biau pre et ver-gier et buis-son,\\net li oi-sel chan-tent de-sor la flor,\\nlors sui jo-ianz quant tuit les-sent a-mors,\\nqu\'a-mi lo-ial ni voi mes se moi non;\\nseus vueil a-mer, et seus veuil cest ho-nor.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f115\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(623, 'Douce dame, gres et graces vous rent', 'Linker 65.31', 'Gace Brulé', 'French', 'K', '90a', 1, 1, '[\"C1 d h c ha h h aGF \'C1b} G a GGF\\nF G a \'C1b} aGGa b b aGF F Ga baaGF \'\\nC1b} d b c cb b b aGF G a GGF \'\\nC1b} F F G aGGa b a GFE F \'C1b} FGa baaGF\\na b c c c c \'C1b} b c cc(b) aGGa\\na b c c c \'C1b} d b c d cbaGa\\nC2b} cdefe d \'C1b} c b bba GFE aba G F FE //\",\"C1 d h c ha h h aGF\\nC1b} G a GGF \'F G a\\nC1b} aGGa b b aGF F Ga baaGF \'\\nC1b} d b c cb b b aGF G a GGF \'\\nC1b} F F G aGGa b a GFE F\\nC1b} FGa baaGF \'a b c c c c\\nC1b} b c cc(b) aGGa \'a b c c c\\nC1b} d b c d cbaGa \'C2b} cdefe d\\nC1b} c b bba GFE aba G F FE //\"]', '[\"Dou-ce da-me, grez et gra-ces vous rent,\\nquant il vos plest que je soie en-voi-siez;\\na-ten-du ai vos-tre con-man-de-ment,\\nsi chan-te-rai pour vos jo-ianz et liez,\\net, s\'il vous plest, de moi mer-ci a-iez.\\nEn tel gui-se vous en prai-gne pi-tiez\\nq\'il ne vous poist se j\'aim si hau-te-ment.\"]', '[\"\"]', NULL, 2, 11),
(624, 'Sans atente de gueredon', 'Linker 65.74', 'Gace Brulé', 'French', 'K', '91a', 1, 1, '[\"C1 F G a a G a h a \'\\nC1 F G a G FE FG FE D\\nF \'C1 G a a G a h a\\nF G a \'C1 G FE FG FE D\\nD F G a \'C1 G c c a\\nc d c a ah \'C1 cca h hhaF\\nF G a G G \'C1 Ga Ga FEC\\nD C D F \'C1 F FG aGF F\\nF F a a FED \'C1 D C D //\",\"C1 F G a a G a h a \'\\nC1 F G a G FE FG FE D \'F\\nC1 G a a G a h a \'F G a\\nC1 G FE FG FE D \'D F G a\\nC1 G c c a \'c d c a ah\\nC1 cca h hhaF \'F G a G G\\nC1 Ga Ga FEC \'D C D F\\nC1 F FG aGF F \'F F a a FED\\nC1 D C D //\"]', '[\"Sanz a-ten-te de guer-re-don\\nm\'o-troi a ma da-me ser-vir;\\npuis que tou-te s\'en-ten-ci-on\\na si tor-nee a moi ha-ir\\nqu\'e-le m\'o-cit a des-re-son.\\nja Dex mes ne m\'i dont jo-ir\\nde riens, fors que du tout mo-rir;\\nqu\'au-tre-ment ne me puet fail-lir\\nl\'i-re dont el set l\'a-che-son.\"]', '[\"\"]', NULL, 2, 11),
(625, 'Oies (Saves) pour coi plaing et soupir', 'Linker 65.54', 'Gace Brulé', 'French', 'K', '92a', 1, 1, '[\"C3 e g g fed ed ed \'C3 dc c\\nh c d fec \'C3 d e fe d\\ne g g fed \'C3 ed ed dc c\\nh c d \'C3 efec d e ed d\\ne g g \'C3 fedc e g g+agf f\\ne g +a d \'C3 f edc dc haG\\nh d \'C2 d e dcd haG ahch haG //\",\"C3 e g g fed ed ed\\nC3 dc c \'h c d fec\\nC3 d e fe d \'e g g fed\\nC3 ed ed dc c \'h c d\\nC3 efec d e ed d \'e g g\\nC3 fedc e g g+agf f \'e g +a d\\nC3 f edc dc haG \'h d\\nC2 d e dcd haG ahch haG //\"]', '[\"O-ez pour quoi plaing et sous-pir:\\nseig-neurs, n\'en faz pas a blas-mer.\\ntoz jors m\'es-tu-et_ma mort ser-vir;\\na-mors, n\'en puis mon cuer os-ter;\\nmes a-nor ai d\'en-si mo-rir;\\nsi en vueil bien les maus sous-frir,\\ntant que plus en puis-se mon-ter.\"]', '[\"\"]', NULL, 2, 11),
(626, 'Quant l\'erbe muert, voi la fueille cheoir', 'Linker 65.66', 'Gace Brulé', 'French', 'K', '92b', 1, 1, '[\"C2b} e e e e d \'C2b} aG ab cd cb\\ncde d c a \'C2b} b aGF G a Ga baG G\\nd \'C2b} d d d c bb(a) GF Ga bc \'C2b} bba\\ncde d c a b b aGF G \'C2b} Ga baG G\\nc d e f e e \'C2b} c d d cba c\\neddef ee(d) \'C2b} e c d cbaG F c b aGGF G //\",\"C2b} e e e e d\\nC2b} aG ab cd cb \'cde d c a\\nC2b} b aGF G a Ga baG G \'d\\nC2b} d d d c bb(a) GF Ga bc\\nC2b} bba \'cde d c a b b aGF G\\nC2b} Ga baG G \'c d e f e e\\nC2b} c d d cba c \'eddef ee(d)\\nC2b} e c d cbaG F c b aGGF G //\"]', '[\"Quant l\'er-be muert, voi la fueille che-ir\\nque li venz fet jus des ar-bres des-cen-dre,\\ndont con-vient il les douz chanz re-ma-noir\\ndes oi-se-lez, qui n\'i pu-ent con-ten-dre;\\nlors me res-tuet a A-mor mon cuer ten-dre,\\nmes par pe-chie cui-dai ail-leurs en-ten-dre.\"]', '[\"\"]', NULL, 2, 11),
(627, 'Ahi! amours, con dure departie', 'Linker 50.1', 'Chastelain de Coucy', 'French', 'K', '93b', 1, 1, '[\"C2 h c d d d \'C2 d c d d cha G \'\\nC2 F E F a a h c h cha \'C2 G\\nh c d d d d c \'C1 d d cha G\\nF E F a a \'C1 h c h cha G\\nF E F a \'C1 a a G F E D\\nC2 d e \'C3 f g e d c e f edc d\\nc \'C2 a h c d c c h a \'C3 G\\nd efgf e d c \'C2 d c e e edc d // \",\"C2 h c d d d\\nC2 d c d d cha G \'\\nC2 F E F a a h c h cha\\nC2 G \'h c d d d d c\\nC1 d d cha G \'F E F a a\\nC1 h c h cha G \'F E F a\\nC1 a a G F E D \'C2 d e\\nC3 f g e d c e f edc d \'c\\nC2 a h c d c c h a\\nC3 G \'d efgf e d c\\nC2 d c e e edc d // \"]', '[\"A-hi A-mors, com du-re de-par-ti-e\\nme cou-ven-dra fe-re pour la meil-lor\\nqui on-ques fust a-me-e ne ser-vi-e!\\nDex me ra-maint a li par sa dou-çor\\nsi voi-re-ment com gen part a do-lor.\\nDex, q\'ai je dit? Ja ne m\'en part je mi-e!\\nainz na mes cors ser-vir nos-tre seig-nor,\\nmes cuers re-maint du tout en sa bail-li-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 12, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 12, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(628, 'Comencement de douce saison bele', 'Linker 77.6', 'Gautier d\'Espinau', 'French', 'K', '94b', 1, 1, '[\"C1 D a aG a h c ha G \'C1 E GFE ED\\nC G GF EDE EDC D\\nD \'C1 a aG a h c ha G E \'C1 FED C\\nE F EDC D DE G\\na \'C1 h c ha h c hah G ahaG \'C1 G\\nh c dca GF E F EDC E \'C1 ah chaG aGF\\nE F GF ED EF ED\\nG \'C1b} ab aG FED EDC D\\nE F ED C EC \'C1 D DE C\\nE G ah chaG F EDE \'C1 EDC D //\",\"C1 D a aG a h c ha G\\nC1 E GFE ED \'C G GF EDE EDC D \'D\\nC1 a aG a h c ha G E\\nC1 FED C \'E F EDC D DE G \'a\\nC1 h c ha h c hah G ahaG\\nC1 G \'h c dca GF E F EDC E\\nC1 ah chaG aGF \'E F GF ED EF ED \'G\\nC1b} ab aG FED EDC D \'E F ED C EC\\nC1 D DE C \'E G ah chaG F EDE\\nC1 EDC D //\"]', '[\"Com-men-ce-ment de dou-ce se-son be-le\\nque je voi re-ve-nir,\\nre-men-bran-ce d\'a-mors qui me ra-pe-le,\\ndont ja ne qier par-tir,\\net la mau-viz qui con-men-ce_a ten-tir\\net li douz sons du ru par le ri-va-ge\\nque je voi res-clar-cir\\nme fet re-sou-ve-nir\\nde la ou tuit mi bon de-sir\\nsont et se-ront jus-qu\'a mo-rir.\"]', '[\"Notes: Work attributed to the Chastelain de Coucy in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f120.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 899.5, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(629, 'Li nouviaus tans et mais et violete', 'Linker 38.9', 'Chastelain de Coucy', 'French', 'K', '95b', 1, 1, '[\"C2 G ah c d e f \'C2 e d c defe ed\\nh d ef ed c \'C2 ha h ch ha aG\\nG ah c \'C2 d e f e d c defe ed \'\\nC2 h d ef ed c ha h ch \'C2 ha aG\\nh cha h aG h c(h) \'C2 a h c d\\nh cha h aG \'C2 h c(h) a h c d\\nc \'C2 d c d e f e d c \'C2 ee(d) c\\nc h(a) h ch ha aG // \",\"C2 G ah c d e f\\nC2 e d c defe ed \'h d ef ed c\\nC2 ha h ch ha aG \'G ah c\\nC2 d e f e d c defe ed \'\\nC2 h d ef ed c ha h ch\\nC2 ha aG \'h cha h aG h c(h)\\nC2 a h c d \'h cha h aG\\nC2 h c(h) a h c d \'c\\nC2 d c d e f e d c\\nC2 ee(d) c \'c h(a) h ch ha aG // \"]', '[\"Li nou-viau tens et mais et vi-o-le-te\\nli ro-sig-nox me se-mont de chan-ter,\\net mes fins cuers ma fet d\'une a-mo-re-te\\nun douz pre-sent que je n\'os re-fu-ser.\\nOr me dont Dex en tele ho-nor mon-ter\\nque ce-le_ou j\'ai mon cuer et mon pen-ser\\ntieng-ne une foiz en-tre mes braz nu-e-te\\nainz que voi-se_ou-tre-mer!\"]', '[\"\"]', NULL, 2, 11),
(630, 'Mout m\'est belle la douce commençance', 'Linker 38.11', 'Chastelain de Coucy', 'French', 'K', '96b', 1, 1, '[\"C1 FED C D F FGa G(F) ED \'C1 E FG FED C\\nC D E F \'C1 FGa G(F) EDC DE FE D\\nFED C \'C1 D F FGa G(F) ED E FG FED \'C1 C\\nC D E F FGa G(F) \'C1 EDC DE FE D\\na G d c baG \'C1 a ab cd c baG F\\nE F \'C1 G FED DC D\\na G d c haG \'C1 F FG a GFG F\\nG a h G \'C1 F E F G FED C\\nF2 D A C \'C1 D C D E G ah ccd \'\\nC1 c baG F ED E D E \'C1 FGa GF EDDC D //\",\"C1 FED C D F FGa G(F) ED\\nC1 E FG FED C \'C D E F\\nC1 FGa G(F) EDC DE FE D \'FED C\\nC1 D F FGa G(F) ED E FG FED\\nC1 C \'C D E F FGa G(F)\\nC1 EDC DE FE D \'a G d c baG\\nC1 a ab cd c baG F \'E F\\nC1 G FED DC D \'a G d c haG\\nC1 F FG a GFG F \'G a h G\\nC1 F E F G FED C \'F2 D A C\\nC1 D C D E G ah ccd \'\\nC1 c baG F ED E D E\\nC1 FGa GF EDDC D //\"]', '[\"Mult m\'est be-le la dou-ce con-men-çan-ce\\ndu nou-viau tens a l\'en-trant de Pas-cor,\\nque bois et prez sont de main-te sam-blan-ce,\\nvert et ver-meil, cou-vert d\'er-be_et de flor;\\net je sui, las, de ça en tel ba-lan-ce\\nque, mains join-tes, a-or\\nma be-le mort ou ma hau-te ri-chor,\\nne sai le quel, s\'en ai joie et pa-or,\\nsi que sou-vent chant la ou du cuer plor,\\ncar lonc res-pis m\'es-maie et mesc-he-an-ce.\"]', '[\"\"]', NULL, 2, 11),
(631, 'Molt ai este longuement esbahiz', 'Linker 65.50', 'Gace Brulé', 'French', 'K', '97b', 1, 1, '[\"C1 GGF G Ga c c c(h) aGF \'C1 G Ga c\\nF G GF Ga h \'C1 aG F Ga h aGGF G\\nGGF G Ga \'C1 c c c(h) aGF G Ga c\\nF G GF Ga \'C1 h aG F Ga h aGGF G\\nF G a \'C2b} c d e dc b de c\\nd e \'C2b} f d e c d b cc(b) aGGa\\nb \'C1b} a Ga F F G F G Ga cbba \'\\nC2b} c e e fdb c aG F Ga \'C2b} b aGGF G //\",\"C1 GGF G Ga c c c(h) aGF\\nC1 G Ga c \'F G GF Ga h\\nC1 aG F Ga h aGGF G \'GGF G Ga\\nC1 c c c(h) aGF G Ga c \'F G GF Ga\\nC1 h aG F Ga h aGGF G \'F G a\\nC2b} c d e dc b de c \'d e\\nC2b} f d e c d b cc(b) aGGa \'b\\nC1b} a Ga F F G F G Ga cbba \'\\nC2b} c e e fdb c aG F Ga\\nC2b} b aGGF G //\"]', '[\"Mult ai es-te lon-gue-ment es-ba-hiz,\\nc\'on-ques ne soi chan-çon a fere en-pren-dre;\\ncar de ma jo-ie_es-to-ie de-par-tiz.\\nOr me re-fet A-mors a li en-ten-dre,\\nq\'u-ne biau-te m\'est ve-nu-e de-vant\\nqui me se-mont et pri-e que je chant;\\net je sui si siens, li-ges, qui-te-ment,\\nque tout me puet et en-ga-gier et ven-dre.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 11),
(632, 'Nouvele amours ou j\'ai mis mon penser', 'Linker 38.12', 'Chastelain de Coucy', 'French', 'K', '98b', 1, 1, '[\"C1b} D D D(C) F F G FG \'C1b} b cba G\\nb cd c b \'C1b} F Ga GFE D FG bba G\\nD D \'C1b} DD(C) F F G FG b cba G \'\\nC1b} b cd c a F Ga GFE \'C1b} D FG bba G\\nd d dc d \'C1b} c b bc d cbc b\\nc d c \'C1b} a b c F G aGa G\\na \'C1b} b c c(b) G F b c d \'C1b} dccd b\\nc d GG(F) a c d \'C1b} ca F abc ba G //\",\"C1b} D D D(C) F F G FG\\nC1b} b cba G \'b cd c b\\nC1b} F Ga GFE D FG bba G \'D D\\nC1b} DD(C) F F G FG b cba G \'\\nC1b} b cd c a F Ga GFE\\nC1b} D FG bba G \'d d dc d\\nC1b} c b bc d cbc b \'c d c\\nC1b} a b c F G aGa G \'a\\nC1b} b c c(b) G F b c d\\nC1b} dccd b \'c d GG(F) a c d\\nC1b} ca F abc ba G //\"]', '[\"Nou-vele a-mor ou j\'ai mis mon pen-ser\\nme fet chan-ter de la plus de-bo-ne-re\\nqu\'el puist el mont ne vo-er ne trou-ver,\\nsi m\'en ser-mont mes cuers de jo-ie fe-re.\\nEt quant j\'ai mis en li m\'en-ten-ci-on,\\ndont ne doi je chan-ter se de li non,\\ntout mi pen-ser sont a ma douce a-mi-e,\\npuis que je sai mon cuer en ma bail-li-e.\"]', '[\"\"]', NULL, 2, 11),
(633, 'La douce vois du rouseignol sauvaige', 'Linker 38.7', 'Chastelain de Coucy', 'French', 'K', '99b', 1, 1, '[\"C1 C D E FED D a a \'C1b} a aGab aGFG FEDC\\nC DC DE \'C1b} FF(G) a GFG FED DC CD D\\nC \'C1 D E FED D a a a \'C1b} aGab aGFG FEDC\\nC DC DE FF(G) a GFG \'C1 FED DC CD D\\nb} c d cc(b) aG \'C1b} G G abc G FED D\\nF F a \'C1b} cb cd c a GFE FG FED DC \'\\nC1b} C D F FF(E) FG aa(b) a GFE \'C1b} FG FED C\\nb a Ga FEDE C DC DE GFFED \'C1 DE FED //\",\"C1 C D E FED D a a\\nC1b} a aGab aGFG FEDC \'C DC DE\\nC1b} FF(G) a GFG FED DC CD D \'C\\nC1 D E FED D a a a\\nC1b} aGab aGFG FEDC \'C DC DE FF(G) a GFG\\nC1 FED DC CD D \'b} c d cc(b) aG\\nC1b} G G abc G FED D \'F F a\\nC1b} cb cd c a GFE FG FED DC \'\\nC1b} C D F FF(E) FG aa(b) a GFE\\nC1b} FG FED C \'b a Ga FEDE C DC DE GFFED\\nC1 DE FED //\"]', '[\"La dou-ce voiz du ro-sig-nol sau-va-ge\\nqu\'oi nuit et jor coin-to-ier et ten-tir\\nme ra-dou-cist mon cuer et mon co-ra-ge,\\nlors ai ta-lent que chant pour es-bau-dir,\\nbien doit chan-ter puis q\'il vient a ple-sir\\nce-le qui j\'ai de cuer fet lige hon-ma-ge,\\nsi doi a-voir grant joie en mon co-ra-ge\\ns\'e-le me veut a son oes re-te-nir.\"]', '[\"\"]', NULL, 2, 11),
(634, 'L\'an (Lorsque) que rose ne feuille', 'Linker 38.8', 'Chastelain de Coucy', 'French', 'K', '100b', 1, 1, '[\"C2 d e e ede fe e(d) dc\\nd \'C2b} edc b bc dc c\\nd e e \'C2b} ede fe e(d) dc\\nd edc b bc \'C2b} dc c\\ne e e ed C3 e fg \'C3b} ef edc cd e\\nef ed edc ch \'C3 c dc def ed hc haG\\nGh c \'C3 d edc ch c\\nh c c ch c \'C2 d cha G Ga c\\nd d cha \'C2 hcha c d e d c dch ha //\",\"C2 d e e ede fe e(d) dc \'d\\nC2b} edc b bc dc c \'d e e\\nC2b} ede fe e(d) dc \'d edc b bc\\nC2b} dc c \'e e e ed C3 e fg\\nC3b} ef edc cd e \'ef ed edc ch\\nC3 c dc def ed hc haG \'Gh c\\nC3 d edc ch c \'h c c ch c\\nC2 d cha G Ga c \'d d cha\\nC2 hcha c d e d c dch ha //\"]', '[\"Lan-que ro-se ne fueil-le\\nne flor ne voi pa-roir,\\nque n\'oi chan-ter par brueil-le\\noi-si-ax, n\'au main n\'au soir,\\na-donc flo-rist mon cu-er_et mon vo-loir\\nen bo-ne_a-mor, qui m\'a en son po-voir,\\ndont ja ne qier ois-sir\\net s\'il est nus qui m\'en vueil-le par-tir\\nne qier je ja sa-voir, ne Dex nel vueil-le!\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f126.item[/link]\\n\\n\"]', NULL, 2, 11),
(635, 'Par quel forfait ne par quel ochoison', 'Linker 38.13', 'Chastelain de Coucy', 'French', 'K', '101b', 1, 1, '[\"C2 Gah c ha h G a F \'C2 G a G\\nh c d d(c) c ha \'C2 d c h aG\\nGah c ha \'C2 h G a F G a G \'\\nC2 h c d d(c) c ha d c \'C2 h aG\\nd e f ed c ha h c \'C2 dd(c) ha\\nh c d d h aG \'C2 aG a h aG\\nGah a aG a \'C2 h c haG h c d\\nd e \'C3 g f e d cha h c dcde \'\\nC2 G a aGF G a h c \'C2 d cha haG //\",\"C2 Gah c ha h G a F\\nC2 G a G \'h c d d(c) c ha\\nC2 d c h aG \'Gah c ha\\nC2 h G a F G a G \'\\nC2 h c d d(c) c ha d c\\nC2 h aG \'d e f ed c ha h c\\nC2 dd(c) ha \'h c d d h aG\\nC2 aG a h aG \'Gah a aG a\\nC2 h c haG h c d \'d e\\nC3 g f e d cha h c dcde \'\\nC2 G a aGF G a h c\\nC2 d cha haG //\"]', '[\"Par quel for-fet et par quele a-che-son\\nm\'a-vez, a-mors, si de vous es-loig-nie\\nc\'on-ques de vous n\'oi gre ne guer-re-don,\\nne je ne truis qui de moi ait pi-tie?\\nA tort m\'a-vez si sanz mer-ci les-sie\\nc\'on-ques de vous ne me vint se mal non;\\nn\'on-core, a-mor, ne vous ai rep-ro-chie\\nmon ser-vi-ce, mes o-re m\'en plaing ié\\net di pour mort m\'a-vez sanz a-che-son.\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f127.item[/link]\\n\"]', NULL, 2, 11),
(636, 'Quant li rossignols jolis', 'Linker 38.15', 'Chastelain de Coucy', 'French', 'K', '102b', 1, 1, '[\"C1b} d ca b aGF G abaF F\\nF \'C1 G a ab cc(b) aG a\\nd ca \'C1b} b aGF G abaF F\\nF FG ab a(G) FED DC \'C1b} CD D\\nE F G FED EF E(D) DC \'\\nC1b} E F E D E DC D\\na \'C1b} b cc(b) cb G ab cbGab\\ncd cb \'C1b} Gab aGF G abaF F\\nF G \'C2b} a b a Ga GFED\\nFGab a(G) FED DC \'C1b} DC CD D //\",\"C1b} d ca b aGF G abaF F \'F\\nC1 G a ab cc(b) aG a \'d ca\\nC1b} b aGF G abaF F \'F FG ab a(G) FED DC\\nC1b} CD D \'E F G FED EF E(D) DC \'\\nC1b} E F E D E DC D \'a\\nC1b} b cc(b) cb G ab cbGab \'cd cb\\nC1b} Gab aGF G abaF F \'F G\\nC2b} a b a Ga GFED \'FGab a(G) FED DC\\nC1b} DC CD D //\"]', '[\"Quant li ro-sig-nol jo-lis\\nchan-te seur la flor d\'es-té,\\nque nest la ro-se_et le lis\\net la rou-se-e el vert pré,\\nplains de bo-ne vo-len-té\\nchan-te-rai con fins a-mis;\\nmes di tant sui es-ba-hiz\\nque j\'ai si tres haut pen-sé\\nqu\'a pai-nes ert a-com-pliz\\nli ser-virs dont j\'a-ie gré.\\n\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f128.item[/link]\"]', NULL, 2, 11),
(637, 'Tant ne me sai dementer ne complaindre', 'Linker 38.18', 'Chastelain de Coucy', 'French', 'K', '103b', 1, 1, '[\"C1b} aa(b) aG d c a Gab aGF \'C1b} G a cdcc(b) ba\\na GF GG(F) \'C1b} ED C D E F GFFE D\\na \'C1b} G d c a Gab aGF G \'C1b} a cdcc(b) ba\\na F a(G) ED C \'C1b} D E F GFFE D\\nF G aba \'C1b} G a b c d c cbaGa abaaG \'\\nC1b} FGac a G a G(F) E(D) C D \'C1b} DE(D) C\\nDE G a b c a \'C1b} G(F) ED C GFFE ED //\",\"C1b} aa(b) aG d c a Gab aGF\\nC1b} G a cdcc(b) ba \'a GF GG(F)\\nC1b} ED C D E F GFFE D \'a\\nC1b} G d c a Gab aGF G\\nC1b} a cdcc(b) ba \'a F a(G) ED C\\nC1b} D E F GFFE D \'F G aba\\nC1b} G a b c d c cbaGa abaaG \'\\nC1b} FGac a G a G(F) E(D) C D\\nC1b} DE(D) C \'DE G a b c a\\nC1b} G(F) ED C GFFE ED //\"]', '[\"Tant ne me sai de-men-ter ne con-plain-dre\\nque puisse a-voir de ma do-lor so-saz,\\nne de mon cuer ne puis la flan-be_es-tain-dre,\\ndont tan-te foiz me claim do-lent et laz,\\nce-le m\'o-cit vers qui ne me sai fain-dre,\\nainz sui toz jorz en pai-ne_et en por-chaz,\\nse ja por-rai jus-qu\'a s\'a-mor a-tain-dre. \"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f129.item[/link]\"]', NULL, 2, 11),
(638, 'Merci clamans de mon fol errement', 'Linker 38.10', 'Chastelain de Coucy', 'French', 'K', '104b', 1, 1, '[\"C1b} E F G ab a GF Gab \'C1b} a aG GF\\nG a G F E F(E) \'C1b} DC D E F\\nE F G ab a \'C1b} GF Gab a aG GF\\nG a G F \'C1b} E F(E) DC D E F\\nE F \'C1b} G(a) GF a b(c) b a aG GF \'\\nC1b} c G abc ba G(F) ED C D \'C1b} E FG\\na(G) GF E F a b \'C1b} c(b) aGF a GabaG\\nC D E \'C1b} F G a F GEC D E GF //\",\"C1b} E F G ab a GF Gab\\nC1b} a aG GF \'G a G F E F(E)\\nC1b} DC D E F \'E F G ab a\\nC1b} GF Gab a aG GF \'G a G F\\nC1b} E F(E) DC D E F \'E F\\nC1b} G(a) GF a b(c) b a aG GF \'\\nC1b} c G abc ba G(F) ED C D\\nC1b} E FG \'a(G) GF E F a b\\nC1b} c(b) aGF a GabaG \'C D E\\nC1b} F G a F GEC D E GF //\"]', '[\"Mer-ci cla-mant de mon fol er-re-ment,\\nfe-rai la fin de mes chan-çons o-ïr\\ncar tra-ï m\'a et mort a e-sci-ent\\nmes ja-los cuers que g\'en doi tant ha-ïr,\\nsi m\'a mal fet par le dit d\'au-tre gent,\\ntout sont par-ti de moi jo-ios ta-lent\\net quant jo-ie me faut bien est re-sons\\nqu\'ap-rés ma jo-ie fe-nis-sent mes chan-çons.\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f130.item[/link]\"]', NULL, 2, 11),
(639, 'Je chantasse volentiers liement', 'Linker 38.6', 'Chastelain de Coucy', 'French', 'K', '105b', 1, 1, '[\"C3 g f g +a f g ee(d) c d \'C3 c\\na h c d c \'C3 h aG a hc c\\ng f g \'C3 +a f g ee(d) c d c\\na h \'C3 c d c h aG a hc c \'\\nC3 a c c d c c aG a hc \'C4 c\\n+h +h+c +h+c +h+ag e c feed \'C3 c\\nh a h cd c h \'C3 aG a h cd e\\nf g g \'C3 fed e c C4 g +a +hg gee(d)\\nc \'C4 d dh d d C3 e f g c efe edc //\",\"C3 g f g +a f g ee(d) c d\\nC3 c \'a h c d c\\nC3 h aG a hc c \'g f g\\nC3 +a f g ee(d) c d c \'a h\\nC3 c d c h aG a hc c \'\\nC3 a c c d c c aG a hc\\nC4 c \'+h +h+c +h+c +h+ag e c feed\\nC3 c \'h a h cd c h\\nC3 aG a h cd e \'f g g\\nC3 fed e c C4 g +a +hg gee(d) \'c\\nC4 d dh d d C3 e f g c efe edc //\"]', '[\"Je chan-tas-se vo-len-tiers li-e-ment\\nse g\'en trou-vasse en mon cuer l\'a-che-son,\\nmes je ne puis di-re se je ne ment\\nq\'a-ie d\'a-mors nu-le riens se mal non,\\npour ce ne puis fe-re li-é chan-çon,\\nqu\'a-mors le me de-sen-saig-ne\\nqui veut que j\'aim et ne veut que je tieng-ne;\\nen-si me tient a-mors en de-ses-poir,\\nqu\'el ne m\'o-cit ne ne let jo-ie a-voir.\"]', '[\"\",\"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f131.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 359, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(640, 'S\'onkes nus hom pour dure departie', 'Linker 117.7', 'Chastelain de Coucy', 'French', 'K', '106b', 1, 1, '[\"C3 G h hcd d e c \'C3 d e f ed dc\\ne g f f e c \'C3 e e gfed d\\nh d d \'C3 d e f e d c cha \'\\nC3 h d d edc c h a c h \'C3 aGah aG\\nah c haG F F h d \'C3 d edc c\\ne g f g e c \'C3 e g ec c\\nh d d d f \'C3 e d c h ha G\\nh d d \'C3 edc h h a c h aGah aG //\",\"C3 G h hcd d e c\\nC3 d e f ed dc \'e g f f e c\\nC3 e e gfed d \'h d d\\nC3 d e f e d c cha \'\\nC3 h d d edc c h a c h\\nC3 aGah aG \'ah c haG F F h d\\nC3 d edc c \'e g f g e c\\nC3 e g ec c \'h d d d f\\nC3 e d c h ha G \'h d d\\nC3 edc h h a c h aGah aG //\"]', '[\"S\'on-ques nus hom pour du-re de-par-ti-e\\neut cuer do-lent, je l\'au-rai par re-son,\\non-ques tur-tre qui pert son com-paig-non\\nne re-mest jor de moi plus es-ba-hi-e.\\nChas-cuns pleu-re sa ter-re_et son pa-is,\\nquant il se part de ses co-riax a-mis;\\nmes nul par-tir sa-chiez que que nus di-e,\\nnest do-le-reus que d\'a-mi et d\'a-mi-e.\"]', '[\"This composition is also attributed to Thibaut de Champagne and Hughes de Bregi.\\n\\n\\n[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f132.item[/link]\"]', NULL, 2, 11),
(641, 'A vous, amant, plus k\'a nulle autre gent', 'Linker 38.1', 'Chastelain de Coucy', 'French', 'K', '107b', 1, 1, '[\"C2b} a a a a a G \'C2b} abc b ba aG\\na a a \'C2b} a a a G F Gabc baG aG \'\\nC2b} a a a a a G abc \'C2b} b ba aG\\na a a a a a \'C2b} G F Gabc baG aG\\nb d ed c \'C2b} e f e c d(c) baG aGF \'\\nC2b} F F a a a a a baG a \'\\nC2b} a b c d e d c b \'C2b} baG aGF\\nF G a a a \'C2b} G abc b cba aG //\",\"C2b} a a a a a G\\nC2b} abc b ba aG \'a a a\\nC2b} a a a G F Gabc baG aG \'\\nC2b} a a a a a G abc\\nC2b} b ba aG \'a a a a a a\\nC2b} G F Gabc baG aG \'b d ed c\\nC2b} e f e c d(c) baG aGF \'\\nC2b} F F a a a a a baG a \'\\nC2b} a b c d e d c b\\nC2b} baG aGF \'F G a a a\\nC2b} G abc b cba aG //\"]', '[\"A vous, a-manz, plus qu\'a nule au-tre gent\\nest bien re-son que ma do-lor con-plai-gne\\nquant il m\'es-tuet par-tir ou-tre-e-ment\\net de-sev-rer de ma lo-ial con-pain-gne\\net, se la pert, n\'est riens qui me re-main-gne\\net sa-chiez bien, A-mors, vra-ie-ment,\\nse nus mo-rust pour a-voir cuer do-lent,\\nja-més par moi n\'iert le-üz vers ne lais.\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f133.item[/link]\"]', NULL, 2, 11),
(642, 'Bele dame me prie de chanter', 'Linker 38.2', 'Chastelain de Coucy', 'French', 'K', '108b', 1, 1, '[\"C3 f fe d dc d e f e(d) efe d \'\\nC3 ch hh(a) aG a c d e fed dc \'C3 d\\nf fe d dc d e f \'C3 e(d) efe d\\nch hh(a) aG a c \'C3 d e fed dc d\\ne f g \'C4 fe d c d efed c d\\ne f \'C4 g f g +a +h+ag +a gfg gf\\ng \'C3 c d c d e ff(e) ed c d \'\\nC3 d a c d e e f fe dcd fed //\",\"C3 f fe d dc d e f e(d) efe d \'\\nC3 ch hh(a) aG a c d e fed dc\\nC3 d \'f fe d dc d e f\\nC3 e(d) efe d \'ch hh(a) aG a c\\nC3 d e fed dc d \'e f g\\nC4 fe d c d efed c d \'e f\\nC4 g f g +a +h+ag +a gfg gf \'g\\nC3 c d c d e ff(e) ed c d \'\\nC3 d a c d e e f fe dcd fed //\"]', '[\"Be-le da-me me pri-e de chan-ter,\\nsi est bien droiz que je fa-ce chan-çon,\\nje ne m\'en sai ne ne puis des-tor-ner\\ncar n\'ai po-voir de moi se par li non:\\ne-le_a mon cuer que ja n\'en qier os-ter\\net sai de voir q\'il n\'i tret se mal non,\\nor le dont Dex a droit port ar-ri-ver\\ncar il s\'est mis en mer sanz a-vi-ron!\"]', '[\"[link]https://gallica.bnf.fr/ark:/12148/btv1b550063912/f134.item[/link]\"]', NULL, 2, 11),
