(667, 'S\'al cor plagues ben for\' oimais sazos', 'BdT 155.18', 'Folquet de Marseilla', 'Occitan', 'G', '2r', 1, 1, '[\"C2b} a a ab G G F GF b aGF F \'\\nC2b} FG b aG FED C DE F GF EDE F \'\\nC2b} F G ab G b c G b a DF \'\\nC1F3 FG F EDC C F F GF G aG G \'\\nC2 G a h c d c haG c _haGF F \'\\nC2 F G a hc ha G aG FE DE FEDDC \'\\nC1 D F EDC F G a_h G _h aGF F \'\\nC2 a c cd c h aG FG h aGa G \'\\nC2 a a a G a F F EDC D EF \'\\nC1F3 FEFG F EDC C D F EDC F GE FEED \",\"C2b} a a ab G G F GF b aGF F \'\\nC2b} FG b aG FED C DE F GF EDE F \'\\nC2b} F G ab G b c G b a DF \'\\nC1F3 FG F EDC C F F GF G aG G \'\\nC2 G a h c d c haG c _haGF F \'\\nC2 F G a hc ha G aG FE DE FEDDC \'\\nC1 D F EDC F G a_h G _h aGF F \'\\nC2 a c cd c h aG FG h aGa G \'\\nC2 a a a G a F F EDC D EF \'\\nC1F3 FEFG F EDC C D F EDC F GE FEED \"]', '[\"S\'al cor pla-gues ben for\' oi-mais sa-zos\\nde far can-chon per jo-ia man-te-ner\\nmas trop mi fai ma ven-tu-ra do-ler\\nqant eu es-gart lo be el mal q\'eu n\'ai\\nqe rics diz hom qe sui e qe be·m vai,\\nmas cel q\'o diz non sab ges ben lo ver\\nqe be-ne-nan-za non pot hom a-ver\\nde nuil-la re mais de cho q\'al cor plai\\nper qe val mais us pau-bres q\'es jo-ios\\nc\'us rics ses joi q\'es tot l\'an con-si-ros.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digitallibrary.unicatt.it/canvas/c0902da828006492c\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://digitallibrary.unicatt.it/veneranda/data/public/manifests/0b/02/da/82/80/05/1b/f4/0b02da8280051bf4.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false