(668, 'Molt me mervoil de ma dame et de moi', 'Linker 107.4', 'Guiot de Provins', 'French', 'U', '4v', 1, 1, '[\"C3b} c c e gf ed c fe dc dc cb\\nC2b} dc baG a F \'C2h} G a ha G c c\\nh aGF Ga c d c +fe dc dc cb \'\\nC3 d ef g ec d c hG a c c\\ng +ag f g e fe dc \'C2b} d c\\nd c _h a c _h a Ga %hG G\\nh aG Ga c \'C3b} d c fe dc dc cbc\\ndc baG F3 a F G a hG a c c\",\"C3b} c c e gf ed c fe dc dc cb \'C2b} dc baG a F\\nC2h} G a ha G c c \'h aGF Ga c d c +fe dc dc cb \'\\nC3 d ef g ec d c hG a c c \'g +ag f g e fe dc\\nC2b} d c \'d c _h a c _h a Ga %hG G \'h aG Ga c\\nC3b} d c fe dc dc cbc \'dc baG F3 a F G a hG a c c\"]', '[\"Molt me mer-voil de ma da-me_et de moi,\\nq\'en-si me tient qant plus suis lonz de li;\\nbien cuit ga-rir l\'ou-re que je la voi,\\nmais lors dou-ble li mals dont je m\'o-ci;\\nsi m\'ait Dex trop fie-re cho-se_a ci\\nkant je mor-rai por tant que je la vi,\\nmais je me fi tant en ma bo-ne foi\\net en i-ceu c\'on-ques ne li men-ti.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f16.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(669, 'Molt chantesse volentiers liemant', 'Linker 38.6', 'Chastelain de Coucy', 'French', 'U', '5r-v', 1, 1, '[\"C1b} c b c d b c baG F G GFE\\nD E F G F \'C2F4b} E DC D E F\\nc b c d b c baG F G GFE \'\\nF3 D E F G F E DC D E FFG\\na b} b aGF F a bcc(b) aG a GFE \'C2b} F\\nc de f edc c aF GabaG GF\\nF3 E D E F G FE \'F3 DC D E FFG a\\nb} b c c baG a GF C2 c d ec cbaGa\\nF \'F3 G GFE G G a h c C2b} aF baaGF\",\"C1b} c b c d b c baG F G GFE \'D E F G F\\nC2F4b} E DC D E F \'c b c d b c baG F G GFE \'\\nF3 D E F G F E DC D E FFG \'a b} b aGF F a bcc(b) aG a GFE\\nC2b} F \'c de f edc c aF GabaG GF \'F3 E D E F G FE\\nF3 DC D E FFG a \'b} b c c baG a GF C2 c d ec cbaGa \'F\\nF3 G GFE G G a h c C2b} aF baaGF\"]', '[\"Molt chan-tes-se vo-len-tiers li-e-mant\\nse j\'en trou-vas-se_en mon cuer la choi-son,\\nmais je ne puis di-re se je ne mant\\nk\'a-ie d\'a-mors nu-le rien s\'i-re non,\\npor ceu ne puis fai-re li-e cha-çon\\nq\'A-mors lo me de-sen-se-ngne,\\nqui vuet que j\'aim ne ne vuet que j\'a-te-ngne,\\nen-si me tient a-mant en de-ses-poir\\nque ne m\'o-cit ne ne lait jo-ie_a-voir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f17.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,5,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
