(672, 'Molt ai este longuement esbahiz', 'Linker 65.50', 'Gace Brulé', 'French', 'U', '6r', 1, 1, '[\"C2 F G Ga c d ch ch aGa h c\\nF G GF Ga b aG GF \'C2b} Ga ba aGF FG\\nF G Ga c h} d ch ch aGa h c\\nF G GF Ga \'C2b} b aG GF Ga ba aGF FG\\naGF G Ga c d cb d e dcd dc\\nd \'C2 e f ed e c d h} h cch aGGa\\nb a aG GF F G aGF \'C2 G a ccha\\nc edef d c b} b aG GF Ga ba aGF FG\",\"C2 F G Ga c d ch ch aGa h c \'F G GF Ga b aG GF\\nC2b} Ga ba aGF FG \'F G Ga c h} d ch ch aGa h c \'F G GF Ga\\nC2b} b aG GF Ga ba aGF FG \'aGF G Ga c d cb d e dcd dc \'d\\nC2 e f ed e c d h} h cch aGGa \'b a aG GF F G aGF\\nC2 G a ccha \'c edef d c b} b aG GF Ga ba aGF FG\"]', '[\"Molt ai es-té lon-gue-ment es-ba-hiz\\nque je no sai chan-çon a fai-re_em-pren-dre,\\ncar de ma jo-ie_es-to-ie de-par-tiz.\\nOr me re-fait a-mors a li en-ten-dre\\nc\'u-ne bial-tez m\'est ve-nu-e de-vant,\\nqui me re-quierz et pri-e que je chanz\\net je sui siens toz qui-tes li-ge-ment,\\nque tot me puet et en-gai-gier et va-ndre.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f19.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 116, \"facsimileY\": 267, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(673, 'Molt m\'est bele la douce comencence', 'Linker 38.11', 'Chastelain de Coucy', 'French', 'U', '4r', 1, 1, '[\"F3 FFED DC CD F FGa GGF EDC DE FG FFED DC\\nD C CD F FG \'F3 FG FED DC CD EFE ED\\nFFED DC CD F FGa GGF EDC DE FG FFED DC \'\\nF3 D C CD F FG FED DC CD EFE ED\\naah G d c a \'F3 GF FG b} ab a GFFE ED\\nE F GGF ED DC CD\\naab G d c \'F3 a GF FG b} ab aG GF\\nFG a c G F E F GaG FED DC\\nF2 DE A \'F2 C D DC D E G Ga C1 ccd\\ncch aG aG FEDE C D \'F3 DE Ga GF EDC CD\",\"F3 FFED DC CD F FGa GGF EDC DE FG FFED DC \'D C CD F FG\\nF3 FG FED DC CD EFE ED \'FFED DC CD F FGa GGF EDC DE FG FFED DC \'\\nF3 D C CD F FG FED DC CD EFE ED \'aah G d c a\\nF3 GF FG b} ab a GFFE ED \'E F GGF ED DC CD \'aab G d c\\nF3 a GF FG b} ab aG GF \'FG a c G F E F GaG FED DC \'F2 DE A\\nF2 C D DC D E G Ga C1 ccd \'cch aG aG FEDE C D\\nF3 DE Ga GF EDC CD\"]', '[\"Molt m\'est be-le la dou-ce co-men-cen-ce\\ndel no-vel tens a a l\'en-trer del pas-cor\\nque bois et pre sn de main-te sem-blan-ce\\nvert et ver-meil co-vert d\'er-be_et de flor;\\net je sui lais de ceu en tel ba-lan-ce\\nque main join-tes a-our\\nma bo-ne mort ou ma hal-te ri-chor\\nne sai lo que·l sen ai jo-ie_et pa-ior\\nsi que·m so-vent chanz la ou de cuer plor\\nke lons res-piz m\'aes-ma-ie_et mes-che-an-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f15.item.zoom\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 53, \"facsimileY\": 98, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicSt