(692, 'Molt ai esté lon tens en esperance', 'Linker 80.1', 'Geoffroi de Chastillon', 'French', 'U', '6v-7r', 1, 1, '[\"C2 d edc h haG Ga h ahc ha G GahaG GF\\nah ch ha aG a ha aGa \'C2 aG GF G\\nd edc h haG Ga h ahc ha G GahaG GF\\nah ch ha aG a \'C2 ha GFG aG GF G\\nGa h ch haG Ga h c ha G ahaG GF\\nah \'C2 ch ha aG a ha GFG a GFG FED\\nF G a h c dc ha haG \'C2 GF G\",\"C2 d edc h haG Ga h ahc ha G GahaG GF \'ah ch ha aG a ha aGa\\nC2 aG GF G \'d edc h haG Ga h ahc ha G GahaG GF \'ah ch ha aG a\\nC2 ha GFG aG GF G \'Ga h ch haG Ga h c ha G ahaG GF \'ah\\nC2 ch ha aG a ha GFG a GFG FED \'F G a h c dc ha haG\\nC2 GF G\"]', '[\"Molt ai es-té lon tens en es-pe-ran-ce\\net de fin cuer ai le-al-mant a-mé\\nnon-ques a-mors ou j\'a-vo-ie-e fian-ce\\nne m\'a se-vi rien de ma vo-len-té\\ntrop ma gre-ve mis i ai m\'a-tan-dan-ce\\nmais d\'u-ne rien me puis je bien van-ter,\\nc\'ainz ni per-di per le-al-ment a-mer.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f20.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 90, \"facsimileY\": 491, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(694, 'Encor ferai une chançon perdue', 'Linker 117.3', 'Hughes de Bregi', 'French', 'U', '7r-v', 1, 1, '[\"F3 G G FE DC C D F G \'F3b} ab aGF FG\\nGa G FE DC C D F G aGF FG\\nbbaG GF \'F3b} FG b b cc(b) aGF G aG GF\\nbbaG GF FG b b cc(b) \'F4b} aGF G ab aGF FG\\nb c baG GF G a F G FE \'F3 D\\nD E F G F a ahc b} b aG GF\\nb c d cba b \'C1F3 cc(h) aGF G a GFE ED\\nD E F G F a ahc h ha aGF FG\",\"F3 G G FE DC C D F G\\nF3b} ab aGF FG \'Ga G FE DC C D F G aGF FG \'bbaG GF\\nF3b} FG b b cc(b) aGF G aG GF \'bbaG GF FG b b cc(b)\\nF4b} aGF G ab aGF FG \'b c baG GF G a F G FE\\nF3 D \'D E F G F a ahc b} b aG GF \'b c d cba b\\nC1F3 cc(h) aGF G a GFE ED \'D E F G F a ahc h ha aGF FG\"]', '[\"En-cor fe-rai u-ne chan-çon per-du-e\\npues q\'a per-dre sont a-tor-né mi chant,\\nc\'on-ques ne fis chan-çon en mon vi-vant\\ndont me-ri-te me soit en-cor ren-du-e;\\nn\'ainz de cha-nter d\'a-mors mains ne me fu\\nmais se Deus plaist ces-te_au-ra tel ver-tu\\nque des au-tres me ren-dra la droi-tu-re\\ns\'en met senz plus cest chant en a-ven-tu-re.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f21\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 130, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(695, 'Quant flors et glais et verdure s\'esloigne', 'Linker 65.63', 'Gace Brulé', 'French', 'U', '8r', 1, 1, '[\"F3 F G aaG GF a hc ch ha ahc haGa aG\\nF GaG GF G F Ga \'C1F3b} b aGaG GF FG\\nF G aaG GF a bc cb ba abc baGa aG\\nF GaG GF \'F3 G F Ga h aGaG GF FG\\nC2 c d c cde d def eed dc cdedc haG\\nF \'C1 G Ga ccha GGF ED DE G Ga cchah cd\\nC2 ed ch dc haG F Ga ha \'C1b} aGaG GF FG\",\"F3 F G aaG GF a hc ch ha ahc haGa aG \'F GaG GF G F Ga\\nC1F3b} b aGaG GF FG \'F G aaG GF a bc cb ba abc baGa aG \'F GaG GF\\nF3 G F Ga h aGaG GF FG \'C2 c d c cde d def eed dc cdedc haG \'F\\nC1 G Ga ccha GGF ED DE G Ga cchah cd \'C2 ed ch dc haG F Ga ha\\nC1b} aGaG GF FG\"]', '[\"Quant flors et glais et ver-du-re s\'es-loi-gne\\nque cil oi-sel no sent un mot so-ner\\npor la froi-dor ches-cuns do-te_et re-soi-gne\\nius-q\'a bel tens qu\'il res-ve-lent chan-ter\\nlors chan-te-rai qui ne puis ob-li-er\\nla dol-ce_a-mor dont Dex jo-ie me doi-gne\\ncar de li sont et mue-vent mei pen-ser.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f23.item.zoom\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 89, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(701, 'Coment que longe demore', 'Linker 38.4', 'Chastelain de Coucy', 'French', 'U', '8v', 1, 1, '[\"C1 c d chaG F Ga b aGF Ga\\nh} h ch aG aGF ED EF G\\nc d \'C1 haG F b} Ga b aGF Ga\\nb cb aG aGF EDEF EDC C\\nF D EDC F Ga b aGa \'\\nC1 c b} b aG F GabaG GF Ga\\nc C2 d edc b aGa ba GF\\nF3 F ED F \'C1 Ga h ha GC DEF\\nED DC\",\"C1 c d chaG F Ga b aGF Ga \'h} h ch aG aGF ED EF G \'c d\\nC1 haG F b} Ga b aGF Ga \'b cb aG aGF EDEF EDC C \'F D EDC F Ga b aGa \'\\nC1 c b} b aG F GabaG GF Ga \'c C2 d edc b aGa ba GF \'F3 F ED F\\nC1 Ga h ha GC DEF \'ED DC\"]', '[\"Co-ment que lon-ge de-mo-re\\na-ie fai-te de chan-ter,\\nor est bien rai-son et o-re\\nke mi do-ie re-tor-ner;\\nk\'a-mors m\'a fait ob-li-er\\nla nui qui lon-tens m\'a mort,\\net do-ne no-vel con-fort;\\nda-me por cui chant et de-port\\nmer-ci.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f24.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 186, \"facsimileY\": 109, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(704, 'Cil qui aime de bone volenté', 'Linker 65.16', 'Gace Brulé', 'French', 'U', '9r', 1, 1, '[\"C3 d e f g c d c def eed dc\\nd e dch ha [h] G a h c \'C3 eddc d\\nd e f g e f e fg+a ggf fe\\nf g fed dc d h cd \'C2 d a chha aG\\nF G Ga c d ch cd f h} e dcch c\\nd e dch \'C2 ha h cddc ha hc haG GF\\nF G a h c dc ha ha aGF G\",\"C3 d e f g c d c def eed dc \'d e dch ha [h] G a h c\\nC3 eddc d \'d e f g e f e fg+a ggf fe \'f g fed dc d h cd\\nC2 d a chha aG \'F G Ga c d ch cd f h} e dcch c \'d e dch\\nC2 ha h cddc ha hc haG GF \'F G a h c dc ha ha aGF G\"]', '[\"Cil qui ai-me de bo-ne vo-len-té\\ndeu-roit a-des estre en bo-ne_es-pe-ran-ce\\net je qui ai de cuer lon-tens a-mé\\nnen poi a-voir fors i-re_et grant pe-san-ce;\\nce-li ne plaist en cui j\'ai ma fi-an-ce,\\nor me doint Dex que je la ser-ve_en gré\\ntant qu\'e-le m\'ait de ma do-lor os-té.\"]', '[\"Notes: 2.5, note and syllable <i>estre</i> added in the margin, in an additional four line staff provided by the notator. This has a C-clef on the first line (from the top), and the <i>h</i> is also on the first line. For sake of consistency with the rest of the melody, in this edition the note is simply reported on the third space (form the top).\\n<br>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f25.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 105, \"facsimileY\": 188, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 23, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(705, 'Al renovel de la dolçor d\'esté', 'Linker 65.6', 'Gace Brulé', 'French', 'U', '23r', 1, 1, '[\"C2 d d e f ed dc cd ed chaG ac\\nc ch c de dh cha \'C2 F Ga cch aGF G\\ne d d f eed ddc cd ed chaG ac\\nc ch \'C2 c dde dh cha G ah ddc haG a\\nG a h cch c ha G ahc \'C2 haG G\\ndef e dcd edc dc ha G aG ah cd dc\\nC3 e f g \'C2 fed c ha G ahc haG G\\ndef e dcd edc ddc haG Ga ha aGF FG\",\"C2 d d e f ed dc cd ed chaG ac \'c ch c de dh cha\\nC2 F Ga cch aGF G \'e d d f eed ddc cd ed chaG ac \'c ch\\nC2 c dde dh cha G ah ddc haG a \'G a h cch c ha G ahc\\nC2 haG G \'def e dcd edc dc ha G aG ah cd dc \'C3 e f g\\nC2 fed c ha G ahc haG G \'def e dcd edc ddc haG Ga ha aGF FG\"]', '[\"Al re-no-vel de la dol-çor d\'es-té\\nque res-clar-cist la doiz en la fon-tei-ne\\net que sont vert bois et ver-gier et pré,\\net cil ro-si-er flo-ri_en mai en grei-ne\\nlors chan-te-rai que tant m\'au-ra-du-re\\ni-re_et es-mai qui m\'est al cuer pro-chai-ne\\ndon fins a-manz est tost o-qui-so-nez\\net molt so-vent de le-gier es-fa-ez.\"]', '[\"Notes: The melody is notated by a different hand from the one of the main scribe, and provides a much less precise transcription. Pitches and distribution of the notes are sometimes difficult to determine with certainty.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f53.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 96.66667175292967, \"facsimileY\": 778.888916015625, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 20, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}',