(713, 'En talant ai q\'a chanter me retraire', 'Linker 265.660', 'Author of Linker 265.660', 'French', 'U', '9v', 1, 1, '[\"C1 c a F G F a c h d chaG EDC\\nha G F G \'C1 a h ch h a aGF G\\nc a F G F a c h cd ch cd \'\\nC1 ha G F G a h ch h a aGF G\\nC2 c d e c d h \'C1 ch a Ga F\\nF G a b} b cb aG E FE ED DC\\nC E F \'C1 G a F G F c hcdca a\\nF G a h c aG F ED \'C1 F aGF FG\",\"C1 c a F G F a c h d chaG EDC \'ha G F G\\nC1 a h ch h a aGF G \'c a F G F a c h cd ch cd \'\\nC1 ha G F G a h ch h a aGF G \'C2 c d e c d h\\nC1 ch a Ga F \'F G a b} b cb aG E FE ED DC \'C E F\\nC1 G a F G F c hcdca a \'F G a h c aG F ED\\nC1 F aGF FG\"]', '[\"En ta-lant ai q\'a chan-ter me re-trai-re\\nk\'a-mors lo vuet et ma da-me m\'en pri-e.\\nTrop lon-gue-ment m\'ai te-nu en de-la-ie,\\nque ne chan-tai ne n\'oi jo-ieu-se vi-e\\nnon-ques por ceu mains n\'a-mai ne ser-vi;\\nque cil n\'est pas a-manz ne sam-ble_a-mi\\nqui d\'a-mor part por mal ne por gre-ven-ce,\\nk\'en pou do-re crest les suens et a-van-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f26.item.r=20050.langES\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(714, 'De bone amor et de leial amie', 'Linker 65.25', 'Gace Brulé', 'French', 'U', '10r', 1, 1, '[\"C2 c d d dc d e d c h aGF G\\nGa c h ha c d ch \'C2 h a aGF G\\nc d d dc d e d c h aGF G\\nGa c ch ha hc \'C1 d ch h a aGF G\\nC2 d e f e c d e f ede d \'\\nC3 d e f g f e e d def edc\\nc d c fede c d ch \'C2 a G Ga\\nF G Ga c e dc h a G aha ha\",\"C2 c d d dc d e d c h aGF G \'Ga c h ha c d ch\\nC2 h a aGF G \'c d d dc d e d c h aGF G \'Ga c ch ha hc\\nC1 d ch h a aGF G \'C2 d e f e c d e f ede d \'\\nC3 d e f g f e e d def edc \'c d c fede c d ch\\nC2 a G Ga \'F G Ga c e dc h a G aha ha\"]', '[\"De bo-ne_a-mor et de le-ial a-mi-e\\nme vient so-vent  pi-tiez et re-mam-bran-ce\\nsi que jai-mais a nul ior de ma vi-e\\nn\'ob-li-e-rai son vis ne sa sam-blan-ce\\net puis k\'a-mors ne s\'en vuet plus sof-frir\\nqu\'e-le de toz ne fa-ce_a son plai-sir\\net de to-tes mais ne puet a-ve-nir\\nque de la mo-ie_a-ie bo-ne_es-pe-ran-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f27.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 33, \"facsimileY\": 539.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(715, 'Quant voi venir lo dolz tens et la flor', 'Linker 38.17', 'Chastelain de Coucy', 'French', 'U', '10r-v', 1, 1, '[\"C2 c h c d e d cch a G aaG\\ncd ch aG \'F3 FE D C F F G abaG a\\nc h c d C2 e d ch a G aa(h) \'\\nC1 cd ch aG FE D C G G a ahaG a\\nc a ch GF ED C \'F3 D E F ED\\nD F G a h ch aG F FG aa(h)\\ncd ch aG \'F3 FE D C F F G ahaG a\\nc a ch GF E DC D E F EDC CD \",\"C2 c h c d e d cch a G aaG \'cd ch aG\\nF3 FE D C F F G abaG a \'c h c d C2 e d ch a G aa(h) \'\\nC1 cd ch aG FE D C G G a ahaG a \'c a ch GF ED C\\nF3 D E F ED \'D F G a h ch aG F FG aa(h) \'cd ch aG\\nF3 FE D C F F G ahaG a \'c a ch GF E DC D E F EDC CD \"]', '[\"Quant voi ve-nir lo dolz tens et la flor\\nque l\'er-be verz s\'es-pant a-val la pre-ie,\\nlors me so-vient de ma do-ce do-lor,\\net del douz leu ou mes cuers a-des be-ie.\\nS\'ai tant de jo-ie_et tant ai de dol-çor\\nque je ja-mais nen par-ti-rai nul jor,\\net quant je sui plus lonz de sa con-tre-e\\nlors est mes cuers plus pres de sa pen-se-e.\"]', '[\"Notes: 8.9-10. The distribution of the notes  <i>FEDC</i> over the syllables is uncertain. The division proposed is conjectural.\\n<br>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f28.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 48, \"facsimileY\": 634.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(717, 'Je chantaisse volontiers liement', 'Linker 112.2', 'Hue de la Ferté', 'French', 'T', '149v-150r', 1, 1, '[\"C4 g f g +a f g e d e c\\na c c d c ch aG \'C3 a c c\\ng f g +a f g e d e c\\na c c d c ch aG a c c \'\\nC3 e f edc de e fg fed c ch c\\ne f g gfe e d eddc c\\naG a h c \'C3 h a GF a h chc d\\ne f g(f) edc c G c d ef\\nedcha G \'C3 haG h a h c aGF chha G\",\"C4 g f g +a f g e d e c \'a c c d c ch aG\\nC3 a c c \'g f g +a f g e d e c \'a c c d c ch aG a c c \'\\nC3 e f edc de e fg fed c ch c \'e f g gfe e d eddc c \'aG a h c\\nC3 h a GF a h chc d \'e f g(f) edc c G c d ef \'edcha G\\nC3 haG h a h c aGF chha G\"]', '[\"Je chan-tais-se vo-lon-tiers li-e-ment\\nse je trou-vais-se_ens mon cuer o-coi-son\\net de-sis-se_et l\'es-tre et l\'er-re-ment\\nse j\'o-sais-se me-tre m\'en-ten-ti-on\\nde la grant cort de Fran-ce_au douç re-non,\\nou tou-te va-lors se bai-gne\\ndes prod\' o-mes me lo qui ke s\'em plai-gne\\ndont tant ja ki bien por-ront ve-oïr\\npar tans je quic lor sens et lor sa-voir. \"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60007945/f310.item\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60007945/canvas/f310\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"19\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60007945/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(718, 'Quant li oisillon menu', 'Linker 265.1464', 'Author of Linker 265.1464', 'French', 'K', '396a', 1, 1, '[\"C2 e e e c d cha c \'\\nC2 h c d cha c haG a \'\\nC2 e e e c d cha c \'\\nC2 h c d cha c haG \'C2 a\\nh c d cha h \'C2 a\\nh c d cha h a \'\\nC2 F G a h a G a\\nd ch c \'C2 haG a h c\",\"C2 e e e c d cha c \'\\nC2 h c d cha c haG a \'\\nC2 e e e c d cha c \'\\nC2 h c d cha c haG\\nC2 a \'h c d cha h\\nC2 a \'h c d cha h a \'\\nC2 F G a h a G a \'d ch c\\nC2 haG a h c\"]', '[\"Quant li oi-sel-lon me-nu\\nchan-tent par le gaut foil-lu\\nque cil bois sou-vent son dru\\npour le douz tens qu\'iest ve-nu,\\nm\'es-tuet que me plai-gne \\nquant si me des-trai-gne\\nla be-le qui m\'a to-lu\\nson so-laz et sa ver-tu.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f424.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 141, \"facsimileY\": 527, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
