(722, 'Ausi comme unicone sui', 'Linker 240.3', 'Thibaut de Champagne', 'French', 'K', '29a', 1, 1, '[\"C1 c c h a G ahaG G G\\nG \'C1 G a F G a ha G\\nE \'C1 F G a G F E FED\\nF F \'C1 G E C D EC C\\nG a G c \'C1 a h aGE FG\\na h a F F \'C1 G aG GF\\na h c d c \'C1 h ahc h\\na G a F E \'C1 F GF FE\\nF G a \'C1 h a G aF G\",\"C1 c c h a G ahaG G G \'G\\nC1 G a F G a ha G \'E\\nC1 F G a G F E FED \'F F\\nC1 G E C D EC C \'G a G c\\nC1 a h aGE FG \'a h a F F\\nC1 G aG GF \'a h c d c\\nC1 h ahc h \'a G a F E\\nC1 F GF FE \'F G a\\nC1 h a G aF G\"]', '[\"Au-si com-me_u-ni-co-ne sui\\nqui s\'es-ba-hit en re-gar-dant\\nquant la pu-ce-le va mi-rant\\ntant est li-é de son en-nui\\npas-me-e chiet en son gi-ron,\\nlors l\'o-cit on en tra-ï-son;\\net moi ont mort d\'au-tel sen-blant\\na-mors et ma da-me por voir\\nmon cuer ont n\'en puis point a-voir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f55.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 174, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(724, 'Avoir quidai engané le marchié', 'Linker 133.20', 'Jean Bretel', 'French', 'A', '148v (157v)', 1, 1, '[\"C1 a h c c(h) hah(a) G a G \'F2 E FEE(D) DC\\nD F G(a) G a h \'F3 c ha G aGF G\\nG(F) ED EF G \'F3 a h G a GF EF ED\\nE F ED C \'F3 E G a h aG aGF G\\nG a \'F3 h c ha h c(h) aG a \'F3 aG\\nE G a G(F) ED E G a(G) FED \'F2 E\\nC DE G G a F Ga \'F2 FED E(F) ED C\\nE F ED EF G GG(F) ED E \'F2 F EDC ?\",\"C1 a h c c(h) hah(a) G a G\\nF2 E FEE(D) DC \'D F G(a) G a h\\nF3 c ha G aGF G \'G(F) ED EF G\\nF3 a h G a GF EF ED \'E F ED C\\nF3 E G a h aG aGF G \'G a\\nF3 h c ha h c(h) aG a\\nF3 aG \'E G a G(F) ED E G a(G) FED\\nF2 E \'C DE G G a F Ga\\nF2 FED E(F) ED C \'E F ED EF G GG(F) ED E\\nF2 F EDC ?\"]', '[\"A-voir qui-dai en-ga-né le mar-chi-é\\nquant tou-voi-tai be-le da-me_et jo-li-e\\net tant pour quis k\'e-le m\'eut o-tri-i-é\\nke le m\'a-moit et me fist cour-toi-si-e.\\nMais li mar-chiés m\'a trop miex en-ga-né\\nkar en li n\'a ne foi ne lo-iau-té\\nains l\'a kas-cuns a son tour ga-e-ni-é;\\nA-dan, ai jou per-du u ga-a-ni-é?\"]', '[\"Notes:  a peculiar simbol, similat to a <i>h(c)</i> notatated in the space between <i>fist</i> and <i>court-</i>. If is was a note, there would be one too many note group in the metrical line. \", \"\"]', '{\"Link\": \"https://iiif.irht.cnrs.fr/iiif/France/Arras/Bibliotheque_municipale/620416201_MS0139_0657/DEPOT/620416201_MS0139_0657_0164A/full/full/0/default.jpg\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 70, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(725, 'Je chant mes c\'est mauves signes', 'Linker 87.1', 'Gille de Maison', 'French', 'K', '234b-235a', 1, 1, '[\"C1 d d G Gah e \'C1 ch a aG\\na aGF G \'C1 Gah cd cha aG\\nd d hG d \'C1 dch a aG a\\naGF G Gah cd \'C1 cha haG aG\\nC3 d def g gfed d \'C3 def g\\ng fee(f) g gfed c ha G \'\\nC2 Gah d def e dch ch a(G) GF\\nG \'C2 Ga c c d chha aG\",\"C1 d d G Gah e\\nC1 ch a aG \'a aGF G\\nC1 Gah cd cha aG \'d d hG d\\nC1 dch a aG a \'aGF G Gah cd\\nC1 cha haG aG \'C3 d def g gfed d\\nC3 def g \'g fee(f) g gfed c ha G \'\\nC2 Gah d def e dch ch a(G) GF \'G\\nC2 Ga c c d chha aG\"]', '[\"Je chant mes c\'est mau-ves si-gnes,\\nqu\'en chan-tant m\'es des-con-fort,\\ncil n\'est pas de chan-ter di-gnes\\nqui ne chan-te par de-port\\net quant plus mi-re con-fort,\\nde la do-lor que je port\\nfaz tout au-si com li ci-gnes\\nqui chan-te de-vant sa mort.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f262.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 145, \"Annotations\": true, \"FontSizeOld\": 19, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(726, 'Quant je plus sui en poor de ma vie', 'Linker 24.19', 'Blondel de Nesles', 'French', 'K', '109b', 1, 1, '[\"C1 c c chc \'C1 ha h cd c(h) \'C1 aG F GaG GF\\ncc(h) aG F Ga F \'C1 Gah aa(G) FED EDC D\\nc c chc ha \'C1 h cd cc(h) aG F GaG GF\\ncc(h) aG F Ga \'C1 F Gah aa(G) FED EDC D\\nE F G FED \'C1 E G F G FED C\\nG G \'C1 aG F a h cc(h) G E FE D \'\\nC1 E G a c h c b} a b aG \'C1 aa(G)\\nF G F\\nb a GG(F) ED \'\\nC1 E G F G FED C\\nG G \'C1 aG F a h cc(h) G E FED \'\\nC1 E G F G FED EFG FED C \'\\nC1 C E G a h aGa c \'\\nC1 d c h a G ahcha aG\",\"C1 c c chc\\nC1 ha h cd c(h)\\nC1 aG F GaG GF \'cc(h) aG F Ga F\\nC1 Gah aa(G) FED EDC D \'c c chc ha\\nC1 h cd cc(h) aG F GaG GF \'cc(h) aG F Ga\\nC1 F Gah aa(G) FED EDC D \'E F G FED\\nC1 E G F G FED C \'G G\\nC1 aG F a h cc(h) G E FE D \'\\nC1 E G a c h c b} a b aG\\nC1 aa(G) \'F G F \'b a GG(F) ED \'\\nC1 E G F G FED C \'G G\\nC1 aG F a h cc(h) G E FED \'\\nC1 E G F G FED EFG FED C \'\\nC1 C E G a h aGa c \'\\nC1 d c h a G ahcha aG\"]', '[\"Quant je plus sui en po-or de ma vi-e\\net je mains doi par re-son es-tre liéz,\\nlors mi se-mont ma vo-len-té et pri-e\\net fi-ne_a-mours que je so-ie_en-voi-siez.\\nS’e-le m’o-cit, siens en ert li pe-chiez;\\ntrop a douz non pour fe-re vi-le-ni-e;\\net se je sui par mes euz tra-veil-liez,\\ndont la vi,\\nqu’en doi ja li\\nde-man-der fors mer-ci?\\nPuis que par mi sui de jo-ie_es-lo-gniez,\\nje ne m’en doi plain-dre mi-e;\\ncon-ment qu’a-ie_es-té i-riez,\\ndou-ce-ment sui en-gi-ngniez.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f135.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 385, \"facsimileY\": 842, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"Me