(727, 'A la doucer du tens qui raverdoie', 'Linker 65.3', 'Gace Brulé', 'French', 'K', '111a', 1, 1, '[\"C1 d d d c h chaG F G \'C1 Ga chha aG\\nF E FGG(F) ED E G \'C1 G FF(E) FG G\\nC2 d cde d c \'C2 h chaG F GG(F) FG chha aG\\nF \'C1 E F FED C E G FE \'C1 F G\\nF a chha G C2 d cde d \'C2 d ch aGa G\\nC3 e fg edef \'C2 edc h chaG F GG(F) FE GFFE G \'\\nC2 ccd(c) c(h) a ec ch ha \'C2 G a ah chha G\",\"C1 d d d c h chaG F G\\nC1 Ga chha aG \'F E FGG(F) ED E G\\nC1 G FF(E) FG G \'C2 d cde d c\\nC2 h chaG F GG(F) FG chha aG \'F\\nC1 E F FED C E G FE\\nC1 F G \'F a chha G C2 d cde d\\nC2 d ch aGa G \'C3 e fg edef\\nC2 edc h chaG F GG(F) FE GFFE G \'\\nC2 ccd(c) c(h) a ec ch ha\\nC2 G a ah chha G\"]', '[\"A la dou-cer du tens qui ra-ver-doi-e\\nchan-tent oi-sel et flo-ris-sent ver-gier\\nmes je ne sai dont re-si-oir me doi-e\\nquant a mer-ci fail quant je plus la qier\\nje chan-te-rai sanz jo-ie et sanz pro-ier\\nque ma mort voi ne fail-lir ni por-roi-e\\npuis qu\'a-mors veut que con-tre moi la cro-ie.\"]', '[\"Notes: Attributed to Blondel de Nesle in K.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f137.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 1, \"facsimileY\": 800, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
