(740, 'D\'amour ki m\'a tolu a moi', 'Linker 39.2', 'Chrestien de Troies', 'French', 'T', '45v', 1, 1, '[\"C2 c c d dch c d(c) haG a\\nF a c a GFE FG FE ED\\nc c d dch c d(c) \'F4 haG a\\nF a c a GFE FG FE ED\\nF EDC D E F GG(F) EDC F\\nG a c haG \'F4 ah hcd c ha\\nah aG a a F G FED F\\nC D F EDC F G(F) EDC F \'\\nF3b} b a G FED C DE GF ED\",\"C2 c c d dch c d(c) haG a \'F a c a GFE FG FE ED \'c c d dch c d(c)\\nF4 haG a \'F a c a GFE FG FE ED \'F EDC D E F GG(F) EDC F \'G a c haG\\nF4 ah hcd c ha \'ah aG a a F G FED F \'C D F EDC F G(F) EDC F \'\\nF3b} b a G FED C DE GF ED\"]', '[\"D\'a-mour ki m\'a to-lu a moi\\nn\'a soi ne me veut re-te-nir,\\nme plaig je si c\'a-des o-troi\\nque de moi fa-ce son plai-sir.\\nEt jou ki ne puis ... tai-sir\\nque ne me plai-gne,_et di pour coi:\\nquant cels ki le tra-ïs-sent voi\\nso-vent a lour jo-ie ve-nir\\net g\'i fal par ma bo-ne foi.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60007945/f102.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 208, \"facsimileY\": 255, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
