(744, 'Chanter me fait ce don je criem morir', 'Linker 207.1', 'Pierre II de Molins', 'French', 'U', '11r-v', 1, 1, '[\"C1 G h c d d d c d cha h\\nh c d dc h\",\"C1 G h c d d d c d cha h \'h c d dc h\"]', '[\"Chan-ter me fait ce don je criem mo-rir\\nle-als a-mors et\"]', '[\"Notes: The melody ends at f° 11r.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f29.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 124, \"facsimileY\": 612, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(745, 'Bien doit chanter cui fine amors adrece', 'Linker 24.5', 'Blondel de Nesles', 'French', 'U', '11v-12r', 1, 1, '[\"C1b} b b bba aG a b ccb aG E FE DC\\nD E F \'F3 FE D E FE DC CD DC\\nb} b b ba G a b ccb aG \'C1F3b} F FE D\\nD E F FE D E FFE DC CD DC\\nD F FED F G a b \'C1b} aG GF G\\na b c cb a b ccb aG Ga aG \'\\nC1b} a h c F G b a G F DCD\\nF3 C D DC F G \'C1b} ab aaG FED EFG FED DC\\nC D DC F G ab aaG FED EFG FED\",\"C1b} b b bba aG a b ccb aG E FE DC \'D E F\\nF3 FE D E FE DC CD DC \'b} b b ba G a b ccb aG\\nC1F3b} F FE D \'D E F FE D E FFE DC CD DC \'D F FED F G a b\\nC1b} aG GF G \'a b c cb a b ccb aG Ga aG \'\\nC1b} a h c F G b a G F DCD \'F3 C D DC F G\\nC1b} ab aaG FED EFG FED DC \'C D DC F G ab aaG FED EFG FED\"]', '[\"Bien doit chan-ter cui fi-ne_a-mors ad-re-ce\\nde jo-ie_a-voir mais pas ne m\'en se-mont\\nne.m moi ne truis ne jo-ie ne le-e-ce\\nper coi ge chant ne ne sau-roi-e dont\\net non-por-cant se li mals me des-pont\\nk\'en-tre ma da-me_et fi-ne_a-mor me font\\nbien puis mo-rir que ja ne lo sau-ront\\nse par mon chant n\'en se-vent la des-tre-ce\\nou par mon vis don la co-lors de-font.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f30.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 132, \"facsimileY\": 711.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(746, 'Quant je plus sui en paor de ma vie', 'Linker 24.19', 'Blondel de Nesles', 'French', 'U', '12v-13r', 1, 1, '[\"C3b} f f ffe ed f g ffe dc b cdc cb\\need dc b ccd \'C3b} b cde ddc ba a aG\\nf f fe ed f g ffe dc b cdc cb \'\\nC2b} ffe dc cb cd b cde ddc baG a aG\\nc de d cbc a F Ga \'C2b} bc baG GF\\nc c dc cb d _e dc baG F GabaG GF\\nc d c f \'C3b} e fg d e dc d\\nb c b\\n_e d c baG\\na bc \'C2b} b c baG GF\\nc c dc cb d e fed c a \'C2b} baG\\na c b a G abc baG GF\\nc c ddc cb c \'C3b} cd f\\ng f e d c de ddc\",\"C3b} f f ffe ed f g ffe dc b cdc cb \'eed dc b ccd\\nC3b} b cde ddc ba a aG \'f f fe ed f g ffe dc b cdc cb \'\\nC2b} ffe dc cb cd b cde ddc baG a aG \'c de d cbc a F Ga\\nC2b} bc baG GF \'c c dc cb d _e dc baG F GabaG GF \'c d c f\\nC3b} e fg d e dc d \'b c b \'_e d c baG \'a bc\\nC2b} b c baG GF \'c c dc cb d e fed c a\\nC2b} baG \'a c b a G abc baG GF \'c c ddc cb c\\nC3b} cd f \'g f e d c de ddc\"]', '[\"Quant je plus sui en pa-or de ma vi-e\\net je doi mains per rai-son es-tre liez,\\nlors me se-mont ma vo-len-tez et pri-e\\net fi-ne_a-mors que le so-ie_en-voi-siez.\\nS\'e-le m\'o-cit seins en iert li pe-chiez;\\ntrop a douz non por fai-re vi-le-ni-e;\\net se je sui per mes euz tra-bil-liez,\\ndont la vi,\\nq\'en doi je li\\nde-man-der fors mer-ci?\\nPues que par moi sui de jo-ie_es-loi-gniez,\\nje ne m\'en doi plain-dre mi-e;\\nco-ment c\'a-je_es-té i-riez,\\ndol-ce-mant sui en-gi-gniez.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f32.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 194, \"facsimileY\": 764, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true