(747, 'Comancemenz de douce saison bele', 'Linker 77.6', 'Gautier d\'Espinau', 'French', 'U', '51r', 1, 1, '[\"F3 D a aG Ga h c ha G FE GFE ED\\nC G GGF EDE EDC CD\\nD \'F3 a aha aG h cd cha G FE GFE ED\\nE F EDC D DE G\\na \'C1F3 h ch ha a c hah G haG G\\nh c dca G F F EDC F \'C2 a chG F\\nF3 E F GGF ED EFE C\\nG G GF EDE EDC D\\nE F \'F3 E D C D EFE ED\\nE G ah chaG F EDE EDC D\",\"F3 D a aG Ga h c ha G FE GFE ED \'C G GGF EDE EDC CD \'D\\nF3 a aha aG h cd cha G FE GFE ED \'E F EDC D DE G \'a\\nC1F3 h ch ha a c hah G haG G \'h c dca G F F EDC F\\nC2 a chG F \'F3 E F GGF ED EFE C \'G G GF EDE EDC D \'E F\\nF3 E D C D EFE ED \'E G ah chaG F EDE EDC D\"]', '[\"Co-man-ce-menz de dou-ce sai-son be-le,\\nque je voi re-ve-nir,\\nre-mam-bran-ce d\'a-mors qui me ra-pe-le\\ndon je ne puis par-tir,\\net la ma-viz qui co-men-ce_a tan-tir,\\net li douz sons de ruis-sel sor gra-ve-le,\\nque je voi res-clar-cir,\\nme font re-sou-ve-nir\\nde la ou tuit mi boen de-sir\\nsont et se-ront tres-q\'au fe-nir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f109.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 60, \"facsimileY\": 129, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(748, 'De bien amer grant joie atent', 'Linker 65.24', 'Gace Brulé', 'French', 'U', '14r', 1, 1, '[\"C1 G a ab a GF FGa(G) FED D\\nC DE G Ga aG \'C1 Ga chaG Ga\\nG a ab a GF FGa(G) FED DE\\nC DE G Ga aG Ga chaG Ga \'\\nC2 c d e cha G Ga F3 aGF FE\\nD a G F ED EFG FED DC\\nE \'F3 G F FGa G F EDC C\\nD EF EDC F Ga GE FE ED \",\"C1 G a ab a GF FGa(G) FED D \'C DE G Ga aG\\nC1 Ga chaG Ga \'G a ab a GF FGa(G) FED DE \'C DE G Ga aG Ga chaG Ga \'\\nC2 c d e cha G Ga F3 aGF FE \'D a G F ED EFG FED DC \'E\\nF3 G F FGa G F EDC C \'D EF EDC F Ga GE FE ED \"]', '[\"De bien a-mer grant jo-ie_a-tent,\\nque c\'est ma gre-gnor en-vi-e;\\net sa-chiez bien cer-tei-ne-ment\\nq\'A-mors ai tel sei-gno-ri-e\\nque dou-ble guer-re-don en rent\\nce-lui qui en li se fi-e;\\net cil qui d\'a-mer se re-pent\\ns\'est bien tra-vail-liez por ne-ient. \"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f35.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 124, \"facsimileY\": 2, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
