(749, 'Toz esforciez aurai chanté souvent', 'Linker 77.22', 'Gautier d\'Espinau', 'French', 'U', '14r-v', 1, 1, '[\"F2 D a a a a aG aG GF FG a\\nGGF E F GGF ED DC \'F3 F G a aGGF G\\nD a a a a aG aG GF FG a\\nGGF \'F3 E G aaG E DC F G a aGGF G\\nc h} h h aG aG GFG a \'\\nF3 D a a aG b} Gab aaG GF\\nh} c h h aG aG GFG a\\nD a \'F3 a aG b} Gab aaG GF\\na(F) G a GF GF EDC F\\nG aG GF\\na \'c h h aG aG\",\"F2 D a a a a aG aG GF FG a \'GGF E F GGF ED DC\\nF3 F G a aGGF G \'D a a a a aG aG GF FG a \'GGF\\nF3 E G aaG E DC F G a aGGF G \'c h} h h aG aG GFG a \'\\nF3 D a a aG b} Gab aaG GF \'h} c h h aG aG GFG a \'D a\\nF3 a aG b} Gab aaG GF \'a(F) G a GF GF EDC F \'G aG GF \'a\\nc h h aG aG\"]', '[\"Toz es-for-ciez au-rai chan-té sou-vent\\nsenz o-chi-son et senz a-mor ve-ra-ie,\\nmais or me do-ne_a-mors cuer et ta-lant\\net vo-len-té qu\'en-vers li me ra-tra-ie\\npor mal sof-frir lon-gue-ment\\nn\'ai soig que me re-cro-ie\\nain-ceis a-tent be-ne-ment\\nmer-ci se ja l\'au-ro-ie\\nc\'or-guil-los sert fo-le-ment\\nqui n\'a-tent\\nson bien et sa jo-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f35.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 120, \"facsimileY\": 816, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(759, 'Tout altresi con l\'aymanz deçoit', 'Linker 77.21', 'Gautier d\'Espinau', 'French', 'U', '14v-15r', 1, 1, '[\"C2b} d d dc d c cb aGF c dcb ba\\nF G GF abc b a GGa \'C1b} ba aGF Fa\\nF a ab c C2h} d e dcd ch ch aG\\na c cha aGF \'C2 a c d ch cd d\\ne a chha aGF a c d ch dca aG\\na cch aGF \'C2 G a c d ch de dc\\nd e ffe dc a c d b} GGa ba aGF \'\\nC2 F G Ga c d ea ahc h ha aG\",\"C2b} d d dc d c cb aGF c dcb ba \'F G GF abc b a GGa\\nC1b} ba aGF Fa \'F a ab c C2h} d e dcd ch ch aG \'a c cha aGF\\nC2 a c d ch cd d \'e a chha aGF a c d ch dca aG \'a cch aGF\\nC2 G a c d ch de dc \'d e ffe dc a c d b} GGa ba aGF \'\\nC2 F G Ga c d ea ahc h ha aG\"]', '[\"Tout al-tre-si con l\'a-y-manz de-çoit\\nl\'an-guil-le-te per for-ce de ver-tu\\na ma da-me tot lo mont re-te-nu\\nqui sa be-alté co-noist et a-per-çoit\\net je sui cil qui sor toz la co-noit\\net se ni truis ne mer-ci ne rai-son\\npar coi pois-se ve-nir a ga-ri-son\\nbien ait l\'a-mors qui por mal ne re-croit.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f36.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 121, \"facsimileY\": 575, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(760, 'Par son dolz comandement', 'Linker 77.12', 'Gautier d\'Espinau', 'French', 'U', '15v', 1, 1, '[\"F3 D F G aGF c dcch aGF\\nG F a c dcch aG \'C2 G\\na c d e dcd ch c\\na c b} cb aGF Ga \'C2h} hha G\\nc d c b} b c cd ffed\\nC3 e f g f \'C3b} g g+a c\\nd f e d cch aG F3 aGF\\nF a b} ccb aGa ba aGF FG\",\"F3 D F G aGF c dcch aGF \'G F a c dcch aG\\nC2 G \'a c d e dcd ch c \'a c b} cb aGF Ga\\nC2h} hha G \'c d c b} b c cd ffed \'C3 e f g f\\nC3b} g g+a c \'d f e d cch aG F3 aGF \'F a b} ccb aGa ba aGF FG\"]', '[\"Par son dolz co-man-de-ment\\nme fui al chan-ter en-pris,\\nque toz es-toi-e mar-riz\\net plains di-re_et de tor-ment\\nmais il co-vient nuit et jor\\nmoi et mon cuer senz re-tor\\na ma da-me_et a a-mor\\ntot tens es-tre_o-bei-di-ent.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f38.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 143, \"facsimileY\": 317, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(761, 'Qui que de chanter recroie', 'Linker 265.1537', 'Author of Linker 265.1537', 'French', 'U', '16r', 1, 1, '[\"C1 c d c a F GF ED C\\nC C DE F FG FE D \'\\nC1F3 c d c a F FG FED DC\\nD C D DE FG FE D \'\\nF3 F FE D c d chaG F c cd\\nC2 e d c hG a a(h)\\nc cd \'C1F3 c a F G FED C\\nC CD EFG FE D\\nD F G a c \'C1F3 d c aGF\\nG ab aG FE FG FEDC D\",\"C1 c d c a F GF ED C \'C C DE F FG FE D \'\\nC1F3 c d c a F FG FED DC \'D C D DE FG FE D \'\\nF3 F FE D c d chaG F c cd \'C2 e d c hG a a(h) \'c cd\\nC1F3 c a F G FED C \'C CD EFG FE D \'D F G a c\\nC1F3 d c aGF \'G ab aG FE FG FEDC D\"]', '[\"Qui que de chan-ter re-croi-e\\nje ne.l puis en-tre-las-sier;\\nmais plus sou-vant chan-te-roi-e\\nse ma da-me m\'a-voit chier,\\nqui m\'a mis lo di-sir-rier e.l cuer.\\nque si m\'a-fe-bloi-e.\\nBien voi k\'a-mor me des-voi-e\\nqui senz li m\'o-cit.\\nNon-ques ja nus ne me chas-tit\\nk\'en tel pei-ne me de-lit.\"]', '[\"Notes:\\nLl. 7-8: metrical irregularities alter the syllable count and the musical notation. L. 9 should count 8 syllables says it did before the corrector put in ba \'ja\').\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f39.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 57, \"facsimileY\": 512, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(762, 'Tant ai d\'amor k\'en chantant m\'estuet plaindre', 'Linker 262.7', 'Vidame de Chartres', 'French', 'U', '16v-17r', 1, 1, '[\"C2 c h c d e d c c ch aGa(G) GF \'\\nC1 c d c haG F FG aG F F EDC D\\nc h c d C2 e d \'C1 c c ch aGa GF\\nc d c aG F FG a GF F EDC CD\\nF ED \'C1b} F G G a G c b aGa GF\\nc d c a F FG aG \'F3 F F EEDC(D) D\\nFE D F G G a aG c h aGa GF\\nc d \'C1F3 c a GF FG aG GF F ED DC\\nDE FG FE ED\\nF E F \'F3 G G aG FE F G FED DC\\nDE FG FE ED\",\"C2 c h c d e d c c ch aGa(G) GF \'\\nC1 c d c haG F FG aG F F EDC D \'c h c d C2 e d\\nC1 c c ch aGa GF \'c d c aG F FG a GF F EDC CD \'F ED\\nC1b} F G G a G c b aGa GF \'c d c a F FG aG\\nF3 F F EEDC(D) D \'FE D F G G a aG c h aGa GF \'c d\\nC1F3 c a GF FG aG GF F ED DC \'DE FG FE ED \'F E F\\nF3 G G aG FE F G FED DC \'DE FG FE ED\"]', '[\"Tant ai d\'a-mor k\'en chan-tant m\'es-tuet plain-dre,\\nce m\'est a-vis, en es-tran-ge ma-nie-re;\\npor ceu cui-dai a bo-ne_a-mor a-tain-dre\\nla ou je n\'os a-voir au-tre pro-ie-re,\\net des pa-ors rest ce la mo-ie grain-dre\\nque nel sai-chent ce-le genz no-ve-lie-re\\nqui a-des font la bo-ne_o-re re-main-dre\\net les a-manz tra-ient toz jors ar-rie-re\\nde jo-ie_a-voir.\\nMer-ci, da-me, que j’ai el mont plus chie-re,\\nsenz de-ce-voir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f40.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 116, \"facsimileY\": 542.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(763, 'Ma joie premeraine', 'Linker 107.3', 'Guiot de Provins', 'French', 'U', '17r-17v', 1, 1, '[\"C1 a c ch ha hcd ch aG\\na c h a G FGaGE D\\nDE G \'F3 FG hcd ch a\\nC2 c d e f e dedc ch\\nc d G F3 a G FGaGE D \'\\nF3 F EDC DE GE FE ED\\nF EDC DE G Ga h \\nC3 d e f e d cdedh a \'\\nC2 h d G a GF FE \\nF3 F EDC DE GE FE ED\",\"C1 a c ch ha hcd ch aG \'a c h a G FGaGE D \'DE G\\nF3 FG hcd ch a \'C2 c d e f e dedc ch \'c d G F3 a G FGaGE D \'\\nF3 F EDC DE GE FE ED \'F EDC DE G Ga h  \'C3 d e f e d cdedh a \'\\nC2 h d G a GF FE  \'F3 F EDC DE GE FE ED\"]', '[\"Ma jo-ie pre-me-rai-ne\\nm\'est tor-ne-ie_en pe-san-ce;\\nlas! je ne sai por coi,\\nmais en-si me de-mei-ne\\nla fors\' et l’es-pe-ran-ce\\nk’a-mors a mis en moi.\\nSe je par bo-ne foi\\ndoi a-voir pe-ni-ten-ce,\\nde moi ne sa nul roi\\nfors quem ma mort i voi.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f41.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 90, \"facsimileY\": 709, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(764, 'An present sui', 'Linker 265.134', 'Author of Linker 265.134', 'French', 'U', '17v-18r', 1, 1, '[\"C1 G G FE F\\nD E F G\\nc h a G\\na FE \'C2 F G\\nd c ha c\\nd e dc d\\nc ha G - a \'C2 G F G\\nF G a aG G a a\\nh d c C1 h \'C2 a G GF\\na h ch ha G\",\"C1 G G FE F \'D E F G \'c h a G \'a FE\\nC2 F G \'d c ha c \'d e dc d \'c ha G - a\\nC2 G F G \'F G a aG G a a \'h d c C1 h\\nC2 a G GF \'a h ch ha G\"]', '[\"An pre-sent sui\\nde jo-ie_a-voir,\\nou por a-nui,\\ns’il m’est ju-gié.\\non-ques ne fui\\nen mon po-oir:\\nmei oil am-be-dui m’ont tre-chié\\nqui mon cuer ju-gent ce-li\\ndont il sont tuit es-ba-hi\\net so-vent moil-lié.\"]', '[\"Notes: 9.4: The syllable <i>tuit</i>, with its corresponding note <i>h</i>, its staff and a C-clef sign have been added in the right margin by the notator.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f42.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 89, \"facsimileY\": 535, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(765, 'Li plus desconfortez dou mond', 'Linker 262.5', 'Vidame de Chartres', 'French', 'U', '18r', 1, 1, '[\"C1 c cd c a F GF FE ED\\nFFE EDC CD F FG ab \'C1b} aG FED\\nc a b aG F Ga GF F\\nGF ED FE DC CD F FG \'C1 a\\nah cd ch aG ah cd ch aGF\\nFG a D F FGa GF \'C1F3 FED DC\\nC D F F FG ab aG FED\\nC GF ED D \'\\nF2 A C D FEDC F FG aah\\nC1 c dc aG GFE FG FE D\",\"C1 c cd c a F GF FE ED \'FFE EDC CD F FG ab\\nC1b} aG FED \'c a b aG F Ga GF F \'GF ED FE DC CD F FG\\nC1 a \'ah cd ch aG ah cd ch aGF \'FG a D F FGa GF\\nC1F3 FED DC \'C D F F FG ab aG FED \'C GF ED D \'\\nF2 A C D FEDC F FG aah \'C1 c dc aG GFE FG FE D\"]', '[\"Li plus des-con-for-tez dou mond\\nsui, et si chantz con en-voi-siez,\\nne ja Deus jo-ie ne me dont\\nde ce don je doi es-tre liez,\\ns’uns al-tres n’en fust en-ra-giez.\\nque ma le-al-tez me con-font;\\nor voi bien que li a-mant sont\\nmort et tra-i,\\nau guer-re-don ai fail-li\\npor ce que trop ai ser-vi.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f43\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 72, \"facsimileY\": 428, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(766, 'Ja por mal perliere gent', 'Linker 265.852', 'Author of Linker 265.852', 'French', 'U', '18v', 1, 1, '[\"C1 c ha h c d ch haGa\\nhc haG F cha G GF G\\nc ha \'C1 h c d h haGa\\nhc haG F cha G aG GF\\nb aGF \'C1b} G Ga b aGa aG\\nF Ga bc baG F GaGE F\\nG ab \'C1b} c(b) aG F Ga %h\\nc haGa F Ga h aGa aG\",\"C1 c ha h c d ch haGa \'hc haG F cha G GF G \'c ha\\nC1 h c d h haGa \'hc haG F cha G aG GF \'b aGF\\nC1b} G Ga b aGa aG \'F Ga bc baG F GaGE F \'G ab\\nC1b} c(b) aG F Ga %h \'c haGa F Ga h aGa aG\"]', '[\"Ja por mal per-lie-re gent\\nne me ten-rai de chan-ter\\ncar bien sai cer-tei-ne-ment\\nqu’il sont lié del des-tor-ber\\nmais ceu me fait plus a-mer\\nqu’il ni ont que lo par-ler\\nne droi-tu-re ne rai-son\\nfors men-çon-ge_et mes-pri-son.\"]', '[\"Notes: 1.3. The reading of the third syllable of the first line is unclear. The notator modified the first letter and added an <i>l</i> at the end of the word, changing what appears to have been <i>ia</i> into <i>tal</i> or <i>mal</l>.<br/>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f44.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 169, \"facsimileY\": 540, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(767, 'Baudoyn, il sunt dui amant', 'Linker 240.57', 'Thibaut de Champagne', 'French', 'A', '139v (148v)', 1, 1, '[\"C2 h c d d d c e dc \'\\nC2 h ch a h cha G Ga a \'\\nC2 h c d d d c e(d) dc\\nh ch \'C2 a h cha G Ga a\\na hc d(c) \'C2 ha a ah c ha\\na e e(f) ec \'C2 d e(f) ed c\\nd de d ch a h c \'C2 ha\\nG ah c d cha h \'C2 c ha\",\"C2 h c d d d c e dc \'\\nC2 h ch a h cha G Ga a \'\\nC2 h c d d d c e(d) dc \'h ch\\nC2 a h cha G Ga a \'a hc d(c)\\nC2 ha a ah c ha \'a e e(f) ec\\nC2 d e(f) ed c \'d de d ch a h c\\nC2 ha \'G ah c d cha h\\nC2 c ha\"]', '[\"Bau-du-vin, il sont dui a-mant\\nki ai-ment de kuer sans tre-cier\\nu-ne pu-ce-le de jou-vant:\\nli queus le doit mieus ga-a-nier?\\nLi uns l\'ai-me pour ses va-lours\\net pour sa kour-toi-si-e_au-si;\\nli au-tres l\'ai-me par a-mours\\npour la grant biau-té q\'est en li.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://arca.irht.cnrs.fr/iiif/135137/canvas/canvas-2538110\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://api.irht.cnrs.fr/ark:/63955/f2h3p7upoyoo/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(771, 'Souvent souspire', 'Linker 265.1638', 'Author of Linker 265.1638', 'French', 'K', '332a', 1, 1, '[\"aC1 D F F F E\\nF \'C1 G G G F\\na(h)h a h \'C1 aG E G F E D\\nD F F F E \'\\nC1 F G G G F\\nb} b a b \'C1 aG E G F E D\\nD F F FE \'C1 C DE F E D\\nD F F \'C1 FE(F) C DE F E D\\nF E D \'\\nC1 F E D\\nD F F FE C DE \'C1 F G E\\nF E D\\nF E D\\nC E \'F2 C CD F EED C\",\"aC1 D F F F E \'F\\nC1 G G G F \'a(h)h a h\\nC1 aG E G F E D \'D F F F E \'\\nC1 F G G G F \'b} b a b\\nC1 aG E G F E D \'D F F FE\\nC1 C DE F E D \'D F F\\nC1 FE(F) C DE F E D \'F E D \'\\nC1 F E D \'D F F FE C DE\\nC1 F G E \'F E D \'F E D \'C E\\nF2 C CD F EED C\"]', '[\"Sou-vent sous-pi-re\\nmon cuer plain d\'i-re\\npour la plus be-le de l\'en-pi-re;\\nsi me mar-ti-re\\nque ne l\'os di-re;\\nsou-vent mi fet plo-rer et ri-re\\ne le mi set bien es-con-di-re,\\net moi seur-touz au-tres des-pi-re,\\ndes-cri-re\\nen-ci-re\\nne por-roit nus son cors ne li-re,\\no-ci-re\\nde-fri-re\\nmi fet quant la re-mi-re.\\n\\nDex sor po-vo-ie\\nte-nir la vo-ie,\\npar quoi g\'e-us-se de li jo-ie;\\nas-sez au-ro-ie,\\nplus ne quer-ro-ie,\\ntant ne de-sir dras ne mou-no-ie.\\nDous Dex, s\'a-mor tant mi guer-ro-ie\\nquant el ne veut que je sieus so-ie;\\nle fo-ie \\nmi no-ie,\\nplus ai do-lor que cil de Tro-ie;\\nne cro-ie\\nque vo-ie\\nle jor que si-re_en so-ie.\\n\\nTant ai ser-vi-e\\nma dou-ce_a-mi-e, \\nbien croi que gen per-drai la vi-e;\\nquant je la pri-e\\nel me dit: \'vi-e!\\nFui de ci, gars, je ne t\'aim mi-e!\'\\nDouz Dex, s\'a-mor mi con-tra-li-e,\\nqui en mon cuer s\'est en-dor-mi-e,\\nn\'est mi-e\\nen vi-e\\nqui m\'en po-ïst don-ner a-ï-e;\\nm\'a-mi-e,\\nma vi-e,\\nde vous ai grant en-vi-e.\\n\\nE-le se pai-ne\\nde me-tre_en pai-ne\\nmoi tou-te lon-gue la se-mai-ne,\\nsi me de-mai-ne,\\ncom sien de-mai-ne,\\nplus est fie-re que chas-te-lai-ne;\\non-ques ne fu si be-le_e-lai-ne,\\nne n\'ot on-ques si dou-ce_a-lai-ne,\\nes-trai-ne\\nde pai-ne\\nmi fet ne-ïs au di-e mai-ne;\\nvi-lai-ne\\nn\'a vai-ne\\nqui d\'or-gueil ne soit plai-ne.\"]', '[\"Notes: Stanza V is fragmentary (only vv. 1-3: \'De m\'amie / m\'estuet retraire / quant\') and is interrupted at the end of f° 331v. The following folio contains the ending of Linker 265.186 (RS 624).\\n<br> \", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f360.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 3, \"facsimileY\": 25, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(773, 'De ramis cadunt folia', 'De ramis cadunt folia', 'Author of De ramis cadunt folia', 'Latin', 'F-Pn lat. 3719', '42r', 1, 1, '[\"C2 G c c cc a c d hh\\na h c aGG FE \'C2 G a G\\nG d e cc e d h G\\nh ha a G \'\\nC2 a c c ch a h c aG\\nF G a G\",\"C2 G c c cc a c d hh \'a h c aGG FE\\nC2 G a G \'G d e cc e d h G \'h ha a G \'\\nC2 a c c ch a h c aG \'F G a G\"]', '[\"De ra-mis ca-dunt fo-li-a,\\nnam vi-ror to-tus pe-ri-it,\\njam ca-lor li-quit om-ni-a\\net a-bi-it;\\nnam si-gna ce-li ul-ti-ma\\nsol pe-ti-it.\"]', '[\"Notes: The graphic representation of the ancient notation is not entirely accurate, as the manuscript does not use square notation. It is however useful to express a distinction between <i>punctus</i> from <i>virgae</i>, which clearly carries a rythmic information. The internal caesura (after the 4<sup>th</sup> syllable in the octosyllabic lines) and the end of the metrical verse are always marked by a double note, the second of which is a <i>virga</i>. It is safe to assume that it indicated a longer duration, rather that a pause, considering that where they mark a caesura the occur in the middle of the words.\\n<br/>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b52502489w/f93.item\", \"Plica\": false, \"custos\": \"[6,5,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 294, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 100, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(774, 'Ecce letantur omnia', 'Ecce letantur omnia', 'Author of Ecce letantur omnia', 'Latin', 'F-Pn lat. 3719', '40r', 1, 0, '[\"C1 G G a a h hah G hah\\nc a h G ha \'C1 G(F) G G\\nh c d ha h a G hah\\nG a a a a \'C1 G F GFED\\nG a h c h(a) h h aG(F)\\nG a h c(h) ha aG G G\",\"C1 G G a a h hah G hah \'c a h G ha\\nC1 G(F) G G \'h c d ha h a G hah \'G a a a a\\nC1 G F GFED \'G a h c h(a) h h aG(F) \'G a h c(h) ha aG G G\"]', '[\"Ec-ce le-tan-tur om-ni-a\\nque-que dant su-a gau-di-a,\\nex-cep-to me qui gra-ci-a \\na-mi-ce me-e ca-re-o\\nquod co-rum-dam in-vi-di-a.\\ne-ve-nit un-de do-le-o.\\n\\nA-mor a-mo-ris lan-ce-a\\nme vul-ne-ra-vit au-re-a;\\nmal-lem e-go quod plum-be-a:\\nnam sic in il-lam ar-de-o,\\nnon est ca-te-na fer-re-a\\nque me te-ne-ret la-que-o.\\n\\nEst e-qui-dem res an-xi-a,\\na-mor ple-nus mi-se-ri-a;\\nnam tunc da-te in gau-di-a\\ncum vel-le men-tis a-be-o,\\ni-tem pre-bent sus-pi-ri-a\\ncum cu-pi-ta non te-ne-o.\\n\\nA-mo-re ni-chil gra-vi-us.\\nni-chil a-mo-re le-vi-us.\\nni-chil e-o fe-li-ci-us;\\ngra-vat cor-de la-pi-de-o;\\nmu-ta-tur ex la-sci-vi-a;\\nest fe-lix cum pos-si-de-o.\\n\\nQuod sunt a-re-ne lit-to-re.\\nquod fo-li-a in ar-bo-re,\\nquod ra-mi sunt in mne-mo-re\\ntot do-lo-res sus-ti-ne-o:\\nob oc in-fir-mus cor-po-re,\\nquod anc te-ne-re ne-que-o.\\n\\nRur-sus quot sunt in e-te-re\\nas-tra, [...] quod sub a-e-re\\no-mi-nes, cre-do vi-ve-re,\\ntot vi-ci-bus con gau-de-o\\ncum pos-sum ma-ne tan-ge-re\\nquam sem-per me-nte vi-de-o.\\n\\nNul-li sit am-mi-ra-bi-le\\nquod fa-cit a-mor fe-mi-ne\\nme non ca-re-re cri-mi-ne;\\nnam sub tro-no e-te-re-o\\nnon est qui pul-cri-tu-di-ne\\nanc vin-cat cui me de-be-o.\"]', '[\"Notes: According to Spanke, <i>Marcabrustudien</i>, p. 21, this is the model for Marcabru, BdT 293.29.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b52502489w/f89.item\", \"Plica\": false, \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 85, \"facsimileY\": 337, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(783, 'De jolif cuer enamoré', 'Linker 147.1', 'Jehan de Roucy (Jehan II, comte de Roucy)', 'French', 'K', '138a', 1, 1, '[\"C2 c c h a ah d c chha\\nG \'C2 a F G Ga c haG G\\nc \'C2 c h a ah d c chha \'\\nC2 G a F G Ga c haG G\\nc \'C3 d e d f e de dc\\nc d e \'C3 c f e de dcde\\nG a \'C2 F G Ga c haG G\",\"C2 c c h a ah d c chha \'G\\nC2 a F G Ga c haG G \'c\\nC2 c h a ah d c chha \'\\nC2 G a F G Ga c haG G \'c\\nC3 d e d f e de dc \'c d e\\nC3 c f e de dcde \'G a\\nC2 F G Ga c haG G\"]', '[\"De jo-lif cuer e-na-mo-ré\\nchan-çon-ne-te con-men-ce-rai\\npour sa-voir s\'il ven-droit en gré\\nce-le dont ja ne par-ti-rai,\\nainz se-rai a sa vo-len-té\\nja tant ne mi sau-ra gre-ver\\nqu\'el ne mi truis-se_a mi ve-rai.\\n\\nQuant son gent cors et son vis cler\\net la grant biau-té re-mi-rai,\\nlors la trou-vai si a mon gré\\nque tou-te_au-tre_a-mor ou-bli-ai;\\nce ne fu pas pour ma san-té\\net si cuit bien tout mon a-é\\nlan-guir que ja ne li di-rai.\\n\\nRe-son me blas-me du-re-ment\\net dit que pas ne l\'au cre-ü\\ncar d\'a-mer si tres hau-te-ment,\\nai trop mau-ves con-seil e-ü;\\nmes Pi-tié, qui les fins a-manz\\nfet i-ri-ez liez bauz et jo-ianz,\\ndit qu\'en-cor mi se-ra ren-du.\\n\\nDa-me, se j\'aim plus hau-te-ment\\nque mes-tiers ne mi soit e-ü,\\nla grant biau-té qu\'a vous a-pent\\na si mon co-ra-g\'_e-me-ü,\\nsi vous cri mer-ci bo-ne-ment\\ncar trop re-dout vi-lai-ne gent,\\nque il ne soi-ent mes-cre-ü.\\n\\nDes o-re mes n\'est il noi-ent\\ndu de-par-tir ne du mou-voir,\\nne pour pai-ne ne pour tor-ment\\nne pour mal que mi fa-ce a-voir,\\nainz se-rai tout a li ser-vir,\\nor soit du tot a son ple-sir\\npour mer-ci a-ten-dre_et a-voir.\"]', '[\"Notes: The identity of the author, established by H. Petersen Dyggve, \'Personnages historiques figurant dans la poésie lyrique française des XII<sup>e</sup> et XIII<sup>e</sup> siècles\', [V-VI], <i>Neuphilologische Mitteilungen</i>, 37/4 (1936), 257-283, remains incertain. In K (as well as in NX), the song is atttributed to Moniot d\'Arras, but the agreement of C with T and the table of M on the attribution to \'Li quens de couci\', make this a more reliable reading.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f164.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 112, \"facsimileY\": 171, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 2, 10),
(784, 'Empereour ne roi n\'ont nul pooir', 'Linker 265.592', 'Author of Linker 265.592', 'French', 'j', '1v', 1, 1, '[\"C3 h d e(d) d c d ch(c) ha \'C3 G F\\na h c ch a G h(a)h(a) aG \'C3 G a\\nh d e(d) d c d ch(c) \'C3 ha G F\\na h c ch a G h(a)h(a) \'[C3 aG G a]\",\"C3 h d e(d) d c d ch(c) ha\\nC3 G F \'a h c ch a G h(a)h(a) aG\\nC3 G a \'h d e(d) d c d ch(c)\\nC3 ha G F \'a h c ch a G h(a)h(a)\\n[C3 aG G a]\"]', '[\"Em-pe-re-our ne roi n\'ont nul po-oir\\ndes maus ga-rir ne des a-mes sau-ver\\nfors uns tous seus et ciex vint re-che-voir\\nla mort ch\'a jus en crois par ... ... [–er]\"]', '[\"Notes: The fragment only preserves the beginning of the song, which is interrupted in the middle of line 4. The full metrical structure can be deduced from its model, Thibaut de Champagne\'s <i>Empereres ne rois n\'ont nul pooir / encontre</i> (Linker 240.24, RS 1811): 10 10 10 10 [10 7\' 7\'].\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 1067, \"facsimileY\": 1997, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(799, 'Man sach hie vuren alten herren eren phlegen', 'Litschauer I', 'Der Litschauer', 'German', 'J', '42r', 1, 1, '[\"D G a c c d c ch a c G ac\\nc c c c G G GFEFE DE\\nGac c a G aG ED EDC\\nC D C CH A G aGEFE DE\\nD G a c c d c ch a c G ac c\\nc c c c G G GFEFE DE\\nGac a G aG ED EDC\\nC D C CH A G aGEFE DE\\nE G G G GE GG\\nG G a c c d c c chaG E DC\\nE G a c c d c ch a cG ac\\nc c c c G G GFEFE DE\\nGac a G aG ED EDC\\nC D C CH A G aGEFE DE\",\"D G a c c d c ch a c G ac \'c c c c G G GFEFE DE \'Gac c a G aG ED EDC \'C D C CH A G aGEFE DE \'D G a c c d c ch a c G ac c \'c c c c G G GFEFE DE \'Gac a G aG ED EDC \'C D C CH A G aGEFE DE \'E G G G GE GG \'G G a c c d c c chaG E DC \'E G a c c d c ch a cG ac \'c c c c G G GFEFE DE \'Gac a G aG ED EDC \'C D C CH A G aGEFE DE\"]', '[\"Man sach hie vuͦren die al-ten her-ren e-ren phlegen\\nvnd dar tzv̊ ho-er wer-di-cheit\\nnv ist her-ren e-re leit\\nan e-ren wil-ich sie vuͦr-tzagen.\\nDie ivn-gen her-ren ha-ben e-ren sich ir we-gen\\nsie mẏn-net vuͦr die ere daz guͦt\\nswelich her-re hat den mv̊t\\nder kan nicht gan-zen pris be_ia-gen.\\nGot sel-be daz ge-bot\\ndaz ed-ele her-ren sol-ten e-re mẏn-nen.\\ndes mv̊ch-ten wi-se her-ren sich vuͦr sẏn-nen\\ndaz her-ren e-re wol an-stat\\nSwelich her-re e-re hat\\nder her-re sich wol vreu-wen mac.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
