(801, 'Het ich al der werlde hulde', 'J117', 'Hermann Damen', '', 'J', '117v', 1, 1, '[\"f e d f c ab c ba\\nc G aG F a c dc\\nf e d f c ab c ba\\nc G aG F a c dc\\nF F b a G a GFE GF F\\n+a g d f c ab c ba\\nc G aG F a c dc c\",\"f e d f c ab c ba \'c G aG F a c dc \'f e d f c ab c ba \'c G aG F a c dc \'F F b a G a GFE GF F \'+a g d f c ab c ba \'c G aG F a c dc c\"]', '[\"Het ich al der wer-de hul-de\\nSo wer ich eyn fa-lich man\\nGot vur geb ym sy-ne schul-de\\nder my sel-den teyl vur gan\\nIch werz yr vil der sw-achen tza-gen\\ndie die bi-derben ym-mer ny-den\\nunde daz bos-te von yn sa-gen\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(802, 'Ave, Princeps celestis curie', 'Anderson L173', 'Adam de la Bassée', 'Latin', 'F-Lm 397', '21r', 1, 1, '[\"C2 cha h c c d c ha G a hG(a)G\\nc(_h) \'C1 a _haG FE F G E F E D \'\\nC2 cha h c c d c ha G a hG-G\\nb} c(b) a baG \'C2 FE F G F F E D\\nE F G G \'C2 a h c c h cha-a\\na h c d e d \'C2 c a c chGG\\nc(h) a haG FE F G F FED \'C1 F FED-C\\nE F G G a h c(h) a G FED-C \'\\nC1 E F G G a h c(h) a G haaG-a\",\"C2 cha h c c d c ha G a hG(a)G \'c(_h)\\nC1 a _haG FE F G E F E D \'\\nC2 cha h c c d c ha G a hG-G \'b} c(b) a baG\\nC2 FE F G F F E D \'E F G G\\nC2 a h c c h cha-a \'a h c d e d\\nC2 c a c chGG \'c(h) a haG FE F G F FED\\nC1 F FED-C \'E F G G a h c(h) a G FED-C \'\\nC1 E F G G a h c(h) a G haaG-a\"]', '[\"A-ve, prin-ceps ce-les-tis cu-ri-e,\\nqui trans-mis-sus ad sa-cram Vir-gi-nem,\\nnun-ci-as-ti quod ple-na gra-ci-e\\npar-tu-ri-ret De-um et ho-mi-nem;\\ncon-tur-ba-te se-dans for-mi-di-nem\\ngau-di-o-sa ver-bo-rum se-ri-e,\\nas-se-ren-do quod vi-ri ne-sci-e\\no-bum-bra-ret vir-tus Al-tis-si-mi,\\nar-cham lo-ci fe-con-dans in-ti-mi.\\n\\nIl-lum er-go qui in tri-cli-ni-o\\nvir-gi-na-li car-nis ci-li-ci-um\\nnos-tre sum-psit, ex-ple-to nun-ti-o,\\nve-rum De-i sci-li-cet Fi-li-um,\\nde-pre-ca-re ut post ex-si-li-um.\\npre-sens fru-ar e-jus con-sor-ti-o,\\nqui re-cum-bens in ster-qui-li-ni-o\\ntes-ta ra-sit mem-bro-rum ul-ce-ra,\\nbe-ne-di-cens re-gen-tem e-the-ra.\"]', '[\"\", \"\"]', '{\"Link\": \"https://bvmm.irht.cnrs.fr/includes/php/rotation.php?vueId=1944454&niveauZoom=moyen&angle=0\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 17, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 2, 10),
(803, 'Got in vier elementen sich erscheinet', 'Rumelant von Sachsen, Ton I', 'Rumelant von Sachsen', '', 'J', '47v', 1, 1, '[\"C3 e f g +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd dc db c abaG C2 GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\ne f C3 g +a g fed \'\\nc d e a \'\\ne f g +a g f e C2 ef \'\\nd dc db c abaG GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\na c c dc ba b aG Ga baG aG G \'\\naG F G a ab c baG F G ba a \'\\na c c dc ba b aG Ga baG aG G \'\\na F G a ab c baG F G ba a \'\\nC3 e f g C4 +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd C2 dc db c abaG GF \'\\nG aGF G ab ca baG c c d a cba\",\"C3 e f g +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd dc db c abaG C2 GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\ne f C3 g +a g fed \'\\nc d e a \'\\ne f g +a g f e C2 ef \'\\nd dc db c abaG GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\na c c dc ba b aG Ga baG aG G \'\\naG F G a ab c baG F G ba a \'\\na c c dc ba b aG Ga baG aG G \'\\na F G a ab c baG F G ba a \'\\nC3 e f g C4 +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd C2 dc db c abaG GF \'\\nG aGF G ab ca baG c c d a cba\"]', '[\"Got in vier ele-men-ten\\nsich er-scheẏ-net.\\nob wir den nicht recht ir ken-ten\\nder vns hat ge-reẏ-net.\\nal-ler svn-den smit-ten.\\nwosch vns abe sẏn bluͦt.\\nSẏn vleisch wart durch sto-chen.\\nsam div er-de.\\ndie mẏt phluͦ-gen wirt tzv̊-bro-chen.\\ndar nach der vil wer-de.\\nan dem kru-tze mit-ten\\nhienc sẏn vrucht ist guͦt.\\nDer vns sind vleis-lich erde in a-cker brach-te.\\ntzv̊ sate er wart ge-phluͦ-get in der mar-ter.\\nDo er men-sli-che bruͦ-di-cheit be-dach-te.\\ndo wart men-scheit ẏm tru-ter vn-de tzar-ter.\\nNu kumpt sẏn er-bar-men\\nvns tzv̊ tro-ste.\\nsit daz er die vreu-den ar-men\\ngue-dich-liche ir-lo-ste.\\nvon des tiv-bels kẏ-ten vz der hel-le gluͦt.\\n\\nWer kan daz be-gri-fen\\nal mit sẏn-ne.\\nwie man twin-get in den phi-fen\\nluft daz sie ge-wẏn-ne.\\nsuͦ-zer dho-ne scel-le.\\nkref-tich vn-de lut\\nVon sich sel-ben kvn-de\\nluft nicht brẏn-gen.\\nal-so guͦ-ter dho-ne vunde\\ndes mv̊z man sie twẏn-gen.\\nstei-get vn-de vel-le\\nda von wirt sie trut\\nSam ist vns got nv hert-ze-li-chen tru-ter.\\nsit daz die luft in sẏ-nes hert-zen grvn-de\\nBe-twuͦn-gen wart so reẏ-ne suͦ-ze lu-ter\\nder luf-te galm ir-schẏn ẏm vz dem mvn-de\\nDo des krut-zes vur-ste.\\nsprach die me-re.\\nJa-mer-liche daz ẏm dor-ste.\\nvnd_ez vol-ko-men we-re.\\nher brachte vz der hel-le mani-ger sel-le brut.\\n\\nVivr ist nicht so kref-tich\\nheiz al-eẏ-ne.\\ne. sin mar-tẏr ẏm tzv̊ scef-tich wert.\\nwẏ-e man daz meẏ-ne.\\ndes ist vn-ge-le-ret.\\nmani-ger han-de man\\nMit den bla-se-bal-gen.\\nwirt ge-pẏ-net.\\nvivr daz_ez mv̊z vuͦr wẏn-de wal-gen.\\ndaz sẏn gluͦte ir schẏ-net.\\nkref-te-li-chen me-ret.\\nwirt sẏn hit-ze dan\\nAl-so wart go-tes bar-mic-heit ge-bla-sen.\\nvil mani-ges iu-den bal-ges ad-hem an-spite\\nDẏn lib do er vnt-fienc vil mar-ter ma-sen.\\nda von sẏn lob er-klẏn-get al-so wi-te\\nDv sẏn gna-den guͦ-te\\nheẏ-zer brẏn-net.\\nin der wa-ren mẏn-ne gluͦ-te.\\nher div men-scheit mẏn-net.\\ndes sẏ got ge-e-ret der daz al-lez kan.\\n\\nWaz-zer hat na-tiv-re\\nkalt ge-stel-let.\\nman be-twin-get ez mẏt viu-re.\\ndaz sẏn walm er-wel-let.\\ndaz eẏn ro-e spi-se.\\nwirt ge-ma-chet gar\\nSvn-der twẏn-gen su-det\\nwaz-zer sel-ten.\\nswer mich des mẏt kvnst vuͦr gu-det.\\ndes mv̊z ich vnt-gel-ten.\\nob ich daz be-wi-se.\\ndes wirt man ge-war\\nGot ist ge-lich dem wazzer in dẏ-sen sa-chen.\\nE. wesen-der got starc e. her men-sche wor-de\\nIst waz-zer starch daz mac man star-cher ma-chen.\\nsam tete sich got mẏt sẏ-ner men-schen bor-de\\nKris-tes ou-gen waz-zer.\\nsot in wal-me.\\nwart sẏn men-scheit vreu-den laz-zer.\\nin des to-des qual-me.\\ndes stet her tzv̊ pri-sende mẏs-se-wen-de bar.\\n\\n\\n\\n\"]', '[\"\\n\\n\\n\\nRasur bei Z. 5 ca, vorher fälschlich cha, d.h. die folgende Neumenfigur\\nNach Z. 5 Strich auch in Notensystem\\nZ. 10 anzunehmen b\\nNach Z. 10 nicht nach Z. 11 Strich (nicht analog zu Z. 5)\\nNach Z. 12 Strich\\nZ. 20 c rasiert; versehentliche Doppelung oder versehentlich auf zu elidierender Silbe platziert\\nZ. 21 Rasur: a h -> c c\\n\\nStr. 2 vnde lut: Punkt rasiert?\\nSele bruͦt -> brut Rasur\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 0, 31),
(804, 'Swa sich die tugent irbivtet', 'Frauenlob Ton V (Flugton)', 'Heinrich von Meißen (Frauenlob)', '', 'J', '106v', 0, 1, '[\"F2 G G G baG F C1 G G \'G b c d b c baG G \'c G FED EC \'C F F2 E F G G a G GFE FED \'G aGECH AH C \'G G G baG F G C1 G \'G b c d(c) b c baG G \'c G FED EC \'C F E F G F2 G a G GFE FED \'G aGECH AH C \'C D D FED C D D \'D E F G EC EF G \'G C1 h c d hc ha aG \'GF E F G EF ED DC \'F2 D C CH CD \'D F E F G G GFGa G GFE FED \'G aGECH AH C\",\"F2 G G G baG F C1 G G\\nG b c d b c baG G\\nc G FED EC\\nC F F2 E F G G a G GFE FED\\nG aGECH AH C\\nG G G baG F G C1 G\\nG b c d(c) b c baG G\\nc G FED EC\\nC F E F G F2 G a G GFE FED\\nG aGECH AH C\\nC D D FED C D D\\nD E F G EC EF G\\nG C1 h c d hc ha aG\\nGF E F G EF ED DC\\nF2 D C CH CD\\nD F E F G G GFGa G GFE FED\\nG aGECH AH C\"]', '[\"Swa sich die tugent ir-biv-tet.\\nda kumt sie mit vuͦr-mez-zen-heit.\\nder sel-den kleyt.\\ntreit sie mẏt it vil gar an vn-der-scheit.\\ndiz wiz-ze diet.\\nUn-pris-lich tat sie riv-tet.\\nvz tru-wen her-tzen mẏt ir rat.\\nIr ho-ez phat.\\nmit melde an rich-er vnd an ar-mer wat.\\nsich nẏe vuͦr-schriet.\\nDer tugent ist als dem viv-re.\\ndem of-te we-re tiv-re.\\nsẏn mel-den vn-ge-hiu-re.\\nniur daz der rouch sẏn stiv-re.\\nTuͦt of-fen-bar.\\nsus tuͦt die tigent mẏt mel-de-ri-cher tat.\\nir mel-den kar.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true}', 0, 31),
(805, 'Wer kante gotes krefte', 'Frauenlob Ton III (Grüner Ton)', 'Heinrich von Meißen (Frauenlob)', '', 'J', '108r', 1, 1, '[\"a a a a a aGF \\nF G F G a D FED CD \\nD E ED DE a a a \\na aG F aG FE C D D \\nF G F FG a D GFEDC DF \\nF G a chaFED E C E Ga GF Ga \\na a a a a a a aGF \\nF G F G a D FED CD \\nF G F FG a a a  \\na aG GF aG FED C D D \\nF G F FG a D GFEDC DF \\nF G a chaFED E C E Ga GF Ga \\na c d e c d cha \\na h c d h c a GFE \\nF G GF FG a D D \\nD F D ED C D D \\nD F F G GF G GF Ga \\na h c aG F a GFEDC DF \\nF G a chaFED E C E Ga GF Ga a\",\"a a a a a aGF  \'F G F G a D FED CD  \'D E ED DE a a a  \'a aG F aG FE C D D  \'F G F FG a D GFEDC DF  \'F G a chaFED E C E Ga GF Ga  \'a a a a a a a aGF  \'F G F G a D FED CD  \'F G F FG a a a  \'a aG GF aG FED C D D  \'F G F FG a D GFEDC DF  \'F G a chaFED E C E Ga GF Ga  \'a c d e c d cha  \'a h c d h c a GFE  \'F G GF FG a D D  \'D F D ED C D D  \'D F F G GF G GF Ga  \'a h c aG F a GFEDC DF  \'F G a chaFED E C E Ga GF Ga a\"]', '[\"Wer kante go-tes kref-te\\ndo er was in des va-ter gheist\\nnivr e-wi-cheit al-eẏ-ne\\nkant ẏn vnde sẏ-ner kraft vol-leist\\nal da keẏn men-sche vuͦr baz mac\\nwer kan wer tar wer sol wist man ez wol\\nWa wo-net na-tiur in hef-te\\nsẏnt sie_al-ler din-ge wal-te hat\\nmit got durch got in go-te\\nsie tẏr-met waz er tẏr-men lat\\nvz sẏ-me bote quam sie nẏe tac\\nsie was nẏvr eẏn des mv̊ste sie li-dhen dol\\nWen got sie bestvnt selb-vier-de\\ner eẏn vnd ouch sẏn e-wi-cheit\\nvnde sẏn ma-ie-stas wir-de\\ndar tzv̊ so half div reẏ-ne\\nMa-ri-a vlei-sches blei-che vrẏ\\nsie spielt vz eẏn per-so-nen drẏ\\nviere mv̊ch-ten me den na-tivre al-ters eẏ-ne\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"