(806, 'Lob aller engel unde lob der rechten kristenhet', 'J Stolle 1', 'Stolle', 'German', 'J', 'fol. 2r-2v', 1, 1, '[\"C2 c c e e e e d dc c \'C2 c c d dcha c\\ne e e \'C2 e e e d dc c c(h) a \'C2 c(h) ca Ga\\na a c c c d \'C2 dcha GF\\nF G a a c a F a baG \'C2 GF F\\nc c e e e e d \'C2 d dc c c c d dcha cc\\nc \'C2 e e e e e(d) d dc c(h) a c \'C2 ca Ga\\na a c c c d dcha \'C2 GF\\nF G a a c a(G) F a \'C2 baG GF F\\na a a aGF a c c\\nc \'C2 c d ch a G a h c haG a\\na \'C2 a a aGF a c c\\nc d f f \'C3 g f e f(e) d ca cd ca \'C1 a GF\\nF F G a c a G \'C1 F F G F a GF FED\\nF D \'C1 F G FE D F F/ F G a \'C1 a c a F a baG G\",\"C2 c c e e e e d dc c\\nC2 c c d dcha c \'e e e\\nC2 e e e d dc c c(h) a\\nC2 c(h) ca Ga \'a a c c c d\\nC2 dcha GF \'F G a a c a F a baG\\nC2 GF F \'c c e e e e d\\nC2 d dc c c c d dcha cc \'c\\nC2 e e e e e(d) d dc c(h) a c\\nC2 ca Ga \'a a c c c d dcha\\nC2 GF \'F G a a c a(G) F a\\nC2 baG GF F \'a a a aGF a c c \'c\\nC2 c d ch a G a h c haG a \'a\\nC2 a a aGF a c c \'c d f f\\nC3 g f e f(e) d ca cd ca\\nC1 a GF \'F F G a c a G\\nC1 F F G F a GF FED \'F D\\nC1 F G FE D F F/ F G a\\nC1 a c a F a baG G\"]', '[\"Lob al-ler en-gel vn-de lob der rech-ten kris-ten het.\\nVnd wer daz lob mit rech-ter vuͦge. Tzv̊ eẏ-me lobe ge-leit.\\nDen-noch wer sie me lobes ge-wert.\\ndie suͦ-ze mv̊-ter vn-de ma-get rey-ne.\\nDie krist ge-bar vnd wer die ge-buͦrt so were wir gar vur lorn.\\nSit daz sie got ym sel-ben tzv̊ mv̊-ter hat ir korn.\\nSwer an sie rech-ter gna-den gert.\\nDer wizzẹ daz ym ir hul-fe ist ge-mey-ne.\\nAl-ler svn-der tros-ter-yn.\\ntzv̊ hy-mel-ri-che wer-de kv-nin-gyn-ne.\\nSter-ke vrou-we vn-sen sin.\\nkris-tes mv̊-ter reẏ-ne maget helf vns der wa-ren myn-ne.\\nLa vns der lobe ge-nye-zen die man hat von dir ge-seit.\\nDie tiv-rent vn-de pri-sent wol. Got hat vil tivr-ren pris an dich ge-leit.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 1, 31),
(809, 'Leals amors q\'est dedanz fin cuer mise', 'Linker 217.1', 'Renaut de Beaujeu', 'French', 'U', '19r', 1, 1, '[\"C2 F G a h h h ha aG ahc hha aG\\na h haG \'C2 a a G ahc h ha aG\\nF G a h h h ha aG ahc hha \'C2 aG\\na h haG a a G ahc h ha aG\\nh c d hG \'C2 h d de d dc hah\\nahc h haG GF a G h \'C2 c ddc ha ah\\nahc h haG GF a G ahc h ha aG\",\"C2 F G a h h h ha aG ahc hha aG \'a h haG\\nC2 a a G ahc h ha aG \'F G a h h h ha aG ahc hha\\nC2 aG \'a h haG a a G ahc h ha aG \'h c d hG\\nC2 h d de d dc hah \'ahc h haG GF a G h\\nC2 c ddc ha ah \'ahc h haG GF a G ahc h ha aG\"]', '[\"Le-als a-mors q\'est de-danz fin cuer mi-se\\nne s\'en doit mais par-tir ne re-mo-voir\\net la do-lors qui des-traint et jus-ti-se\\nsem-ble dou-çors cant on la puet a-voir;\\nnus biens d\'a-mors ne puet pe-tit va-loir\\nainz sont tuit douz qant on les ai-me_et pri-se\\nce doit chas-cuns bien en-ten-dre_et sa-voir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f45.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 86, \"facsimileY\": 381, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 1, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(810, 'A vos, Amors, plus q\'a nule autre gent', 'Linker 38.1', 'Chastelain de Coucy', 'French', 'U', '19v', 1, 1, '[\"C1b} a b b baG a aG ab c baG abaG\\nb b b \'C1b} bc b baG F G h} Gah chaG aG\\nb} b b b baG a aG ab \'C1h} c haG ahaG\\nb} b b b bc b b aGF G Gab cbaG abaG\\nh} h c \'C1 d ch c d c h ha haGFG aG\\nb} b b b ba \'C1b} b c a b aG a\\na h} h c d C2 e d c hc \'C1 h} haG GF\\nF G a h c a dhaGF G a aG\",\"C1b} a b b baG a aG ab c baG abaG \'b b b\\nC1b} bc b baG F G h} Gah chaG aG \'b} b b b baG a aG ab\\nC1h} c haG ahaG \'b} b b b bc b b aGF G Gab cbaG abaG \'h} h c\\nC1 d ch c d c h ha haGFG aG \'b} b b b ba\\nC1b} b c a b aG a \'a h} h c d C2 e d c hc\\nC1 h} haG GF \'F G a h c a dhaGF G a aG\"]', '[\"A vos, A-mors, plus q\'a nu-le_au-tre gent\\nest bien rai-sons que ma do-lor com-plai-gne\\ncar il m\'es-tuet par-tir ou-tre-ie-ment\\net des-seu-rer de ma dol-ce com-pai-gne;\\net qant li perz n\'aim rien qui me re-mai-gne\\net sa-chiez bien a-mors se-u-re-ment\\nsainz nus mo-ront por a-voir cuer do-lant\\nia-mais per moi n\'ier chan-tez vers ne lais.\"]', '[\"Notes: the natural signs on 2.9, 3.8, 5.1, 7.2, 7.9 and the flat accidental at 3.1 are added by the hand of the corrector.\\nThe additional accidentals create noticeable inconstistencies in the melodic phrases repeated on l. 1 and 3, and 2 and 4.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f46.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 261, \"facsimileY\": 511, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 1, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 160, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysIn