(811, 'Tant con je fusse fors de ma contreie', 'Linker 262.8', 'Vidame de Chartres', 'French', 'U', '22v', 1, 1, '[\"C1 c h h a G F G(F) G a cha aG(F)\\nED EC D D D E \'C1 F E ED DC\\nc h ch aG a GE GE G a cha aG(F)\\nED E C D D \'C1 E F E ED DC\\nFED D E G a GF a c h aGF G\\nc d \'C1 d ha G F a h G GFEDE\\nC D C DE D E F G EC DEFED E\",\"C1 c h h a G F G(F) G a cha aG(F) \'ED EC D D D E\\nC1 F E ED DC \'c h ch aG a GE GE G a cha aG(F) \'ED E C D D\\nC1 E F E ED DC \'FED D E G a GF a c h aGF G \'c d\\nC1 d ha G F a h G GFEDE \'C D C DE D E F G EC DEFED E\"]', '[\"Tant con je fus-se fors de ma con-tre-ie\\nne de-üst pas a moi joi-e ve-nir,\\net qant es-loig ce-le c\'ai tant a-mé-e\\nne cuit que ja la doi-e re-ve-nir.\\nDeus, iert il ja que la tie-ngne_en ce-lé-ie\\nen-tre mes braz nu et nu en un lit!\\nO-ïl, s\'a-mors vuet  que j\'ai-e du-ré-ie.\"]', '[\"Notes: The melody is not notated by the main musical scribe, but by a secondary, less carefull hand.\\n 7.4: unclear reading.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f52.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 183, \"facsimileY\": 690, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(812, 'Tant de solaz come j\'ai par chanter', 'Linker 65.76', 'Gace Brulé', 'French', 'U', '25r', 1, 1, '[\"C1 a a aGa GF FG a h} ah cd cch aGF\\nFG b} ab aG GFE \'C1 F EDC CD EFG FE ED\\na a aGa GF FG a h} ah cd ch aGF \'\\nC1b} FG ab aaG GFE GF EDC CD EFG FE ED\\nE G E FFEC C \'C1 D C DE GF ED DC\\nC D E G a GF EDC DE GF EDC CD\\na a \'C1 ha aG d cch aGF G a GFFG a\\nahc aab aG FED C DC DE Ga GF EDC CD\",\"C1 a a aGa GF FG a h} ah cd cch aGF \'FG b} ab aG GFE\\nC1 F EDC CD EFG FE ED \'a a aGa GF FG a h} ah cd ch aGF \'\\nC1b} FG ab aaG GFE GF EDC CD EFG FE ED \'E G E FFEC C\\nC1 D C DE GF ED DC \'C D E G a GF EDC DE GF EDC CD \'a a\\nC1 ha aG d cch aGF G a GFFG a \'ahc aab aG FED C DC DE Ga GF EDC CD\"]', '[\"Tant de so-laz co-me j\'ai par chan-ter,\\nda-me, m\'es-tuet et guer-pir et las-sier;\\nqant je ne puis en vos mer-ci trou-ver,\\nmolt co-ven-dra mes chan-çon em-pi-rier.\\nPor ce lo las que jo-ie m\'est fail-li-e\\nqant en vos n\'ai a-ten-te ne fï-an-ce,\\nne ja d\'ail-lors ne quier a-voir a-ï-e:\\ntot ai per-du, con-fort et es-pe-ran-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f57.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 81, \"facsimileY\": 373, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(813, 'Qui bien vuet amors descrivre', 'Linker 231.9', 'Robert de Reins', 'French', 'U', '37r', 1, 1, '[\"C2 h c d d e c dcha a\\nh c d haG F a GahG G \'\\nC2 h c d d e c dcha a\\nh c d haG F a GahG G\\ne f e \'C2 d e f e d\\ne f ed ed c ch a a\\nh c h h a \'C2 aG a a\\nh c d chaG GF a Gahch haG\",\"C2 h c d d e c dcha a \'h c d haG F a GahG G \'\\nC2 h c d d e c dcha a \'h c d haG F a GahG G \'e f e\\nC2 d e f e d \'e f ed ed c ch a a \'h c h h a\\nC2 aG a a \'h c d chaG GF a Gahch haG\"]', '[\"Qui bien vuet a-mors des-criv-re?\\nA-mors est et ma-le_et bo-ne;\\nlo pluz me-su-ra-ble_e-ni-vre\\net lo pluz sa-ge_a-bri-co-ne;\\nles em-pri-so-nez de-li-vre,\\nles de-liv-rez em-pri-so-ne;\\nchan-cun fait mo-rir et vi-vre\\net a chas-cun tot et do-ne.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f81.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 86, \"facsimileY\": 22, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(814, 'Novele amors dont granz peine m\'est néie', 'Linker 265.1213', 'Author of Linker 265.1213', 'French', 'U', '37r-v', 1, 1, '[\"C3F3C1b} G a b c c c b a bc baG aba-aG\\nbc ba \'C1b} G F E D C E F G\\nbc a G F E \'F3 D C E F D\\nD E F G a G F E D \'F2 C DED-DC\\nD E E EDC D E F F F EDCD F\\nF F G F \'? ? ? ? ? ?\\n? ? ? ? ? ? ? ? ? \'? ? ?\",\"C3F3C1b} G a b c c c b a bc baG aba-aG \'bc ba\\nC1b} G F E D C E F G \'bc a G F E\\nF3 D C E F D \'D E F G a G F E D\\nF2 C DED-DC \'D E E EDC D E F F F EDCD F \'F F G F\\n? ? ? ? ? ? \'? ? ? ? ? ? ? ? ?\\n? ? ?\"]', '[\"No-ve-le_a-mors dont granz pei-ne m\'est né-ie\\nme fait chan-tant des-couv-rir mon vo-loir;\\nmais li chan-ters ne mi puet riens ai-dier\\na ma do-lor, qui chas-cun jor em-pi-re.\\ncar a-mors est de si ma-le ma-nie-re\\ncom qui la tri-che_en fait tot son vo-loir\\net cil lan-guist qui a bo-ne_es-pe-ran-ce.\"]', '[\"Notes: 1.10-10\': The distribution of the notes on the syllables is unclear.\\n6.5-7.10\': The music on 37v (from 6.5 to the end of the piece) has not been copied.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f81.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(815, 'Dame j\'atent en bon espoir', 'Linker 265.414', 'Author of Linker 265.414', 'French', 'U', '38r', 1, 1, '[\"C1 F G a aGF ahc haGF Ga h\\nha GF G aG ahc ha aG \'C1 G\\nF G a aGF ahc haGF Ga h\\nha GF G aG ahc hha aG G \'\\nC2 h c d ch d edc ha h\\nh h ha Ga h ch aGa h\\nh \'C2 c d dh d edc h aGa\\na GF G aG ahc ha aG G\",\"C1 F G a aGF ahc haGF Ga h \'ha GF G aG ahc ha aG\\nC1 G \'F G a aGF ahc haGF Ga h \'ha GF G aG ahc hha aG G \'\\nC2 h c d ch d edc ha h \'h h ha Ga h ch aGa h \'h\\nC2 c d dh d edc h aGa \'a GF G aG ahc ha aG G\"]', '[\"Da-me j\'a-tent en bon es-poir\\nvos-tre_a-mor ou j\'a[i] mon pan-ser,\\nne de ce ne me quier mou-voir\\nne de vos-tre ser-vi-se_os-ter,\\nainz pri a Deu et faz sa-voir\\nqu\'il me vuel-le ci a-tor-neir\\ntoz au-tres biens que doi a-voir,\\nja plus ne l\'en quier de-man-der.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f83.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 90, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(816, 'Qant li rosignols s\'escrie qui nos desduit', 'Linker 265.1465', 'Author of Linker 265.1465', 'French', 'U', '39v', 1, 1, '[\"C2 G h c d d e d c\\nf e e d ha c d-d \'\\nC2 G h c d c e d c\\nf e ed c ha c dd\\nh d \'C2 dc a ha G aG F\\na a G c haG F G\\nh d \'C2 dc a ha G aG F\\na a G c haG GF G\",\"C2 G h c d d e d c \'f e e d ha c d-d \'\\nC2 G h c d c e d c \'f e ed c ha c dd \'h d\\nC2 dc a ha G aG F \'a a G c haG F G \'h d\\nC2 dc a ha G aG F \'a a G c haG GF G\"]', '[\"Qant li ro-si-gnols s\'es-cri-e\\nqui nos des-duit de son chant,\\npor ma be-le dol-ce_a-mi-e\\nvois mon cuer ro-si-gno-lant.\\njoin-tes mains mer-ci li cri-e,\\ncar on-ques rien n\'a-mai tant;\\net bien sai s\'e-le m\'ob-li-e\\nque jo-ie me va fi-nant.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f86.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 114, \"facsimileY\": 319, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(817, 'En aventure comanz', 'Linker 38.5', 'Chastelain de Coucy', 'French', 'U', '39v-40r', 1, 1, '[\"C3 d e f g+a g fg fed\\nh ha G Ga c de fed \'\\nC3 d e f g+a g fg fed\\nh ha G G(a) c de fed \'\\nC3 e g e fe dc cde cha\\nh d c a cd def gfed\\nd \'C3 dc d f g +a g\\n+a g d ed h d haG G\\nc h a h \'C2 Ga cd cha haG\",\"C3 d e f g+a g fg fed \'h ha G Ga c de fed \'\\nC3 d e f g+a g fg fed \'h ha G G(a) c de fed \'\\nC3 e g e fe dc cde cha \'h d c a cd def gfed \'d\\nC3 dc d f g +a g \'+a g d ed h d haG G \'c h a h\\nC2 Ga cd cha haG\"]', '[\"En a-ven-tu-re co-manz\\nma dar-ra-ie-ne chan-çon,\\nsi ne sui liez ne do-lanz\\nne ne sai se vif ou non\\nou se j’ai trop ou rai-son\\nou se j’aim ou c’est ne-ienz,\\nmais i-tex est mes ta-lenz\\nque senz nu-le re-pen-tan-ce\\npens a la mel-lor de Fran-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f86.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 108, \"facsimileY\": 734.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(818, 'Tant ai en chantant proié', 'Linker 24.23', 'Blondel de Nesles', 'French', 'U', '40r', 1, 1, '[\"C2 f fe edc de dc ch haG\\na b aG GF Ga \'C2 a_hc_h _ha aG\\nf fe edc de dc hc haG\\nb} a b aG GF Ga \'C2 a_hc_h _ha aGa\\nb} c d dcb cd defe edc c\\nC3 g g gf edc \'C2 cde dc ch aG\\nF G a h G d c dcha h cd\\nfgfed c \'C1b} a bc(b) aG GF Ga C2b} cb d edc\",\"C2 f fe edc de dc ch haG \'a b aG GF Ga\\nC2 a_hc_h _ha aG \'f fe edc de dc hc haG \'b} a b aG GF Ga\\nC2 a_hc_h _ha aGa \'b} c d dcb cd defe edc c \'C3 g g gf edc\\nC2 cde dc ch aG \'F G a h G d c dcha h cd \'fgfed c\\nC1b} a bc(b) aG GF Ga C2b} cb d edc\"]', '[\"Tant ai en chan-tant pro-ié\\nque bien por-roit mais re-ma-noir,\\nqant de moi n’en at pi-tié\\nce-le qui bien seit mon vo-loir;\\nlas n’en puis a-voir con-gié,\\nc\'a fi-ne_a-mor mai ou-tro-ié,\\ntant com j’au-rai sens et for-ce_et po-oir,\\nne las-se-rai mon chant ne s’a-mis-tié.\"]', '[\"Notes.\\n2.6-7 and 4.6-7: the accidentals are not explicit since the key-signature is not renewd after the manuscript line breaks. However, the fact that they are renewed at the beginning of the metrical lline at l. 2, 4 and 5, suggests that the model intended the key to affect the entire musical phrase.\\n8. 5-6: the text scribe copied the words \'mon chant\' twice. The repetition was correctly skipped by the notator.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f87.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 91, \"facsimileY\": 572.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFl