(819, 'Eyn wunder in der werlde vert', 'J WAlex 4', 'Der Wilde Alexander', 'Middle High German', 'J', 'fol. 22r', 1, 1, '[\"C2 a h c d ch cd cha \'C2 Ga\\nc cha a aGF FGa GFED \'C1 CD\\nC D F F FG a \'C1 GFED\\na h c d ch cd cha Ga \'\\nC1 c cha a aGF FGa GFED CD \'\\nC1 C D F F FG a GFED \'\\nC1 D F FED F F G abaG a\\na \'C2 h c d d fed cdcba Ga C1\\nD \'C1 F FED F FGa a GFEFG FED \'\\nC1 D F FED F F G abaG a\\na \'C2 h c d d fed cdcba Ga C1\\nD F FED \'C1 F FGa a GFEFG FED D\",\"C2 a h c d ch cd cha\\nC2 Ga \'c cha a aGF FGa GFED\\nC1 CD \'C D F F FG a\\nC1 GFED \'a h c d ch cd cha Ga \'\\nC1 c cha a aGF FGa GFED CD \'\\nC1 C D F F FG a GFED \'\\nC1 D F FED F F G abaG a \'a\\nC2 h c d d fed cdcba Ga C1 \'D\\nC1 F FED F FGa a GFEFG FED \'\\nC1 D F FED F F G abaG a \'a\\nC2 h c d d fed cdcba Ga C1 \'D F FED\\nC1 F FGa a GFEFG FED D\"]', '[\"Eyn wun-der in der werl-de vert.\\nDaz sich al-len tugen-den wert.\\nVals-lich leben ist sin ge-lvst.\\nVvan ez hat der sy-re-nen sanc.\\npha-wen varwe. vnd ha-sen wanc.\\nScha-fes houbet. vnd vox-ses brust.\\nVn-sel-de wirt ym nym-mer buͦz.\\nSin wolp-lich li bhat hen-nen vuͦz.\\nSyn ke-mels rucke hat na-te_ren tzagel.\\nVon sy-me kran-ken her-tzen gat.\\nEin vr-sprinc al-ler mis-se-tat.\\nVn-tru-wen regen der e-ren ha-gel\"]', '[\"\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_022r.tif\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"Carri