(820, 'Syon, trure', 'J WAlex 28', 'Der Wilde Alexander', 'Middle High German', 'J', 'fol. 24r, 24v', 1, 1, '[\"C2 chahcddchch aGFG a aG\\nc \'C3 c d dc d e fed dc\\nhcd \'C2 c ch aG Ga c dc \'\\nC1 chahcddchch aGFG a aG\\nc c \'C2 d dc d e fed dc\\nhcd c ch aG \'C3 Ga c dc\\ng c C4 g +a \'C4 g f g\\n+b +a g\\n+a g \'C3 f\\nf g fe d f f gfddc \'C3 d\\ng c g +a g f \'C4 g\\n+b +a g\\n+a g f \'\\nC3 f g fe d f f gfddc d \'\\n\",\"C2 chahcddchch aGFG a aG \'c\\nC3 c d dc d e fed dc \'hcd\\nC2 c ch aG Ga c dc \'\\nC1 chahcddchch aGFG a aG \'c c\\nC2 d dc d e fed dc \'hcd c ch aG\\nC3 Ga c dc \'g c C4 g +a\\nC4 g f g \'+b +a g \'+a g\\nC3 f \'f g fe d f f gfddc\\nC3 d \'g c g +a g f\\nC4 g \'+b +a g \'+a g f \'\\nC3 f g fe d f f gfddc d \'\\n\"]', '[\"Sy-on tru-re.\\nDin buͦrch mv-re. hat von schu-re.\\nVnd von win-de mani-gen stoz.\\nDar nach wey-ne.\\nDem ort stey-ne. Der all-ley-ne.\\nDy-ne wende tzv̊-sam-ne sloz\\nDen wint man abe mit tzan-gen.\\nSy-nen kloben.\\nNv la toben.\\nDaz volc la die wach-ter sla-fen.\\nDer kvninc ist of ge-gan-gen.\\nVnde syn her\\nAn die wer.\\nO-we wa-fen ym-mer wa-fen\\nVwaz sol echt nv hie ge-schen.\\nDer kv-ninc wil sen.\\nWie sin stat be-huͦ-tet sy.\\nSon ist ez nicht wan der tot.\\nO-we der not.\\nher ist ym mit tzor-ne bi\\nNoch wa-chent al-le.\\nVuͦr dem wal-le.\"]', '[\"V. 3, S. 2: Text \'ouch\' gestrichen\\nZ. 9,10: Die Linie unter dem Text des darüberliegenden Systems wird als zusätzliche, oberste Notenlinie genutzt\\nZ. 12, 13: Die Linie unter dem Text des darüberliegenden Systems wird als zusätzliche, oberste Notenlinie genutzt\\nZ. 12, S. 5, 6: Rasur e ef, Korrektur f f\\nZ. 12, S. 8: Rasur C2 d, Korrektur C3 d\\nZ. 12, S. 3: Textrasur \'e\'\\nZ. 13, S. 3: Textrasur \'e\'\\nZ. 15: Melodieüberlieferung bricht ab\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_024r.tif\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]