(821, 'Hie bevorn, do wir kynder waren', 'J WAlex 30', 'Der Wilde Alexander', 'Middle High German', 'J', 'fol. 24v, 25r', 1, 1, '[\"F1 A C D DC F \'F1 DA C D\\nF G FE D C \'F1 D C A\\nC D F ED E DCH \'F2 CD D\\na a a a F G F \'F2 Gaba\\nD DC F G F(E) D \'F2\\nC D C A\\nC D F ED E \'F1 DCH CD\",\"F1 A C D DC F\\nF1 DA C D \'F G FE D C\\nF1 D C A \'C D F ED E DCH\\nF2 CD D \'a a a a F G F\\nF2 Gaba \'D DC F G F(E) D\\nF2 \'C D C A \'C D F ED E\\nF1 DCH CD\"]', '[\"Hie bevorn do wir kyn-de wa-ren.\\nVnd die tzit was in den ia-ren.\\nDaz wir lie-fen of die we-sen.\\nVon ie-nen her wi-der tzv̊ desen.\\nDa wir vn-der stvn-den.\\nfi-ol vun-den.\\nda sicht man nv ryn-der besen\"]', '[\"Z. 6, S. 4: Aus Platzmangel zwischen Notensystem und Text A in rhombischer Form\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_024v.tif\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 18, \"TextFontOld\": 5, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 1, 31),
(822, 'Owe, daz nach liebe gat', 'J WAlex 37', 'Der Wilde Alexander', 'Middle High German', 'J', 'fol. 25r, 25v', 1, 1, '[\"C2 c d e e \'C2 fe d e\\nh c d a c ha \'C2\\nc d e e fe d e \'C2\\nh c d a c ha\\nf e \'C2 d c d cd efe\\ne f g e f e d dc \'C2\\nd c ba G a _h c GF \'C1\\na b c GF G abaG _ha\",\"C2 c d e e\\nC2 fe d e \'h c d a c ha\\nC2 \'c d e e fe d e\\nC2 \'h c d a c ha \'f e\\nC2 d c d cd efe \'e f g e f e d dc\\nC2 \'d c ba G a _h c GF\\nC1 \'a b c GF G abaG _ha\"]', '[\"O-we daz nach lie-be gat.\\nLeit so man ez tri-be.\\nNv wil mynne vnde ist ir rat.\\nDaz ich da von scri-be.\\nSie sprach sel-le wi-der mich.\\nScrib daz leyt ob al-lem ley-de\\nSwa sich lieb von lie-be schey-de.\\nTru-rich vnde vn-en-de-lich.\"]', '[\"V. 7, S. 6: Die b-Akzidentien in V. 7 und V. 8 machen einen Moduswechsel plausibel, weshalb b anzunehmen ist.\\nDie Parallelüberlieferung in W zeichnet nur das b-Akzidens in V. 7, S. 3 vor\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_025r-EB.tif\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 18, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 5, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 1, 31),
