2 f e d dc \'d c ba G\\nC2 a b c a \'b c a \'_h c\\nC2 G F G a_haG _ha \'e e e d\\nC2 e a \'e e e d e a\\nC3 \'e f g e f e d dc\\nC2 \'d c ba G a _h c a\\nC2 \'b c a \'_h c\\nC2 G G F GabaG a\"]', '[\"Myn tru-rich-lich iz klagen.\\nIst daz daz mich vuͦr sneit\\nmynne o-we.\\nSol a-ber ich da tra-gen.\\nDaz gro-ze her-tze leit\\nym-mer me.\\nDaz an mir be-gat.\\nDer myn-nen rat.\\nNein ich sol.\\nmich wol.\\nvon di-sem schaden.\\nvil balde vnt-la-den.\\nDie not.\\nDen tot.\\nVon mir iage.\\nE. daz ich klage.\\nal-le tage\\nMin leit also vn-en-de-lich.\\nRecht als eyn swan.\\nDer wiz-zen. kan.\\nDaz ym an.\\nkvmpt sin tot dem sing ich glich.\\nAch my-ner wune ein beren-de rebe.\\nNympt ie-man wun-der wes ich lebe.\\nJa myn ste-te tzv̊ vuͦr sicht.\\nDie tros-tet mich vnd an-ders nicht.\\nAch myn-ne du has mir ge gebn.\\nEynen lie-ben wan ein stren-giz lebn.\\nSol ich an die vrou-we myn.\\nDoch din schilt-ge-ver-te syn.\\nEr mac wol von no-ten kla-gen.\\nSwer den schilt muv̊z ey-ne tra-gen.\\nSo ist daz not v-ber not.\\nVvirt ge-tragen kegen ym der schilt.\\nOb sie sich schei-den vn-ge spilt.\\nAch daz ist eyn leben-der tot.\\nNv la sie tzv̊ sam-ne komen.\\nDa wirt vil-lich-te ein spil ge-no-men.\\nDaz vreude vber vreu-de birt.\\nO-we so tuͦt in dar nach.\\nAber ein lan-gez tru-ren scach.\\nSwen vr-lob ge-no-men wirt.\\nMyn-ne ist ir ge-sel-le.\\nSwer ir die-nen wel-le.\\nHiv-te suͦ-ze mor-ne svr.\\nLeit ist lie-bes nach ge-bur.\\nSwer ot e. ge-spil-te.\\nVn-der myn-nen schil-te.\\nDer leit v-bel vn-de guͦt.\\nAls noch myn-ne ger-ne tuͦt.\\nVns tzal-ten.\\ndie al-ten.\\nVon der sen-den not.\\nwie sich mani-ger bot.\\nJn den grym-men tot.\\nAls in die myn-ne v-ber want.\\nNv le-re.\\nmich he-re.\\nMyn-ne wie daz ich.\\ndi-nen schilt vn-de dich.\\nwol vn-de myn-nich-lich.\\nDi-nen vrivn-den tv̊ be-kant\\nNv wol ot her.\\nSwer des ger.\\nDaz er werd eyn die-nest man.\\nho-er mynne of wer-den lon.\\nDem laz ich hie.\\nwiz-zen wie.\\nEr gab vn-de ge-ben kan\\nmyn-ne tzei-chen vnd ir don.\\nNv ne-met war daz ist der schilt.\\ndar vn-der mani-ger hat ge-spilt.\\nOf ro-tem velde ein nacket kynt.\\nDaz ist ge-kro-net vnd ist blint.\\nVon golde ein strale in ey-ner hant.\\nVnd in der an-dern ist ein brant.\\nDaz kynt hat of den rant ge-spreit\\nTzwe-ne vlugel nach snel-lem vluge\\nDer schild ist in vnd vz be-reit.\\nAn dem tzeychen vnd an dem tzvge.\\nHabent ir vuͦr nomen.\\nwie vua sint komen.\\nJr wort vnd ir ma-ter-ie gar.\\nSchilt vn-de kynt.\\nJst gar ein wynt.\\nNv ne-met ouch der glo-sen war.\\nVvweck of myn-ne.\\nspehe syn-ne.\\nTu din recht of daz din her.\\nDich ir ken-ne.\\nSchuz vnde bren-ne.\\nVnd la sen wer dir daz wer.\\nVuͦr war hie kvmpt amor ge-vlo-gen.\\nDer bryn-get vach-len vnd bo-gen\\nSin. stra-le vert durch gan-tze want.\\nDar nach so wer-fet er den brant.\\nSo kvmpt eyn viuvr vnd eyn ge-lust.\\nBald in der myn-nen geren-de brust.\\nVvaz er be-gat oder waz er tri-bet.\\nDaz ist al-lez kint-lich spil.\\nDurch daz man in so kynt-lich scri-bet.\\nEr kan kindi-scher tzuͦ-cke vil.\\nDie kronen er treit.\\nMit wer-di-cheit.\\nDer mani-gen kvninc be twun-gen hat.\\nJa wi-che wich.\\nWie starch wye rich.\\nEr v-ber kvmpt swaz er be-stat.\\nGet durch scou-wen.\\nLieb-lich vrou-wen.\\nVnd lat vch da wi-der sen\\nKvmpt er stille.\\nDer tzwi-er wil-le.\\nAch so ist eyn scuͦz ge-schen.\\nScho-ne myn-ne scho-ne.\\nTobe nicht mit der kro-ne.\\nDv has nv tzv̊ ma-le.\\nTzwey mit ey-ner stra-le.\\nGe wunt in dyme stri-cke.\\nVon ir ou-gen bli-cke.\\nDv bist in ir lan-de.\\nTobe nicht mit den bran-de.\\nSwa brust kvmpt tzv̊ brus-te.\\nDa schy-net von ge-lus-te.\\nDin vivr an der stra-ze.\\nDv brin-nest a-ne ma-ze.\\nJch mv̊z ouch dy-ne blint-heit klagen.\\nSwa man sicht ey-nen swa-chen tzagen.\\nho-er myn-nen solt be ia-gen.\\nBlynt vn-de bloz. was E. din spil.\\nDaz mer-ke swer daz mer-ken wil.\\nSpiech ich me des ist tzv̊ vil.\\nVvun-schen vnd ge-den-ken.\\nist ein ge-vider.\\nDaz kan-stu ge-len-ken.\\nho vn-de nider.\\nwer mac dir vnt-wen-ken.\\nDu vlu-ges hyn du vlu-ges wider.\\nDi-nen schilt la scou-wen.\\nSin velt ist rot.\\nSwa man durch die vrou-wen\\nkvmpt in die not.\\nDaz ey-ner lit vuͦr hou-wen.\\nDer an-der li-det snel-len tot\\nSwer den schilt wil v-ben.\\nder sol nicht be-tru-ben.\\nOb in daz kint mit der kro-ne.\\nTwin-ge daz er vol-ge scho-ne.\\ndem do-ne.\\nDen vns pa-ris v-ber se.\\nBrach-te von den krie-chen.\\nAn die myn-nen sie-chen.\\nDo die krie-chen wun-nen tro-ie.\\nSwer da truͦc der myn-nen bo-ye\\nDes kro-ye.\\nwas nicht wen ach vnd o-we\"]', '[\"V. 2, S. 3: Ergänzter Text \'daz\'\\nV. 14, S. 1: Rasur a, Korrektur G\\nV. 15, S. 3: Rasur a, Korrektur _h\\nV. 17: Unter den Notensystemen Melodie und Text nachgetragen\\nV. 18, S. 1: Rasur hd (?), Korrektur hc\\nV. 19, S. 1: Rasur  a und \'c\' (für Notenschlüssel?) auf erster Notenlinie, Korrektur d\\nV. 22: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 23, S. 4: Rasur d\\nV. 23, S. 6: plica anzunehmen, da Notenhälse links und rechts, allerdings nur leicht angeschrägte Neumengraphie; Parallelstelle im folgenden Vers als Clivis\\nV. 25, S. 4: pes mit Notenhals nach unten rechts. Vermutlich wurde die obere Note (d) unmittelbar nachgetragen; die Paralellstelle im folgenden Vers weist eine reguläre Graphie auf\\nV. 27, S. 8: Zwei virgae auf der silbe \'-gebn\'; die Parallelstelle im folgenden Vers notiert für \'lebn\' nur eine virga\\nV. 32, S. 4: Vorzeichen b um einen Zwischenraum verrutscht (hier korrigiert wiedergegeben); die Parallelstelle notiert b korrekt \\nV. 33, S. 6: Rasur a (plica-Graphie), Korrektur G (plica-Graphie) als letzte Note der Ligatur; parallel zu V. V. 36, S. 6\\nV. 33, S. 3: Rasur d (der folgenden Silbe)\\nV. 36, S. 4: Rasur?  (G)\\nV. 36, S. 6: Rasur a ,Korrektur G (plica-Graphie) als letzte Note der Ligatur; parallel zu V. 33, S. 6\\nV. 37, S. 1: Rasur f, Korrekgur e\\nV. 37, S. 2: Rasur \'t\' im Text\\nV. 38, S. 4: Notenkopf fast nicht auf der C-Notenlinie; Parallelstelle in V. 41 deutlich als c lesbar\\nV. 38, S. 8: Rasur F, Korrektur a\\nV. 38, S. 9: Rasur F, Korrektur aGF\\nV. 39, S. 2: Rasur von vermutlich GF der folgenden Silbe\\nV. 45: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 46: Über dem Notensystem liegende Hilfslinie der Seitenaufteilung als weitere, oberste Notenzeile verwendet\\nV. 54, S. 3: Rasur von Notenschlüssel oder a\\nV. 58, S. 1, 2: Rasur a G, Korrektur G F\\nV. 60, S. 3: Das b ist der vorigen Silbe bzw. am Zeilenanfang vorgezeichnet\\nV. 60, S. 4: Das Akzidens ist in zwei dünnen strichen ausgeführt und wirkt nachgetragen. Vermutlich ist es ein B molle, nur unwahrscheinlich wäre ein B durum (Auflösungszeichen) zu verstehen sein\\nV. 62, S. 5: Rasur Text \'z\' aus \'tzv̊\' (für \'tv̊\')\\nV. 64, S. 2: Rasur F, Korrektur E\\nV. 66, S. 3: \'ne\' aus \'myn-ne\' nach dem Zeilenumbruch ohne Note\\nV. 71, S. 1-4: Rasur G F G FE, Korrektur a G a GF\\nV. 73, S. 4: Rasur G der folgenden Silbe\\nV. 73, S. 6: Vermutlich ein a zu wenig auf dem potentiell zweisilbigen \'na-cket\'; die Parallelstellen in V. 71, 72, 74, 75, 76 weisen es auf\\nV. 74, S. 2: Evtl. Rasur G (?)\\nV. 86, 87: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 86-91: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 93, S. 7: Rasur G, Korrektur a\\nV. 109, 110: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV, 112, 113: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 124, S. 2: Rasur a, Korrektur G\\nV. 129, S. 1-3: Rasur d d e, Korrektur c c d\\nV. 129, S. 6: Rasur aGF, Korrektur baG\\nV. 132, 133: Linie unter dem Text des darüberliegenden Notensystems als weitere, oberste Notenzeile verwendet\\nV. 113, 114: Silbendifferenz beim Reim \'stille\' (virga) - wil-le (