(824, 'Ach, owe, daz noch lyb yrgat', 'W WAlex 2', 'Der Wilde Alexander', 'German', 'W', 'fol. 49r', 1, 1, '[\"C3 a c d e e f ed e\\na h c ddc ah c cha\\na c \'C3 d e e f ed e\\na h c ddc ah c cha\\nf e e(d) e \'C3 dc d e\\ne e g e f e e(d) dc\\nd c ba G a _h c \'C3 GF\\nG a_h c GF G a_haG a\",\"C3 a c d e e f ed e \'a h c ddc ah c cha \'a c\\nC3 d e e f ed e \'a h c ddc ah c cha \'f e e(d) e\\nC3 dc d e \'e e g e f e e(d) dc \'d c ba G a _h c\\nC3 GF \'G a_h c GF G a_haG a\"]', '[\"Ach ow-e daz noch lyͤb yr gat\\neyn leit als ich daz tri-be.\\ndaz wil dyᵉ mynn vnd ist ir rat\\ndaz ich do von so shriͤ-bin\\nse sprach sel-be we-dir-mich\\nshriͤp eyn leit vor al-lim ley-de\\nwo sich lyͤp von lyͤ-be shey-de\\ntru-rik vnd vn-en-de-lich\"]', '[\"Es sind durchgängig fünf Linien pro Notensystem gezogen. Die fünfte, unterste Notenlinie wird erst ab V. 7, S. 8 genutzt\\nV. 2, S. 4; V. 4, S. 4: Ligatur als ddc oder dc lesbar. J überliefert d (im Sinne eines \'Strukturtons\'), die Graphie weicht an beiden Stellen in W ab. Daher erscheint mir ddc die plausiblere Variante\\nV. 6, S. 4: Tonhöhen undeutlich, könnte auch f g f etc. bedeuten; die Parallelüberlieferung in J legt dies jedoch nicht nahe\\nV. 8, S. 2, 6: In der Parallelüberlieferung in J sind b-Akzidentien vorgezeichnet\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 18, \"TextFontOld\": 5, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 1, 31);
