a h ha\\nC2 \'a G E \'a G E \'E d e dc c \'h c d c\\nC2 a \'a G G G E \'E G a aG a h ha\\nC2 \'a G G E \'a G E \'E c c c d c\\nC2 a \'h a a aF Ga h ha \'a G G E \'a G E\\nC2 \'E c c c d c a \'d c c(h) a hc d dc\\nC2 \'a a G GF G a a a \'a a G G(F) G a\\nC2 a a \'a a G G G a a a \'a a G GF G\\nC2 a a a \'a a G GF G a a a \'a\\nC2 a G GF G a a a \'a c a h c a\\nC2 G a a \'G a h c a G G \'a c\\nC2 a h c a G a a \'G a h h c a G\\nC2 a \'cd e e e \'eed e e e \'e e\\nC2 e c d edc ha \'cd e e e \'eed e e e\\nC2 \'e e e c d e c ha C3 \'e e g gfe \'f e\\nC3 e dc \'d dc ba G a a a \'e e g fe\\nC3 \'f e e dc \'d dc ba G a a a\\nC2 \'a aG a GF G a a a a \'a a(G) a\\nC2 GF G a a a a \'a a G GF G a\\nC2 a a \'a a G GF G a a a \'a a\\nC2 G GF G a a a \'a a G GF G aa a\\nC2 \'a c a h c a G a a \'G a h c a G\\nC2 G \'a c a h c a G a a \'G a\\nC2 h c a G a \'cd e e e e \'eed e\\nC2 e e \'e e e c d e c ha \'cd e e e\\nC2 \'eed e e e \'e e e c d e c ha \'e\\nC3 e g fe \'f e e dc \'d dc ba G\\nC3 a a a \'e e g gfe \'f e e dc \'d dc ba\\nC2 G a a a \'aG a GF G a a \'G G a\\nC2 GF G a a \'h c G F a a \'G G a GF\\nC2 G a a \'h c G F a a \'G a GF G\\nC2 a a \'h c G F a a \'G a GF G a a\\nC2 \'a c G F a a-a \'G a GF G a a \'h\\nC2 c G GF G a a \'a G a GF G a a \'c\\nC3 d e e g g fe e \'e f e d dc d dc\\nC3 baG \'a _h c cG c dca ba \'c d e e\\nC3 g g fe \'e f e d c d dc baG \'a _h\\nC3 c cG c dca ba \'e e g e f e \'d f\\nC3 e ed d \'d c c b a a \'G c _h aG G\\nC3b} \'G G d d c f \'e d c _ha G ca _hcdca\\nC3 ba a \'e e g e f e \'d f e ed \'d\\nC3 c c b a a \'G c _h aG \'G G G\\nC3 d d c f \'e d c ha a Gca bcdca _ha \'e e e\\nC3 e e e a \'e e e e e a \'e e g fe\\nC3 f e ed dc \'d dc ba G a _h c a \'c\\nC3 c a \'h c G a F GabaG a \'e e e e e a \'\\nC2 e e e e e a \'e e C3 g fe e f e e dc \'d\\nC2 c ha G a h c a \'h c a \'h c G a\\nC2 F GabaG a\"]', '[\"Eyn tru-re-chi-ches cla-gyn\\nist daz mich vor sneyt\\nmyn o-we\\nUnd sal ab-ir ich nu tra-gin\\ndaz groz her-tze-leyt\\nym-myr me\\nDaz am-myr be-gat\\nder myn-nyn rat\\nneyn ich\\nsal mich\\nwol von desim scha-din\\nvil balde ynt-la-dyn\\nDy not\\nder tot\\nvo-myr ia-ge.\\ne. daz ich cla-ge\\nal-le ta-ge\\nmyn leyt als vn-en-dek-lich\\nRecht alz der swan\\nder wis-syn kan\\nwen yn an kumt sin tot\\ndem sing ich glich\\nAch ym-mir wn-nyn bern-dir reb\\nnymt y-mant wn-dir wez ich le-be\\nya myn stᵃe-te tzu-vor sicht\\ntros-tit mich vnd an-dirs nicht\\nZewar myn-ne du host myr ge-gᵉ-bin\\nyn li-bym wan eyn stren-gis le-bin\\nsal ich an der. vro-wyn myn.\\ndoch dyn schilt ge-ver-te sin\\nHer mac wol von no-tyn sagin\\nwer der schilt sal ey-ne tragin\\nso ist daz not ob-yr not\\nwirt ge-tra-gin keyn ym der zchilt\\nab sy schey-din vn-ge-spilt\\nach daz ist eyn lebn-dir tot\\nNu lost zy czu sa-myne komn\\ndo wirt licht eyn spil vor-nomn\\ndaz vrow o-bir wroy-de birt\\no-we zo tut yn do noch\\nab-ir eyn lan-gis tru-ryn schoch\\nwen or-lovp ge-no-myn wirt\\nMyn. ist sulch ge-sel-le\\nwer yr di-nen wol-le\\nhu-te zu-se mor-ne svwir.\\nleyt ist io libiz no-ke-bu-wir\\nWer ot y. ge-spil-te\\nvn-dir myn-nyn zchil-te\\nder leit o-bil vn-de gut\\nalz noch myn-nyn gern-de der tut\\nUns zcal-tin\\ndi al-tin\\nvon der sen-din not\\nwi sich man-chir bot\\nin den grym-myn tot\\nalz yn di myn-ne o-bir want\\nNu le-re\\nmich he-re\\nmyn-ne wi daz ich\\ndy-nen schilt vnd dich\\nwol vnd myn-nek-lich\\ndy-nen vrun-din tu be-kant\\nNv wo-lat her\\nwer daz ger\\ndaz her wrd eyn dy-nist-man\\nho-yr myn of er-din lon\\nDaz laz ich hy\\nwis-sin wy\\nwen y gap vnd ge-byn kan\\nmyn yr zcey-chin vnd yr donᵉ.\\n[N]v ne-mit war daz ist der schilt\\ndor vn-dir man-chir hat ge-spilt\\nof ro-ty[m] veld eyn na-ckit kint\\ndaz ist ge-cro-nyt vnd ist blint\\nUon golde eyn stral yn ey-nyr hant\\nvnd in der an-drin ist eyn brant\\ndaz kint hat of den rant ge-spren-git\\nzcwe-ne vlogil mit snel-lim vloge\\nDer schilt ist vz vnd vz ge-spen-git\\nan dem zchey-chin vnd an dem zcoge\\nhot yr vor-nomyn.\\nwy ? sy komyn\\nder schilt vnd dy ma-terie gar\\nschilt vn-de kint\\ndaz ist eyn wint\\nyr ne-mit ouch der glo-zin war.\\nWer of myn-ne\\nspe-e syn-ne\\ntu din recht durch daz din her\\ndich yr ken-ne\\nschuys vnd bren-[e]\\nvnd sich wer sich din yr weyr\\nWor war hy kumt a-mor ge-vlo-gin\\nher bren-git vack-lin vnd dem bo-gin\\nsyn stral dy vert durch gan-cze want\\ndor noch zo wir-f[e]t her dem brant\\nZo komt eyn fuwyr vnd eyn ge-lust\\nbald in der myn-ny g[er-n]de\\nwaz her be-geyt vnd waz her try-bit\\ndaz ist al-lis kint-lich spil.\\nDurch daz man ym so kint-kich scri-bit\\nher hat kyndy-schir tu-cke vil.\\n[D]y cro-ne her treyt\\ndurch wer-de-keyt\\ndi man-chin konic be-swn-gin hat\\nEy wy-cha wich\\nwy stoltz wy rich\\nher o-bir kumt waz her be-stat.\\n[G]yt durch scho-win\\nlip-lich vro-wyn\\nvnd lat vch da wi-der sen.\\nKvmt do stil-le\\nzcwȳ eyn wil-le\\nach zo ist eyn schoz ge-schen\\nScho-ne mȳ-ne scho-ne\\nto-be nicht myt der crno-nyn\\ndu bist in ir lan-de\\nto-be nicht mit den bran-de.\\ndo hast nu czu ma-le\\nzcwey mit ey-nir stra-le\\nvor wnt in dyn strik-ke\\nmit der ov-gin bli-cke\\nwo brust kumt czu brus-te\\ndo zcunt von ge-lus-te\\ndaz fu-wyr an der stra-se\\nys bryn-nyt a-ne ma-ˢe\\nDuch muz ich din blint-heit cla-gin\\nwo man zit ey-nyn swa-chin zcagin\\nho-yr myn-ne sold beia-gyn\\nBloz vnde blint waz y. din spil\\ndaz mer-ke wer do mer-kin wil\\nsprech ich mer daz wer czu vil\\nWn-schin vnd ge-den-kin\\nist din ge-ve-der\\ndaz kanst du wol len-kin\\nhoch vn-de ny-dy[r]\\nwer kan dir ent-wan-ckin\\ndu vlu-gist hyn du vlu-gist we-dir\\nDy-nen schilt la scho-wyn.\\nsin velt ist rot\\nwo man durch dy vro-wen\\nkumt in dy not\\ndaz ey-nyr lyt vor ho-wyn\\nder an-dir ly-dit snel-lin tot\\nWer dy-nen schilt wil v-byn\\nden kan nicht be-tru-bin\\nab yn daz kint myt der cro-nyn\\ntwin-gyt daz her vol-git sho-ne\\ndem do-ne\\nden vns pa-ris o-bir se\\nBrach-te von den cri-chē\\ndo den mȳ-ne si-chin\\ndo dy cri-chin ge-wn-nȳ tro-ye\\nwer [da] [tr]vk der mȳ-nen bo-ye\\ndes cro-ye\\nwas nicht wen ach vnd o-we   \"]', '[\"V. 4, S. 6: undeutliche Graphie, anzunehmende Korrektur durch Überschreiben aus cca zu ca\\nV. 6, S. 3: Rasur Ga der folgenden Silbe\\nV. 18, S. 6: Graphie der Ligatur aa-h-a\\nV. 19, S. 2: Fleck/Streichung (?) im Zwischenraum des Tons d\\nV. 22, S. 6: Undeutliche Graphie der Ligatur aa-h-a\\nV. 29, S. 6, 7: In Handschrift (W) h ddch, da in Zeile verrutscht. Korrekt: a ccha\\nV. 30, S. 1, 2: In Handschrift (W) h d, da in Zeile verrutscht. Korrekt: a c\\nV. 35, S. 6: Rasur \'t\' in \'spiltt\' zu \'spilt\'\\nV. 41, S. 8: Undeutlich GE oder GF, Parallelstelle etwa in V. 38, S. 8 GE\\nV. 46, S. 3, 4: Textuunterlegung uneindeutig \'io libiz\'\\nV. 45, S. 2; V. 49, S. 2: vermutlich identische Diastematik beabsichtigt\\nV. 51: Rasur C3, G1 (Notenschlüssel), Korrektur C2\\nV. 56, S. 2: Tonhöhe nicht eindeutig, Parallelstelle legt G nahe\\nV. 66, S. 1/2: \\nV. 91: Ligatur \\nV. 96, S. 5: eine Note mehr als Silben im Text\\nV. 107: Oberste Notenzeile anfänglich (bis V. 108, S. 3) nicht gezogen, da Text des darüberliegenden Systems sich dort befindet. Die Tonhöhen entsprechen anzunehmend der Parallelstelle ab V. 109\\nV. 118: Zeichen auf der vierten Notenlinie\\nV. 123: a zu viel am Versende. Gerne [ ]\\nV. 138, S. 4: Tonhöhe unklar, ha G ca oder: hG G ca; die Parallelstelle in V. 144 weist eine Silbe mehr auf: ha a Gca\\nV. 141, S. 4: b-Akzidens eine Silbe vorher notiert\\nV. 144, S. 6: andere Neumengraphie der Ligatur\\nV. 150, S. 6: andere Neumengraphie der Ligatur\\nV. 154, S. 2, 4, 5: Schwer lesbar\\nZ. 156, S. 5: c-F-Notenschlüssel?\\n\\nV. 7: Rasur \'a\' im Text, Korrektur durch Superkript \'e\'\\nV. 29: Kleine Punkte vor und nach \'vrowyn myn\'\\nV. 91: Rasur \'e\' von \'brene\' zu \'bren\'\\nV. 126: Textkorrektur von \'mane\' zu \'maˢe\' \\nV. 134: Rasur \'e\' aus \'gevedere\' zu \'geveder\'\\n\\nȳ ē ī\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null