(826, 'Qant voi esté et lo tans revenir', 'Linker 38.16', 'Chastelain de Coucy', 'French', 'U', '48v', 1, 1, '[\"C1 a a c a G Gah a GF G GF\\nFG a ab a G aG \'F2 FE D C D\\nC2 a a c a G Gah a ha h a\\nah c \'F2 ab a G aG FE D C D\\nG a G FE D \'F3 C DE FG FED C\\nG G aG FE D C D D E FEDC\\nFG a \'F3 a_h a G aG F D C D\",\"C1 a a c a G Gah a GF G GF \'FG a ab a G aG\\nF2 FE D C D \'C2 a a c a G Gah a ha h a \'ah c\\nF2 ab a G aG FE D C D \'G a G FE D\\nF3 C DE FG FED C \'G G aG FE D C D D E FEDC \'FG a\\nF3 a_h a G aG F D C D\"]', '[\"Qant voi es-té et lo tans re-ve-nir\\nqe bois et prei con-men-çent a ver-dir\\nse j\'ai a-mé bien m\'en doit sou-ve-nir.\\nTrop m\'ont gre-vé cil qui m\'ont fait guer-pir\\nla riens fors Deu que plus aim et de-sir.\\nDeus, sei bel oil, sei bel oil, sei bel oil\\nme font a-mer cenz tanz que je ne suel.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f104\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(828, 'Swer des biderben swache phligt', 'A JSperv 3', 'Der Junge Spervogel', 'German', 'k', 'fol. 719ra', 1, 1, '[\"C1F3 cc c c c a \'C2F4 a G GG\\nF G \'F3 G G G G\\nG D D \'F4 E F ED\\nD D G \'C2F4 G G G F GG \'\\n[C2 D D G G G G F GG] \'C2F4\\nG a h c a a G \'C1F3 G/ G G G F E C C \'F3\\nC C C G G a a G/ \'C1F3 G G D F G E DD\",\"C1F3 cc c c c a\\nC2F4 a G GG \'F G\\nF3 G G G G \'G D D\\nF4 E F ED \'D D G\\nC2F4 G G G F GG \'\\n[C2 D D G G G G F GG]\\nC2F4 \'G a h c a a G\\nC1F3 G/ G G G F E C C\\nF3 \'C C C G G a a G/\\nC1F3 G G D F G E DD\"]', '[\"k:_Schaff-za-bel wart vor Troy her-dacht,\\nseyt mir ein krie-scher herr:\\ndaz macht sin schö-nes wyp.\\nder mich hat spie-les a-ne-bracht,\\nder wil mir nemen one wer\\nden my-nen jun-gen lyp.\\ner zucht mir schach, ich mach in mat\\n? ? ? ? ? ? ? ?\\nsin kung kumpt nym-mer ab der stat, daz er mich mög ver-tri-ben.\\nmir hat myn jun-ges hercz ge-seit: ich sol hie mei-ster bly-ben.\\n\\nA:_Swer des bi-der-ben swa-che phligt,\\nda bi des boe-zen wol,\\nder hat si beide ver-lorn.\\nge-walt den wiz-zen ane ge-siget.\\nein sin-nic her-ze sol\\nmit zuh-ten tra-gen zorn.\\ndes ja-res kumpt vil lihte ein tac,\\ndaz ers wol ver-en-den mac.\\nun-reh-ter ge-he nie-man phligt, er muͦge ir wol en-gel-ten.\\nguͦter ge-bit-te noch nie ge-brast mit scho-nen zuh-ten sel-ten.\"]', '[\"Der Ton wird in k dem Jungen Stolle zugeschrieben\\nV. 8: Der Ton in k weist diesen Vers nicht auf; Wiederholung des vorangegangenen Verses wäre möglich\\nWiederholungszeichen\\nguͦ-ter ge-bit-te: beides kürzbar\\n\\n3 Rasur, zwei Korrektur durch Überschreibung?\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1445\", \"custos\": \"[3,6,6,6,6,null,6,8,4,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", 