(832, 'Ez ist hiute eyn wunnychlicher tac', 'J Tannh 1', 'Tannhäuser', 'German', 'J', 'fol. 42vb-43rb', 1, 1, '[\"F2 E G \'C1 G Ga b a G aG\\na G \'F2 D D F E D E D C C \'\\nF2 D F F F G a G GC \'\\nF2 D E F E D E D DH C D D \'\\nF2 E G G Ga b a G aG \'\\nF2 F E D D F E D E D-C C C \'\\nF2 D F F F G a G GC \'\\nF2 D E F E D E D DH C \'F2 D D\\nE G G G C1 a c \'C1 c c\\nb a _h aG F E F \'C1 D\\nD E D D E G GC \'C1\\nE G G G a c c c \'C1\\nb a _h aG F E F ED \'F2\\nD E D DH C D D F2\\n[E G G Ga b a G aG\\nF E D DE G G GC]\\nG \'C1 G a c c ha h aG\\nG a \'C1 b a G F E FE D C C \'C1\\nE G G Ga b a G aG\\nF \'F2 E D DE G G GC\\nG G a \'C1 c c d G ch\\na G a G \'C1 F E D D D F2 E D DH C \'F2 D D\",\"F2 E G\\nC1 G Ga b a G aG \'a G\\nF2 D D F E D E D C C \'\\nF2 D F F F G a G GC \'\\nF2 D E F E D E D DH C D D \'\\nF2 E G G Ga b a G aG \'\\nF2 F E D D F E D E D-C C C \'\\nF2 D F F F G a G GC \'\\nF2 D E F E D E D DH C\\nF2 D D \'E G G G C1 a c\\nC1 c c \'b a _h aG F E F\\nC1 D \'D E D D E G GC\\nC1 \'E G G G a c c c\\nC1 \'b a _h aG F E F ED\\nF2 \'D E D DH C D D F2 \'[E G G Ga b a G aG \'F E D DE G G GC] \'G\\nC1 G a c c ha h aG \'G a\\nC1 b a G F E FE D C C\\nC1 \'E G G Ga b a G aG \'F\\nF2 E D DE G G GC \'G G a\\nC1 c c d G ch \'a G a G\\nC1 F E D D D F2 E D DH C\\nF2 D D\"]', '[\"Ez_ịst hivtẹ eyn wun-nich-li-cher tac.\\nNv phle-ge myn der al-ler din-ge wal-te.\\nDaz ich myt sel-den mv̊-ze wesẹn.\\nvndẹ ich ᵍᵉ-buͦ-ze my-ne gro-ze scul-de\\nUventẹ her mich wol ᵍᵉ-hel-fen mac.\\nAl-so daz ich die se-le myn be-hal-te.\\nDaz ich vuͦr svn-den sy ge-nesẹn.\\nvndẹ daz ich noch ir wer-be go-tes hul-de.\\nNv gebẹ her mich so ste-ten mv̊t.\\nDaz ez der lib vuͦr die-ne so.\\nDaz myr got dan-ken mv̊-ze\\nDaz myr daz en-de wer-de guͦt.\\nvnd ouch die se-le wer-de vro.\\nMyn schei-den wer-de suͦ-ze.\\nDaz mich de hel-le gar vuͦr ber.\\nDes hel-fe mir de rey-ne\\nUndẹ vuͦ-ge mich des ich da ger.\\nDaz mich die hoe-ste vreu-de sy ge mey-ne.\\nAlsọ ich der ma-ge mv̊z vn-per.\\nDaz ich dort vrivn-de vyn-de.\\nDie my-ner kvn-ste wer-den vro.\\ndaz ich ge-hey-zen mv̊gẹ eyn sel-den ri-chez in-ge-syn-de\"]', '[\"V.1, S. 1-2: \'Ẹz ist\' oder \'Ez ịst\'\\nV. 4, S. 3: Textnachtrag \'ge\' (ge-buͦ-ze)\\nV. 5, S. 5: Textnachtrag \'ge\' (ge-hel-fen)\\nV. 6, S. 5: Rasur E, Korrektur F\\nV. 6, S. 9: Zwei Plicae (D-C) auf der Silbe; D könnte nachgetragen worden sein, da die Graphie etwas größer erscheint\\nV. 7, S. 8: Rasur D aus gD, Korrektur zu C in gC\\nV. 11, S. 4-6: Rausr C D F, Korrektur D E G\\nV. 11: Textrasur \'es\'/\'ez\'\\nV. 14, S. 1-3: Rausr H C H, Korrektur D E D\\nV. 17, S. 8: Rasur \'e\' aus \'gere\' zu \'ger\'\\nV.22, S. 8-9: Rasur E F, Korrektur D D\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_042v.tif\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": false, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 18, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": false, \"ManualMelodicStructure\": \"\", \"UseManualMelodicStructure\": 0}', 1, 31),
(833, 'Es wont ein magt vff erden hie (Frau-Ehren-Ton)', 'k Zwet 1', 'Reinmar von Zweter', 'German', 'k', 'fol. 663r', 1, 1, '[\"F3 D D D F F \'F3 F F F\\nF D D E D D C \'F3\\na a G a a G F F \'F3\\na a a G E FD D\\nD D \'F3 D F a a G G F FEF \'\\nF2 D D D F F-E F D D \'F3 C D C\\nC F G a a h \'F3 a a G G F\\nF F G a \'F3 G a G G E FD D\\nD D \'F2 D F F F E F\\nD D \'F3 D E D D C C\\na a G \'F3 a G G F F D D CDFaGGF\",\"F3 D D D F F\\nF3 F F F \'F D D E D D C\\nF3 \'a a G a a G F F\\nF3 \'a a a G E FD D \'D D\\nF3 D F a a G G F FEF \'\\nF2 D D D F F-E F D D\\nF3 C D C \'C F G a a h\\nF3 a a G G F \'F F G a\\nF3 G a G G E FD D \'D D\\nF2 D F F F E F \'D D\\nF3 D E D D C C \'a a G\\nF3 a G G F F D D CDFaGGF\"]', '[\"Es wont ein magt vff er-den hie\\ndie sant ir bot-ten vs-se\\nnach got-tes son nu mer-kent wie\\nir kusch vnd ir de-mu-te\\nir zucht ir scham ir gro-ße rei-ni-keit\\ndie lud-en got mit al-ler craft\\ndaz er ir sant die rei-ne\\nvnd hoch ge-lob-te rein bot-schaft\\ndaz sie in magt ge-be-re,\\ndaz wart ir von dem en-ge so ge-seit\\nDa des ir bottẹ in gan-czen glau-ben ka-men\\nVnd sie die lie-ben mer al-so ver-na-men\\ndaz worcht der hei-lig geist in ir so scho-ne\\nIr kint mit gan-czer küsch sie sa\\ndaz wont vndr ie-ren brüs-ten da\\nbiss sies ge-bar waz geb wir ir zu lo-ne\"]', '[\"V. 13: \'küsch\' oder \'kuͤsch\'?\\nV. 4, S. 3/4: Streichung G ohne Notenhals\\nV. 4, S. 6: Punkt über Bichstabe \'u\'\\nV. 5, S. 5, 6: Korrektur durch Überschreiben von F F mit a a\\nV. 6, S. 6, 7: \'aller\' steht bereits vor dem Zeilenumbruch\\nV.  6, 7: Textunterlegung verschoben\\nV. 8, S. 4: Die Silbe \'lob\' fehlt anzunehmend, vgl. Brunner\\nV. 9: Textunterlegung verschoben\\nV. 12, S. 5-6; V. 13, S. 1-2: Rasur a G G a (erstes G ohne Notenhals), Korrektur G F F F\\nV. 14, S. 7: \'s\' von \'sie\' nicht geschrieben\\n\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": 2, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": false, \"RepetitionPattern\": \"ABCDEABCDE\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(834, 'Mir tet gar wol ein lieber wan (Luodeleich)', 'k Tannh 1', 'Tannhäuser', 'German', 'k', 'fol. 72ra', 1, 1, '[\"C2 E F F F G a \'C2 a a\\na a a b} b b \'C2 a G G\\nG G F G G \'F4 F F D\\nD E F \'F4 G G a a G G F F \'\\nF4 F a h c c c h \'F4 a\\nD E F G G a a \'F4 G E F F\\nF a h \'F4 c c c h a\\nG F F F E \'F4 G D\\nD E F G G \'F4 G F G\\nG h c \'F4 d d d c ha\\nD D D C \'\\nF4 C G G G G a a G G F F\",\"C2 E F F F G a\\nC2 a a \'a a a b} b b\\nC2 a G G \'G G F G G\\nF4 F F D \'D E F\\nF4 G G a a G G F F \'\\nF4 F a h c c c h\\nF4 a \'D E F G G a a\\nF4 G E F F \'F a h\\nF4 c c c h a \'G F F F E\\nF4 G D \'D E F G G\\nF4 G F G \'G h c\\nF4 d d d c ha \'D D D C \'\\nF4 C G G G G a a G G F F\"]', '[\"Mir tet gar wol ein lie-ber wan.\\nden ich nu von fraw gu-ten han\\nwan[n] nu der ma-ni-fe zer-gat\\nrecht alz der schne so lo-net mir die rey-ne.\\nGar al-les daz my[n] h[er]z be-gert\\ndez bin ich von ir vn-ge-wert\\nden my-ne[n] wil-len tut sie ser\\nbu ich ir mit ein huß vo[n] helf-fen bey-ne\\nVnd wo sie wil vff wil-dem see.\\nso man-gel ich ir fru[n]t-schaft vnd ir hul-de\\nVnd brecht ich ir von ga-li-le\\nso kem ich vß ir schul-de\\nein gro-ßen berg wie füg ich daz.\\nda kung he-ro-des vf-fe saß\\nvnd ey und ey\\ndaz wer wol gein ir schon ein ub-er-gul-de\"]', '[\"Z. 5, S. 7: \'be\' von \'begert\' in der vorigen Zeile notiert\\nZ. 6, S. 6: \'vn\' von \'vngewert\' in der vorigen Zeile\\nZ. 8, S. 4: \'mit\' in der vorigen Zeile\\nZ. 9, S. 1-3: Rasur a c d, Korrektur F a h\\nZ. 12, S. 2-4: Streichung a a a G, Korrektur F F F E; E ohne Notenhals\\nZ. 13, S. 6:  Text \'füg\' oder \'fuͤg\' oder \'fuͦg\'\\nZ. 14, S. 2:  Text \'küng\' oder \'knuͤg\'\\nZ. 14: Streichung C3, Korrektur C2/F4 (Notenschlüssel)\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFont