(835, 'Ich wil dich bitten, milter got ... (Alment)', 'k Stolle/Alment 1', 'Stolle', 'German', 'k', 'fol. 706ra', 1, 1, '[\"F3 h c d d d \'F4 d c d d c h \'F4 c h h\\nh c d d c d c \'F4 d c c h c h h\\nd \'F4 d c c h G FE FE \'C2\\nh h a a F F [F] E E FE [E] \'\\nF4 E E E F F G h h\\nh \'F4 c c c h h a G F G G \'F4\\nE E E G G h h h \'F4\\nh c d d c d c c \'F4 c c h a F G G\\nd d d \'F4 c h c h h G a F F E F \'[F4]\\nD D E F G F E F h h \'[F4] a a F F F E D ED\",\"F3 h c d d d\\nF4 d c d d c h\\nF4 c h h \'h c d d c d c\\nF4 d c c h c h h \'d\\nF4 d c c h G FE FE\\nC2 \'h h a a F F [F] E E FE [E] \'\\nF4 E E E F F G h h \'h\\nF4 c c c h h a G F G G\\nF4 \'E E E G G h h h\\nF4 \'h c d d c d c c\\nF4 c c h a F G G \'d d d\\nF4 c h c h h G a F F E F\\n[F4] \'D D E F G F E F h h\\n[F4] a a F F F E D ED\"]', '[\"Ich wil dich bit-ten mil-ter got wan[n] du dorch vns den tot\\nan dem vil her-re[n] criu-ze litt daz du vß al-ler not\\nmir helf-fest durch die mu-t[er] din\\ndie dich on al-le[n] wa[n]-del meit ge-be-rẹ\\nBis ich ge-bus-se waz <i>[ich]</i> han ge-sun-det wy-der dich\\ndaz hilff mir vet-ter-lich-[er] got ge-ruch zu fe-ste[n] mich\\nvnd laß mich dir be-fol-hen sin\\ndurch di-ne tu-ge[n]d ny[m] mir my-ne swe-rẹ\\nMa-ri-a mut-[er] vn-de magt\\ngar wan-dels fry vnd al-l[er] mis-se-te-te\\nMin leyt sy dir al-so ge-clagt\\nhilff an der se-le mir vnd daz myn le-ben wer-de ste-te\\nVnd bit auch di-nen lie-ben son daz er die cris-ten-h[ei]ᵗ\\nbe-ke-re nach dem wil-len sin wan er die cron ob al-len kun-gen treit\"]', '[\"V. 1-9: Die Melodie ist in roter Tinte (korrekt) überschrieben; zum Teil mit zuvor in schwarzer Tinte fälschlichen Korrekturversuchen durch Überschreiben\\nSystem 3, Silben 1, 2: Das Notensystem ist an seinem Beginn verlängert für die beiden nachgetragenen Silben, bereits mit schwarzer Tinte\\nSystem 3, Silbe 10: d gestrichen, nachdem schon in rot nachgezeichnet worden war\\nV. 10-14: Die Melodieaufzeichnung inklusive der Notenschlüssel steht ausschließlich in roter Tinte \\nV. 1, S. 12, 13: Nachtrag, zuerst in schwarzer Tinte h (korrigiert c) h am linken Rand, anschließend in roter Tinte überschrieben\\nV. 2, S. 7: Streichung (schwarz, rot) d, Korrektur c (schwarz, rot) ohne Notenhals)\\nV. 2, S. 12: Streichung (schwarz) c, fehlerhafte Korrektur (schwarz) h, Korrektur (rot) c\\nV. 2, S. 13, 14: Korrektur h h (rot) über Gh G (schwarz)\\nV. 3: Rote Überschreibung d d c c h G FE FE über zwei, stellenweise drei schwarze Notate d/h d(?)/c d/c d/c/h d/c/h d/c/G c(ohne Notenhals)/FE d/FE\\nV. 4: Rote Überschreibung C2 (?) von C2/F4 (schwarz)\\nV. 4: Rote Überschreibung h h a a F F (F[schwarz]) E (ohne Notenhals) E (ohne Notenhals) FE; Korrektur aus (in schwarz) c/G c/G h/F h G G (F[schwarz]) E E FE\\nV. 4, S. 5: Möglicherweise ist eine sechste Silbe zu ergänzen, etwa E, vgl. Brunner\\nV. 5: Metrisch unterfüllt, mögliche Ergänzung \'ich\' auf Silbe 7; LDM: Das ausgelassene Personalpronomen geht hier mit metrischer Unregelmäßigkeit einher (Unterfüllung)\\nV. 9, S. 8: Schwarze Tinte mit roter identisch überschrieben; ggf. S. 7 h statt c (ohne Notenhals)\\nV. 12, S. 14, 15: Rasur (?) a a, Korrektur/Überschreibung G G\\nV. 13, S. 14: Ergänzung \'ei\' zum Auffüllen der Silbenzahl und für den Reimklang\\nV. 14: F4 anstelle von c1/F3 als Notenschlüssel anzunehmen , vgl. Brunner. Der custos am Ende von V. 13 spricht dafür\\nV. 14, S. 11: a eigentlich mit Notenhals\\nV. 14, S. 17: D eigentlich ohne Notenhals\\nV. 14, S. 18: Neumengraphie eigentlich anders\\nBrunner ergänzt am Ende von V. 4 ein E.\\nBrunner erwägt, dass im vorletzten System, Silbe 8 statt F der Ton e korrekt gewesen ein könnte (lies e?)\", \"\"]', NULL, 1, 31),
(836, 'Hoffart ist worden also groß (Aspiston)', 'k KonrW 1', 'Konrad von Würzburg', 'German', 'k', 'fol. 506r', 1, 1, '[\"F3 G a a a a a G \'F2 aG b}\\na b a a G a G\\nG a \'F3 a b a G F E D\\nD E \'F3 D D C D\\na a a a a a G \'F3 aG\\na G F E F G F FEF \'\\nF3 D F F F E F E/ E D\\nD \'F2 E D D C D\\na a a a a a G aG \'F3\\na h a a G a G\\nG a a \'F3 b a G F E D\\nD E D D \'F3 C D\\nG a a a a a G aG \'F3\\na G F E D F E EDE\",\"F3 G a a a a a G\\nF2 aG b} \'a b a a G a G \'G a\\nF3 a b a G F E D \'D E\\nF3 D D C D \'a a a a a a G\\nF3 aG \'a G F E F G F FEF \'\\nF3 D F F F E F E/ E D \'D\\nF2 E D D C D \'a a a a a a G aG\\nF3 \'a h a a G a G \'G a a\\nF3 b a G F E D \'D E D D\\nF3 C D \'G a a a a a G aG\\nF3 \'a G F E D F E EDE\"]', '[\"Hof-fart ist wor-den al-so groß\\nein ub-er-mes-sig bur-de\\nich gleu-be daz byss-her nie wur-de\\nme rech-te al-so vil\\nsit daz dez bö-sen geis-tez spil\\nsich in dem hoch-sten tron her-hub\\nDez must er wer-den sy-ge-loß\\njn slug doz en-gelz mur-de\\nher-ny-der zu der hel-le hür-de\\nda brint er o-ne zil\\nnoch nym-me me v[er]-le-sche[n] wil\\nsyt sich der freud al-so be-schub\\nWann luc-zi-fe-res schal-len val-len\\nmüst zu der sel-ben stunt\\ndez wart er je-mer-lich ver-wunt\\nvmb daz er sich wolt gli-chen\\ngot si-nen schop-fer al-so ri-chen\\ndez wart er vn-ge-sunt\\nda er her-dacht den bö-sen funt\\nda mit er hin zur hel-le grub.\"]', '[\"Mehrere Abweichungen im dritten Stollen (zu Beginn und am Ende)\\nStriche durch das Notensystem in Rot, außer nach V. 13, S. 5\\nV. 5, S. 4: \'bösen\' oder \'boͤsen\'\\nV. 8, S. 3: \'doz\' oder \'dez\'\\nV. 9, S. 8: \'hürde\' oder \'huͤrde\'\\nV. 13, S. 5: Halbstrich in schwarz\\nV. 14, S. 5: Textnachtrag \'stu[n]t\'\\nV. 15, S. 8: Nach der Silbe roter Strich hinter dem Text\\nV. 19, S. 6: \'bösen\' oder \'boͤsen\'\\n\\n\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1017\", \"custos\": \"[3,1,7,3,7,6,1,2,8,3]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"2\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"ABCDEFABCDEF\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(837, 'Waz in dem pardys ie wart gebildet und gemachet', 'k KonrW/HofT 1', 'Konrad von Würzburg', 'German', 'k', 'fol. 531ra', 1, 1, '[\"C2 a a h d d d d d \'C2F4 d c h h a a a\\na G F \'C2F4 E D F a a d d a a \'C2F4 G F E\\na a a a G F \'C2F4 E/ D F G a a h a aGa \'\\nC2F4 d e e e d d c d \'F4 a a F E D E D D D\\na \'C2F4 a a a h d d d-d/ \'C2F4 d c h h G a a\\na G E \'F3 F D F G a c d a a G a a \'F4\\na G F E D E F a d \'C2F4 d a a G a a\\nG a a a G \'C1F3 F E/ D F G a a h a \'C2 aGa\",\"C2 a a h d d d d d\\nC2F4 d c h h a a a \'a G F\\nC2F4 E D F a a d d a a\\nC2F4 G F E \'a a a a G F\\nC2F4 E/ D F G a a h a aGa \'\\nC2F4 d e e e d d c d\\nF4 a a F E D E D D D \'a\\nC2F4 a a a h d d d-d/\\nC2F4 d c h h G a a \'a G E\\nF3 F D F G a c d a a G a a\\nF4 \'a G F E D E F a d\\nC2F4 d a a G a a \'G a a a G\\nC1F3 F E/ D F G a a h a\\nC2 aGa\"]', '[\"Waz in dem pa-[ra]-dys ie wart ge-bil-det vnd ge-ma-chet\\nvor al-ler cre-a-tur ein wyp jn rech-ter lieb sie la-chet\\ngot hat sie wol be-sach-et jst war alz ez die schrif-te gicht\\nDa von die wyp sint fur die man bil-lich-en hoch ge-pri-set\\nWan-[e]n der man ist yr-de-nisch daz wip ge-pa-ra-dy-set\\nwer mich nu baz be-wy-set vff er-den wart nie bes-sers icht\\nWann wo ein wyp ist kusch on wan-del dem wil ich der vol-ge je-hen\\nWer dann ein wun-der wol-le spe_hen jn got-te-li-chen flys-se\\nder kies ein wyp die lu-ter sy on al-le fal-sche wy-se\\nwol ym der al-le si-ne tag mit einr al-so ver-flys-se\\njch sprich ir lop daz gli-ße fur al-les daz man le-bend sicht\"]', '[\"V. 1, S. 1, 2: Korrektur a a durch Überschreiben von F F\\nV. 5: Metrisch unterfüllt, für S. 1, 2 Brunner: \'Wan[e]n\'\\nV. 8 S. 14: Korrektur G durch Überschreibung von a\\nV. 8, S. 6 Korrektur c -> d durch Überschreibung\\nV. 9, ab S. 4: Vier Notenzeilen im System\\n\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1067\", \"custos\": \"[2,8,6,8,2,5,5,2,7,3,2,7,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"2\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"ABCABC\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(838, 'Ave Maria kusche maget stete', 'k KonrW_MorgenW 1', 'Konrad von Würzburg', 'German', 'k', 'fol. 512r', 1, 1, '[\"C1F3 G a a a a b a \'C1F3 a G a D/ a a a a \'F3 a h a\\nG a F F E D \'\\nC1F3 D D D D E F C/ G a \'C1F3 a a a b a\\nG a F \'C1F3 E D F F G G DE D\\nDDC \'C1F3 F G a a b a a G G F E\",\"C1F3 G a a a a b a\\nC1F3 a G a D/ a a a a\\nF3 a h a \'G a F F E D \'\\nC1F3 D D D D E F C/ G a\\nC1F3 a a a b a \'G a F\\nC1F3 E D F F G G DE D \'DDC\\nC1F3 F G a a b a a G G F E\"]', '[\"A-ve Ma-ri-a ku-sche ma-get ste-te. wie gern ich fra-ge te-te\\ndu key-ser-li-che meit\\nwo-hin din kint be-ke-me al nach dez to-des re-me\\nsich daz wil ich dir sa-gen sun-der lau-gen\\nEr gẹley-te da sin frunt den scha-cher wy-se hin zu den pa-ra-dy-se\\ndaz sy dir nuͦ ge-seit\\ndu myn vil trut-ge-sel-le dar nach fur er zur hel-le\\ndar vß her lost er sin er-wel-ten tau-gen.\\nEr lost in le-wen creft vß hel-le her ad-am\\nVnd jhe-re-my-am vnd jo-hans bap-tis-ten den wolt er auch ge-fris-ten\\nbeyd frau-wen vn-de man,\\ndie lost er an der stun-de diess vß der hell ab-grun-de\\nVnd gab da liecht vil man-gen blin-den au-gen\"]', '[\"V. 12, Z. 3: Streichung \'s\'\\nV. 7-12: Durch Wiederholungszeichen angegeben\\nV. 5: \'die steyg\' in Rot auf dem Notensystem geschrieben\\nV. 5, S. 2: \'gẹleyte\' vgl. Brunner\\nV. 10: Der dritte Stollen ist nicht ausnotiert; stattdessen steht unter dem letzten Notensystem: \'Furbas aber ein stoll als vor\'\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1029\", \"custos\": \"[3,3,7,3,6,5]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"2\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"ABCDABCDEABCD\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(840, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'Mt', '68v', 1, 1, '[\"C1 a _h a G a G FFE \'C1 F G G\\nC D DE G \'C1 a G FE D C D\\na _h a G \'C1 a G FE F G G\\nC D DE G a G \'C1 FE D C D\\nE F EDC C E G \'C1 Ga _h a G\\ncc(h) a G G a h c \'C1 a G E\\nF E D D E \'C1 F G aG GF Ga\\nc a G G E C \'C1 D E FE ED //\",\"C1 a _h a G a G FFE\\nC1 F G G \'C D DE G\\nC1 a G FE D C D \'a _h a G\\nC1 a G FE F G G \'C D DE G a G\\nC1 FE D C D \'E F EDC C E G\\nC1 Ga _h a G \'cc(h) a G G a h c\\nC1 a G E \'F E D D E\\nC1 F G aG GF Ga \'c a G G E C\\nC1 D E FE ED //\"]', '[\"De fi-ne_a-mor vient se-an-ce_et biau-tez,\\net a-mors vient de ces deus au-tre-ssi\\nTuit troi sont un, que bien j\'ai pen-sé,\\nJa ne se-ront a nul jor de-par-ti.\\nPar un con-seil ont tuit troi es-ta-bli\\nlor cor-re-ors, qui sont a-vant a-lé:\\nde moi ont fet tout lor che-min fer-ré;\\ntant l’ont u-sé ja n’en se-ront par-ti. \"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f154.item.r=fr\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 128, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(841, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'R', '43v', 1, 1, '[\"C1b} a b a G a G FE F G G\\nC \'C1 D DE G a G FE D C D\\na b \'C1 a G a G FE F G G\\nC D DE G a G \'C1 FE D C D\\nE F ED C E G Ga \'C1b} b a G\\nc a G G a b c a G D\\nF E \'C1 D E E F F G a GF FG\\nc a GG \'C1 E C D E FED DC //\",\"C1b} a b a G a G FE F G G \'C\\nC1 D DE G a G FE D C D \'a b\\nC1 a G a G FE F G G \'C D DE G a G\\nC1 FE D C D \'E F ED C E G Ga\\nC1b} b a G \'c a G G a b c a G D \'F E\\nC1 D E E F F G a GF FG \'c a GG\\nC1 E C D E FED DC //\"]', '[\"De fine a-mour vient scien-ce et bon-té,\\net A-mours vient de ces deus au-tre-si\\ntous trois sont uns, qui bien i a pen-sé,\\nja ne se-ront a nul jour de-par-ti.\\nPar un con-seil sont touz trois es-ta-bli\\nleur cour-re-eur, qui ont a-vant a-lé.\\nDe moi ont fai tout leur che--min far-ré,\\ntant l\'ont usé, ja n\'en se-ront par-ti.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b8454668b/f92.item.r=1591%20thibaut%20de%20champagne\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 467, \"facsimileY\": 1200, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(842, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'O', '38r', 1, 1, '[\"C1 a b a G a \'C1 G GFE F G G\\nC D DE G \'C1 a G FE D C D\\na b a \'C1 G a G GFE F G G\\nC D \'F2 DE G a G FF D C D\\nF E \'F2 D D E F G a F \'C1 Ga\\ncc(h) a G G a h cc(h) a \'C1 G FE\\nF E D D E F \'C1 G G F Ga\\ncc h G G E \'F2 C D E F FED //\",\"C1 a b a G a\\nC1 G GFE F G G \'C D DE G\\nC1 a G FE D C D \'a b a\\nC1 G a G GFE F G G \'C D\\nF2 DE G a G FF D C D \'F E\\nF2 D D E F G a F\\nC1 Ga \'cc(h) a G G a h cc(h) a\\nC1 G FE \'F E D D E F\\nC1 G G F Ga \'cc h G G E\\nF2 C D E F FED //\"]', '[\"De bone a-mour vient se-ance et beau-tez,\\net a-mors vient de ces deus au-tre-si.\\nTuit troi sont un, que bien i ai pan-sey,\\nja ne se-ront a nul jor de-par-ti.\\nPer un con-soil ont en-sam-ble_es-tau-bli\\nli cor-re-or, en sont a-vant a-lé:\\nde moi ont fait tout lor che-min fer-ré;\\ntant l\'ont u-sey, ja n\'en se-ront par-ti.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b6000950p/f105.item.r=fr\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 2200, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11);
