(843, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'V', '25r', 1, 1, '[\"C2b} a b a G a(G) F FED \'C2 E G G\\nC D DE G a \'C2 G FE D C D\\na b a G a \'C1 G FED F G G\\nC D D(E) G \'C1 a G F(E) D C D\\nE F E \'C1 F G a h(c) a G F Ga\\nc(h) a \'C1 G G a h c(h) a GF FE\\nE F \'C1 E D D E F G F Ga \'\\nC1 c(h) a G G E C D E F(E) ED //\",\"C2b} a b a G a(G) F FED\\nC2 E G G \'C D DE G a\\nC2 G FE D C D \'a b a G a\\nC1 G FED F G G \'C D D(E) G\\nC1 a G F(E) D C D \'E F E\\nC1 F G a h(c) a G F Ga \'c(h) a\\nC1 G G a h c(h) a GF FE \'E F\\nC1 E D D E F G F Ga \'\\nC1 c(h) a G G E C D E F(E) ED //\"]', '[\"De jeu-ne_a-mour vient se-an-ce_et biau-té,\\net a-mours vient de ces deus au-tre-si.\\nLi troi sont un, que bien l’ai es-prou-vé;\\nJa a nul jour n’en se-ront de-par-ti.\\nPar un con-seil ont en-sam-ble es-ta-bli\\nli co-re-our, qui sont a-vant a-lé:\\nde mon cuer ont fet leur che-min fer-ré;\\ntant l’ont u-sé, ja n’en se-ront par-ti.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84386028/f63.item.r=FR\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(844, 'De fin\'Amors si vient seance et bonté', 'Linker 240.14', 'Thibaut de Champagne', 'French', 'X', '32r', 1, 1, '[\"C1b} a b a G a \'C1 G FE F G G\\nC D DE \'C1 G a G FF(E) D C D\\na \'C1b} b a G a G FE F \'C1 G G\\nC D DE G a G FF(E) \'C1 D C D\\nE F E DC E \'C1b} G Ga b b aGa G\\nc a G G a \'C1 b c b a GF\\nG E FED \'C1 D E F G a GF Ga\\ncc(h) \'C1 a G a F D E F FFE ED //\",\"C1b} a b a G a\\nC1 G FE F G G \'C D DE\\nC1 G a G FF(E) D C D \'a\\nC1b} b a G a G FE F\\nC1 G G \'C D DE G a G FF(E)\\nC1 D C D \'E F E DC E\\nC1b} G Ga b b aGa G \'c a G G a\\nC1 b c b a GF \'G E FED\\nC1 D E F G a GF Ga \'cc(h)\\nC1 a G a F D E F FFE ED //\"]', '[\"De bo-ne_a-mor vient se-an-ce_et biau-té,\\net a-mors vient de ces deus au-tre-si.\\nLi troi sont un, que bien l’ai es-pro-vé;\\nJa a nul jor n’en se-ront de-par-ti.\\nPar un con-seil ont en-sen-ble es-ta-bli\\nli co-re-or, qui sont a-vant a-lé:\\nde mon cuer ont fait lor che-min fer-ré;\\ntant l’ont u-sé, ja n’en se-ront par-ti.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f71.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 941.1111450195312, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(845, 'Dame, l\'on dit que l\'on muert bien de joie', 'Linker 240.13', 'Thibaut de Champagne', 'French', 'Mt', '76r', 1, 1, '[\"C3 e f g fed c h C2 aGF \'C3 G ah chha h\\nh c d d e f e dc \'C3 de d\\ne f g fe d c h C2 aGF G \'C3 ah chha h\\nh c d d e f e dc de d\\nefg \'C3 fe d c e f g +a f g\\ne \'C3 f g fed h c d e f e(d)ed dc \'\\nC3 h c d d h G d de f ed dc //\",\"C3 e f g fed c h C2 aGF\\nC3 G ah chha h \'h c d d e f e dc\\nC3 de d \'e f g fe d c h C2 aGF G\\nC3 ah chha h \'h c d d e f e dc de d \'efg\\nC3 fe d c e f g +a f g \'e\\nC3 f g fed h c d e f e(d)ed dc \'\\nC3 h c d d h G d de f ed dc //\"]', '[\"Da-me, l’en dit que l’en muert bien de jo-ie,\\nje l’ai dou-té, més ce fu por no-ient,\\nque je cui-do-ie, s’en-tre vos braz es-to-ie,\\nque fe-nis-se i qui jo-ieu-se-ment.\\nSi dou-ce mors fust bien a mon ta-lent,\\nque la do-lors d’a-mors qui me guer-ro-ie\\npar est si grans que dou mo-rir m’es-fro-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 11),
(846, 'Dame, l\'on dit que l\'on muert bien de joie', 'Linker 240.13', 'Thibaut de Champagne', 'French', 'V', '26v', 1, 1, '[\"C1 c h c cha G a \'C1 h c h haG a\\nF G G G \'C1 a c d cha G F\\nc h c \'C1 cha G a h c h aGF G\\na \'C1 a c cha G a h c aG F \'\\nC1 E G a G FE D E F \'C1 G G\\na aGF F E FGa GFG \'C1 F G E FED C\\nE G a G \'C1 a c h aG F aGFE DC //\",\"C1 c h c cha G a\\nC1 h c h haG a \'F G G G\\nC1 a c d cha G F \'c h c\\nC1 cha G a h c h aGF G \'a\\nC1 a c cha G a h c aG F \'\\nC1 E G a G FE D E F\\nC1 G G \'a aGF F E FGa GFG\\nC1 F G E FED C \'E G a G\\nC1 a c h aG F aGFE DC //\"]', '[\"Da-me, l’en dist que l’en meurt bien de jo-ie,\\nje l’ai dou-té, més ce fu por no-iant,\\nque je cui-dai, s’en-tre voz braz es-toi-e,\\nque je fe-nisse i-leuc jo-ieu-se-ment.\\nSi dou-ce mort fust bien a mon ta-lent,\\nque la do-lorz d’a-mours qui me guer-ro-ie\\npar est si granz que du mo-rir m’es-fro-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(847, 'Dame, l\'on dit que l\'on muert bien de joie', 'Linker 240.13', 'Thibaut de Champagne', 'French', 'O', '35r', 1, 1, '[\"C3 e f g fed c h \'C2 aGF G ah cha h\\nh c d d \'C3 e f e dc de d\\ne f g \'C2 fed c h aGF G ah cha h\\nh \'C3 c d d e f e dc de d\\nefg \'C3 fe fed c e f g +a f \'C3 g\\ne f g(f) edc h c d \'C2 e f ee(d) dc\\nh c d d \'C2 h G d e f ee(d) dc//\",\"C3 e f g fed c h\\nC2 aGF G ah cha h \'h c d d\\nC3 e f e dc de d \'e f g\\nC2 fed c h aGF G ah cha h \'h\\nC3 c d d e f e dc de d \'efg\\nC3 fe fed c e f g +a f\\nC3 g \'e f g(f) edc h c d\\nC2 e f ee(d) dc \'h c d d\\nC2 h G d e f ee(d) dc//\"]', '[\"Da-me, l’en dit que l’en muert bien de jo-ie,\\nje l’ai dou-té, mais ce fu por ne-ant,\\nque je cui-dai, s’en-tre vos braz es-to-ie,\\nque je fus-se en qui jo-iou-se-ment.\\nSi dou-ce morz fust bien a mon ta-lant,\\ncar la do-lors d’a-mors qui me guer-ro-ie\\npar est si granz que de mo-rir m’es-fro-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
