(857, 'Par quel forfait ne per quel mesprison', 'Linker 38.13', 'Chastelain de Coucy', 'French', 'U', '41v', 1, 1, '[\"C1 h c ha h a G F G a G\\nh c d dc \'C1 ha G d c h haG\\nh c ha h a G F G a G \'\\nC1 h c d ddc ha G d c h haG\\nC2 d e f ed dc \'C1 a h d ch a\\nah c d dc a G a h cch aG \'\\nC1 a h aG a a h c a h d\\nC3 d e g f e dc h \'C2 a c dcde\\nG a GF G a h c d cha haG\",\"C1 h c ha h a G F G a G \'h c d dc\\nC1 ha G d c h haG \'h c ha h a G F G a G \'\\nC1 h c d ddc ha G d c h haG \'C2 d e f ed dc\\nC1 a h d ch a \'ah c d dc a G a h cch aG \'\\nC1 a h aG a a h c a h d \'C3 d e g f e dc h\\nC2 a c dcde \'G a GF G a h c d cha haG\"]', '[\"Par quel for-fait ne per quel mes-pri-son\\nm\'a-vez, a-mors, si de vos es-loi-gnié\\nque de vos n\'ai ne bien ne guer-re-don,\\nne je ne truis qui de moi ait pi-tié?\\nMa-le-ment ai mon se-vi-se_en-plo-ié\\nc\'ainz de par vos ne me vint se mals non\\nen-cor a-mors ne•l vos ai re-pro-ié\\nmon ser-vi-se, mais o-re m\'en plaig gié\\net di que mort m\'a-vez senz o-qui-son.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f90.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
