(861, 'Espris d\'amor et se longue atandance', 'Linker 265.593', 'Author of Linker 265.593', 'French', 'U', '44v', 1, 1, '[\"F3 aG GF ED F G a GF ED C FEDE D\\nFGF ED C \'F3 F G a GF ED C D\\nFGF ED C D E G F E G aGa F3 a \'\\nch aG F E D C D F E D\\na d c d C2 e \'C1 c a F FG a\\nc d c a b} b aG F a c baGFG a\\ncbG G \'F2 aG FG FE C E F E D\",\"F3 aG GF ED F G a GF ED C FEDE D \'FGF ED C\\nF3 F G a GF ED C D \'FGF ED C D E G F E G aGa F3 a \'\\nch aG F E D C D F E D \'a d c d C2 e\\nC1 c a F FG a \'c d c a b} b aG F a c baGFG a \'cbG G\\nF2 aG FG FE C E F E D\"]', '[\"Es-pris d\'a-mor et de lon-gue_a-tan-dan-ce\\nm\'es-tuet chan-ter por ce-li cui j\'aim tant,\\nen li a-mer ai to-te m\'es-pe-ran-ce\\nse ne li os des-co-vrir mon ta-lant,\\nne d\'au-tre_a-mor nul se-cors n\'en a-tent;\\nen-si por-rai mo-rir sa sa vail-lan-ce\\nou a mon chant ne s\'en va par-ce-vant.\"]', '[\"5.1-2: A syllable, <i>ia</i>, was supplied by the corrector as a tentative amendment to the disallinement of text and melody in 5.2-4. However, the addition is unjustified as it is supernumerary. The correspondence of syllables and notes is thus here reestablished.\\n<br>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f96.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 121, \"facsimileY\": 621.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(862, 'Amors me semont et prie / que je chant', 'Linker 265.101', 'Author of Linker 265.101', 'French', 'U', '45r', 1, 1, '[\"C1 c haG a G c h aG a\\nah aG G\\nE F \'C1F3 G FE F DE FD D\\nc haG a G c h aG a\\nah aG G \'\\nF3 E F G E F DE FD D\\nc h d cha G G(a) \'C1F3 ch a\\na h c C2 d e cd cha G\\na h c a F3 G FED DE\\nF ED C \'C1 a ahc aGF EDE D\",\"C1 c haG a G c h aG a \'ah aG G \'E F\\nC1F3 G FE F DE FD D \'c haG a G c h aG a \'ah aG G \'\\nF3 E F G E F DE FD D \'c h d cha G G(a)\\nC1F3 ch a \'a h c C2 d e cd cha G \'a h c a F3 G FED DE \'F ED C\\nC1 a ahc aGF EDE D\"]', '[\"A-mors me se-mont et pri-e\\nque je chant,\\nmais ma do-lors lo me def-fent\\nsi est bien droiz que je di-e\\nson ta-lent,\\nmais trop m\'a fait mon cuer do-lant\\npor ce-li cui j\'ai ser-vi-e\\net si ne.l cui-das-se mi-e\\nque por nu-le rien vi-vant\\nlas-sas-se sa com-pai-gni-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f97.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 65, \"facsimileY\": 535.5, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(863, 'Qant li estez et la dolce saisons', 'Linker 38.14', 'Chastelain de Coucy', 'French', 'U', '45v', 1, 1, '[\"F3 D F G a a a a a aG GF\\nF G aG FE D C DE \'F3 FG FE D\\nD F G a a a a a aG GF\\nF G aG \'F3 FE D C DE FG FE D\\nC1 c a c d c b aG F FG a \'\\nF3 a G c b a G F E DE DC\\nC D E F E G \'F3 F E G a\\naG F G FE D C DE GF FE ED\",\"F3 D F G a a a a a aG GF \'F G aG FE D C DE\\nF3 FG FE D \'D F G a a a a a aG GF \'F G aG\\nF3 FE D C DE FG FE D \'C1 c a c d c b aG F FG a \'\\nF3 a G c b a G F E DE DC \'C D E F E G\\nF3 F E G a \'aG F G FE D C DE GF FE ED\"]', '[\"Qant li es-tez et la dol-ce sai-sons\\nfait fuel-le_et flor et les préz ren-ver-dir,\\nque li dolz chanz des me-nuz oi-seil-lons\\nfait les plu-sors de jo-ie sou-ve-nir;\\nlas, chas-cuns chan-te_et je plor et sos-pir,\\nmais ceu n’est pas droi-tu-re ne rai-sons;\\ncar c\'est a-dés to-te m’en-ten-cï-ons,\\nda-me, de vos ho-no-rer et ser-vir.\"]', '[\"\",\"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f98.item\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 87, \"facsimileY\": 314.5, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 120, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(864, 'Chevauchoie lez un bruel', 'Linker 265.357', 'Author Linker 265.357', 'French', 'U', '46r', 1, 1, '[\"C1b} a b c b c ba G\\na b c b c ba G \'\\nC1b} a b aG F a G G\\na b a G G C F\\nE D C\\nG C \'C1b} G G G G G G G G G C\\nG G F a b a G\\nG a \'C1b} F a G G C\\nF E D C\\nG G FE D\\nF G ED \'C1F3b} C\\nC D C D E FE DC C\\nFG a DC EF G FED CD FED\",\"C1b} a b c b c ba G \'a b c b c ba G \'\\nC1b} a b aG F a G G \'a b a G G C F \'E D C \'G C\\nC1b} G G G G G G G G G C \'G G F a b a G \'G a\\nC1b} F a G G C \'F E D C \'G G FE D \'F G ED\\nC1F3b} C \'C D C D E FE DC C \'FG a DC EF G FED CD FED\"]', '[\"Che-vau-choi-e lez un bruel\\nchan-tant en-si con je suel,\\ntro-vai pas-to-re que vuel\\nto-te sou-le senz or-goil\\nen des-tor,\\nhe o,  do-re-lo,  do-re-lo,  do-re-lo do!\\nialz vairs et fre-che co-lor,\\nou chan-toit coil-lant la flor\\nun son d\'a-mor.\\nPor la dol-cor\\nce-le part tor;\\nsi de-cen-di soz un au-bor,\\ndou-ce-ment, que n\'e-üst pa-our.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f99.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 79, \"facsimileY\": 302, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(865, 'Bien doit chanter qui fine amor adrece', 'Linker 24.5', 'Blondel de Nesles', 'French', 'K', '112a-b', 1, 1, '[\"C3 f f fe ed e f \'C3 gf d h cch aG\\na h c h \'C2 a h ch aGa aGF G\\nf \'C3 f fe ed e f gf d h cch aG \'\\nC2 a h c h a h ch aGa aGF \'C2 G\\na c cha c d e \'C3 f fed edc d\\ne f g \'C3 f e f g(f) ede edc d \'\\nC3 e f g c d f e d cc(b) \'C2b} aG\\na b aGF b c \'C2b} de dd(c) baG Gab baG GF\\nG b aGF \'C2b} b c d dd(c) baG abc baG\",\"C3 f f fe ed e f\\nC3 gf d h cch aG \'a h c h\\nC2 a h ch aGa aGF G \'f\\nC3 f fe ed e f gf d h cch aG \'\\nC2 a h c h a h ch aGa aGF\\nC2 G \'a c cha c d e\\nC3 f fed edc d \'e f g\\nC3 f e f g(f) ede edc d \'\\nC3 e f g c d f e d cc(b)\\nC2b} aG \'a b aGF b c\\nC2b} de dd(c) baG Gab baG GF \'G b aGF\\nC2b} b c d dd(c) baG abc baG\"]', '[\"Bien doit chan-ter qui fi-ne_a-mor a-dre-ce\\nde jo-ie_a-voir, mez pas ne m’en se-mont,\\nqu\'en moi ne truis ne jo-ie ne le-e-ce\\npar quoi je chant, ne ne sa-vro-ie dont.\\nEt non-por-quant, se mon mal ne des-pont,\\nqu\'en-tre ma da-me_et fi-ne_a-mor me font,\\nbien puis mo-rir, que ja ne le sav-ront,\\nse par mon chant n\'en se-vent la des-tre-ce,\\nou par mon vis, dont la dou-leur me font.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f138.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 127, \"facsimileY\": 950, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(867, 'Qant per la froidure', 'Linker 265.1472', 'Author of Linker 265.1472', 'French', 'U', '46v', 1, 1, '[\"C2 c d e d c c\\nC3 f g +a g f e \'\\nC3 g f e d c cch\\naG a c d e e\\ng f e d \'C3 e dd(e)\\nf e d c d b} cb\\ne d c b c c\\ne d c b d cb\\ne c \'C3 d h G G\\ne f ed b} c c b\\nf e e d d c c b\\nh} d c ha \'C3 h c c\\nh a h c ha Ga\\nh G a h G Ga\\nc d cha h c c \'\\nC3 c d cha h d de\\nc d h G a h} ah\\nc d cha h c c\",\"C2 c d e d c c \'C3 f g +a g f e \'\\nC3 g f e d c cch \'aG a c d e e \'g f e d\\nC3 e dd(e) \'f e d c d b} cb \'e d c b c c \'e d c b d cb \'e c\\nC3 d h G G \'e f ed b} c c b \'f e e d d c c b \'h} d c ha\\nC3 h c c \'h a h c ha Ga \'h G a h G Ga \'c d cha h c c \'\\nC3 c d cha h d de \'c d h G a h} ah \'c d cha h c c\"]', '[\"Qant per la froi-du-re\\net re-vient l\'ar-du-re\\ndou tans qui m\'a-gre-e,\\nche-val-chant ma mu-re\\nto-te m\'am-ble-ü-re,\\nvi par a-ven-tu-re\\nlez u-ne ra-me-e\\nu-ne cri-a-tu-re\\nsou-le_et es-ga-re-e\\nqui n\'ert pas se-gu-re\\npor ceu q\'e-le_ot a-di-re-e\\nsa cha-pe-te bu-re.\\nFa-ce_ot cle-re_et pu-re\\net gen-te fai-tu-re,\\nto-te_es-che-ve-le-e.\\nSe mau-dit et ju-re\\net dit: \'Trop fu du-re\\nl\'o-re que fu ne-ie.\'\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f100.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 155, \"facsimileY\": 32, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 140, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(868, 'Je me chevalchoie / par mi un prael', 'Linker 265.881', 'Author of Linker 265.881', 'French', 'U', '47r', 1, 1, '[\"C3 c c c e gf e\\nd c h d c\\nc c c e gf e\\nd \'C3 c h d c\\nf f f d f ed\\ne f g d c baG\\na b d \'C3b} b c\\nd e f ed c\\nG b G b dc cbc\",\"C3 c c c e gf e \'d c h d c \'c c c e gf e \'d\\nC3 c h d c \'f f f d f ed \'e f g d c baG \'a b d\\nC3b} b c \'d e f ed c \'G b G b dc cbc\"]', '[\"Je me che-val-choi-e\\npar mi un pra-el;\\nde jos-te_u-ne_ar-broi-e,\\nlez un or-mis-sel,\\nla tro-vai grant joi-e.\\nPas-to-re_en l\'ar-broi-e,\\nen sa main fres-tel,\\nchan-te_un son no-vel;\\nvuet que Ro-bins l\'oi-e.\"]', '[\"Notes:\\nThe piece is notated on the first stanza and from ll. 5-9 of the second stanza without any break, while ll. 1-4 of the second stanza are missing.\\n<br/>\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f101.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 61, \"facsimileY\": 181, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(869, 'Pieç\'a que savoie', 'Linker 265.1325', 'Author of Linker 265.1325', 'French', 'U', '48r-v', 1, 1, '[\"C2 c d a G G G\\na h c a G G G\\nc d a \'C1 G G G\\na h ch a G G G\\nF a a a\\nG h h h\\na \'C1 c a G G G\\nF a a a\\nG ah h h\\na h c a G G G \'\\nC2 d c d e f e\\nd c d e d d\\nd c d e f e\\ndc \'C2 d e d d\\nh d d e d\\nc d h\\nc d \'C2 e d c d h\\na h c a G G G\\na h c a G G G\\na \'C2 h c h a c c\\nd e d d c d d\\ne d c h a G G \'\\nC2 a c c h a c c\\nd e d d c d d\\ne d c h a G G \'\\nC2 a c h a c d\\ne d c h d\\nG a h c h a G\",\"C2 c d a G G G \'a h c a G G G \'c d a\\nC1 G G G \'a h ch a G G G \'F a a a \'G h h h \'a\\nC1 c a G G G \'F a a a \'G ah h h \'a h c a G G G \'\\nC2 d c d e f e \'d c d e d d \'d c d e f e \'dc\\nC2 d e d d \'h d d e d \'c d h \'c d\\nC2 e d c d h \'a h c a G G G \'a h c a G G G \'a\\nC2 h c h a c c \'d e d d c d d \'e d c h a G G \'\\nC2 a c c h a c c \'d e d d c d d \'e d c h a G G \'\\nC2 a c h a c d \'e d c h d \'G a h c h a G\"]', '[\"Pie-ç\'a que sa-voi-e\\nque por ce la per-droi-e\\nque trop la ser-vo-ie\\net cre-moi-e_et a-moi-e.\\nPor ce per-drai\\nque trop l’a-mai\\net aim to-te voi-e\\net a-me-rai\\net ser-vi-rai,\\nen quel leu que je soi-e.\\nJe la ser-vi-roi-e,\\nmais e-le nel dai-gne,\\nnes que se j’es-toi-e\\nuns hom d’Es-pai-gne,\\nainz me dit, quant sui\\nde-vant li,\\nque j’aim ma da-me ce-li\\nsi me met ta-che seu-re,\\nsi m’o-cit et a-qeu-re.\\nCer-tes, je n’a-me-roi-e\\nto-tes ce-les que voi-e\\ns’or me co-roi-ent seu-re,\\nne fai-re nel po-roi-e\\nse je bien lo vo-loi-e.\\nGar-dez por coi de-meu-re\\nla granz jo-ie_a do-ner\\nqui me fait trem-bler\\net plo-rer par main-te_eu-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f104.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, 