(870, 'En icel tens que je voi la froidor', 'Linker 73.11', 'Gautier de Dargies', 'French', 'U', '49v', 1, 1, '[\"C3b} ffe dccb cd ef g fg+a gfe dc cb aGab\\nC2b} aGF a bc c c d \'C2b} dcb cde dc ba aG\\nC3b} ffe dccb cd ef g(f) fg+a gfe dc cb aGab\\nC2b} aGF a bc c \'C2b} c dc cb cde dc baaG GF\\nF a bc c c dc cb cde dc cba b \'\\nC4b} edcb c cd f g fg+a gfe dc cb c\\nd e fe dc b def \'C2b} dc b cb aGF\\nF a bc c e f edc e C3b} fg fedc a\\nbaG a \'C2b} bc c e fe dc d c abcbaG aGF\",\"C3b} ffe dccb cd ef g fg+a gfe dc cb aGab \'C2b} aGF a bc c c d\\nC2b} dcb cde dc ba aG \'C3b} ffe dccb cd ef g(f) fg+a gfe dc cb aGab \'C2b} aGF a bc c\\nC2b} c dc cb cde dc baaG GF \'F a bc c c dc cb cde dc cba b \'\\nC4b} edcb c cd f g fg+a gfe dc cb c \'d e fe dc b def\\nC2b} dc b cb aGF \'F a bc c e f edc e C3b} fg fedc a \'baG a\\nC2b} bc c e fe dc d c abcbaG aGF\"]', '[\"En i-cel tens que je voi la froi-dor\\nnoif et gre-sil re-ma-noir, et bos-ca-ge\\nfoil-lis-sent tuit en-con-tre la dou-çour\\ndel tens d’es-té, chan-tent oi-sel sal-va-ge\\nlors s\'es-jo-ïst chas-cuns en son lan-gai-ge,\\nhe las, chai-tis! et je tot a-des plor\\nfors qu’en chan-tant ra-man-toi ma do-lor\\nque j’ai sof-fert lonc tens en mon a-ai-ge;\\nmo-rir en cuit, se ne me ras-sou-a-ge.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f106.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 151, \"facsimileY\": 151, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2,