(871, 'Eyn wunder in der werlde vert', 'J WAlex 15-16', 'Der Wilde Alexander', 'Middle High German', 'J', 'fol. 23r', 1, 1, '[\"a h c d ch cd cha \'Ga\\n[c] c cha a aGF FGa GFED \'CD\\nC D F F FG a \'GFED\\na h c d ch cd cha Ga \'\\n[c] c cha a aGF FGa GFED CD \'\\nC D F F FG a GFED \'\\nD F FED F F G abaG a\\na \'h c d d fed cdcba Ga \\nD \'F FED F FGa a GFE FG FED \'\\nD F FED F F G abaG a\\na \'h c d d fed cdcba Ga \\nD F FED \'F FGa a GFEFG FED D\",\"a h c d ch cd cha\\nGa \'[c] c cha a aGF FGa GFED\\nCD \'C D F F FG a\\nGFED \'a h c d ch cd cha Ga \'\\n[c] c cha a aGF FGa GFED CD \'\\nC D F F FG a GFED \'\\nD F FED F F G abaG a \'a\\nh c d d fed cdcba Ga  \'D\\nF FED F FGa a GFE FG FED \'\\nD F FED F F G abaG a \'a\\nh c d d fed cdcba Ga  \'D F FED\\nF FGa a GFEFG FED D\"]', '[\"Do durch der werlde um-muͦ-zi-cheit \\nher abe von ku-ninges kun-ne schreit \\ndaz tich-ten unde daz sin-gen, \\nvon sun-de-haf-ten sculden ez quam, \\ndaz daz sei-ten-spil ur-loͮb nam \\nunde der junc-vrou-wen spryn-gen. \\ndo viel ez an die er-geren hant: \\nein ar-me diet sich_es un-der-want, \\nof daz der kunste nicht gien-ge a-be. \\ndo truͦgen die her-ren durch die kunst \\nden sel-ben hel-fe-be-re gunst \\nunde ner-ten sie mit varen-der ha-be.\\n\\nSwer in daz recht vuͦr-stuͦr-tzen wil, \\n_ der sol u-ben sey-ten-spil \\nunde nu-we lie-der sin-gen \\nunde scric-ken tzuͦ der hoch-get-zit. \\nalso vuͦr der ar-ken kuninc Da-vit. \\ndie brut sol sel-ben sprin-gen, \\nalso kuninc He-ro-des toch-ter spranc. \\nso nympt die kunst eynen wi-der-wanc \\nhen of, sam sie her abe ist ko-men. \\ndunct a-ber ű_daz ein sceme-lich leben \\nunde kunt ir_es nicht, so sult ir geben \\nden, die sich kunst haben an ge-no-men.\\n \\n\",\"\"]', '[\"\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001155/Ms-El-f-101_022r.tif\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,n