(872, 'Mar vit raison qui couvoite trop haut', 'Linker 35.1', 'Chardon de Croisilles', 'French', 'U', '50r', 1, 1, '[\"C2 d d h c h h hah ch ha aG \'\\nC2 a G d edc h h aG aG GF G\\nd e f ed e dc \'C2 ha h ch ha\\nhc d d ch a G ahc h ha aGa\\nc c d \'C2 e c def edc d e d\\nf f f fe c d dc a ch aGa \'\\nC2 c d d ch a G c d e dcha c\\nd hG a c d ef ed \'C2 e d cha aG\",\"C2 d d h c h h hah ch ha aG \'\\nC2 a G d edc h h aG aG GF G \'d e f ed e dc\\nC2 ha h ch ha \'hc d d ch a G ahc h ha aGa \'c c d\\nC2 e c def edc d e d \'f f f fe c d dc a ch aGa \'\\nC2 c d d ch a G c d e dcha c \'d hG a c d ef ed\\nC2 e d cha aG\"]', '[\"Mar vit rai-son qui cou-voi-te trop haut\\net bo-ne-ment vuet es-tre fins a-mis.\\nPor moi lo di, cui bo-ne_a-mors as-saut,\\nn\'on-ques nul jor ne-ient ne li mes-dis;\\nmais le-au-ment l\'ai ser-vi-e toz jors,\\nplains de de-sirs et de dou-ces do-lors,\\ndont la do-lor tieng a be-ne-ü-re-ie,\\nquant la meil-lor du mon-de_ai e-na-me-ie.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f107.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 907, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
