(888, 'Ne me done pas talent', 'Linker 185.12', 'Moniot d\'Arras', 'French', 'U', '52r-52v', 1, 1, '[\"F3 a a GF aG GE F EDC\\nD E F G FED C CD\\na \'F3 a GF aG GE F EDC\\nD E F G FED C CD\\nF FE F G \'F3 a aG aa(h)\\nc ch a G a a GFG\\na b aG a GF E \'F3 DCDE\\nG F ED DC F E DCDED DC\",\"F3 a a GF aG GE F EDC \'D E F G FED C CD \'a\\nF3 a GF aG GE F EDC \'D E F G FED C CD \'F FE F G\\nF3 a aG aa(h) \'c ch a G a a GFG \'a b aG a GF E\\nF3 DCDE \'G F ED DC F E DCDED DC\"]', '[\"Ne me do-ne pas ta-lent\\nde chan-ter li mois de mai,\\nmais A-mors de cui je sent\\nun no-vel con-fort que j’ai,\\nqant ce-le qui lon-ge-ment\\nm’a te-nu en son es-mai\\nre-çoit mon ser-vi-se_et prent,\\net je plus ne li quier mi-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f111.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 122, \"facsimileY\": 946, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(889, 'An chantant m\'estuet complaindre', 'Linker 65.32', 'Gace Brulé', 'French', 'U', '52v', 1, 1, '[\"C2h} c c d f e dc cd dc\\na hc c d ch \'C2 aGa hc\\nc c d f e dc cd dc\\na hc c d ch \'C2 aGa hc\\nc d e f ed e ec\\nC3 e g f e de f e \'C2 d\\ne f e d cc h dd(e)\\nG a c d eed ch hc\",\"C2h} c c d f e dc cd dc \'a hc c d ch\\nC2 aGa hc \'c c d f e dc cd dc \'a hc c d ch\\nC2 aGa hc \'c d e f ed e ec \'C3 e g f e de f e\\nC2 d \'e f e d cc h dd(e) \'G a c d eed ch hc\"]', '[\"An chan-tant m\'es-tuet com-plain-dre\\na ma da-me_et a A-mors:\\nser-vi-es les ai senz fain-dre,\\nn\'ainz n\'i poi tro-ver se-cors.\\nCeu n\'est mi-e lor ho-nors\\nde moi gre-ver et des-train-dre,\\nc\'on-ques n\'en oi tant do-lors\\nque vo-sis-se_a-mer ail-lors.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f112.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 119, \"facsimileY\": 447, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(890, 'Li douz termines m\'agreie', 'Linker 185.11', 'Moniot d\'Arras', 'French', 'U', '53r', 1, 1, '[\"F3 G F G a b} ba GF Gaba aG\\nFE ED DC DE F G \'F3b} FEFG\\nG F G a ba GF Gaba aG\\nFE ED DC DE F \'F3 G FE\\nED DC FE ED DC\\nG F G a h a aG\\nah c \'F3 ch ha aG GF Gaha aG\\nah c haG E F E ED\\na h aG \'F3 F aG E FE ED\\nC DE G aG FEF D FEDC\",\"F3 G F G a b} ba GF Gaba aG \'FE ED DC DE F G\\nF3b} FEFG \'G F G a ba GF Gaba aG \'FE ED DC DE F\\nF3 G FE \'ED DC FE ED DC \'G F G a h a aG \'ah c\\nF3 ch ha aG GF Gaha aG \'ah c haG E F E ED \'a h aG\\nF3 F aG E FE ED \'C DE G aG FEF D FEDC\"]', '[\"Li douz ter-mi-nes m\'a-gre-ie\\ndou mois d\'av-ril en pas-cor\\nque voi la bruil-le_et la pre-ie\\nchar-gier de fuel-le_et de flor\\net es-tre_en ver-dor\\net j’oi chan-ter nuit et jor\\nois-els par bruil-l\'_e ra-me-e;\\nmais jo-ie_e-üs-se grei-gnor\\nse je fus-se_en la con-tre-e\\nou ce-le maint cui j’a-ior.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f113.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 66, \"facsimileY\": 430, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(891, 'Quant li douz tens renovele', 'Linker 265.1455', 'Author of Linker 265.1455', 'French', 'U', '53v', 1, 1, '[\"C1 c cha hc c cha aG a ah\\naG GF Ga hc cha aG Ga \'\\nC1 c cha hc c cha aG a ah\\naG GF Ga c cha aG Ga\\nc a \'C2 c cd e ed dc\\nc def e d ch a G ah\\naG GF FG \'C2 hcha aG Ga\",\"C1 c cha hc c cha aG a ah \'aG GF Ga hc cha aG Ga \'\\nC1 c cha hc c cha aG a ah \'aG GF Ga c cha aG Ga \'c a\\nC2 c cd e ed dc \'c def e d ch a G ah \'aG GF FG\\nC2 hcha aG Ga\"]', '[\"Quant li douz tens re-no-ve-le\\nq\'es-tez trait a sa sai-son,\\nlors me co-man-da a fai-re\\nbo-ne_A-mors u-ne chan-son.\\nJa Dex ne me doint le don\\nque j’a-ie_ail-lors ma pen-se-e\\nd’a-mer, da-me, se vos non.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f114.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 189, \"facsimileY\": 229, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(892, 'A droit se plaint et droit se gaimente', 'Linker 77.1', 'Gautier d\'Espinau', 'French', 'U', '53v-54r', 1, 1, '[\"F3 a a a aG a h c h h aG a\\na h a \'F3 G G F E F E ED\\na a a aG a h c ha ha aG \'\\nF3 a h a G G F E F E EDDE DC\\nE G G ED G a G c ha \'F3 aG\\nC2 h d d de a hcd c h h aGF G\\na h a G E \'F3 G F E E EDE D\\nDE G G a G c h a ha aG \'\\nF3 a h aG GF ED C FGa G GF EDC D\",\"F3 a a a aG a h c h h aG a \'a h a\\nF3 G G F E F E ED \'a a a aG a h c ha ha aG \'\\nF3 a h a G G F E F E EDDE DC \'E G G ED G a G c ha\\nF3 aG \'C2 h d d de a hcd c h h aGF G \'a h a G E\\nF3 G F E E EDE D \'DE G G a G c h a ha aG \'\\nF3 a h aG GF ED C FGa G GF EDC D\"]', '[\"A droit se plaint et a droit se gai-men-te\\nqui toz jors sert senz guer-re-don a-voir.\\nTant ai A-mors ser-vi a mon po-oir\\nc\'a-dés i ai es-pe-ran-ce_et a-tan-te;\\nn\'on-ques pour ceu q\'e-le m\'a fait do-loir\\nn\'en poi a-voir a nul jor au-tre ren-te.\\nNe.l di por ceu que j\'an-cor m\'en re-pan-te,\\npar Deu, A-mors, ainz ai mis mon po-oir\\nen vos ser-vir et tres-to-te m\'en-ten-te.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f114.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 103, \"facsimileY\": 817, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(893, 'Quant je voi l\'erbe menue', 'Linker 77.15', 'Gautier d\'Espinau', 'French', 'U', '54r-54v', 1, 1, '[\"F3 C D C CD F GF ED E\\nC DC DE FE ED\\nC \'F3 D C CD F aGF ED FE\\nC DC DE FE ED\\nF Ga G aGF FE \'\\nF3 D FED DC CD F GF FE\\na ch G FE G aGF ED FE\\nC D C E G aGF EED\",\"F3 C D C CD F GF ED E \'C DC DE FE ED \'C\\nF3 D C CD F aGF ED FE \'C DC DE FE ED \'F Ga G aGF FE \'\\nF3 D FED DC CD F GF FE \'a ch G FE G aGF ED FE \'C D C E G aGF EED\"]', '[\"Quant je voi l\'er-be me-nu-e\\npoin-dre_au prin d\'es-té,\\nque to-te riens chain-ge_et mu-e\\nen grei-gnor beal-té,\\nse lors vient a gré\\nma da-me, qu\'a-ie chan-té,\\nbien m\'iert ma jo-ie cre-ü-e,\\nseul q\'e-le l\'ait com-man-dé.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f115.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 78, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(894, 'Lonc tens ai amors servie', 'Linker 265.1089', 'Author of Linker 265.1089', 'French', 'U', '54v', 1, 1, '[\"C1 F G a b a aGE FE ED\\nF G a GF ED FE EDC\\nF \'C1b} G a b a aGE FE ED\\nF G a GF ED FE EDC\\nE F G ab G \'\\nC1b} a c b a G E FED\\nE G GF G C DEF EDC CD\",\"C1 F G a b a aGE FE ED \'F G a GF ED FE EDC \'F\\nC1b} G a b a aGE FE ED \'F G a GF ED FE EDC \'E F G ab G \'\\nC1b} a c b a G E FED \'E G GF G C DEF EDC CD\"]', '[\"Lonc tens ai a-mors ser-vi-e\\nc\'ainz ne fu guer-re-do-né,\\nn\'a-tain-dre ne bé je mi-e\\nsi haut con j\'ai en-toi-sé,\\nn\'en ai vo-len-té\\nque moins m\'en doi-e gre-ver\\ntant aim ma dol-ce fo-li-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f116.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 177.27272033691406, \"facsimileY\": 768.1818237304688, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(895, 'Cil qui d\'amors me conseille', 'Linker 65.17', 'Gace Brulé', 'French', 'U', '55r', 1, 1, '[\"F3 D a a a b} b a aG aGF\\nE F G D F EDC F\\nG \'F3 a a a c b aG aGF\\nE F G D F EDC D\\nD E \'F3 G G G GF GFED F\\na h} h c c c ch cha\\nG d d c a \'F3 hcd chG aGF\\na h c aF G a GFE GFFEDC\\nC D E F GGF EDC F\\nG a a \'F3 DC EFG(F) EDC FED\",\"F3 D a a a b} b a aG aGF \'E F G D F EDC F \'G\\nF3 a a a c b aG aGF \'E F G D F EDC D \'D E\\nF3 G G G GF GFED F \'a h} h c c c ch cha \'G d d c a\\nF3 hcd chG aGF \'a h c aF G a GFE GFFEDC \'C D E F GGF EDC F \'G a a\\nF3 DC EFG(F) EDC FED\"]', '[\"Cil qui d\'A-mors me con-seil-le\\nque je m\'en do-ie par-tir\\nne sent pas que me res-veil-le\\nne quel sont mei grie sos-pir.\\nPe-tit a sens et voi-di-e\\ncil qui m\'en vuet chas-toi-er,\\nn\'en ainz n\'a-ma en sa vi-e,\\ncil fait bien ni-ce fo-li-e\\nqui s\'en-tre-met del mes-tier\\ndont il ne se set ai-dier.\"]', '[\"Notes:\\n1.5, 3.6, and 6.2: Accidentals added by a different hand.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f117.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
