(896, 'Quant li douz tans rasuage', 'Linker 265.1456', 'Author of Linker 265.1456', 'French', 'U', '55v', 1, 1, '[\"C2 c ha c d ch ch aG ah\\nc ha h ch aG GF G\\nc \'C2 ha c d ch ch aG ah\\nc ha h ch aG GF Ga\\nb} b c aF Ga hc ha aG \'\\nC2 c ha c d ch ch(a) aG a\\nha G FE F3 FD E F G GF\\na h c h \'C2 ha aG GF\\nc ha h ch aG GF G\\nahc h ha aG Ga GF FG\\nF G \'F3 a a ha GF Ga aG\\nahc h cha GF Ga GFE FG\",\"C2 c ha c d ch ch aG ah \'c ha h ch aG GF G \'c\\nC2 ha c d ch ch aG ah \'c ha h ch aG GF Ga \'b} b c aF Ga hc ha aG \'\\nC2 c ha c d ch ch(a) aG a \'ha G FE F3 FD E F G GF \'a h c h\\nC2 ha aG GF \'c ha h ch aG GF G \'ahc h ha aG Ga GF FG \'F G\\nF3 a a ha GF Ga aG \'ahc h cha GF Ga GFE FG\"]', '[\"Quant li douz tans ra-su-a-ge\\na douz mois d\'av-ril en-trant,\\nche-vau-chai lez le ri-va-ge\\nd\'u-ne ri-vie-re bru-iant.\\nSi com j’a-lo-ie pan-sant\\ns’o-ï de-danz un bois-cha-ge\\nu-ne vois qui son da-ma-ge\\nplaint et re-gra-te_en chan-tant\\net di-soit en sos-pi-rant:\\n\'A-mors m’o-cit et tu-e.\\nA-pren-nez a va-loir, a-mis,\\nli ia-lous m\'a per-du-e.\'\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f118.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 158.1818084716797, \"facsimileY\": 171.81817626953125, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(897, 'Ne puet lassier fins cuer q\'ades ne plaigne', 'Linker 77.10', 'Gautier d\'Espinau', 'French', 'U', '56r', 1, 1, '[\"C3b} f f fe ec d e fg f e edc d\\nf f e d c \'C3b} b abc b a aG\\nC2 F G Ga c d e f ed eed\\nC3 e g g+a \'C3b} c d e fg f e edc d\\nf f e d c b a bc(b) aG G \'\\nF3 a b} b aGa F G a c C3 d e ffedcd c\\nd f d ff(e) c \'C1b} b aGF a b cbbaGF G\",\"C3b} f f fe ec d e fg f e edc d \'f f e d c\\nC3b} b abc b a aG \'C2 F G Ga c d e f ed eed \'C3 e g g+a\\nC3b} c d e fg f e edc d \'f f e d c b a bc(b) aG G \'\\nF3 a b} b aGa F G a c C3 d e ffedcd c \'d f d ff(e) c\\nC1b} b aGF a b cbbaGF G\"]', '[\"Ne puet las-sier fins cuers q\'a-dés ne plai-gne\\nle-al a-mor, dont se sont es-tran-gié\\ncil fals a-mant de-ses-pe-ré, chain-gié;\\nmais ne cuit pas que li miens cuers se fai-gne\\nde li ser-vir, qui que li ait tre-chié.\\nAin-çois a-tent en si bo-ne_es-pe-ran-ce\\nque toz mals traiz me tor-ne_en a-li-gan-ce.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f119.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 71.81818389892578, \"facsimileY\": 417.272705078125, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 130, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
