(913, 'Li miens chanters ne puet mais remanoir', 'Linker 255.9', 'Thibaut de Blason', 'French', 'U', '59v', 1, 1, '[\"C2 a h c c c h ha aG a aGF\\na \'C2 h c ch ha aG a aGF FG G\\na h c c c h \'C2 ha aG a aGF\\na h c ch ha aG a aGF FG G\\nh c \'C2 d d de d c ch ha c\\nh c d d \'C2 de d c hc haG GF\\nF G a aGF\\na h c cha \'C2 h haG a aGF FG G\",\"C2 a h c c c h ha aG a aGF \'a\\nC2 h c ch ha aG a aGF FG G \'a h c c c h\\nC2 ha aG a aGF \'a h c ch ha aG a aGF FG G \'h c\\nC2 d d de d c ch ha c \'h c d d\\nC2 de d c hc haG GF \'F G a aGF \'a h c cha\\nC2 h haG a aGF FG G\"]', '[\"Li miens chan-ters ne puet mais re-ma-noir\\ntant com a-mors vuel-le que soi-e_a li,\\ncar par li ai la for-ce_et lo pö-oir,\\nsens et va-lor, par coi je pans a li.\\nMais trop ma mis lon tens en non-cha-loir\\nsi dout et criem que ceu ne m\'ait tra-i,\\nk\'a-me-ie l\'ai\\nsi le-ial-ment, k\'ainz de rienz n\'i fau-sai.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f126.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 100, \"facsimileY\": 524, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
