(916, 'A l\'entree dou douz comancement', 'Linker 106.1', 'Guiot de Dijon', 'French', 'U', '60v-61r', 1, 1, '[\"F3 a a aG a G GF FE GE FE ED\\nC D E F ED EFG \'F3 F ED DC CD\\nC D E F E ED DEF F ED DC\\nC D E F \'F3 ED DEF F ED DC CD\\na a aG Gab a GF FG aG GFE F\\nE GE \'F3 FE ED E F G a aG aGF G\\nc h ha ahc h a G a \'F3 GF GFE ED\\nE F GGF ED DC CD G ah c haG Ga\\nhcha G GF FE G EC D \'F3 E FE EDC CD\",\"F3 a a aG a G GF FE GE FE ED \'C D E F ED EFG\\nF3 F ED DC CD \'C D E F E ED DEF F ED DC \'C D E F\\nF3 ED DEF F ED DC CD \'a a aG Gab a GF FG aG GFE F \'E GE\\nF3 FE ED E F G a aG aGF G \'c h ha ahc h a G a\\nF3 GF GFE ED \'E F GGF ED DC CD G ah c haG Ga \'hcha G GF FE G EC D\\nF3 E FE EDC CD\"]', '[\"A l\'en-tre-e dou douz co-man-ce-ment\\ndel no-vel tens que je voi re-pai-rier,\\nque pré sunt vert et flo-ris-sent ver-gier\\net cil oi-sel chan-tent si dou-ce-ment,\\nlors chan-te-rai plus ren-voi-sï-e-ment\\nc\'on-ques ne fis, qant ce-le lo me pri-e\\nqui est ma da-me_et ma tres dou-ce_a-mi-e.\\nSi en mer-ci A-mors, qui m\'as-se-gu-re\\nde jo-ie_a-voir et de bo-ne_a-ven-tu-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f128.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 100.5, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(918, 'Jusq\'a ci ai tor jors chanté', 'Linker 73.9', 'Gautier de Dargies', 'French', 'U', '61v', 1, 1, '[\"C2 a c c ch def edc cch aGFGa\\nh c ch aGF Gab aG a a a aGF\\nF \'C2b} G G abaF\\nF Ga bc baG ab cd cba bc\\nc d cba aG ab cb \'C2b} aG F GaGE F\\nc d e f f fe dcb a aGF F\\naGF Ga bcbG FE E F \'C2b} G a bc c\\nd b G abc a aF baG F GaGE F\",\"C2 a c c ch def edc cch aGFGa \'h c ch aGF Gab aG a a a aGF \'F\\nC2b} G G abaF \'F Ga bc baG ab cd cba bc \'c d cba aG ab cb\\nC2b} aG F GaGE F \'c d e f f fe dcb a aGF F \'aGF Ga bcbG FE E F\\nC2b} G a bc c \'d b G abc a aF baG F GaGE F\"]', '[\"Jus-q\'a ci ai tor jors cha-nté\\nde molt boen cuer fin et le-ial en-tier,\\nne de chan-gier\\nn’oi de-danz mon cuer vo-lan-té,\\nne la pei-ne ne m’i e-üst mes-tier;\\nbien m’a A-mours a son oes es-pro-vé,\\nre-te-nu m’a ne ja nel quier las-sier,\\net s’en voi je les plu-sors es-loi-gnier.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f130.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 190, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
