(931, 'Ihc wil singhen in der nuwen wise', 'J Wizl 1', 'Wizlav', 'German', 'J', 'fol. 72v', 1, 1, '[\"C2 G c d f\\nfe dc \'C2 d fed defede dc c cba\\na \'C2 h c d a c c cba \'C2\\na %h c d cba\\na_hc d_h \'C2 c c fedcch ah c\\nG \'C2 c d f\\nfe dc d \'C2 fed defede dc c cba\\na %h c \'C2 d a c c cba\\na %h \'C2 c d cba\\na_hc d_h c fedcc_h \'C3 ah c\\nc e f \'C3 g c\\ng +a f ge f g g\",\"C2 G c d f \'fe dc\\nC2 d fed defede dc c cba \'a\\nC2 h c d a c c cba\\nC2 \'a %h c d cba \'a_hc d_h\\nC2 c c fedcch ah c \'G\\nC2 c d f \'fe dc d\\nC2 fed defede dc c cba \'a %h c\\nC2 d a c c cba \'a %h\\nC2 c d cba \'a_hc d_h c fedcc_h\\nC3 ah c \'c e f\\nC3 g c \'g +a f ge f g g\"]', '[\"Ihc wil sin-ghen\\nin der nu-wen wi-se eyn let\\nvon dem der mich ghe-mach-et hat\\nder mach mir ne-men\\nvn-de ghe-ben waz her wil\\nIch wil brin-ghen\\ndar tzuͦ hertze vnd den sin ich ret\\ndaz al min heyl an ym be stat.\\nliph guͦt muͦt le-ben\\nwaz des ist her mach vil.\\nWol min spil let-zen\\ndaz ich tzuͦ rech-te ha-ben\"]', '[\"Nachtrag\\nSeitenverlust am Ende\\nAuflösungzeichen z.T. eine Silbe vorher\\nb/h Unklarheiten\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(932, 'Menschen kint denket daran', 'J Wizl 2', 'Wizlav', 'German', 'J', 'fol. 73r', 1, 1, '[\"C2 f e d c d c \'C2 cha\\na a a fed c d cba-%hc \'C3\\ne f g gfe ef g fedc \'C2\\nc d c cha hc dch c\\nf \'C2 e d c d c cba\\na \'C2 a a a fed c d cba-%hc \'C3\\nc e f g gfe ef g fedc \'C2\\nc d c cha hc dch c \'C2\\nc d c c c d c cba \'C2\\nc cha hG c dch c\\nc \'C2 d c ch\\nc d c \'C2 cba\\nc c%ha h c dch c\\nf \'C2 e d c d c cba\\na \'C2 a a a fed c d cba %hc \'C3\\ne f g gfe ef g\\nfedc c d \'C2 c cha hc dch c\",\"C2 f e d c d c\\nC2 cha \'a a a fed c d cba-%hc\\nC3 \'e f g gfe ef g fedc\\nC2 \'c d c cha hc dch c \'f\\nC2 e d c d c cba \'a\\nC2 a a a fed c d cba-%hc\\nC3 \'c e f g gfe ef g fedc\\nC2 \'c d c cha hc dch c\\nC2 \'c d c c c d c cba\\nC2 \'c cha hG c dch c \'c\\nC2 d c ch \'c d c\\nC2 cba \'c c%ha h c dch c \'f\\nC2 e d c d c cba \'a\\nC2 a a a fed c d cba %hc\\nC3 \'e f g gfe ef g \'fedc c d\\nC2 c cha hc dch c\"]', '[\"Men-schen kint den-ket dar an.\\nob ich vch ghe ra-ten kan.\\niz ist in der werlt wol schin\\ndaz en-des tac wil ko-men.\\nIz ist in der werlt wol schin\\ndaz kint truwet nicht den va-ter sin\\nnoch va-ter si-me kin-de nicht\\ndaz habe wir wol uor no-men.\\nNu toͮt al so daz ir sith vro\\nob ich_iz vch w[uͦ]r he-le.\\ndaz ir tzuͦr stunt\\nnicht sith ghe wut\\nghar an u-wer se-le.\\nWen ne ir den gheyst vph gheben\\nvnd nicht be hal-den muͦghen den le-ben\\ndaz ir den-ne key-ne\\nnot li-den daz mach vch uro-men.\"]', '[\"Z. 9 (alt) Auflösungszeichen am Ende\\nZ. 10 (alt) Nachtrag in Rot h -> hG (?)\\nZ. 10 (alt) Text: \'u\' fehlt, nur Diakritikum\\nZ. 10 (alt) \'d\' in Rot nachgetragen\\nZ. 12 (alt): \'n\' fehlt\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \