(936, 'Ich partere dich durch mine vrowen', 'J Wizl 14', 'Wizlav', 'German', 'J', 'fol. 75r', 1, 1, '[\"C1 E EF G F E a G a \'C1 EF G\\nch aG a a EF G \'C1 D C DCDEF E\\nE EF G F \'C1 E a G a EF G\\nch aG \'C1 a a EF G D C DCDEF E \'C1\\nE EF G G DE G E \'C2 FG E\\nh h c de dchc \'C1 a G GF E\\nE EF G F \'C1 E a G a EF G\\nch aG \'C1 a a EF G D C DCDEF E\",\"C1 E EF G F E a G a\\nC1 EF G \'ch aG a a EF G\\nC1 D C DCDEF E \'E EF G F\\nC1 E a G a EF G \'ch aG\\nC1 a a EF G D C DCDEF E\\nC1 \'E EF G G DE G E\\nC2 FG E \'h h c de dchc\\nC1 a G GF E \'E EF G F\\nC1 E a G a EF G \'ch aG\\nC1 a a EF G D C DCDEF E\"]', '[\"Ich par-te-re dich durch mi-ne vro-wen\\nde dich lep-lich sach vor mi-nen ou-ghen.\\nHer-tze tru-te sich min eyn par vro-we\\ntzuͦ al-ler ghuͦ-te schin-bar vn-tou-ghen.\\nWer mach vuͦr ghuͦ-ten di-ne ghuͦ-te.\\nven ghot der ghu-te dich be huͦ-te.\\nDes be darph ich wol sol ich mich ne-ren\\nvor di-ner min-ne diz mach ich swe-ren.\"]', '[\"Unklar, ob als 5-Linien-System gedacht\\nNur vorgezeichnete Initiale bei \'ven ghot der ghute\'\\n\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
