(952, 'Au novel tens pascor', 'Linker 15.2', 'Audefroi le Bastart', 'French', 'U', '66v', 1, 1, '[\"C2 c c d edc cha Ga d cha G(a) cha G GFG(a) G\\nc c c \'C2 edc cha G(a) d cha G(a) ch aG GFG(a) G\\naGF G a haG a \'C2 a c c d ed c(b) c c\\nd e d ch c(d) cha aGF \'C2 G G(a) c c(d) ed dc\\ncde(d) d c c(h) c(d) cha aGF G G(a) cha G GFG(a) G\\naGF \'C2 G(a) cch aG a haG a a\\nc d ch aaG a cha haG G\",\"C2 c c d edc cha Ga d cha G(a) cha G GFG(a) G \'c c c\\nC2 edc cha G(a) d cha G(a) ch aG GFG(a) G \'aGF G a haG a\\nC2 a c c d ed c(b) c c \'d e d ch c(d) cha aGF\\nC2 G G(a) c c(d) ed dc \'cde(d) d c c(h) c(d) cha aGF G G(a) cha G GFG(a) G \'aGF\\nC2 G(a) cch aG a haG a a \'c d ch aaG a cha haG G\"]', '[\"Au no-vel tant Pas-cor, quant flo-rist l’au-bes-pi-ne\\nes-po-sa li cuens Guis la bien fai-te_Ar-gen-ti-ne.\\nTant fu-rent bo-ne ment braz et braz soz cor-ti-ne\\nque .vi. bels fiz en out; puis li mos-tra ha-ï-ne,\\npor ce que melz a-ma sa pu-ce-le Sa-bi-ne.\\nQui co-vent a a mal ma-ri\\nso-vent en a lo cuer mar-ri.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f140\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 112, \"facsimileY\": 139, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 120, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(953, 'Bele et bone cele por cui je chant', 'Linker 240.5', 'Thibaut de Champagne', 'French', 'U', '67r', 1, 1, '[\"C2 e e ed e d dc haG h hcd dch\\nG a h c \'C1 h h a E FE ED\\nF G aaG GF a c ch aG \'C2 a(h) aGa\\nc d cc(h) haG b} a b a G a(G) GF\\nh} a a \'C2 a ahc h h(a) a h c hah hG\\na c cha a(h) d \'C2 h ch(a) aGF G(a) b} baG GF\\ncde f d hG d d edc h cha aG \'\\nC1 a GF G(a) c C2 d(e) fed cha aGa cha G\",\"C2 e e ed e d dc haG h hcd dch \'G a h c\\nC1 h h a E FE ED \'F G aaG GF a c ch aG\\nC2 a(h) aGa \'c d cc(h) haG b} a b a G a(G) GF \'h} a a\\nC2 a ahc h h(a) a h c hah hG \'a c cha a(h) d\\nC2 h ch(a) aGF G(a) b} baG GF \'cde f d hG d d edc h cha aG \'\\nC1 a GF G(a) c C2 d(e) fed cha aGa cha G\"]', '[\"Be-le_et bo-ne ce-le por cui je chant,\\ns’en doi-vent bien mes chan-cons en-meu-drer.\\nPuis ce-le hore que je la vi a-vant,\\nne poi ail-lors k’a li mon cuer tor-ner;\\nmais molt so-vent me tor-men-te_et es-mai-e\\nceu que je l\'ai tant ser-vi en me-nai-e,\\nneinz nel me volt de riens guer-re-do-ner,\\nfors seu-le-ment k’a-pris m’a a chan-ter.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f141\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 533, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(954, 'Un petit devant lo jor', 'Linker 34.2', 'Chapelain de Laon', 'French', 'U', '67v', 1, 1, '[\"C2 G h c d d d cha\\nh G a(h) c d\\nG h \'C2 c d d d cha\\nh a G(a) F G\\nG h c d d d \'C2 cha\\nh G a(h) c d\\nG h c d d d cha\\nh a G(a) \'C2 F G\\nF G a a h c ha\\na [h] a GF G a \'\\nC1 F G a a h c h\\na h a G(a) F G\\nF G a G F a a \'\\nC1 a h c [? ? ? ?\\nh aG a GF a G F G\\nC2 d d c d e d cha G \'\\nC2 d d c d e d cha G(a)\\nG GF G G(a) c d cha aG\",\"C2 G h c d d d cha \'h G a(h) c d \'G h\\nC2 c d d d cha \'h a G(a) F G \'G h c d d d\\nC2 cha \'h G a(h) c d \'G h c d d d cha \'h a G(a)\\nC2 F G \'F G a a h c ha \'a [h] a GF G a \'\\nC1 F G a a h c h \'a h a G(a) F G \'F G a G F a a \'\\nC1 a h c [? ? ? ? \'h aG a GF a G F G \'C2 d d c d e d cha G \'\\nC2 d d c d e d cha G(a) \'G GF G G(a) c d cha aG\"]', '[\"Un pe-tit de-vant lo jor\\nme le-vai l\'au-trier,\\nsos-pris de no-ve-le_a-mor\\nqui me fait veil-lier;\\npor ob-lï-er ma do-lor\\net por es-la-gier\\nm\'en a-lai coil-lir la flor\\nde-jos-te_un ver-gier\\nLa de-danz en un des-tor\\no-ï un che-va-lier,\\nde-soz lui en u-ne tor\\nfu ce-le qui l\'ot chier.\\nE-le_out fre-sche la co-lor\\net chan-toit [... ... ... ...]\\nun chant pi-tous mel-lé en plor\\net di-soit con le-als dru-e:\\n–_A-mis, vos m\'a-vez per-du-e!\\nli ja-lous m\'a mis en mu-e._-\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f142\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern