(955, 'Pour le tens qui verdoe', 'Linker 135.1', 'Jehan d\'Auxerre', 'French', 'U', '170v', 1, 1, '[\"C1 a c c c h c(a) a\\nh cha G a(G)\\nG F E G \'F3 F E D\\nE G G a\\na c c c h ch a \'\\nC1 h h(a) G a\\nG F E G F E D\\nE G G a\\nh \'C1 a h c haG a\\nh d a c c h a\\na GFE D C\\nE \'C1 G a c c haG a\",\"C1 a c c c h c(a) a \'h cha G a(G) \'G F E G\\nF3 F E D \'E G G a \'a c c c h ch a \'\\nC1 h h(a) G a \'G F E G F E D \'E G G a \'h\\nC1 a h c haG a \'h d a c c h a \'a GFE D C \'E\\nC1 G a c c haG a\"]', '[\"Pour le tens qui ver-do-e\\nm\'es-tuet chan-ter\\net mon cuer me-tre_en joi-e\\net con-for-ter;\\npour riens ne me ten-ro-e\\nde bien a-mer\\nse je da-me tro-vo-e\\nqui sens gul-ler\\nmi vos-sit con-for-ter\\nplus jo-lis en se-ro-e\\nn\'en n\'aj mon grej\\nde li ne pai-de-ro-e.\"]', '[\" \",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f348\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(956, 'Ausiment con Percevals', 'BdT 421.3', 'Richart de Berbezill', 'Occitan', 'X', '85r', 1, 1, '[\"C1 G a G c ha ha aG\\na h G E FE ED\\nC E G F a cha \'C1 aG\\na c h a G GF EDE\\nC D E Ga aG\\na aGF G a ahc haG G \'\\nC1 a G GFE ED ED DC\\nC D DE G a ahc ha aG aGF G\\na \'C1 G GFE ED\\nE G F ED ED DC\\nC D E FEDC E G a GF aGD FG\",\"C1 G a G c ha ha aG \'a h G E FE ED \'C E G F a cha\\nC1 aG \'a c h a G GF EDE \'C D E Ga aG \'a aGF G a ahc haG G \'\\nC1 a G GFE ED ED DC \'C D DE G a ahc ha aG aGF G \'a\\nC1 G GFE ED \'E G F ED ED DC \'C D E FEDC E G a GF aGD FG\"]', '[\"Au-si-ment con Per-ce-vals\\nal tens que ve-vi-e\\nqui s\'es-ba-hi des-gar-dar\\net non sa-bri de-man-dar\\nde qe.i ser-vi-e\\nla lan-ce ne lo gra-zals\\net eu sui au-tre-tals\\nbe-le don-ne, can veu vos-tre cors gent\\ncat al-si-ment.\\nm\'ob-li can vos re-mir\\net vol pre-jar k\'eu non sui mais con-sir.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f177.item.zoom\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 79, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(957, 'Quant voi ces prez florir et verdoier', 'Linker 185.15', 'Moniot d\'Arras', 'French', 'U', '82v-83r', 1, 1, '[\"C2 d c d cha G a h cha G a\\nd c d cha G \'C2 a h cha G a\\nd c h a h(c) ha F G a GF\\nG a \'C2 F Ga c ch cd ch G ah a\\nd c d a d ch Ga GF \'C2 ah cchG a\",\"C2 d c d cha G a h cha G a \'d c d cha G\\nC2 a h cha G a \'d c h a h(c) ha F G a GF \'G a\\nC2 F Ga c ch cd ch G ah a \'d c d a d ch Ga GF\\nC2 ah cchG a\"]', '[\"Quant voi ces prez flo-rir et ver-do-ier,\\nque se pei-nent cil oi-sel d\'en-voi-sier,\\na-don me fait mon chant re-co-men-cier\\nA-mors, don n\'ai ta-lent que m\'en re-trai-e,\\nke sens a-mor n\'a nus jo-ie ve-ra-ie.\"]', '[\"\",\"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f173.item.zoom\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f172\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 104, \"facsimileY\": 717, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(958, 'Gaite de la tor', 'Linker 265.722', 'Author of Linker 265.722', 'French', 'U', '83r', 1, 1, '[\"C1 c c c c ha\\nG FG FED C\\nD F G a h \'C1 chG a\\nc c c c ha\\nG FG FED C\\nD F G aGFG FE D D \'\\nC1 D E C E G a hc\\nd ch G a\\nG FE D EFG FED C CH \'\\nC1 D E F2 A C D E DC\\nE G a F3 GFG FED D D\",\"C1 c c c c ha \'G FG FED C \'D F G a h\\nC1 chG a \'c c c c ha \'G FG FED C \'D F G aGFG FE D D \'\\nC1 D E C E G a hc \'d ch G a \'G FE D EFG FED C CH \'\\nC1 D E F2 A C D E DC \'E G a F3 GFG FED D D\"]', '[\"Gai-te de la tor\\ngar-dez en-tor\\nles murs, se Deus vos vo-ie!\\nc\'or sont a se-jor\\nda-me_et sei-gnor\\net lar-ron vont en pro-ie.\\nHu et hu et hu et hu!\\nje l\'ai ve-ü\\nla jus soz la coud-ro-ie.\\nHu et hu et hu et hu!\\na bien pres l\'o-cir-ro-ie.\"]', '[\"\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/canvas/f173\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 190, \"facsimileY\": 720.5, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b60009580/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"1\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(960, 'Chant e deport, joi, domnei e solatz', 'BdT 167.15', 'Gaucelm Faidit', 'Occitan', 'X', '85r', 1, 1, '[\"C1 a a a GFFE D C DE F GF FE\\nC F FG aaG F ED DC \'C1 F E EDC CD\\na a aGa aG a c haG F EDC FFG a\\na h c d G ahc b \'C1b} a Ga aGF\\nFG a GFE ED E DC EFG F ED DC\\nC D E F Ga C \'C1b} FE D C D\\nE F GFFE ED F G F b a GFFG a\\na c \'C1b} cd F G ab a GF ED DC F\\nE F GFE ED F G F \'C1b} a c dccba\\nGGF F3 ED DC D FFE EDC FFGaGF ED EDC CD \",\"C1 a a a GFFE D C DE F GF FE \'C F FG aaG F ED DC\\nC1 F E EDC CD \'a a aGa aG a c haG F EDC FFG a \'a h c d G ahc b\\nC1b} a Ga aGF \'FG a GFE ED E DC EFG F ED DC \'C D E F Ga C\\nC1b} FE D C D \'E F GFFE ED F G F b a GFFG a \'a c\\nC1b} cd F G ab a GF ED DC F \'E F GFE ED F G F\\nC1b} a c dccba \'GGF F3 ED DC D FFE EDC FFGaGF ED EDC CD \"]', '[\"Chant et de-por, ioi, don-noi et so-laz,\\nen-sen-gnal-ment, lar-ge-ce_et cor-te-si-e\\net prez et sen et le-ial dru-de-ri-e,\\nont si bas-sat en-gens et mal-ve-staz\\nk\'a poi d\'i-re non sui de-se-spe-raz;\\ncar en-tre cent do-nes ni pre-ia-dors\\nni a u-ne ne un k\'au ben en-te-gne\\nvers ben a-mar que d\'au-tre part non fen-gne\\nne qui sa-chent q\'est de-ven-gud-e_a-mors:\\ngar-daz com es a-bas-sa-de va-lors!\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f177.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 55, \"facsimileY\": 404, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(961, 'De son tort ferai emende', 'BdT 366.12', 'Peirol', 'Occitan', 'X', '88v', 1, 1, '[\"C2 a G a h ch a ha G\\na h c d G ah a\\na G a \'C2 h ch a ha G\\na h c d ch c dcde\\ndch a G d ch ha \'C2 aG\\na h a F3 G aG F EE D\\nG E G G ah c haaG a\",\"C2 a G a h ch a ha G \'a h c d G ah a \'a G a\\nC2 h ch a ha G \'a h c d ch c dcde \'dch a G d ch ha\\nC2 aG \'a h a F3 G aG F EE D \'G E G G ah c haaG a\"]', '[\"De son tort fe-rai e-men-de,\\nli que fist par-tir del sen,\\nen-cor ai ta-lan que ren-de,\\nsi plaz mes chan-cons a men,\\nsenz res-pit d\'au-tre mer-cen,\\nsel vuel-le k\'a li m\'a-ten-de\\net que bel sam-blan mi ren-de.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f184.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 102, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(962, 'Li tens d\'esté et mais et violete', 'Linker 38.9', 'Chastelain de Coucy', 'French', 'U', '38r-38v', 1, 1, '[\"F3 C E F G a b} bc b aG F baGa G\\nE Ga b aG GF EDC CDE \'F3 FE ED DC\\nC E F G a b} c b aG F bbaGa G\\nE Ga \'C1F3b} b aGF E DC CDE FE ED DC\\nE G GF EDC E G aG F \'? ?\\n? ? ? ? ? ? ? ? ? ?\\n? ? \'? ? ? ? ? ? ? ? ?\\n? ? ? ? ? ? ?\",\"F3 C E F G a b} bc b aG F baGa G \'E Ga b aG GF EDC CDE\\nF3 FE ED DC \'C E F G a b} c b aG F bbaGa G \'E Ga\\nC1F3b} b aGF E DC CDE FE ED DC \'E G GF EDC E G aG F\\n? ? \'? ? ? ? ? ? ? ? ? ? \'? ?\\n? ? ? ? ? ? ? ? ? \'? ? ? ? ? ? ?\"]', '[\"Li tens d\'es-té et mais et vi-o-le-te\\net ro-sig-nols me se-mo-nent d\'a-mer,\\net mes fins cuers me fet d\'un-e_a-mo-re-te\\nsi dolz pre-sent que ne.l doi re-fu-ser.\\nOr me doint Deus a tel ho-nor mon-ter\\nque ce-le_ou j\'ai mon cuer et mon pan-ser\\nteng-ne_un-e foiz en-tre mes braz nu-e-te\\nainz que je voi-se_ol-tre-mer!\"]', '[\"5.9-8.6: The two staves on the verso of f° 38 have not been notated.\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f83.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 533, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(963, 'L\'on dit q\'amors est dolce chose', 'Linker 265.1235', 'Author of Linker 265.1235', 'French', 'U', '47v', 1, 1, '[\"C2 c c c c c h c haG G\\nh d e c c ha h c \'\\nC2 c c c c c h c haG G\\nh d e c c ha h c \'\\nC2 e c e f ed c c ha h\\nG a h c d G h dcde\\nc h \'C2 a h a h c haG F\\nG a h c h aG ah aG\\nC3 g fed h \'C2 c de d c ha h\\nh c d dchaG F Ga c hha aG\",\"C2 c c c c c h c haG G \'h d e c c ha h c \'\\nC2 c c c c c h c haG G \'h d e c c ha h c \'\\nC2 e c e f ed c c ha h \'G a h c d G h dcde \'c h\\nC2 a h a h c haG F \'G a h c h aG ah aG \'C3 g fed h\\nC2 c de d c ha h \'h c d dchaG F Ga c hha aG\"]', '[\"L\'on dit q\'a-mors est dol-ce cho-se\\nmais je n\'en co-nois la dol-çor;\\nto-te jo-ie m\'en est en-clo-se,\\nn\'ainz ne sen-ti nul bien d\'a-mor.\\nlas-se, mes mals ne se re-po-se;\\nsi m\'en de-plaig et faz cla-mor.\\nmar est ba-tuz qui plo-rer n\'o-se\\nn\'en plo-rant di-re sa do-lor.\\nses duelz li part, qui s\'o-se plain-dre;\\nplus tost en puet son mal es-tain-dre.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60009580/f102.item\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 111, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 1, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1329, 'De mon desir ne sai mon melz ellire', 'Linker 24.12', 'Blondel de Nesles', 'French', 'K', '113a-b', 1, 1, '[\"C2 d d dch d c de d \'C2 c hcd cha aG\\nhcd c c(h) haG h \'C2 cd c ha G a\\nd d dch d c de \'C2 d c hcd cha aG\\nhcd c(h) \'C2 ha aG h cd c ha aG a \'\\nC2 G a h d e d e f f \'C3 ede ed\\ne f g fe c de \'C2 h c h(a) ah\\nG a h \'C2 d e d e C3 g f edefe ed\",\"C2 d d dch d c de d\\nC2 c hcd cha aG \'hcd c c(h) haG h\\nC2 cd c ha G a \'d d dch d c de\\nC2 d c hcd cha aG \'hcd c(h)\\nC2 ha aG h cd c ha aG a \'\\nC2 G a h d e d e f f\\nC3 ede ed \'e f g fe c de\\nC2 h c h(a) ah \'G a h\\nC2 d e d e C3 g f edefe ed\"]', '[\"De mon de-sir ne sai mon melz el-li-re\\ncar a-des voi ma joi-e de-la-ier.\\nSi sin je al qui plo-rief sen con-sieur-re\\nmes ne men sai en quel lieu con-seil-lier.\\nmer-ci re-qier a-mors de mon mar-ti-re.\\nQue nus fors li ne men for-noit ai-dier\\nquant li ple-ra ni cou-vient au-tre mi-re.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f139.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 769, \"facsimileY\": 1042, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 250, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 37),
