(1333, 'Pax in nomine', 'Marc1', 'Marcabru', 'Occitan', 'W', 'fol. 194v', 1, 1, '[\"c c c a h(a) G a c\\nh \'c aG ah c haG a a \'\\nEEF G GF FE\\nE G G a a aG FED FE \'\\nE G G a a aG FED FE\\nc c c(h) a \'hh(a) aG Ga c\\nc d c h(a) a ah cc(h) \'haG\\nc d e e e e d efe dc\\ncd ede(f) d(c) \'ha aG decd c(h) ha h%ca\",\"c c c a h(a) G a c \'h\\nc aG ah c haG a a \'\\nEEF G GF FE \'E G G a a aG FED FE \'\\nE G G a a aG FED FE \'c c c(h) a\\nhh(a) aG Ga c \'c d c h(a) a ah cc(h)\\nhaG \'c d e e e e d efe dc \'cd ede(f) d(c)\\nha aG decd c(h) ha h%ca\"]', '[\"Pax in no-mi-ne Do-mi-ni!\\nFez Mar-ca-bruns los moz e·l so.\\nAu-iaz qe di:\\ncum nos a fait per sa dou-sor\\nlo sei-gno-rius ce-les-ti-aus,\\npro-bet de nos, un la-va-dor\\nc\'anc for ou-tra-mar no·n fon taus\\nen de lai en-ves Jo-sa-phat;\\ne d\'a-quest de sai vos co-nort.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 22, \"TextFontModern\": 5, \"MelodicStructure\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1353, 'Ich male of des sanges symz', 'Herm J 4', 'Herman Damen', 'German', 'J', 'fol. 122v-124r', 1, 1, '[\"C1 FG a a a c a aGFG GF\\nF \'C1 G a a(G) F G a ba\\na c d \'C1 c a aFGD F\\nF G a aG \'C1 F G a Ga\\na a G a aFG \'C1 GF\\nFED F G a G a GFED \'C1 EF\\nF G a ab aG c \'C1 ca b a Ga F Ga\\nFG a \'C1 aG c chaG a a\\nF G a a b \'C1 a Ga\\nFED F G a G a \'C1 FED F FEDC D FF\\nFG a a a \'C1 c a aGFG GF\\nF G a \'C1 aG F G a ba\\na c d \'C1 ch a aFGD F\\nF G a a(G) a \'C1 G a ha\\na a G a aFG \'C1 GF\\nFED F G a G a GFED EF \'C1\\nF G a a aG c cha \'C1 h a Ga F Ga\\nFG a aG \'C1 c chaG a a\\nF G a a \'C1 b a Ga\\nGFED F G a G \'C1 a FED F FEDC D FF\\nF F E \'C1 D/ C DF C D\\nF G \'C1 a b a Ga a\\nF F F D/ \'F2 C DF C D\\nF G a b \'C1 a Ga a\\nFG a a a \'C1 c(h) a aGFG GF\\nF G \'C1 a aG F G a ba\\na c d \'C1 c a aF-GD F\\nF G a aG \'C1 F G a ba\\na a G a aFG \'C1 GF\\nFED F G a G a GFED \'C1 EF\\nF G a a(G) aG\\nc \'C1 cah b a Ga F Ga\\nFG \'C1 a aG c chaG a a\\nF G a \'C1 a b a Ga\\nGFED F G a G \'C1 a GFED F FEDC D FF\",\"C1 FG a a a c a aGFG GF \'F\\nC1 G a a(G) F G a ba \'a c d\\nC1 c a aFGD F \'F G a aG\\nC1 F G a Ga \'a a G a aFG\\nC1 GF  \'FED F G a G a GFED\\nC1 EF \'F G a ab aG c\\nC1 ca b a Ga F Ga \'FG a\\nC1 aG c chaG a a \'F G a a b\\nC1 a Ga \'FED F G a G a\\nC1 FED F FEDC D FF \'FG a a a\\nC1 c a aGFG GF \'F G a\\nC1 aG F G a ba \'a c d\\nC1 ch a aFGD F \'F G a a(G) a\\nC1 G a ha \'a a G a aFG\\nC1 GF \'FED F G a G a GFED EF\\nC1 \'F G a a aG c cha\\nC1 h a Ga F Ga \'FG a aG\\nC1 c chaG a a \'F G a a\\nC1 b a Ga \'GFED F G a G\\nC1 a FED F FEDC D FF \'F F E\\nC1 D/ C DF C D \'F G\\nC1 a b a Ga a \'F F F D/\\nF2 C DF C D \'F G a b\\nC1 a Ga a \'FG a a a\\nC1 c(h) a aGFG GF \'F G\\nC1 a aG F G a ba \'a c d\\nC1 c a aF-GD F \'F G a aG\\nC1 F G a ba \'a a G a aFG\\nC1 GF \'FED F G a G a GFED\\nC1 EF \'F G a a(G) aG \'c\\nC1 cah b a Ga F Ga \'FG\\nC1 a aG c chaG a a \'F G a\\nC1 a b a Ga \'GFED F G a G\\nC1 a GFED F FEDC D FF\"]', '[\"Ich ma-le of des san-ges symz.\\nMyt tich-te sam ich bes-te kan.\\nHer syn ir suͦlt po-l[i]e-ren.\\nSwa-che truͦ-be von my-ne wort.\\nSo tuͦt yr lie-be myr.\\nOuch sagen es v̈. die wy-sen danc.\\nwibet in dem her-tzen myt ge-dan-ken red-he glanz.\\nDaz prist man v-zer ma-ze\\nOuch tze-lich ez v. vuͦr guͦt.\\nDoch vuͦrcht ich ey-nez hert-ze-li-che se-re.\\nDaz myn kvnst ryn-ger den eyn pymz.\\nwige. leit man sie kegen an-der an.\\nDie wa-ge san wil tzie-ren.\\nDiv bes-te in der wa-ge dort.\\nOuch wil sie tzey-gen ir.\\nSwar da an al-ler tru-ge wanc.\\nDurch daz man schou-we daz nicht sy an ir vn-ganz.\\nVnde daz die rech-ten sa-ze.\\nSanc hat der ym rech-te tuͦt.\\nDer mac sin wol ge-wyn-nen pris vnd e-re.\\nEr tiv-ret man. vnde wir-det wib.\\nOuch git er ho-e le-re.\\nSwer syn vil kan. vil mani-gen lib.\\nvryt er von senen-der swe-re.\\nSanc ist der kvnst eyn gespie-gelt trymz.\\nSwer syn da kvn-de ie ge-wan.\\nDer liez sich tugen-de vie-ren.\\nNach pri-ses site of itz-lich ort.\\nDa von stet al myn gir.\\nDar nach daz ich ge-rech-ten sanc.\\nVil gerne ir kan-de.\\nWiz-zent daz swer sy-nen kranz.\\nSo birt daz er vuͦr gra-ze.\\nSy-ne tzvn-gen hat be-huͦt.\\nDer treyt yn daz er ym nicht wirt tzv̊ swe-re.\"]', '[\"Ms Z. 9: G a korrigiert um eine silbe verschoben\\nZ. 10: Silbenaufteilung am Zeilenende nicht ganz eindeutig\\nZ. 13: Korrektur?\\nZ. 30 : Rasur a\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignatur