(1379, 'Conmencerai / a fere un lai', 'Linker 240.8', 'Thibaut de Champagne', 'French', 'Mt', '66r', 1, 1, '[\"C1 F G a a\\nc d c a\\nG \'C2 F G a\\nF G a a \'\\nC2 c d c a\\nG F FG a\\nF G F \'C1 E D C D\\nF G a h c d ch a\\nc \'C1 d c a G ah aG F\\nFG ah a GGF ED C \'C1 Ga\\nFE D C D F E D \'\\nC1 F G a h c dch aG\\nd c a G ah c \'C1 a\\nG FE D DC\\nC D F F \'C1 GF E D\\nC D F G ah c ch a\\nC2 c de \'C2 d c a h h(a) aG\\na h c a\\nc \'C2 d e d\\nf e d c d eed dc \'\\nC2 c d f e d c h a\\nh c c d c h \'C2 a h a\\nc d e d c ch c c\\nc d f e \'C2 d c cd c\\nf e d c h a Gah GF\\nF G \'C2 a GF\\nF G h h c dcch c\\nc \'C3 d f f fed e c\\nd f e d c \'C2 cc(h) haG\\nF G a GF\\nF G h h c \'C2 dcch c\\nc d f d d c dedc\\nf f f \'C2 d ef c h a\\nh c d e f \'C3 g f e\\nf gc e e\\ne f +a g \'C2 d c haG\\na c h a h a haG\\na h d \'C2 h c d h\\na G GFE F\\nG h a G \'C2 a ha aG\\na hc(d) d c h hG h\\na \'C2 h c h\\ne f e c\\ne d c a G  \'C2 ahc ha\\nh a G F G aG GF //\",\"C1 F G a a \'c d c a \'G\\nC2 F G a \'F G a a \'\\nC2 c d c a \'G F FG a \'F G F\\nC1 E D C D \'F G a h c d ch a \'c\\nC1 d c a G ah aG F \'FG ah a GGF ED C\\nC1 Ga \'FE D C D F E D \'\\nC1 F G a h c dch aG \'d c a G ah c\\nC1 a \'G FE D DC \'C D F F\\nC1 GF E D \'C D F G ah c ch a \'C2 c de\\nC2 d c a h h(a) aG \'a h c a \'c\\nC2 d e d \'f e d c d eed dc \'\\nC2 c d f e d c h a \'h c c d c h\\nC2 a h a \'c d e d c ch c c \'c d f e\\nC2 d c cd c \'f e d c h a Gah GF \'F G\\nC2 a GF \'F G h h c dcch c \'c\\nC3 d f f fed e c \'d f e d c\\nC2 cc(h) haG \'F G a GF \'F G h h c\\nC2 dcch c \'c d f d d c dedc \'f f f\\nC2 d ef c h a \'h c d e f\\nC3 g f e \'f gc e e \'e f +a g\\nC2 d c haG \'a c h a h a haG \'a h d\\nC2 h c d h \'a G GFE F \'G h a G\\nC2 a ha aG \'a hc(d) d c h hG h \'a\\nC2 h c h \'e f e c \'e d c a G \\nC2 ahc ha \'h a G F G aG GF //\"]', '[\"Com-men-ce-rai\\na fere un lai\\nde la meil-lor.\\nFor-ment m’es-mai\\nque trop par ai\\nfet de do-lor\\ndont mi chant tor-ront a plor.\\nMe-re vir-ge sa-vo-re-e,\\nse vos fai-tez de-mo-re-e\\nde pro-ier le haut Se-gnor,\\nbien doit a-voir grant pa-or\\ndu du de-able, du fe-lon,\\nqui en la noi-re pri-son\\nnos velt me-ner\\ndont nus ne puet es-cha-per.\\nEt j’ai for-fet, dou-ce Da-me,\\na per-dre le cors et l’a-me,\\nse ne m’ai-diez.\\nDouz Diex, a-iez\\nmer-ci de mes vix pe-chiez.\\nOu se-ra mer-ci tro-ve-e,\\ns’e-le est de vos re-fu-se-e\\nSi-re, droi-tu-re ou-bli-ez\\net des-ten-dez vos-tre cor-de,\\nsi vie-gne mi-se-ri-cor-de\\npor nos ai-dier.\\nNos a-vons de droit mes-tier;\\nquant seur toz es-tez puis-sanz,\\nbien de-vez de vos ser-janz\\na-voir mer-ci.\\nBiaux douz Si-re, je vos pri,\\nne me me-tez en ou-bli!\\nSe pi-tiez ne vaint uen-jan-ce,\\ndont se-ronz nos sans dou-tan-ce\\ntrop mal me-né.\\nDa-me, ple-ne de bon-té\\nvos-tre douz moz sa-vo-ré\\nne so-ient pas ou-bli-é!\\nPro-iez por nos!\\nJa-més ne se-rons res-couz,\\nse ne le so-mes par vos,\\nde voir le sai.\\nCi lais-se-rai\\net Dex nos doint sans de-lai\\na-voir son se-cors ve-rai!\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
