(1394, 'Dame, li vostres fins amis', 'Linker 240.12', 'Thibaut de Champagne', 'French', 'Mt', '59v', 1, 1, '[\"C1 D D E F G aGF GFE \'C1 D\\nE FG FE D E \'C1 FG FED C\\nC D E F G aGF GFE D \'\\nC1 E G E G a cha haG a\\nh d \'C1 G a h cha haG a\\na a G FE \'C1 F Ga FED DC\\nC D E F G ECD \'C1 DEFE ED //\",\"C1 D D E F G aGF GFE\\nC1 D \'E FG FE D E\\nC1 FG FED C \'C D E F G aGF GFE D \'\\nC1 E G E G a cha haG a \'h d\\nC1 G a h cha haG a \'a a G FE\\nC1 F Ga FED DC \'C D E F G ECD\\nC1 DEFE ED //\"]', '[\"Da-me, cist vos-tre fins a-mis,\\nqui tot son cuer a en vos mis,\\nde vos a-mer est si sor-pris\\nque de jor et de nuit est pris,\\nvos man-de que sa-chiez de voir\\nqui vos ai-me sans de-ce-voir;\\nen vos a-mer n’a pas mes-pris.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
