(1450, 'Mout sera cil bien norris', 'Linker 265.1183', 'Author for Linker 265.1183', 'French', 'X', '258r-258v', 1, 1, '[\"C3 c d c f e d e \'\\nC2 d c cd chaG a\\nc d c \'C3 f C2 e d e\\nd c cd chaG \'C2 a\\nc ch GF baG F \'\\nC2b} c b c d d edc b\\nd \'C2 e(d) cd d\\nC3 e f g e \'C2 c c cd dhaG a\\na cd \'C2 h c(h) a cd chaG a\\nc ch G \'C2b} a F a baG F // \",\"C3 c d c f e d e \'\\nC2 d c cd chaG a \'c d c\\nC3 f C2 e d e \'d c cd chaG\\nC2 a \'c ch GF baG F \'\\nC2b} c b c d d edc b \'d\\nC2 e(d) cd d \'C3 e f g e\\nC2 c c cd dhaG a \'a cd\\nC2 h c(h) a cd chaG a \'c ch G\\nC2b} a F a baG F // \"]', '[\"Mout se-ra cil bien nor-ris\\net en bon cou-vent,\\net mult se-ra sei-gno-ris\\ntres bien et sou-vent\\nqui veut re-cla-mer\\nla me-re dieu et a-mer\\ntout son jou-vent:\\net Dieu le nos a bien en cou-vent,\\nque cil a s\'a-me ga-ri-e\\nqui sert la vir-ge Ma-ri-e.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1453, 'De la tres douce Marie', 'Linker 265.473', 'Author of Linker 265.473', 'French', 'X', '258v', 1, 1, '[\"C2 F Ga c c c h aG F \'C1 F Ga cha\\nF Ga c c \'C1 c h aG F F Ga cha\\nc \'C1 h a h aG F E F G \'F2 E F\\nC D E aF GE F \'\\nC1 c h a h a GF E \'\\nC1 F G D E\\nD F D \'C1 F\\nC E G aF GE F //\",\"C2 F Ga c c c h aG F\\nC1 F Ga cha \'F Ga c c\\nC1 c h aG F F Ga cha \'c\\nC1 h a h aG F E F G\\nF2 E F \'C D E aF GE F \'\\nC1 c h a h a GF E \'\\nC1 F G D E \'D F D\\nC1 F \'C E G aF GE F //\"]', '[\"De la tres dou-ce Ma-ri-e wieil chan-ter,\\nqui por-ta le sau-ve-or por en chan-ter,\\nce-lui qui nu-it  et jor nos vent ten-ter\\npor fai-re son de-vis.\\ncil doit bien es-tre_es-bau-dis\\nqui sert toz dis\\nen fes, en dis,\\nla flor de pa-ra-dis.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f524.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 672, \"facsimileY\": 481.3333435058594, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1454, 'De la flor de paradis', 'Linker 265.465', 'Author of Linker 265-465', 'French', 'X', '259r', 1, 1, '[\"C2 d c d e d ch aG\\nG \'C2 G a a hc haG G\\nd c \'C2 d e d ch aG\\nG G a \'C2 a hc haG C1 G\\nG E F \'C1 G FG FEF(E) D\\nD G a \'C1 G F ahc ha\\nC2 h c d e \'C2 d c d\\nC3 e f g c dd(c) ch \'C2 ch\\na h c d c hc ha \'\\nC2 c c c ef e de dcha G\\nc \'C2 c c df e df dcha G\\nG \'C2 a(G) F a h cha h //\",\"C2 d c d e d ch aG \'G\\nC2 G a a hc haG G \'d c\\nC2 d e d ch aG \'G G a\\nC2 a hc haG C1 G \'G E F\\nC1 G FG FEF(E) D \'D G a\\nC1 G F ahc ha \'C2 h c d e\\nC2 d c d \'C3 e f g c dd(c) ch\\nC2 ch \'a h c d c hc ha \'\\nC2 c c c ef e de dcha G \'c\\nC2 c c df e df dcha G \'G\\nC2 a(G) F a h cha h //\"]', '[\"De la flor de pa-ra-dis\\nvou-drai di-re_u-ne chan-çon,\\ncar de li doi-vent touz diz\\nve-nir tuit li no-vel son.\\nnus ne puet es-tre_es-bau-diz\\nne ne puet a-voir rai-son\\nqui ne sert en fes et diz\\nla da-me sanz tra-i-son\\net sanz ni-sun es-con-diz,\\ncar je m\'es-mer-veil-le-ro-ie\\nco-ment por-roit a-voir jo-ie\\nnu-le_a-me se par li non.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1455, 'Mainte chançon ai fait de grant ordure', 'Linker 265.1113', 'Author of Linker 265.1113', 'French', 'X', '259v-260r', 1, 1, '[\" C3 c d e e f d \'C2 c d e d d\\nc d e \'C2 e f d c d e d d \'\\nC3 d c d e f g e\\nf ed c \'C2 d e a aaG\\nd c d C3 e f g e \'\\nC3 f ed c d e d d \'\\nC3 d +a +a f g f e\\nd \'C3 +a +a f g f e\\ne d c d \'C3 e d d\\nd +a +a f g f e \'\\nC3 d +a +a f g f e\\ne d c \'C3 d e d d\\nd c d e f \'C3 g e\\nf ed c d e a a \'\\nC3 d c d e f g e\\nf \'C3 ed c d e d d // \",\" C3 c d e e f d\\nC2 c d e d d \'c d e\\nC2 e f d c d e d d \'\\nC3 d c d e f g e \'f ed c\\nC2 d e a aaG \'d c d C3 e f g e \'\\nC3 f ed c d e d d \'\\nC3 d +a +a f g f e \'d\\nC3 +a +a f g f e \'e d c d\\nC3 e d d \'d +a +a f g f e \'\\nC3 d +a +a f g f e \'e d c\\nC3 d e d d \'d c d e f\\nC3 g e \'f ed c d e a a \'\\nC3 d c d e f g e \'f\\nC3 ed c d e d d // \"]', '[\"Main-te chan-çon ai fait de grant or-du-re,\\nmes, se dieu plaist, ja-més n\'en av-rai cu-re.\\nEn moi a pe-tit e-u\\nbien et sens et me-su-re;\\nor me tieng a de-ce-u\\nquant si lonc tens me du-re.\\nbien ai mon cuer es-me-u,\\ncar por chan-ter l\'ai me-u\\nde la ro-ï-ne pu-re\\npar qui so-mes es-le-ü\\nen grant jo-ie_et re-ce-ü\\net fors de grant ar-du-re\\nc\'est la dou-ce me-re dieu,\\nqui de do-lor nos cu-re;\\nren-du nos a le bon lieu\\nou joi-e toz jors du-re.\\n\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40