(1457, 'On doit la mere Dieu honorer', 'Linker 265.1239', 'Author of Linker 265.1239', 'French', 'X', '260v-261r', 1, 1, '[\"C3 a c c dch c d dch \'C2 d(h) a\\nh a h a\\nG a(G) \'C1 E F a(G) FE D C\\nD E F \'C1 Ga D FEF D\\nD E F Ga D \'C1 FED C\\nD E F Ga D FEF(E) D //\",\"C3 a c c dch c d dch\\nC2 d(h) a \'h a h a \'G a(G)\\nC1 E F a(G) FE D C \'D E F\\nC1 Ga D FEF D \'D E F Ga D\\nC1 FED C \'D E F Ga D FEF(E) D //\"]', '[\"On doit la me-re Dieu ho-no-rer\\nsans de-mo-rer\\net de-seur tou-tes a-o-rer,\\ncar ce est nos-tre_a-mi-e.\\nVir-ge dou-ce Ma-ri-e,\\nne nos ou-bli-és mi-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
