(1459, 'Prions en chantant', 'Linker 265.1381', 'Author of Linker 265.1381', 'French', 'X', '261v', 1, 1, '[\"F3 C G Ga G FFE\\nD D \'F2 DEF EDC DE\\nC G Ga G FFE \'\\nF2 D D DEF EDC CE\\nC G Ga \'F2 G FFE\\nD D DEF EDC DE\\nD G \'F2 Ga G FFE\\nD D DEF EDC DE \'\\nF2 C C D DDE GFE ED\\nD D D \'F2 D EDC C\\nD D DEF EDC C\\nC \'F2 C D DDE GFE ED\\nD D D D EDC C \'\\nF2 D D DEF EDC C //\",\"F3 C G Ga G FFE \'D D\\nF2 DEF EDC DE \'C G Ga G FFE \'\\nF2 D D DEF EDC CE \'C G Ga\\nF2 G FFE \'D D DEF EDC DE \'D G\\nF2 Ga G FFE \'D D DEF EDC DE \'\\nF2 C C D DDE GFE ED \'D D D\\nF2 D EDC C \'D D DEF EDC C \'C\\nF2 C D DDE GFE ED \'D D D D EDC C \'\\nF2 D D DEF EDC C //\"]', '[\"Pri-ons en chan-tant\\nla me-re Jhe-su\\nqu\'el nos soit ai-dant,\\nne soi-ons per-du,\\nen-vers son en-fant,\\nqui de li nez fu,\\nqu\'il nos soit ga-rant\\npar sa grant ver-tu.\\nBon fu on-ques ne-e\\nla vir-ge ho-no-ree,\\nla flor de bon-té,\\nda-me bien a-me-e,\\nro-ï-ne cla-me-e\\nde grant roi-au-té.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40);
