(1460, 'Lonc tens ai usé ma vie', 'Linker 265.1095', 'Author of Linker 265.1095', 'French', 'X', '262r', 1, 1, '[\"C2 a d c d e d cha G \'\\nC2 G d c d e d cha G\\na c \'C2 h G a ch a G a h \'C2 aG F\\na c h a h c G \'C2 F G a ha G //\",\"C2 a d c d e d cha G \'\\nC2 G d c d e d cha G \'a c\\nC2 h G a ch a G a h\\nC2 aG F \'a c h a h c G\\nC2 F G a ha G //\"]', '[\"Lonc tens ai u-sé ma vi-e\\nen pe-chié et en fo-li-e.\\nLas chai-tis, co-ment ai je char si har-di-e\\nde tant dor-mir en pe-chié? C\'est mu-sar-di-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f531.item\", \"Plica\": false, \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 533.3333129882812, \"facsimileY\": 113.33333587646484, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 18, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1461, 'Mere au roi puissant', 'Linker 265.1140', 'Author of Linker 265.1140', 'French', 'X', '262v', 1, 1, '[\"C3 G G G G h d\\ne \'C2 d c a chha\\nGF ah G\\nG \'C2 G G h d\\ne d c \'C2 a chha\\nGF ah G\\nG F G \'C1 h FED\\nD DE G F aa\\nc \'C1 h a a G\\nG F G a FFED \'\\nC1 D DE G F a a\\nc h \'C1 h a\\nc h h a\\nd \'C2 ch h a G // \'\",\"C3 G G G G h d \'e\\nC2 d c a chha \'GF ah G \'G\\nC2 G G h d \'e d c\\nC2 a chha \'GF ah G \'G F G\\nC1 h FED \'D DE G F aa \'c\\nC1 h a a G \'G F G a FFED \'\\nC1 D DE G F a a \'c h\\nC1 h a \'c h h a \'d\\nC2 ch h a G //\\n\"]', '[\"Me-re au roi puis-sant,\\nbon loi-er a-tent\\nqui vous sert.\\nL\'a-mour vos-tre_en-fant,\\nque vous a-mez tant,\\nen de-sert\\nroï-ne ho-no-ree,\\nbo-ne_est la pen-see\\nqui a vos s\'a-ert.\\nSe ne fus-siés nee,\\ntou-te fust dam-pne-e\\nla gent qui sont\\net qui se-ront,\\ntuit en soi-mes cert.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1462, 'Qui bien aime a tart oublie', 'Linker 185.16', 'Moniot d\'Arras', 'French', 'X', '262v-263r', 1, 1, '[\"C2 G aGF a c d ed \'C2 c dcde\\nf e d ed c ch ah \'\\nC2 G aGF a hcd c h c haG\\nG aGF a \'C3 c d ed cd\\ng fe d \'C3 efe d cd efec\\ndc de g fed c h \'C3 c ha\\na e fg fed c-c h cha \'\\nC2 G a c h ch haG h cha\\ne \'C3 fgf d ch d cha aG //\",\"C2 G aGF a c d ed\\nC2 c dcde \'f e d ed c ch ah \'\\nC2 G aGF a hcd c h c haG \'G aGF a\\nC3 c d ed cd \'g fe d\\nC3 efe d cd efec \'dc de g fed c h\\nC3 c ha \'a e fg fed c-c h cha \'\\nC2 G a c h ch haG h cha \'e\\nC3 fgf d ch d cha aG //\"]', '[\"Qui bien ai-me_a tart ou-bli-e,\\npor-ce ne puis ou-blï-er,\\nla dou-ce vier-ge Ma-ri-e;\\nde li me cou-vient chan-ter\\net mon chant re-nou-ve-ler\\net fai-re de li m\'a-mi-e,\\nqu\'e-le me puis-se_a-cor-der\\na ce-lui qui ne faut mi-e\\nceus qui le vuel-lent a-mer.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f532.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 219, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1463, 'Je te pri de cuer par amors', 'Linker 265.934', 'Author of Linker 265.934', 'French', 'X', '263r', 1, 1, '[\"C3 a c d e f g f e \'\\nC2 d ch a c d haG a\\na c d \'C3 e f g f e\\nd ch a \'C2 h c haG a\\nC3 g e f g e \'C3 fed e\\ng e f e c d ch \'C2 a\\nG c d e f e \'C3 d e\\nd e f g e fed e\\ng \'C3 e f e c d ch a\\nG \'C2 c d e c dch a //\",\"C3 a c d e f g f e \'\\nC2 d ch a c d haG a \'a c d\\nC3 e f g f e \'d ch a\\nC2 h c haG a \'C3 g e f g e\\nC3 fed e \'g e f e c d ch\\nC2 a \'G c d e f e\\nC3 d e \'d e f g e fed e \'g\\nC3 e f e c d ch a \'G\\nC2 c d e c dch a //\"]', '[\"Je te pri de cuer par a-mors,\\nhau-te vir-ge Ma-ri-e,\\npar ta pi-tié, par ta dou-çor,\\nque ton chier fiz de-pri-e,\\nda-me, que il n\'o-bli-e\\nces chai-tis do-lens pe-che-ors\\nqui me-tent leur a-me_a do-lor,\\nne se co-nois-sent mi-e;\\nper-du se-ront sanz nul re-tor,\\nse tu lor faus d\'a-ï-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1464, 'Or laissons ester touz les chans dou monde', 'Linker 265.1276', 'Author of Linker 265.1276', 'French', 'X', '263v', 1, 1, '[\"C2 d d d c ah d d \'C2 d c ha G\\nd d d \'C2 c ah d d d c ha G\\nd \'C2 d d c ah c h aG F \'C1 G E\\nG G a d haG h \'C1 h a a G\\nd(c) ha G F G \'C1 Ga h d(c) h a\\nh h a a G //\",\"C2 d d d c ah d d\\nC2 d c ha G \'d d d\\nC2 c ah d d d c ha G \'d\\nC2 d d c ah c h aG F\\nC1 G E \'G G a d haG h\\nC1 h a a G \'d(c) ha G F G\\nC1 Ga h d(c) h a \'h h a a G //\"]', '[\"Or lais-sons e-ster touz les chans dou mon-de\\nmeil-lor fet chan-ter de la vir-ge mon-de,\\nde la me-re Dieu, qui tres-touz nos mon-de\\ndou mal ou A-dan nos a-voit po-sez.\\nHé, me-re Dieu, tres dou-ce Ma-ri-e,\\ncar nos se-cor-rés.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1465, 'Fox est qui en folie', 'Linker 265.718', 'Author of Linker 265.718', 'French', 'X', '264r', 1, 1, '[\"C2 c c h d c h a\\nc c \'C2 h d ch a G\\nc c h d \'C2 c h a\\nc c h d ch a G \'\\nC3 d h c d e c f(e)\\nd ch \'C3 a h c d c\\nd h c \'C3 d e c f(e)\\nc h a h \'C2 c d c\\nh c ha G h d \'C2 c\\nd h c d e \'C3 c f(e)\\nd ch a h c \'C3 d c\\nc h c d e c f(e) \'\\nC2 d ch a h c d c //\",\"C2 c c h d c h a \'c c\\nC2 h d ch a G \'c c h d\\nC2 c h a \'c c h d ch a G \'\\nC3 d h c d e c f(e) \'d ch\\nC3 a h c d c \'d h c\\nC3 d e c f(e) \'c h a h\\nC2 c d c \'h c ha G h d\\nC2 c \'d h c d e\\nC3 c f(e) \'d ch a h c\\nC3 d c \'c h c d e c f(e) \'\\nC2 d ch a h c d c //\"]', '[\"Fox est qui en fo-li-e\\nson tens met et em-ploi-e,\\ncar l\'a-me n\'est pas li-e\\nquant li cors trop fo-loi-e.\\nOr me sui ie a-par-ceüz\\nque j\'ai chan-té fo-le-ment,\\npar pou ne sui de-ce-üs.\\nChan-ter m\'e-stuet au-tre-ment:\\nde la ro-ï-ne dou mont;\\nsa grant bon-tez mi se-mont\\nqu\'a li soit mes chanz tor-nez.\\nMe-re Dieu, de-vo-te-ment\\nvos pri que me se-cor-rés.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1467, 'J\'ai un cuer trop lent', 'Linker 253.1', 'Thibaut d\'Amiens', 'French', 'X', '264v', 1, 1, '[\"C3 G aGF G Ga c\\nc \'C2 cd c h aGF\\na hch a \'C2 G aGF G\\nG aGF G Ga c\\nc \'C2 cd c h aGF\\na hch \'C2 a G aGF G\\nd cha h c d \'\\nC2 d efe d ch aG\\nc e f \'C2 f ede d\\nd efe d ch aG \'\\nC2 c ded h haG aF\\na hch a G \'C2 aGF G //\",\"C3 G aGF G Ga c \'c\\nC2 cd c h aGF \'a hch a\\nC2 G aGF G \'G aGF G Ga c \'c\\nC2 cd c h aGF \'a hch\\nC2 a G aGF G \'d cha h c d \'\\nC2 d efe d ch aG \'c e f\\nC2 f ede d \'d efe d ch aG \'\\nC2 c ded h haG aF \'a hch a G\\nC2 aGF G //\"]', '[\"J\'ai un cuer trop lent,\\nqui sou-vent mes-prent\\net pou s\'en es-mai-e.\\nEt li tens s\'en vet\\net je n\'ai-riens fait,\\nou grant fi-an-ce_ai-e.\\nLonc tens ai mu-sé\\net mon tens u-sé\\ndont j\'a-tent grief pai-e,\\nse par sa bon-té\\nla flor de pur-té\\nson fil ne m\'a-pai-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1468, 'Je ne vueil plus de sohier', 'Linker 265.916', 'Author of Linker 265.916', 'French', 'X', '265r', 1, 1, '[\"C2 h c d d ch ha G \'\\nC1 a F G a c(h) ha G \'\\nC2 h c d d ch ha G \'\\nC2 a F G G c(h) ha G\\nh \'C2 c d cha h c d\\nh \'C2 c d cha h c d\\nc \'C2 cha G\\na hc h a G \'\\nC2 a a h c d cha\\nh G \'C2 a c haG a //\",\"C2 h c d d ch ha G \'\\nC1 a F G a c(h) ha G \'\\nC2 h c d d ch ha G \'\\nC2 a F G G c(h) ha G \'h\\nC2 c d cha h c d \'h\\nC2 c d cha h c d \'c\\nC2 cha G \'a hc h a G \'\\nC2 a a h c d cha \'h G\\nC2 a c haG a //\"]', '[\"Je ne vueil plus de so-hier\\nchan-ter ne fai-re chan-çon,\\nla me-re Dieu vueill proi-er\\nque me fa-ce vrai par-don\\net me fa-ce_a-cor-de_et pes\\nvers son fil de mes mes-fés\\nqu\'a-ne-mis\\nne m\'ait mort et pris.\\nTres dou-ce Ma-ri-e,\\nne m\'ou-blï-és mi-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1469, 'De la mere au sauveor', 'Linker 265.467', 'Author of Linker 265.467', 'French', 'X', '265v', 1, 1, '[\"C3 h c d d-e(d) ch a G\\nh \'C2 c d e(d) cha G a\\nh \'C2 c d e(d) ch a G\\nh c \'C2 d e(d) cha G a\\nh c d hG h \'C3 c d\\nd e g f e\\ne d \'C2 e e\\nc d c\\nc d h ch \'C2 a G\\nG a h c\\nG a \'C2 h c cha G a //\",\"C3 h c d d-e(d) ch a G \'h\\nC2 c d e(d) cha G a \'h\\nC2 c d e(d) ch a G \'h c\\nC2 d e(d) cha G a \'h c d hG h\\nC3 c d \'d e g f e \'e d\\nC2 e e \'c d c \'c d h ch\\nC2 a G \'G a h c \'G a\\nC2 h c cha G a //\"]', '[\"De la me-re_au sau-ve-or\\nvo-drai chan-çon co-men-cier\\nnus ne puet es-tre_en do-lor\\nqui mer-ci [li] veut proi-er.\\nMa-ri-e vir-ge loi-aus,\\npu-ce-le roi-aus,\\nde cuer vra-i,\\nsans de-lai,\\nVir-ge, vos proi-e-rai\\nqu\'au iu-ge-ment\\nnos des-fen-dez de tor-ment.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f538.item.zoom\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 504, \"facsimileY\": 310, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
