(1472, 'Nv scouwet an den svmer guot', 'BWernh 11', 'Bruder Wernher', 'German', 'J', 'fol. 9r', 1, 1, '[\"C1 a a a aG F \'C1 a c c/ c-c c d c cb a \'C1 b c\\n_h a _h c _h a _h \'C1 c/ a _h a aG a _h aGFE GF \'C1\\nF G a abaG  a _h c/ baG F F \'C1 F G ab aGFE GF\\na a a \'C1 a GF a c c/ c c d c cb \'C1 a b c\\n_h a _h c _h a \'C1 b c/ a _h a a(G) a _h aGFE \'C1 GF\\nF G a b aG a _h \'C1 c/ baG F F F G a_h aGFE GF \'C1\\nC D F F G ab aG-FE GF\\nF \'C1 F a c G E FED E FED EC \'C1 C\\nC D F F G aGF F F \'C1 F F F G ab aGFE GF\\nF F \'C1 a c G F ED E FED EC C \'C1\\nC D F F G a b/ \'C1 aG F F F G ab aGF F \'C1\\nF G a a baG a _h c/ baG \'C1 F F G a b aGFE GF\",\"C1 a a a aG F\\nC1 a c c/ c-c c d c cb a\\nC1 b c \'_h a _h c _h a _h\\nC1 c/ a _h a aG a _h aGFE GF\\nC1 \'F G a abaG a _h c/ baG F F\\nC1 F G ab aGFE GF \'a a a\\nC1 a GF a c c/ c c d c cb\\nC1 a b c \'_h a _h c _h a\\nC1 b c/ a _h a a(G) a _h aGFE\\nC1 GF \'F G a b aG a _h\\nC1 c/ baG F F F G a_h aGFE GF\\nC1 \'C D F F G ab aG-FE GF \'F\\nC1 F a c G E FED E FED EC\\nC1 C \'C D F F G aGF F F\\nC1 F F F G ab aGFE GF \'F F\\nC1 a c G F ED E FED EC C\\nC1 \'C D F F G a b/\\nC1 aG F F F G ab aGF F\\nC1 \'F G a a baG a _h c/ baG\\nC1 F F G a b aGFE GF\"]', '[\"Nv scou-wet an den sv-mer guͦt. Wie_er al der werl-de vreu-de git.\\nDer rey-nen wrtz ir suzẹ iz krut. heydẹ vn-d[e] walt ge-tzie-ret lit.\\nDie vog-lin hohẹnt _ i-ren sanc. Der hy-mel hat ge-rey-net sich\\nDes sol der werc-man gẹ eret syn. Der al-so bil-de scef-fen kan.\\nDaz rey-ne wib ir lie-bez kynt. Dar tzv̊ den wol ge-mv̊-ten man.\\nVndẹ ouch des liech-ten mey-en blic. Wie sv-ze er nv dvn-ket mich.\\nSo_ẹr in der bes-ten wir-de lit.\\nDa nach so kvmpt ein ri-fe myt ge tvan ge\\nDer vuͦr tir-bet blv̊-men vndẹ vuͦr kerẹt die wun-nich-li-che tzit.\\nVndẹ schei dent sich die vogẹ-lin von ge san-ge.\\nVvi-bes schonẹ vndẹ man-nes kraft. Stent in der wirdẹ wol dri-tzich iar.\\nSo leit div erdẹ an sie ir stric des nemt an my-ner mv-de war.\"]', '[\"Z. 13 Rasur der Note D von \'er\'\\nZ. 20 Korrektur _h zu a bei \'sie\'\\n\'rife\' vs \'vogelin\' verschieden - Absicht?\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
