(1501, 'Swer die wunne wol pruven kunne', 'S1 Namenl 1', 'Ulrich von Winterstetten', 'German', 'Schreibers Bruchstück', 'S. 252-253', 1, 1, '[\"C2 D G a h hc dc hc a G a G FFG E\\nG \'F3 F E D C D E\\nD E EF G F/ E FG \'F3 a a G\\na Ga E E GE G E C E DH \'F3 C D C\\nD E EF G F/ E FG a a G\\n\'F3 a Ga E E GE G E D C C E\",\"C2 D G a h hc dc hc a G a G FFG E \'G\\nF3 F E D C D E \'D E EF G F/ E FG\\nF3 a a G \'a Ga E E GE G E C E DH\\nF3 C D C \'D E EF G F/ E FG a a G \'\\nF3 a Ga E E GE G E D C C E\"]', '[\"Die mi-ne stoͤ-ret vnd toͤ-ret mich anẹ al-len wan\\nsit daz sù mich niht en-hoͤrẹt\\nEs ist ein wun-der sol ich bi-sun-der\\nvn-der mi-nen dang ver-der-bevn sehẹnd daz muͦz ich clagẹn\\nAch fro-we schei-de von sen-demẹ lei-de\\nbei-de mir den muͦt vnd al-le mi-ne simsẹ\"]', '[\"Letzte Zeile ohne Notenschlüssel\\nù in Z. 2 eigentlich nicht korrekt\\nsimsẹ eigentlich wohl sinne\\nMelodie mit Edition (?) abgleichen\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
