(1504, 'Au douz comencement d\'esté', 'Linker 265.167', 'Author of Linker 265.167', 'French', 'X', '270r', 1, 1, '[\"C2 c c h a ah d c \'C1 chha\\nG a F G Ga c haG G \'\\nC2 c c h a ah d c chha \'\\nC2 G a F G Gh c haG G\\nc \'C2 d e d f e de dc\\nc d \'C2 e c f e de dcde\\nG a F \'C2 G Ga c haG G // \",\"C2 c c h a ah d c\\nC1 chha \'G a F G Ga c haG G \'\\nC2 c c h a ah d c chha \'\\nC2 G a F G Gh c haG G \'c\\nC2 d e d f e de dc \'c d\\nC2 e c f e de dcde \'G a F\\nC2 G Ga c haG G // \"]', '[\"Au douz co-men-ce-ment d\'e-sté\\nu-ne chan-çon co-men-ce-rai,\\nnon pas por ce que de vert pré\\nme vei-gne la joi-e que j\'ai,\\nan-çois me sem-ble faus-se-té\\net ba-ras et des-loi-au-té\\ntres-tout quant qu\'en cest sie-cle voi.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 120, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1507, 'Buer fu nez qui s\'apareille', 'Linker 265.283', 'Author of Linker 265.283', 'French', 'X', '270r-270v', 1, 1, '[\"C2 D a a a h a G aGF \'\\nF2 E F G FED FE DC FE\\nD a a \'C1 a h a G aGF\\nE F G FED \'F2 F EDC D\\nE F G G G F \'C1 GFD EG\\na h c c c h chah \'\\nC1 G d d c a hcd chaG F\\na \'C1 h c aF G a(G) FED C\\nC D E \'C1 F G(F) EDC F\\nF G a D \'C1 FG FEC EGED //\",\"C2 D a a a h a G aGF \'\\nF2 E F G FED FE DC FE \'D a a\\nC1 a h a G aGF \'E F G FED\\nF2 F EDC D \'E F G G G F\\nC1 GFD EG \'a h c c c h chah \'\\nC1 G d d c a hcd chaG F \'a\\nC1 h c aF G a(G) FED C \'C D E\\nC1 F G(F) EDC F \'F G a D\\nC1 FG FEC EGED //\"]', '[\"Buer fu nez qui s\'a-pa-reil-le\\na Dieu a-mer et ser-vir\\net qui en o-roi-sons veil-le\\nen fer-veur et en de-sir\\ncar qui sert Dieu en sa vi-e\\nde loi-al cuer et d\'en-tier,\\nil l\'en ren-dra grant bail-li-e,\\nqu\'en la so-e con-pai-gni-e\\nven-dra les mau-vais ju-gier\\net les jus-tes es-sau-cier.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40);
