(1508, 'Qui de la prime florete', 'Linker 265.1529', 'Author of Linker 265.1529', 'French', 'X', '271r', 1, 1, '[\"C2 D a G ahc a FG FE FED \'\\nF2 C DE G aGF E G a \'\\nC1 D a G ahc a FG F(E) FED \'\\nC1 C Ga F aG E CD EFED\\nD \'C1 a G ahc a Ga GE FED\\nC DE G aGF \'C1 E G a\\nC Ga G ahc \'C1 a FG FE FED\\nC Ga F aG \'C1 E CE EFED\\nC D D F2 E FED CHCD \'F2 CH CHA\\nC CD E FE E CD \'F2 F F\\nF Ga G aG E CD EFED // \'\",\"C2 D a G ahc a FG FE FED \'\\nF2 C DE G aGF E G a \'\\nC1 D a G ahc a FG F(E) FED \'\\nC1 C Ga F aG E CD EFED \'D\\nC1 a G ahc a Ga GE FED \'C DE G aGF\\nC1 E G a \'C Ga G ahc\\nC1 a FG FE FED \'C Ga F aG\\nC1 E CE EFED \'C D D F2 E FED CHCD\\nF2 CH CHA \'C CD E FE E CD\\nF2 F F \'F Ga G aG E CD EFED //\\n\"]', '[\"Qui de la pri-me flo-re-te\\nvou-dra dou-ce-ment chan-ter,\\nil con-vient qu\'il s\'en-tre-me-te\\nde ses mef-fais a-men-der\\net sa con-scï-en-ce ne-te\\nte-nir et son cuer mon-der,\\ncar ce de-vons nos de de-te,\\nsans au-tre-ment a-men-der,\\na Jhe-su, qui est flo-re-te\\ndes fleurs et la plus dou-ce-te\\nc\'on puist ja-més re-co-vrer.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1509, 'Une tres douce pensee', 'Linker 265.1720', 'Author of Linker 265.1720', 'French', 'X', '271v', 1, 1, '[\"F2 C H C D E F(E) DCDE FED \'\\nF2 C H C DEF E ED DC \'\\nF2 C H C D E F(E) DCDE FED \'\\nF2 C H C DEF E ED \'F2 DC\\nC DE G C1 ahc haG \'F2 FED E\\nF F FE EDC D EFG F(E) ED \'\\nF2 C DE C1 G ahc haG FED EDC \'\\nF2 D E FG FED C \'F2 DCH C //\",\"F2 C H C D E F(E) DCDE FED \'\\nF2 C H C DEF E ED DC \'\\nF2 C H C D E F(E) DCDE FED \'\\nF2 C H C DEF E ED\\nF2 DC \'C DE G C1 ahc haG\\nF2 FED E \'F F FE EDC D EFG F(E) ED \'\\nF2 C DE C1 G ahc haG FED EDC \'\\nF2 D E FG FED C\\nF2 DCH C //\"]', '[\"U-ne tres dou-ce pen-se-e\\nque ja ne vueil ou-blï-er\\nm\'a si dou-ce-ment na-vre-e\\nque sou-vent me fait pen-ser\\nce que tant nos veut a-mer\\nce-le biau-té de-si-re-e:\\nHé las, co-ment puet du-rer\\nmes cuers, qu\'il ne muert d\'a-mer?\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1510, 'Chanter m\'estuet de cele sans targier', 'Linker 265.332', 'Author of Linker 265.332', 'French', 'X', '272r', 1, 1, '[\"C1 a a a a G F E \'C1 G G F\\nE FE D C \'C1 D E G G F FE F\\na a \'C1 a a G F E G G F \'\\nF2 E F(E) D C D E G G \'C1b} F FE F\\na h c cc(b) aG \'C1b} F Ga b a G G\\nG \'C1b} G F E F G a b \'C1b} a aG\\nG a b cc(b) aG F \'C1b} a b cbG G\\nE G G G \'C1b} a b a G F FE F \'\\nC1b} D E C G a b a G \'C1 F GE F //\",\"C1 a a a a G F E\\nC1 G G F \'E FE D C\\nC1 D E G G F FE F \'a a\\nC1 a a G F E G G F \'\\nF2 E F(E) D C D E G G\\nC1b} F FE F \'a h c cc(b) aG\\nC1b} F Ga b a G G \'G\\nC1b} G F E F G a b\\nC1b} a aG \'G a b cc(b) aG F\\nC1b} a b cbG G \'E G G G\\nC1b} a b a G F FE F \'\\nC1b} D E C G a b a G\\nC1 F GE F //\"]', '[\"Chan-ter m\'e-stuet de ce-le sans tar-gier\\nqui de mer est luiss-ans es-toi-le cle-re.\\nSer-vir la doit chas-cuns de cuer en-tier.\\nCar fors nos mist de la tor-men-te_a-me-re\\nou mis nos ot A-dans no pre-mier pe-re:\\nle fruit man-ja par E-vain sa moil-lier\\nque Dex li ot des-fen-du a man-gier.\\nS\'en che-ï-mes tres-tuit en grant mi-se-re,\\nquant de li fist li douz Jhe-sus sa me-re.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1511, 'Chanter vos vueil de la virge Marie', 'Linker 265.345', 'Author of Linker 265.345', 'French', 'X', '260r-260v', 1, 1, '[\"C1b} F G a a b a \'C1b} G a b aaG F\\na a a \'C1b} a b a G a G aaG F\\nG a \'C1b} b aG F E\\nE F G G FE D \'\\nC1b} D E FG F ED C\\nD E F(G) \'C1b} F E FG F\\nG a b aG F E \'\\nC1b} E F G G FE D\\nD \'C1b} E FG F ED C\\nC E FG F E \'C1b} FG F //\",\"C1b} F G a a b a\\nC1b} G a b aaG F \'a a a\\nC1b} a b a G a G aaG F \'G a\\nC1b} b aG F E \'E F G G FE D \'\\nC1b} D E FG F ED C \'D E F(G)\\nC1b} F E FG F \'G a b aG F E \'\\nC1b} E F G G FE D \'D\\nC1b} E FG F ED C \'C E FG F E\\nC1b} FG F //\"]', '[\"Chan-ter vos vueil de la vir-ge Ma-ri-e\\nqui main-te_a-me_a et sau-vé-e_et ga-ri-e.\\nLi doit on re-cla-mer\\net che-rir et a-mer\\ntouz nos ge-ta d\'a-mer\\net de grant vi-lai-ni-e\\nda-me ne de-mo-res\\nmes por Dieu se-coi-rés\\nmoi qui fui de-vo-rés\\nse je n\'ai vost-re_a-i-e\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b530003205/f527.item.zoom\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 490, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1512, 'Et cler et lai', 'Linker 265.686', 'Author of Linker 265.686', 'French', 'X', '267v- 268r', 1, 1, '[\"C1 E G G G\\nE F \'C1 F F\\nF F E D C E E \'\\nC1 E G G G\\nE F F F\\nF \'C1 F F E D E E\\nC E G F \'C1 F F E D\\nC E G E F \'C1 F E D\\nE G F(E) D CE E \'\\nC1 E G G F ED C\\nC \'F2 E G F F F E \'F2 D\\nC E G F F F E \'F2 D\\nE G FE D C EE \'\\nF2 E G G G E F F F \'\\nF2 F F E D C E E //\",\"C1 E G G G \'E F\\nC1 F F \'F F E D C E E \'\\nC1 E G G G \'E F F F \'F\\nC1 F F E D E E \'C E G F\\nC1 F F E D \'C E G E F\\nC1 F E D \'E G F(E) D CE E \'\\nC1 E G G F ED C \'C\\nF2 E G F F F E\\nF2 D \'C E G F F F E\\nF2 D \'E G FE D C EE \'\\nF2 E G G G E F F F \'\\nF2 F F E D C E E //\"]', '[\"Et cler et lai,\\ntout sanz de-lai,\\nor es-cou-tés m\'en-ten-te.\\nChan-çon fe-rai,\\nsi chan-te-rai\\nde la ro-ï-ne gen-te\\nen qui cos-tez Dex des-cen-di\\nqui de do-lor nos des-fen-di\\net de grant tor-men-te.\\nChan-tons en sans_a-ten-te.\\nQue je me puis mout bien chan-ter.\\nDe ce-le de-vons nos chan-ter\\nqui touz nos ren-di vie.\\nor nos ai-diez et con-seil-liés,\\ndou-ce vir-ge Ma-ri-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 40),
(1514, 'Swa eyn vrivnt dem andern vrivnde bi gestat', 'J Sperv 1', 'Spervogel', 'German', 'J', 'fol. 29r', 1, 1, '[\"C1 c c c c d c \'C1 cha h c ha hG\\nG G a \'C1 ca h c G G E G F E\\nc \'C1 c G G E G F E\\nE E \'F2 E E(D) E F EC C\\nC C E G \'C1 G a G G\\nc c G G E \'C1 G FE\\nE E E E DC \'C1 E F G\\nC D E FED E DC C\",\"C1 c c c c d c\\nC1 cha h c ha hG \'G G a\\nC1 ca h c G G E G F E \'c\\nC1 c G G E G F E \'E E\\nF2 E E(D) E F EC C \'C C E G\\nC1 G a G G \'c c G G E\\nC1 G FE \'E E E E DC\\nC1 E F G \'C D E FED E DC C\"]', '[\"Swa eyn vrivnt dem an-dern vrivn-de bi ge-stat.\\nMit gant-zer tru-wen gar an al-le mis-se-tat.\\nDa ist des vrivn-des hel-fe guͦt.\\nDem er sie wil-lich-li-che tuͦt.\\nDaz sie ge-lichẹ ein an-der helẹn.\\nDem me-ret sich daz kvn-ne.\\nSwa vriundẹ eyn an-der we-ge. Sint\\ndaz ist ein mi-chel wun-ne.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1517, 'Ivnger man von tzwenzich iaren', 'J Unverz 1', 'Der Unverzagte', 'German', 'J', 'fol. 39r', 1, 1, '[\"C3 g ge fg fed c dcd e e \'C3\\ng ge fg fed c fedc ab aG\\nc \'C3 c de fg fed c fedc cba a G \'C3 ab a\\ng ge fg fed \'C3 c dcd e e\\ng ge fg fed c fedc \'C3 ab aG\\nc de fg fed c fedc \'C3 cba  G ab a\\nc cG C2 aG F \'C2 c dcb c_ha a aG a_h a C3\\ng \'C3 ge fg fed c dcd e e\\ng ge \'C3 fg fed c fedc ab aG\\nc de fg \'C3 fed c fedc cba  aG a_h a\",\"C3 g ge fg fed c dcd e e\\nC3 \'g ge fg fed c fedc ab aG \'c\\nC3 c de fg fed c fedc cba a G\\nC3 ab a \'g ge fg fed\\nC3 c dcd e e \'g ge fg fed c fedc\\nC3 ab aG \'c de fg fed c fedc\\nC3 cba G ab a \'c cG C2 aG F\\nC2 c dcb c_ha a aG a_h a C3 \'g\\nC3 ge fg fed c dcd e e \'g ge\\nC3 fg fed c fedc ab aG \'c de fg\\nC3 fed c fedc cba aG a_h a\"]', '[\"Ivn-ger man von tzwen-zich ia-ren.\\nLer-ne tu-gent-li-che ba-ren.\\nTzv̊ al-len tzi-ten myn-ne got daz ist myn rat.\\nSo mac dir nicht mis-se lin-gen.\\nDy-ne iu-gent sol-tu twin-gen.\\nDaz sie vlie tzv̊ al-ler stvnt _ mis-se-tat.\\nTru-we. scha-me. sol-tu tra-gen dy-nen leben.\\nSo mac sich dyn sel-de me-ren.\\nDu solt al-le vrou-wen e-ren.\\nSo wird dir der en-gel wat _ dort ge geben\"]', '[\"Z. 1 Korrektur f fd ef zu g ge fg\\nMs. Z. 3 aG Korrektur zu a G\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1518, 'Ez ist eyn lobeliche kvnst', 'J Unverz 9', 'Der Unverzagte', 'German', 'J', 'fol. 40r', 1, 1, '[\"C3 d f f f fed c chaGa \'C3 cc\\nd f f f fed c cha \'C1 GF\\nFE D F GFGa aGFE CD \'C1 F F C2\\nd f f f \'C2 fed-c c chaGa cc\\nd \'C2 f f f fed c cha GF\\nF \'C1 D F GFGa GFED CD F F\\nD \'C1 F G a a aGF FGaG GF\\nd \'C2 f f f fed c chaGa c \'C2\\nd f f f fed c cha GF F \'C1\\nF D F GFGa GFED CD F F \'C1\\nF G a a aGF FG \'C1 aG GF F\",\"C3 d f f f fed c chaGa\\nC3 cc \'d f f f fed c cha\\nC1 GF \'FE D F GFGa aGFE CD\\nC1 F F C2 \'d f f f\\nC2 fed-c c chaGa cc \'d\\nC2 f f f fed c cha GF \'F\\nC1 D F GFGa GFED CD F F \'D\\nC1 F G a a aGF FGaG GF \'d\\nC2 f f f fed c chaGa c\\nC2 \'d f f f fed c cha GF F\\nC1 \'F D F GFGa GFED CD F F\\nC1 \'F G a a aGF FG\\nC1 aG GF F\"]', '[\"Ez ist eyn lo-be-li-che kvnst.\\nDer sei-ten spil tzv̊ rech-te kan.\\nDie gi-ger vreu-wen manị-ges mv̊t.\\nHie vuͦr trag ich tzv̊_dem san-ge gvnst.\\nSanc le-r[e]t vrou-wen vn-de man.\\nSanc ist tzv̊ go-tes ri-sche guͦt.\\nHer blest da yn der sei-ten klanc.\\nSwer vch da lobẹt vuͦr mei-ster sanc.\\nDer sol mynẹs lo-bes a-ne we-sen.\\nSanc mac man scri ben vndẹ le-sen.\\nMit sang ist al die werlt ge ne-sen\"]', '[\"Z. 2 Korrektur C2 GF aGF zu C1 GF FE\\nMs. Z. 10 Federansatz G\\nMs. Z. 12 \'sen\' ohne Note (in voriger Zeile mit Elision bei \'vnde\')\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1519, 'Der kvninc rodolp mynnet got', 'J Unverz 14', 'Der Unverzagte', 'German', 'J', 'fol. 40v-41r', 1, 1, '[\"F2 C F G a a \'F2 b a a\\nFE F G a F \'F2 F EC\\nC F G a a b \'F2 a a(G) FE F G a FE \'F2 GF\\nC F G a a b \'F2 a a\\nFE F G a G \'F2 F EC\\nC F G a a b a \'F2 a(G) FE F G a FE GF F \'C1\\na c b _h aG a _h a \'C1 FE F G aG a b _h\\na c a \'C1 a GF a _h a FE F G a G \'C1 F EC\\nC F G a a  \'C1 _h a a FE F G a aF \'C1 FE\\nF G a b a c a \'C1 b\\naG F F F G \'C1 a b a aG GF\",\"F2 C F G a a\\nF2 b a a \'FE F G a F\\nF2 F EC \'C F G a a b\\nF2 a a(G) FE F G a FE\\nF2 GF \'C F G a a b\\nF2 a a \'FE F G a G\\nF2 F EC \'C F G a a b a\\nF2 a(G) FE F G a FE GF F\\nC1 \'a c b _h aG a _h a\\nC1 FE F G aG a b _h \'a c a\\nC1 a GF a _h a FE F G a G\\nC1 F EC \'C F G a a\\nC1 _h a a FE F G a aF\\nC1 FE \'F G a b a c a\\nC1 b \'aG F F F G\\nC1 a b a aG GF\"]', '[\"Der kv-ninc ro-dolp myn-net got.\\nVnd ist an tru-wen ste-te.\\nDer kv-ninc ro-dolp hat sich manị-gen scan-den wol vuͦr sagẹt.\\nDer kv-ninc ro-dolp rich-tet wol.\\nvndẹ haz-zet val-sche re-te.\\nDer kv-ninc ro-dolp ist eyn helt an tugẹn-den vn-vuͦr tza-get.\\nDer kv-ninc ro-dolp e-ret got vndẹ al-le wer-de vrou-wen.\\nDer kvn-ninc ro-dolp let sich dickẹ in ho-en e-ren scou-wen.\\nIch gan ym wol daz ym nach sy-ner mil-te heil ge-scicht.\\nDer mei-ster syn-gen. gi-gen. sagẹn.\\nDaz hort her gernẹ vndẹ git yn dar ummẹ nicht.\"]', '[\"Ms. Z. 10 Ergänzungen und Änderungen\\nMs. Z. 16 \'b\'-Akzidens nachgetragen?\\ntugẹnden oder tugendẹn?\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1525, 'Got in vier elementen sich erscheinet', 'J Rum, Estas', 'Rumelant von Sachsen/Estas', 'German', 'J', '47v', 1, 1, '[\" C3 e f g +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd dc db c abaG C2 GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\ne f C3 g +a g fed \'\\nc d e a \'\\ne f g +a g f e C2 ef \'\\nd dc db c abaG GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\na c c dc ba b aG Ga baG aG G \'\\naG F G a ab c baG F G ba a \'\\na c c dc ba b aG Ga baG aG G \'\\na F G a ab c baG F G ba a \'\\nC3 e f g C4 +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd C2 dc db c abaG GF \'\\nG aGF G ab ca baG c c d a cba\",\" C3 e f g +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd dc db c abaG C2 GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\ne f C3 g +a g fed \'\\nc d e a \'\\ne f g +a g f e C2 ef \'\\nd dc db c abaG GF \'\\nG aGF G ab ca baG \'\\nc c d G cba \'\\na c c dc ba b aG Ga baG aG G \'\\naG F G a ab c baG F G ba a \'\\na c c dc ba b aG Ga baG aG G \'\\na F G a ab c baG F G ba a \'\\nC3 e f g C4 +a g fed \'\\nc d e a \'\\ne f g +a g f e ef \'\\nd C2 dc db c abaG GF \'\\nG aGF G ab ca baG c c d a cba\"]', '[\"Got in vier ele-men-ten\\nsich er-scheẏ-net.\\nob wir den nicht recht ir ken-ten\\nder vns hat ge-reẏ-net.\\nal-ler svn-den smit-ten.\\nwosch vns abe sẏn bluͦt.\\nSẏn vleisch wart durch sto-chen.\\nsam div er-de.\\ndie mẏt phluͦ-gen wirt tzv̊-bro-chen.\\ndar nach der vil wer-de.\\nan dem kru-tze mit-ten\\nhienc sẏn vrucht ist guͦt.\\nDer vns sind vleis-lich erde in a-cker brach-te.\\ntzv̊ sate er wart ge-phluͦ-get in der mar-ter.\\nDo er men-sli-che bruͦ-di-cheit be-dach-te.\\ndo wart men-scheit ẏm tru-ter vn-de tzar-ter.\\nNu kumpt sẏn er-bar-men\\nvns tzv̊ tro-ste.\\nsit daz er die vreu-den ar-men\\ngue-dich-liche ir-lo-ste.\\nvon des tiv-bels kẏ-ten vz der hel-le gluͦt.\\n\\nWer kan daz be-gri-fen\\nal mit sẏn-ne.\\nwie man twin-get in den phi-fen\\nluft daz sie ge-wẏn-ne.\\nsuͦ-zer dho-ne scel-le.\\nkref-tich vn-de lut\\nVon sich sel-ben kvn-de\\nluft nicht brẏn-gen.\\nal-so guͦ-ter dho-ne vunde\\ndes mv̊z man sie twẏn-gen.\\nstei-get vn-de vel-le\\nda von wirt sie trut\\nSam ist vns got nv hert-ze-li-chen tru-ter.\\nsit daz die luft in sẏ-nes hert-zen grvn-de\\nBe-twuͦn-gen wart so reẏ-ne suͦ-ze lu-ter\\nder luf-te galm ir-schẏn ẏm vz dem mvn-de\\nDo des krut-zes vur-ste.\\nsprach die me-re.\\nJa-mer-liche daz ẏm dor-ste.\\nvnd_ez vol-ko-men we-re.\\nher brachte vz der hel-le mani-ger sel-le brut.\\n\\nVivr ist nicht so kref-tich\\nheiz al-eẏ-ne.\\ne. sin mar-tẏr ẏm tzv̊ scef-tich wert.\\nwẏ-e man daz meẏ-ne.\\ndes ist vn-ge-le-ret.\\nmani-ger han-de man\\nMit den bla-se-bal-gen.\\nwirt ge-pẏ-net.\\nvivr daz_ez mv̊z vuͦr wẏn-de wal-gen.\\ndaz sẏn gluͦte ir schẏ-net.\\nkref-te-li-chen me-ret.\\nwirt sẏn hit-ze dan\\nAl-so wart go-tes bar-mic-heit ge-bla-sen.\\nvil mani-ges iu-den bal-ges ad-hem an-spite\\nDẏn lib do er vnt-fienc vil mar-ter ma-sen.\\nda von sẏn lob er-klẏn-get al-so wi-te\\nDv sẏn gna-den guͦ-te\\nheẏ-zer brẏn-net.\\nin der wa-ren mẏn-ne gluͦ-te.\\nher div men-scheit mẏn-net.\\ndes sẏ got ge-e-ret der daz al-lez kan.\\n\\nWaz-zer hat na-tiv-re\\nkalt ge-stel-let.\\nman be-twin-get ez mẏt viu-re.\\ndaz sẏn walm er-wel-let.\\ndaz eẏn ro-e spi-se.\\nwirt ge-ma-chet gar\\nSvn-der twẏn-gen su-det\\nwaz-zer sel-ten.\\nswer mich des mẏt kvnst vuͦr gu-det.\\ndes mv̊z ich vnt-gel-ten.\\nob ich daz be-wi-se.\\ndes wirt man ge-war\\nGot ist ge-lich dem wazzer in dẏ-sen sa-chen.\\nE. wesen-der got starc e. her men-sche wor-de\\nIst waz-zer starch daz mac man star-cher ma-chen.\\nsam tete sich got mẏt sẏ-ner men-schen bor-de\\nKris-tes ou-gen waz-zer.\\nsot in wal-me.\\nwart sẏn men-scheit vreu-den laz-zer.\\nin des to-des qual-me.\\ndes stet her tzv̊ pri-sende mẏs-se-wen-de bar.\\n\\nGot der al-er wun-der.\\nwun der wun-dert.\\nDer hat svn-der-lich be-svn-der\\nwun-der vz ge svn-dert.\\nDaz vuͦr al-le wun-der.\\nMi-chel wun-der ist.\\nSvn-der svn den schy-mel.\\nwun-de-re-re.\\nGot ob al-len hy-melen hy-mel.\\nDu bist wun-der-be-re.\\nMit-ten. oben. vnd vn-der.\\nVm-me durch dyn list.\\nMit listen her al-ler lis-te list vuͦr lis-te.\\nDo sich got reyne in men-schen vleisch ge vlei-schte\\nDa er myt list sich vier-tzich wo-chen vris-te.\\nSo gro-zer wun-der list ich nye ge-vrei-schte\\nDaz eyn maget ge-be-re\\nsvn-den vri-e.\\nsyn kynt daz ir va-ter we-re.\\nsuͦ-ze ma-get ma-rie.\\nGo-tes flam-men tzvn der du myt wun-dere bist.\\n\\nMi-rum mi-ran-dum\\nmira-cu-lo-sum,\\nmi-ra-bi-lis de-us dum\\nmira-bi-le fa-mo-sum\\nmi-ra-bi-li-za-vit\\nre ra-ris-si-ma,\\nvir-go no-vo mo-re\\ndum pre-gna-bat.\\nStel-le-o na-ta splen-do-re\\npat-rem ge-ne-ra-bat\\ndo-te, quam da-ta-vit,\\npre-c[l]a-ris-si-ma.\\nAn-te Lu-ci-fe-rum qui g[e]-ne-ra-tus\\nfi-li-us de-i mun-do iam il-lu-xit,\\nmag-nus et par-vu-lus no-bis do-na-tus,\\nquem vir-go sa-cra-tis-si-ma pro-du-xit.\\no fons qua-dri-fu-sus\\ngra-ci-a-rum,\\nper te ser-pens est il-lu-sus,\\nquod va-le-bit pa-[rum].\\nlux il-lu-mi-na-vit te, sanc-tis-si-ma!\\n\\nMi-rum mi-ran-dum [mi-]\\nra-cu-lo-sum,\\nmi-ra-bi-lis de-us dum [mi-]\\nra-bi-le fa-mo-sum\\nmi-ra-bi-li-za-vit\\nre ra-ris-si-ma,\\nvir-go no-vo mo-re\\ndum pre-gna-bat.\\nStel-le-o na-ta splen-do-re\\npat-rem ge-ne-ra-bat\\ndo-te, quam da-ta-vit,\\npre-c[l]a-ris-si-ma.\\nAn-te Lu-ci-fe-rum qui g[e]-ne-ra-tus\\nfi-li-us de-i mun-do iam il-lu-xit,\\nmag-nus et par-vu-lus no-bis do-na-tus,\\nquem vir-go sa-cra-tis-si-ma pro-du-xit.\\no fons qua-dri-fu-sus\\ngra-ci-a-rum,\\nper te ser-pens est il-lu-sus,\\nquod va-le-bit pa-[rum].\\nlux il-lu-mi-na-vit te, sanc-tis-si-ma!\\n\\nO lux lu-mi-no-sa,\\nlux pre-cla-ra\\ngra-ci-e-que gra-ci-o-sa,\\npre-sen-tans in a-ra\\nul-nis Sy-me-o-nis\\nde-i fi-li-um,\\nlu-mi-no-sum lu-men\\npre-lus-ces-cens,\\nnu-mi-no-sum ri-gans flu-men\\npur-ga-vit flo-res-cens\\nte (iam sum-mis thro-nis),\\nval-lis li-li-um.\\nno-bi-li o-ne-re stans o-ne-ra-ta\\npon-de-ro-sis-si-mum ges-t[]ans the-sau-rum,\\npre-ci-o se-cu-li-que sar-ci-na-ta,\\nnos-tre re-demp-ci-o-nis por-tans au-rum.\\no vox tur-tu-ri[-na]\\nnatu-re nos-tre,\\npla-cens in au-re di-vi-na,\\ngen-tis tu-e pos-tre\\nfons pur-ga-ci-o-nis sis hu-mi-li-um.\"]', '[\"\\n\\n\\n\\nRasur bei Z. 5 ca, vorher fälschlich cha, d.h. die folgende Neumenfigur\\nNach Z. 5 Strich auch in Notensystem\\nZ. 10 anzunehmen b\\nNach Z. 10 nicht nach Z. 11 Strich (nicht analog zu Z. 5)\\nNach Z. 12 Strich\\nZ. 20 c rasiert; versehentliche Doppelung oder versehentlich auf zu elidierender Silbe platziert\\nZ. 21 Rasur: a h -> c c\\n\\nStr. 2 vnde lut: Punkt rasiert?\\nSele bruͦt -> brut Rasur\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1526, 'Je vous pri, dame Maroie', 'Linker 176.1', 'Dame Margot', 'French', 'A', '151v', 1, 1, '[\"C3 c de e dc d cha h aG\\na h \'C3 c ha hh(a) aG a\\nc de e dc d \'C3 cha h aG\\na h c ha h(a) aG a\\nc \'C3 c d cha h(a) G ah\\nd ef e dc \'C3 d cha c\\nh c d cha h c haG \'C3 a\\ne e dc d cha h cha G\\na Ga c \'C3 d(c) ha\\nh ch a ha G ah a\\nc de d \'C3 ef e dcha G\\na G a c d cd c \'\\nC3 c de d(c) ha h G ah\\nd e d cha h(a) \'C3 aG a //\",\"C3 c de e dc d cha h aG \'a h\\nC3 c ha hh(a) aG a \'c de e dc d\\nC3 cha h aG \'a h c ha h(a) aG a \'c\\nC3 c d cha h(a) G ah \'d ef e dc\\nC3 d cha c \'h c d cha h c haG\\nC3 a \'e e dc d cha h cha G \'a Ga c\\nC3 d(c) ha \'h ch a ha G ah a \'c de d\\nC3 ef e dcha G \'a G a c d cd c \'\\nC3 c de d(c) ha h G ah \'d e d cha h(a)\\nC3 aG a //\"]', '[\"Je vous pri, da-me Ma-roi-e,\\nKe res-pon-dés con-tre moi.\\nU-ne da-me sim-ple et choie\\nEst bien a-me-e de foi,\\nEt ele ai-me bien au-si,\\nCe sa-ciés vous tout de fi;\\nMais cil est de tel ma-nie-re\\nKi l’ai-me ke sa proi-ie-re\\nN’o-se pas ge-hir,\\nEt si ne puet a-ve-nir\\nKe ja li fai-ce sa-voir.\\nS’or me vo-liés di-re voir,\\nS’en doit e-le des-cho-vrir,\\nU e-le s’en doit ta-sir?\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
