(1553, 'Nu alrest lebe ich mir werde', 'Nu alrest lebe ich mir werde', 'Walther von der Vogelweide', 'German', 'Z', '1r-v', 1, 0, '[\"D D F FF D DEFE D DC\\nE G a aGF FF DCD EFED\\nDD F F F D DEF E D DC\\nE G a aGF F DCD EFED\\na a c c aG a ch a\\na cha G GFED E FED C\\nE G a aGFE DCD EFED\",\"D D F FF D DEFE D DC \'E G a aGF FF DCD EFED \'DD F F F D DEF E D DC \'E G a aGF F DCD EFED \'a a c c aG a ch a \'a cha G GFED E FED C \'E G a aGFE DCD EFED\"]', '[\"Nu al-rest leb ich mir wer-de,\\nsint myn sundich ou-ge er-sicht\\ndaz lie-be lant und ouch die er-de,\\ndem man al der e-ren gicht.\\nnu ist ge-schen als ich ie bat:\\nich byn ko-men an die stat,\\nda Got men-sli-chen trat.\"]', '[\"Cfr: https://www.examenapium.it/cs/w-carmina/211-alte/alteclamat.html\", \"\"]', '{\"Link\": \"https://collections.thulb.uni-jena.de/rsc/viewer/HisBest_derivate_00001263/Muenster_MSCVII_51r.tif\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 6, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1554, 'Amour, dont sui espris', 'K Blondel', 'Blondel de Nesle', 'French', 'Trouv K', 'p. 114-115', 1, 1, '[\"C2 a c d c(h) haG a\\nF \'C1 G(F) EDE FG FE D\\na c d \'C1 c(h) haG a\\nF G(F) EDE FG \'C1 FE D\\nC D F G Ga F \'C1 \\nF a b} c-cd c haG F \'C1b}\\nG ab a G aG\\nF E F G-G(F) \'C1b} ED DC CD\\nC D F a G-Ga F\\nF \'C1b} a c-cd c baG F\\nG ab aGFE FG \'C1 FE ED \'\",\"C2 a c d c(h) haG a \'F\\nC1 G(F) EDE FG FE D \'a c d\\nC1 c(h) haG a \'F G(F) EDE FG\\nC1 FE D \'C D F G Ga F\\nC1  \'F a b} c-cd c haG F\\nC1b} \'G ab a G aG \'F E F G-G(F)\\nC1b} ED DC CD \'C D F a G-Ga F \'F\\nC1b} a c-cd c baG F \'G ab aGFE FG\\nC1 FE ED\\n\"]', '[\"A-mour, dont sui es-pris,\\nme se-mont de chan-ter,\\nsi chant com hom sou-pris\\nqui ne puet a-men-der.\\nPe-tit i ai con-quis;\\nMais bien me puis van-ter,\\nse li plaist, j’ai apris\\na loi-au-ment a a-mer.\\nA ce sunt mi pen-ser\\nEt se-ront a touz dis;\\nJa ne.s en quier os-ter.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": false, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
