(1557, 'A la joie que desir tant', 'Linker 65.26', 'Gace Brulé', 'French', 'M', '27r', 1, 1, '[\"C2 a c c d d c haG a\\nb} a baG \'C1 FED C F Ga GFE D\\na \'C2 c c d d c haG a\\na baG \'C1 FED C F Ga GFE D\\nF G FED F \'C1b} F G a b aG a\\na c d G \'C1b} c cba G\\nC2 c d e d d a c \'C1b} ba\\na G F G a(G) GFE D\",\"C2 a c c d d c haG a \'b} a baG\\nC1 FED C F Ga GFE D \'a\\nC2 c c d d c haG a \'a baG\\nC1 FED C F Ga GFE D \'F G FED F\\nC1b} F G a b aG a \'a c d G\\nC1b} c cba G \'C2 c d e d d a c\\nC1b} ba \'a G F G a(G) GFE D\"]', '[\"A la jo-ie que de-sir tant\\nd\'A-mors, qui m\'a a soi tour-né,\\nne puis leis-sier que je ne chant\\npuiz que ma da-me vient a gré,\\nen cui j\'ai mis mon cuer et mon pen-sé\\na tres-tou-te ma vi-e;\\nmaiz trop me font a-nui so-vent\\ngenz qui Diex ma-le-ï-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1559, 'Diable, guaras non tormentes', 'SA 16', 'Author of Jeu de Saint\'Agnès', 'French', 'Chig', '80r', 1, 0, '[\"C1F3 G aGah aGFG aG a c d c \'\\nC1F3 ch aG Ga c dc d e ed \'\\nC2F4 c dcde ch a a hcd h GGa c \'\\nC1F3 chahh ca aGF a h aG F G\",\"C1F3 G aGah aGFG aG a c d c \'\\nC1F3 ch aG Ga c dc d e ed \'\\nC2F4 c dcde ch a a hcd h GGa c \'\\nC1F3 chahh ca aGF a h aG F G\"]', '[\"Dia-ble, gua-ras non tor-men-tes\\nces-t’ar-ma, que tou-ta vos es,\\nque Dieus vol que si-a re-ci-taz\\nle cors d’es-t’ar-ma e sa-naz.\"]', '[\"Unclear separation of syllables throughout the piece.\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[1,1,3,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1564, 'Ondas do mar de Vigo', 'LPGP 91.6', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '1v', 0, 1, '[\"C2 Ga c hc dc cha c hcdchah-aG \'\\nC2 a c hcdc cha-c hc dc dchhah(a)-aG\\nGa haa \'C2 GF Ga c hc-dc dcchah(a) aG\",\"C2 Ga c hc dc cha c hcdchah-aG \'\\nC2 a c hcdc cha-c hc dc dchhah(a)-aG \'Ga haa\\nC2 GF Ga c hc-dc dcchah(a) aG\"]', '[\"On-das do mar de Vi-go\\nse vis-tes meu a-mi-go\\nE ay Deus, se ver-rá ce-do?\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"custos\": \"[null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1565, 'Mandad\'ei comigo', 'LPGP 91.4', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '1r', 0, 1, '[\"C2 hG ah hd cha ha G\\naG ah hd \'C2 chaG G F\\nGa h aG aGF G-ahc hah G\",\"C2 hG ah hd cha ha G \'aG ah hd\\nC2 chaG G F \'Ga h aG aGF G-ahc hah G\"]', '[\"Man-da-d\'ei co-mi-go\\nc\'a ven meu a-mi-go\\nE i-rei ma-dr\'_a Vi-go\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1566, 'Mia irmana fr[emosa, treides] comigo', 'LPGP 91.5', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '1r', 0, 1, '[\"C1b} F F G a a a ? ? ? ? \'C1b} F aGa GF\\nF F G a a a ? ? ? ? ? \'C1b} F G a aG\\nF F DF DC DF [F(E) ? ?]\",\"C1b} F F G a a a ? ? ? ?\\nC1b} F aGa GF \'F F G a a a ? ? ? ? ?\\nC1b} F G a aG \'F F DF DC DF [F(E) ? ?]\"]', '[\"Mi-a yr-ma-na fr[e-mo-sa] ...  ... co-mi-go\\na la y-gre-ia de Vi-[go u e o] mar sa-li-do\\nE mi-ra-re-mos las on-das\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1567, 'Ay Deus, se sab’ora meu amigo', 'LPGP  91.1', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '1r', 0, 1, '[\"C1b} F G a a aG a haa(G) \'C1b} a GFGa aG F(E) F G ba aG a baa(G) \'C1b} a GFGa a baa baG F(G) E F Ga\",\"C1b} F G a a aG a haa(G)\\nC1b} a GFGa aG F(E) F G ba aG a baa(G)\\nC1b} a GFGa a baa baG F(G) E F Ga\"]', '[\"Ai Deus, se sa-b’o-ra meu a-mi-go\\nco-m’eu sen-nei-ra es-tou en Vi-go,\\ne vou na-mo-ra-da!\\n\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"custos\": \"[null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1568, 'Quantas sabedes amar amigo', 'LPGP 91.7', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '2r', 0, 1, '[\"C3 a c c c h G c \'C2 h(c) haaG G\\na c c dcc(h) h a c \'C2 h(c) haa(G) G\\nG haa(G) GF G ah c \'C2 hc haaG [G]\",\"C3 a c c c h G c\\nC2 h(c) haaG G \'a c c dcc(h) h a c\\nC2 h(c) haa(G) G \'G haa(G) GF G ah c\\nC2 hc haaG [G]\"]', '[\"Quan-tas sa-be-des a-mar a-mi-go\\ntrei-des co-mi-g\'a lo mar de Vi-go.\\nE ba-nnar nos e-mos [nas on-das]\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1569, '[A]y ondas que eu vin veer', 'LPGP 91.2', 'Martin Codax', 'Galician-Portuguese', 'Pergaminho Vindel', '2r', 0, 1, '[\"C2b} E F G a baG F(G)-FE \'C1b} FEF Ga-baG-a(G)\\nFEDE F G a baG F(G)-FE \'C1b} [FEF Ga-baG-a(G)\\nFEDE F] FEF Ga baG \'C1b} baG FEDE FEDC C-DE F\",\"C2b} E F G a baG F(G)-FE\\nC1b} FEF Ga-baG-a(G) \'FEDE F G a baG F(G)-FE\\nC1b} [FEF Ga-baG-a(G) \'FEDE F] FEF Ga baG\\nC1b} baG FEDE FEDC C-DE F\"]', '[\"[A]y on-das que eu vin ve-er\\nse me sa-be-re-des di-zer\\npor que tar-da meu a-mi-go sen min!\\n\\nAi on-das que eu vin mi-rar,\\nse me sa-be-re-des co-ntar\\npor que tar-da meu a-mi-go sen min!\"]', '[\"\", \"\"]', '{\"Link\": \"https://www.themorgan.org/sites/default/files/manuscripts/145456v_0002-0003_0.jpg\", \"Plica\": false, \"custos\": \"[null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10);
INSERT INTO `mm_staves_stored` (`id_staves`, `title`, `id`, `author`, `language`, `ms`, `f`, `modernStyle`, `oldStyle`, `staves`, `text`, `annotations`, `settings`, `visibility`, `id_user`) VALUES
(1628, 'Douce dame, ce soit en vos nomer', 'Linker 203.2', 'Anonymous-Perrot de Beaumarchais', 'French', 'T', '51r', 1, 1, '[\"D F F G a b aG a a aF\'\\nb aG a GFE F G aG GFED ED D\'\\nD F G G a b aG a aF F\'\\nb aG a GFE F G FE D C D\'\\nD D DC F E F G FED C F\'\\nD E F a a a aG a ba aG a\'\\nb aG a GFE F G a FED E FED C\'\\nD DC F G a h ch GF Ga a\\nb a aG FE G a GF ED GFE D //\",\"D F F G a b aG a a aF \'\\nb aG a GFE F G aG GFED ED D \'\\nD F G G a b aG a aF F \'\\nb aG a GFE F G FE D C D \'\\nD D DC F E F G FED C F \'\\nD E F a a a aG a ba aG a \'\\nb aG a GFE F G a FED E FED C \'\\nD DC F G a h ch GF Ga a \'\\nb a aG FE G a GF ED GFE D //\"]', '[\"Dou-ce da-me, ce soit en vos no-mer:\\nQuels vo-lés vos que li vostres a-mis soit,\\nBuen che-va-lier, s’il li co-vient ar-mer,\\nEt de-sar-més n’i ait nul autre es-ploit\\nNe nu-le rien de cour-toi-sie ait droit -\\nTel le vos fas, c’en est l’u-ne par-ti-e-\\nU biaus et bons, de dou-ce com-pai-gni-e,\\nSa-ge_et cour-tois et d’a-mou-rous sou-las,\\nSans prou-ë-ce, i-tel le vous re-fas.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 11),
(1646, 'Amors n\'est pas que qu\'en die', 'Linker 185.4', 'Moniot d\'Arras', 'French', 'K', '137a', 1, 1, '[\"C2 G aGF a c d ed \'C2 c de\\n? e d ed c h aG\\nG \'C2 aGF a hcd c h aG\\nG aGF a \'C2 hcd c hch a G\\nG aGF a h d \'C3 ed c de\\ng f e de d cd efec \'\\nC3 c de f fed d c h cha \'\\nC3 a e fg fed c h c haG\\nh cd c \'C2 hch a haG hcha\\ne fed cd \'C2 ch d cha chha aG\",\"C2 G aGF a c d ed\\nC2 c de \'? e d ed c h aG \'G\\nC2 aGF a hcd c h aG \'G aGF a\\nC2 hcd c hch a G \'G aGF a h d\\nC3 ed c de \'g f e de d cd efec \'\\nC3 c de f fed d c h cha \'\\nC3 a e fg fed c h c haG \'h cd c\\nC2 hch a haG hcha \'e fed cd\\nC2 ch d cha chha aG\"]', '[\"A-mors n\'est pas que qu\'en di-e\\nsa-ges ne bien e-ü-ros,\\ncuer qui ne se rent a vous.\\nIl li cou-vient sa fo-li-e,\\nsa gui-le_et sa vi-la-ni-e,\\nses mes-diz et ses maus toz\\nguer-pir, puis que sanz bois-di-e\\nse met en vos-tre bail-li-e.\\nSa-ge, cor-tois, lar-ge_et proz\\nde-vient par vos-tre mes-tri-e.\"]', '[\"Notes: \\n2.1-2: the first and likely part of the second neume are covered by the text initial. The notes were positioned in the highest part of the staff (probably <i>e</i> and/or <i>d</i>).\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f163.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 1261.111083984375, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1651, 'Nouviaument m\'est pris envie', 'Linker 48.5', 'Jean I de Bretagne', 'French', 'P', '201r', 1, 1, '[\"C3 a h cha h(a) G \'C2 ah dh c\\nh ahchG a c h dh hc \'\\nC3 efgf d e(d) c f fed efed \'\\nC2 G d edc d e cd chch a\\nh \'C2 d h d c h a G\\nd h \'C3 d e g fefgfd d\\nh d \'C3 cha haG dh d c ha\\nh d \'C2 ch haG ah d dch d\\nd e \'C3 c d h ch a \'\\nC2 h d c hh(a) ha h \'C2 a G\",\"C3 a h cha h(a) G\\nC2 ah dh c \'h ahchG a c h dh hc \'\\nC3 efgf d e(d) c f fed efed \'\\nC2 G d edc d e cd chch a \'h\\nC2 d h d c h a G \'d h\\nC3 d e g fefgfd d \'h d\\nC3 cha haG dh d c ha \'h d\\nC2 ch haG ah d dch d \'d e\\nC3 c d h ch a \'\\nC2 h d c hh(a) ha h\\nC2 a G\"]', '[\"Nou-viau-ment m\'est pris en-vi-e\\nde bien a-mer par a-mors,\\ncar mon cuer ne pen-se_ail-lors\\nqu\'en la dou-ce sei-gno-ri-e,\\nn\'el sie-cle, que que nus di-e,\\nn\'é je pas ves-cu toz jorz,\\nainz ai lan-gui par fo-li-e;\\nmès ore a-men-de ma vi-e,\\nquant je sent les maus d\'a-mors\\npor la meil-lor, q\'ai choi-si-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b8454673n/f413.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
