\'c c(h)\\nC1 a G a/ D \'d d G a\\nC1 c/ a \'b} a a b a GFE/ D \'\\nC1 G G a G F G a/ c\\nC1 h a \'c d cha G a(h) aG F/\\nC1 a h c \'c d d c\\nC1 c(h) a G/ b} G ab a \'a\\nC1b} b c b a G F/ G a\\nC1 G \'D E F G F E D/ c\\nC2 c d \'e d c(h) a h(c) h\\nC1 a \'a b a(G) F G a G \'\\nF3 D E F G G a G/ c c a \'a F\\nF3 G a GF E D/ E F G \'\\nC1 ah c/ c d c h a/ a GFE\\nF2 D\"]', '[\"I.__Bel-la don-na ca-ra,\\non poc Dyeus tro-bar\\ntant de beu-tat cla-ra,\\nquant vos for-met sens par?\\nQu’e-nans ni an-qua-ra\\nnon volc nul’ au-tra far\\nam tan bel-la ca-ra\\nni am tant bel es-gar.\\nE qui ben es-ga-ra\\nso que Dyeus volc mielz far,\\nmi-ra vos-tra ca-ra\\nel vos-tre bel cor car.\\nPlan-sent don-na ca-ra,\\ndou-sa sens tot a-mar,\\nno·us a-ma ben a-ra\\nnulz oms ni o pot far.\\nII._Pos am fin’ a-mor m’a-cort que am fort\\npla-sent don-na ga-ya,\\nben dey far pla-sent a-cort que des-cort\\nnon tan qu’ieu re-tra-ya;\\nc’A-mors m’a mes a tal port on de-port\\nmon cors, cor que·m pla-ya.\\nBen tanch de mon fin a-cort port l’on-rat port\\nque·ls ay-mans a-pa-ya.\\nIIIa._Pos li dous con-si-re\\nque·m so-lon au-si-re\\nte-non mon cor gay,  ay!\\nBen dey motz es-li-re,\\nper leys qui’eu de-si-re;\\nqu’au-tr’a-mors non play, may.\\nIIIb._Sos gay cors pla-sens, gentz,\\nel syei bel sem-blan man,\\nque res non n’es mentz sentz,\\nmi fan dir can-tan can\\ne can-tars pla-sens, gentz.\\nSa-bes per qu’ieu can tan?\\nCar, fins en-ten-dentz dentz,\\nam e sens en-gan blan,\\ne quar blan gau-sentz mentz\\nen prez mon a-fan gran.\\nIVa._So qu’als au-tres fins ay-mantz es a-fantz\\nes a mi gautz e dou-sors, car A-mors\\nvol qu’ieu am, sens totz en-gantz totz mos antz\\ntals que so-bre las gen-sors m’es au-sors.\\nIVb._A-mors, ben es mos a-cortz que “a-cortz”\\ns’a-pel mos cantz totz tems mays\\nen-tre·ls fins ay-mans ve-rays,\\ncuy plas so-laz e de-portz que des-cortz\\nnon deu far qui non s’i-rays; per qu’ieu lays\\ndes-cortz, per far a-cortz gays en-tre·ls gays.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b84192440/f251.item\", \"Plica\": false, \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 71, \"facsimileY\": 123, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 210, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
