Number\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1679, 'Chanter m\'estuet, quar volenté m\'en prie', 'Linker 265.339', 'Author of Linker 265.339', 'French', 'i', '243v', 1, 1, '[\"C1 a c cd d c h a G \'C1 a hchh a\\na c c-d d c h \'C1 a G a hchh a\\naGF G [F] \'C1 EDC DE D\\nE G Ga a a G \'\\nC1 c ch aG a hc a\\nD a \'C1 a GFE GFG a a\\nD F \'C1 GFG a F GE ED C D EFEE E\",\"C1 a c cd d c h a G\\nC1 a hchh a \'a c c-d d c h\\nC1 a G a hchh a \'aGF G [F]\\nC1 EDC DE D \'E G Ga a a G \'\\nC1 c ch aG a hc a \'D a\\nC1 a GFE GFG a a \'D F\\nC1 GFG a F GE ED C D EFEE E\"]', '[\"Chan-ter m\'es-tuet, quar vo-len-té m\'en pri-e\\ndu ros-si-gnol qui da [... ... ... ...i-e\\n... ... ....] dous Jhe-sus\\nqui est mon-té las-sus,\\net nous som-mes ça jus;\\ntous li cuers m\'en sous-pi-re.\\nDu dous Jhe-su de-vons a-dez bien di-re.\\nDu dous [Jhe-su sou-vent de-vons chan-ter et li-re].\"]', '[\"Notes:\\n2.3: The notes <i>c</i> and <i>d</i> are placed on two different syllables, troubling the correspondence bewteen twxt and music. A scribe attempts to correct the text by adding the syllable <i>let</i> to <i>rossignol</i>. However this only contributes to the irregularity of the verse. Even if the last text line of the folio is cut off, the number of neumes is supranumerary and can easily be fixed by comparison with the preceding one.\\n\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b8454680s/f490.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 672, \"facsimileY\": 1811, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1680, 'Je chevauchai l\'autrier la matinee', 'Linker 224.4', 'Richart de Semilli', 'French', 'K', '174', 1, 1, '[\"C1b} a a a a b a G \'C1b} a b aaG F\\na a a a b a G \'C1b} a b aaG F\\nG a b aG F E \'\\nC1b} E E G G FE D\\nD E \'C1b} FG F ED C\\nD E FG F E \'C1 FG F\\nb} G a b aG F E\\nE \'C1b} F G G FE D\\nD E \'C1 F G F ED C\\nD E FG \'C1 F E FG F\",\"C1b} a a a a b a G\\nC1b} a b aaG F \'a a a a b a G\\nC1b} a b aaG F \'G a b aG F E \'\\nC1b} E E G G FE D \'D E\\nC1b} FG F ED C \'D E FG F E\\nC1 FG F \'b} G a b aG F E \'E\\nC1b} F G G FE D \'D E\\nC1 F G F ED C \'D E FG\\nC1 F E FG F\"]', '[\"Je che-vau-chai l\'au-trier la ma-ti-ne-e;\\nde-lez un bois, as-sez pres de l\'en-tre-e,\\ngen-til pas-to-re truis.\\nmes ne vi on-ques puis\\nsi plai-ne de de-duis\\nne qui si bien m\'a-gre-e.\\nMa tres dou-ce-te seur,\\nvos a-vez tout mon cuer,\\nne vous le-ro-ie_a nul fuer;\\nm\'a-mor vous ai do-ne-e.\"]', '[\"ì\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f202.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"A A B C D D\' B C D D\'\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1681, 'Chançon ferai plain d\'ire et de pensee', 'Linker 224.1', 'Richart de Semilli', 'French', 'K', '174', 1, 1, '[\"C1b} a a a a b a G a \'C1b} b aaG F\\na a a a b a \'C1b} G a b aaG F\\nG a b aG \'C1b} F E\\nE E G G FE D\\nD \'C1b} E F G F ED C\\nD E \'C1 FG F E FG F\\nb} G a b aG F E \'\\nC1 E F G G FE D\\nD E F \'C1 G F ED C\\nD E FG F \'C1 E FG F\",\"C1b} a a a a b a G a\\nC1b} b aaG F \'a a a a b a\\nC1b} G a b aaG F \'G a b aG\\nC1b} F E \'E E G G FE D \'D\\nC1b} E F G F ED C \'D E\\nC1 FG F E FG F \'b} G a b aG F E \'\\nC1 E F G G FE D \'D E F\\nC1 G F ED C \'D E FG F\\nC1 E FG F\"]', '[\"Chan-çon fe-rai plain d\'i-re_et de pen-se-e\\npour ce-le riens el mont qui plus m\'a-gre-e,\\nhe las, on-ques n\'a-ma\\nde cuer qui li blas-ma.\\nDeus, pour quoi es-con-dit m\'a?\\nel m\'a la mort do-ne-e!\\ndou-ce da-me de pris,\\nqui je lo tant et pris,\\nsi m\'a vos-tre_a-mor sor-pris,\\nplus vous aim que riens ne-e!\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f202.item\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 199, \"facsimileY\": 919, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1682, 'L\'autrier par la matinee / En cele tres douce saison', 'Linker 265.1030', 'Author of Linker 265.1030', 'French', 'K', '367', 1, 1, '[\"C2b} F G a b c d(c) bc \'C2b} ba G\\na c ba G F b aGF F \'\\nC2b} F G a b c d(c) bc ba aG\\na \'C2b} c ba G F b aGF G\\nb a \'C2b} b c ba G Gab aGF\\nF G \'C2b} a b a b c dcde d\\nd \'C2b} e f a b c b(a) aGa\\nF G \'C2b} a bb(a) aG a b cba baG\",\"C2b} F G a b c d(c) bc\\nC2b} ba G \'a c ba G F b aGF F \'\\nC2b} F G a b c d(c) bc ba aG \'a\\nC2b} c ba G F b aGF G \'b a\\nC2b} b c ba G Gab aGF \'F G\\nC2b} a b a b c dcde d \'d\\nC2b} e f a b c b(a) aGa \'F G\\nC2b} a bb(a) aG a b cba baG\"]', '[\"L’au-trier par u-ne ma-ti-ne-e\\nen ce-le tres dou-ce se-son,\\nque li gä-ains a-val la pre-e\\nra-ver-dist, et cil oi-sel-lon\\nvont chan-tant par droi-te re-son\\npor le douz tens qui lor a-gre-e:\\nlors truis de chan-ter a-che-son,\\nde tris-te cuer, plain de pen-se-e.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b550063912/f395.item\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f395\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 503.5, \"facsimileY\": 453, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": true, \"UseManualMelodicStructure\": 0}', 2, 10),
