, oder nicht eher ein Schreibfehler?\\nBrunner: mit (meinsterscheften) G statt e bei prima volta; warum?\\n\\nDas Notensystem der Zeile mit F2-Schlüssel hat nur vier Notenzeilen.\\nDas letzte System weist keinen Notenschlüssel auf, jedoch die rubrizierte F3-Notenzeile\", \"\"]', NULL, 0, 31),
(1701, 'Den vier elmenten gab zu sture (Grundweise)', 'k Regb Grundweise', 'Regenbogen', 'German', 'k', 'fol. 432r', 1, 1, '[\"C1 hc d d c G G E \'F3 F D\\nD D F G a a \'C2 a GFE \'\\n[C1 hc d d c G G E \'F3 F D\\nD D F G a a \'C2 a GFE]\\nE D D a h c \'C2 a aGa\\ncd e e d h a F \'C1 FD D\\nD D D F G a a GFE\",\"C1 hc d d c G G E\\nF3 F D \'D D F G a a\\nC2 a GFE \'\\n[C1 hc d d c G G E\\nF3 F D \'D D F G a a\\nC2 a GFE] \'E D D a h c\\nC2 a aGa \'cd e e d h a F\\nC1 FD D \'D D D F G a a GFE\"]', '[\"Den vier el-men-ten gab zu stu-re\\ngot vnd sin wol trech-ti ger funt\\nErt-rich luft was-ser vn-de fu-re\\ndez ment-schen hercz hant gar en-zunt\\nDer er-ste ment-sche hieß a-dam\\nGot schuff vß ym-me so ge hu-re\\nein schö-neß bild e-ua er nam\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1702, 'In dyser zyt mir großes ellend ist gegeben', 'k Brenn 1', 'Reinmar von Brennenberg', 'German', 'k', 'fol. 672r', 1, 1, '[\"C2 a c d e c d \'C2 c h a a G a a \'C2\\nG G G a a c c c \'C2 c h a G a h a \'\\nC2 d d d d c h a G \'C2\\nG a a a a c c c h \'C1 a a G a h a\\na \'C2 c c d d e e e f e e \'C2 c de\\nec d d e \'C2 e e d d c h a G\\nG \'C2 a a a d d c [c] h a a G \'C2\\nG c c d d e e d \'C1 c c h a a G F Gaa\",\"C2 a c d e c d\\nC2 c h a a G a a\\nC2 \'G G G a a c c c\\nC2 c h a G a h a \'\\nC2 d d d d c h a G\\nC2 \'G a a a a c c c h\\nC1 a a G a h a \'a\\nC2 c c d d e e e f e e\\nC2 c de \'ec d d e\\nC2 e e d d c h a G \'G\\nC2 a a a d d c [c] h a a G\\nC2 \'G c c d d e e d\\nC1 c c h a a G F Gaa\"]', '[\"In dy-ser zyt mir g[r]os-ses el-lend ist ge-ge-ben\\ndar zu so lyd ich man-ger-hand daz geb mir got zu gu-te\\nWas ich nu tun daz wil-der welt mit fu-gen e-ben\\nein yg-lich man der züg mich gern nach si-nes sel-bes m[u]-te\\nUnd daz en-mag doch nit ge sin\\nwann die na-tur ist vn-ge-lich wer wolt daz an-ders ma-chen\\nWas ÿ-mant hat daz ist nit myn\\ndaz myn alz we-nig ÿ-mand ist d[a]z wolt got al-so sa-chen\\nDer ein ist rich der an-der der muß och we-sen arn\\nder dryt da heym der vier-de muß ins el-lend farn\\nden funf-ten has-set y-der man in dyr-re zyt\\ndem sehs-ten sint die lu̍-de holt got weyß wol wie es dar vmb lyt\"]', '[\"In Brunner nach d transponiert (mit b-Vorzeichnung) \\n\'müte\' wegen Reim \'mute\'\\n\'och\' metrisch überschüssig und nachgetragen\\nBei Brunner: luͤde; eigentlich lu̍de\\nZ. # Korrektur aus a G G F zu d d e; Brunner übernimmt F: möglich, aber die Faktur legt c oder h näher in Analogie zu den anderen Zeilen.\", \"\"]', NULL, 0, 31);
