(1703, '[...] sin henne genomen', 'Z1 Wa 1', 'Walther von der Vogelweide', 'German', 'Z', 'fol. 1ra', 1, 1, '[\"C3 c c c c c d\\nf f f fed \'C3 dc c\\nc d dch ca a/ c dch ca \'C3\\nc c c d c ch c c\\nb a \'C3 h c c d dch ca\\nc c \'C3 h aG a h aG aGF\\nc \'C3 c c d ch c c\\nh a h \'C2 c c d dch ca a\\na G G G \'C3 a haG a F\\nh h a h c \'C2 c d dch ca a\\na G G G \'C3 a baG a F\\na c c d fed \'C2b} c b a _h\\nc_ha G F F F \'C2 GFE F ED\\na a a a b a \'C2 GF G a a\\na G a G FE F G GF\",\"C3 c c c c c d \'f f f fed\\nC3 dc c \'c d dch ca a/ c dch ca\\nC3 \'c c c d c ch c c \'b a\\nC3 h c c d dch ca \'c c\\nC3 h aG a h aG aGF \'c\\nC3 c c d ch c c \'h a h\\nC2 c c d dch ca a \'a G G G\\nC3 a haG a F \'h h a h c\\nC2 c d dch ca a \'a G G G\\nC3 a baG a F \'a c c d fed\\nC2b} c b a _h \'c_ha G F F F\\nC2 GFE F ED \'a a a a b a\\nC2 GF G a a \'a G a G FE F G GF\"]', '[\"sin hen-ne ge-no-men.\\nso_ịs des al-den cla-ge.\\ndaz si-ne ta-ge zcar-gen sint\\nmit al-so ma-ni-ger swe-re\\nDer iung e den-ket werd ich gra.\\nmir vro me-det die vro-wen min\\nvnd truͦ-ret von dem me-re\\nals ich die wi-sen ho-re sa-gen\\nwie kum-mer-lich iz al-lez ste.\\nSich be-gin-net noch die iun-gen cla-gen.\\ndes sich die gri-sen vrou-ten e.\\nDer mil-te sich nach he-ren se-net.\\ndem kar-gen ist nach gu-te we\\nnacht vn-de tach wie er vil be-ia-ge\\nvnd ym daz ei-ne gar ge-ste\"]', '[\"Strich vor [vro]medet; medet unter einer Silbe, folgende aG-Ligatur untextiert\\nVor \'als\' Ton rasiert oder nur verschmiert?\\nFür Binnenreime mit LDM sâ [diu vrouwe[ ]] und tage statt tach zu konjizieren\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"Tex