(1704, 'Wir lan die phaffen syn vur tan', 'J BWernh 1', 'Bruder Wernher', 'German', 'J', 'fol. 7v-8r', 1, 1, '[\"C1 FG a a a a a \'C1 aGF GF\\nF G F FED F \'F2 FE-FGFE F ED\\nC D F F \'C1 F G F FE D F F Ga GFED \'C1 EF\\nFG a a a a a \'C1 aGF GF\\nF G F FED F \'C1 FE-FGFE F ED\\nC D F F F G \'C1 F FE D F F Ga GFED EF \'C1\\nF G F FED F FE-FGFE F ED \'C1\\nD F F G a a(G) \'C1 ha h aGFE F F G a baG a \'C1\\nD F F G a b a GF F \'C1 GFE F ED\\nC D F F GFE \'C1 D F F FE-FGFE FED DC C\\nC D \'C1 F F F G a a GF FE D \'C1 FE-FGFE FED DC\\nC D F F F \'C1 G a a GF F FE D \'C1 FC D F FG-a FEDC FF\",\"C1 FG a a a a a\\nC1 aGF GF \'F G F FED F\\nF2 FE-FGFE F ED \'C D F F\\nC1 F G F FE D F F Ga GFED\\nC1 EF \'FG a a a a a\\nC1 aGF GF \'F G F FED F\\nC1 FE-FGFE F ED \'C D F F F G\\nC1 F FE D F F Ga GFED EF\\nC1 \'F G F FED F FE-FGFE F ED\\nC1 \'D F F G a a(G)\\nC1 ha h aGFE F F G a baG a\\nC1 \'D F F G a b a GF F\\nC1 GFE F ED \'C D F F GFE\\nC1 D F F FE-FGFE FED DC C \'C D\\nC1 F F F G a a GF FE D\\nC1 FE-FGFE FED DC \'C D F F F\\nC1 G a a GF F FE D\\nC1 FC D F FG-a FEDC FF\"]', '[\"Wir lan die phaf-fen syn vuͦr tan.\\nWer lernẹt vns kris-te li-chez lebẹn.\\nWer git vns wib tzv̊ rech-ter e. Wer tou-fet vns die kynt.\\nWer sol vuͦr svndẹ vns buͦ-ze gebẹn.\\nWer sol vns vz dem ban-ne lan.\\nWer wi-set vns ob wir mit sen-den ou-gen wer-den blynt.\\nWer helt nv ste-te rit-ter scaft.\\nSit man nicht swert durch schyr men se-gent wit-wen vn-de wey-sen.\\nWer git vns vn-ses her-ren trost wer hat div kraft.\\nDaz er vns schyr-me vuͦr en-gest-li-chen vrey-sen.\\nWir we ren doch vuͦr ir-ret gar hetẹ wir der phaf-fen nicht.\\nDie val-schen lant ir or-den phlegẹn vnde habẹ wir myt dem rech-ten lebẹn-de phlicht\"]', '[\"Viele zusätzliche Federstriche\\nRasuren bei [schyr-]men, [trost] wer\\nengestlichen: seltsames Zeichen in Notensystem (F?)\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1705, 'Mary du bist daz bernde ryß (Wiener Hofton)', 'k Walth Ton III', 'Walther von der Vogelweide', 'German', 'k', 'fol. 734r', 1, 1, '[\"C1 h c c h a G a h \'C1\\nG a h c G a F FE\\nF-D \'C1 a a c G a G F ED C C \'[\\nC1 h c c h a G a h \'C1\\nG a h c G a F FE\\nF-D \'C1 a a c G a G F ED C C] \'C2\\nD G G G G a G F G \'C1 a G\\nG h c d h c a \'C1 GF E\\nC E F G E F \'C1 D C\\nC E F G G G \'C1 G F G a G\\nG G F E-F G \'F3 EF G\\nG G G F E FG a \'C1 G\\nG a h c a-G G D \'C1 E\\nc c c c h c h a \'F2 h GFE\\nC C C G D E C C\",\"C1 h c c h a G a h\\nC1 \'G a h c G a F FE \'F-D\\nC1 a a c G a G F ED C C\\n[ \'C1 h c c h a G a h\\nC1 \'G a h c G a F FE \'F-D\\nC1 a a c G a G F ED C C]\\nC2 \'D G G G G a G F G\\nC1 a G \'G h c d h c a\\nC1 GF E \'C E F G E F\\nC1 D C  \'C E F G G G\\nC1 G F G a G \'G G F E-F G\\nF3 EF G \'G G G F E FG a\\nC1 G \'G a h c a-G G D\\nC1 E \'c c c c h c h a\\nF2 h GFE \'C C C G D E C C\"]', '[\"Ma-ry du bist daz bern-de ryß\\ndaz a-dam vß dem pa-[ra]-dyß\\nge sen-det wart zu ei-ner helf-fe stu-re\\nMa-ry du bist daz le-bend zwy\\ndaz noe macht ma-chet ley-dez fry\\ndo in ver-ließ daz was-ser vn-ge-hu-re\\nMa-ry du bist daz kin-de-lin so clei-ne\\ndaz op-fert ab-ra-ham der rei-ne\\ngottẹ der ym die be-sny-du[n]g gab\\nMa-ry du bist die ta-fel lo-be-li-che\\ndar ynn die .x. bot so fron\\nge-schy-ben wor-den al-so schon\\ndie moy-ses sy-der nam dar ab\\nMa-ry du bist die cro-ne her-li-che\\ndie da-uid trug biß in sin grab\"]', '[\"Federstriche und Graphien zu überarbeiten!\\n\\nZ. 2 Korrektur G zu F bei \'pa[ra]dys\'\\n.x. = zehn oder ze-hen EF oder E-F\\n\'fron\' überschrieben, \'schon\' durchgestrichen\\nZ. 13 letzter Ton E fast wie F notiert\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotation