(1707, 'Ich weiz der hêrren manegen', 'J BWernh 3', 'Bruder Wernher', 'German', 'J', 'fol. 12v-13r', 1, 1, '[\"C1 G G b _h _h c_ha _h aG a \'C1 F GFE F G G\\nG G a b \'C1 G FE F G a FED E FGFE F ED \'\\nC1 D F F G a bc_ha _h aG a \'C1 F GFE F G G\\nG G b \'C1 ba _h c_ha _h aG a F GFE \'C1 F G G\\nG G a b G FE F \'C1 G a FED E FGFE F ED \'\\nC1 D F F G a bc_ha _h \'C1 aG a F GFE F G G\\nG \'C1 a b c _ha a_h-c_ha _h aG\\na(G) \'C1 F GFE F G G\\nG a b a _ha \'C1 b c d G a _h cba _h aG \'C1 G\\nbaG F E F G FED E FGFE \'C1 F ED\\nD F F G b _hc_ha _h \'C1 aG a G F G b _hc_ha _haG \'C1 GF\\nG a b c _ha _h c \'C1 d cbaG F G baG a_h c_ha _h aG G\",\"C1 G G b _h _h c_ha _h aG a\\nC1 F GFE F G G \'G G a b\\nC1 G FE F G a FED E FGFE F ED \'\\nC1 D F F G a bc_ha _h aG a\\nC1 F GFE F G G \'G G b\\nC1 ba _h c_ha _h aG a F GFE\\nC1 F G G \'G G a b G FE F\\nC1 G a FED E FGFE F ED \'\\nC1 D F F G a bc_ha _h\\nC1 aG a F GFE F G G \'G\\nC1 a b c _ha a_h-c_ha _h aG \'a(G)\\nC1 F GFE F G G \'G a b a _ha\\nC1 b c d G a _h cba _h aG\\nC1 G \'baG F E F G FED E FGFE\\nC1 F ED \'D F F G b _hc_ha _h\\nC1 aG a G F G b _hc_ha _haG\\nC1 GF \'G a b c _ha _h c\\nC1 d cbaG F G baG a_h c_ha _h aG G\"]', '[\"Ich weiz der her-ren manị-gen ob ich het ir ey-nes guͦt.\\nIch welt ouch ver-re baz wen er vuͦr scxan-den syn be huͦt.\\nIch welt ouch baz die se-le vuͦr des tiv-bels ban-den nerẹn.\\nIch wolt ouch varẹn-des guͦt durch got vnd ouch vm e-re tzerẹn.\\nIch wolt ouch val-scher ei-de nicht von hert-zen vil ge-swerẹn.\\nkegẹn vrivn-de wolt ich dul dich sin. kegẹn vien-den hoch ge-mv̊t.\\nIch wolt ouch rech-ter vuͦ-re phlegẹn.\\nVndẹ wol-te val-sche lan.\\nVn-recht we-wyn-nen guͦt. Des wolt ich mich vil gar ir we-gen.\\nMich duch-te daz werẹ al-lez wol ge tan.\\nIch wolt ouch haz-zen val-schen rat den schalkẹ Den liv-ten tzv̊_o-ren tragẹn.\\nDa von die her-ren wo[r]-den wert wie lut-zel sies in nv vuͦr ge-sagẹn.\"]', '[\"ẹuͦịv̊\\nRasur bei V. 4 se-le c_ha -> _h\\nRasuren bei V. 11 wolt (11.2: F ersatzlos; 11.10: F E zu G). Anschließend Initiale, dann weitere Rasur (11.11-12: E F zu F G); dort Textunterlegung den Vorschlägen von Zuckschwerdt folgend\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1708, 'Nu merket wa eyn blynder get', 'J BWernh 4', 'Bruder Wernher', 'German', 'J', 'fol. 14r-14v', 1, 1, '[\"C1 F a b c c_h a \'C1 b c_h a G a _h c%ha hc \'\\nC1 G a h c ch aG a ba_h c \'C1 b aG a_h aGFE GF\\nG a b _ha \'C1 G G EF GF DC D E \'C1 F FED EF F\\nF a c c cb \'C1 b} a _h c_h a_h G a _h c%ha hc \'\\nC1 G a h c cb aG a _h c _h \'C1 aG ab aGFE GF\\nG b a _ha G \'C1 G EF GF DC D E F FED EF F \'\\nC1 E D E F G b} a _h _haG-aaGFE GF \'\\nC1 G b G _h a G F D F F \'C1 FE F\\nF a b c c _h a a baG \'C1 aGa b a aGFE GF\\nF G E G \'C1 E C D EDE FE DC C\\nC D E \'C1 F FE G G a ba GF G E \'C1 G ED ED D\\nE C D E FE G \'C1 a h a GF G(F) ED E F GF F\",\"C1 F a b c c_h a\\nC1 b c_h a G a _h c%ha hc \'\\nC1 G a h c ch aG a ba_h c\\nC1 b aG a_h aGFE GF \'G a b _ha\\nC1 G G EF GF DC D E\\nC1 F FED EF F \'F a c c cb\\nC1 b} a _h c_h a_h G a _h c%ha hc \'\\nC1 G a h c cb aG a _h c _h\\nC1 aG ab aGFE GF \'G b a _ha G\\nC1 G EF GF DC D E F FED EF F \'\\nC1 E D E F G b} a _h _haG-aaGFE GF \'\\nC1 G b G _h a G F D F F\\nC1 FE F \'F a b c c _h a a baG\\nC1 aGa b a aGFE GF \'F G E G\\nC1 E C D EDE FE DC C \'C D E\\nC1 F FE G G a ba GF G E\\nC1 G ED ED D \'E C D E FE G\\nC1 a h a GF G(F) ED E F GF F\"]', '[\"Nv mer-ket wa eyn blyn der get. Vuͦr lu-fet er den knecht.\\nIm ist die ruwẹ an tze-ren vuͦ-zen sam die stra-ze slecht.\\nIm ist die tiefẹ al sam der vort. Swen er dem waz-zer na-het.\\nIm ist die dyn-ster nacht ge-li-che lecht. Al-sam der tac.\\nWen er ne we-derz a-ne wi-sel nicht ir ken-nen mac.\\nEr stru-chet bi dem svn-nen schynẹ ob er tzv̊ bal-de ga-het.\\nDes ne mac ich ym ge-wi-zen nicht.\\nEz ist so ma-ni-ger blynt mit liech-ten ou-gen.\\nDer wol daz vn-ge-ver-te bi der rech-ten stra-ze sicht.\\nVndẹ ir-re vert vuͦr schan-den svn-der lou-gen.\\nWir lei-en habẹn den wi-sel vuͦr lorn der vn-ser sol-te phle-gen.\\nWer gri-fen sel-ber nach den pha-den wir stru-chen bi den we-gen.\"]', '[\"uͦ v̊\\nẹ\\nV. 3.4 Rasur _ha zu _ha korrigiert (?); tie-fe über Zeilenbruch, ohne Note in der Folgezeile\\nZ. 4 \'Swen\' mit Majuskel-S; metrischer Zeilenbruch nach \'nahet\' durch | in der Textzeile markiert\\nZ. 4.8-4.9 Rasuren ? cb zu c_h a_h korrigiert; nach 4.14 (Zeilenende) Federansatz\\nZ. 7.6 Rasur b korrektur zu a, Alterations-b bleibt stehen - wohl für anschließendes _h=b\\nV. 10.1/2 Rasur von  G, ersatzlos, da für Folgesilbe\\nStatt Federstrich im Notensystem  in der Textzeile am Ende von V. 10\\nV. 11.14 Rasur F (von FED) ersatzlos\\nV. 12 b oder h ?\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1709, 'Quant voi le dous tans venir que fait noif et gelée', 'Linker 65.70', 'Author of Linker 65.70 (Gace Brulé?)', 'French', 'K', '377', 1, 1, '[\"C2 d c d e e fe \'C2 d c\\nd e c d c cd d \'\\nC2 d c d e e fe d c\\nd \'C2 e d d c cd d\\na c d \'C2 f ed f C3 g ec\\nd e f \'C3 e dch cd ch ha\\na c d \'C3 fed f edc d\\nc h cd dch cd \'C3 d dc ch\\na c d fe \'C2 e dc d\",\"C2 d c d e e fe\\nC2 d c \'d e c d c cd d \'\\nC2 d c d e e fe d c \'d\\nC2 e d d c cd d \'a c d\\nC2 f ed f C3 g ec \'d e f\\nC3 e dch cd ch ha \'a c d\\nC3 fed f edc d \'c h cd dch cd\\nC3 d dc ch \'a c d fe\\nC2 e dc d\"]', '[\"Quant je voi le douz tens ve-nir\\nque fait noif et ge-lé-e,\\net j\'oi ces oi-se-llons ten-tir\\nel bois sor la ra-mé-e,\\nlors me fet ma da-me sen-tir\\nun mal dont ja ne qier gue-rir\\nne ja n\'en au-rai mé-e;\\nentre q\'il li vie-ngne a plai-sir\\nqu\'el m\'ait joi-e do-né-e.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f405\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1710, 'Quant voi le dous tans venir La flor en la pree', 'Linker 231.8', 'Robert de Reins', 'French', 'K', '190', 1, 1, '[\"C3 g f g fe d fe \'C3 dcc(d)\\nf e d ch d e\\nf fed c \'C3 ch c\\nd e c de f \'C3 e d\\nf e d d b} c b b\\nc \'C3b} cd e d c\\nd c f g \'C3b} fed e dc b\\nd g fed f edc \'C3b} dc cb c\\na G b\\na b \'C3b} c cd c a b\\nG a b \'C3b} c\\nd b c d e c d\\nb \'C2b} c b aGa b c\",\"C3 g f g fe d fe\\nC3 dcc(d) \'f e d ch d e \'f fed c\\nC3 ch c \'d e c de f\\nC3 e d \'f e d d b} c b b \'c\\nC3b} cd e d c \'d c f g\\nC3b} fed e dc b \'d g fed f edc\\nC3b} dc cb c \'a G b \'a b\\nC3b} c cd c a b \'G a b\\nC3b} c \'d b c d e c d \'b\\nC2b} c b aGa b c\"]', '[\"Quant voi le douz tens ve-nir\\nla flor en la pré-e\\nla ro-se_es-pa-vir\\na-donc chant pleur et sous-pir;\\ntant ai joi-e a-mé-e\\ndont ne puis jo-ir\\nmir— ma joi-e sanz re-pen-tir\\ntir— a ce que ne puis sen-tir\\nnas-sen-tir\\nne me puis pour nul a-voir\\nau de-par-tir\\nje voi ce que je de-sir\\nsi n\'en puis joi-e_a-voir.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f218\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1711, 'Ich buwe eyn hus', 'J BWernh 5', 'Bruder Wernher', 'German', 'J', 'fol. 14v-15r', 1, 1, '[\"C2 a c d e ed e ea c c \'C2 dch c ha\\na c d e edc \'C2 h c d ch c(h) ha h cha \'C2 a Gacha\\naG c d e edc h c \'C2 dc hah G a hc hah Ga\\na c d \'C2 e ed e a c c dch c ha \'\\nC2 a c d e edc h c d ch \'C2 c ha h cha a Gacha\\naG \'C2 c d e edc h c dc hah G \'C1 a hc hah Ga\\naaGE G \'C1 a a c cd cha aG c c d \'C2 cha h G G a\\na c d e \'C2 edc h a dc ha h cha aG\\na c c \'C2 d ch a G a dch c haG a \'\\nC2 a h c dc d e ed c \'C2 ch a c ch-cd cha aG\\nG a c \'C2 d ch c d e edc h c \'C2 dc hah G a hc hah Ga\",\"C2 a c d e ed e ea c c\\nC2 dch c ha \'a c d e edc\\nC2 h c d ch c(h) ha h cha\\nC2 a Gacha \'aG c d e edc h c\\nC2 dc hah G a hc hah Ga \'a c d\\nC2 e ed e a c c dch c ha \'\\nC2 a c d e edc h c d ch\\nC2 c ha h cha a Gacha \'aG\\nC2 c d e edc h c dc hah G\\nC1 a hc hah Ga \'aaGE G\\nC1 a a c cd cha aG c c d\\nC2 cha h G G a \'a c d e\\nC2 edc h a dc ha h cha aG \'a c c\\nC2 d ch a G a dch c haG a \'\\nC2 a h c dc d e ed c\\nC2 ch a c ch-cd cha aG \'G a c\\nC2 d ch c d e edc h c\\nC2 dc hah G a hc hah Ga\"]', '[\"Ich buwẹ eyn hus dar yn-ne will ge syn-de wesẹn.\\nDer tza-del vnd der tzwi-bel sint mit herẹ da vuͦr ge sez-zen.\\nDer man-gel vndẹ wer fet so ge wal-tich-li-chen da yn.\\nNv ra-tent lie-be vrivnt wie ich mv̊-ge ge-nesẹn.\\nVn-tu-gent vndẹ der her-ren er-ge die habẹnt sich vuͦr mez-zen.\\nDaz sie mir tzv̊_ey-ner sy-ten wen-den spisẹ vndẹ ouch den wyn.\\nSo blet tzv̊_der drit-ten si-ten dar. Vn-tru-we vndẹ ir ge-syn-de.\\nDar tzv̊ byn ich in der vuͦr scan-den ech-te gar.\\nDie re-che sint tzv̊ der vier-den si-ten swyn-de.\\nSit mich vn-tugẹn-de mit yr her al-so be sez-zen hat.\\nVndẹ mich vuͦr ter-ben will daz wendẹ der her-ren tugẹnt den_iz les-ter-li-chen stat.\"]', '[\"Rasur bei Schlüssel (F-Schlüssel?) und F3 D F zu C2 a c korrigiert\\nZ. 3.7 h von dch Rasur, weiter bis Ende des Verses um eine Sekunde korrigiert bei gleichen Neumengraphien: aGa F G ah aGa FG korrigiert zu hah G a hc hah Ga\\nZ. 3 Konjekturvorschläge von Zuckschwerdt: Umstellung der Wörter\\nZ. 4.12 Rasur aG zu ha korrigiert\\nZ. 7.8 Rasur Ga zu aG korrigiert. Z. 8.11 Rasur (?) c zu d korrigiert\\nZ. 9.9-9.12 Rasur cha h aGF G zu dch c haG a korrigiert\\n\\n\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
(1712, 'Chant can non es qui l\'entenda', 'BdT 406.22', 'Raimon de Miraval', 'Occitan', 'R', '83v (lxxxvii)', 1, 1, '[\"F2 C D F F F F G F\\nF G a G F \'\\nF2 F b} Gab a G FE D DC\\nG a DC D F E FEDC D\\nC D F \'F3 F G aGF a\\na c(h) a h a G F\\nF G ah a \'F3 G F E D FED DC\\na C D F G FE D F EDC CD\",\"F2 C D F F F F G F \'F G a G F \'\\nF2 F b} Gab a G FE D DC \'G a DC D F E FEDC D \'C D F\\nF3 F G aGF a \'a c(h) a h a G F \'F G ah a\\nF3 G F E D FED DC \'a C D F G FE D F EDC CD\"]', '[\"Chant can non es qui l\'en-ten-da,\\nnon pot trop va-ler\\ne pus ai loc et le-zer\\nque nos bels so-las des-pen-da,\\nses gab si\'_en un pauc au-zitz;\\ncar totz clams n\'es pus gra-zitz,\\ncant a la fi pauz\' om be-las ra-zos\\nper que vuelh far en-ten-dre mas chan-sos.\"]', '[\"\", \"\"]', '{\"Link\": \"https://gallica.bnf.fr/ark:/12148/btv1b60004306/f184.item\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 431, \"facsimileY\": 1368, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"ZoomFacsimile\": 270, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1713, 'Swer sich myt vremden livten wil bewerren', 'J BWernh 6', 'Bruder Wernher', 'German', 'J', 'fol. 15v-16r', 1, 1, '[\"C1 D F F G a \'C1 a aGF Ga\\na a h c a a aGF \'C1 FG a aGF F\\nFG a a a \'C1 aGF EFGFE F ED\\nFED C D FD F \'C1 a G aG a ED D\\nD F \'C1 F G a a aGF Ga\\na a \'C1 h c(h) a a aGF FG a aGF F\\nF \'C1 G a a aGF EFGFE F ED\\nFED \'C1 C D FED F F GF E F ED \'C1 D\\nD E F G FE F GF \'C1 ED\\nD F F G a \'C1 a aGF G a baG a\\na \'C2 c c d a ab-c a_h aG\\na \'C1 c c d a c ab aG a a aGF FG a aGF \'C1 F\\nF G a c a aG \'C1 a b aGF D F FG FED DC \'\\nC1 C D F G FE F G a aGF \'C1 E D EF EDCD ED\",\"C1 D F F G a\\nC1 a aGF Ga \'a a h c a a aGF\\nC1 FG a aGF F \'FG a a a\\nC1 aGF EFGFE F ED \'FED C D FD F\\nC1 a G aG a ED D \'D F\\nC1 F G a a aGF Ga \'a a\\nC1 h c(h) a a aGF FG a aGF F \'F\\nC1 G a a aGF EFGFE F ED \'FED\\nC1 C D FED F F GF E F ED\\nC1 D \'D E F G FE F GF\\nC1 ED \'D F F G a\\nC1 a aGF G a baG a \'a\\nC2 c c d a ab-c a_h aG \'a\\nC1 c c d a c ab aG a a aGF FG a aGF\\nC1 F \'F G a c a aG\\nC1 a b aGF D F FG FED DC \'\\nC1 C D F G FE F G a aGF\\nC1 E D EF EDCD ED\"]', '[\"Swer sich myt vrem-den liv-ten wil\\nbe wer-ren. Der sol sv̊-nen mit den kvn-den.\\nWil er der vien-de ma-chen vil.\\nDaz scha-det ym ob er vuͦrẹt vrivn-de vei-le.\\nNv merkẹt an den von os-ter-lant.\\nWie dem ge-lvn-gen sy an sy-me tei-le.\\nDo_ẹr an den vien-den nicht ne vant.\\nDo solt er an den vrivn-den han ir vun den.\\nMyn rat den wi-sen wol be hagẹt.\\nMan sol den vrivnt tzv̊ gro-zen notẹn be-hal-ten\\nSwer vien-de vlivt vndẹ vrivn-de iagẹt.\\nSol dem ge-lin-gen des mv̊z ovch ge-lu-cke se-re wal ten.\\nWie ob der vrivnt tzv̊ vien de wirt. vndẹ tzv̊ den vremẹ-den swert.\\nDa scicht ein klem-me da von ym vn sel-de wirt be-schert\"]', '[\"Z. 7.1-7.2 Rasur G a korrektur zu [ ] G (Do_ẹr)\\nZ. 8.10 Rasur C in: [ED]C\\nZ. 12 \'ovch\' nachgetragen, und korrigiert platziert, \'sere\' nachgetragen\\nZ. 13 \'den\' nachgetragen \", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"II