(1714, 'Eyn kvninc in syme trovme sach', 'J Kelin 1', 'Kelin', 'German', 'J', 'fol. 16v', 1, 1, '[\"C1 a c c-c ch-cd c \'C1 ch aG GFE\\nE-F G FED E \'C1 G Ga cG\\nGa c c cd c ch aG \'C1 GFE\\nGa-cha G F ED C \'C1 EGC\\na c c ch-cd c ch aG GFE \'\\nC1 EF G FED E G Ga cG\\nGa c c \'C1 cd c ch aG FED\\nGa-cha G \'C1 F ED C EGC\\nE F E \'F2 ED C E G Ga\\nG-G Ga h \'C1 ch aG Ga cG\\nGa c c \'C1 cd c ch aG GFE\\nEF G FED \'C1 E G Ga cG\\nGa c c cd \'C1 c ch aG GFE\\nGa-cha \'C1 G F ED C EGC C\",\"C1 a c c-c ch-cd c\\nC1 ch aG GFE \'E-F G FED E\\nC1 G Ga cG \'Ga c c cd c ch aG\\nC1 GFE \'Ga-cha G F ED C\\nC1 EGC \'a c c ch-cd c ch aG GFE \'\\nC1 EF G FED E G Ga cG \'Ga c c\\nC1 cd c ch aG FED \'Ga-cha G\\nC1 F ED C EGC \'E F E\\nF2 ED C E G Ga \'G-G Ga h\\nC1 ch aG Ga cG \'Ga c c\\nC1 cd c ch aG GFE \'EF G FED\\nC1 E G Ga cG \'Ga c c cd\\nC1 c ch aG GFE \'Ga-cha\\nC1 G F ED C EGC C\"]', '[\"Eyn kv-ninc_in sy-me trov-me sach.\\nSy_ne werlt die was so scho-ne.\\nVon gol-de daz er di-cke iach.\\nSie het nicht schan-den meyl.\\nDiv an-der lu-ter sil-ber was.\\nVil gar al a-ne ho-ne.\\nGe-lu-tert alsọ ein spie-gel glas.\\nVn_dẹ hetẹ ouch seldẹ eyn teil.\\nDiv drit-te was sich y-sen-in.\\nDiv_ir scract yn vz demẹ trov-me.\\nSo mac sie nv wol kop-fer syn.\\nDes ne-ment da by gov-me.\\nManịc e-delẹ ivgẹnt git liech-ten schyn.\\nVndẹ tzamẹt an scan-den tzov-me.\"]', '[\"Rasur bei \'hetẹ\' F ersatzlos (Z. 8.2)\\nRasur bei \'seldẹ\' C ersatzlos (Z. 8.4)\\nRasur bei \'ir scract\' Ga; voriges G zu Ga erweitert\\nDünner Federstrich nach \'luter\' (Z. 5)\\nDünner Federstrich nach \'also\' (Z. 7)\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": 17, \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\