(1719, 'Vil riche selde mich nympt ymmer wunder', 'J Kelin 2', 'Kelin', 'German', 'J', 'fol. 17v-18r', 1, 1, '[\"C3 G c d e f g f \'C3 e de-f e ed\\nf +a g fg dc \'C2 d a d c baG a _h aG\\n- c d \'C2 e f d c d a d c baG a \'C3 baG\\nG c d e f g f \'C3 e de-f e ed\\nf +a g fg dc d \'C2 a d c baG a _h aG\\n- c d \'C2 e f d c d a d c \'C2 baG a baG\\na(G) F G a \'C2 b c_h _h c d c baG a \'C3 bGF G\\nG c d e f g \'C2 f e de-f e ed\\nC3 f +a g ef \'C2 dc d a d c baG a _h aG\\n- c \'C2 d e f d c d a d \'C2 c baG a _hGF G\",\"C3 G c d e f g f\\nC3 e de-f e ed \'f +a g fg dc\\nC2 d a d c baG a _h aG \'- c d\\nC2 e f d c d a d c baG a\\nC3 baG \'G c d e f g f\\nC3 e de-f e ed \'f +a g fg dc d\\nC2 a d c baG a _h aG \'- c d\\nC2 e f d c d a d c\\nC2 baG a baG \'a(G) F G a\\nC2 b c_h _h c d c baG a\\nC3 bGF G \'G c d e f g\\nC2 f e de-f e ed \'C3 f +a g ef\\nC2 dc d a d c baG a _h aG \'- c\\nC2 d e f d c d a d\\nC2 c baG a _hGF G\"]', '[\"Vil ri-che sel-de mich nympt ym-mer wun-der.\\nDaz du die e-ren gern-den e-res nicht be-svn-der.\\n_ Vndẹ die wol ge-mv̊-ten von den ar-gen nicht en-scers.\\nNv scham dich sel-de du gis ey-nem me-re.\\nWen dryn die ger-ne tze_reten durch got vn-de vm e-re.\\n _ O-we daz du dy-ne helfẹ tzv̊_den mil-ten nicht en swers.\\nIch weiz wol du wilt sie_hin heym in di-nen hob be hal-ten.\\nDu quemẹ al-rest da her von hy-mel-ri-che.\\nDa wil du die ge-tru-wen mil-ten sy cher-li-che.\\n_ La die gar vuͦr scamp-ten ar-gen hye mit scan-den al ten.\"]', '[\"Mehrfach Textlinie als oberste, fünfte Notenlinie genutzt.\\nZ. 3.1 Rasur d bei \'Vndẹ\'\\n3.7-3.9 Rasur c a GFE, korrigiert zu d c baG\\n4.2 Rasur zwischen \'scham\' und \'dich\'\\nZ. 5 \'tze_reten\' nach \'reten\' nach Zeilenumbruch ohne Note\\n6.5-6.7 Rasur e d e, Korrektur zu d c d\\n10.1 Rasur d, Korrektur c\\nSchlüsselwechsel bei Versumbruch inmitten der Zeile bei V. 8/9\\n7.6/7.7 Rasur c d\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,