(1720, 'Ez ist vil maniger herre von hoer art geborn', 'J Kelin 3', 'Kelin', 'German', 'J', 'fol. 18r-18v', 1, 1, '[\"C1 a c ac \'C1 c d hcha aG\\nE G G Ga cha aG \\n\'C1 a c c c G a GFE \\nGa-b a G \'C1 E FE D C C\\nC E F G\\n\'C1 a G F E FED CFED DC\\na c \'C1 c c d hcha aG\\nE a a \'C1 Ga cha aG\\na c c c G a \'C1 GFE\\nGa-b a G EF E D C C \'\\nC1 C E F G\\na G F E \'C1 FED CFED DC\\nE G F E FE D \'F2 C C\\nC E F G a h \'C1 a hG a h a h c haG \'\\nC1 E F G a G F E FE D C \'C1 CD\\nD E F G a G \'C1 F E FED CFED DC\\nE G F \'C1 E FE D C C\\nC E F \'C1 G a h a hG a \'C1 h a h c haG\\nF E F \'C1 G a G F E FE D C CD \'\\nC1 D E F G a G F E FED \'F2 CFED DC\",\"C1 a c ac\\nC1 c d hcha aG \'E G G Ga cha aG  \'\\nC1 a c c c G a GFE  \'Ga-b a G\\nC1 E FE D C C \'C E F G \'\\nC1 a G F E FED CFED DC \'a c\\nC1 c c d hcha aG \'E a a\\nC1 Ga cha aG \'a c c c G a\\nC1 GFE \'Ga-b a G EF E D C C \'\\nC1 C E F G \'a G F E\\nC1 FED CFED DC \'E G F E FE D\\nF2 C C \'C E F G a h\\nC1 a hG a h a h c haG \'\\nC1 E F G a G F E FE D C\\nC1 CD \'D E F G a G\\nC1 F E FED CFED DC \'E G F\\nC1 E FE D C C \'C E F\\nC1 G a h a hG a\\nC1 h a h c haG \'F E F\\nC1 G a G F E FE D C CD \'\\nC1 D E F G a G F E FED\\nF2 CFED DC\"]', '[\"Ez ist vil manị-ger her-re.\\nVon ho-er art ge-born.\\nVndẹ vol-get scal-kes le-re.\\nDaz ist mir her-tzich-li-chen tzorn.\\nSie habẹn ir korn.\\nEin wun-der daz se vel-let.\\nSwer hie die tzit vuͦr tri-bet.\\nMit gan-tzen tugẹn-den gar.\\nVnd da an ste-te bli-bet.\\nDa wirt man ho-er burt ge-war.\\nDer engẹ-le schar.\\nhat sich tzv̊ ym ge-sel-let.\\nSwer gar mit kvn-di-chei-te vert.\\nVnde sich da by myt ma-nich-val-ten hou-bet schan-den nert.\\nVndẹ da bi wil we-sen e-delẹ vn-de wert.\\nLa sen wer kan mir daz tzv̊ samẹ-ne bryn-gen.\\nIr edẹ-len myn-net wi-sen mv̊t.\\nDie varẹn-den smeichẹn vndẹ ma-chen manị-gen man tzv̊ dvn-kel guͦt.\\nSwer sy-me dingẹ in dir-re werl-de rech-te tuͦt.\\nDem mac an sy-me a-del wol ge-lin-gen\"]', '[\"Z. 6 Nachtrag \'daz\'\\nRasur bei \'Sie haben ir korn\'\\nZ. 13.6 Rasur FE, Korrektur D\\nZ. 19.4 Rasur a\\nZ. 19.9 Rasur D aus Ligatur FED\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31),
