+a g fed/ c d e G/ e f g +a g f e ef/ d dc db c abaG C2 GF \'\\nC2 a c c d d d c c aG F G a/ d d c c a a G F F a GFED C1 CD \'\\nC2 a a b c d c a c aF Ga a/ a c G aG C1 F EDE F ED \'\\nC1 F E F G G FE F G G G G FE F G E/ F E F G F E F G F E F Ga F \'\\nC2 c e e e def e dccdedef edc/ c e e de f e d c b a Ga_h aG \'\\nC3 e f g g g fe f e e d edc d e fe/ e f g g g fe f e d dc c b a _ha_hG \'\\nC2 d d d d cha/ c c e dcha h c d cde d cha h c d da \'\\nC2 d c f e fed d dh cd/ d c f e fed dh c ca \'\\nC1 a c d dc b aG Gab aG/ a b aG aF G aG F F \'\\nC2 c e d ch aG a a aE/ F3 a G F E FE D C CDE \'\\nC1 a a c c c d a c a a G Ga c c/ a a c c c d a c a a GF FG a Ga GFED FF \'\\nC1 c c d h cha GaGF GE/ EF G FED C E G GC\"]', '[\"Lob al-ler en-gel vn-de lob der rech-ten kris-ten-het.\\nWir lan die phaf-fen syn vuͦr tan. Wer lernet vns kris-te li-chez leben.\\nNv scou-wet an den sv-mer guͦt. Wie er al der werl-de vreu-de git.\\nIch weiz der her-ren mani-gen ob ich het ir ey-nes guͦt.\\nNv mer-ket wa eyn blyn-der get. Vuͦr-lu-fet er den knecht.\\nIch buwe eyn hus dar yn-ne wil ge-syn-de wesen. Der tza-del vnd der\\nSwer sich my vem-den liv-ten wil be-wer-ren. Der sol sv̊-nen mit den kvn-den.\\nEyn kvninc in sy-me trov-me sach. Von gol-de daz er di-cke iach.\\nVil ri-che sel-de mich nympt ym-mer wun-der. Daz du die e-ren gern-den e-res nicht be-svn-der.\\nEz ist vil mani-ger her-re. von ho-er art ge-born.\\nSo wol dem ho-be da man truwe an ho-er wir-de hat.\\nEyn kvp-fer so vuͦr gul-det was daz ez gar gul-din scheyn.\\nEyn wun-der in der werl-de vert. Daz sich al-len tugen-den wert.\\nSy-on tru-re. Din buͦrch mv-re. Hat von schu-re.\\n_ Hie bevorn do wir kyn-der wa-ren. Vnd die tzit was in den ia-ren.\\n_ O-we daz nach lie-be gat. Leit so man ez tri-be.\\nMyn tru-rich-lich-iz klagen. Ist daz daz mich vuͦr sneit mynne o-we.\\nNie-man tzv̊ vro sol pry-sen. Mit lobe den liech-ten tac.\\n_ Swa eyn vrivnt dem an-dern vrivn-de bi-ge-stat. Mit gant-zer tru-wen gar an al-le mis-se-tat.\\nIn di-ser wise daz er-ste liet. Sing ich dem hoes-ten her-ren der vns von den gro-zen sor-gen schiet.\\nDri-val-tich name der go-te-heit krist so bis-tu ge-nen-net.\\n_ Golt von a-ra-bye ist guͦt. Daz darb ouch ne-man stra-fen. Swelich her-re tugent...\\n_ Swer da ger-ne rit-ter wird myt ho-er wir-di-cheyt. Der lege die tugent...\\nHie vuͦr eyn wer-der rit-ter lac. Tot siech da an dem bet-te syn.\\n_ Ivn-ger man von zwen-zich ia-ren. Ler-ne tu-gent-li-che ba-ren.\\nEz ist eyn lo-be-li-che kvnst. Der sei-ten spil tzv̊ rech-te kan.\\nDer kv-ninc ro-dolp myn-net got. Vnd ist an tru-wen ste-te. Der kv-ninc ro-dolp hat...\\nMan sach hie vuͦren die al-ten her-ren e-ren phlegen. Vnd dar tzv̊ ho-er wer-de-cheit.\\nEz_ist hivte eyn wun-nych-li-cher tac. Nv phle-ge myn der al-ler din-ge wal-te.\\nSwer rit-ters na-men wolle vnt-fan. Als en ge-tiv-ret hat der man. \\nMyn men-scheit ley-der ist so kranc. Daz myn ge-danc Nympt wi-der wanc.\\n_ Got in vier ele-men-ten sich er-schey-net. Ob wir den nicht recht ir-ken-ten der vns hat ge-rey-net.\\nDer wi-se hei-den ca-to der nye touf ge-wan. Der sprichet die wort daz sich eyn is-lich kris-ten man.\\nDaz ge-de-o-nes wol-len vlivs in tou-we. quam hy-mel vrucht daz ist die brut.\\nDer kv-ninc na-bu-godo-no-sor ge-sach in sy-me trov-me. Eyn bil-de von der er-den an den hy-mel rey-chen.\\nOb al-er myn-ne myn-nen kraft. Die hoch ge-lobe-ten wer-den myn-ne meis-ter-scaft.\\nAl-ler guͦ-te. vuͦl-ler vluͦ-te. vloz in gna-den stra-men. Kvmpt ge-vloz-zen her vz go-tes hert-zen griez or-sprvn-ge.\\nGot herre al-mech-tich. Vuͦr be-dech-tich. al-ler meis-ter schaft vnd al-ler din-ge.\\nHerre vn-de mey-ster schef-fer myn. Got al-le cre-a-tu-re dyn.\\nUn-tru-we sli-chet also eyn mvs. In val-sches man-nes hert-zen hus.\\nIch han nach wa-ne dic-ke lobet. Vnd et-te-wa durch liebe eyn teil.\\nSo wol dir werlt so wol dir hivte vnd ym-mer me-re wol. So wol dir des daz ich daz hy-mel-ri-che noch be-sit-zen sol.\\nEyn ri-cher kvninc hiez kof-dras. Der hette vz ro-tem gol-de.\\n\"]', '[\"1. Stolle \'Alment\' (2r)\\n2. Bruder Wernher I (7v)\\n3. Bruder Wernher II (9r)\\n4. Bruder Wernher III (12v)\\n5. Bruder Wernher IV (14r)\\n6. Bruder Wernher V (14v)\\n7. Bruder Wernher VI (15v)\\n8. Kelin I (16v)\\n9. Kelin II (17v)\\n10. Kelin III (18r)\\n11. Zilies von Seyne I (20v)\\n12. Zilies von Seyne II (21r)\\n13. Der Wilde Alexander (22r)\\n14. Der Wilde Alexander (24r)\\n15. Der Wilde Alexander (24v)\\n16. Der Wilde Alexander (25r)\\n17. Der Wilder Alexander, Leich (25v)\\n18. Robyn (28r)\\n19. Spervogel (29r)\\n20. Höllefeuer (30r)\\n21. Gervelin I (31r)\\n22. Fegfeuer II (35r)\\n23. Henneberger (36v)\\n24. Der Guter (38r)\\n25. Der Unverzagte I (39r)\\n26. Der Unverzagte II (40r)\\n27. Der Litschauer (42r)\\n28. Tannhäuser (42v)\\n29. Singauf (43v)\\n30. Reinolt von der Lippe (45r)\\n31. Rumelant von Sachsen I (47v)\\n32. Rumelant von Sachsen II (49r)\\n33. Rumelant von Sachsen III (51r)\\n34. Rumelant von Sachsen IV (51v)\\n35. Rumelant von Sachsen V (55r)\\n36. Rumelant von Sachsen VI (56v)\\n37. Rumelant von Sachsen VII (58v)\\n38. Rumelant von Sachsen VIII (59v)\\n39. Rumelant von Sachsen IX (62r)\\n40. Rumelant von Schwaben (62v)\\n41. Friedrich von Sonnenburg I (63v)\\n42. Friedrich von Sonnenburg II (70r)\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 0, 31);
