(1797, 'Il feroit trop bon morir', 'Linker 192.8', 'Perrin d\'Angecourt', 'French', 'K', '154b-155a', 1, 1, '[\"C1 c d cc(h) aG F GFED C \'\\nC1 G F G aa(G) FED C D\\nc \'C1 d cc(h) aG F GFED C\\nG F G \'C1 aa(G) FED C D\\nE F G \'C1 E(D) G Ga cc(h)\\na GG(F) E D C \'C1 Ga GFE D\\nE G Ga G d cc(h) \'C1 aGF\\nb a G FED D C GFE-ED\",\"C1 c d cc(h) aG F GFED C \'\\nC1 G F G aa(G) FED C D \'c\\nC1 d cc(h) aG F GFED C \'G F G\\nC1 aa(G) FED C D \'E F G\\nC1 E(D) G Ga cc(h) \'a GG(F) E D C\\nC1 Ga GFE D \'E G Ga G d cc(h)\\nC1 aGF \'b a G FED D C GFE-ED\"]', '[\"Il fe-roit trop bon mo-rir;\\npour ois-sir hors de dan-gier.\\nbien doi ma vi-e ha-ïr;\\nquant ce-le point ne m\'a chier.\\nque je tant aim et de-sir.\\nsi me cou-ven-dra a-ten-dre.\\nma vo-len-té et sous-frir;\\ntant q\'il li vien-gne_a ple-sir.\"]', '[\"\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/canvas/f180\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"https://gallica.bnf.fr/iiif/ark:/12148/btv1b550063912/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 29),
