(1860, 'Quar nueg e jorn trist soi et esbahit', 'BdT 461.206a', 'Author of BdT 461.206a', 'Occitan', 'I-CF LVI', '', 1, 0, '[\"C4 D F G a c cha a G a a \'\\nC4 d c h a a h a G a h\\nh \'C4 c h a a h a G F(E) \'C4 FED\\nc c h a G a h chc \'C4 h a\\nG G a h d d cha a \'C4 G a\\nc c c h d c \'C4 a G a hah-ch\\nh cha a a h \'C4 cha a G a G\\nd c c hah-ch h \'C4 cha a G a a\",\"C4 D F G a c cha a G a a \'\\nC4 d c h a a h a G a h \'h\\nC4 c h a a h a G F(E)\\nC4 FED \'c c h a G a h chc\\nC4 h a \'G G a h d d cha a\\nC4 G a \'c c c h d c\\nC4 a G a hah-ch \'h cha a a h\\nC4 cha a G a G \'d c c hah-ch h\\nC4 cha a G a a\"]', '[\"Quar nueg e iorn trist soi et es-ba-hit,\\nno sap chan-tar com se de-gra da-vers,\\nde mieu se-nher lo pretz que mais fa-lhit;\\nmort bri-sa-ra, com l\'es-tat lhi ver-ger.\\nPer sieu va-lor lo mieu chants es trops nutz,\\ncilh de Cu-canh plus non au-ran la lutz,\\nquar saup totz temps al mielhs a-con-se-lhar.\\nper lor, plo-rantz, no val lo mieus chan-tar.\"]', '[\"Notes: The melody is here transcribed one octave lower.\", \"\"]', '{\"Link\": \"https://www.librideipatriarchi.it/Archivi/LBPT/Files/pdfs/031/001.jpg\", \"Plica\": false, \"IIIFid\": \"undefined\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"12\", \"TextFontOld\": 0, \"IIIFManifest\": \"undefined\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": \"false\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1861, 'Eyn kvpfer so vur guldet was', 'J Zilies 2', 'Zilies von Seine', 'German', 'J', 'fol. 21r', 1, 1, '[\"C2 c c c \'C1 c c cha h cGaGEC/ C F E \'C1 F G G\\nc c c c \'C1 c cha h cGaGEC/ C D E FED \'C1 E DC\\nc c c-c c c cha h \'C1 cGaGEC/ C F E F G G\\nc \'c c c c cha h cGaGEC/ C D \'C1 E FED E DC\\nC C F E \'C1 F G F E FGC/ C D E FED \'C1 E DC\\nc c c c c c \'C1 c hcha hG/ G a h cha hc \'\\nC1 c c c c hG G E G EC/ D \'C1 E FED E DC\\nC D E \'C1 E G ED E FED E DC/ C \'F2 D E FED E DC\",\"C2 c c c\\nC1 c c cha h cGaGEC/ C F E\\nC1 F G G \'c c c c\\nC1 c cha h cGaGEC/ C D E FED\\nC1 E DC \'c c c-c c c cha h\\nC1 cGaGEC/ C F E F G G \'c\\nc c c c cha h cGaGEC/ C D\\nC1 E FED E DC \'C C F E\\nC1 F G F E FGC/ C D E FED\\nC1 E DC \'c c c c c c\\nC1 c hcha hG/ G a h cha hc \'\\nC1 c c c c hG G E G EC/ D\\nC1 E FED E DC \'C D E\\nC1 E G ED E FED E DC/ C\\nF2 D E FED E DC\"]', '[\"Eyn kyp-fer so vuͦr gul-det was daz ez gar gul-din scheyn.\\nDes valsch be trouch vil manị-gen man e. man sin wart ge-war.\\nDo daz sol_de syn daz kop-fer wart ge-stri-chen an den steyn.\\nAl da ou-ge-te sich der valsch alsọ er was kop-fer var.\\nDaz be tzei-chent ey-nen scho-nen man. Vz-en vndẹ yn nen nicht.\\nvul vnd valsch. vn-de vn-ge-tru-we. manị-ger mir des gicht.\\nDaz wir vil scho-ner bo-ser liv-te han by vn-sen tagẹn.\\nGe wunnẹn wen wir der guͦ-ten bidẹr-ben han. helfẹnt al-le mir daz klagẹn.\"]', '[\"System 2, Silbe 2: Rasur ha von cha.\\nSystem 9, Silbe 6, 7: Rasur C D, Korrektur C D E\\nSystem 13, Silbe 6/7: Rasur E\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontM