(1862, 'In diser wise daz erste liet', 'J Helleviur 1', 'Helleviur', 'German', 'J', 'fol. 30r-30v', 1, 1, '[\"C3 c c g fed e fed e dc \'\\nC2 c d e d c h c d \'C2 e d c hc dc ba GFG aG \'\\nC2 c c c d c fed e dc \'C2 c d e c dch c\\nc c \'C3 g fed e fed e dc\\nc d \'C2 e d c h c d e d c \'C2 hc dc baG GFG aG\\nc c \'C2 c d c fed e dc c d e \'C2 c dch c\\nc G a c \'C2 c d e d h G a \'C2 c c d e c dch c c\\nc \'C3 c e g g +a g \'C2 fe fe d c c c d e c \'C2 dch c c\\ne f e d c \'C2 h c d e d c hc dc ba GFG \'C2 aG\\nG c c d c \'C3 e g fed c c c d e \'C2 c dch c\",\"C3 c c g fed e fed e dc \'\\nC2 c d e d c h c d\\nC2 e d c hc dc ba GFG aG \'\\nC2 c c c d c fed e dc\\nC2 c d e c dch c \'c c\\nC3 g fed e fed e dc \'c d\\nC2 e d c h c d e d c\\nC2 hc dc baG GFG aG \'c c\\nC2 c d c fed e dc c d e\\nC2 c dch c \'c G a c\\nC2 c d e d h G a\\nC2 c c d e c dch c c \'c\\nC3 c e g g +a g\\nC2 fe fe d c c c d e c\\nC2 dch c c \'e f e d c\\nC2 h c d e d c hc dc ba GFG\\nC2 aG \'G c c d c\\nC3 e g fed c c c d e\\nC2 c dch c\"]', '[\"In di-ser wisẹ daz ers-te liet.\\nsing ich dem hoes-ten her-ren der vns von den gro-zen sor-gen schiet.\\nDie man tzv̊_dẹr hel-le von-det wan er leit durch vns den tot.\\nDo er sich an die mar-ter gab.\\nEr wart ge-sto-zen vndẹ ge-slagẹn ge-han-gen dar nach in eyn grab.\\nwart er ge-leit. der suͦ-ze got mit sy-nen wun-den rot.\\nNv dankẹ ym men_schẹ vndẹ sie dich vuͦr daz er dich stetẹ. An sy-nem dien-ste vin-de.\\nEz tetẹ eyn kynt den va-ter nicht daz er da tetẹ. Noch va-ter kegẹn dem kyn-de.\\nNu lo-bet yn er_ist lo-bes wert sin guͦ-te nye vol lo-bet wart.\\nVol scribẹn noch vol lesẹn. Swer in lobẹn kan der ist of der rech-ten vart.\"]', '[\"Rasur Z. 1.1, 1.2: d d -> korrigiert zu c c.\\nZ. 5 Korrektur/Ergänzung: [ba]G\\nZ. 7.2/7.3 Rasur a\\nlo-bet yn er_ist / lobẹt yn er ist\\nTexstreichungen\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,