(1863, 'In dyser zyt mir großes ellend ist gegeben', 'k Brenn 1', 'Reinmar von Brennenberg', 'German', 'k', 'fol. 672r', 1, 1, '[\"C2F4 a c d e c d \'C2F4 c h a a G a a \'C2F4\\nG G G a a c c c \'C2F4 c h a G a h a \'\\nC2F4 d d d d c h a G \'C2F4\\nG a a a a c c c h \'C1F3 a a G a h a\\na \'C2F4 c c d d e e e f e e \'C2F4 c de\\nec d d e \'C2F4 e e d d c h a G\\nG \'C2F4 a a a d d c [c] h a a G \'C2F4\\nG c c d d e e d \'C1F3 c c h a a G F Gaa\",\"C2F4 a c d e c d\\nC2F4 c h a a G a a\\nC2F4 \'G G G a a c c c\\nC2F4 c h a G a h a \'\\nC2F4 d d d d c h a G\\nC2F4 \'G a a a a c c c h\\nC1F3 a a G a h a \'a\\nC2F4 c c d d e e e f e e\\nC2F4 c de \'ec d d e\\nC2F4 e e d d c h a G \'G\\nC2F4 a a a d d c [c] h a a G\\nC2F4 \'G c c d d e e d\\nC1F3 c c h a a G F Gaa\"]', '[\"In dy-ser zyt mir g[r]os-ses el-lend ist ge-ge-ben\\ndar zu so lyd ich man-ger-hand daz geb mir got zu gu-te\\nWas ich nu tun daz wil-der welt mit fu-gen e-ben\\nein yg-lich man der züg mich gern nach si-nes sel-bes m[u]-te\\nUnd daz en-mag doch nit ge sin\\nwann die na-tur ist vn-ge-lich wer wolt daz an-ders ma-chen\\nWas ÿ-mant hat daz ist nit myn\\ndaz myn alz we-nig ÿ-mand ist d[a]z wolt got al-so sa-chen\\nDer ein ist rich der an-der der muß och we-sen arn\\nder dryt da heym der vier-de muß ins el-lend farn\\nden funf-ten has-set y-der man in dyr-re zyt\\ndem sehs-ten sint die lu̍-de holt got weyß wol wie es dar vmb lyt\"]', '[\"In Brunner nach d transponiert (mit b-Vorzeichnung) \\n\'müte\' wegen Reim \'mute\'\\n\'och\' metrisch überschüssig und nachgetragen\\nBei Brunner: luͤde; eigentlich lu̍de\\nZ. # Korrektur aus a G G F zu d d e; Brunner übernimmt F: möglich, aber die Faktur legt c oder h näher in Analogie zu den anderen Zeilen.\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1351\", \"custos\": \"[3,6,3,2,6,5,1,3,1,5,6,3]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\