(1866, 'Maria muter reine meit (Langer Ton)', 'k Marner Lang', 'Marner', 'German', 'k', 'fol. 447r', 1, 1, '[\"C1F3 F F F G F F G ac \'C2F4\\nc d c h c aG\\nh c-c c h \'C1F3 h a G G\\nF G G \'C1F3 F E E C C\\nC G \'C2F4 G a h c c haG G \'F3 G F E C E F GG \'\\nC2F4 G G G G G a-a a \'C2F4 a a h h a G G\\nG h c \'C2F4 d e d c h c a G G \'\\nC2F4 D E F G F G\\nh c a h \'C2F4 [a] a G G F G F F D E \'C2F4 D C\\nC G G G G a a \'C2F4 a a h a a a GG\\nG h c \'C2F4 d\\nd c h c a G\\nh c c \'C2F4 h c h a G\\nh c c \'C2F4 h h a a G G G G F E F \'C1F3 D CC\\nC G G a h c c haG \'F3 G G F E D E F GGG\",\"C1F3 F F F G F F G ac\\nC2F4 \'c d c h c aG \'h c-c c h\\nC1F3 h a G G \'F G G\\nC1F3 F E E C C \'C G\\nC2F4 G a h c c haG G\\nF3 G F E C E F GG \'\\nC2F4 G G G G G a-a a\\nC2F4 a a h h a G G \'G h c\\nC2F4 d e d c h c a G G \'\\nC2F4 D E F G F G \'h c a h\\nC2F4 [a] a G G F G F F D E\\nC2F4 D C \'C G G G G a a\\nC2F4 a a h a a a GG \'G h c\\nC2F4 d \'d c h c a G \'h c c\\nC2F4 h c h a G \'h c c\\nC2F4 h h a a G G G G F E F\\nC1F3 D CC \'C G G a h c c haG\\nF3 G G F E D E F GGG\"]', '[\"Ma-ri-a mu-ter rei-ne meit\\nros o-ne sun-den dorn\\ndie hey-lig schrift vns von dir seit\\nwir wa-ren al-le gar ver-lorn\\nda halff din kusch vnd got-tes güt vns vs-ser ym-mer wern-der not\\nWir sint in arg-ger zyt be-reit\\nmilt vns den go[]t-t[e]z zorn\\ndan son dir nym-mer nit ver-seit\\nder hel-le wirt hat es ge-sworn\\ner woll vns werf-fen e-wic-lich all in den ym-mer wern-den tot\\nNu bitt got vnd ge-büt dem ein gi-bor-nen so-ne din\\ndaz er vns hie nit lass al-so ver-wy-set sin\\ndorch sol-cher freu-den kunft\\nsit er zu trost ge-sen-det hat sins to-des vr-stend in ver-nunft\\nVnd er den grym-men tot mit si-nem tod vor vns her-slug\\nvnd ab uns zwüg\\nder sun-den vn-ge-fug\\ndie sich die ment-scheit vff ir trug\\ndaz was der cris-ten-heit zu tröst von y-rem schop-fer me dann gnug\\ndaz er sich zu der mar-tel sin hie fur vns an daz cru-cze bot\"]', '[\"Z. zwei c kleiner\\nIn erster Zeile im Steg nach Brunner aa\\nInklusive Taktstrichen/Markierungen\\nZ. 3 cc ergänzt dadurch eine Silbe zu viel (?)\\nZ. 9 eher \'din\' als \'dan\' (Brunner)\\nZ. 11 a-a: zweite Note ohne cauda\\nZ. 12 \'al\' und \'all\' in neuer Zeile, letzteres überflüsslig\\nZ. 14 Ergänzung a nach Brunner\\nZ. 19 Korrektur h zu c durch Überschreiben?\\nZ. 20 \'tröst\' trost?, gnug gnuog?\\nZ. 21 martel?\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/899\", \"custos\": \"[1,4,5,4,6,4,5,2,9,5,9,5,2,4,4,9,4]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"2\", \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": false, \"RepetitionPattern\": \"ABCDEABCDE\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1867, 'Do got der herr (Grauer Ton)', 'k Regb Grauer Ton', 'Regenbogen', 'German', 'k', 'fol. 308r', 1, 1, '[\"C1F3 FCFacaFG a F F\\nF F c \'C1F3 c\\nc d c c h c\\nF F \'C1F3 F G F F D FC\\na \'C1F3 h c c h c\\na h c \'C1F3 c h h a GF\\nF a h c \'C1F3 a G F-G G F FEF\\nF \'F3 C C F F a a a a G \'C1F3 F G F FEF\\nF a a h \'C2F4 hc c c c d c c h c \'\\nC2F4 a h c c h c a GF\\nF \'F2 F F G F E D E D DCD\",\"C1F3 FCFacaFG a F F \'F F c\\nC1F3 c \'c d c c h c \'F F\\nC1F3 F G F F D FC \'a\\nC1F3 h c c h c \'a h c\\nC1F3 c h h a GF \'F a h c\\nC1F3 a G F-G G F FEF \'F\\nF3 C C F F a a a a G\\nC1F3 F G F FEF \'F a a h\\nC2F4 hc c c c d c c h c \'\\nC2F4 a h c c h c a GF \'F\\nF2 F F G F E D E D DCD\"]', '[\"Do got der herr\\nzu ra-te ging\\nin sinr dri-ual-ti-keit\\nwie er die ment-scheit nem an sich\\nder vat-ter sprach in zorn\\nge-na-de sol im we-sen ferrẹ\\nsit er ge-broch-en hat daz myn ge-bot\\nDer son der sprach\\no-we der fart\\ner ist an in ge-leit\\ndaz ru-wet ser von her-czen mich\\nvnd solt er sin ver-lorn\\nee wolt ich ly-den vn-ge-mach.\\nDurch si-nen wil-len ha-ben schand vnd spot\\nDa sprach zu in der hei-lig geist so wer ich vn-ge-muͦt\\nVnd solt der mentsch ver-lorẹn sin nuͤ ho-rent my-nen rat\\nob es uch bey-de tuch-te guͦt\\nSo lo-sen wir die vn-ser hant-ge-tat\"]', '[\"FC bei Brunner in Zeile 3 nicht ediert (?); wie in DKL (Lütolf, Geistliche Gesänge des deutschen Mittelalters) 156\\n\'ge-broch-en\' Silbenaufteilung wie in k\\nZ. 1, Silbe 4: Text und Ton wohl unmittelbar nachgetragen \\nSystem 8: Notenschlüssel unsauber geschrieben\\nIm Abgesang Striche nach Versenden nur im Text, nicht im Notensystem\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/621\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \