(1868, 'Den vier elmenten gab zu sture (Grundweise)', 'k Regb Grundweise', 'Regenbogen', 'German', 'k', 'fol. 432r', 1, 1, '[\"C1 hc d d c G G E \'F3 F D\\nD D F G a a \'C2 a GFE\\nE D D a h c \'C2 a aGa\\nc-d e e d h a F \'C1 FD D\\nD D D F G a a GFE\",\"C1 hc d d c G G E\\nF3 F D \'D D F G a a\\nC2 a GFE \'E D D a h c\\nC2 a aGa \'c-d e e d h a F\\nC1 FD D \'D D D F G a a GFE\"]', '[\"Den vier el-men-ten gab zu stu-re\\ngot vnd sin wol trech-ti ger funt\\nErt-rich luft was-ser vn-de fu-re\\ndez ment-schen hercz hant gar en-zunt\\nDer er-ste ment-sche hieß a-dam\\nGot schuff vß ym-me so ge hu-re\\nein schö-neß bild e-ua er nam\"]', '[\"System 4, Silbe 9: Korrektur E zu F durch Überschreiben\\nCustos nur nach dem ersten Notensystem und mit klobiger Graphie\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/869\", \"custos\": \"[]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": 2, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"ABAB\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1870, 'Ewiger starker hoher almechtiger got (Briefweise)', 'k Regenb 1', 'Regenbogen', 'German', 'k', 'fol. 244r', 1, 1, '[\"C2 D D F a a \'C1 b _h _h a _h a a\\na \'C1b} _h _h _h a _h a G F a F \'C1b} D\\nG _h a _h a _h a \'C2 G E G E C\\nD D F \'C2b} a a _h _h a\\nG a F D D \'C2 E D\\nDF F F F F \'C1 F E D D E D\",\"C2 D D F a a\\nC1 b _h _h a _h a a \'a\\nC1b} _h _h _h a _h a G F a F\\nC1b} D \'G _h a _h a _h a\\nC2 G E G E C \'D D F\\nC2b} a a _h _h a \'G a F D D\\nC2 E D \'DF F F F F\\nC1 F E D D E D\"]', '[\"E-wi-ger star-ker ho-her al-mech-ti-ger got\\nder so-do-ma go-mor sto-ret vnd ne-ret loth\\nVnd der den is-ra-hel-schen gab die ze-hen bot\\ndie liech-te sonn er stil-le hilt\\nbiß jo-su-e sich ro-che\\nNam ab den vin-den sin ich weß wol d[a]z du bist\\nDer küng ein kung der göt ein got seit mir myn list\\nW[a]z nu der kun-ge vnd der key-ßer nach dir ist\\ndaz ist doch al-lez gar ein nicht\\ngein din r[ic]h-er wel-te sproche\\nDer göt ein got der kung ein kung al-ech-tig\\nDer hern ein herrẹ al-so bi-stu u-ber all ding\\ndin an-be-gyn-ne hat ie we-sen-den vr-spring\\ndu bist fur a-ne-gen-ge de[s] an-fan-ges ring\\nder er-sten sach ie we-send got\\nder ym-mer ist be-trech-tig\"]', '[\"Brunner: richer weltẹ spr[o]che\\nde[s] \\nDer dritte Stollen ist nicht unterlegt, sondern durch folgende Rubrik angezeigt: der drit stoll alz die ersten zwey.\\nDie erste Note könnte nachgetragen sei, da sie unmittelbar unter den Notenschlüsseln und quasi innerhalb des unterlegten Textes notiert ist.\\nSystem 6 Korrektur von F3 zu F4 mitsamt roter Notenlinie \", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[4,2,7,4,5,8,7]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"\", \"TextFontOld\": 0, \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": 2, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 0, \"MelodicStructure\": true, \"RepetitionPattern\": false, \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1871, 'Solt ich mit hohen fursten geuden (Langer Ton)', 'k Regenb Langer Ton', 'Regenbogen', 'German', 'k', 'fol. 333r', 1, 1, '[\"F3 FED C D \'F2 F F FD E \'F3 F F\\nG a a a G G F E \'F3 D C D F\\nF F E D C D F \'F3 F\\nF F E C D F E F \'F3 D DC C\\nC C D F F F D F \'\\nF3 F G a a G a F E F G F \'\\nF3 F F E F D E D DC\\nC D \'F3 C D F F\\nE F E F D E D \'F3 D C C\\nC C C C C D C \'F3 C\\nE F E F D E D D C \'F3 C\\nC C C C C D C C\\nE \'F2 F E F D E D D C C \'\\nF3 C C C C C D C C\\nE F E \'F3 F D E D D C C\\nF F G \'F3 a G a F FEF\\nG G F F D E \'F3 D C D FEF\",\"F3 FED C D\\nF2 F F FD E\\nF3 F F \'G a a a G G F E\\nF3 D C D F \'F F E D C D F\\nF3 F \'F F E C D F E F\\nF3 D DC C \'C C D F F F D F \'\\nF3 F G a a G a F E F G F \'\\nF3 F F E F D E D DC \'C D\\nF3 C D F F \'E F E F D E D\\nF3 D C C \'C C C C C D C\\nF3 C \'E F E F D E D D C\\nF3 C \'C C C C C D C C \'E\\nF2 F E F D E D D C C \'\\nF3 C C C C C D C C \'E F E\\nF3 F D E D D C C \'F F G\\nF3 a G a F FEF \'G G F F D E\\nF3 D C D FEF\"]', '[\"Solt ich mit ho-hen fur-sten g[e]u-den\\nvor war daz muͤs-te sin der en-gel gab-ri-el\\nmi-cha-hel ra-pha-hel der wyss\\nher o-ri-el mer-ckent die vier gar scho-ne\\nGot in ge walt in e-wig freu-den\\ngab da dem dien-ten sie fruͤ vn-de spat so snel\\nsie wa-ren in dem pa-ra-dys\\nda so-ci-i ge-sel-len in dem tro-ne\\nA-do-na-y got a-y-gos\\nde-us me-us mit got ob al-len din-gen\\ndar u-ber schri-bet vns die gloss\\ne-ma-nu-el na-the-us ich wil sin-gen\\ndaz al-le-lu-ia spri-chet lob\\nsa-both sy dir ge-seit\\nwaz gro-ßer pin er an dem cru-cze leit\\nvnd kuͤnd dich vß der gul-din smyt\\nein lopt ge-tich-ten zu der e-wi keit\\nnu bin ich an der kun-ste lyt\\nmit mein-ster-schef-ten leyd-er vn be-reit\\no-san-na ist so suß ein nam\\nder sch fur vns barg in ein rei-ne meit\\nGe-wal-tig al-len din-gen ob\\nNu hilff vns dar da sich din kraft be-reyt\"]', '[\"Brunner: g[e]uden\\nvor-[war]: \'war\' nachgetragen\\nIst \'meinsterscheften\' mit i[n]-Abbreviatur wirklich korrekt, oder nicht eher ein Schreibfehler?\\nBrunner: mit (meinsterscheften) G statt e bei prima volta; warum?\\n\\nDas Notensystem der Zeile mit F2-Schlüssel hat nur vier Notenzeilen.\\nDas letzte System weist keinen Notenschlüssel auf, jedoch die rubrizierte F3-Notenzeile\", \"\"]', NULL, 1, 31),
(1872, 'Mary du bist daz bernde ryß (Wiener Hofton)', 'k Walth Ton III', 'Walther von der Vogelweide', 'German', 'k', 'fol. 734r', 1, 1, '[\"C1 h c c h a G a h \'C1\\nG a h c G a F F-E\\nF-D \'C1 a a c G a G F ED C C \'\\nC2 C G G G G a G F G \'C1 a G\\nG h c d h c a \'C1 GF E\\nC E F G E F \'C1 D C\\nC E F G G G \'C1 G F G a G\\nG G F E-F G \'F3 EF G\\nG G G F E FG a \'C1 G\\nG a h c a-G G D \'C1 E\\nc c c c h c [c] h a \'F2 h GFE\\nC C C G D E C C\",\"C1 h c c h a G a h\\nC1 \'G a h c G a F F-E \'F-D\\nC1 a a c G a G F ED C C \'\\nC2 C G G G G a G F G\\nC1 a G \'G h c d h c a\\nC1 GF E \'C E F G E F\\nC1 D C \'C E F G G G\\nC1 G F G a G \'G G F E-F G\\nF3 EF G \'G G G F E FG a\\nC1 G \'G a h c a-G G D\\nC1 E \'c c c c h c [c] h a\\nF2 h GFE \'C C C G D E C C\"]', '[\"Ma-ry du bist daz bern-de ryß\\ndaz a-dam vß dem pa-[ra]-dyß\\nge sen-det wart zu ei-ner helf-fe stu-re\\nMa-ry du bist daz le-bend zwy\\ndaz noe macht ma-chet ley-dez fry\\ndo in ver-ließ daz was-ser vn-ge-hu-re\\nMa-ry du bist daz kin-de-lin so clei-ne\\ndaz op-fert ab-ra-ham der rei-ne\\ngottẹ der ym die be-sny-du[n]g gab\\nMa-ry du bist die ta-fel lo-be-li-che\\ndar ynn die .x. bot so fron\\nge-schy-ben wor-den al-so schon\\ndie moy-ses sy-der nam dar ab\\nMa-ry du bist die cro-ne [die] her-li-che\\ndie da-uid trug biß in sin grab\"]', '[\"Federstriche und Graphien zu überarbeiten!\\n\\nZ. 2 Korrektur G zu F bei \'pa[ra]dys\'\\n.x. = zehn oder ze-hen EF oder E-F\\n\'fron\' überschrieben, \'schon\' durchgestrichen\\nZ. 13 letzter Ton E fast wie F notiert\\nV. 14 metrisch unterfüllt, Brunner schlägt [die] vor und eine Silbe vorher [c]\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/canvas/1475\", \"custos\": \"[4,3,8,5,4,7,null,6,4,6,2]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://api.digitale-sammlungen.de/iiif/presentation/v2/bsb00105055/manifest\", \"MsLineBreaks\": true, \"NotationType\": 2, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": false, \"RepetitionPattern\": \"ABCABC\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1877, 'Drivaltich name der goteheit krist', 'J Gerv 1', 'Gervelin', 'German', 'J', 'fol. 31r-31v', 1, 1, '[\"C3 f +a g \'C3 ge ef gfe f ed\\nef g c dcb \'C2 c abaG GF\\n- c c d cb d efed ec \'C2 b} b ab c a ba Ga a\\nC3 f +a \'C3 g ge ef gfe f ed\\nef g c \'C2 b} cba c abaG GF\\nc c c d \'C2 cb d efed ec b a b c \'C2 aba Ga a\\na c dcb d efed \'C2 ec b} b ab cb aG a GF F\\nf \'C3 +a g ge/ ef gfe f ed d \'\\nC3 ef g c b} dcb c abaG [GF\\nc c c \'C2 d cb] d efed fc b} b ab c \'C2 a ba Ga a\",\"C3 f +a g\\nC3 ge ef gfe f ed \'ef g c dcb\\nC2 c abaG GF \'- c c d cb d efed ec\\nC2 b} b ab c a ba Ga a \'C3 f +a\\nC3 g ge ef gfe f ed \'ef g c\\nC2 b} cba c abaG GF \'c c c d\\nC2 cb d efed ec b a b c\\nC2 aba Ga a \'a c dcb d efed\\nC2 ec b} b ab cb aG a GF F \'f\\nC3 +a g ge/ ef gfe f ed d \'\\nC3 ef g c b} dcb c abaG [GF \'c c c\\nC2 d cb] d efed fc b} b ab c\\nC2 a ba Ga a\"]', '[\"Dri-val-tich namẹ der go-te-heit\\nkrist so bis-tu ge-nen-net.\\n _ Al-le men-schen tzvn-gen kvn nen dir nicht vol-len lo-ben.\\nDv has ge-walt. wit. vn-de breit.\\nDin sin durch grift ir ken-net.\\nWaz in der erdẹ vuͦr bor-gen ist in hymẹl-richẹ vndẹ da o-ben.\\nDaz hoes-te lob sol man dem edẹ-len kvnnị-ge ge-ben.\\nEr ist ein lebẹn. Dem nicht ist ne-ben\\nDaz sich ym mv̊-ge gẹli-chen\\nal sy-ne werc durch recht sulẹn al der werl-de wol ir tze-men\"]', '[\"System 10, Silbe 3, 4, 5 Korrektur von e f gfe zu ef gfe f\\nSystem 10 ggf. um eine Sekunde transponiert?\\nSystem 8, Silbe 1 \'ouch\' gestrichen\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_031r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": 0, \"ZoomFacsimile\": 170, \"FontSizeModern\": 19, \"TextFontModern\": 1, \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31);
