(1881, 'Golt von arabye ist guͦt', 'J Fegf 1', 'Fegfeuer', 'German', 'J', 'fol. 35r-35v', 1, 1, '[\"C1 - a a a b a G G/ \'C1 a G F F F EC D\\nD \'C1 D E G G G G G/ \'C1 a G E F E D D\\nE \'C1 G C D E G/ G a G E \'C1 F F F EC D\\na a \'C1 a a _h a G G/ a G F \'C1 E F EC D\\nD D E G G \'C1 G G G/ a G E F E \'C1 D D\\nE G C D E G/ \'C1 G a G F F F F EC D \'\\nC1 - a a b aG FE D G/ - \'C1 F G a GF G G\\na b a \'C1 G G FE D G/ F F \'F2 F F F EC D\",\"C1 - a a a b a G G/\\nC1 a G F F F EC D \'D\\nC1 D E G G G G G/\\nC1 a G E F E D D \'E\\nC1 G C D E G/ G a G E\\nC1 F F F EC D \'a a\\nC1 a a _h a G G/ a G F\\nC1 E F EC D \'D D E G G\\nC1 G G G/ a G E F E\\nC1 D D \'E G C D E G/\\nC1 G a G F F F F EC D \'\\nC1 - a a b aG FE D G/ -\\nC1 F G a GF G G \'a b a\\nC1 G G FE D G/ F F\\nF2 F F F EC D\"]', '[\"_ Golt von a-ra-byẹ ist guͦt. Daz darb ouch ne-man stra-fen.\\nSwe_lịch her-re tugẹnt vndẹ wer-di-cheit von kyn-de hat vuͦr sla-fen.\\n_ Kant ich in by na_mẹn ich woltẹ in schel-ten daz iz klvn-ghe.\\nSwelịch her_rẹ syn ou-gen ny-der slet. Als ich yn scho-ne gruͦ-ze.\\nIch we-ne syn vuͦr tral-tez guͦt myr sel-ten kvm-mer buͦ-ze.\\nVnd sin lob hyn-der werẹ tzv̊ mez-zen ich vil ger-ne svn-ge\\n_ Rat vnd erẹ ie was vil gut. _ Vndẹ dar tzv̊ ge-ne-me.\\nA-ber wer guͦt myt schan-den spart des lob ist wi-der tze-me.\"]', '[\"System 3, Silbe 3 Rasur G\\nSystem 5, Silbe 2 Korrektur D zu C\\nSystem 5, Silbe 7/8 Rasur G\\nSystem 6, Silbe 3 Korrektur a zu G\\nSystem 6, Silbe 6, 7 Korrektur a (a) zu G G\\nSystem 12, Silbe 3/4 Rasur a\\nSystem 13, Silbe 9 Korrektur b zu a\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_035r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"An