(1885, 'Swer da gerne ritter wirt', 'J Henneb 1', 'Henneberger', 'German', 'J', 'fol. 36v-37r', 1, 1, '[\"C1 c d ch a \'C1 aG a GF D F F FG a GF \'\\nC1 FG a a a G a G-F \'C1 F(E) D FG FED FC\\nC D F FG \'C1 a a GF F G GF F \'\\nC1 c d ch a a Ga GFE D \'C1 FG aG GF\\nFG a a a \'C1 G a GF F D F FED FC\\nC \'C1 D F FG a a GF F G GF \'C1 F\\nF D F FG FED \'C1 CD F FC\\nC D F FG a \'C1 a GF F G GF F\\nc \'C1 c d ch a aG a GF\\nD \'C1 F F FG a a GFED CD F \'C1 FC C\\nC D F F aG \'C1 F F Ga GF D F FG \'C1 FED CD F FC\\nC D F F aG F \'C1 F Ga GF D F FC D F \'C1 F Ga GFED EF\",\"C1 c d ch a\\nC1 aG a GF D F F FG a GF \'\\nC1 FG a a a G a G-F\\nC1 F(E) D FG FED FC \'C D F FG\\nC1 a a GF F G GF F \'\\nC1 c d ch a a Ga GFE D\\nC1 FG aG GF \'FG a a a\\nC1 G a GF F D F FED FC \'C\\nC1 D F FG a a GF F G GF\\nC1 F \'F D F FG FED\\nC1 CD F FC \'C D F FG a\\nC1 a GF F G GF F \'c\\nC1 c d ch a aG a GF \'D\\nC1 F F FG a a GFED CD F\\nC1 FC C \'C D F F aG\\nC1 F F Ga GF D F FG\\nC1 FED CD F FC \'C D F F aG F\\nC1 F Ga GF D F FC D F\\nC1 F Ga GFED EF\"]', '[\"Swer da ger-ne rit-ter wirt myt ho-er wir-di-cheyt.\\nDer legẹ die tugẹnt an sich vuͦr_daz al-ler hoe-ste kleit.\\nVnd la-ze daz die kvnị-ge vur-sten scou-wen\\nUnd dar tzv̊ den bes-ten vnd swerz se-hen wil.\\nSo wirt ym lob vnd da by ste-ter e-ren vil.\\nOuch lo-bent yn die tu-gent-haf-ten vrou-wen.\\nDaz swert nem er durch rit-ters tat.\\nDaz er sich wer vuͦr svn-den vnd vuͦr schan-den.\\nHer myn-ne got habẹ rech-ten rat.\\nSo wirt syn lob ge-hoet an al-len lan-den.\\nDen schild nem er durch rech-ten vridẹ so daz her deckẹ vuͦr mys-se-tat.\\nVnd ha-be rit-ter-li-chez lebẹn so wiz-zent daz sin lob die vol-ge hat.\"]', '[\"System 13, Silbe 3 Korrektur d zu ch\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_036v.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,nul