(1886, 'Hie vuͦr eyn werder ritter lac', 'J Guter 1', 'Der Guter', 'German', 'J', '38r-38v', 1, 1, '[\"F2 C E F \'F2 G a G GFEF ED\\nE G G G(F) \'F2 E D C FE\\nD C C DC \'F2 HA H C C\\nC E F G a \'F2 G GFEF ED\\nE G G G(F) E \'F1 D C FE\\nD C C DC \'F2 HA H C C\\nFE D \'F1 C DC BA H C C\\nC \'F2 E F G a G GFEF ED\\nE G \'F2 G G EF ED C C\\nFE D C DC \'F1 BA B C D/ *G C C \'F1 FE FE D C C\",\"F2 C E F\\nF2 G a G GFEF ED \'E G G G(F)\\nF2 E D C FE \'D C C DC\\nF2 HA H C C \'C E F G a\\nF2 G GFEF ED \'E G G G(F) E\\nF1 D C FE \'D C C DC\\nF2 HA H C C \'FE D\\nF1 C DC BA H C C \'C\\nF2 E F G a G GFEF ED \'E G\\nF2 G G EF ED C C \'FE D C DC\\nF1 BA B C D/ *G C C\\nF1 FE FE D C C\"]', '[\"Hie vuͦr eyn wer-der rit-ter lac.\\nTot siech da an dem bet-te syn.\\nSo scho_nẹ eyn vrou-we vuͦr ym ge.\\nDaz er so ho ir scho-ne wac.\\nSie hattẹ vuͦr al-len wi-ben schyn.\\nHer_nẹ sach ouch scho ner vrou-wen nye.\\nSie stvnt vuͦr ym vndẹ sprach nv sagẹ.\\nGuͦt rit-ter wie ich dir be-ha_gẹ.\\nDu has ge die-net vli-zich myr.\\ngar dy-ne tagẹ. Nv byn ich komẹn vndẹ wil nach to-dhe lo-nen dyr.\"]', '[\"Zusätzlicher C-Schlüssel in System 3  auf der dritten Notenzeile und in System 7 auf der vierten\\nSystem 5, Silbe 2: Korrektur FE zu GFEF\\nSystem 10, Silbe 3 Rasur F ggf. Korrektur zu bleibendem EF\\nSystem 11, Silbe 5: Rasur A, Korrektur *G\\nKonjekturen:\\nZeile 2, Silbe 2-3: schonẹ mit zwei C, jedoch metrisch nur eine Silbe\\nZeile 8, Silbe 9: überflüssig, wohl \'be-hagẹ\' anzusetzen\", \"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_038r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": 0, \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"facsimileX\": 0, \"facsimileY\": 0, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": 1, \"IIIFManifest\": \"https://col