(1905, 'Je chantasse volentiers liement', 'Linker 38.6', 'Chastelain de Coucy', 'French', 'a', '12r', 1, 1, '[\"C4 g f g +a f g ed c d cch \'\\nC4 a c c c c h aG a \'C4 c c\\ng f g +a g e \'C4 e c d ch\\nha h c de \'C4 d ch aG a ahc h\\ne f \'C4 edc d e fg fed ed ch c\\ne f \'C4 g+a gfe e c feed c\\naGa a h ch \'C3 ha ha GF a h chc d\\ne f gg(f) \'C4 edc c h e f g+ag edcha\\nG \'C3 h haG h a h c dcha chha G\",\"C4 g f g +a f g ed c d cch \'\\nC4 a c c c c h aG a\\nC4 c c \'g f g +a g e\\nC4 e c d ch \'ha h c de\\nC4 d ch aG a ahc h \'e f\\nC4 edc d e fg fed ed ch c \'e f\\nC4 g+a gfe e c feed c \'aGa a h ch\\nC3 ha ha GF a h chc d \'e f gg(f)\\nC4 edc c h e f g+ag edcha \'G\\nC3 h haG h a h c dcha chha G\"]', '[\"Je chan-tas-se vo-len-tiers li-e-ment,\\nse je trou-vas-se_en mon cuer l\'a-coi-son,\\nmais jou ne puis di-re, se jou ne ment,\\nk\'ai-e d\'a-mours nu-le riens s\'i-re non;\\npour che ne puis fai-re li-e can-chon\\nk\'A-mours le me de-sen-sei-gne,\\nki veut que j\'aim et ne veut que j\'a-tai-gne;\\nen-si me tient A-mours en de-ses-poir,\\nke ne m\'o-chist ne me laist joi-e_a-voir.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0031\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
