(1907, 'La douche vois du lourseignol sauvage', 'Linker 38.7', 'Chastelain de Coucy', 'French', 'a', '13r', 1, 1, '[\"F3 C D E FED D a ah \'F3 a Gah aGGF GFED\\nA-C D C DE \'F3 a FG FED DC CD D\\nC D E \'F3 FED D a ah a Gah aGGF GFED\\nA \'F3 HA HC D a Fa FED DC CD \'F3 D\\nc d cch aG G G ahc \'C1 h aGF F\\nF a c d d c a GFE FG \'F3 FED C\\nC D F FE Ga ah a- \'F3 a GFE FG FED D\\nC D F Ga aG \'F2 F EDE C DE GFFED\",\"F3 C D E FED D a ah\\nF3 a Gah aGGF GFED \'A-C D C DE\\nF3 a FG FED DC CD D \'C D E\\nF3 FED D a ah a Gah aGGF GFED \'A\\nF3 HA HC D a Fa FED DC CD\\nF3 D \'c d cch aG G G ahc\\nC1 h aGF F \'F a c d d c a GFE FG\\nF3 FED C \'C D F FE Ga ah a-\\nF3 a GFE FG FED D \'C D F Ga aG\\nF2 F EDE C DE GFFED\"]', '[\"La dou-che vois du lour-seig-nol sau-va-ge\\nk\'oi nuit et jour coin-toi-er et ten-tir\\nme ra-dou-chist mon cuer et ra-sou-a-ge,\\nlor ai ta-lent que kant pour es-bau-dir;\\nbien doi can-ter puis qu\'il vient a plai-sir\\nce-li qui j\'ai de cuer fait li-ge_hou-ma-ge;\\nsi doi a-voir grant jo-ie__en mon co-ra-ge,\\ns\'e-le me veut a son oés re-te-nir.\"]', '[\"Dubbi:\\n6.9-10 e 7.7: sinalefe con a capo\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0033\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
