(1913, 'Merchi clamans de mon fol errement', 'Linker 38.10', 'Chastelain de Coucy', 'French', 'a', '15r', 1, 1, '[\"C3 h c d d e ec \'C3 def e ed dc\\nd e d c a c \'C3 h hG ah c\\nh c d e e ec \'C3 def e ed dc\\nd e d cch a c \'C3 h hG ah c\\nd e dch \'C3 c c g f e ed dcd \'\\nC3 f e d efg ffe e d c \'C2 h aGa\\na c c d e dc \'C3 g f g+age e\\ng e f \'C3 edc de dch cd d edch c\",\"C3 h c d d e ec\\nC3 def e ed dc \'d e d c a c\\nC3 h hG ah c \'h c d e e ec\\nC3 def e ed dc \'d e d cch a c\\nC3 h hG ah c \'d e dch\\nC3 c c g f e ed dcd \'\\nC3 f e d efg ffe e d c\\nC2 h aGa \'a c c d e dc\\nC3 g f g+age e \'g e f\\nC3 edc de dch cd d edch c\"]', '[\"Mer-chi cla-mans de mon fol er-re-ment,\\nfe-rai la fin de mes can-chons o-ïr,\\ncar tra-ï m\'a et mort a en-si-ent\\nmes jo-lis cuers que jou tant doi ha-ïr;\\nche mal m\'a fait pour le gré d\'au-tre gent.\\nTout sont de moi par-ti joi-ous ta-lent,\\net qant joi-e me faut, bien est rai-sons\\nk\'a-veuc ma joi-e fail-lent mes chan-chons.\"]', '[\"\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0037\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1919, 'Coument ke longue demeure', 'Linker 38.4', 'Chastelain de Coucy', 'French', 'a', '15v', 1, 1, '[\"C3 g g fed c de \'C3 f edc dd(e)\\nf g fed e cha ahc d \'\\nC3 g g fed c de f eedc dd(e)\\nf g \'C3 ed e(d) chaG c-ded dcch\\nc ha \'C3 haG c de f edde\\ng e f e ed \'C3 c d\\ne fgfe ec dh - ded hG \'\\nC2 c ha c de f dch hG ahch \'\\nC3 ha aG\",\"C3 g g fed c de\\nC3 f edc dd(e) \'f g fed e cha ahc d \'\\nC3 g g fed c de f eedc dd(e) \'f g\\nC3 ed e(d) chaG c-ded dcch \'c ha\\nC3 haG c de f edde \'g e f e ed\\nC3 c d \'e fgfe ec dh - ded hG \'\\nC2 c ha c de f dch hG ahch \'\\nC3 ha aG\"]', '[\"Cou-ment ke lon-gue de-meu-re\\nai-e fai-te de can-ter,\\nor est bien rai-sons et eu-re\\nque je me doi-ve_a-tour-ner,\\nk\'a-mours m\'a fait ou-bli-er\\nl\'a-nui qui lon tans m\'a mort,\\net dou-né nou-vel con-fort;\\nda-me, pour qi chant et de-port,\\nmer-chi.\"]', '[\"Notes:\\n7.5 missing notation.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0038\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1920, 'Humilites et franchise', 'Linker 73.13', 'Gautier de Dargies', 'French', 'a', '16r', 1, 1, '[\"C3 a ha hc d defe ed dch h\\naG \'C3 a aGF a cd chaGF G\\nG h ahc d defe-ed dch h \'C3 h\\nahch ha aGF cd chaGF GF F\\nF a chha c \'C3 cded c cha\\nc de dh G G G aGGF G \'\\nC3 c ha-hcd c ha-hcd c c haG G \'\\nC3 d defg ed dh dedch ch h\\na dch h \'C3 hcde dch haG G\",\"C3 a ha hc d defe ed dch h \'aG\\nC3 a aGF a cd chaGF G \'G h ahc d defe-ed dch h\\nC3 h \'ahch ha aGF cd chaGF GF F \'F a chha c\\nC3 cded c cha \'c de dh G G G aGGF G \'\\nC3 c ha-hcd c ha-hcd c c haG G \'\\nC3 d defg ed dh dedch ch h \'a dch h\\nC3 hcde dch haG G\"]', '[\"Hu-mi-li-tes et fran-chi-se,\\ndou-çors, de-bo-ne-re-tes\\nest bien a-lé-e_et re-mi-se,\\net or-gues et cru-e-tes\\nest rep-ris et rau-ci-nes\\net a-mours mout e[n-tre]-pri-se;\\nje m\'en plaing pour mon ser-vi-che,\\nqui m\'en est tant de-mou-res\\nque je cuit qu\'il est re-mes.\"]', '[\"Notes: \\n1.2: <i>humulites</i> in the manuscript.\\n2: <i>et doucors et deboneretes</i> in the manuscript. The amendment is required by metrical reasons. \\n5.7: <i>emprise</i> in the manuscript. The integration is required by metrical reasons.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0039\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1923, 'Chanson ferai mult maris', 'Linker 73.7', 'Gautier de Dargies', 'French', 'a', '16r-v', 1, 1, '[\"C2 d dcha ahc haG d dch \'C3 h\\nh ahcdcha a aGF a ahcha h \'\\nC3 d dchaG Ga h ch cha aG\\nGa \'C3 h dedc ha\\nd d efg g gfed c gfe e \'\\nC3 e edefgfd d hG ah dch aG GFG \'\\nC3 GahaG ah h G d dch ha Gah chha \'C3 aG\",\"C2 d dcha ahc haG d dch\\nC3 h \'h ahcdcha a aGF a ahcha h \'\\nC3 d dchaG Ga h ch cha aG \'Ga\\nC3 h dedc ha \'d d efg g gfed c gfe e \'\\nC3 e edefgfd d hG ah dch aG GFG \'\\nC3 GahaG ah h G d dch ha Gah chha\\nC3 aG\"]', '[\"Chan-son fe-rai mult ma-ris\\nd\'a-mours qui tant seut va-loir;\\nfaus l\'ont lais-sié de-ch[a]a-oir,\\ns\'en est pe-ris\\nli mons et vain-cus et fail-lis;\\ndrois est, puis qu\'a-mours n\'a po-oir,\\nque-li sie-cles ne puist mais riens va-loir.\"]', '[\"v. 3 dechaoir] dechaaoir\\nDubbi:\\nv. 6 est puis\\nv.7: punto dopo puist\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0039\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1924, 'La gens dient pour qoi jou ne fai cans', 'Linker 73.17', 'Gautier de Dargies', 'French', 'a', '16v-17r', 1, 1, '[\"C3 c a ahc dedc G C2 E F D \'C2 E C\\nC D DEG a aaG FED \'C2 C D EFG FE\\nD E F G h c \'C2 ha ha aG ah\\nd d d e d c \'C2 a hc d(c) ch\\nhcdc aF GFFE \'C2 EF D D EF a ha haFD\\nEFGaG c \'C2 dcch a c e d c h cha\\na haG \'C2 F GFE D a a haG F \'C2 GFE\\na a h haG h d c-c d ca \'C2 h\\nG FG a a G ahc ha h \'C2 G(a) GFED\",\"C3 c a ahc dedc G C2 E F D\\nC2 E C \'C D DEG a aaG FED\\nC2 C D EFG FE \'D E F G h c\\nC2 ha ha aG ah \'d d d e d c\\nC2 a hc d(c) ch \'hcdc aF GFFE\\nC2 EF D D EF a ha haFD \'EFGaG c\\nC2 dcch a c e d c h cha \'a haG\\nC2 F GFE D a a haG F\\nC2 GFE \'a a h haG h d c-c d ca\\nC2 h \'G FG a a G ahc ha h\\nC2 G(a) GFED\"]', '[\"La gens di-ent pour qoi jou ne fais cans\\nplus le-giers et mil-lours a re-te-nir;\\nmais ne se-vent q\'A-mours mi fait sen-tir:\\ncar de chu lieu u l\'a-mours est plus grans\\nes-tuet mo-voir les chans fors et pe-sans;\\nqui mains ai-me, de lui con-vient ve-nir\\nles foi-bles chans que chas-cuns puet fur-nir;\\nqui ne le set, de-man le_a fins a-mans,\\ns\'a-mour est si ver-tu-eus et pois-sans.\"]', '[\"Notes:\\n7.10: <i>furiir</i> in the manuscript.\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0040\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1925, 'Desque chi ai tous jours chanté', 'Linker 73.9', 'Gautier de Dargies', 'French', 'a', '17r-v', 1, 1, '[\"C2b} a c c cb cded dc \'C2b} ccb aGFGa\\na c c cbaGF abc aF \'C2 Gah haG a aF\\nF F FGaGF FE \'\\nC2b} F Ga bc aG b cd baG ab \'\\nC3 c d cha G ahc haG aGF G aGF F \'\\nC3b} c d e f gfe e edc a \'C2b} aGF F\\nGaGF FG hchG GF G a \'C3b} b c d e\\nf d b cd \'C3 e c a _GFE F F\",\"C2b} a c c cb cded dc\\nC2b} ccb aGFGa \'a c c cbaGF abc aF\\nC2 Gah haG a aF \'F F FGaGF FE \'\\nC2b} F Ga bc aG b cd baG ab \'\\nC3 c d cha G ahc haG aGF G aGF F \'\\nC3b} c d e f gfe e edc a\\nC2b} aGF F \'GaGF FG hchG GF G a\\nC3b} b c d e \'f d b cd\\nC3 e c a _GFE F F\"]', '[\"Des-que chi ai tous jours chan-té\\nde mult bon cuer fin et loi-al en-tier,\\nn\'ains de chan-ter\\nn\'euc de-dens mon cuer vo-len-té;\\nne ma pai-ne ne m\'i e-üst mes-tier!\\nBien m\'a A-mours a son oes es-prou-vé:\\nre-te-nu m\'a j\'a-mais rien qier lais-sier,\\net si voi jou les plu-sours mais tar-gier.\"]', '[\"Notes:\\n6.8: initially <i>es esprouve</i> in the manuscript for a syllabic doubling. The copist underlined the second in order to correct the mistake.\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0041\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1926, 'Li plusour ont d\'amours chanté', 'Linker 65.47', 'Gace Brulé', 'French', 'a', '18r', 1, 1, '[\"C2 c c c cha c dh \'C2 cd chG\\nF a cd cdc a GFE F(G) \'C2 D\\nc c c cha c dh \'C2 cd chG\\nF a c cdc hG \'C2 F FE D\\nC D E F \'C2 G a baG Ga\\nF a c defe \'C2 d c c(h)c(h) aGF\\nF a c dc \'C2 a F(G) FE D\\nC D E F \'C2 G aG FE D\",\"C2 c c c cha c dh\\nC2 cd chG \'F a cd cdc a GFE F(G)\\nC2 D \'c c c cha c dh\\nC2 cd chG \'F a c cdc hG\\nC2 F FE D \'C D E F\\nC2 G a baG Ga \'F a c defe\\nC2 d c c(h)c(h) aGF \'F a c dc\\nC2 a F(G) FE D \'C D E F\\nC2 G aG FE D\"]', '[\"Li plu-sour ont d\'a-mours chan-té\\npar es-fors et des-loi-au-ment;\\nmais de ce me doit sa-voir gré\\nc\'on-ques nen chan-tai faus-se-ment,\\nma boi-ne fois m\'en a gar-dé,\\net l\'a-mour, dont j\'ai tel plen-té\\nque mer-veil-les_est se jou riens hé.\\nne-ïs ce-le_a-ni-eu-se gent.\"]', '[\"Notes: \\n4.6-7: G GF scraped off and substituted with F FE.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0043\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1927, 'Desconfortes plain de dolour et d\'ire', 'Linker 65.27', 'Gace Brulé', 'French', 'a', '18v', 1, 1, '[\"F3 E F G(F) FE G a a \'F3 GFE F(G) FED E\\nC E E D F EG \'F3 G F F EDC D\\nE F G(F) \'F3 FE G a a GFE F(G) FED E\\nC \'F3 E E D F EG G F \'F3 F(D) EDC D\\nG a ha aG G a h \'F3 aG Gah aG GF\\nF F F EDC D \'F3 EF E D F EDC D\\nC D E \'F3 DCH C-D EFG FE E\\nG a a \'F3 GFE FG EC DEFE ED\",\"F3 E F G(F) FE G a a\\nF3 GFE F(G) FED E \'C E E D F EG\\nF3 G F F EDC D \'E F G(F)\\nF3 FE G a a GFE F(G) FED E \'C\\nF3 E E D F EG G F\\nF3 F(D) EDC D \'G a ha aG G a h\\nF3 aG Gah aG GF \'F F F EDC D\\nF3 EF E D F EDC D \'C D E\\nF3 DCH C-D EFG FE E \'G a a\\nF3 GFE FG EC DEFE ED\"]', '[\"Des-con-for-tes, plain de do-lour et d\'i-re,\\nfe-rai can-çon, k\'ail-lors n\'ai a en-ten-dre.\\nTout le mont voi, fors moi, jou-er et ri-re,\\nne jou ne truis ki d\'a-mours me des-fen-de.\\nCe-le m\'o-cist que mes cuers plus de-si-re,\\ns\'en sui i-ries, qant e-le nen a-men-de.\\nCas-cuns dist k\'il ai-me_au-tre-si,\\npour cou ne con-nois-con a-mi.\"]', '[\"Notes: \\n1: Clef on the first stave missing.\\n8.7: stem of E may be a liquescent note.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0044\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1928, 'Pensis d\'amours vueul retraire', 'Linker 65.56', 'Gace Brulé', 'French', 'a', '19r', 1, 1, '[\"C2h} G a h(a) aG a \'F3 h c(h) aG\\nahaG GF a h c \'C2 h(a) ha G\\nG a h(a) aG a \'C2 h c(h) aG\\nahaG GF a h c h(a) \'C2 ha G\\nd efe d c chc haG \'C2 ahaG GF\\na c d efe d ch(c) \'C2 ha haG\\nF G a h(a) G d(e) dcc(h) ha \'\\nC2 a h c ha G a h(a) aG\",\"C2h} G a h(a) aG a\\nF3 h c(h) aG \'ahaG GF a h c\\nC2 h(a) ha G \'G a h(a) aG a\\nC2 h c(h) aG \'ahaG GF a h c h(a)\\nC2 ha G \'d efe d c chc haG\\nC2 ahaG GF \'a c d efe d ch(c)\\nC2 ha haG \'F G a h(a) G d(e) dcc(h) ha \'\\nC2 a h c ha G a h(a) aG\"]', '[\"Pen-sis d\'a-mour vueul re-trai-re\\ncon-ment li miens cuers me mai-ne,\\nk\'a son plai-sir m\'es-tuet fai-re\\nçe dont j\'ai a-nui et pai-ne;\\ntant me fait ma do-lour plai-re,\\ns\'en tieng a-mours a vi-lai-ne\\nki m\'o-cist en son ser-vi-ce,\\nqui tous sui a sa de-vi-se.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0045\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1930, 'Douce dame gres et grases vous rent', 'Linker 65.31', 'Gace Brulé', 'French', 'a', '19v', 1, 1, '[\"C3 d h c cha h h aGF G \'C3 aG GF\\nF G G Ga \'C2 c h aGF G a haG\\nd h c cha \'C4 h h aGF G aG F\\nF G \'C3 G Ga c h aGF G a haG \'\\nC3 h c d d d d c d \'C3 dc ha\\nh c d d d d c \'C2 d dd(c) haG\\nC3 defg gfed edc chaGF \'C2 ahcd ch aG ahch ha aG\",\"C3 d h c cha h h aGF G\\nC3 aG GF \'F G G Ga\\nC2 c h aGF G a haG \'d h c cha\\nC4 h h aGF G aG F \'F G\\nC3 G Ga c h aGF G a haG \'\\nC3 h c d d d d c d\\nC3 dc ha \'h c d d d d c\\nC2 d dd(c) haG \'C3 defg gfed edc chaGF\\nC2 ahcd ch aG ahch ha aG\"]', '[\"Dou-ce da-me, gres et gra-ses vous rent,\\nqant il vous plaist que gi soi-e_en-voi-sies;\\na-ten-du ai vos-tre cou-man-de-ment,\\nsi chan-te-rai pour vous joi-ans et lies,\\net, s\'il vous plaist, de moi mer-ci a-jies.\\nEn tel gui-se vous en pren-gne pi-ties\\nk\'il ne vous poist, se j\'aim si hau-te-ment.\"]', '[\"Notes:\\n3.5: two clefs on the stave, C-clef on the fourth and F-clef on the fifth line from the top. The F-clef is an apparent mistake.\\n6.6: <i>pous</i> corrected in <i>vous</i>.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0046\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1931, 'En dous tans et en boine eure', 'Linker 65.33', 'Gace Brulé', 'French', 'a', '20r', 1, 1, '[\"F4 F G a a ha ah hc-d d\\nd ca F G F E D \'\\nF4 DCD E C4 a a ha hc d d\\nd \'C2 c aF G a(G) FE D\\nC D F \'C2 F F Ga haG F\\nF a c d \'C2 dc a a F\\nb aG a GFE FGG(F) \'C2 EDC D\",\"F4 F G a a ha ah hc \\nF4 d d \'d ca F G F E D \'\\nF4 DCD E C4 a a ha hc d d \'d\\nC2 c aF G a(G) FE D \'C D F\\nC2 F F Ga haG F \'F a c d\\nC2 dc a a F \'b aG a GFE FGG(F)\\nC2 EDC D\"]', '[\"En dous tans et en boi-ne_eu-re\\nveul re-trai-re ma can-çon.\\nMes-tier m\'est c\'or mi se-ceu-re\\nfaus-se riens, a cuer fe-lon,\\nen qi jou ai m\'a-ten-dan-ce.\\nGar-des con sui em ba-lan-ce\\nqi_en a-tent son guer-re-don.\",\"En dous tans et en boi-ne eu-re\\nveul re-trai-re ma can-çon.\\nMes-tier m\'est c\'or mi se-ceu-re\\nfaus-se riens, a cuer fe-lon,\\nen qi jou ai m\'a-ten-dan-ce.\\nGar-des con sui em ba-lan-ce\\nqi_en a-tent son guer-re-don.\"]', '[\"Notes:\\n5.3: G scraped off and substituted with F.\\n\\n\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0047\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": false, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1932, 'De boine amour et de loial amie', 'Linker 65.25', 'Gace Brulé', 'French', 'a', '20v', 1, 1, '[\"C2 d d d c d e d c \'C2 h aGF Ga\\nc c chc ha c d \'C2 ch h a aGF G\\nd d d c d e \'C2 d c h aGF Ga\\nc c chc ha c \'C2 d ch h a aGF G\\nc d e f \'C3 e d c cd ef(e)f(e) ed\\nd e f \'C3 g g g f e def edc\\nc d \'C3 c fed c d ch h a aGa\\nF G \'C2b} a b d c ba a G GabaF G\",\"C2 d d d c d e d c\\nC2 h aGF Ga \'c c chc ha c d\\nC2 ch h a aGF G \'d d d c d e\\nC2 d c h aGF Ga \'c c chc ha c\\nC2 d ch h a aGF G \'c d e f\\nC3 e d c cd ef(e)f(e) ed \'d e f\\nC3 g g g f e def edc \'c d\\nC3 c fed c d ch h a aGa \'F G\\nC2b} a b d c ba a G GabaF G\"]', '[\"De boi-ne_a-mour et de loi-al a-mi-e\\nme vient sou-vent pi-ties et ra-men-bran-ce,\\nsi que ja-mais a nul jour de ma vi-e\\nn\'ou-blï-e-rai son vis ne sa sam-blan-ce;\\net puis k\'A-<i>mours</i> ne mi vient plus sou-frir,\\nqu\'e-le del tout ne fa-ce_a son plai-sir\\net de tou-tes; mais ne puet a-ve-nir\\nque de la moi-e_ai-e boi-ne_es-pe-ran-ce.\"]', '[\"Notes:\\n5.3-4: amorus in the manuscript.\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0048\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1933, 'Cant la saison del dous tans s\'asegure', 'Linker 262.6', 'Vidame de Chartres', 'French', 'a', '21r', 1, 1, '[\"F4 a F G FE G F \'C2b} c(d) c b aGFab aG\\nG F G(F)G(F) FE G \'C2b} F c(d) c b aGFGa GF\\na F G FE \'C2b} G F c(d) c b aGFGah aG\\nG F G(F)G(F) FE \'C2b} G F c(d) c b aGFGa(G)a(G) GF\\nd \'C2b} d d dca %h c a b c(h)c(h) \'C2b} aGFGab aG\\na F G(F)G(F) FE d d dca \'C2b} b c(h)c(h) aGFGab aG\\na F G(F)G(F) FE E-G F \'C2b} cd c b aGFGa(G)a(G) GF\",\"F4 a F G FE G F\\nC2b} c(d) c b aGFab aG \'G F G(F)G(F) FE G\\nC2b} F c(d) c b aGFGa GF \'a F G FE\\nC2b} G F c(d) c b aGFGah aG \'G F G(F)G(F) FE\\nC2b} G F c(d) c b aGFGa(G)a(G) GF \'d\\nC2b} d d dca %h c a b c(h)c(h)\\nC2b} aGFGab aG \'a F G(F)G(F) FE d d dca\\nC2b} b c(h)c(h) aGFGab aG \'a F G(F)G(F) FE E-G F\\nC2b} cd c b aGFGa(G)a(G) GF\"]', '[\"Cant la sai-son del douç tans s\'a-se-gu-re,\\nque biaus es-tes se ra-fer-me_et res-clai-re,\\nque tou-te riens a sa dou-ce na-tu-re\\nvient et re-trait, se trop n\'est de mal\' ai-re,\\nlor chan-te-rai, car plus ne m\'en puis tai-re,\\npour con-for-ter ma cru-el a-ven-tu-re,\\nki m\'est tour-ne-e_a grant mes a-ven-tu-re.\"]', '[\"Notes: \\n2.10: The reading aG was scraped and subsequently corrected in GF.\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0049\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1940, 'Li nouviaus tans et mais et violete', 'Linker 38.9', 'Chastelain de Coucy', 'French', 'a', '13v-14r', 1, 1, '[\"C3 G h c d d d \'C3 f ed c fe d\\na d def-e edc h aGF \'C2 Ga ch ha aG\\nG h c \'C3 d d d f f-ed c fe d \'\\nC2 a d def edc h aGF Ga ch ha aG \'\\nC3 h d(c) haG G h d e(f) edc \'C4 hah d\\nde g g+a+h-+ag g g(f) edc \'C3 e fgf e dchc\\nC2 F G a h \'C3 c d G ahc h haGF a\\na aG \'C3 ah ch ha aG\",\"C3 G h c d d d\\nC3 f ed c fe d \'a d def-e edc h aGF\\nC2 Ga ch ha aG \'G h c\\nC3 d d d f f-ed c fe d \'\\nC2 a d def edc h aGF Ga ch ha aG \'\\nC3 h d(c) haG G h d e(f) edc\\nC4 hah d \'de g g+a+h-+ag g g(f) edc\\nC3 e fgf e dchc \'C2 F G a h\\nC3 c d G ahc h haGF a \'a aG\\nC3 ah ch ha aG\"]', '[\"Li nou-viaus tans et mais et vi-o-le-te\\net rou-sei-gnaus mi se-mont de kan-ter,\\net mes fins cuers me fait d\'u-ne_a-mou-re-te\\nsi douç pre-sent que ne l\'os re-fu-ser.\\nOr me laist Dieus en chel ho-nour mon-ter\\nque che-le_u j\'ai mon cuer et mon pen-ser\\ntie-gne_u-ne fois en-tre mes bras, nu-e-te,\\nains que voi-se_ou-tre-mer!\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0034\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1949, 'A vous, amant, plus k\'a nulle autre gent', 'Linker 38.1', 'Chastelain de Coucy', 'French', 'A', '153r (130r)', 1, 1, '[\"F3 a a a aGF G F Ga ha a(G) GF \'\\nF3 G a a aGa GF \'F3 FE F G Ga(h) aGF GF\\na a a aGF \'F3 G F Ga ba a(G)a(G) GF\\nG a a aGa \'F3 aa(G) FE F G Ga(h) aGFG GF\\nb} a b c haG \'F3b} a c b a a aGFG GF\\nG a  \'F3 a a G Gah a G aGF Ga \'\\nF3b} G a b c cd c b \'F3b} a GF GFE\\nC F FG a \'F3b} Gab aG FE F GF F\",\"F3 a a a aGF G F Ga ha a(G) GF \'\\nF3 G a a aGa GF\\nF3 FE F G Ga(h) aGF GF \'a a a aGF\\nF3 G F Ga ba a(G)a(G) GF \'G a a aGa\\nF3 aa(G) FE F G Ga(h) aGFG GF \'b} a b c haG\\nF3b} a c b a a aGFG GF \'G a\\nF3 a a G Gah a G aGF Ga \'\\nF3b} G a b c cd c b\\nF3b} a GF GFE \'C F FG a\\nF3b} Gab aG FE F GF F\"]', '[\"A vous, a-mant, plus k\'a nul-le_au-tre gent,\\nest bien rai-sons ke ma do-lour con-plai-ne,\\nkar il m\'es-tuet par-tir or au-tre-ment\\net de-se-vrer de ma dou-che com-pai-ne\\net qant li pert n\'est riens ki me re-mai-gne;\\net sai-chies bien, a-mours, cher-tai-ne-ment,\\ns\'ains nus mo-rust pour a-voir cuer do-lent,\\ndont n\'iert par moi es-me-us sons ne lais.\"]', '[\"Notes:\\n1.8-10: syllables <i>autre gent</i> copied on the following line.\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://arca.irht.cnrs.fr/iiif/135137/canvas/canvas-2538073\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"16\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://api.irht.cnrs.fr/ark:/63955/f2h3p7upoyoo/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"21\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 2, 10),
(1951, 'Conbien que j\'aie demouré', 'Linker 262.2', 'Vidame de Chartres', 'French', 'a', '21v', 1, 1, '[\"C2 ? d c(d) haG F GF Ga h \'\\nC2 h haG F FG F Gah a haG\\nh \'C2 h ah G FE GF Ga(h) h\\nh \'C2 haG F G FGa h aha G\\nd d dedc \'C2 c def e(d) ed d\\nf fedc cd chaG \'C2 d cdch a haG\\nF G a haG \'C3 c defed cdch a\\nF Ga cd cha \'C2 G ah ch a\",\"C2 ? d c(d) haG F GF Ga h \'\\nC2 h haG F FG F Gah a haG \'h\\nC2 h ah G FE GF Ga(h) h \'h\\nC2 haG F G FGa h aha G \'d d dedc\\nC2 c def e(d) ed d \'f fedc cd chaG\\nC2 d cdch a haG \'F G a haG\\nC3 c defed cdch a \'F Ga cd cha\\nC2 G ah ch a\"]', '[\"Con-bien que j\'ai-e de-mou-ré\\nfors de ma dou-ce con-tre-e\\net maint grant a-nui en-du-ré\\nen ter-re ma-le-ü-re-e,\\npour cou n\'ai jou pas ou-blï-é\\nle douç mal ki si m\'a-gre-e,\\ndont ja nen kier a-voir san-té,\\ns\'en Fran-ce ne m\'est trou-ve-e.\"]', '[\"Notes:\\n1.1: missing note.\\n8: The verse 8 is actually the last verse of the second stanza. The section between verse 8 of the first stanza and verse 7 of the second was omitted.  \"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0050\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1952, 'Tant con fuisse hors de ma contree', 'Linker 262.8', 'Vidame de Chartres', 'French', 'a', '21v-22r', 1, 1, '[\"C3 g fe f ? ed c d \'C3 d e gfe d\\na h G a a \'C2 a h-aG F F E\\nc ha \'C2 h aG G F G a a cha G\\nC1 D \'C1 E C D E G aG F ? E\\nFEDC D \'F3 EF G a F a h ch aGF G \'\\nC2 c d c h a aG-F a ah chG GFEDE \'\\nF3 D E C D D E F G EC DEFEDC D\",\"C3 g fe f ? ed c d\\nC3 d e gfe d \'a h G a a\\nC2 a h-aG F F E \'c ha\\nC2 h aG G F G a a cha G \'C1 D\\nC1 E C D E G aG F ? E \'FEDC D\\nF3 EF G a F a h ch aGF G \'\\nC2 c d c h a aG-F a ah chG GFEDE \'\\nF3 D E C D D E F G EC DEFEDC D\"]', '[\"Tant con fu-is-se hors de ma con-tre-e,\\nne pe-üst pas ma joi-e_a moi ve-nir;\\ncar qant re-mir la bien fai-te se-ne-e,\\nmoi est a-vis, nel doi-e re-ve-ïr.\\nEn-sus de li ai fait grant de-mou-re-e\\nen u-ne ter-re u_es-tre ne de-sir;\\nmie-us a-mais-se la u_e-le fu ne-e.\"]', '[\"Notes: \\n1.4: missing neuma.\\n4.9: missing neuma.\\n7-2-9: incorrect alignment of text and music.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0050\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58);
