(1953, 'Li plus desconfortes del mont', 'Linker 262.5', 'Vidame de Chartres', 'French', 'a', '22r-v', 1, 1, '[\"C2 c d c a F Ga G(F) \'F3 E(D)\\nFG FEC D F G ah aG FED \'\\nC2 c b} a Gab aGa F Ga GF F \'\\nF3 FG FED ED C D FE F Ga\\nh \'C2 cd ch aG h cd c(h) aGF\\nG \",\"C2 c d c a F Ga G(F)\\nF3 E(D) \'FG FEC D F G ah aG FED \'\\nC2 c b} a Gab aGa F Ga GF F \'\\nF3 FG FED ED C D FE F Ga \'h\\nC2 cd ch aG h cd c(h) aGF \'G \"]', '[\"Li plus des-con-for-tes del mont\\nsui, et si chant con en-voi-sies,\\nne ja Dieus joi-e ne me doinst,\\nde ce dont jou veil es-tre lies,\\ns\'uns aut-res n\'en fust en-ra-gies.\\nMais ma loi-a-tes me con-font;\\nor voi bien que li a-mant sont\\nmort et tra-i \\nqu\'a gher-redon ai fail-li\\npour ce que j\'ai trop ser-vi.\"]', '[\"Notes:\\n6.2-8.8: staves were left empty by the copist.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0051\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1954, 'Chanter me fait cou dont je criem morir', 'Linker 207.1', 'Pierre II de Molins', 'French', 'a', '22v-23r', 1, 1, '[\"C2 a G a(G)a(G) F a G \'C2b} a b aGFG a\\nF G a F \'C2 E a G a h aG a\\na G a(G)a(G) F a \'C2b} G a b aGFG a\\nF G a F \'C2 E a G a h aG a\\ncha G \'C2 aG F G a cha h c d\\ne \'C3 fed c b c d e ed c \'C3 ded c\\nc d cha G a c d(c)d(c) \'C3 haG a hc d\\nd e fed e c \'C2 d e c d(c)d(c) ha\",\"C2 a G a(G)a(G) F a G\\nC2b} a b aGFG a \'F G a F\\nC2 E a G a h aG a \'a G a(G)a(G) F a\\nC2b} G a b aGFG a \'F G a F\\nC2 E a G a h aG a \'cha G\\nC2 aG F G a cha h c d \'e\\nC3 fed c b c d e ed c\\nC3 ded c \'c d cha G a c d(c)d(c)\\nC3 haG a hc d \'d e fed e c\\nC2 d e c d(c)d(c) ha\"]', '[\"Chan-ter me fait cou dont je criem mo-rir:\\nloi-al a-mours et dou-ce de-si-re-e,\\nsi mes mer-veil con-ment peut a-ve-nir\\nque ma mours est la riens ki plus m\'a-gre-[e].\\nTant ai do-lour a mon mal sous-te-nir,\\nke pis me fait A-mours et mieus m\'a-gre-e.\\nDieus, ven-rai ja la pro-mes-se_a-ve-re-e\\ndont fi-ne_A-mour me de-üst en-ri-cher?\"]', '[\"Notes:\\n4.11: integration of <i>e</i> for metrical reasons.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0052\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1956, 'Tant sai d\'Amours que cil qui plus l\'emprent', 'Linker 207.3', 'Pierre II de Molins', 'French', 'a', '23r', 1, 1, '[\"C3 G h hcd d c d ch \'C2 ha G F(E)F(E)\\nC F GFE FG \'C2 c ha G(a) aG FG G\\nG h hcd d c \'C2 d ch ha G F(E)F(E)\\nC F GFE \'F4 FG c ha G(a) aG FG G\\na h c(h)c(h) \'C3 aGF G\\nd e f g g g gfe f \'C3 g edh\\ndef ed h c(h)c(h) aG\\na h h \'C2 ha G aG GF\\nahc h ha aG \'C2 aG GF G\",\"C3 G h hcd d c d ch\\nC2 ha G F(E)F(E) \'C F GFE FG\\nC2 c ha G(a) aG FG G \'G h hcd d c\\nC2 d ch ha G F(E)F(E) \'C F GFE\\nF4 FG c ha G(a) aG FG G \'a h c(h)c(h)\\nC3 aGF G \'d e f g g g gfe f\\nC3 g edh \'def ed h c(h)c(h) aG \'a h h\\nC2 ha G aG GF \'ahc h ha aG\\nC2 aG GF G\"]', '[\"Tant sai d\'A-mours que cil qui plus l\'em-prent\\net mieus la sert et pis li est me-ri.\\nDe cou sui lies cant jou la con-nois tant\\npar coi je n\'ai mon pen-sé de-par-ti\\net mon co-ra-je.\\nLon-ge-ment m\'a de-ce-ü et tra-i\\npar mon fo-la-je,\\nne ja nus hom n\'ert a-mes\\nque trop suit ses vo-lon-tes.\"]', '[\"Notes:\\n1: F3 clef scraped off and substituted with C3 clef.\\n1.5: d scraped off and substituted with c.\\n1.8-2.2: the entire staff was heavily corrected: F3 ED C H(A) \'A C were scraped off and substituted with the actual C2 ha G F(E)F(E) \'C F.   \"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0053\", \"custos\": \"[null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1957, 'Ahi! Amours, con dure departie', 'Linker 50.1', 'Conon de Betune', 'French', 'a', '23v-24r', 1, 1, '[\"C2 G h c d d d c de \'C3 f eddc d\\nh cd c h a GF ahc h \'C3 h(a) hG\\nG h c d c d e \'C3 f e dc d\\nh de d c \'C2 h(a) aG ahc h h(a) aG\\nedef e d c \'C2 c c h cd ch a\\nC3 e fg(f) fe \'C3 d ch a h c(d) c ch a \'\\nC3 ef e d d c h(a) hc d ch a \'\\nC2 eddc d ch a hcd c haG ahc \'C2 h ha haG \",\"C2 G h c d d d c de\\nC3 f eddc d \'h cd c h a GF ahc h\\nC3 h(a) hG \'G h c d c d e\\nC3 f e dc d \'h de d c\\nC2 h(a) aG ahc h h(a) aG \'edef e d c\\nC2 c c h cd ch a \'C3 e fg(f) fe\\nC3 d ch a h c(d) c ch a \'\\nC3 ef e d d c h(a) hc d ch a \'\\nC2 eddc d ch a hcd c haG ahc\\nC2 h ha haG \"]', '[\"A-hi! A-mours, con du-re de-par-ti-e\\nmoi con-ven-ra fai-re de la meil-lour\\nki on-ques fust a-mé-e ne ser-vi-e!\\nDieus me ra-maint a li par sa dou-çour,\\nsi vrai-e-ment que m\'en part a do-lour!\\nDieus q\'ai je dit? Ja ne m\'en part je mi-e!\\nSe li cors va ser-vir Nos-tre Sei-gnour,\\nli cuers re-maint del tout en sa bail-li-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0054\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1958, 'Herre vnde meyster scheffer myn', 'J Rum 8', 'Rumelant von Sachsen', 'German', 'J', '59v', 1, 1, '[\"C3 d c f e fed \'C2 d eh cd\\nd c f e fed dh c \'C2 ca\\na c dc baG a h aG \'C2 G\\na F G a FG a a \'\\nC2 d c f e fed d dh \'C2 cd\\nd c f e fed dh c ca \'\\nC2 a c dc baG a h aG \'C2 G\\na F G a FG a a \'\\nC2 a c dc baG a h aGF G \'\\nC1 a F G a FG a a\\na \'C2 c dc baG a h aGF G-G\\na \'C2 F G a ab c baG a ah ca a \'\\nC2 d c f e fed c ca cd \'\\nC2 d c f e fed dh c ca \'\\nC1 a c dc baG a h \'C1 aG G\\na F G a aG a \'C1 ab ca\\na c dc baG a \'C1 b aG a ah ca a\",\"C3 d c f e fed\\nC2 d eh cd \'d c f e fed dh c\\nC2 ca \'a c dc baG a h aG\\nC2 G \'a F G a FG a a \'\\nC2 d c f e fed d dh\\nC2 cd \'d c f e fed dh c ca \'\\nC2 a c dc baG a h aG\\nC2 G \'a F G a FG a a \'\\nC2 a c dc baG a h aGF G \'\\nC1 a F G a FG a a \'a\\nC2 c dc baG a h aGF G-G \'a\\nC2 F G a ab c baG a ah ca a \'\\nC2 d c f e fed c ca cd \'\\nC2 d c f e fed dh c ca \'\\nC1 a c dc baG a h\\nC1 aG G \'a F G a aG a\\nC1 ab ca \'a c dc baG a\\nC1 b aG a ah ca a\"]', '[\"Herrẹ vn-de mey-ster schef-fer myn.\\nGot al-le cre-a-tu-re dyn.\\nDie has-tu dir tzv̊ lobẹ ge dacht.\\nDie en-gel vndẹ die liv-te\\nVischẹ. vn-de vog-ẹle. wuͦr-me. tier.\\nhas-tu tzv̊ lobẹ ge-scaf-fen dir.\\nDyn wil-le werdẹ an vns vuͦl bracht.\\nNu helf myr daz ich hiv-te\\nGe-dan-ke dy-ner wer-di-cheit.\\nDaz ich dyn lob ge-sin-ge.\\nDyn erẹ ist groz an en-de breit.\\nDaz er-ste lob in dis-ser wisẹ ir klin-ge\\nDem her-ren der e. was vndẹ ist.\\nVndẹ ym-mer bli-bet ihe-sus krist.\\nDer schuͦf vns vridẹ vndẹ gibẹt vns vrist.\\nGot al-ler schef-fe-nvn-ge list.\\nKan vn-de weiz her meys-ter al-ler din-ge.\"]', '[\"System 4, Silbe 5: Korrektur G zu a\\nSystem 6, Silbe 5: Korrektur fed zu e\\nSystem 13, Silbe 8: Korrektur bc zu cd\\nSystem 14, Silbe 6: Korrektur ca zu dh\\nSystem 18, Silbe 3, 4: Korrektur aF Ga zu a ah\\n\\nCustoden in den ersten drei Notensystemen gesetzt\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_059v.tif\", \"custos\": \"[4,3,6,null,null,null,null,null,null,null,null,null,null,null,null,null,null,4,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1959, 'Se cascuns del monde savoit', 'Linker 56.3', 'Duc de Brabant', 'French', 'a', '24v', 1, 1, '[\"F3b} a aG a ba a(G)a(G) aGF GF FE \'\\nF3b} a aG a b a aGF a(G)a(G) GF \'\\nF3b} a aG a ba a(G)a(G) aGF GF FE\\na aG \'F4b} a b a aGF a(G)a(G) GF\\na aG a b \'F4b} aG GFE F\\na b c cc(b) aGF \'F4 G a\\na G a(h) a aGF E F(E)F(E) \'\\nF4 DC D E F G aG GF\\nG a ha \'F4b} aG aGF E F\\na b a GFED C \'\\nF4 D E F G aa(G) GF GaGE F\",\"F3b} a aG a ba a(G)a(G) aGF GF FE \'\\nF3b} a aG a b a aGF a(G)a(G) GF \'\\nF3b} a aG a ba a(G)a(G) aGF GF FE \'a aG\\nF4b} a b a aGF a(G)a(G) GF \'a aG a b\\nF4b} aG GFE F \'a b c cc(b) aGF\\nF4 G a \'a G a(h) a aGF E F(E)F(E) \'\\nF4 DC D E F G aG GF \'G a ha\\nF4b} aG aGF E F \'a b a GFED C \'\\nF4 D E F G aa(G) GF GaGE F\"]', '[\"Se cas-cuns del mon-de sa-voit\\ncou-ment boi-ne_A-mour set ou-ver,\\nja nus ne ses mer-veil-le-roit\\nde cou k\'e-le mi fait can-ter.\\nAs-sés i puet on tro-ver\\nplus grant po-oir de ces-tui.\\nFo-le gent plai-ne d\'a-nui,\\ntres-tout cil qui a-mi sont,\\nkui-dent la meil-lour del mont\\na-voir coi-si-e;\\nc\'est en-cor plus grant mais-tri-e.\"]', '[\"Notes: \\n11.6: GFa scraped off and sobstituted with GF.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0056\", \"custos\": \"[null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1960, 'Par force cant con m\'esbahis', 'Linker 214.3', 'Raoul de Ferrieres', 'French', 'a', '25r', 1, 1, '[\"F3 F F a a a aGFE DE F \'\\nF3 F F F FED EFG F EDDC C \'\\nF3 F G a a aGF F G a \'\\nF3 a aGF E DE F F F FEDC\\nD D \'F3 EFG F E-c a aGF E\\nF G Gah \'F3 a G FED C D\\na a ahc \'C2 c c cha F Ga\\nc d c \'C2 c c-c cha FGa aG\\nG a h chaG \'F3 F G E F\",\"F3 F F a a a aGFE DE F \'\\nF3 F F F FED EFG F EDDC C \'\\nF3 F G a a aGF F G a \'\\nF3 a aGF E DE F F F FEDC \'D D\\nF3 EFG F E-c a aGF E \'F G Gah\\nF3 a G FED C D \'a a ahc\\nC2 c c cha F Ga \'c d c\\nC2 c c-c cha FGa aG \'G a h chaG\\nF3 F G E F\"]', '[\"Par for-ce cant con m\'es-ba-his,\\nqant ma da-me le cou-man-da\\nmes cuers en-con-tre moi em-pris,\\nce dont il me par o-ci-ra.\\nSur mon gré l\'ai-me_et a-me-ra,\\nsans re-lais-sier l\'a en-tre-pris\\nn\'en moi ne sai hou-nour ne pris,\\npar coi a-ten-dre_i doi-e ja.\\nS\'a-tent de ses pe-res mer-ci.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0057\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1961, 'Swer ritters namen wolle vntfan', 'J Sing1', 'Singauf', 'German', 'J', 'fol. 43v', 1, 1, '[\"C1 D F F G a \'C1 a aGF Ga\\na h c a G \'C1 aGF F ED\\nE C D E \'F2 DCH CD D\\nD F F G \'F3 a a aGF Ga\\na h c a \'F2 G aGF F ED\\nE C D E \'F2 DCH CD D\\nE C D E D \'F2 E CH CD\\nD E F GFG \'F2 a GFE F ED\\nE C D \'F2 E D CHC DC HA\\nD A H \'F1 D DH D D\\nD E F \'F2 G aG F GF ED\\nE C \'F2 D E DC HCDC HA\\nD A \'F2 H D D E DH DD\",\"C1 D F F G a\\nC1 a aGF Ga \'a h c a G\\nC1 aGF F ED \'E C D E\\nF2 DCH CD D \'D F F G\\nF3 a a aGF Ga \'a h c a\\nF2 G aGF F ED \'E C D E\\nF2 DCH CD D \'E C D E D\\nF2 E CH CD \'D E F GFG\\nF2 a GFE F ED \'E C D\\nF2 E D CHC DC HA \'D A H\\nF1 D DH D D \'D E F\\nF2 G aG F GF ED \'E C\\nF2 D E DC HCDC HA \'D A\\nF2 H D D E DH DD\"]', '[\"Swer rit-ters na-men wollẹ vnt-fan.\\nAls en ge-tiv-ret hat der man.\\nDer erst den rit-ter mach-te.\\nDie schamẹ sol er tzv̊ schil-de han.\\nDie tzucht sol her sich kley-den an.\\nAls ez syn mey-ster dach-te.\\nSyn gur-tel si der myltẹ eyn ort.\\nDaz pri-set wol eynẹs rit-ters wort.\\nSyn sper sol syn die mv̊-ti-cheit.\\nSyn swert sol vridẹ ir we-cken.\\nSyn man-tel snv̊r myt lobẹ ge-leit.\\nSyn huͦt vuͦr schan-den dec ken.\\nSo ist der rit-ter val-sches vry.\"]', '[\"System 2, Silbe 3-8: Korrektur aGF G a b a G zu Ga a h c a G\\nSystem 5, Silbe 8: Korrektur?\\nSystem 8, Silbe 1/2: Rasur CH\\nSystem 10, Silbe 6: Rasur F1\\nSystem 10, Silbe 6-8: Korrektur D H C zu D A H\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_043v.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1962, 'Got herre almechtich', 'J Rum 7', 'Rumelant von Sachsen', 'German', 'J', 'fol. 58v', 1, 1, '[\"C2 d d d d cha/ \'C2 c c e dcha\\nh c d cde \'C2 d cha h c d da\\na h c \'C2 d cha a F a\\nC1 G F ED C \'C1 F E D E DCD ED \'\\nC2 d d d d cha/ c c e dcha \'\\nC2 h c d cde d cha h c \'C1 d da\\na h c d cha a(G) \'C1 F a\\nG F ED C F E \'C1 D E DCD ED\\nD E \'C1 F G FED E F G\\ncha \'C1 G a G FE D F FG \'F2 FED CD D\\nD E F G \'F3 FED E F G\\nG a h ch \'C2 aG h c d\\ncde d c h \'\\nC1 cha G a h cha Ga a\\na h \'C2 c d cha a F a GF \'F2 D F FG FED DC\\nD E F \'F3 G cha a F a\\nG F ED \'F2 C F E D E DCD ED\",\"C2 d d d d cha/\\nC2 c c e dcha \'h c d cde\\nC2 d cha h c d da \'a h c\\nC2 d cha a F a \'C1 G F ED C\\nC1 F E D E DCD ED \'\\nC2 d d d d cha/ c c e dcha \'\\nC2 h c d cde d cha h c\\nC1 d da \'a h c d cha a(G)\\nC1 F a \'G F ED C F E\\nC1 D E DCD ED \'D E\\nC1 F G FED E F G \'cha\\nC1 G a G FE D F FG\\nF2 FED CD D \'D E F G\\nF3 FED E F G \'G a h ch\\nC2 aG h c d \'cde d c h \'\\nC1 cha G a h cha Ga a \'a h\\nC2 c d cha a F a GF\\nF2 D F FG FED DC \'D E F\\nF3 G cha a F a \'G F ED\\nF2 C F E D E DCD ED\"]', '[\"Got herrẹ al-mech-tich. Vuͦr be-dech-tich.\\nAl-ler mei-ster schaft vnd al-ler din-ge.\\nDu ey-ne meis-ter schef-fer bist.\\nAn a-ne-gengẹ. an endẹ ist dyn ge-walt.\\nDv al-ler hers-te. Dir daz ers-te.\\nLob in dir-re nu-wen wisẹ ich sin-ge.\\nDyn wis-heit al-ler syn-ne list.\\nGe-mer-ket hat ge-mez-zen vnd ge-tzalt.\\nWol dich got kist der kris-ten-heit.\\nSo wol vns daz wir kris-ten synt ge-wor-den.\\nWol vns des daz du has ge-seit.\\nDaz die synt al le go-tes kynt.\\nDie kris-ten sind.\\nIn kris-te-li-cher or-den.\\nWol dich. wol vns. Daz wir dich mv̊-zen hie of er-den lobẹn.\\nWol dir daz al-ler en-gel schar\\nvnd al dyn schef-fe nvn-ge dir mv̊z hobẹn\"]', '[\"System 5, Silbe 5: Korrektur?\\nSystem 7, Silbe 7/8: Rasur c\\nSystem 20, Silbe 7/8: Rasur D\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_058v-EB.tif\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1963, 'S\'onkes nus hom pour dure departie', 'Linker 117.7', 'Hughes de Bregi', 'French', 'a', '26r', 1, 1, '[\"F3 C E F G G \'F3 G F a b aGa GF\\na c h c \'F3 a a G ah hch aG\\nC E \'F3 F G G G F a b aGa-GF \'\\nF3 G F G aGF E D E F \'F3 E DCD DC\\nE E F EDC E G a-h \'F3 h aGF F\\na b} c b c ba G \'F3 F Ga _hca a\\nE F G aG \'F2 F E D E G FE ED\\nE F G aGF \'F2 E D E F E DCD DC\",\"F3 C E F G G\\nF3 G F a b aGa GF \'a c h c\\nF3 a a G ah hch aG \'C E\\nF3 F G G G F a b aGa-GF \'\\nF3 G F G aGF E D E F\\nF3 E DCD DC \'E E F EDC E G a-h\\nF3 h aGF F \'a b} c b c ba G\\nF3 F Ga _hca a \'E F G aG\\nF2 F E D E G FE ED \'E F G aGF\\nF2 E D E F E DCD DC\"]', '[\"S\'on-kes nus hom pour du-re de-par-ti-e\\neut cuer do-lant, dont l\'ai jou par rai-son,\\nc\'on-ques tour-te qui pert son con-pai-gnon\\nne fu un jour de moi plus es-ba-hi-e.\\nCas-cuns pleu-re sa te-re_et son pa-ïs\\nqant se de-part de ses car-nels a-mis,\\nmais il n\'est nus con-giés, que-que nus di-e,\\nsi do-le-reus con d\'a-mi et d\'a-mi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0059\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1964, 'Encor ferai une cançon perdue', 'Linker 117.3', 'Hughes de Bregi', 'French', 'a', '26v', 1, 1, '[\"F3 G G FFE DC C D F G \'F3 h(c) haG a\\na(h) a F(E) DC C D \'F3 F G aGF G\\nhcha haG Ga \'F3 ch c d haG a hcha aG\\nhcha \'F3 G Ga ch c d(c) haG a hc haG a \'\\nF3 h c haG F G a G F \'F3 FE ED\\nC C D F G ab c \'F3b} ba aG GF\\nb c d cba b c(b) aGF \'F3 G a FE ED\\nD E F G \'F3 F a h(c) h a haGF G\",\"F3 G G FFE DC C D F G\\nF3 h(c) haG a \'a(h) a F(E) DC C D\\nF3 F G aGF G \'hcha haG Ga\\nF3 ch c d haG a hcha aG \'hcha\\nF3 G Ga ch c d(c) haG a hc haG a \'\\nF3 h c haG F G a G F\\nF3 FE ED \'C C D F G ab c\\nF3b} ba aG GF \'b c d cba b c(b) aGF\\nF3 G a FE ED \'D E F G\\nF3 F a h(c) h a haGF G\"]', '[\"En-cor fe-rai u-ne can-çon per-du-e,\\npuis k\'a per-te sont a-tour-né mi cant,\\nc\'on-ques can-chon ne fis en mon vi-vant\\ndont me-ri-te me soit en cor ren-du-e,\\nk\'ain de can-ter d\'a-mour meus ne me fu;\\nmais par es-poir ces-te_av-ra tel ver-tu\\nque des au-tres mi ren-dra la droi-tu-re:\\nsans plus met-rai cest cant en a-ven-tu-re.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0060\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1965, 'Fine amour claime en moi par iretage', 'Linker 205.1', 'Pierre de Craon', 'French', 'a', '27r', 1, 1, '[\"C3 h c d d c-d \'C3 d e f d chch a\\nahc h a \'C3 h a G F G ah hG\\nh \'C3 c d d de(f) f f d ch ch aG\\nahc h \'C3 a h a G F G a hG \'\\nC3 h c d d d e c d chaG \'C3 ah\\nh c d d c haG ahc \'C3 h ha G\\nc a hcd ch a \'C3 aG ahcd h a GF G\\ne f g \'C3 e f d e c a chha G\\nF \'C3 G a h c ha c G d chahch aG \'\\nC3 c d e d d-a hcd c c \'C3 haG ahcha aG\",\"C3 h c d d c-d\\nC3 d e f d chch a \'ahc h a\\nC3 h a G F G ah hG \'h\\nC3 c d d de(f) f f d ch ch aG \'ahc h\\nC3 a h a G F G a hG \'\\nC3 h c d d d e c d chaG\\nC3 ah \'h c d d c haG ahc\\nC3 h ha G \'c a hcd ch a\\nC3 aG ahcd h a GF G \'e f g\\nC3 e f d e c a chha G \'F\\nC3 G a h c ha c G d chahch aG \'\\nC3 c d e d d-a hcd c c\\nC3 haG ahcha aG\"]', '[\"Fi-ne_a-mour clai-me_en moi par i-re-ta-ge\\ndrois: s\'est rai-son, car bien et loi-au-ment\\nl\'ont ser-vi-e de Cre-om, lor e-a-ge,\\nli bon sei-gnour, qi tin-drent loi-au-ment\\npris et va-lour et tout en-sei-gne-ment,\\ns\'en chan-te-rent, et jou tot en-se-ment\\nvoeil que de chant et d\'a-mour les ret-rai-e,\\net del sor-plus me met en sa-ma-nai-e,\\nde cuer, de cors et d\'ou-nour et de vi-e,\\ncom a ma dou-ce_et droi-te sig-nou-ri-e.\"]', '[\"Dubbi: \\n5.9: plica?\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0061\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlway