(1968, 'Qant la saisons est passee', 'Linker 122.7', 'Jaque de Cysoing', 'French', 'a', '28r', 1, 1, '[\"C2 d d h d(e) c h cha G \'\\nC2 a h c aF G a G\\nd d \'C2 h d(e) c h cha G\\na h c aF \'C3 G a G\\na h c d c ch \'C3 d\\nd e f e d c dch c(h)c(h) \'\\nC2 a G F d dc hc a\\nh \'C2 h(a)h(a) G F G a h(a)h(a) G\\nc ch a hcd h \'C2 G a\\naGF G ahc hh(a) aG\",\"C2 d d h d(e) c h cha G \'\\nC2 a h c aF G a G \'d d\\nC2 h d(e) c h cha G \'a h c aF\\nC3 G a G \'a h c d c ch\\nC3 d \'d e f e d c dch c(h)c(h) \'\\nC2 a G F d dc hc a \'h\\nC2 h(a)h(a) G F G a h(a)h(a) G \'c ch a hcd h\\nC2 G a \'aGF G ahc hh(a) aG\"]', '[\"Qant la sai-sons est pas-se-e\\nd\'es-té et y-ver re-vient,\\npour la meil-lour qui soit ne-e\\ncha[n]-con fai-re me cou-vient,\\nk\'a li ser-vir me re-tient\\na-mours et loi-al pen-se-e,\\nsi q\'a-dés m\'en re-sou-vient\\nsans vo-loir que je re-croi-e:\\nde li ou mes cuers sa tent\\nme vient ma joi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0063\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1969, 'Li nouviaus tans que ge voi repairier', 'Linker 122.2', 'Jaque de Cysoing', 'French', 'a', '28v', 1, 1, '[\"C2 d e c dd(c) h a \'F4 G a h(a)h(a) G\\na h c h a \'F3 G a G F GG(F) EDC\\nC2 d e \'C2 c d h a G a h G\\na \'C2 h c h a G a G F G(F)G(F) EDC\\nE \'F4 E C D E F G a b \'F4 aGF G\\na c d f d c h \'F4 a G GFE\\nE F G a \'C2 h c h a G FED\\nE F \'F4 D E F G a h G a(G)a(G) FED\",\"C2 d e c dd(c) h a\\nF4 G a h(a)h(a) G \'a h c h a\\nF3 G a G F GG(F) EDC \'C2 d e\\nC2 c d h a G a h G \'a\\nC2 h c h a G a G F G(F)G(F) EDC \'E\\nF4 E C D E F G a b\\nF4 aGF G \'a c d f d c h\\nF4 a G GFE \'E F G a\\nC2 h c h a G FED \'E F\\nF4 D E F G a h G a(G)a(G) FED\"]', '[\"Li nou-viaus tans que ge voi re-pai-rier\\nm\'e-üst dou-né vo-loir de can-çon fai-re,\\nmais jou voi si tout le mont en-pi-rier\\nq\'a chas-cun doit a-nu-ier et des-plai-re,\\ncar cour-tois cuers jo-lis et de-boi-nai-re\\nne veut nus ber a li ser-vir hu-chier\\npar les mau-vais ki des bons n\'ont mes-tier,\\ncar a son per chas-cun oi-siaus s\'a-ai-re.\"]', '[\"REVIEWED BY STEFANO\\nNotes:\\n4.2-5.1: the section was repeated twice with slight difference (<i>cascun doit anuier et desplare / car</i>). The staff over the repeated line was left blank. \"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0064\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1974, 'Qant voi la glaie meüre', 'Linker 215.5', 'Raoul de Soissons', 'French', 'a', '29r', 1, 1, '[\"F4 F G a a(G)a(G) GF Gab a(G)a(G) GF \'\\nF4 G a G aGF E FED EF\\nF G a a(G)a(G) GF \'F4 Gab a(G)a(G) GF\\nG a G aGF E FED EF\\nF \'F4 Ga(G)a(G) aG\\nh c d de d chc \'F4 haG\\na h a G F FG FE \'F4 DC\\nD E F G a(G)a(G) GaGF E \'\\nF3 b a(G)a(G) GF G aa(G) \'F4 GFE F\\nh c d d(e) \'F4 d chc haG\\na h a G F FG FEE(D) DC\\nD E \'F4 F G a(G)a(G) GF GaGFE\\nb a(G)a(G) GF \'F3 G a(G)a(G) GFE F\",\"F4 F G a a(G)a(G) GF Gab a(G)a(G) GF \'\\nF4 G a G aGF E FED EF \'F G a a(G)a(G) GF\\nF4 Gab a(G)a(G) GF \'G a G aGF E FED EF \'F\\nF4 Ga(G)a(G) aG \'h c d de d chc\\nF4 haG \'a h a G F FG FE\\nF4 DC \'D E F G a(G)a(G) GaGF E \'\\nF3 b a(G)a(G) GF G aa(G)\\nF4 GFE F \'h c d d(e)\\nF4 d chc haG \'a h a G F FG FEE(D) DC \'D E\\nF4 F G a(G)a(G) GF GaGFE \'b a(G)a(G) GF\\nF3 G a(G)a(G) GFE F\"]', '[\"Qant voi la glai-e me-ü-re\\net le ro-sier es-pa-nir\\net sor la be-le ver-du-re\\nla rou-se-e res-plen-dir,\\nlors sous-pir\\npour ce-li qui tant de-sier\\net aim, las, out-re me-su-re!\\nTout aus cou-me l\'ar-su-re\\nfait, kan-qu\'e-le_a-taint, bru-ïr,\\nfait mon cors tain-dre_et pa-lir\\nsa dou-ce re-gar-de-ü-re\\nqui el cors me vint fe-rir\\npour fai-re la mors souf-frir.\"]', '[\"Notes:\\n13: after <i>souffrir</i> copyst originally wrote <i>la mort</i> and then deleted it.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0065\", \"custos\": \"[null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\