(1975, 'J\'ai oublïé paine et travaus', 'Linker 8.1', 'Andrieu de Paris', 'French', 'a', '29v', 1, 1, '[\"C2 a c c d e fed c d \'\\nC2 d a h cc(h) aG F FG a\\na c c \'C2 d e fed c d\\nd a \'C2 h c(h)c(h) aG F FG a\\nD F \'F4 G a a a(h) G a\\na c e \'F4 efe d c c(h)c(h) aG\\nD F G \'F4 a a a(h) aG a\\nD F G \'F3 G FED FG FE D\",\"C2 a c c d e fed c d \'\\nC2 d a h cc(h) aG F FG a \'a c c\\nC2 d e fed c d \'d a\\nC2 h c(h)c(h) aG F FG a \'D F\\nF4 G a a a(h) G a \'a c e\\nF4 efe d c c(h)c(h) aG \'D F G\\nF4 a a a(h) aG a \'D F G\\nF3 G FED FG FE D\"]', '[\"J\'ai oub-lï-é pai-ne_et tra-vaus,\\ns\'ai de fi-ne joi-e can-té.\\nDes or ne sui jou plus de ciaus\\nqui pour noi-ent ai-ent a-mé:\\nboi-ne-ment m\'a as-se-ü-ré\\nce-le_u mes ser-vi-ces est saus\\nk\'ainc ne fui tre-chie-res ne faus,\\ndont jou sai mon cuer mult boin gré.\"]', '[\"Notes:\\n1.1: G scraped off and substituted with a.\\n2.2-4: h c d scraped off and substituted with a h c.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0066\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1976, 'Der wise heiden cato der nye touf gewan', 'J Rum 2', 'Rumelant von Sachsen', 'German', 'J', 'fol. 49r-49v', 1, 1, '[\"C2 a c c d d d c \'C2 c aG F G a\\nd d \'C2 c c a a G F F a GFED \'C1 CD\\nD F G a c a GF \'C1 FG aGF GF F\\na c c d \'C1 d d c c aG F G a\\nd \'C1 d c c a a G F F a GFED \'C1 CD\\nD F G a c a GF \'C1 FG aGF GF F\\na a G F F \'C1 a GFED CD\\nD F G a c \'C1 a GF FG aGF GF F\\na c c \'C1 d d d c c aG F G a \'\\nC1 d d c c(h) a a G F \'C1 F a GFED CD\\nD F G a c \'C1 a GF FG aGF GF F\",\"C2 a c c d d d c\\nC2 c aG F G a \'d d\\nC2 c c a a G F F a GFED\\nC1 CD \'D F G a c a GF\\nC1 FG aGF GF F \'a c c d\\nC1 d d c c aG F G a \'d\\nC1 d c c a a G F F a GFED\\nC1 CD \'D F G a c a GF\\nC1 FG aGF GF F \'a a G F F\\nC1 a GFED CD \'D F G a c\\nC1 a GF FG aGF GF F \'a c c\\nC1 d d d c c aG F G a \'\\nC1 d d c c(h) a a G F\\nC1 F a GFED CD \'D F G a c\\nC1 a GF FG aGF GF F\"]', '[\"Der wi-se hei-den ca-to der nye touf ge-wan.\\nDer sprichẹt die wort daz sich eyn is-lich kris-ten man.\\nBe-den-ken mac wie daz eyn hey-den vun-de.\\nHer sprach ich bin den svn-den al-so gar ge-haz.\\nOb nicht der go-te svn-de ry-chen wist ich daz.\\nOb nym-mer men-sche wis-te my-ne svn-de\\nDen-noch welt ich die svn-de lan.\\nSie_ịst vn-ge-svnt von rey-ni-cheit ge-schey-den.\\nDaz my-ner svn-de wor-de nym-mer nicht ge-seit.\\nDoch lieu ich svn-de durch der svndẹn vn-rey-ni-cheit.\\nNv pruͦ-be kris-ten wie diz sprach eyn hey-den.\"]', '[\"System 5, Silben 1-2: Korrektur EF G zu FG aGF\\nSystem 10, Silbe 1/2: Rasur F\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_049r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1977, 'Daz gedeones wollen vliuvs in touwe', 'J Rum 3', 'Rumelant von Sachsen', 'German', 'J', 'fol. 51r', 1, 1, '[\"C2 a a b c d c a \'C2 c aF Ga a\\na c G aG \'C1 F EDE F ED\\nD D C F2 DH C \'C1 D D\\na a _h c d c a \'C1 c aF Ga a\\na c G aG \'F2 F EDE F ED\\nD D C DH C \'F2 D D\\nE G Gab aG F ED \'F2 CHC DC\\nD H C D DE F \'F2 EDC DH C D D\\na a \'C1 h c d c ab c aF Ga a \'\\nC1 a a c G aG F EDE F ED \'\\nF2 D D C DH C D D\",\"C2 a a b c d c a\\nC2 c aF Ga a \'a c G aG\\nC1 F EDE F ED \'D D C F2 DH C\\nC1 D D \'a a _h c d c a\\nC1 c aF Ga a \'a c G aG\\nF2 F EDE F ED \'D D C DH C\\nF2 D D \'E G Gab aG F ED\\nF2 CHC DC \'D H C D DE F\\nF2 EDC DH C D D \'a a\\nC1 h c d c ab c aF Ga a \'\\nC1 a a c G aG F EDE F ED \'\\nF2 D D C DH C D D\"]', '[\"Daz ge-de-o-nes wol-len vlivs in tou-we.\\nquam hy-mel vrucht daz ist die brut.\\nDer wa-ren go-tes myn-ne.\\nHer mo-y-ses der sach tzv̊ wun-der scou-we.\\nDen grv̊-nen busch den go-tes trut.\\nDa got was sel-ben yn-ne.\\nDer hy-melẹ viur dar ynnẹ vn-bran\\nsyn nest vnd ouch sin loub nye wart vuͦr sen-get.\\nNv wes ge gru-zet al-ler hy-melẹ vrou-we.\\nA-a-ron dyn ger-te vruch-ten kan\\ndes sich al vrucht vnt-fen-get.\"]', '[\"System 3, Silbe 8: Rasur Alterationszeichen b\\nSystem 6, Silbe 1: Korrektur C1 zu F2\\nSystem 6, Silbe 8: Rasur Alterationszeichen b\\nSystem 8, Silben 7-8: Korrektur EF G zu DE F\\nSystem 9, Silben 1-5: Korrektur FED EC D E E zu EDC DH C D D\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_051r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1978, 'Der kvninc nabugodonosor gesach in syme trovme', 'J Rum 4', 'Rumelant von Sachsen', 'German', 'J', 'fol. 51v', 1, 1, '[\"C1 F E F \'C1 G G FE F G G G G FE F \'C1 G E\\nF E F G F E F \'C1 G F E F Ga F\\nF E \'C1 F G F E F G G G G \'C1 FE F G E\\nF E F G \'C1 F E F G F E F Ga F \'\\nC1 a a c b h a a G \'\\nC1 a b h a G a F G a b \'C1 G\\na a c b h a \'C1 G\\na b h a G aG F G \'C1 a G F\\nF F F G \'C1 F a(G) F G F E F Ga G \'\\nC1 F E F G F a F \'C1 G F E F Ga F\",\"C1 F E F\\nC1 G G FE F G G G G FE F\\nC1 G E \'F E F G F E F\\nC1 G F E F Ga F \'F E\\nC1 F G F E F G G G G\\nC1 FE F G E \'F E F G\\nC1 F E F G F E F Ga F \'\\nC1 a a c b h a a G \'\\nC1 a b h a G a F G a b\\nC1 G \'a a c b h a\\nC1 G \'a b h a G aG F G\\nC1 a G F \'F F F G\\nC1 F a(G) F G F E F Ga G \'\\nC1 F E F G F a F\\nC1 G F E F Ga F\"]', '[\"Der kv-ninc na-bu-godọ-no-sor ge-sach in sy-me trov-me.\\nEyn bil-de von der er-den an den hy-mel rey-chen.\\nDem was daz hou-bet gul-dyn wun-der-lich des nam her gov-me.\\nDie brvst vnd ar-me sil-ber-yn dem sel-ben tzey-chen.\\nSyn buch e-ryn ge-scaf-fen was.\\ndiv die von her-ten sta-le y-sin die beyn.\\nDie vuͦzẹ er-dyn vnd ysẹ-nyn.\\nDaz bil-de brach tzv̊ ma-le ein gro-zer steyn.\\nDer quam vz ey nen bergẹ an al-le wer al ey-ne.\\nDer steyn tzv̊ rieb daz bildẹ vnd al tzv̊ brach ez kley-ne.\"]', '[\"System 6, Silbe 4: Korrektur G zu E\\nSystem 10, Silbe 4/5: Rasur c\\nSystem 13, Silbe 3/4: Rasur F\\nSystem 14, Silbe 7/8: Rasur F\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_051v.tif\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1979, 'Ob aller mynne mynnen kraft', 'J Rum 5', 'Rumelant von Sachsen', 'German', 'J', 'fol. 55r', 1, 1, '[\"C3 c e e e def e dc-cded-ef \'C2 edc\\nc e e de f e d \'C2 b} c b a Gab aG\\nG c c \'C2 cG a cde dcha Ga c dc c \'\\nC2 c e e e def e dccded-ef \'C2 edc\\nc e de f e d \'C2 b} c b a Gab aG\\nG c c \'C2 cG a cde dcha Ga c dc c \'\\nC2 b} a c b a G Ga b \'C2 aG\\nG c c cG a cde dc%ha Ga c \'C2 dc c\\nc c d f fe d \'C3g1 f f\\nf f g +a f g \'C3g1 gfd f gf f f\\nb} a c b \'C2 b} a G Ga b aG\\nGa c c \'C2 cG a c c b} b a Ga \'C2 b} b aG\\nG c c cG a cde \'C2 dcha Ga c dc c\",\"C3 c e e e def e dc-cded-ef\\nC2 edc \'c e e de f e d\\nC2 b} c b a Gab aG \'G c c\\nC2 cG a cde dcha Ga c dc c \'\\nC2 c e e e def e dccded-ef\\nC2 edc \'c e de f e d\\nC2 b} c b a Gab aG \'G c c\\nC2 cG a cde dcha Ga c dc c \'\\nC2 b} a c b a G Ga b\\nC2 aG \'G c c cG a cde dc%ha Ga c\\nC2 dc c \'c c d f fe d\\nC3g1 f f \'f f g +a f g\\nC3g1 gfd f gf f f \'b} a c b\\nC2 b} a G Ga b aG \'Ga c c\\nC2 cG a c c b} b a Ga\\nC2 b} b aG \'G c c cG a cde\\nC2 dcha Ga c dc c\"]', '[\"Ob al-ler myn-ne myn-nen kraft.\\nDie hoch ge-lobẹ-ten wer-den myn-ne mei-ster-scaft.\\nDer myn-nich li-chen vreu-de gebẹn-de myn-ne._.\\nDer suͦ-zen myn-nen berẹn-de vrucht.\\nDie den he-ren geist mit sy-ner go-tes tzucht.\\nAl vm-me sloz der myn-ne meys-te-ryn-ne.\\nDer wil ihc syn-gen my-nen sanc\\nDaz ers-te lob in di-ser nu-wen wi-se.\\nSit go-tes trorn ir myn ne twanc.\\nMagẹt ma-ri-a dv myn_nẹ yn ho-en pri-se.\\nDen star-ken got des v-ber want.\\nDaz er durch men-schen myn-ne men-sche wart ir kant.\\nHeil von yes-se dem vrev-de berẹn-den ri-se.\"]', '[\"Von weniger professioneller Hand die Noten nachgetragen\\nSystem 1, Silbe 1: Strich auch zwischen dem Notenschlüssel und dem ersten Ton\\nSystem 3, Silbe 6: Auflösungszeichen auf der Höhe von b\\nSystem 10, Silbe 1: Korrektur ch zu aG\\nSystem 10, Silbe 2: Auflösungszeichen auf der Höhe von b\\nSystem 13, Silbe 1: Strich vor der ersten Ligatur\\nSystem 13, Silbe 1: Notiert ist gfd, es könnte auch gfe gemeint gewesen sein\\nSystem 14, Silbe 6: Auflösungszeichen auf der Höhe von b\\nSystem 16, Silbe 3: Auflösungszeichen auf der Höhe von b\\nSystem 16, Silbe 3: Korrektur a zu G\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_055r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1980, 'Aller guͦte vuͦller vluͦte vloz in gnaden stramen', 'J Rum 6', 'Rumelant von Sachsen', 'German', 'J', 'fol. 56v', 1, 1, '[\"C3 e f g g/ g fe e f/ \'C3 e d edc d e fe\\ne \'C3 f g g g fe f e d dc \'C3 c b} b a babG\\nc d e g \'C3 f ed e d c b} baG c ba ba \'\\nC3 e f g +a/ g fe f e/ \'C2 e d edc d e fe\\ne f \'C3 g g g fe f e d dc \'C3 c b} b a ba-bG\\nc d e g \'C3 f ed e d c _haG c b} ba \'C2 ba\\nG a b c baG a \'C2 b c cG\\na _h c c_hc d \'C2 _hG a _h c c\\nG \'C2 a _h c _haG a _h c cG \'\\nC3 ede f e d c b} baG Ga \'C2 b} cb aGF G\\nC3 e f g g \'C3 g fe f e e d ec d e \'C3 fe\\ne f g g g fe f \'C2 e d dc c b} b a babG\\nc \'C3 d e g f ed/ e d \'C2 c b} baG c ba ba\",\"C3 e f g g/ g fe e f/\\nC3 e d edc d e fe \'e\\nC3 f g g g fe f e d dc\\nC3 c b} b a babG \'c d e g\\nC3 f ed e d c b} baG c ba ba \'\\nC3 e f g +a/ g fe f e/\\nC2 e d edc d e fe \'e f\\nC3 g g g fe f e d dc\\nC3 c b} b a ba-bG \'c d e g\\nC3 f ed e d c _haG c b} ba\\nC2 ba \'G a b c baG a\\nC2 b c cG \'a _h c c_hc d\\nC2 _hG a _h c c \'G\\nC2 a _h c _haG a _h c cG \'\\nC3 ede f e d c b} baG Ga\\nC2 b} cb aGF G \'C3 e f g g\\nC3 g fe f e e d ec d e\\nC3 fe \'e f g g g fe f\\nC2 e d dc c b} b a babG \'c\\nC3 d e g f ed/ e d\\nC2 c b} baG c ba ba\"]', '[\"Al-ler guͦ-te. vuͦl-ler vluͦ-te. vloz in gna-den stra-men.\\nKvmpt ge vloz-zen her vz go-tes hert-zen griez or-sprvn-ge.\\nDa von trin-kent al die sy-ner hel-fe durs-tic syn\\nSyn geist vliv-zet. Des ge-nyv-zet. Swer des kan ge-ra-men.\\nDaz er svn-den ru-wich sy der schrye an gotẹs bar-mvn-ge.\\nSo mac erˢ ge-la-zen nicht her tv̊ ym hel-fe schyn.\\nHer ster tzv̊ van-ge mit den ar-men.\\nIm tzvr ax-len ist syn houbẹt ge-ney-get.\\nAls her sich wil vbẹr vns ir bar-men.\\nVm-be-vanc vnd kvs her vns ir tzey-get.\\nSvnd-er wil-tu gna-de suͦ-chen du bist vn-ge-vey-get.\\nDy-nes hert-zen ou-gen vluͦt myt ru-we trost of rey-get.\\nDa myt wirt ge-swey-get. Al die lan-ge sor-ge dyn\"]', '[\"System 8, Silbe 2: Korrektur +a zu g\\nSystem 8, Silbe 5: Korrektur e zu f\\nSystem 14, Silben 1-2: Korrektur _h c zu a _h\\nSystem 15, Silbe 1. Korrektur dcd zu ede\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_056v.tif\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1981, 'Untruwe slichet also eyn mvs', 'J Rum 10', 'Rumelant von Sachsen', 'German', 'J', 'fol. 62r', 1, 1, '[\"C1 a c d dc b aG Gab \'C1 aG\\na b} b aG aF G aG F \'C1 F\\nF Ga b} b aF EF G G \'\\nC1 a c d dc b aG Gab aG \'\\nC1 a b} b aG aF G aG F F \'\\nC1 F Ga b} b aF FG G G\\nG \'C1 FE F G G FE F G\\na b} b \'C1 b} c bF G b aG aG F G \'C1 G\\na c d dc b aG Gab \'C1 aG\\na b} b aG aF G aG \'C1 F F\\nF Ga b} b aF EF G G\",\"C1 a c d dc b aG Gab\\nC1 aG \'a b} b aG aF G aG F\\nC1 F \'F Ga b} b aF EF G G \'\\nC1 a c d dc b aG Gab aG \'\\nC1 a b} b aG aF G aG F F \'\\nC1 F Ga b} b aF FG G G \'G\\nC1 FE F G G FE F G \'a b} b\\nC1 b} c bF G b aG aG F G\\nC1 G \'a c d dc b aG Gab\\nC1 aG \'a b} b aG aF G aG\\nC1 F F \'F Ga b} b aF EF G G\"]', '[\"Un-tru-we sli-chet alsọ eyn mvs.\\nIn val-sches man-nes hert-zen hus.\\nDer sie myt wil-len hu-set\\nDer we-net daz er wer-de rich.\\nVndẹ slynt den an-gel gi-rich-lich.\\nHer voxs der wilẹ ir mv̊-set.\\nSo rat ich daz ir vm-me sen.\\nIr mv̊gẹnt be-sli-chen wer-den of der wey-de.\\nDa ir vuͦr lie-sen u-wern balc.\\nSchynt man den vn-ge-tru-wen scalc.\\nIch tros-te mich der lei-de.\",\"Un-tru-we sli-chet alsọ eyn mvs.\\nIn val-sches man-nes hert-zen hus.\\nDer sie myt wil-len hu-set\\nDer we-net daz er wer-de rich.\\nVndẹ slynt den an-gel gi-rich-lich.\\nHer voxs der wilẹ ir mv̊-set.\\nSo rat ich daz ir vm-me sen.\\nIr mv̊gẹnt be-sli-chen wer-den of der wey-de.\\nDa ir vuͦr lie-sen u-wern balc.\\nSchynt man den vn-ge-tru-wen scalc.\\nIch tros-te mich der lei-de.\"]', '[\"System 3, Silben 6-8: Korrektur FG a a zu EF G G\\nSystem 8, Silben 4-5: Korrektur a G zu b aG\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_062r.tif\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": tr