(1982, 'Got aller selden anevanc dir sy genigen', 'J Meiß 1', 'Der Meißner', 'German', 'J', 'fol. 81r', 1, 1, '[\"C3 d d d d fed c b} b a \'C2 b} abaG F G a a\\nd d d d fed c \'C2 b a abaG F G a F G \'C1 FED\\nD F G a abaG aGF G \'C1 aGa b} b a\\nC2 d d d d fed \'C2 c b} b a abaG F G a a\\nd d d \'C2 d fed c b} b a abaG F G a F \'C1 G FED\\nD F G a abaG aGF G aGa b a \'\\nC1 D F G a F G FED _ F G \'C1 a aG c c d dc b} ba GF G G \'\\nC1 D F G a F G FED D F \'C1 G F aG c c dc b} ba GF G a a \'\\nC2 d d d d fed c b} b a \'C2 b} abaG F G a [a]\\nd d d d \'C2 fed c b} b a abaG F G a F G FED\\n\'C1 D F G a abaG aGF G aGa b a\",\"C3 d d d d fed c b} b a\\nC2 b} abaG F G a a \'d d d d fed c\\nC2 b a abaG F G a F G\\nC1 FED \'D F G a abaG aGF G\\nC1 aGa b} b a \'C2 d d d d fed\\nC2 c b} b a abaG F G a a \'d d d\\nC2 d fed c b} b a abaG F G a F\\nC1 G FED \'D F G a abaG aGF G aGa b a \'\\nC1 D F G a F G FED _ F G\\nC1 a aG c c d dc b} ba GF G G \'\\nC1 D F G a F G FED D F\\nC1 G F aG c c dc b} ba GF G a a \'\\nC2 d d d d fed c b} b a\\nC2 b} abaG F G a [a] \'d d d d\\nC2 fed c b} b a abaG F G a F G FED \'\\nC1 D F G a abaG aGF G aGa b a\"]', '[\"Got al-ler sel-den a-ne-vanc dir sy ge-ni-gen.\\nGot va-ter al-ler bar-mvn-ge din lob wirt nicht vuͦr swi gen.\\nKvnịnc al-ler rech-ti-cheit dynẹ wort synt war.\\nKrist rich-ter al-ler we-ke vri-der al-les vri-des.\\nKrist sv̊-ner al-ler mis-se-tat. Durch vns den tot du li-des.\\nGe-bie-ter v-ber al-ler en-gel schar.\\nHelf schef-fer al-ler din-ge. _ Du bist al-ler guͦtẹ eyn v-ber vluz-zich brvn-ne.\\nLa vns nicht hie vuͦr ter-ben in disẹm e-lendẹ von dir vnt fet der liech-te svn-ne\\nEyn brvn vnt-sprin-get in dem hert zen dyn svn-de-re.\\nKvmpt des eyn tzar durch dyn ou-gen der ist go-te so me-re.\\nDaz er dir vuͦr git dy-ne svn-de gar.\"]', '[\"System 8, Silbe 8: Rasur aGF\\nSystem 13, Silbe 8: Korrektur _h zu a\\nSystem 14, Silbe 6: Ton d überzählig\\nSystem 15, Silben 1-2: Korrekgur d fed zu fed c\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_081r.tif\", \"custos\": \"[7,4,null,4,3,2,6,null,3,null,null,null,5,2,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1983, 'Maria mv̊ter meit vnd kristes amme', 'J Meiß 2', 'Der Meißner', 'German', 'J', 'fol. 83r', 1, 1, '[\"C1 a c c d a c b} b \'C1 a b} Gab a aG\\na c c d a c \'C1 b} b a Gab a GFED\\nD F G a b \'C1 c d c b} baG F Gab a\\na c \'C1 c d a c b} b a Gab a aG \'\\nC1 G a b c G c b} b a Gab \'C1 a GFED\\nD F G a b} b c d c \'C1 b} baG F Ga a\\naD F G a \'C1 b} baG F G a aD\\nD F G a \'C1 b c d c b} baG F Gab a \'\\nC1 aD F G a b} baG F G \'C1 a aD\\nD F G a b} b c d c baG \'C1 F b} Gab a\\na c c d a \'C1 c b} b a Gab a aG\\na b c d \'C1 a b} c b a Gab a GFED\\nD F \'C1 G a b} b c d c baG \'C1 F b} Gab a\",\"C1 a c c d a c b} b\\nC1 a b} Gab a aG \'a c c d a c\\nC1 b} b a Gab a GFED \'D F G a b\\nC1 c d c b} baG F Gab a \'a c\\nC1 c d a c b} b a Gab a aG \'\\nC1 G a b c G c b} b a Gab\\nC1 a GFED \'D F G a b} b c d c\\nC1 b} baG F Ga a \'aD F G a\\nC1 b} baG F G a aD \'D F G a\\nC1 b c d c b} baG F Gab a \'\\nC1 aD F G a b} baG F G\\nC1 a aD \'D F G a b} b c d c baG\\nC1 F b} Gab a \'a c c d a\\nC1 c b} b a Gab a aG \'a b c d\\nC1 a b} c b a Gab a GFED \'D F\\nC1 G a b} b c d c baG\\nC1 F b} Gab a\"]', '[\"Ma-ri-a mv̊-ter meit vnd kris-tes am-me.\\nGe-born da her von kv̊_nịnc da-ui-tes stam-me.\\nDu go-tes se-del tem-pel der dry val-di-cheit.\\nDu tu gendẹ vaz bist wol eyn hy-mel por-te.\\nDyns kyn-des va-ter schuͦf mit ey-nen wor-te.\\nDaz du den truͦ-ge der da hy_mẹl vndẹ er-den treit.\\nE daz go-tes svn men-sche wuͦr-de.\\nWas er ein geist des mv̊ch-te man yn nicht ge sen\\nVon vlei-sche vleisch a_nẹ svn-den buͦr-de.\\nSelẹ vn-de lib nam her in ir des mv̊zẹ wir ihẹn.\\nEz quam da von her wol-te in ir ras-ten.\\nDurch vns liez er sich gri-fen vn-de tas-ten.\\nHer wart vns glich wol vns des daz daz sol-te schen\"]', '[\"System 4, Silbe 7: Korrektur G zu a\\nSystem 6: Rasur von Custos auf c?\\nSystem 8, Silben 6-8: Korrektur D F G zu F G a\\nSystem 10, Silbe 5: Korrektur aGF zu baG\\nSystem 16, Silbe 5: Korrektur _h zu d\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_083r_EB.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,5,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1984, 'Vil suͦze tzarte mynne', 'J Meiß 3', 'Der Meißner', 'German', 'J', 'fol. 85v', 1, 1, '[\"C1 G G a b} baGE F G G\\nGa c \'C1 G a G FG GGFED E FED EC C\\nC \'C1 F E F G aG FE FG G\\nGGFED C \'F1 D CHA H C*G *G\\nDEF EDC DC \'F1 B} BAB *GA B C C\\nC1 G G a \'C1 b} baGE F G G\\nGa c G a G \'C1 EF GGFED E FED EC C\\nC F \'F2 E F G aG FE FG G \'\\nF1 GGFED C D CHA H C*G *G\\nDEF EDC \'F1 DC B} BAB *GA B C C\\nC E \'F3 F G G a h c haG F \'F2 G a F G FED EC E F \'F2 G G\\nC E F G G a h \'C1 c(h) haG F G a F G FED EC\",\"C1 G G a b} baGE F G G \'Ga c\\nC1 G a G FG GGFED E FED EC C \'C\\nC1 F E F G aG FE FG G \'GGFED C\\nF1 D CHA H C*G *G \'DEF EDC DC\\nF1 B} BAB *GA B C C \'C1 G G a\\nC1 b} baGE F G G \'Ga c G a G\\nC1 EF GGFED E FED EC C \'C F\\nF2 E F G aG FE FG G \'\\nF1 GGFED C D CHA H C*G *G \'DEF EDC\\nF1 DC B} BAB *GA B C C \'C E\\nF3 F G G a h c haG F\\nF2 G a F G FED EC E F\\nF2 G G \'C E F G G a h\\nC1 c(h) haG F G a F G FED EC\"]', '[\"Vil suͦ-ze tzar-te myn-ne.\\nDu solt ie-ten vn-mynnẹ vz e-ren gar-ten.\\nOf keyn vn-ste-te sol-tu war-ten.\\nDin smy ren vndẹ din tzar-ten.\\nTuͦnt bey-de sanftẹ in den ou-gen.\\nDu twin-ges man-nes syn-ne.\\nMit dy-nen liech-ten spilẹn-den ou-gen bli-cken.\\nTzwe hert_zẹ in eyn kans-tu vuͦr tzwi-cken\\nMit myn-nich-li-chen stri-cken.\\nVes-tu dy-nen die-ner tou-gen.\\nDv schivz der myn-nen stra-le myt ge walt durch wi-bes ou-gen in  man-nes hert-ze.\\nDu wun-des vn-de hey-les widẹr sich myn-ne daz ist eyn tru-te\"]', '[\"Melodie fragmentarisch\\nSystem 5, Silbe 1/2: Rasur *GA\\nSystem 5, Silbe 3: Korrektur C zu B\\nSystem 7, Silbe 4: Korrektur EDC zu FED\\nSystem 8, Silbe 0/1: Rasur E\\nSystem 12, Silbe 8: Korrektur G zu F\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_085v.tif\", \"custos\": \"[null,null,7,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1985, 'Tant ai d\'amours q\'en chantant mi fait plaindre', 'Linker 262.7', 'Vidame de Chartres', 'French', 'a', '30r', 1, 1, '[\"C2 c c c d e \'C2 d c c c hah aG \'\\nC2 c d e a Ga ah c ha \'C1 a GFE E\\nC2 c ch c d e d c \'C1 c h hah aG\\nc d d a Ga h \'C2 a G F EDC DE\\nFG(F) D EF G \'C2 G a G c ha hah aG\\nc d \'C2 c a F FG a G F3 FED C DE \'\\nC1 Ga(G) D EF G G a GF c h \'C2 aGa GF\\nc d c a F FG \'F3 a(G) F G FE EDC\\nCD D GFF(E) ED \'\\nF3 F(E) D EF G G ah a F G \'F3 FED C\\nCD E GFE ED\",\"C2 c c c d e\\nC2 d c c c hah aG \'\\nC2 c d e a Ga ah c ha\\nC1 a GFE E \'C2 c ch c d e d c\\nC1 c h hah aG \'c d d a Ga h\\nC2 a G F EDC DE \'FG(F) D EF G\\nC2 G a G c ha hah aG \'c d\\nC2 c a F FG a G F3 FED C DE \'\\nC1 Ga(G) D EF G G a GF c h\\nC2 aGa GF \'c d c a F FG\\nF3 a(G) F G FE EDC \'CD D GFF(E) ED \'\\nF3 F(E) D EF G G ah a F G\\nF3 FED C \'CD E GFE ED\"]', '[\"Tant ai d\'a-mours q\'en chan-tant mi fait plain-dre,\\nsai ce m\'est vis bien es-tran-ge ma-nie-re;\\ncar a-dés pens que par ce doi-e_a-tan-dre\\nla u je n\'os par-ler d\'aut-re ma-nie-re,\\net des pa-ours est ce la moi-e grain-dre:\\nque nel sa-chent ce-le gent mau par-lie-re\\nki a-dés font la boi-ne_oeu-re re-main-dre,\\net les a-mans me-tent del tout a-rie-re\\nsans joi-e_a-voir.\\nDa-me, mer-ci, ce-le qui j\'ai plus chie-re,\\nsans de-ce-voir.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0067\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1986, 'Amours, que porrai devenir', 'Linker 255.2', 'Thibaut de Blason', 'French', 'a', '30v-31r', 1, 1, '[\"C3 c c d d c(h) aG Ga \'C3 c\\nc c d d cc(h) aG \'C2 Ga aG\\nc c d d cc(h) aG Ga \'C3 c\\nc c d d c(h) aG Ga aG \'\\nC3 F G a a a(h) aG a \'\\nC3 a h c ha G a GF\\nF G \'C3 a a a(h) aG a\\na h cc(h) \'C3 aG a aGF G\",\"C3 c c d d c(h) aG Ga\\nC3 c \'c c d d cc(h) aG\\nC2 Ga aG \'c c d d cc(h) aG Ga\\nC3 c \'c c d d c(h) aG Ga aG \'\\nC3 F G a a a(h) aG a \'\\nC3 a h c ha G a GF \'F G\\nC3 a a a(h) aG a \'a h cc(h)\\nC3 aG a aGF G\"]', '[\"A-mours, que por-rai de-ve-nir\\nli vos-tres frans hom na-tu-raus\\nqant ce-le ne mi lait ga-rir\\nqui jou sui fin a-mis loi-aus?\\nHe Dieus! Pour koi fui jou taus\\nque li o-sai des-cou-vrir\\nles maus que me fait sen-tir:\\net tous jours le truis crü-aus.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0068\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1987, 'Bien font amours leur talent', 'Linker 255.3', 'Thibaut de Blason', 'French', 'a', '31r-v', 1, 1, '[\"F4b} F G a b a G \'F4b} F\\nb b aG a\\nF FEF G C G \'F4 GF E\\nF F bab F E F\\nF \'F3b} G a aF b a F\\nb b aG \'F4 a\\nF FEF G C G GF E\\nF \'F4 G aGa F E F\\na %h c c \'C2 a aG F\\nc c b bab G \'\\nC2 d e c h a aGF G\\na \'F3 F GF D HC\\nC D EDE \'F3 F ED H C\",\"F4b} F G a b a G\\nF4b} F \'b b aG a \'F FEF G C G\\nF4 GF E \'F F bab F E F \'F\\nF3b} G a aF b a F \'b b aG\\nF4 a \'F FEF G C G GF E \'F\\nF4 G aGa F E F \'a %h c c\\nC2 a aG F \'c c b bab G \'\\nC2 d e c h a aGF G \'a\\nF3 F GF D HC \'C D EDE\\nF3 F ED H C\"]', '[\"Bien font a-mours leur ta-lent\\nqui si m\'ont mis\\nen des-tre-ce lou-ge-ment\\ndont je sui si sou-pris,\\nque riens ne m\'a-be-list tant,\\nj[e] sui pen-sis,\\ncoum es-tre_en-sus de la gent\\na u-ne part, sou-tis.\\nA-donc re-mir son cler vis\\nmil fois en pen-sant,\\nmau-gré fe-lons mes-dis-ans\\nqui m\'ont del pa-ïs\\nfait es-tre lonc tant es-chis\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0069\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1988, 'Amours a cui je me rench pris', 'Linker 265.67', 'Author of Linker 265.67', 'French', 'a', '31v', 1, 1, '[\"F4 F GFE b} G Ga bG ab \'F4 aG F\\nF GFE G Ga bG \'F4 ab aG F\\ne f edc b} dcb baG \'F4 a(_h) aGF G(F)G(F)\\nE GFFG a c \'F4 cbaG a c%haG F\\nE GFFG a \'F4 c(d) cbaG a %haGF GG(F)\\nE GFFG a \'C2 c(d) cbaG a c%haG G\",\"F4 F GFE b} G Ga bG ab\\nF4 aG F \'F GFE G Ga bG\\nF4 ab aG F \'e f edc b} dcb baG\\nF4 a(_h) aGF G(F)G(F) \'E GFFG a c\\nF4 cbaG a c%haG F \'E GFFG a\\nF4 c(d) cbaG a %haGF GG(F) \'E GFFG a\\nC2 c(d) cbaG a c%haG G\"]', '[\"A-mours a cui je me rench pris\\nm\'a par sa si-gnou-ri-e_a-pris\\nsi ke j\'aim da-me de tel pris,\\nke bien croi kel mont n\'a son per.\\nJe ne puis sans a-mors du-rer,\\nche me fait ser-vir et a-mer.\"]', '[\"REVISONE STEFANO, DA LEGGERE DA CARLO\\nnota come nella prima riga ho inserito b} : questo serve per inserire un segno di bemolle nel post giusto (utile quando non è immediatamente attaccato al gruppo in cui c\'è il b) e ha valore fino alla fine della riga manoscritta, evitando che i b successivi al primo siano visualizzati ognuno un segno di bemolle. \\nPer casi più complessi, ci sono delle opzioni nei settings (magari ne parliamo una volta).\\nIn casi in cui il b-bemolle è costante, è possibile spuntare \'Bb always is key signature\', ma non è questo il caso.\\n-Osserva sulla 4a riga del ms, sillaba \'de\'. Non c\'è un segno di bemolle, eppure possiamo stare certi che quello è bemolle (per questioni un po\' complesse), come hai però intuito anche tu: in questi casi usiamo \'_h\' che vuol dire \\n\'Si bemolle aggiunto dall\'editore\'.\\n- Non mettere Anonymous ma of Author of Linker 265.67\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0070\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"I