(1990, 'De bien amer vient sens et courtoisie', 'Linker 102.6', 'Guillaume le Vinier', 'French', 'a', '32v', 1, 1, '[\"C3 G ha hc(d) d e \'C3 f g gfe d dch ha\\nh ch ha G \'C3 F Ga h cha-c(h) ha G\\nG ha \'C3 hc(d) d e f g gfe \'C3 haG F G\\nh ch ha G F Ga \'C3 h d(c) ha G\\na haG a(h) \'C3 ch a\\nah c cd ef g \'C3 fg g fed f(e)edc haG\\nG ah \'C3 c haG c de f gf \'C3 e ede c\\ng gf g +ag f d d \'C3 d ed dch\\na haG ahc d \'C2 dhcd ha G\",\"C3 G ha hc(d) d e\\nC3 f g gfe d dch ha \'h ch ha G\\nC3 F Ga h cha-c(h) ha G \'G ha\\nC3 hc(d) d e f g gfe\\nC3 haG F G \'h ch ha G F Ga\\nC3 h d(c) ha G \'a haG a(h)\\nC3 ch a \'ah c cd ef g\\nC3 fg g fed f(e)edc haG \'G ah\\nC3 c haG c de f gf\\nC3 e ede c \'g gf g +ag f d d\\nC3 d ed dch \'a haG ahc d\\nC2 dhcd ha G\"]', '[\"De bien a-mer vient sens et cour-toi-si-e,\\nhu-mi-li-tes et fran-chi-se_et jou-vens,\\nlar-ge-che,_hou-nour, va-lour et cour-toi-si-e:\\npar quoi de li nou-vel cans re-cou-mens.\\nMais di taus m\'es-poent\\nque ne sai u ma can-chons soit oï-e,\\nq\'il n\'est mais nus qui d\'a-mours cant ne di-e,\\nains est au siec-le de si maus par-lens\\nc\'on le het et ger-ri-e.\"]', '[\"Notes:\\n2.2: <i>humulites</i> erroneously in the manuscript.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0072\", \"custos\": \"[null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1991, 'Ne me sont pas ocoison de chanter', 'Linker 65.51', 'Gace Brulé', 'French', 'a', '33r', 1, 1, '[\"F5 a c c d d f ee(d) \'F4 c(h)c(h) aGF b\\na a G E F \'F3 ED C F FG a\\na c c \'C3 d d f e(d) cc(h) aGF h \'\\nF4 a a G E F ED C F FG \'F4 a\\nb} b a baa(G) G d c aF \'F4 G F EDDC D\\na c dch a a a \'F4 GFE F Ga GFFE ED\\nE F \'F4 G G G a h cd b} cc(b) ba \'\\nF3 ahc h a G E F EDC DE \'F3 GFFE ED\",\"F5 a c c d d f ee(d)\\nF4 c(h)c(h) aGF b \'a a G E F\\nF3 ED C F FG a \'a c c\\nC3 d d f e(d) cc(h) aGF h \'\\nF4 a a G E F ED C F FG\\nF4 a \'b} b a baa(G) G d c aF\\nF4 G F EDDC D \'a c dch a a a\\nF4 GFE F Ga GFFE ED \'E F\\nF4 G G G a h cd b} cc(b) ba \'\\nF3 ahc h a G E F EDC DE\\nF3 GFFE ED\"]', '[\"Ne me sont pas o-coi-son de chan-ter\\npres ne ver-gier, pla-se-ïs ne buis-son;\\nmais qant ma da-me_le plaist a cou-man-der,\\nn\'i puis a-voir plus a-ve-nant rai-son.\\nPour che m\'est bel que sa va-lour re-trai-e,\\nsa cour-toi-si-e_et sa grant biau-té vrai-e,\\ndont Dix li vaut si grant plen-té dou-ner\\nqi li con-vient les au-tres ou-blï-er.\"]', '[\"Notes: \\n1: The F clif is on the sixth line not on the fifth.\\n3: The verse 3 has an additional syllable, probably for the uncorrect insertion of the adverb <i>mais</i>. The sequence of neumas is transcribed as appears in the manuscript, with a single neuma on the 3.5-6.  \"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(1992, 'Marcus. matheus. lucas. Vnd iohan', 'J Meiß 4', 'Der Meißner', 'German', 'J', 'fol. 86r', 1, 1, '[\"[C3 f f g f e fd ec cd e fc \'\\nC3 defed c b ca C2 c c d ch] \'C1 ca\\nab c baG GF\\nabcd c a \'C2 b c c c\\nC3 f f g f e \'C3 fd ec cd e fc\\ndefed c b ca \'C2 c c d ch ca\\na h c haG GF \'\\nC2 b} abcd c(h) a h c c\\nc \'C2 d ch ca\\nah c haG GF\\nF \'C2 a b c d c a c c c c \'\\nC2 c d ch ca\\nab c baG \'C2 GF\\nF a b} b c d c a h c c \'C2 c\\ndefed c h ca\\na_h c _haG aF \'\\nC2 F a h c d c a h c c c\",\"[C3 f f g f e fd ec cd e fc \'\\nC3 defed c b ca C2 c c d ch]\\nC1 ca \'ab c baG GF \'abcd c a\\nC2 b c c c \'C3 f f g f e\\nC3 fd ec cd e fc \'defed c b ca\\nC2 c c d ch ca \'a h c haG GF \'\\nC2 b} abcd c(h) a h c c \'c\\nC2 d ch ca \'ah c haG GF \'F\\nC2 a b c d c a c c c c \'\\nC2 c d ch ca \'ab c baG\\nC2 GF \'F a b} b c d c a h c c\\nC2 c \'defed c h ca \'a_h c _haG aF \'\\nC2 F a h c d c a h c c c\"]', '[\"_ _ _ _ _ _ _ _ _ _\\n_ _ _ _ _ _ _ _ ...hat.\\nSin hant ge-tat.\\nMit vuͦr ge dach-ten ra-te.\\nMar-cus. ma-the-us. lu-cas. Vnd io-han.\\nDie vier ge-tzug in ge-tzu-ge stan.\\nDie ge-sci-ben han.\\nGotẹs wun-der vruͦ vnd spatẹ.\\nIst daz wir synt.\\nDer tugẹn-de kynt.\\nSo ist got vn-ser va-ter vn-ser bruͦ-der.\\nDes schef-fet gar.\\nTzuͦr tugẹn-de schar.\\nDie rey-ne tzvn-ge sy der se-le ruͦ-der.\\nSus ey-net v̈.\\nMit go-te nv.\\nDaz er vch tv̊ vry vuͦr der hel-le lu-der\"]', '[\"System 12, Silbe 6: Korrektur hc zu a_h\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_086r.tif\", \"custos\": \"[null,null,null,2,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-j