(1994, 'Got ist gewaltich', 'J Meiß 5', 'Meißner', 'German', 'J', 'fol. 87r-87v', 1, 1, '[\"C2 c d e fe dc\\nd e \'C2 f c\\nd f c d c ba G a \'C2 c d dc\\ncd f f fe dc d c c ab \'C1 c F b a c _haG Ga _haG GF F\\nC2 cd f \'C2 f fe dc\\nd e f c\\nd f c \'C2 d c c baG a c d dc\\ncd f f fe \'C2 dc d c c ab c F b \'C2 a c baG Ga _haG GF F\\nF b \'C2 a b c d c_ha _hc\\ncd f \'C2 f fe dc d c c a b \'C2 a a G a c d dc\\na b \'C2 a a G Ga c c\\ncd f f fe \'C2 dc d c c ab c F b a c _haG \'C2 Ga baG GF\\ncd f f fe dc \'\\nC2 d e fe c\\nd f c d c \'C2 ba G a c d dc\\ncd f f fe \'C2 dc d c c ab c F b a \'C2 c baG Ga _haG GF F\",\"C2 c d e fe dc \'d e\\nC2 f c \'d f c d c ba G a\\nC2 c d dc \'cd f f fe dc d c c ab\\nC1 c F b a c _haG Ga _haG GF F \'C2 cd f\\nC2 f fe dc \'d e f c \'d f c\\nC2 d c c baG a c d dc \'cd f f fe\\nC2 dc d c c ab c F b\\nC2 a c baG Ga _haG GF F \'F b\\nC2 a b c d c_ha _hc \'cd f\\nC2 f fe dc d c c a b\\nC2 a a G a c d dc \'a b\\nC2 a a G Ga c c \'cd f f fe\\nC2 dc d c c ab c F b a c _haG\\nC2 Ga baG GF \'cd f f fe dc \'\\nC2 d e fe c \'d f c d c\\nC2 ba G a c d dc \'cd f f fe\\nC2 dc d c c ab c F b a\\nC2 c baG Ga _haG GF F\"]', '[\"Got ist ge-wal-tich.\\nMa-nich val-tich.\\nSint sy-ne werc syn na-me ist ge-dry-et.\\nHer ist der er-ste vn-de ouch der les-te. got sin le-ben ist an en-de.\\nOben ym ist key-ner.\\nHer ist ey-ner.\\nDer al-len cre-a-tiv-ren l[]en vuͦr li-et.\\nHer ist al-mech-tich wer vuͦr mac daz_daz er vuͦr mac vns machẹ-ten sy-ne hen-de.\\nHer may-stert al-lez daz da lebẹt.\\nHer_nẹ vruch-tet kvnịnc noch key-ser nicht. in vruch-ten al-le schef-fe-nvn-ge\\nSwaz swem-met odẹr in luftẹn swe-bet.\\nSwaz e. ge-wart daz lobẹt der mey-de kynt vn-de die go-tes bar-mvn-ge.\\nDer al-ler wun-der.\\nObẹn vnd vn-der.\\nMit sy-ner kraft al-ey-ne mac be-twin-gen.\\nDer si ge-mant. vndẹ helf vns dar da wir sin lob myt al-len en-gelẹn syn-gen.\"]', '[\"System 3, Silbe 9: Korrektur dc zu d durch Rasur von c\\n\\nObj: V. 8 \'lien\' -> \'len\'\\n\",\"\"]', '