(1995, 'Mich wundert wie die wolken vliegent tac vnde nacht', 'J Meiß 6', 'Der Meißner', 'German', 'J', 'fol. 88r', 1, 1, '[\"C2 G c d e fed c \'C2 b} b ca ab c baG ba\\nG \'C2 c d e fed c b} b ca ab \'C2 c _h a c G F G a \'C2 aF\\nF G F G b} abaG ba \'\\nC2 G c d e fed c b} b \'C2 ca b} ab c baG ba\\nG c d \'C2 e fed c _h ca b} ab c b \'C1 a c G F G a aF\\nF \'C1 G F G b} abaG ba\\nc G a aG F \'C1 G a(G) F G b} abaG ba\\nc G a aF \'C1 G aF G a_haG ba\\nG c d \'C2 e fed c _h ca b} ab c baG ba\\nG c \'C2 d e fed c _h b} ca ab c b a b \'C2 G F G a aF\\nF G F \'C1 G a_haG _ha\",\"C2 G c d e fed c\\nC2 b} b ca ab c baG ba \'G\\nC2 c d e fed c b} b ca ab\\nC2 c _h a c G F G a\\nC2 aF \'F G F G b} abaG ba \'\\nC2 G c d e fed c b} b\\nC2 ca b} ab c baG ba \'G c d\\nC2 e fed c _h ca b} ab c b\\nC1 a c G F G a aF \'F\\nC1 G F G b} abaG ba \'c G a aG F\\nC1 G a(G) F G b} abaG ba \'c G a aF\\nC1 G aF G a_haG ba \'G c d\\nC2 e fed c _h ca b} ab c baG ba \'G c\\nC2 d e fed c _h b} ca ab c b a b\\nC2 G F G a aF \'F G F\\nC1 G a_haG _ha\"]', '[\"Mich wund-dert wie die wol-ken vliegẹnt tac vn-de nacht.\\nMich wun-dert wa die nacht hin kom des tagẹs vndẹ wa der tac des nach-tes sy.\\nDes liecht vns hiv-te scheyn.\\nMich wun-dert manị-ger wun-der die got hat ge-macht.\\nMich wun-dert wie die svn-ne nympt der ma-nen sy-nen schyn gotẹs na-men dry.\\nDie slie-zen sich an eyn.\\nAn a-ne gen-ge an en-de dry eyn got.\\nEy-nen ich drye. An schrie. Svn-der spot.\\nDiv tri-ni tat ge-dry-et in dryn na-men ist.\\nDie dry eyn got in ey-ner go-te-heit hey-li-ger gheist got va-ter krist.\\nAl-mech-tich got du bist\"]', '[\"System 1, Silben 2-3: Korrektur h c zu c d\\nSystem 2, Silbe 2/3: Rasur a\\nSystem 8, Silbe 1: e mit zwei caudae, links und rechts unten\\nSystem 9, Silbe 3: Korrektur a zu G\\nSystem 10, Silbe 3: Korrektur Gah zu G durch Rasur von ah\\nSystem 11, Silbe 10: Korrektur aGF zu aF\\n\\nNach Brunner fehlen Noten für eine zusätzliche zweite und dritte Silbe in den Versen 8 und 9\"]', 