(1996, 'Vvr alle wunder die nv synt merket eyn mychel wunder', 'J Meiß 7', 'Der Meißner', 'German', 'J', 'fol. 89v', 1, 1, '[\"C1 a a c b} b aG a b \'C1 aG G a G a GE FG G \'\\nC1 G a b} b c bcd c(b) a \'C1 c\\nb} baG F E F G a \'C1 b} Gab a G a GE FG G \'\\nC1 a a c b} b aG a b} b \'C1 aG G a G a GE FG G \'\\nC1 G a b} b c bcd c a c\\nb} baG F \'C1 D F G a b} Gab a G a \'C1 GE FG G\\na a c b} b \'C1 aG a _h aG\\nG a G a GE \'C1 FG G\\na a c b} b \'\\nC1 aG a b} b aG\\nG a G \'C1 a GE FG G\\nG a b} b c \'C1 _hcd c a c\\nb} baG F D F G \'C1 a b} Gab a G a GE FG G\",\"C1 a a c b} b aG a b\\nC1 aG G a G a GE FG G \'\\nC1 G a b} b c bcd c(b) a\\nC1 c \'b} baG F E F G a\\nC1 b} Gab a G a GE FG G \'\\nC1 a a c b} b aG a b} b\\nC1 aG G a G a GE FG G \'\\nC1 G a b} b c bcd c a c \'b} baG F\\nC1 D F G a b} Gab a G a\\nC1 GE FG G \'a a c b} b\\nC1 aG a _h aG \'G a G a GE\\nC1 FG G \'a a c b} b \'\\nC1 aG a b} b aG \'G a G\\nC1 a GE FG G \'G a b} b c\\nC1 _hcd c a c \'b} baG F D F G\\nC1 a b} Gab a G a GE FG G\"]', '[\"Vv̊r al-le wun-der die nv synt mer-ket eyn my-chel wun-der.\\nWie selẹ vndẹ vleisch eyn men-sche sy.\\nVndẹ wie die selẹ eyn gheist vndẹ wie der gheist lebẹ ym-mer.\\nVvie go-tes wort sy mensch vndẹ krist. krist go-tes kynt be-svn-der.\\nDa by die go-tes na-men dry.\\nVa-ter. Svn. Heilị-ger gheist. Die dry sich schey den nym-mer.\\nIr kennẹ wir got eyn ke-gen eyn.\\nGe-vuͦ-get hat myt lis-ten.\\nVnd eyn kegẹn tzweyn.\\nSprich ia nicht neyn.\\nWil-tu dyn le-ben vris-ten.\\nTeil eyn kegẹn drin die dry in eyn.\\nGe-dri-et vndẹ ge ey-net sich so bis-tu kris-ten.\"]', '[\"System 4, Silbe 5/6: Rasur F\\nSystem 9, Silben 1-2/3: Korrektur F G a zu D F\\nSystem 10, Silbe 5/6: Rasur \\nSystem 11, Silbe 8: Korrektur G zu a\\nSystem 15, Silbe 8/9: Rasur G\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_089v.tif\", \"custos\": \"[null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1997, 'Tzwibeler an deme louben sich an gotes wunder', 'J Meiß 8', 'Der Meißner', 'German', 'J', 'fol. 90v', 1, 1, '[\"C1 a a c c a c \'C1 b} baG a baG E F G G\\nG G \'C1 c c a c G a G EFED \'F3 C DEF E E\\nDa a G a cha \'C1 G F E FED C DEF E \'\\nC1 a a c c a c b} baG \'C1 a b} baG E F G G\\nG G c \'C1 c a c G a G EFED C DEF \'C1 E E\\nEa a G a cha G F \'C1 E EFED C DEF E\\nEFED C E \'C1 E\\nEF G FED FE\\nD G a \'C2 h c d cde d c h\\nc \'C1 a GFED E EFGF E E\\nEFED C D \'C1 E\\nEF G FED FE\\nD G \'C2 a h c d cde d c h \'C1 c\\na G FED E EFG G G\\nG a \'C1 h c(h) a c G a G \'C1 EFED C DEF E E\\nDa a G \'C1 a cha G F E FED C DEF E\",\"C1 a a c c a c\\nC1 b} baG a baG E F G G \'G G\\nC1 c c a c G a G EFED\\nF3 C DEF E E \'Da a G a cha\\nC1 G F E FED C DEF E \'\\nC1 a a c c a c b} baG\\nC1 a b} baG E F G G \'G G c\\nC1 c a c G a G EFED C DEF\\nC1 E E \'Ea a G a cha G F\\nC1 E EFED C DEF E \'EFED C E\\nC1 E \'EF G FED FE \'D G a\\nC2 h c d cde d c h \'c\\nC1 a GFED E EFGF E E \'EFED C D\\nC1 E \'EF G FED FE \'D G\\nC2 a h c d cde d c h\\nC1 c \'a G FED E EFG G G \'G a\\nC1 h c(h) a c G a G\\nC1 EFED C DEF E E \'Da a G\\nC1 a cha G F E FED C DEF E\"]', '[\"Tzwibẹ-ler an de-me lou ben sich an go-tes wun-der.\\nVon wem kvmt bli-tzen. don-re. tac. vndẹ nacht. regẹn be-svn-der.\\nVon dem der al-le dinc vuͦr mac. Der ist eyn got.\\nDv_nẹ has dich nicht ge-ma-chet. Her lie dich e wer-den.\\nSwaz der hy mel hat be-grif-fen swaz da lebẹt of er-den.\\nWaz er da yn-ne wun-ders wil tuͦt syn ge-bot.\\nHie pruͦb ich by.\\nDaz eyn got sy.\\nDer ster-ben mv̊gẹ vndẹ le-ben ge-ben widẹr.\\ndes ni-get sy-ner kro-ne.\\nLob ma-nich valt.\\nWirt ym ge-tzalt.\\nVier vndẹ zwen-tzich alt her-ren val-lent ny der\\nof ir ant-li-tze scho-ne.\\nSie be-ten an tac vn-de nacht gotẹs lam vuͦr dem tro-ne.\\nIr ket-zer. iv-den. hei-den. sin der tiv-bel spot\"]', '[\"System 14, Silben 7/8: Korrektur E F zu G\\nSystem 15, Silben 1-3: Korrektur G h a c h zu a h c\\nSystem 16, Silben 2-4: Korrektur c a G zu a G FED\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_090v.tif\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/manifest\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 31),
(1999, 'En tous tans se doit fins cuers esjoïr', 'Linker 102.9', 'Guillaume le Vinier', 'French', 'a', '34r-v', 1, 1, '[\"C3 g g fed(e) h dd(e) \'C3 fed dc h de c\\ng g fed h dd(e) \'C3 f e edc de c\\nc ha \'C3 h c d d g fed c cha(h) \'\\nC3 h G a h chcd c\\nc \'C3 ha h c d c g fed \'C2 c cha\\nh G a h chcd c \",\"C3 g g fed(e) h dd(e)\\nC3 fed dc h de c \'g g fed h dd(e)\\nC3 f e edc de c \'c ha\\nC3 h c d d g fed c cha(h) \'\\nC3 h G a h chcd c \'c\\nC3 ha h c d c g fed\\nC2 c cha \'h G a h chcd c \"]', '[\"En tous tans se doit fins cuers es-jo-ïr\\net joi-e me-ner et son cors coin-tir,\\ncar on voit che-lui de s\'a-mour jo-ïr\\nqui loi-au-ment proi-e.\\nBoine est la do-lours dont il naist dou-chours\\net sou-las et joi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2000, 'Ki merchi prie, merchi doit avoir', 'Linker 102.20', 'Guillaume le Vinier', 'French', 'a', '34v', 1, 1, '[\"C3 d d c d c hG ah \'C3 c d cha\\nd d c d h G \'C3 a hc d cha G\\nd d c d h G a hc \'C3 d cha\\nd d c d h G a \'C3 hc d cha G\\ndd(e) ef edc ha h d \'C3 def ed hc c c\\nc e fg \'C3 fed h G fe d cha h\\nh c \'C3 d edc h h ah c haG G \'\\nC2 a F FD G a haG c d edc ha G\",\"C3 d d c d c hG ah\\nC3 c d cha \'d d c d h G\\nC3 a hc d cha G \'d d c d h G a hc\\nC3 d cha \'d d c d h G a\\nC3 hc d cha G \'dd(e) ef edc ha h d\\nC3 def ed hc c c \'c e fg\\nC3 fed h G fe d cha h \'h c\\nC3 d edc h h ah c haG G \'\\nC2 a F FD G a haG c d edc ha G\"]', '[\"Ki mer-chi pri-e, mer-chi doit a-voir,\\nbo-ne da-me, pie-cha l\'ai o-ï di-re.\\nA-ten-du ai mer-chi en boin es-poir:\\nor ai mes-tier k\'a-le-giés mon mar-ti-re\\nen tel ma-nie-re que vous n\'en soiés pi-re,\\ncar ne vous kier faus-ser ne de-che-voir\\nvos-tre plai-sir veul en gré re-che-voir:\\nse bel vous est, bien mi po-és o-chir-re.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0076\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2002, 'Amours, vostre sers et vostre hom', 'Linker 102.2', 'Guillaume le Vinier', 'French', 'a', '35r', 1, 1, '[\"C3 h G a c c c ha \'C3 h\\nh(a) G F ahcha G a(G) F \'C3 G\\nh G a(h) c c c ha h\\nh(a) G \'C3 F ahcha a aG F G\\nah cd \'C3 d haG F G a F\\nGa ch a \'C3 G\\nde f f f f fed \'C3 cha h\\nffg fedc ha G\\nhh(c) d d \'C3 h c d d cha\\nGah c c haG \'C3 F G ahc chaG\",\"C3 h G a c c c ha\\nC3 h \'h(a) G F ahcha G a(G) F\\nC3 G \'h G a(h) c c c ha h \'h(a) G\\nC3 F ahcha a aG F G \'ah cd\\nC3 d haG F G a F \'Ga ch a\\nC3 G \'de f f f f fed\\nC3 cha h \'ffg fedc ha G \'hh(c) d d\\nC3 h c d d cha \'Gah c c haG\\nC3 F G ahc chaG\"]', '[\"A-mours, vos-tre sers et vos-tre_hom\\nai tou-jours es-té sans men-tir,\\nsans a-ï-e de vos-tre don\\nque je tant con-voi-te_et de-sir.\\nFor-ment me fai-tes es-ba-hir\\npar vos-tre bon,\\nmais moi sam-ble se-lonc rai-son\\nk\'en biau ser-vir\\net en loi-au-ment, sans tra-ïr,\\na de-ser-te de ger-re-don.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0077\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2003, 'Voloirs de faire chanson', 'Linker 102.27', 'Guillaume le Vinier', 'French', 'a', '35v-36r', 1, 1, '[\"C3 c h c d d e f \'\\nC3 e d e f ed c c-c\\nf \'C3 e f(g) e d e(f) edc\\na h \'C3 aG F G Ga c\\ne d e \'C3 f f edc aF\\na c d h \'C3 aG F G\\nh c d aF G \'C2 Ga c\\nC3 f e f g fe f(g) f \'\\nC3 e f g fd b} c b a \'\\nC3b} ba G b c de fed cba b a \'C3 G\\na a G h a hc haG G\",\"C3 c h c d d e f \'\\nC3 e d e f ed c c-c \'f\\nC3 e f(g) e d e(f) edc \'a h\\nC3 aG F G Ga c \'e d e\\nC3 f f edc aF \'a c d h\\nC3 aG F G \'h c d aF G\\nC2 Ga c \'C3 f e f g fe f(g) f \'\\nC3 e f g fd b} c b a \'\\nC3b} ba G b c de fed cba b a\\nC3 G \'a a G h a hc haG G\"]', '[\"Vo-loirs de fai-re chan-son\\nmes muet par cel con-ve-nant\\nque fai-re me font chest chant\\ncru-el mes-di-sant fe-lon.\\nSi chant por aus sans rai-son,\\nmais jel fais de cuer do-lant,\\ncar ne sont tel ne si bon\\nc\'on doi-ve di-re_en chan-tant\\nleur mur-tre_et leur tra-ï-son.\\nMieus a-feu-roit c\'on de-sist en plou-rant\\nleur mes-dit et leur en-vi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0078\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2004, 'Encor n\'est raisons', 'Linker 102.7', 'Guillaume le Vinier', 'French', 'a', '36r', 1, 1, '[\"C2 d c d e d\\ne \'C2 d cc(h) a a G F GFE D C\\nF G(F) \'F4 FE FED DC D\\nd c d \'C2 e d\\ne d c c(h) a G F GFE \'F4 D C\\nF G(F) FE FED DC D\\nF F G a(h) \'F4 a ?\\na a(h) aGF G a D\\nF G(a) \'F3 G aGF E FED\\nE F G FED D C\\nE FED C \'F3 CD F\\nC D C F G(a) GFE ED\",\"C2 d c d e d \'e\\nC2 d cc(h) a a G F GFE D C \'F G(F)\\nF4 FE FED DC D \'d c d\\nC2 e d \'e d c c(h) a G F GFE\\nF4 D C \'F G(F) FE FED DC D \'F F G a(h)\\nF4 a ? \'a a(h) aGF G a D \'F G(a)\\nF3 G aGF E FED \'E F G FED D C \'E FED C\\nF3 CD F \'C D C F G(a) GFE ED\"]', '[\"En-cor n\'est rai-sons\\nque ma joi-e doi-ve_es-tre fail-li-e\\nne li miens chans fe-nis,\\ncar, se des can-chons\\na-voi-e me vo-len-té par-ti-e,\\njen vo-roi-e trop pis:\\ndes fe-lons mes-di-sans\\nen se-roi-e_a-sail-lis.\\nS\'aim mieus que jou di-e\\nchan-son en-voi-si-e\\nque fui-se re-pris\\ndes fe-lons par en-vi-e.\"]', '[\"Notes:\\n7.6: The verse 7 has an additional syllable, probably the last <i>-sans</i>, which lacks of notes.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0079\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2005, 'Amours graci, si me lo de l\'outraie', 'Linker 102.1', 'Guillaume le Vinier', 'French', 'a', '36v', 1, 1, '[\"F4 c d c haG F E D EF \'F3 G FED C\\nCD F EDC F G a GFE \'F3 D DC D\\nc d c haG \'F3 F E D EF G FED C\\nCD F \'F3 EDC F G a GFE D DC D\\na h \'F3 a G a G FE F Ga \'F4 FED C\\nFG a G a G F EFG \'F3 FE D C\\nFE D C FGa G \'F2 aGF E\\nCD E(D)E(D) DC FGa G F GFE ED\",\"F4 c d c haG F E D EF\\nF3 G FED C \'CD F EDC F G a GFE\\nF3 D DC D \'c d c haG\\nF3 F E D EF G FED C \'CD F\\nF3 EDC F G a GFE D DC D \'a h\\nF3 a G a G FE F Ga\\nF4 FED C \'FG a G a G F EFG\\nF3 FE D C \'FE D C FGa G\\nF2 aGF E \'CD E(D)E(D) DC FGa G F GFE ED\"]', '[\"A-mours gra-ci, si me lo de l\'ou-trai-e\\nque j\'ai par son en-che-e-ment en-pris;\\nsi l\'en aim mout et pris en mon co-rai-ge\\ndel biau pen-ser que mon cuer a a-sis,\\ntel don mieus voeil sou-frir do-lour et ra-ge\\nen bon es-poir <i>qua</i>-<i>tre</i>_ans ou <i>cinq</i> ou <i>sis</i>\\nk\'es-tre d\'au-tre_a-mour jo-ïs\\nconm a-mis tout mon e-a-ge.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0080\", \"custos\": \"[null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2006, 'Ire d\'amours et doutanche', 'Linker 102.13', 'Guillaume le Vinier', 'French', 'a', '37r', 1, 1, '[\"C3 c c h d c e c d\\nh \'C3b} c b aba G F F\\nc c h d c \'C3 e c d\\nh c h aha G \'C3 F F\\nf f f fed c ha G \'\\nC3 G Ga h cd e ec f\\ng \'C3b} e f fed c dcb a ba\\nG \'C3b} b a G F\\nE F Ga \'C2b} b c de defec\",\"C3 c c h d c e c d \'h\\nC3b} c b aba G F F \'c c h d c\\nC3 e c d \'h c h aha G\\nC3 F F \'f f f fed c ha G \'\\nC3 G Ga h cd e ec f \'g\\nC3b} e f fed c dcb a ba \'G\\nC3b} b a G F \'E F Ga\\nC2b} b c de defec\"]', '[\"I-re d\'a-mours et dou-tan-che\\nde ma joi-e re-cou-vrer\\net de-fau-te d\'es-pe-ran-che\\nfait mon chant re-no-ve-ler.\\nSe moi con-vient con-sieur-rer\\ndes biens que seul sa-vou-rer,\\ndont m\'a e-le fait sam-blan-che\\npour ma gre-van-che,\\npour mieus plai-re_et plus gre-ver.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0081\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58);
