(2008, 'Bone amour, cruel manaie', 'Linker 1.2', 'Adam de Givenci', 'French', 'a', '38r', 1, 1, '[\"F2 C D E D E(D)E(D) CH \'F2 A *G\\nC C D\\nC D E \'F2 D E(D) CH A *G\\nC C D \'\\nF3 E F G G FE D C\\nF \'F3 a Ga F G FE EDC D\\nE \'F3 F G G FE F G\\nF G a \'F3 a(h) a a G(F) E\\nE D D C \'\\nF2 C D ? ? ? ? ? ? ? ? \",\"F2 C D E D E(D)E(D) CH\\nF2 A *G \'C C D \'C D E\\nF2 D E(D) CH A *G \'C C D \'\\nF3 E F G G FE D C \'F\\nF3 a Ga F G FE EDC D \'E\\nF3 F G G FE F G \'F G a\\nF3 a(h) a a G(F) E \'E D D C \'\\nF2 C D ? ? ? ? ? ? ? ? \"]', '[\"Bo-ne_A-mour, cru-el ma-nai-e,\\nche m\'est vis,\\npren-dés de moi en grief pai-e,\\nchans fail-lis\\nm\'est si tost vos briés res-pis!\\nOr ne sai quel part jou trai-e,\\ncar du mal dont sui ga-ris\\nme re-no-ve-le la plai-e.\\nOr sui tous fis\\nque s\'ainc trais mal de vous c\'or a-tent pis!\"]', '[\"Notes: \\n7-9: The text between 7.2 and 9.4 was repeated. The staves were left blank.\\n10.3-10: The last portion of verse 10 (at f. 38v) had no stave.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0083\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2010, 'Se jou pooie ausi mon cuer douner', 'Linker 223.19', 'Richart de Fournival', 'French', 'a', '39r', 1, 1, '[\"F3 FF(E) D F G C D E \'F3 F EDC C\\nD F G(F) F \'C2 a c G FEDC D EFED\\nC F GFGa aF-h \'C1 h a G(F) EDC CD E\\nE F \'C1 G a(G) G ED F G CD FEDC \'\\nC1 CD D D F GF Ga-aC\\nC D C \'C1 DE FED ED C D\",\"F3 FF(E) D F G C D E\\nF3 F EDC C \'D F G(F) F\\nC2 a c G FEDC D EFED \'C F GFGa aF-h\\nC1 h a G(F) EDC CD E \'E F\\nC1 G a(G) G ED F G CD FEDC \'\\nC1 CD D D F GF Ga-aC \'C D C\\nC1 DE FED ED C D\"]', '[\"Se jou po-oi-e_au-si mon cuer dou-ner\\ncon mes cuers m\'a dou-né la u li pleut,\\nte-le l\'a-vroit qui mieus guer-re-dou-ner\\nle me vau-roit que ma da-me ne veut.\\nE-las, tant ai do-lour\\nains que puis joi-e_a-voir d\'a-mour.\"]', '[\"Notes:\\n6.5: C scraped off.\\n6.6: DC scraped off and substituted with ED.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0085\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2011, 'Adés m\'estoie a che tenus', 'Linker 223.1', 'Richart de Fournival', 'French', 'a', '39r-39v', 1, 1, '[\"C2 c cd c(h) aG a(h) a Ga GF \'\\nC2 a G(F) ED C G FE DC D \'\\nC2 c cd c(h) aG a(h) a Ga GF \'\\nF3 a G EED C G FE DC D \'\\nF3 F F F F G aba a(G) GF \'\\nF3 G a b a G FE DC D\\nG \'F3 G D C D EFE DC C\\nG FE \'F3 DC DE G a(G) FE EF\",\"C2 c cd c(h) aG a(h) a Ga GF \'\\nC2 a G(F) ED C G FE DC D \'\\nC2 c cd c(h) aG a(h) a Ga GF \'\\nF3 a G EED C G FE DC D \'\\nF3 F F F F G aba a(G) GF \'\\nF3 G a b a G FE DC D \'G\\nF3 G D C D EFE DC C \'G FE\\nF3 DC DE G a(G) FE EF\"]', '[\"A-dés m\'es-toi-e_a che te-nus\\nqu\'il ne vient se bien non d\'a-mer,\\nor m\'en est si grans biens ve-nus\\nque ne m\'en sai de koi van-ter\\nfors de mon lan-ga-je gas-ter!\\nMais je ne veil es-tre cre-üs,\\npuis c\'on m\'or-ra de tant lo-er\\nde-vant la que j\'en ai-e plus.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0085\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2012, 'Qant la justice est saisie', 'Linker 223.17', 'Richart de Fournival', 'French', 'a', '39v-40r', 1, 1, '[\"C3 F c c fe d e dc a \'\\nC1 a c(h) G F b} b abG a\\na c \'C3 c fe d e c haG\\nG aGF F \'C3 Ga c(h) G E FG\\nh hcd c a \'C3 Gah aFF F\\nb} b b c a \'C3b} b aGF b\\nb f f \'C3 e c ca aG\\nG aGF F F c \'C2 c ahchG aF\",\"C3 F c c fe d e dc a \'\\nC1 a c(h) G F b} b abG a \'a c\\nC3 c fe d e c haG \'G aGF F\\nC3 Ga c(h) G E FG \'h hcd c a\\nC3 Gah aFF F \'b} b b c a\\nC3b} b aGF b \'b f f\\nC3 e c ca aG \'G aGF F F c\\nC2 c ahchG aF\"]', '[\"Qant la jus-ti-ce_est sai-si-e\\nd\'un lar-ron, ja si sai-sis\\nn\'ert pris k\'an-cois c\'on en di-e\\nju-ge-ment ne s\'es-con-di-e\\ntan-tost pour es-ka-per vis;\\nmais qant ju-ge-mens est dis,\\nlors ni vaut riens es-con-dis,\\nsi ge-hist tou-te sa vi-e.\"]', '[\"Notes:\\n3.1-2: D a scraped off and substituted with a c.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0086\", \"custos\": \"[null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2013, 'Par maintes fois pensé ai', 'Linker 223.12', 'Richart de Fournival', 'French', 'a', '40r', 1, 1, '[\"C2b} a b a G d c(b) \'C2 aG\\nF a ch G a G F ?\\nG a hch \'C2 GE FG F D\\nc a c d \'C2 a(G) GFE F\\nh aG b} c baG a \'C2 h cdch c\\nC1 D F G G G ah \'C2 aG F\\nF a c h(c) a Gah aG \'\\nC2 d c a F a(G)GFE D C\\nG \'C2 F Gah a Ga GFE DC D \",\"C2b} a b a G d c(b)\\nC2 aG \'F a ch G a G F ? \'G a hch\\nC2 GE FG F D \'c a c d\\nC2 a(G) GFE F \'h aG b} c baG a\\nC2 h cdch c \'C1 D F G G G ah\\nC2 aG F \'F a c h(c) a Gah aG \'\\nC2 d c a F a(G)GFE D C \'G\\nC2 F Gah a Ga GFE DC D \"]', '[\"Par main-tes fois pen-sé ai\\nqui a-mours a as-sai-i-e\\ns\'il la puet ja mais guer-pir,\\ncar jou ne voi ne ne sai\\nc\'on puist pas-ser sans a-mi-e,\\nfors gens qui n\'ont aut-re_en-vi-e\\nde riens con-me d\'els tai-sir;\\nvoi-sent a-prés pour je-sir:\\nc\'est lor mieud-re con-pai-gni-e!\"]', '[\"PEER REVIEWED\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0087\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2014, 'L\'amour de ma douche enfanche', 'Linker 223.7', 'Richart de Fournival', 'French', 'a', '40v', 1, 1, '[\"C2 a d c(h) aG F aG \'C2 F E\\nD C D F G aGF aG a \'\\nC2 c a h(c) haG F a(G)GFE D C\\nD \'C2 F G a(G) F G(F) E D\\nF(E) \'C2 D F G a c d(c) haG aG F \'\\nC2 a c G E G F E D EF \'C1 FEDC\\nF2 A C D F(G) aGFE FE D ? \'\\nC2 d d c haG F GFE D C\\nF3 H A \'F2 C D C F Ga GFFE EDC D\",\"C2 a d c(h) aG F aG\\nC2 F E \'D C D F G aGF aG a \'\\nC2 c a h(c) haG F a(G)GFE D C \'D\\nC2 F G a(G) F G(F) E D \'F(E)\\nC2 D F G a c d(c) haG aG F \'\\nC2 a c G E G F E D EF\\nC1 FEDC \'F2 A C D F(G) aGFE FE D ? \'\\nC2 d d c haG F GFE D C \'F3 H A\\nF2 C D C F Ga GFFE EDC D\"]', '[\"L\'a-mour de ma dou-che_en-fan-che,\\nqui fu a-veuc moi nour-ri-e,\\ns\'est au-si cou-m\'en-dor-mi-e\\nlonc tans par des-es-pe-ran-che,\\nmais mi fol oel, qui a-dés m\'ont gre-vé,\\nsont en-tour li par mes-che-an-ce_a-lé\\ntant qu\'e-le s\'est es-veil-li-e;\\nor me dout que ne m\'o-chi-e,\\nqu\'e-le m\'a-voit pie-cha qeul-li en hé.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0088\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
