(2023, 'Qant jou voi la douce saison d\'esté', 'Linker 223.16', 'Richart de Fournival', 'French', 'a', '41v', 1, 1, '[\"C4 f e d\\ne g +a \'C3 g fe d c\\nd ch c\\nd e \'C3 d c e(d) c\\nha G ah\\nc h \'C3 c d(c) hah c\\nd e fed ed \'C3 c\\nh a d cha h G \'\\nC3 h c d dc d\\ne d c d cha h\\nG \'C3 a h c\",\"C4 f e d \'e g +a\\nC3 g fe d c \'d ch c \'d e\\nC3 d c e(d) c \'ha G ah \'c h\\nC3 c d(c) hah c \'d e fed ed\\nC3 c \'h a d cha h G \'\\nC3 h c d dc d \'e d c d cha h \'G\\nC3 a h c\"]', '[\"Qant jou voi\\nla dou-ce sai-son d\'es-té,\\nque cist oi−\\nseil-lon qi ont es-té\\nmu et coi\\nse sont re-con-for-té,\\net qant je les oi,\\nsi m\'ont tel a-tour-né\\nqu\'en la fo-li-e\\nq\'a-voi-e lais-si-e\\nm\'ont re-tour-né.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0090\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2025, 'Vlize dich mensche an gute wort', 'J Meiß 9', 'Der Meißner', 'German', 'J', 'fol. 91v', 1, 1, '[\"C2 c c d c b} cb a b \'C2 c\\nd e f e ed dc\\nc \'C2 b} a b c d b c a \'\\nC2 a G F a b} b c\\nc \'C2 c d c(_h) b} cb a b c\\nd e \'C2 f e fe dc\\nc a _h \'C2 c d b} b c a\\na G F \'C2 a _h c\\nc a b} b c \'\\nC2 d a b} b c\\nG a b a \'C2 G a G-F a b} b c\\nc \'C2 a b} b c\\nd a b} b c \'\\nC2 G a b} b a G a GF \'C2 a b} b c\\nb} b a b c d c \'C2 b} b a ba G F F\\nF \'C2 a b} b c d b c a\\na \'C1 G a G F a b} b c\",\"C2 c c d c b} cb a b\\nC2 c \'d e f e ed dc \'c\\nC2 b} a b c d b c a \'\\nC2 a G F a b} b c \'c\\nC2 c d c(_h) b} cb a b c \'d e\\nC2 f e fe dc \'c a _h\\nC2 c d b} b c a \'a G F\\nC2 a _h c \'c a b} b c \'\\nC2 d a b} b c \'G a b a\\nC2 G a G-F a b} b c \'c\\nC2 a b} b c \'d a b} b c \'\\nC2 G a b} b a G a GF\\nC2 a b} b c \'b} b a b c d c\\nC2 b} b a ba G F F \'F\\nC2 a b} b c d b c a \'a\\nC1 G a G F a b} b c\"]', '[\"Vli-ze dich mensche an guͦ-te wort.\\nDie gebẹn dir sel-den vil.\\nGotẹs huldẹ vndẹ ouch der werl-de gvnst.\\nWort sv̊-nent haz vndẹ nyt.\\nOf er-den hie. in hy-melẹ dort.\\nWort wal-tent wun-sches spil.\\nWort le-schen gar der hel-le brvnst.\\nWort schei-den manị-gen strit.\\nVvort die synt guͦt.\\nWort go-tes bluͦt.\\nWort go-tes lich-namẹn schef-fent_von bro-te hie.\\nDo nicht en was.\\nKeyn krut kein gras.\\nDo was got vndẹ syn kynt krist tros-te die.\\nDie ger-ne guͦ-te wort spre-chent tzv̊ al-ler stvnt.\\nDen liv-ten wirt vil sel-den kvnt.\\nGe benẹ-diet sy der rey-ne mvnt.\"]', '[\"System 3, Silbe 2: Korrektur b a zu b\\nSystem 5, Silbe 3: Korrektur d zu c(_h)\\nSystem 16, Silbe 3: Korrektur G F zu F\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://collections.thulb.uni-jena.de/api/iiif/presentation/v2/HisBest_derivate_00001155/canvas/HisBest_derivate_00001155%2FMs-El-f-101_091v.tif\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFl