(2029, 'Joie d\'amours ne puet nus esprisier', 'Linker 223.6', 'Richart de Fournival', 'French', 'a', '42r', 1, 1, '[\"C2 c d c d c a G \'C2 F G FED\\nC F G F F \'C2 c d cha Ga\\nb} b a b G \'C1 F G FE D C FGFE D\\nG \'C3 a c d d ef e d \'C1b} c dd(c)cb aab\\nG G c d \'C1 c d ha h G a\\nF E \'F4 FE D C F G E D EFEC D \'\\nC2 c d c d c a G F G FED\",\"C2 c d c d c a G\\nC2 F G FED \'C F G F F\\nC2 c d cha Ga \'b} b a b G\\nC1 F G FE D C FGFE D \'G\\nC3 a c d d ef e d\\nC1b} c dd(c)cb aab \'G G c d\\nC1 c d ha h G a \'F E\\nF4 FE D C F G E D EFEC D \'\\nC2 c d c d c a G F G FED\"]', '[\"Joi-e d\'a-mours ne puet nus es-pri-sier,\\nmais trop l\'es-tuet tes ja de-sir-rer;\\nn\'il n\'est haus dons c\'on ne puist so-ra-ten-dre,\\nne chier a-voir c\'on ne puist bien sor-ven-dre;\\nmais qui por-roit jo-ïr sans trop tar-gier,\\nes biens d\'a-mours n\'a-vroit riens que re-pren-dre\\nq\'il ne fus-sent de tous biens li non-pers.\"]', '[\"Notes:\\n2: Line 2 is one syllable short.\\n\\n\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0091\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
