(2031, 'Ains ne vi grant hardement', 'Linker 223.2', 'Richart de Fournival', 'French', 'a', '42v-43r', 1, 1, '[\"C3 c ch a G G ahaG \'C3 G\\nF G a ba aG a\\nc ch a \'C3 a G ahaG G\\nF G a ba aG a \'\\nC3 c cd h hc c cd fed\\nc \'C3 ch a c d(c) a G\\nF G a \'C3 b a GFE G\\na ch aG G ahcha G\\nG \'C3 a h c d c(h) aG C2\\nF(E) DDC EFED\",\"C3 c ch a G G ahaG\\nC3 G \'F G a ba aG a \'c ch a\\nC3 a G ahaG G \'F G a ba aG a \'\\nC3 c cd h hc c cd fed \'c\\nC3 ch a c d(c) a G \'F G a\\nC3 b a GFE G \'a ch aG G ahcha G \'G\\nC3 a h c d c(h) aG C2 \'F(E) DDC EFED\"]', '[\"Ains ne vi grant har-de-ment\\nfur-nir sans fo-li-e,\\net qui vient cou-ar-de-ment\\nsi pert s\'en-va-ï-e.\\nPour ç\'o-sai jou fo-le-ment\\nma da-me proi-ier mer-chi,\\ncar qui fait le fol har-di\\nplus tost a a-mi-e\\nque teus re-pai-re_en-tour li\\nsa-ge-ment.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0092\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2032, 'Talent avoie d\'amer', 'Linker 223.20', 'Richart de Fournival', 'French', 'a', '43r', 1, 1, '[\"C2 c(h) a hch G F F(G) aa(h)\\nc(h) \'C2b} G E Gab aG F(E)\\nD EFG G aGF F \'\\nC2b} a b c ded b Gab c \'\\nC2 d(c) h c a(h) aG FE\\nD EFG G ahc ha \'\\nC2 haG G(F) FE F\\nG b cdc a FG F\",\"C2 c(h) a hch G F F(G) aa(h) \'c(h)\\nC2b} G E Gab aG F(E) \'D EFG G aGF F \'\\nC2b} a b c ded b Gab c \'\\nC2 d(c) h c a(h) aG FE \'D EFG G ahc ha \'\\nC2 haG G(F) FE F \'G b cdc a FG F\"]', '[\"Ta-lent a-voi-e d\'a-mer,\\nmais pa-our m\'est pri-se\\nqui le m\'a to-lu,\\ncar j\'oi tieus d\'a-mours blas-mer\\net de son ser-vi-che\\nqui l\'ont main-te-nu,\\ns\'ai per-che-ü\\nqu\'il n\'en pue-ent tor-ner.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0093\", \"custos\": \"[null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2034, 'Lonc tans me sui escondis', 'Linker 223.8', 'Richart de Fournival', 'French', 'a', '43v', 1, 1, '[\"C2b} G b b ba G FE F \'\\nC2 a G FE D _h aF G\\nG \'C2b} b b ba G FE F\\na G FE \'C2b} D b aF G\\na c d d d b c(b) a \'\\nC2b} a ad d a G abc a F\\na ab \'C2b} c b aD\\nF E(F) D C \'C2 c b} baF aF ac\\nc b a G(F) ED F G\",\"C2b} G b b ba G FE F \'\\nC2 a G FE D _h aF G \'G\\nC2b} b b ba G FE F \'a G FE\\nC2b} D b aF G \'a c d d d b c(b) a \'\\nC2b} a ad d a G abc a F \'a ab\\nC2b} c b aD \'F E(F) D C\\nC2 c b} baF aF ac \'c b a G(F) ED F G\"]', '[\"Lonc tans me sui es-con-dis\\nc\'on-ques par a-mours n\'a-mai,\\nmais or me sui en-har-dis\\nq\'en tel lieu par-lé en ai,\\ndont je me re-pen-ti-roi-e\\nvo-len-tiers, se je po-oi-e,\\ncar trop sui har-dis,\\nqant par des-daig m\'a-coin-tai\\na ma mor-tel a-ne-mi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0094\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2035, 'Amours n\'est pas que c\'on die', 'Linker 185.4', 'Moniot d\'Arras', 'French', 'a', '44v', 1, 1, '[\"C2 G aGF a c d e(d)e(d) \'C3 c de\\nf e d ed c h aG\\nG \'C2 aGF a c d ch aG\\nG aGF \'C3 a c d h c ha\\nG aGF a \'C2 c d ed c de\\nf e d c h \'C2 a chG\\na c d c \'C2 h a b aG\\nG d e(f) edc h \'C2 aG ha GF\\nF F F(G) F(G) F E(F) \'C2b} baG\\nd d c b c \'C2 haG haaG F \",\"C2 G aGF a c d e(d)e(d)\\nC3 c de \'f e d ed c h aG \'G\\nC2 aGF a c d ch aG \'G aGF\\nC3 a c d h c ha \'G aGF a\\nC2 c d ed c de \'f e d c h\\nC2 a chG \'a c d c\\nC2 h a b aG \'G d e(f) edc h\\nC2 aG ha GF \'F F F(G) F(G) F E(F)\\nC2b} baG \'d d c b c\\nC2 haG haaG F \"]', '[\"A-mours, n\'est pas, que c\'on di-e,\\nsa-ge ne bien ë-u-rous\\ncuers qui ne se rent a vous.\\nIl li con-vient sa fo-li-e,\\nsa ghil-le_et sa vi-lou-ni-e,\\nses mes-dis et ses maus tous\\nguer-pir, puis que sans boi-di-e\\ns\'est mis en vos-tre bail-li-e.\\nSa-ges, cour-tois, lar-ges, prous\\nde-vient par vos-tre mais-tri-e.\"]', '[\"Notes:\\n3.1: <i>cuers</i> with the corresponding neuma (G) repeated twice in the manuscript.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0096\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2037, 'Ne mi doune pas talent', 'Linker 185.12', 'Moniot d\'Arras', 'French', 'a', '45r', 1, 1, '[\"C2 e e dc de dc ha G \'\\nC2 G a c dc ha G a\\ne e \'C2 dc de dc h aG\\nG a c \'C2 d(c)d(c) ha G a\\nc h c d e \'C3 d ef\\nf e d c d c \'C2b} bc\\nd e d c b a GFGa \'\\nC2 c h a(G) F c h aGFGa G\",\"C2 e e dc de dc ha G \'\\nC2 G a c dc ha G a \'e e\\nC2 dc de dc h aG \'G a c\\nC2 d(c)d(c) ha G a \'c h c d e\\nC3 d ef \'f e d c d c\\nC2b} bc \'d e d c b a GFGa \'\\nC2 c h a(G) F c h aGFGa G\"]', '[\"Ne mi dou-ne pas ta-lent\\nde can-ter le mois de mai,\\nmais A-mours de <i>qui</i> de-scent\\nuns nou-viaus con-fors que j\'ai,\\nqant ce-le qui lon-gue-ment\\nm\'a te-nu en grant es-mai\\nre-coit mon ser-vi-che_et prent,\\net jou plus ne li kier mi-e.\"]', '[\"Notes:\\n3.5: some letters were erased by the copist. The integration of one sillable (probably <i>qui</i>) is required by the neuma dc. \\n7.6: 9.2: a(b) scraped off and substituted with a.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0097\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2038, 'Nus n\'a joie ne soulas', 'Linker 185.13', 'Moniot d\'Arras', 'French', 'a', '46r-v', 1, 1, '[\"C2 c h a G c h abaG \'\\nF3 aGF G a G aGF E \'F3 FG\\na b aG a GFE D FEC\\nD \'F3 E F E G(F) ED D\\na \'C2 h c(h)c(h) aG a h chG\\na \'C2 h cc(h) aG a(G) F Ga\\nc c d \'C2 a c c haG\\naGa h c \'C1 a b aGF Ga\\nG FED F EDC\\nDCD \'F3 E F G FED C EFED\",\"C2 c h a G c h abaG \'\\nF3 aGF G a G aGF E\\nF3 FG \'a b aG a GFE D FEC \'D\\nF3 E F E G(F) ED D \'a\\nC2 h c(h)c(h) aG a h chG \'a\\nC2 h cc(h) aG a(G) F Ga \'c c d\\nC2 a c c haG \'aGa h c\\nC1 a b aGF Ga \'G FED F EDC \'DCD\\nF3 E F G FED C EFED\"]', '[\"Nus n\'a joi-e ne sou-las\\nsans boi-ne_a-mour ce m\'est vis\\nne ne puet es-tre jo-lis\\ncuer qui n\'ai-me haut ou bas.\\nDieu proi ki ne me laist pas\\nviv-re_uns jour sans es-tre_a-mis\\ncar en li ser-vir ai mis\\ncuer et cors sans es-tre las:\\nja de ses las\\nn\'is-trai tant con soi-e vis.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0099\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2039, 'Par main s\'est levee', 'Linker 265.1304', 'Author of Linker 265.1304', 'French', 'a', '46v', 1, 1, '[\"\",\"\"]', '[\"Par main s\'est levee la bele Maros,\\nki sans amour n\'est mie;\\nsi s\'en est alee toute seule au bos;\\nnus pies et deslacies;\\nlors s\'est escriee: Mes amis mignos,\\nki m\'a en sa baillie,\\ndeust ore flours ceullir\\net uns kapelet bastir\\npour ses biaus chaveus tenir:\\ns\'en fusse plus jolie.\\nLors la coisi, s\'est saillie:\\nBien veignies, fait cil m\'amie\\na nous de vos me plaing\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0100\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2040, 'Il ne muet pas de sens celui ki plaint', 'Linker 2.15', 'Adam de la Halle', 'French', 'a', '47r', 1, 1, '[\"C2 c c h(a)h(a) aG a F \'F3 G E(D)D(E) C(D) CH\\nD E F \'F3 G E G(a) E E C EE(D) DC\\nc \'F4 c h(a)h(a) aG a F G ED CD \'F3 CH\\nD E F G E G \'F3 E D C E(D)E(D) DC\\nF ED DE \'F3 G a c h ha G h(a)h(a) aG\\nd(e) c \'F3 chca h G a GFED C FEDE G\\na \'F3 h c aG a b aG a \'F3 GFED D\\nC D F FED G aG aG FED \'F3 CD E(D)E(D) DC\",\"C2 c c h(a)h(a) aG a F\\nF3 G E(D)D(E) C(D) CH \'D E F\\nF3 G E G(a) E E C EE(D) DC \'c\\nF4 c h(a)h(a) aG a F G ED CD\\nF3 CH \'D E F G E G\\nF3 E D C E(D)E(D) DC \'F ED DE\\nF3 G a c h ha G h(a)h(a) aG \'d(e) c\\nF3 chca h G a GFED C FEDE G \'a\\nF3 h c aG a b aG a\\nF3 GFED D \'C D F FED G aG aG FED\\nF3 CD E(D)E(D) DC\"]', '[\"Il ne muet pas de sens ce-lui ki plaint\\npai-ne_et tra-vail ki-u-ert a-van-tai-e.\\nPour cou ne puis ve-oir que cil bien aint,\\nki pour go-ïr d\'a-mours souf-fran-che gai-e.\\nQui n\'est sou-frans et d\'es-tab-le co-rai-e,\\nil ne se doit en-tre-mes-tre d\'a-mer:\\ncar ne puet cors en a-mours pour-fi-ter,\\nqi est a-com-pai-gni-e_a cuer vo-la-ge.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0101\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2041, 'Je n\'ai autre retenanche', 'Linker 2.16', 'Adam de la Halle', 'French', 'a', '47v', 1, 1, '[\"F3 aGG(F) FED C FG a hcd c(h)c(h) aGF\\na haG \'F4 a(G)a(G) FED C DE F\\naGG(F) FED C \'F3 FG a hcd c(h)c(h) aGF\\na haG a(G)a(G) FED \'F3 C DE F\\nG(a) GF FED C\\nD FED \'F3 C FG a-aGF aGG(F) FED\\nE F G a G \'F4 aGF G\\nc cha G FED C CD F \'\\nF3 FG a aG F\\na GG(F) FED C \'F3 F Gab a\\naGa F aG FED\",\"F3 aGG(F) FED C FG a hcd c(h)c(h) aGF \'a haG\\nF4 a(G)a(G) FED C DE F \'aGG(F) FED C\\nF3 FG a hcd c(h)c(h) aGF \'a haG a(G)a(G) FED\\nF3 C DE F \'G(a) GF FED C \'D FED\\nF3 C FG a-aGF aGG(F) FED \'E F G a G\\nF4 aGF G \'c cha G FED C CD F \'\\nF3 FG a aG F \'a GG(F) FED C\\nF3 F Gab a \'aGa F aG FED\"]', '[\"Je n\'ai aut-re re-te-nan-che\\nen a-mours que de mon chant\\net d\'u-ne dou-ce_es-pe-ran-che\\nqui me vient a-dés de-vant,\\nen re-cor-dant\\nla biau-té qui m\'a sou-pris\\net le re-gart a-trai-ant\\nen un douc vi-ai-re_a-sis\\ncler et ri-ant,\\ndont cha-scuns en re-gar-dant\\ndoit es-tre [es]pris\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0102\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2043, 'Helas, il n\'est mais nus qi aint', 'Linker 2.13', 'Adam de la Halle', 'French', 'a', '48r', 1, 1, '[\"C2 hc d d(c)d(c) haG F ahc \'C2 h dcha\\nhc d d(c)d(c) haG F ahc h(a)h(a) haG \'\\nC2 hc d d(c)d(c) haG F ahc h \'C2 dcha\\nhc d d(c)d(c) haG F ahc h(a)h(a) \'C3 aG\\nc cha hc d e %f \'C3 edc ch\\ncha hc d(c)d(c) haG GF\\nG ah \'C2 hc d e(d)e(d) dc h dcha a\\nc d d(c)d(c) \'C2 haG F Gab a(G)a(G) GF\",\"C2 hc d d(c)d(c) haG F ahc\\nC2 h dcha \'hc d d(c)d(c) haG F ahc h(a)h(a) haG \'\\nC2 hc d d(c)d(c) haG F ahc h\\nC2 dcha \'hc d d(c)d(c) haG F ahc h(a)h(a)\\nC3 aG \'c cha hc d e %f\\nC3 edc ch \'cha hc d(c)d(c) haG GF \'G ah\\nC2 hc d e(d)e(d) dc h dcha a \'c d d(c)d(c)\\nC2 haG F Gab a(G)a(G) GF\"]', '[\"He-las, il n\'est mais nus qi aint,\\nen-si c\'on de-ve-roit a-mer;\\ncal-cuns l\'a-mant o-ren-droit faint\\net veut jo-ïr sans en-du-rer.\\nEt pour ce se doit mieus gar-der\\nce-le c\'on pri-e;\\ncar tant est li fe-me proi-si-e,\\nc\'on ne li set que re-prou-ver.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0103\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2044, 'De cuer pensieu et desirant', 'Linker 2.8', 'Adam de la Halle', 'French', 'a', '48v', 1, 1, '[\"F3 c ch h(a) aG a GF G FE \'\\nF4 E G a h cc(h) aG F G \'\\nF4 a h a haG a GFE D F\\nG \'F3 G a h cc(h) a b aG \'\\nF4 c d cc(h) aG\\nb} b a b \'F4 c d cha G b\\nd f d c \'F4b} b dc ba aG\\nF GFG a cd \'C3b} c a b cbaG\",\"F3 c ch h(a) aG a GF G FE \'\\nF4 E G a h cc(h) aG F G \'\\nF4 a h a haG a GFE D F \'G\\nF3 G a h cc(h) a b aG \'\\nF4 c d cc(h) aG \'b} b a b\\nF4 c d cha G b \'d f d c\\nF4b} b dc ba aG \'F GFG a cd\\nC3b} c a b cbaG\"]', '[\"De cuer pen-sieu et de-si-rant\\nmuet que bou-che muet a par-ler,\\ncar e-le set de cou mou-strer\\nque cuers vait pre-miers de-vi-sant\\ndi tel sam-blant\\nme fait es-tre_en jo-li-ve-té\\na-mours, dont j\'ai si grant plen-té,\\nk\'a-le-ge-ment proi en can-tant.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0104\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2045, 'Ma douce dame et amours', 'Linker 2.22', 'Adam de la Halle', 'French', 'a', '52r-v', 1, 1, '[\"C2 c ch c dcha h aG a \'\\nF4 h haG F EDC DE EFG G G \'\\nC2 c ch c dcha h aG a \'\\nF4 h haG F EDC DE EFG G G\\nc ch \'C2 c haG F FE F(G) FED\\nG Ga \'F3 C CD F EDE(D) C\\nD F G ah \'C2 c haGa F\\nG FED C DE G GFED EFE D\",\"C2 c ch c dcha h aG a \'\\nF4 h haG F EDC DE EFG G G \'\\nC2 c ch c dcha h aG a \'\\nF4 h haG F EDC DE EFG G G \'c ch\\nC2 c haG F FE F(G) FED \'G Ga\\nF3 C CD F EDE(D) C \'D F G ah\\nC2 c haGa F \'G FED C DE G GFED EFE D\"]', '[\"Ma dou-ce da-me_et A-mours\\nme font tant a-mer ma vi-e,\\nc\'uns ans me sam-ble_uns seul jor\\nen ma souf-fran-ce jo-li-e.\\nMais si bien ne m\'a-last mi-e\\na maus c\'on me fait sen-tir,\\nse li es-poirs de jo-ïr\\nne me te-nist con-pai-gni-e.\"]', '[\"Notes:\\n2.3: G scraped off and substituted with F.\\n5.4: C before haG scraped off.\\n7.1-2: F FG scraped off and substituted with G Ga.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0111\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2046, 'Merveilles est que talent ai', 'Linker 2.24', 'Adam de la Halle', 'French', 'a', '52v', 1, 1, '[\"F3 d c a hcd cc(h) aGa \'F3 F\\nFF(E) FG a\\nd c a hcd cc(h) aGa \'F4 F\\nG(a) GFE D\\nE G a(G) ah c \'F4 hch a\\nc cd e fed cc(h) aG a \'\\nC2F4 f ec a hcd cc(h) aGF ED\\nE G a(G) \'F4 ah c haG\\nh dc h cha G aGF G(F)G(F) ED \'\\nF3 C FG a(h) haG a\",\"F3 d c a hcd cc(h) aGa\\nF3 F \'FF(E) FG a \'d c a hcd cc(h) aGa\\nF4 F \'G(a) GFE D \'E G a(G) ah c\\nF4 hch a \'c cd e fed cc(h) aG a \'\\nC2F4 f ec a hcd cc(h) aGF ED \'E G a(G)\\nF4 ah c haG \'h dc h cha G aGF G(F)G(F) ED \'\\nF3 C FG a(h) haG a\"]', '[\"Mer-veil-les_est que ta-lent ai\\nde can-ter,\\ncar je ne puis ne ne sai\\ntant pen-ser\\nque puis-se voi-e trou-ver\\nc\'on e-üst de moi mer-ci.\\nOn a par faus-ser go-ï,\\nmais an-coi mor-roi-e,\\nque jou vau-si-se_a-voir joi-e\\npour a-voir men-ti.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0112\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2047, 'Or voi jou bien k\'il souvient', 'Linker 2.29', 'Adam de la Halle', 'French', 'a', '53r', 1, 1, '[\"F3 F EDC G ah c haG \'F3 E(F)\\nG E C E(D)E(D) DC\\nF \'F3 EDC G ah c haG E(F)\\nG \'F3 E C E(D)E(D) DC\\nD EF G aG E \'F3 EDC D\\nC H C\\nE F G a h \'F3 chG E(D)E(D)\\nEDC D E(D)E(D) DC\",\"F3 F EDC G ah c haG\\nF3 E(F) \'G E C E(D)E(D) DC \'F\\nF3 EDC G ah c haG E(F) \'G\\nF3 E C E(D)E(D) DC \'D EF G aG E\\nF3 EDC D \'C H C \'E F G a h\\nF3 chG E(D)E(D) \'EDC D E(D)E(D) DC\"]', '[\"Or voi jou bien k\'il sou-vient\\nboi-ne_A-mour de mi;\\ncar plus as-pre-ment me tient\\nk\'ains mais ne sen-ti.\\nCe m\'a le cuer es-jo-ï\\nde can-ter:\\nk\'ain-si doit a-mant mous-trer\\nle mal jo-li.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0113\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2048, 'Qui a droit veut amours servir', 'Linker 2.33', 'Adam de la Halle', 'French', 'a', '53v', 1, 1, '[\"F4 a aG F FE F Gab \'F3 a haG\\na GF G(F)G(F) FE Ga ha a(G) \'F4 GF\\nE FEF G a b haG \'F4 F(G) a\\na(G) GF G(F)G(F) FE Ga \'F4 ha a(G) GF\\na h cc(h) aG\\na \'F4 GF G(F) FE Ga ha a(G) GF\\nc d \'F4 cc(h) aG a(h) aGF E(F) aG\\na(h) \'F4 c cc(h) aGa h aG F GFE\\nF \'F3 GF aa(G) GF\",\"F4 a aG F FE F Gab\\nF3 a haG \'a GF G(F)G(F) FE Ga ha a(G)\\nF4 GF \'E FEF G a b haG\\nF4 F(G) a \'a(G) GF G(F)G(F) FE Ga\\nF4 ha a(G) GF \'a h cc(h) aG \'a\\nF4 GF G(F) FE Ga ha a(G) GF \'c d\\nF4 cc(h) aG a(h) aGF E(F) aG \'a(h)\\nF4 c cc(h) aGa h aG F GFE \'F\\nF3 GF aa(G) GF\"]', '[\"[Qu]i a droit veut A-mours ser-vir\\net can-ter de goi-ous ta-lent,\\npen-ser ne doit a maus k\'il sent,\\nmais au bien ki l\'en puet ve-nir.\\nCe fait ceul-lir\\nsens et va-lour et har-de-ment,\\net les mau-vais bons de-ve-nir\\ncar cas-cuns be-e_au de-ser-vir,\\npuis q\'il i tent.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0114\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2049, 'Sans espoir d\'avoir secours', 'Linker 2.35', 'Adam de la Halle', 'French', 'a', '54r', 1, 1, '[\"C2 c ch c de ff(e) dcc(h) \'C2 aG\\nF a(h) aG\\nc h c de \'C3 ff(e) dcc(h) aG\\na(h) aG F \'\\nC3b} G a(b) a(G) GFEF aG\\na c d(e) dc \'F4b} b a(b) aG\\na c c(b) a(b) c aGF \'F4 E G\\na ha a(G) GF b cd(e) dc h\\nd \'C3 e ff(e) dc h aGF G\\na b aG F\",\"C2 c ch c de ff(e) dcc(h)\\nC2 aG \'F a(h) aG \'c h c de\\nC3 ff(e) dcc(h) aG \'a(h) aG F \'\\nC3b} G a(b) a(G) GFEF aG \'a c d(e) dc\\nF4b} b a(b) aG \'a c c(b) a(b) c aGF\\nF4 E G \'a ha a(G) GF b cd(e) dc h \'d\\nC3 e ff(e) dc h aGF G \'a b aG F\"]', '[\"Sans es-poir d\'a-voir se-cours\\nde nu-lui\\net u pi-eur point d\'a-mours\\nc\'on-ques fui,\\nau fai-te can-çon;\\nsi n\'en ai aut-re_o-coi-son\\nfors c\'u-ne da-me m\'en pri-e,\\nki est de tel sei-gne-ri-e,\\nc\'on doit a li o-be-ïr\\ndu k\'au mo-rir.\"]', '[\"Notes:\\n7.6: c(b) before aGF over <i>m\'en</i> erased in the manuscript.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0115\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2050, 'Amours ne me veut oïr', 'Linker 2.2', 'Adam de la Halle', 'French', 'a', '54r-v', 1, 1, '[\"C3 f f e dch(c) d \'C3 ee(d) dcc(h)\\na(h) c d cba GF E \'C4 G a\\nf f e dch(c) d e(d) \'C3 dcc(h)\\na c d cha GF ah \'F4 G F\\na(G) Ga h cd(e) dc h\\nd \'C2 e c(h) aGF Ga\\na h c cha GF \'F3 EF aG\\na ba a(G) ah c dch aa(G) GF\",\"C3 f f e dch(c) d\\nC3 ee(d) dcc(h) \'a(h) c d cba GF E\\nC4 G a \'f f e dch(c) d e(d)\\nC3 dcc(h) \'a c d cha GF ah\\nF4 G F \'a(G) Ga h cd(e) dc h \'d\\nC2 e c(h) aGF Ga \'a h c cha GF\\nF3 EF aG \'a ba a(G) ah c dch aa(G) GF\"]', '[\"A-mours ne me veut o-ïr\\npour prei-er ne pour chant fai-re\\nne pour loi-au-ment ser-vir\\nne pour dou-ce-ment a-trai-re,\\nains m\'est si coun-trai-re,\\net ma da-me_aus-si,\\nki ne leur est riens de mi,\\nne du mal que me font trai-re.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0115\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2051, 'Om me desfent que mon cuer pas ne croie', 'Linker 2.28', 'Adam de la Halle', 'French', 'a', '54v', 1, 1, '[\"C2 c c h c(h)c(h) a G \'F4 a G F GG(F) ED\\nE G aGF Ga \'C2b} c a baG aG F G\\nc c b c(b)c(b) \'F4 a G a G F G(F)G(F) ED\\nE G aGF \'F4 Ga b} c a baG aG F G\\nc \'C2b} d c dcb a aG abaG\\nG a b c \'C2b} b cbaG aa(G) FED\\nE F G c b baG \'F4 a GF\\na b} baG aa(G) FED F Gab(a)b(a) a \'F4b} aG GFG a\\nc dcb aGF abc b(a)b(a) b(a)b(a) aG \",\"C2 c c h c(h)c(h) a G\\nF4 a G F GG(F) ED \'E G aGF Ga\\nC2b} c a baG aG F G \'c c b c(b)c(b)\\nF4 a G a G F G(F)G(F) ED \'E G aGF\\nF4 Ga b} c a baG aG F G \'c\\nC2b} d c dcb a aG abaG \'G a b c\\nC2b} b cbaG aa(G) FED \'E F G c b baG\\nF4 a GF \'a b} baG aa(G) FED F Gab(a)b(a) a\\nF4b} aG GFG a \'c dcb aGF abc b(a)b(a) b(a)b(a) aG \"]', '[\"Om me des-fent que mon cuer pas ne croi-e,\\nmais si fe-rai, car il l\'a de-ser-vi,\\npar lui sui jou en de-duit et en goi-e;\\ncar il a fait a-mours ve-nir en mi\\npar un de-si-rier jo-li,\\nk\'il prist en la con-te-nan-ce\\net en la dou-ce sam-blan-ce\\nde l\'a-mou-reus vi-ai-re de ce-li\\nqui je proi de cuer mer-ci.\"]', '[\"Notes:\\n3.1-5: d e d edc b scraped off and substituted with c d c dcb a.\\n7.4-8: ba a aGF G FE scraped off and substituted with c b baG a GF.\\n8.10: G scraped off and substituted with a.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0116\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58);
