(2053, 'Puis que jou sui de l\'amoureuse loi', 'Linker 2.32', 'Adam de la Halle', 'French', 'a', '55r-v', 1, 1, '[\"F3 G E F EDC F G a \'F4 h(c) haG G\\na c hG FE D \'F3 E F DCD DCH C\\nG E F EDC \'F3 F G a h(c) haG G\\na c \'F3 hG FE D E FF(E) DCD DCH C \'\\nF3 F FED E EFG G\\na c h \'F3 aG a(G)a(G) GF G\\nE G(a) GF \'F3 FE F ED D\\na G F G(F)G(F) \'F3 ED C H\\nC D E F G aGF \'F3 FE\\nE DEF E E(D)E(D) DC\",\"F3 G E F EDC F G a\\nF4 h(c) haG G \'a c hG FE D\\nF3 E F DCD DCH C \'G E F EDC\\nF3 F G a h(c) haG G \'a c\\nF3 hG FE D E FF(E) DCD DCH C \'\\nF3 F FED E EFG G \'a c h\\nF3 aG a(G)a(G) GF G \'E G(a) GF\\nF3 FE F ED D \'a G F G(F)G(F)\\nF3 ED C H \'C D E F G aGF\\nF3 FE \'E DEF E E(D)E(D) DC\"]', '[\"Puis que jou sui de l\'a-mou-reu-se loi,\\nbien doi a-mours en can-tant es-sau-cier.\\nEn-cor i a meil-lour rai-son par coi\\nje doi can-ter d\'a-mou-reus de-si-rier,\\ncar sans ma-ne-cier\\nsui el cuer trais et fe-rus\\nd\'uns vairs ieus ses et a-gus,\\nri-ans pour mieus as-se-ner:\\na cou ne puet con-tres-ter\\nhau-bers ni es-cus.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0117\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2054, 'Dame, or sui trais', 'Linker 2.42', 'Adam de la Halle', 'French', 'a', '55v', 1, 1, '[\"C3 cha h c ed c\\ncha GF \'C3 a(h) aG\\nG a h c d cba GF \'F4 E F\\ncha h c ed c\\ncha ? ? \'\\nC2 cha h c ed c\\nchaG(a) GF EF aG\\nGFG \'C2 a h c d cba GF E F\\ncha \'C2 h c ed c cha GF EF aG\\nGFG a h \'C2 c d cba GF E F\",\"C3 cha h c ed c \'cha GF\\nC3 a(h) aG \'G a h c d cba GF\\nF4 E F \'cha h c ed c \'cha ? ? \'\\nC2 cha h c ed c \'chaG(a) GF EF aG \'GFG\\nC2 a h c d cba GF E F \'cha\\nC2 h c ed c cha GF EF aG \'GFG a h\\nC2 c d cba GF E F\"]', '[\"Da-me,_or sui tra-ïs\\nper l\'o-coi-son\\nde vos ieus qui sont pri-vé lar-ron.\\nEt par vo dous ris,\\nda-me [...]\\nCar il est as-sis\\nsus cuer fe-lon,\\ndont j\'a-piau vo vis de tra-ï-son.\\nDa-me, or sui traïs\\nper l\'o-coi-son\\nde vos iex qi sont pri-vé lar-ron.\"]', '[\"Notes:\\n5: the verse 5 was partially omitted.\\n7.2-4: G a h scraped off and substituted with a h c.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0118\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2055, 'Je me cuidoie bien tenir', 'Linker 66.2', 'Gaidifer d\'Avion', 'French', 'a', '56r', 1, 1, '[\"F3 F a G F E F G F\\nb a \'F3 G a GFE F G F\\nF \'F3 a G F E F G F\\nb \'F4 a G a GFE F G F\\nc(h)c(h) \'F4 a G FE F G a G \'\\nF4 G F G a G F GEF F\\na \'C2F4 d e fde e c(h)c(h) aGFG F\\na G \'F4 FED C D F G F\\nFE F \'F3 G a G F GEF F\",\"F3 F a G F E F G F \'b a\\nF3 G a GFE F G F \'F\\nF3 a G F E F G F \'b\\nF4 a G a GFE F G F \'c(h)c(h)\\nF4 a G FE F G a G \'\\nF4 G F G a G F GEF F \'a\\nC2F4 d e fde e c(h)c(h) aGFG F \'a G\\nF4 FED C D F G F \'FE F\\nF3 G a G F GEF F\"]', '[\"Je me cui-doi-e bien te-nir\\nd\'es-tre_en-voi-siés d\'o-re_en a-vant,\\nmais jou ne puis a-voir loi-sir\\nde fai-re nul aut-re con-mant\\nfors d\'a-mour, qui me fait pre-sent\\nde la meil-lour que sai coi-sir;\\ns\'ai en li mis cuer et de-sir\\npour li ser-vir a son ta-lent\\nsans par-tir a tout mon vi-vant.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0119\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2056, 'Par grant esfors m\'estuet dire et canter', 'Linker 66.4', 'Gaidifer d\'Avion', 'French', 'a', '56v-57r', 1, 1, '[\"C2 a c chca h c \'C2 d h(a)h(a) G aF G\\nF E \'C2 F G a G c h dd(c) ha(h) G \'\\nC2 a c chca h c d h(a)h(a) G \'C2 aF G\\nF E F G a \'C2 G c h dd(c) ha(h) G\\ne(d)e(d) c(d) \'C3 ed c e f g f edc fe d \'\\nC2 d cha c h(a)h(a) G a h d \'C3 dc d\\ne f edc hah d \'C3 c e g fd h\\nG c \'C3 h a e f ede c d(c)d(c) hah aG\",\"C2 a c chca h c\\nC2 d h(a)h(a) G aF G \'F E\\nC2 F G a G c h dd(c) ha(h) G \'\\nC2 a c chca h c d h(a)h(a) G\\nC2 aF G \'F E F G a\\nC2 G c h dd(c) ha(h) G \'e(d)e(d) c(d)\\nC3 ed c e f g f edc fe d \'\\nC2 d cha c h(a)h(a) G a h d\\nC3 dc d \'e f edc hah d\\nC3 c e g fd h \'G c\\nC3 h a e f ede c d(c)d(c) hah aG\"]', '[\"Par grant es-fors m\'es-tuet di-re_et can-ter;\\nne me muet pas de joi-e mais de ra-je,\\nsi cou-me cil qi ne puet mais trou-ver\\ncon-fort en soi de ga-rir son ma-la-ge;\\nains quit aus-si con der-vés, qant er-ra-je;\\nqui ne puet plus son co-ra-ge che-ler.\\nPour çou m\'es-tuet en haut plain-dre_et crï-er\\nque ma do-lours de noi-ent n\'a-sou-a-je.\"]', '[\"Notes:\\n2.11: aG scraped off and substituted with G.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0120\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2057, 'Las, pour koi ris ne jus ne cant', 'Linker 66.3', 'Gaidifer d\'Avion', 'French', 'a', '57r-v', 1, 1, '[\"F3 F G a h a G \'F4 GFE F\\na h a G a \'C2 c haG(a) c\\nF G a b a \'F4 G GFE F\\na h a G a \'C2 c haG(a) c\\nF FEF G FED \'F3 E F EDE C\\nD \'F4 F G G F E G(a) G\\na c c(h)c(h) aG \'F3 a ha G FG\\nF E(F) G C \'F3 D F GaG G\",\"F3 F G a h a G\\nF4 GFE F \'a h a G a\\nC2 c haG(a) c \'F G a b a\\nF4 G GFE F \'a h a G a\\nC2 c haG(a) c \'F FEF G FED\\nF3 E F EDE C \'D\\nF4 F G G F E G(a) G \'a c c(h)c(h) aG\\nF3 a ha G FG \'F E(F) G C\\nF3 D F GaG G\"]', '[\"Las, pour koi ris ne jus ne cant,\\nqant en moi ne truis o-qoi-son\\npar koi doi-e_a-voir cuer joi-ant\\nne ren-voi-sier se do-lans non?\\nCar grans es-poir, dont j\'euc grant dont,\\nm\'est si tous a-lés a noi-ant\\nque de çou que vois de-si-rant\\nn\'a-tent con-fort ne ga-ri-son.\"]', '[\"Notes:\\n6.9: F scraped off and substituted with G.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0121\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2058, 'Amours ki sur tous a pooir', 'Linker 66.1', 'Gaidifer d\'Avion', 'French', 'a', '57v-58r', 1, 1, '[\"C3 g +a g fed c d \'C3 c haG\\na h c h(c) haG h \'C4 ha G\\ng +a g fed c d c \'C3 haG\\na h c h(c) haG h ha G \'\\nC2 a h c haG d e fed d \'\\nC3 g g e(f) ed e f e d \'\\nC3 c e fed ee(d) h d c(d) e(f) \'\\nF3 a G FED E F ED EC C\",\"C3 g +a g fed c d\\nC3 c haG \'a h c h(c) haG h\\nC4 ha G \'g +a g fed c d c\\nC3 haG \'a h c h(c) haG h ha G \'\\nC2 a h c haG d e fed d \'\\nC3 g g e(f) ed e f e d \'\\nC3 c e fed ee(d) h d c(d) e(f) \'\\nF3 a G FED E F ED EC C\"]', '[\"A-mours, ki sur tous a po-oir\\nplus que nus prin-ces sur sa gent,\\nme mai-ne si a son vo-loir\\nque moi nu-le rai-son ne sent;\\nsi m\'es-mer-veil mult du-re-ment\\nde li, qant si me fait do-loir\\net maint aut-re grant joi-e_a-voir,\\nqui ne font pas si son ta-lent.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0122\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2059, 'Qant dieus ne veut, tout si saint n\'ont pooir', 'Linker 66.5', 'Gaidifer d\'Avion', 'French', 'a', '58r-v', 1, 1, '[\"F3 FGa G F(E) D F \'F3 E C DE ED C\\nE F \'F3 G aGF a h c(h) a hG G \'\\nF3 FGa G F(E) D F E C DE \'F3 ED C\\nE F G aGF a h \'C2 c(h) a hG G\\ncc(h) G G(F) E G aG F \'F3 EDC E(F) ED\\nC G aG F a h \'F3 ch G E FED E\\nG a hG E G ah ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ? ? \'\",\"F3 FGa G F(E) D F\\nF3 E C DE ED C \'E F\\nF3 G aGF a h c(h) a hG G \'\\nF3 FGa G F(E) D F E C DE\\nF3 ED C \'E F G aGF a h\\nC2 c(h) a hG G \'cc(h) G G(F) E G aG F\\nF3 EDC E(F) ED \'C G aG F a h\\nF3 ch G E FED E \'G a hG E G ah ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ? ? \'\\n? ? ? ? ? ? ? ? ? ? ?\\n\"]', '[\"Qant Dieus ne veut, tout si saint n\'ont po-oir\\nd\'un ho-me_a-dier, tant li sa-cent proi-ier.\\npuis qu\'il cou-men-ce_au-cun a mes-cha-oir,\\nnus ne li puet son mal e-ür can-gier.\\nEn-si est il de moi, au droit ju-gier,\\nqant de ce-li ne puis a-voir a-ï-e\\nqui me por-roit ga-rir ma me-ses-tan-ce;\\net jou le truis a-dés en ma nui-san-ce.\\nCon plus le serf et plus m\'est a-ne-mi-e.\"]', '[\"Notes:\\n7.7-9.11: three staves were left blank in the manuscript (58v).\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0123\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelo