(2061, 'Je sui cieus ki tous jors foloie', 'Linker 127.6', 'Jaque le Vinier', 'French', 'a', '59r-v', 1, 1, '[\"F3 a a a F Gab a \'F3 G aGa(h) aGF\\nC H D F F G a \'F3 G F FG\\na a a F \'F3 Gah a G aGa(h) aGF\\nC H D F \'F3 F G a G F FG\\na c \'F3 c h(a) GF Ga h c(h)c(h) aGF \'F4 G\\naGF a h cbaG F a \'C2b} b c b aGF G\\na c b ba \'C2 F a h c b} b aGF Ga\\na b c \'C2 a h(a) G ahaF G ah(a)h(a) aG\",\"F3 a a a F Gab a\\nF3 G aGa(h) aGF \'C H D F F G a\\nF3 G F FG \'a a a F\\nF3 Gah a G aGa(h) aGF \'C H D F\\nF3 F G a G F FG \'a c\\nF3 c h(a) GF Ga h c(h)c(h) aGF\\nF4 G \'aGF a h cbaG F a\\nC2b} b c b aGF G \'a c b ba\\nC2 F a h c b} b aGF Ga \'a b c\\nC2 a h(a) G ahaF G ah(a)h(a) aG\"]', '[\"Je sui cieus ki tous jors fo-loi-e\\nne de mer-ci ne peut ainc a-che-ver,\\nmais sains con-quest a-dés em-ploi-e\\nmoi et ma pai-ne_en loi-au-ment a-mer.\\nAin-si m\'es-tuet mon vo-loir con-pe-rer,\\ndont a tous jours ai do-lour re-ce-ü-e.\\nLas, c\'est a tort que j\'ai joi-e per-du-e;\\ntrop mi a fait loi-al a-mour fï-er.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0125\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2063, 'Fines amours, qui j\'ai mon cuer douné', 'Linker 127.5', 'Jaque le Vinier', 'French', 'a', '60r', 1, 1, '[\"C2 h c d d(e) d c h \'F4 c d(c)d(c) ha\\nh d c ch a \'C2 ha G F G G\\nh c d \'C2 d(e) d c h c d(c)d(c) ha\\nh d \'C2 c ch a ha G F G G \'\\nC3 c(h)c(h) G h d e ef(e)f(e) d \'C3 c d d\\nd e f g g \'C3 g f ed efe ed\\nd e f \'C3 g f d c h c(h)c(h) aGa\\nF \'F4 G a h c dG ahc h h(a)h(a) aG\",\"C2 h c d d(e) d c h\\nF4 c d(c)d(c) ha \'h d c ch a\\nC2 ha G F G G \'h c d\\nC2 d(e) d c h c d(c)d(c) ha \'h d\\nC2 c ch a ha G F G G \'\\nC3 c(h)c(h) G h d e ef(e)f(e) d\\nC3 c d d \'d e f g g\\nC3 g f ed efe ed \'d e f\\nC3 g f d c h c(h)c(h) aGa \'F\\nF4 G a h c dG ahc h h(a)h(a) aG\"]', '[\"Fi-nes A-mours, qui j\'ai mon cuer dou-né,\\ncon fins a-mis loi-aus sans re-pen-tir,\\net dous sam-blans qui m\'a en-pri-sou-né\\nen la mer-ci ma da-me,_a son plai-sir,\\nfont tant en moi lor con-mant a-be-lir\\nplus c\'on-ques mais me truis en-a-mou-ré\\nde son cler vis vrai-e-ment co-lou-ré\\nou jou ma joi-e et ma vie re-mir.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0127\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2064, 'De loial amour jolie', 'Linker 127.4', 'Jaque le Vinier', 'French', 'a', '60v', 1, 1, '[\"C2 c h a hh(a) aG aGF G G \'\\nF3 D E G G a h(a)h(a) aG \'\\nC2 c h a h(a)h(a) aG aGF G G\\nD E \'F4 G G a h(a)h(a) aG\\nc c a \'C2 c hh(a) aGF G\\nb} b c d b \'C2b} c aG FGa b\\na c bb(a) aG\\nD F G \'F4b} b bab G aGF G\",\"C2 c h a hh(a) aG aGF G G \'\\nF3 D E G G a h(a)h(a) aG \'\\nC2 c h a h(a)h(a) aG aGF G G \'D E\\nF4 G G a h(a)h(a) aG \'c c a\\nC2 c hh(a) aGF G \'b} b c d b\\nC2b} c aG FGa b \'a c bb(a) aG \'D F G\\nF4b} b bab G aGF G\"]', '[\"De loi-al a-mour jo-li-e\\nvau-rai un chant cou-men-cier.\\nMon cuer a en sa bail-li-e,\\nja-mais par-tir ne l\'en kier,\\ncar en de-dui-sant mes-tier\\na tou-te joi-e_a-con-pli-e\\nen sa vi-e,\\nki tant sert kil a a-mi-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0128\", \"custos\": \"[null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2065, 'Pour cou je se j\'aim et jou ne sui amés', 'Linker 232.5', 'Robert du Chastel', 'French', 'a', '61r', 1, 1, '[\"C2 c c c d d a G(a) \'F4 G F E\\nD E C F F G \'F4 a(h) a G FEDC D\\nc c c d d \'F3 a G(a) G F E\\nD E C F F G \'F4 a(h) a G FEDC D\\nF G a \'F4 G a h c h a GaG F \'\\nF4 a h c h c d cc(h) a \'F4 G a\\nd c d f e d ed d \'F4 dc d\\nc d c a G \'F4 F G a G FED C\\nD C D F \'F3 a G a F G FE D\",\"C2 c c c d d a G(a)\\nF4 G F E \'D E C F F G\\nF4 a(h) a G FEDC D \'c c c d d\\nF3 a G(a) G F E \'D E C F F G\\nF4 a(h) a G FEDC D \'F G a\\nF4 G a h c h a GaG F \'\\nF4 a h c h c d cc(h) a\\nF4 G a \'d c d f e d ed d\\nF4 dc d \'c d c a G\\nF4 F G a G FED C \'D C D F\\nF3 a G a F G FE D\"]', '[\"Pour cou je se j\'aim et jou ne sui_a-més,\\nn\'ai pas ta-lent que me-te_en ou-bli-an-ce\\nce-li de qui vient ma jo-lie-ve-tés;\\ncar s\'e-le ja n\'a-voit cuer ne voeil-lan-ce\\nd\'a-me-nui-sier ma tres dou-ce gre-va-nce,\\nsi me doi jou de fi-ne_A-mour lö-er;\\ncar par li ai le sa-ve-reus pen-ser\\npar coi jou cant por la tres be-le fran-ce\\nen qui bon-tés maint et sens et vail-lan-ce.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0129\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2066, 'Bien ait amours qui m\'a douné l\'usaje', 'Linker 232.2', 'Robert du Chastel', 'French', 'a', '61v', 1, 1, '[\"C2 c d h c ha G \'C2 F G a(h) aF G\\na c dcb a \'C2b} F Ga(h) aG F EDC D\\nc d h \'C2 c ha G F G a(h) aF G \'\\nC2 a c dcb a F Ga(h) aG F EDC \'C2 D\\nE F G FED F\\na h c \'F4 F G abaG a\\nd d d c h \'F4 c d h a Gaha GF\\nG(a) G FED \'F3 EC G F Ga(h) a GFFE \'F3 D\",\"C2 c d h c ha G\\nC2 F G a(h) aF G \'a c dcb a\\nC2b} F Ga(h) aG F EDC D \'c d h\\nC2 c ha G F G a(h) aF G \'\\nC2 a c dcb a F Ga(h) aG F EDC\\nC2 D \'E F G FED F \'a h c\\nF4 F G abaG a \'d d d c h\\nF4 c d h a Gaha GF \'G(a) G FED\\nF3 EC G F Ga(h) a GFFE\\nF3 D\"]', '[\"Bien ait a-mours qui m\'a dou-né l\'u-sa-je\\nde cans trou-ver et d\'a-mer loi-au-ment.\\nJe la veil bien ser-vir tout mon e-a-ge,\\ncar nus ne puet viv-re jo-lï-e-ment\\nsans A-mour ser-vir;\\ncas-cun i doit o-be-ïr.\\nKi bien la sert, il est en bon es-ta-ge,\\nse drois ne ment, d’a hau-te_hou-nour ve-nir.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0130\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2067, 'Nus fins amans ne se doit esmaier', 'Linker 232.4', 'Robert du Chastel', 'French', 'a', '62r', 1, 1, '[\"C2 dd(c) h c d d d \'F3 c(d) c haG F\\nb} b b G a \'F4 G F EDE D C D\\nd(c)d(c) h c \'F4 d d d c(d) c haG F \'\\nF3b} b b G a G F EDE D \'F4 C D\\nE F a G G F \'F4 G FE D F\\nc c c a(h) \'F3b} a G F(G) G F EDC D\\nd c d(c)d(c) \'F4 haG F E D F F(G) FED C \'\\nF4b} G a b a c d efe d c d \'\\nF4 c d G F G a \'F3 C D E GFFE D\",\"C2 dd(c) h c d d d\\nF3 c(d) c haG F \'b} b b G a\\nF4 G F EDE D C D \'d(c)d(c) h c\\nF4 d d d c(d) c haG F \'\\nF3b} b b G a G F EDE D\\nF4 C D \'E F a G G F\\nF4 G FE D F \'c c c a(h)\\nF3b} a G F(G) G F EDC D \'d c d(c)d(c)\\nF4 haG F E D F F(G) FED C \'\\nF4b} G a b a c d efe d c d \'\\nF4 c d G F G a\\nF3 C D E GFFE D\"]', '[\"Nus fins a-mans ne se doit es-mai-er\\npour mal d\'a-mor; car qant il est en-si\\nque loi-aus cuers ki ai-me sans tri-chier\\nsert sans a-voir re-cou-vrier de mer-ci,\\nal mains le tient a-mours net et jo-li,\\ndont il vaut mieus tous les jours de sa vi-e.\\nEt s\'ai-me mieus li hom en-trués kil pri-e,\\nque s\'on li o-tri-oit son de-si-rier,\\ntant vaut a-mors k\'e-le_est bien con-voi-ti-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0131\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2068, 'On me reprent d\'amour qui me maistrie', 'Linker 158.1', 'Jehan le Petit', 'French', 'a', '62v-63r', 1, 1, '[\"C1 c d c(h)c(h) aGF G a G FED \'F3 C DE F\\nE F G a GG(F) ED \'F3 C F EDC D\\nc d cc(h) \'F4 aGF G a G FED C DE F\\nE F \'F3 G a(G)a(G) G(F) ED C F EDC D \'\\nF3b} D a b aGF a b c b \'F3b} aGa G\\na(G) F E F a c \'C2 d c haG a\\nc(h)c(h) a G FED \'F3 C D E G ah ch a\\nG a \'F3b} baG a G F G a(G)a(G) F GFFE D\",\"C1 c d c(h)c(h) aGF G a G FED\\nF3 C DE F \'E F G a GG(F) ED\\nF3 C F EDC D \'c d cc(h)\\nF4 aGF G a G FED C DE F \'E F\\nF3 G a(G)a(G) G(F) ED C F EDC D \'\\nF3b} D a b aGF a b c b\\nF3b} aGa G \'a(G) F E F a c\\nC2 d c haG a \'c(h)c(h) a G FED\\nF3 C D E G ah ch a \'G a\\nF3b} baG a G F G a(G)a(G) F GFFE D\"]', '[\"On me re-prent d\'a-mour qui me mais-tri-e,\\nke fo-loi-e mes cuers quant le con-sent;\\nmais il n\'ont pas en lor cuer es-ta-bli-e,\\naus-si con j\'ai, biau-té, k\'a mi es-prent,\\nke fi-ne_a-mours mist en moi a loi-sir\\npar ra-men-brer, que mes ieus fist cueil-lir\\nen vi-ai-re d\'a-mou-reu-se_es-pe-ran-ce:\\ncar ains n\'a-ma ki de lui eut pois-san-ce.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0132\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2070, 'J\'ai amé trestout mon vivant', 'Linker 103.1', 'Guillaume Veau', 'French', 'a', '63r-v', 1, 1, '[\"C3 G G def e d b} cd cc(b) ba \'\\nC2b} F G ba c dd(c) baG aba \'C2 aG\\nG G def e d b} cd c(b)c(b) ba \'\\nC2b} F G ba c d(c)d(c) baG aba aG \'\\nC2b} b bab c d cb c cd fed \'\\nC3 d e f g f ff(e) ? dcd \'\\nC3b} b cd fed cd dcb c cd d \'\\nC3b} G Ga baG c cde d cba b\\nab(c) ba \'C3 haG a GF E FG G\",\"C3 G G def e d b} cd cc(b) ba \'\\nC2b} F G ba c dd(c) baG aba\\nC2 aG \'G G def e d b} cd c(b)c(b) ba \'\\nC2b} F G ba c d(c)d(c) baG aba aG \'\\nC2b} b bab c d cb c cd fed \'\\nC3 d e f g f ff(e) ? dcd \'\\nC3b} b cd fed cd dcb c cd d \'\\nC3b} G Ga baG c cde d cba b \'ab(c) ba\\nC3 haG a GF E FG G\"]', '[\"J\'ai a-mé tres-tout mon vi-vant,\\nk\'ains mais ne m\'o-sai en-har-dir\\nde chan-ter ne fai-re sam-blant\\nk\'a-mours me fe-sist riens sen-tir.\\nMais or ne puis plus sous-te-nir\\nsi grief fais, ne nus n\'e-üst tant\\nsou-fert nel cou-ve-nist mo-rir,\\ns\'il n\'a-mast es-ra-gï-e-ment:\\nce me fait loi-au-tes souf-frir.\"]', '[\"Notes:\\n6.7: one note missing in verse 6.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0133\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2071, 'S\'amours loiaus m\'a fait soufrir', 'Linlker 103.3', 'Guillaume Veau', 'French', 'a', '63v-64r', 1, 1, '[\"C2 c(d) cha h c d \'C2 f edc ch\\nc cd e fed \'C3 c(d) cha haG h\\nc(d) cha h \'C3 c d f edc ch\\nc cd e fed cd \'C3b} cba a(G) GF\\na a(G)a(G) F c(d) c baG \'C3 a cdch cd\\nf fe d ch d edc \'C2 c(h)c(h) aGFG a\\nb c d ef e edc \'C2 d ch\\nd ded c(h)c(h) aGF b aa(G) \'F3 GFE F\",\"C2 c(d) cha h c d\\nC2 f edc ch \'c cd e fed\\nC3 c(d) cha haG h \'c(d) cha h\\nC3 c d f edc ch \'c cd e fed cd\\nC3b} cba a(G) GF \'a a(G)a(G) F c(d) c baG\\nC3 a cdch cd \'f fe d ch d edc\\nC2 c(h)c(h) aGFG a \'b c d ef e edc\\nC2 d ch \'d ded c(h)c(h) aGF b aa(G)\\nF3 GFE F\"]', '[\"S\'a-mours loi-aus m\'a fait sou-frir\\nsans nu-le riens guer-re-dou-ner,\\npour Dieu, ne me fa-ce mo-rir\\nen li ser-vir, ki sans faus-ser\\nl’ai ser-vie tres to-te ma vi-e\\nsans ba-rat et sans tre-che-ri-e.\\nA-mours ne doit pas ou-blï-er\\ncuer ki veut loi-au-ment a-mer.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0134\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2074, 'Meudre ocoison n\'euc onques de chanter', 'Linker 103.2', 'Guillaume Veau', 'French', 'a', '64r-v', 1, 1, '[\"C2 d e dh cc(h) a G \'F4 F Ga cca h\\nd(e) d hG G \'C2 F Ga cc(h) aG FG G\\nd e dh c(h)c(h) \'C2 a G F Ga cca h\\nd(e) d hG \'C3 G F Ga cc(h) aG F G\\na \'C2 c hchG a\\nC3 h d efgf e d c(h)c(h) aGa(G)a(G) GF \'\\nC3 a c def e d c cha \'C3 c\\nc ha ah c ha Ga baG F \'\\nC3 a cd e(f) ed c dcha ah c\",\"C2 d e dh cc(h) a G\\nF4 F Ga cca h \'d(e) d hG G\\nC2 F Ga cc(h) aG FG G \'d e dh c(h)c(h)\\nC2 a G F Ga cca h \'d(e) d hG\\nC3 G F Ga cc(h) aG F G \'a\\nC2 c hchG a \'C3 h d efgf e d c(h)c(h) aGa(G)a(G) GF \'\\nC3 a c def e d c cha\\nC3 c \'c ha ah c ha Ga baG F \'\\nC3 a cd e(f) ed c dcha ah c\"]', '[\"Meud-re_o-coi-son n\'euc on-ques de chan-ter\\ncar fi-ne_a-mors le me con-man-de_ain-si\\net ma da-me qui j\'en voeil mer-cï-er,\\ncar on-qes mais n\'euc nul con-mant de li,\\nsi l\'en mer-ci\\net a-mours ki si as-se-ner\\nme vaut, dont chas-cuns es-ba-his\\nse-roit, s’il sa-voit que pen-sis\\nfuis-se d’en si haut lieu a-mer.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0135\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2075, 'Loial amours ne puet nus esprisier', 'Linker 17.1', 'Baude au Grenon', 'French', 'a', '64v-65r', 1, 1, '[\"C2 a h c c h d \'C3 c h h(a)h(a) aG\\na(h) a G F \'C2 a c h(a) G aha G\\na \'C2 h c c h d c h h(a)h(a) \'C2 aG\\na(h) a G F a c h(a)h(a) \'C2 G aha G\\nh c d d e fed c h h(a)h(a) \'C2 aG\\ncha h c c h d d h \'C2 h(a)h(a) aG\\nE F G G G \'C2 F Ga h a haG\\ndd(c) ha haG F \'C2 F Ga haG F FE F\",\"C2 a h c c h d\\nC3 c h h(a)h(a) aG \'a(h) a G F\\nC2 a c h(a) G aha G \'a\\nC2 h c c h d c h h(a)h(a)\\nC2 aG \'a(h) a G F a c h(a)h(a)\\nC2 G aha G \'h c d d e fed c h h(a)h(a)\\nC2 aG \'cha h c c h d d h\\nC2 h(a)h(a) aG \'E F G G G\\nC2 F Ga h a haG \'dd(c) ha haG F\\nC2 F Ga haG F FE F\"]', '[\"Loi-al a-mours ne puet nus es-pri-sier,\\nmais ne l\'a pas teus en cui-de_es-tre fis.\\nPour moi le di: ki ma da-me_a mains chier,\\nque plus li sui droi-tu-riers et a-mis;\\ncar e-le m\'a o-tri-é et pra-mis\\nque m\'a-me-ra loi-au-ment sans tri-chier.\\nEt par sam-blant me fait a-dés cui-dier\\nk\'ai-e son cuer, dont au-tres est sai-sis.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0136\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2076, 'Fueilles ne flours ne mi font pas chanter', 'Linker 108.1', 'Henri Amion', 'French', 'a', '65r-v', 1, 1, '[\"F4 F E F ED F G \'F3 FE F EDC D\\nE F E(F) ED \'F3 ED C D E F EDC D\\nF \'F3 E F ED F G FE F EDC D \'\\nF3 F F E(F) ED ED C D E F \'F3 EDC D\\nE G Ga(G)a(G) C D E \'F3 FG FED E(D) C\\nD EF G \'F3 a b a G F G aGF G\\na \'F3 b aa(G) ED C D EF G aGF ED \'\\nF2 C D F ED C E \'F3 G aGF G FEE(D) DC\",\"F4 F E F ED F G\\nF3 FE F EDC D \'E F E(F) ED\\nF3 ED C D E F EDC D \'F\\nF3 E F ED F G FE F EDC D \'\\nF3 F F E(F) ED ED C D E F\\nF3 EDC D \'E G Ga(G)a(G) C D E\\nF3 FG FED E(D) C \'D EF G\\nF3 a b a G F G aGF G \'a\\nF3 b aa(G) ED C D EF G aGF ED \'\\nF2 C D F ED C E\\nF3 G aGF G FEE(D) DC\"]', '[\"Fueil-les ne flours ne mi font pas chan-ter,\\nne biaus es-tés n\'i-vers, qant il re-pai-re;\\nmais ma da-me, ki tant a le vis cler\\net tant est sa-ge_et dou-ce_et de-bo-nai-re,\\ncan-ter me fait. Car quant puis re-mi-rer\\nson biau gent cors et son sim-ple vi-ai-re,\\nmult le doi bien ser-vir et hou-ne-rer;\\ncar tous les biens puet on de li re-trai-re.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0137\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2077, 'Com plus aim et mains ai joie', 'Linker 174.1', 'Maihieu de Gant', 'French', 'a', '66r', 1, 1, '[\"C2 G Ga h haG c \'C2 cha h h\\nd edc h haG F Ga aG \'\\nC2 G Ga h haG c cha h h \'\\nC3 d edc h haG F Ga aG\\nh c \'C3 d e c dch ha\\nd c h \'C2 a h haG a GF\\nG c d \'C2b} G a bc b aGF\\na bc d e(d)e(d) \'C3 c c dcde\\ng fed d c d cha hc \'\\nC2 d e c d c(h) cha aG\\nF \'C2 a c dch a(G) GF G\",\"C2 G Ga h haG c\\nC2 cha h h \'d edc h haG F Ga aG \'\\nC2 G Ga h haG c cha h h \'\\nC3 d edc h haG F Ga aG \'h c\\nC3 d e c dch ha \'d c h\\nC2 a h haG a GF \'G c d\\nC2b} G a bc b aGF \'a bc d e(d)e(d)\\nC3 c c dcde \'g fed d c d cha hc \'\\nC2 d e c d c(h) cha aG \'F\\nC2 a c dch a(G) GF G\"]', '[\"Com plus aim, et mains ai joi-e\\net plus en de-üs-se_a-voir;\\nmais li maus pas ne m\'a-noi-e\\npour le sou-las que j\'es-poir\\nde la plus be-le_a a-voir\\nque four-mast on-qes na-tu-re.\\nRiens n\'i faut, fors que trop du-re\\nle truis et sans gher-re-don;\\net si ne sai la rai-son,\\nfors tant qu\'e-le_a es-prou-vé\\nque j\'ai loi-au-ment a-mé.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0139\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2078, 'On ne puet bien a deus seignours servir', 'Linker 214.2', 'Raoul de Ferrieres', 'French', 'a', '67r', 1, 1, '[\"F3 D F Ga a a a \'F3 a h aG a\\nc a F G \'F3 a(h) a(G) FED F FG a\\nD \'F3 F Ga a a a a h \'F3 aG a\\nc a F G a(h) a(G) \'F4 FED F FG a\\nF E DEFEC F G \'F3 a h aG a\\nc d c \'F3 haG a hc h a a GFG F\\nF G \'F3 a GFE F G FE D EFEC C \'\\nF4 cd c h a G F GF G a \'F4 GFE D\\nC D DC F FGa GFE DC Ga \'F2 GFFE D\",\"F3 D F Ga a a a\\nF3 a h aG a \'c a F G\\nF3 a(h) a(G) FED F FG a \'D\\nF3 F Ga a a a a h\\nF3 aG a \'c a F G a(h) a(G)\\nF4 FED F FG a \'F E DEFEC F G\\nF3 a h aG a \'c d c\\nF3 haG a hc h a a GFG F \'F G\\nF3 a GFE F G FE D EFEC C \'\\nF4 cd c h a G F GF G a\\nF4 GFE D \'C D DC F FGa GFE DC Ga\\nF2 GFFE D\"]', '[\"On ne puet bien a deus sei-gnours ser-vir\\nle-ge-re-ment, sans noi-se_et sans ten-çon;\\npour ce me fait main-te_en-ten-te guer-pir\\nnou-ve-le_a-mour ki m\'a en sa pri-son.\\nSi mes joi qant por a-mer me duel,\\ncar par mon mal ai de joi-e_es-pe-ran-ce;\\nsi can-te-rai par droit mieus que ne seul,\\nqant de si haut don sui en a-ten-dan-ce\\ncon de la riens que plus de-sir et vueul.\"]', '[\"Attribuita a Simon d\' Autie\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0141\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2082, 'Boine amours ki m\'agrée', 'Linker 77.5', 'Gautier d\'Espinau', 'French', 'a', '67v', 1, 1, '[\"C1 F G Ga F ahch ha G \'\\nF4 a h a G aGF G\\nF G \'F4 Ga F ahch ha G\\na h a \'F3 G GF Ga\\nD a GFE D C FGa G \'\\nF4b} a b cd ca ba G\\na \'F3 h c F GaG GF\\nG a D F FG ba Ga \'\\nF3 F b} c baG aG GF bbaG\",\"C1 F G Ga F ahch ha G \'\\nF4 a h a G aGF G \'F G\\nF4 Ga F ahch ha G \'a h a\\nF3 G GF Ga \'D a GFE D C FGa G \'\\nF4b} a b cd ca ba G \'a\\nF3 h c F GaG GF \'G a D F FG ba Ga \'\\nF3 F b} c baG aG GF bbaG\"]', '[\"Boi-ne_a-mours ki m\'a-gré-e\\nme plaist a-main-te-nir;\\nmais ma joi-e_ont trou-blé-e\\nma pai-ne_et mi sou-pir,\\nk\'ai trait en re-ce-lé-e.\\nSi mes mer-veil cou-ment\\nj\'ai nul a-ï-re-ment\\nen ma li-e pen-sé-e,\\ndont si grant joi-e_a-tent.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0142\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2083, 'Nouvele amour u j\'ai mis mon penser', 'Linker 38.12', 'Chastelain de Coucy', 'French', 'a', '67v-68r', 1, 1, '[\"C1 F EDC DE F a h c \'F3 c aF Ga\\nG E F EDC \'F3 G aG FF(E) D C DE F\\nF EDC \'F3 DE F a h c c aF Ga \'\\nF3 G E F EDC G aG FF(E) D C \'F3 DE F\\nFF(E) D E F G F E \'F3 F Gab aa(G)\\nF G F E G F \'F3 a(G) a h c\\nd c(h) aGF FE F \'F3 G a h a GFE G\\na h c(h) aGF \'F3 E D C G a(G) GFE F\",\"C1 F EDC DE F a h c\\nF3 c aF Ga \'G E F EDC\\nF3 G aG FF(E) D C DE F \'F EDC\\nF3 DE F a h c c aF Ga \'\\nF3 G E F EDC G aG FF(E) D C\\nF3 DE F \'FF(E) D E F G F E\\nF3 F Gab aa(G) \'F G F E G F\\nF3 a(G) a h c \'d c(h) aGF FE F\\nF3 G a h a GFE G \'a h c(h) aGF\\nF3 E D C G a(G) GFE F\"]', '[\"Nou-ve-le_a-mour u j\'ai mis mon pen-ser\\nme fait chan-ter de la plus de-boi-nai-re\\nc\'on puist el mont ne ve-oir ne trou-ver;\\nsi m\'en se-mont mes cuers de joi-e fai-re.\\nEt qant j\'ai mis en li m\'en-ten-tï-on,\\ndont ne doi je chan-ter se de li non?\\nTout mi pen-ser sont a ma dou-ce_a-mi-e,\\npuis que je sai mon cuer en sa bail-li-e.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0142\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2084, 'Onques n\'amai tant que jou fui amee', 'Linker 223.11', 'Richart de Fournival', 'French', 'a', '68v', 1, 1, '[\"F2 a a(G)a(G) a(G) FE F G a \'F3 D EFG FED C\\nc(h)c(h) aG a(G) FE G EC D \'F3 EFG E FED\\na a a FE F \'F3 G a D EFG FED C\\ncc(h) aG \'F3 a-FEF G G EC D EFG E FED\\nG \'F3 Ga c aG c hcd G aGF G ahaG a \'\\nF3 D F ? EDC G ah c(h)c(h) aG \'F3 a(G)a(G) FED C\\nD F EDC F a a(G) FE FG \'F3 E FED\\ndd(c) G-G(a) GF Ga c hc a \'F4 G a(G) FED C\\nD F G aGF G a \'F3 FE FG E FED\",\"F2 a a(G)a(G) a(G) FE F G a\\nF3 D EFG FED C \'c(h)c(h) aG a(G) FE G EC D\\nF3 EFG E FED \'a a a FE F\\nF3 G a D EFG FED C \'cc(h) aG\\nF3 a-FEF G G EC D EFG E FED \'G\\nF3 Ga c aG c hcd G aGF G ahaG a \'\\nF3 D F ? EDC G ah c(h)c(h) aG\\nF3 a(G)a(G) FED C \'D F EDC F a a(G) FE FG\\nF3 E FED \'dd(c) G-G(a) GF Ga c hc a\\nF4 G a(G) FED C \'D F G aGF G a\\nF3 FE FG E FED\"]', '[\"On-ques n\'a-mai tant que jou fui a-me-e;\\nor m\'en re-pent, se ce pe-üst va-loir,\\nq\'a-mours m\'a-voit au meil-lour as-se-ne-e,\\npour tou-te_hou-nour et tou-te joi-e_a-voir,\\net au plus bel de tou-te la con-tre-e;\\nmais o-re a_il au-trui s\'a-mour dou-ne-e,\\nqi vo-len-tiers a soi l\'a re-te-nu.\\nLas-se, pour koi fui je de me-re ne-e!\\nPar mon or-guel ai mon a-mi per-du.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0144\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\"