(2085, 'Loiaus amours et desiriers de joie', 'Linker 41.8', 'Colart le Boutellier', 'French', 'a', '69r', 1, 1, '[\"C2 d c hh(G) aG F \'C2 DC G a h ch ha\\nh(a) G F G F \'C2 G a h h(a) aG\\nd c hh(G) aG \'C2 F DC G a h ch ha\\nh(a) \'C2 G F G F G a h h(a) aG \'\\nC2 G h c(h) ha h ed c dh \'C2 haG G\\ne e C3 g fed h a ah h \'C2 d ch(c) ha\\nd c d(c) haG G \'C2 a h d e dcha G\\nF G \'C2 F a h d(c) h(a) G a hG\",\"C2 d c hh(G) aG F\\nC2 DC G a h ch ha \'h(a) G F G F\\nC2 G a h h(a) aG \'d c hh(G) aG\\nC2 F DC G a h ch ha \'h(a)\\nC2 G F G F G a h h(a) aG \'\\nC2 G h c(h) ha h ed c dh\\nC2 haG G \'e e C3 g fed h a ah h\\nC2 d ch(c) ha \'d c d(c) haG G\\nC2 a h d e dcha G \'F G\\nC2 F a h d(c) h(a) G a hG\"]', '[\"Loi-aus a-mours et de-si-riers de joi-e\\net vo-len-tes que j\'ai de de-ser-vir\\nle guer-re-don q\'a-mours dou-né_et o-tri-e\\nchiaus qui de cuer ai-ment sans re-pen-tir:\\ntout che me fait chan-ter et es-jo-ïr\\net ma da-me ser-vir en sa ma-nai-e\\nne ja, pour mal ne pour bien que j\'en ai-e,\\nn\'en kier mon cuer os-ter ne de-par-tir.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0145\", \"custos\": \"[null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58);
