(2086, 'Amours et bone esperanche', 'Linker 41.1', 'Colart le Boutellier', 'French', 'a', '69v', 1, 1, '[\"F3 a a G FE F FGa \'F3 G FED\\nC DE G Ga G FED D \'\\nF3 a a G FE F FGa G FED\\nC \'F3 DE G Ga G FED D\\nE F G G G \'F4 aGF Ga\\na ah c ha h aG a\\na \'F3 EC D DE D EDC C\\nE G G(F) EDC \'F3 DE G E FE E(D) DC\\nH D \'F3 F FE E(D) E D EDC H C\",\"F3 a a G FE F FGa -\\nF3 G-FED \'C DE G Ga G FED D \'\\nF3 a a G FE F FGa G FED \'C\\nF3 DE G Ga G FED D \'E F G G G\\nF4 aGF Ga \'a ah c ha h aG a \'a\\nF3 EC D DE D EDC C \'E G G(F) EDC\\nF3 DE G E FE E(D) DC \'H D\\nF3 F FE E(D) E D EDC H C\"]', '[\"A-mours et bo-ne_es-pe-ran-che\\nde ma grant joi-e_a-chie-ver\\nm\'a dou-né for-che_et pois-san-che\\net vo-len-té de chan-ter\\net de ma da-me lö-er,\\nki tant a sens et va-lour;\\net de tant mer-chi A-mour\\nqu\'e-le dei-gna de-dens mon cors ve-nir,\\npren-dre le cuer et o soi re-te-nir.\",\"A-mours et bo-ne_es-pe-ran-che\\nde ma grant joi-e_a-chie-ver\\nm\'a dou-né for-che_et pois-san-che\\net vo-len-té de chan-ter\\net de ma da-me lö-er,\\nki tant a sens et va-lour;\\net de tant mer-chi A-mour\\nqu\'e-le dei-gna de-dens mon cors ve-nir,\\npren-dre le cuer et o soi re-te-nir.\"]', '[\"Notes:\\n1.7-8: Incorrect alignment of text and music.\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0146\", \"custos\": \"[null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": false, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignatu