(2092, 'O hoer vnde starker al mechtiger got', 'J Bop 1', 'Boppe', 'German', 'J', 'fol. 111v', 1, 1, '[\"C1 F F a c c d c c \'C1 hG a h c\\nc d c c \'C1 b} cba G a h ccha a GF F \'\\nC1 FGFED E F G E G E G ba aGE \'C1 F\\nF F a c c d c c \'C1 hG a h c\\nc d c c cba \'C1 G a h ccba a GF F\\nFGFED \'C1 E F G E G E G ba aGE F \'C1\\nFE D F G FE D F F \'C1\\nFE D F G FE D F F FEDC \'C1 D D\\nFE D F F FE \'C1 D F F\\nF G a \'C1 abc G F FED F F GF F \'C1\\nF F a c c d c c \'C1\\ncba G a h cchaG F FED F \'C1 F F F\\nF a b c cG \'C1 a c c C2\\ne f(e) d c d \'C1 c c hG a h c c\\nc \'C2 d e f(e) d c d c \'C1 cba G a h chaG GF F\\nF \'C2 a b c cG F E G G \'C1\\nGF F ED EFED C\\nF C D F FE \'C1 G a abc G F E G \'C1 ba aGE F\",\"C1 F F a c c d c c\\nC1 hG a h c \'c d c c\\nC1 b} cba G a h ccha a GF F \'\\nC1 FGFED E F G E G E G ba aGE\\nC1 F \'F F a c c d c c\\nC1 hG a h c \'c d c c cba\\nC1 G a h ccba a GF F \'FGFED\\nC1 E F G E G E G ba aGE F\\nC1 \'FE D F G FE D F F\\nC1 \'FE D F G FE D F F FEDC\\nC1 D D \'FE D F F FE\\nC1 D F F \'F G a\\nC1 abc G F FED F F GF F\\nC1 \'F F a c c d c c\\nC1 \'cba G a h cchaG F FED F\\nC1 F F F \'F a b c cG\\nC1 a c c C2 \'e f(e) d c d\\nC1 c c hG a h c c \'c\\nC2 d e f(e) d c d c\\nC1 cba G a h chaG GF F \'F\\nC2 a b c cG F E G G\\nC1 \'GF F ED EFED C \'F C D F FE\\nC1 G a abc G F E G\\nC1 ba aGE F\"]', '[\"O ho-er vn-de star-ker al mech-ti-ger got.\\nDurch dyn al-mech ti-cheit durch dich durch dyn ge bot.\\nVol ko-men gar an al-le mys-se-wen de.\\nDurch dy-ne ho-hen star-ken kla-ren go-te-heyt.\\nEyn vnd dry-val-tich wol ge-schi-cket in eyn kleyt.\\nE. wesẹn-de vreudẹ an a-ne-gen-ges en de\\nDurch dy-ne tugẹn-de ma-nic valt.\\nDurch dy-ne ho-en wir-de dir wol tzvn-gic.\\nDurch dy-ne bar-mvn_gẹ vn-ge-tzalt.\\nDurch wer-des men-schen bil-de dir wol klvn-gic.\\nDurch dy-ne hoch ge-lob-ten buͦrt.\\nDurch di-ne tu-gent-li-chen wird vr-sten-de.\\nDurch daz du von der hel-le vuͦrt.\\nTzv̊ hy-melẹ nach-tes durch daz du werẹ el-len-de.\\nDurch daz du men-sche wuͦr-de so habẹ stetẹ in dy-nen gna-den.\\nOb hie habẹ kegẹn dyr mis-se-tre-ten.\\nSo wes ge-be-ten.\\nVm den ir wel-ten meis-ter wert von wer-tze-burc con-ra den.\",\"Ob [in] vünf lan-den ûz-er-wün-schet ware ein helt,\\ndes lî-bes schoene, in gan-zen tugen-den ûz-er-welt,\\n_ triu-we, mil-t[e], staet in sî-nen wor-ten;\\ner kün-de schrî-ben, le-sen, tich-ten, sei-ten-spil,\\n_ bir-sen, ja-gen, scher-men, schie-zen zuo dem zil;\\nund waere er guot in wâfen ze al-len or-ten;\\nkün-de er mit be-hen-di-cheit\\ndiu swar-zen buoch, ouch kunst der gra-ma-zî-en\\nund waere in sin-nen wol be-reti\\n[ze] doe-nen, sin-gen al-le stam-pe-nî-en;\\nund wur-f[e] er den blî-den-stein\\nwol zwelf schuo lanc vor al-len sî-nen sel-len,\\ndâ mite er kae-me des in ein,\\ndaz er ei-nen wil-den be-ren kün-de vel-len;\\nund al-le vrou-wen teil-ten im [ir] gruoz zuo [hô-hem din-ge];\\nhae-te er der si-ben kün-ste hort,\\nwî-se un-de wort_–\\ndaz waere vil gar an im ver-lo-ren, haete er nicht pfen-nin-ge.\\n\\n_ Es-to, quot ex-per-tus sis in tri-vi-o\\net in-da-ga-tor cer-tus in qua-dri-vi-o;\\nsi be-ne re-do-les the-o-lo-gy-am,\\nSi na-tu-ra-lis fu-e-ris ut phi-si-cus\\net ma-nu-a-lis cu-ra-tor ut me-di-cus,\\nsi be-ne re-co-les ni-gro-man-ci-am,\\nIn me-tal-lo-rum ge-ne-re\\nsub-ti-li-or si ma-nes al-chi-mis-ta,\\nin me-mo-ri-e vo-me-re\\nha-bi-li-or et doc-ci-or le-gis-ta,\\nsi fu-e-ris cau-si-di-cus\\npe-ro-rans in ca-no-ni-co i-u-re,\\ni-us-tus et ve-ri-di-cus,\\npo-tens in _ _ _ or-di-ne na-tu-re,\\nin om-ni-bus sci-en-ci-is si sis ma-gis-ter sum-mus,\\nil-lud i-u-ro cer-tis-si-mis\\n_ sen-ten-ci-is:\\nhoc to-tum nau-ci pro-de-rit, si ti-bi de-est num-mus\"]', '[\"Korrekturen #\\n\",\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"\", \"custos\": \"[null,1,null,5,null,4,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\":