(2095, 'Je n\'ai pas droite ocoison', 'Linker 41.5', 'Colart le Boutellier', 'French', 'a', '70r', 1, 1, '[\"F3 C C E G G F GE\\nC \'F3 C E G G F GFED C\\nC C E \'F3 G G F GE\\nC C E G \'F3 F F GFED C\\nE E(D) C DE \'F3 G G aGF G\\na h a aG F Gah aG \'\\nF3 E G a aG F E(F) ED\\nF F G \'F3 G a GFE D\\nC G GFED DC\",\"F3 C C E G G F GE \'C\\nF3 C E G G F GFED C \'C C E\\nF3 G G F GE \'C C E G\\nF3 F F GFED C \'E E(D) C DE\\nF3 G G aGF G \'a h a aG F Gah aG \'\\nF3 E G a aG F E(F) ED \'F F G\\nF3 G a GFE D \'C G GFED DC\"]', '[\"Je n\'ai pas droi-te_o-coi-son\\nde fai-re can-chon jo-li-e,\\ncar on-ques n\'oi guer-re-don\\nde chan-ter jour de ma vi-e.\\nMais pour che ne lai-rai mi-e\\na ser-vir sans tra-i-son\\nma da-me, qui par rai-son\\nde-üst bien a-voir mer-chi\\nde son a-mi.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0147\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2096, 'Che c\'on aprent en enfance', 'Linker 41.3', 'Colart le Boutellier', 'French', 'a', '70v', 1, 1, '[\"C3 h d c ha G Ga h h \'\\nC2 h(a) aGF G ah c(h) haG G\\nh d \'C2 c ha G Ga h h\\nh(a) aGF G ah \'C2 c(h) haG G\\nh d c h(a)h(a) GF \'C2 Ga h\\ne f ed ch Ga c d d \'\\nC2 d c d hG ha aG GF-E\\nF G \'C2 FG a ha aG a\\nd c d hG \'C2 ha aG GF\",\"C3 h d c ha G Ga h h \'\\nC2 h(a) aGF G ah c(h) haG G \'h d\\nC2 c ha G Ga h h \'h(a) aGF G ah\\nC2 c(h) haG G \'h d c h(a)h(a) GF\\nC2 Ga h \'e f ed ch Ga c d d \'\\nC2 d c d hG ha aG GF-E \'F G\\nC2 FG a ha aG a \'d c d hG\\nC2 ha aG GF\"]', '[\"Che c\'on a-prent en en-fan-ce\\nlais-se l\'on mult a en-vis;\\npour c\'hai je bo-ne_es-pe-ran-che\\nd\'a-mer loi-au-ment tou dis,\\ncar mult joue-nes l\'en-ter-pis;\\ns\'en ai es-mai et dou-tan-che\\ncar che-le_ou j\'ai ma fran-che\\nne fait pas, che m\'est a-vis,\\nchou que si oeil m\'ont pra-mis.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0148\", \"custos\": \"[null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2097, 'Aucune gens mult m\'ont repris', 'Linker 41.2', 'Colart le Boutellier', 'French', 'a', '70v-71r', 1, 1, '[\"F3 C D E F(E) D C \'F3 CD D\\nF Ga G EC D FED C \'F3 D\\nC D E F(E) D C CD D \'\\nF3 F Ga G EC D FED C D\\nD \'F3 a G hcd ch a(h) aG a\\nDE G \'F3 a GFE Ga GF ED DC\\na(G) FED DE G Ga \'F3 G FED C\\nE GFGa G EC DE \'F2 F EDC D\",\"F3 C D E F(E) D C\\nF3 CD D \'F Ga G EC D FED C\\nF3 D \'C D E F(E) D C CD D \'\\nF3 F Ga G EC D FED C D \'D\\nF3 a G hcd ch a(h) aG a \'DE G\\nF3 a GFE Ga GF ED DC \'a(G) FED DE G Ga\\nF3 G FED C \'E GFGa G EC DE\\nF2 F EDC D\"]', '[\"Au-cu-ne gens mult m\'ont re-pris\\nde chou que piech\' a ne chan-tai,\\net dï-ent que cuers m\'est fail-lis;\\nmais je les en des-men-ti-rai,\\ncar ain mais n\'oi le cuer si gai\\ncon j\'ai o-re, ne si es-pris\\nd\'a-mer da-me de si haut pris,\\nen qui tout les biens du mont sai.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0148\", \"custos\": \"[null,null,null,null,null,null,null,null,null]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58),
(2099, 'Merveille est que de chanter', 'Linker 41.9', 'Colart le Boutellier', 'French', 'a', '71r-71v', 1, 1, '[\"\",\"\"]', '[\"Merveille_est que de chan-ter\\neuc on-ques nul jour ta-lent,\\ncar nus ne por-roit pen-ser\\nla do-lour que mes cors sent.\\nHe las, ch\'est por loi-au-ment\\nser-vir et pour bien a-mer;\\nmais trop se fe-ra blas-mer\\nma dame, s\'a tel tour-ment\\nmis fait ma joi-e fi-ner.\"]', '[\"\"]', '{\"Link\": \"\", \"Plica\": false, \"IIIFid\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/canvas/p0149\", \"custos\": \"[]\", \"Alphabetic\": \"0\", \"CarryBFlat\": true, \"LineNumber\": true, \"OctaveClef\": false, \"AllowResize\": true, \"Annotations\": true, \"FontSizeOld\": \"17\", \"TextFontOld\": \"1\", \"IIIFManifest\": \"https://digi.vatlib.it/iiif/MSS_Reg.lat.1490/manifest.json\", \"MsLineBreaks\": true, \"NotationType\": \"0\", \"SyncModernOld\": true, \"ZoomFacsimile\": 170, \"FontSizeModern\": \"19\", \"TextFontModern\": \"1\", \"MelodicStructure\": true, \"RepetitionPattern\": \"\", \"CarriedBFlatBrackets\": true, \"ManualMelodicStructure\": \"\", \"BFlatAlwaysInKeySignature\": false, \"UseManualMelodicStructure\": 0}', 1, 58);
